import{_ as g,o as t,c as n,a as i,t as u,C as _,M as h,U as k,f as p,F as w,p as b,e as v,q as f}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(D,[["render",x],["__scopeId","data-v-cfb927d4"]]),P=JSON.parse(`[{"page_url":"https://vi.wikipedia.org/wiki/Caladenia_catenata","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Caladenia_catenata_-_Flickr_003.jpg","page_title":"Caladenia catenata","context_page_description":"Caladenia catenata là một loài thực vật có hoa trong họ Lan. Loài này được Druce mô tả khoa học đầu tiên năm 1917."},{"page_url":"https://ca.wikipedia.org/wiki/Canals_de_l%27Urgellet","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Canal_de_l%27Olla_i_Segalers.JPG","page_title":"Canals de l'Urgellet","context_page_description":"Els canals de l'Urgellet són una sèrie de canals i/o canals de rec independents de les planes de la Seu i de l'Urgellet, els quals alguns destaquen per la seva antiguitat com el de l'Olla i Segalers, el del Pla, el del Salit, i el dels Quatre Pobles. També destaca el canal del Parc Olímpic del Segre per ser l'únic construït per motius esportius.\\nAltres recs d'importància són el de Sant Pere, el del Molí i el de Leucata. Els canals de regadiu tenen en comú una antiguitat superior als 50 anys, en alguns casos centenaria, per aquesta raó el seu funcionament és pel mecanisme de pendent, tot i que algunes finques han incorporat mecanismes d'impulsió i elevació. La majoria de canals prenen l'aigua del riu Segre, tant a l'esquerra com a la dreta, i alguns del riu Valira."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D8%AC%D8%A7%D9%BE%D8%A7%D9%86%D8%A7%D9%87%D8%A7%D9%84%DB%8C,_%D9%85%D8%A7%D9%84%D9%88%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/KarnatakaKolar.png","page_title":"آجاپاناهالی, مالور","context_page_description":"آجاپاناهالی, مالور هیندوستان اؤلکه‌سینین کارناتاکا ایالتینده بیر کند دیر. بۇ کنده کانادا دیلی دانیشیلیر."},{"page_url":"https://vi.wikipedia.org/wiki/Colotis_evenina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Common_Orange_Tip_%28Colotis_evenina%29_female_%2832718355393%29.jpg","page_title":"Colotis evenina","context_page_description":"The Common orange tip là một loài bướm thuộc họ Pieridae. Nó được tìm thấy ở Afrotropic ecozone.\\nSải cánh dài 38–45 mm in males and 35–42 mm in females. The adults have fly year-round.\\nThe larva feed on Boscia albitrunca and Capparis species."},{"page_url":"https://de.wikipedia.org/wiki/1918","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Heinrich_Mann_Der_Untertan_%281918%29.jpg","page_title":"1918","context_page_description":"Das Jahr 1918 markiert das Ende des Ersten Weltkrieges. Dadurch zerfallen auch viele europäische Monarchien."},{"page_url":"https://nl.wikipedia.org/wiki/Yoann_Gourcuff","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Colori_di_Lione.png","page_title":"Yoann Gourcuff","context_page_description":"Yoann Gourcuff is een Frans betaald voetballer die doorgaans op het middenveld speelt. In augustus 2008 debuteerde hij in het Frans voetbalelftal."},{"page_url":"https://oc.wikipedia.org/wiki/Luiz_In%C3%A1cio_Lula_da_Silva","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Luiz_In%C3%A1cio_Lula_da_Silva.jpg","page_title":"Luiz Inácio Lula da Silva","context_page_description":"Luiz Inácio Lula da Silva, conegut popularament jos l'escais Lula es un politician e èx-trabalhador d'industria brasilian. Foguèt elegit president de Brasil lo primièr còp en octobre 2002, contra José Serra, candidat del president Fernando Henrique Cardoso. Comencèt son primièr mandat lo 1èr de genièr de 2003, e acabèt lo segond lo 31 de decembre de 2010."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%87%E1%80%AC%E1%80%98%E1%80%AD%E1%80%AF%E1%80%84%E1%80%BA%E1%80%82%E1%80%BB%E1%80%94%E1%80%BA%E1%80%94%E1%80%AD%E1%80%AF%E1%80%84%E1%80%BA%E1%80%84%E1%80%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Azerbaijan_%28orthographic_projection%29.png","page_title":"အဇာဘိုင်ဂျန်နိုင်ငံ","context_page_description":"အဇာဘိုင်ဂျန်နိုင်ငံ၏ တရားဝင်အမည်မှာ အဇာဘိုင်ဂျန် သမ္မတနိုင်ငံဖြစ်သည်။ ယူရေးရှား ဒေသတွင် အကြီးဆုံးတိုင်းပြည်ဖြစ်သည်။ အရှေ့ဥရောပ နှင့် အနောက်တောင်အာရှကြား တွင် တည်ရှိသည်။ အရှေ့ဘက်တွင် ကက်စပီယန်ပင်လယ်၊ မြောက်ဘက်တွင် ရုရှားနိုင်ငံ၊ အနောက်မြောက်ဘက်တွင် ဂျော်ဂျီယာနိုင်ငံ၊ အနောက်ဘက်တွင် အာမေးနီးယားနိုင်ငံ၊ တောင်ဘက်တွင် အီရန်နိုင်ငံ တို့နှင့် နယ်နိမိတ်ချင်း ထိစပ်လျှက်ရှိသည်။\\nနက်ချီဗန် ဒေသကို မြောက်ဘက်နှင့်အရှေ့ဘက်တွင် အာမေးနီးယား၊ တောင်ဘက်နှင့် အနောက်ဘက်တွင် အီရန် တို့ကဝန်းရံလျှက်ရှိသည်။ ကာကီ ၊ Yuxarı Əskipara, Barxudarlı နှင့် Sofulu ဒေသများကို အာမေးနီးယားနိုင်ငံက ဝန်းရံလျှက်ရှိပြီး နာဂိုမို-ကရာဘက်စစ်ပွဲကာလမှစ၍ အာမေးနီးယားနိုင်ငံက ထိန်းချုပ်ထားသည်။ အာမေးနီးယားလူမျိုး အများစုနေထိုင်ရာဒေသဖြစ်သော နာဂိုမို-ကရာဘက်ဒေသသည် အဇာဘိုင်ဂျန်လက်အောက်မှ လွတ်မြောက်ကြောင်း ၁၉၉၁ တွင် လွတ်လပ်ရေးကြေညာခဲ့သည်။ သို့ရာတွင် မည်သည့်နိုင်ငံကမျှအသိအမှတ်မပြုပဲ ယခုထက်တိုင် အဇာဘိုင်ဂျန်နိုင်ငံ၏ ဒေသတစ်ခုအဖြစ်သာ အသိအမှတ်ပြုထားကြဆဲဖြစ်သည်။ ထိုဒေသတွင် အာမေးနီးယားစစ်တပ်က သိမ်းပိုက်ထားလျှက်ရှိသည်။\\nအဇာဘိုင်ဂျန်သည် မူဆလင်ကမ္ဘာတွင် ပထမဦးဆုံး အောင်မြင်စွာဖြင့် ဒီမိုကရေစီ သမ္မတနိုင်ငံစနစ်ကို စတင်တည်ထောင်နိုင်ခဲ့သော နိုင်ငံဖြစ်သည်။"},{"page_url":"https://fy.wikipedia.org/wiki/Richard_Doll","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Richard_Doll.jpg","page_title":"Richard Doll","context_page_description":"Professor Sir William Richard Shaboe Doll wie in Britsk epidemiolooch.\\nDoll wie ien fan de earsten dy't bewiisde dat it smoken fan tabak longkanker feroarsaket en it risiko op hert- en fetsykten fergruttet. Yn de jierren fjirtich naam longkanker bot ta. Mun miende doe yn it generaal dat dat fan it asfaltearjen fan wegen, útlitgassen en Röntgenapparatuer kaam. Yn 1948 die Doll in case-control stúdzje nei longkanker. It die bliken dat smoke de wichtichste oarsaak fan longkanker wie, en dat it risiko op longkanker bot grutter waard mei it tal sigaretten dat smookt waard. Hy hâlde doe sels op mei smoken.\\nDe earste jierren waard syn ûndersyk amper leaud, hoewol't de Amerikaan Wynder en de Nederlanner W.F. Wassink te ferlykjen resultaten publisearren. Letter die bliken dat it ferbân tusken smoken en longkanker al yn 1943 troch ûnder oaren de nazi-artsen Schairer en Schöniger ûntdutsen wie.\\nYn 1954 sette Richard Doll de British Doctors Study op. Dy prospektive kohort-stúdzje liet nochris sjen dat smoken grif longkanker feroarsaakje kin.\\nDoll hat ek paadsljochtsjend ûndersyk dien nei it ferbân tusken radioaktive strieling en leukemy, en dat tusken asbest en kanker."},{"page_url":"https://ms.wikipedia.org/wiki/El_Puerto_de_Santa_Mar%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Vaporcito_de_El_Puerto_2009-12-27.jpg","page_title":"El Puerto de Santa María","context_page_description":"El Puerto de Santa María ialah sebuah perbandaran di wilayah Cádiz, Andalusia, Sepanyol."},{"page_url":"https://sv.wikipedia.org/wiki/Friedrich_Wilken","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Friedrich_Wilken.JPG","page_title":"Friedrich Wilken","context_page_description":"Friedrich Wilken, född 23 maj 1777 i Ratzeburg, död 24 december 1840 i Berlin, var en tysk historiker och orientalist.\\nWilken blev 1805 professor i historia och orientaliska språk vid universitetet i Heidelberg och 1808 tillika chef för biblioteket där. År 1817 utnämndes han till professor och direktor vid Berlins universitet och 1821 till preussisk historiograf. Hans skrifter behandlar huvudsakligen persiska språket och Orientens historia."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Vittoria_(Tornareccio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Volta_chiesa_Santa_Vittoria_Tornareccio.JPG","page_title":"Chiesa di Santa Vittoria (Tornareccio)","context_page_description":"La chiesa parrocchiale di Santa Vittoria Vergine è sita a Tornareccio in provincia di Chieti."},{"page_url":"https://hr.wikipedia.org/wiki/Samostan_Svete_Katarine_na_Sinaju","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/St_CatherinesPanorama.JPG","page_title":"Samostan Svete Katarine na Sinaju","context_page_description":"Samostan Svete Katarine nalazi se na ulazu u klanac planine Sinaj pored grada Sveta Katarina u guvernatu Južni Sinaj. Samostan se nalazi na visini od 1586 metara, u podnožju brda Horeb gdje je prema Starom zavjetu Mojsije primio Deset Božjih zapovjedi. Cijelo ovo područje je sveto trima svjetskim vjerama: kršćanstvu, islamu i judaizmu. Samostan Svete Katarine je osnovan u 6. stoljeću i jedan je od najstarijih kršćanskih samostana koji još uvijek djeluje. Drugi koji se nadmeće za titulu najstarijeg je također u Egiptu, Samostan Svetog Antuna Pustinjaka, koji se nalazi s druge strane Crvenog mora, u pustinji južno od Kaira.\\nZbog toga je 2002. godine upisan na UNESCO-v popis mjesta svjetske baštine u Africi, između ostalog i zbog svojih \\"bizantskih zidina i samostanskih građevina u kojima se nalazi izvanredna kolekcija ranih kršćanskih iluminiranih rukopisa i ikona, sve uokvireno grubim planinskim krajolikom u kojemu se nalaze brojni arheološki i vjerski lokaliteti i spomenici\\"."},{"page_url":"https://ca.wikipedia.org/wiki/Illa_del_Diable","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Vue_de_l%27%C3%AEle_du_Diable.jpg","page_title":"Illa del Diable","context_page_description":"L'Illa del Diable és l'illa més petita de les tres Illes de la Salvació, localitzada a 11 km de la costa de Guaiana Francesa. Té una àrea de 14 hectàrees. Les seves coordenades geogràfiques són: 5° 17′ N, 52° 35′ W.\\nL'illa va ser utilitzada com una colònia penal francesa, molt famosa per la brutalitat amb la que eren tractats els presoners. L'illa és rocosa i està coberta de selva tropical. Té una altitud mitjana de 40 metres sobre el nivell del mar. El penal fou obert en 1851 per Napoleó III, destinat a tota mena de presoners, des d'assassins a criminals polítics. A pesar que els edificis administratius es trobaven a Kourou, a terra ferma, amb el temps tot el complex va ser anomenat \\"L'Illa del Diable\\".\\nDes de 1852 fins a 1938 hi van arribar més de 80.000 presoners, i a causa de les terribles condicions sanitàries de l'illa, la majoria mai en van sortir. L'única forma d'escapar era per barca, i després s'havia de superar una selva impenetrable, pel que no se sap quants convictes en van aconseguir escapar."},{"page_url":"https://sv.wikipedia.org/wiki/Huset_Savojens_residens","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/CastelloRivoli.JPG","page_title":"Huset Savojens residens","context_page_description":"Huset Savojens residens är en grupp byggnader i staden Turin och dess provins Torino i Piemonte i norra Italien som 1997 blev ett världsarv.\\nVärldsarvet omfattar följande byggnader:"},{"page_url":"https://sv.wikipedia.org/wiki/Hypericum_juniperinum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Hypericum_juniperinum_2.jpg","page_title":"Hypericum juniperinum","context_page_description":"Hypericum juniperinum är en johannesörtsväxtart som först beskrevs av Carl von Linné d.y., och fick sitt nu gällande namn av Carl Sigismund Kunth. Hypericum juniperinum ingår i släktet johannesörter, och familjen johannesörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_%C5%9Bwiatowego_dziedzictwa_UNESCO_w_Turcji","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Alanya_Castle.jpeg","page_title":"Lista światowego dziedzictwa UNESCO w Turcji","context_page_description":"Lista światowego dziedzictwa UNESCO w Turcji – lista miejsc w Turcji wpisanych na listę światowego dziedzictwa UNESCO, ustanowionej na mocy Konwencji w sprawie ochrony światowego dziedzictwa kulturowego i naturalnego, przyjętej przez UNESCO na 17. sesji w Paryżu 16 listopada 1972 i ratyfikowanej przez Turcję 16 marca 1983 roku.\\nObecnie na liście znajdują się 18 obiektów: 16 dziedzictwa kulturowego i 2 o charakterze kulturowo–przyrodniczym.\\nNa tureckiej liście informacyjnej UNESCO – liście obiektów, które Turcja zamierza rozpatrzyć do zgłoszenia do wpisu na listę światowego dziedzictwa, znajdują się 78 obiekty."},{"page_url":"https://fr.wikipedia.org/wiki/Bertrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/L%27eglise_de_Jehonville_%28Bertrix%29_P7200068.JPG","page_title":"Bertrix","context_page_description":"Bertrix est une Ville francophone de Belgique située en Région wallonne dans la province de Luxembourg et l’arrondissement de Neufchâteau, ainsi qu’une localité où siège son administration. Elle compte environ 8 000 habitants."},{"page_url":"https://fi.wikipedia.org/wiki/Anthony_Dawson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Anthony_Dawson_%28Death_Rides_a_Horse%29.jpg","page_title":"Anthony Dawson","context_page_description":"Anthony Dawson oli skotlantilainen näyttelijä. Hän näytteli elokuvassa ensimmäisen kerran vuonna 1943.\\n1960-luvulla hän näytteli Pyhimys-sarjassa Floyd Vosperia. Hän esiintyi myös kolmessa James Bond -elokuvassa. Salainen agentti 007 ja tohtori No -elokuvassa hän esitti professori Dentiä ja elokuvissa Salainen agentti 007 Istanbulissa ja Pallosalama hän esitti Ernst Stavro Blofeldia. Hänen kasvojaan ei kuitenkaan näytetty kummassakaan eikä hän esiintynyt omalla äänellään, vaan Blofeldin äänenä oli tuolloin Eric Pohlmann."},{"page_url":"https://vi.wikipedia.org/wiki/Melica_nutans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Melica_nutans.jpg","page_title":"Melica nutans","context_page_description":"Melica nutans là một loài thực vật có hoa trong họ Hòa thảo. Loài này được L. mô tả khoa học đầu tiên năm 1753."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Micha%C5%82a_Archanio%C5%82a_w_Sanoku","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/0241_Baptistal_font_15th_c._Church_of_the_Archangel_Michael_in_Sanok.JPG","page_title":"Kościół św. Michała Archanioła w Sanoku","context_page_description":"Kościół pw. św. Michała Archanioła w Sanoku – nieistniejący rzymskokatolicki kościół parafialny w Sanoku.\\nBył umiejscowiony na tzw. małym rynku stanowiącym obecnie plac św. Michała. Początki świątyni sięgają czasów panowania księcia Bolesława. Świątynię pw. Świętego Michała Archanioła ufundował Kazimierz III Wielki. Ludność nieruska musiała być liczna w Sanoku w drugiej połowie XIV w., na co może wskazywać istnienie kościołów katolickich w tym czasie.\\nNastępny kościół powstał z fundacji Władysława II Jagiełły, który poślubił w nim Elżbietę Granowską 2 maja 1417. Przy parafii wzmiankowana jest szkoła parafialna z 1380 roku oraz prawdopodobnie jej pierwszy przełożony „Marcus rector scholae”.\\nW 1485 roku założony został szpital dla ubogich na przedmieściach miasta z ich własnym murowanym kościołem pod wezwaniem Błogosławionej Dziewicy Marii.\\nProboszczem był tu m.in. kompozytor Sebastian z Felsztyna. Przykościelną szkołę kończył w tym mieście biskup Grzegorz z Sanoka oraz Jan Grodek rektor UJ. Po śmierci Zygmunta I przebywała w Sanoku królowa Bona, która kościół parafialny przebudowała i ozdobiła."},{"page_url":"https://eu.wikipedia.org/wiki/Dezhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Dezhou6.jpg","page_title":"Dezhou","context_page_description":"Dezhou, Shandong probintzian kokatutako prefektura mailako hiria da. Guztira, 5.452.000 biztanle inguru dauzka 2007ko erroldaren arabera eta 10.356,3 kilometro koadroko azalera."},{"page_url":"https://lt.wikipedia.org/wiki/Bismarkas_(karo_laivas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/British_Battlecruiser_HMS_Hood_circa_1932.jpg","page_title":"Bismarkas (karo laivas)","context_page_description":"„Bismarkas“ – vienas iš žinomiausių Antrojo pasaulinio karo laivų, pavadintas Vokietijos kanclerio, pirmojo Vokietijos Reicho architekto, Otto von Bismarck garbei. Pradėtas statyti 1936 m. Hanoveryje, visiškai užbaigtas 1940 m. 1941 m., po įnirtingų mūšių su britų Karališkuoju laivynu, laivas nuskendo, nusinešdamas per 1800 įgulos gyvybių. Nuskendusios nuolaužos buvo rastos 1989 m. žymaus tyrinėtojo Roberto Balardo ekspedicijos metu."},{"page_url":"https://eu.wikipedia.org/wiki/Sibynophis_chinensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Chinese_Mountain_Snake_%28Sibynophis_chinensis%29_%E9%BB%91%E9%A0%AD%E5%8A%8D%E8%9B%874.jpg","page_title":"Sibynophis chinensis","context_page_description":"Sibynophis chinensis Sibynophis generoko animalia da. Narrastien barruko Colubridae familian sailkatuta dago."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D1%84%D0%BE%D1%80%D1%82,_%D0%9C%D0%B0%D1%80%D0%B8_%D0%9C%D0%B0%D0%B4%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Marie_Lefort_age_16.jpg","page_title":"Лефорт, Мари Мадлен","context_page_description":"Мари Мадлен Лефорт интерсекс-человек, которому при рождении был приписан женский пол, впоследствии сменивший его на мужской. Его случай описывался в медицинской литературе, где ему был поставлен диагноз псевдогермафродитизм."},{"page_url":"https://de.wikipedia.org/wiki/Verwaltungsgeb%C3%A4ude_der_Rh%C3%A4tischen_Bahn_(Chur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Chur_Verwaltungsgeb%C3%A4ude_RhB_1931.jpg","page_title":"Verwaltungsgebäude der Rhätischen Bahn (Chur)","context_page_description":"Das Verwaltungsgebäude der Rhätischen Bahn in der Bündner Kantonshauptstadt Chur ist ein unter eidgenössischem und kantonalem Denkmalschutz stehender Bau. Er wird geführt in der Liste der Kulturgüter von nationaler Bedeutung im Kanton Graubünden."},{"page_url":"https://sv.wikipedia.org/wiki/Walkhampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Walkhampton_parish_church_2.jpg","page_title":"Walkhampton","context_page_description":"Walkhampton är en by och en civil parish i West Devon i Devon i England. Orten har 803 invånare. Byn nämndes i Domedagsboken år 1086, och kallades då Wachetone/Wachetona."},{"page_url":"https://nl.wikipedia.org/wiki/Dermestoides_sanguinicollis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Dermestoides.sanguinicollis.-.calwer.28.14.jpg","page_title":"Dermestoides sanguinicollis","context_page_description":"Dermestoides sanguinicollis is een keversoort uit de familie mierkevers. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1782 door Fabricius."},{"page_url":"https://en.wikipedia.org/wiki/Nagpur","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Seminary_Hill.jpg","page_title":"Nagpur","context_page_description":"Nagpur is the third largest city and the winter capital of the Indian state of Maharashtra. It is the 13th largest city in India by population and according to an Oxford Economics report, Nagpur is projected to be the fifth fastest growing city in the world from 2019 to 2035 with an average growth of 8.41%. It has been proposed as one of the Smart Cities in Maharashtra and is one of the top ten cities in India in Smart City Project execution.\\nNagpur is the seat of the annual winter session of the Maharashtra state assembly. It is a major commercial and political centre of the Vidarbha region of Maharashtra. In addition, the city derives unique importance from being an important location for the Dalit Buddhist movement and the headquarters for the Hindu nationalist organisation RSS. Nagpur is also known for the Deekshabhoomi, which is graded an A-class tourism and pilgrimage site, the largest hollow stupa among all the Buddhist stupas in the world.\\nAccording to a survey by ABP News-Ipsos, Nagpur was identified as the best city in India topping in livability, greenery, public transport, and health care indices in 2013."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_bandar_di_Uruguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Montevideo_Uruguay.jpg","page_title":"Senarai bandar di Uruguay","context_page_description":"Ini adalah sebuah senarai bandar dan pekan di Uruguay:"},{"page_url":"https://en.wikipedia.org/wiki/Carmela_Carvajal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Carmela_carvajal.JPG","page_title":"Carmela Carvajal","context_page_description":"Carmela Carvajal was the wife of Arturo Prat Chacón."},{"page_url":"https://sv.wikipedia.org/wiki/Friedrichstadt-Palast","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Friedrichstadtpalast_at_night_01.jpg","page_title":"Friedrichstadt-Palast","context_page_description":"Friedrichstadt-Palast är en revyteater och ett nöjespalats i stadsdelen Mitte i Berlin. Friedrichstadt-Palasts stora sal har 1 895 sittplatser och har en spelyta på 2 854 kvadratmeter."},{"page_url":"https://it.wikipedia.org/wiki/Coro_della_cattedrale_di_Santa_Maria_del_Fiore","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Firenze%2C_cattedrale_metropolitana_di_Santa_Maria_del_Fiore_-_Cattedra.jpg","page_title":"Coro della cattedrale di Santa Maria del Fiore","context_page_description":"Il coro della cattedrale di Santa Maria del Fiore, comunemente anche chiamato nell'ambito della cattedrale l'ottagono per antonomasia, è situato al di sotto della cupola del Brunelleschi e costituisce l'area presbiterale del tempio, che accoglie l'altare maggiore e la cattedra arcivescovile.\\nRealizzato su progetto di Baccio Bandinelli e di Giuliano di Baccio d'Agnolo tra il 1547 e il 1572 in luogo di uno costruito nel 1520 da Nanni Unghero e Domenico di Francesco Baccelli, che a sua volta ne sostituiva uno più antico opera di Filippo Brunelleschi e risalente al 1437-1439, nel corso dei secoli il coro è stato oggetto di diverse modifiche e alterazioni che l'hanno portato all'attuale conformazione."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D9%8A%D9%86%D8%AA_%D8%A8%D8%B1%D9%8A%D8%B1%D9%8A_(%D9%83%D9%8A%D8%A8%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Saint-Pierre_Quebec_location_diagram.png","page_title":"ساينت بريري (كيبك)","context_page_description":"ساينت بريري ‏ هي local municipality of Quebec تقع في كندا في Lanaudière. يقدر عدد سكانها بـ 305 نسمة ومساحتها 10.10 كم²."},{"page_url":"https://it.wikipedia.org/wiki/Passo_della_Raticosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Raticosadamtbeni-pietramala.jpg","page_title":"Passo della Raticosa","context_page_description":"Il passo della Raticosa è un valico dell'Appennino tosco-emiliano posto ad un'altitudine di 968 m s.l.m. È ubicato in provincia di Firenze, nel comune di Firenzuola, lungo la ex strada statale 65 della Futa. Durante la seconda guerra mondiale fu presidiato dalla linea difensiva tedesca denominata Linea gotica.\\nIl suo complesso montuoso comprende alcuni rilievi, tra cui il colle di Canda, monte Canda e monte Oggioli; da quest'ultimo nasce l'Idice, un importante torrente emiliano affluente del Reno.\\nRappresenta un punto nodale di discreta importanza nel sistema viario ordinario tra Bologna e Firenze: dal poggio che segna la sommità del passo diparte infatti verso nord - oltre alla ex SS65 della Futa in direzione Bologna - la strada provinciale che discende la valle del torrente Sillaro, che dopo pochi chilometri si biforca, per discendere - oltre al corso d'acqua sopra citato - la valle dell'Idice. Proseguendo, invece, lungo la ex SS65 in direzione sud si raggiunge il vicino passo della Futa, posto sullo spartiacque appenninico."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Cholet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Maine-et-Loire_-_Cholet_arrondissement.svg","page_title":"Distrito de Cholet","context_page_description":"El distrito de Cholet es un distrito de Francia, que se localiza en el département Maine y Loira, de la région Países del Loira. Cuenta con 9 cantones y 78 comunas.\\nLa capital de un departamento se llama subprefectura. Cuando un departamento contiene la prefectura del departamento, esa prefectura es la capital del distrito, y se comporta tanto como una prefectura como una subprefectura."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D0%BB%D0%B5%D0%BD_%D0%BA%D0%B0%D0%BD%D1%86%D0%BB%D0%B5%D1%80_(%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Angela_Merkel_2019_%28cropped%29.jpg","page_title":"Федерален канцлер (Германия)","context_page_description":"Федералният канцлер на Германия е ръководителят на правителството във Федерална република Германия, избиран от Бундестага.\\nКанцлерът формира правителството и ръководната линия на политиката му. По протокол се нарежда трети след президента и председателя на Бундестага. След 1949 г. това е най-високата длъжност в изпълнителната власт на Германия.\\nОт 22 ноември 2005 г. настоящ канцлер на Германия е Ангела Меркел. Тя е първата жена, заемаща най-високата правителствена длъжност в страната, има подкрепата на широка коалиция от ХДС/ХСС и СПД в първия, третия и четвъртия си мандат."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A5%E0%B8%B8%E0%B9%88%E0%B8%A1%E0%B9%81%E0%B8%A1%E0%B9%88%E0%B8%99%E0%B9%89%E0%B8%B3%E0%B8%A5%E0%B8%B1%E0%B8%A7%E0%B8%A3%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Montsoreau_Castle.jpg","page_title":"ลุ่มแม่น้ำลัวร์","context_page_description":"ลุ่มแม่น้ำลัวร์ เป็นบริเวณทางตอนกลางค่อนไปทางตะวันตกของฝรั่งเศสที่มีชื่อเสียงเป็นที่รู้จักกันดีจากคุณค่าของสถาปัตยกรรมและเมืองโบราณที่มีความสำคัญทางประวัติศาสตร์ที่รวมทั้งเมืองมงต์โซโร, อองบัวส์, อองแชร์, บลัวส์, ชินง, นานต์ส์, ออร์เลอองส์, โซมัวร์ และ ตูร์ แต่ที่สำคัญคือพระราชวัง, วัง, ปราสาท และึคฤหาสน์ต่างๆ ที่มีชื่อเสียงเลื่องลือไปทั่วโลกที่รวมทั้งพระราชวังชองบอร์ด หรือ วังเชอนงโซซื่งเป็นสถาปัตยกรรมที่สะท้อนให้เห็นถึงความรุ่งเรืองทางวัฒนธรรมของฝรั่งเศสในยุคฟื้นฟูศิลปวิทยาและยุคเรืองปัญญาที่มีต่อการออกแบบและการสร้างสถาปัตยกรรม\\nในปี ค.ศ. 2000 องค์การยูเนสโกขึ้นทะเบียนบริเวณตอนกลางของลุ่มแม่น้ำลัวร์ระหว่างแมน และ ซุลลีย์-เซอร์-ลัวร์ให้เป็นมรดกโลก ในการเลือกภูมิภาคลุ่มแม่น้ำลัวร์ที่ครอบคลุมจังหวัดลัวเรต์, ลัว-เรต์-แชร์, แองดร์-เอต์-ลัวร์, and แมน-เนต์-ลัวร์ ทางคณะกรรมการกล่าวถึงภูมิภาคลุ่มแม่น้ำลัวร์ว่าเป็นบริเวณที่ “มีความงามของภูมิทัศน์ทางวัฒนธรรมอันเด่น, และมีความสวยงามอันเลอเลิศที่ประกอบด้วยเมืองและหมู่บ้านสำคัญในประวัติศาสตร์, อนุสรณ์ทางสถาปัตยกรรมอันสำคัญ - ชาโต - และแผ่นดินที่ได้รับการพัฒนาทางการเกษตรกรรมและเปลี่ยนแปลงที่เกิดจากความสัมพันธ์ระหว่างผู้ตั้งถิ่นฐานในท้องถิ่นและสิ่งแวดล้อมรอบข้าง โดยเฉพาะตัวแม่น้ำลัวร์เอง”"},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_Katowice","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Pyrzowice_-_terminal_B.jpg","page_title":"Flughafen Katowice","context_page_description":"Der Internationale Flughafen Katowice ist der internationale Flughafen der polnischen Großstadt Katowice, der Hauptstadt der Woiwodschaft Schlesien. Er ist der nach Fluggästen viertgrößte Flughafen des Landes.\\nDer Flughafen erschließt vor allem die Städte des Oberschlesischen Industriegebiets und andere Kreise der Woiwodschaft Schlesien, die die am dichtesten besiedelten Gebiete des Landes sind."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_na_Vinohradech","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Vila_Hrade%C5%A1%C3%ADnsk%C3%A1_1542-6_%28Vinohrady%29_2012-09-15_15-41-45.jpg","page_title":"Seznam kulturních památek na Vinohradech","context_page_description":"Tento seznam nemovitých kulturních památek v části Vinohrady v hlavním městě Praze vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nVinohrady, Žižkov a Vršovice jsou od roku 1993 městskou památkovou zónou.\\nStaré Město, Nové Město, Malá Strana, Hradčany, Josefov, Vyšehrad a z malé části Vinohrady, Holešovice, Podolí a Smíchov jsou od roku 1971 jako Pražská památková rezervace městskou památkovou rezervací. Z Vinohrad jsou k rezervaci připojeny zejména Federální shromáždění, Státní opera a Fantova budova hlavního nádraží."},{"page_url":"https://en.wikipedia.org/wiki/Allium_peninsulare","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Alliumpeninsulare.jpg","page_title":"Allium peninsulare","context_page_description":"Allium peninsulare is a North American species of wild onion. It is known by such common names as Mexicali onion and Peninsula onion; the former referring to the Mexican city just south of the US/Mexican border, the latter referring to the Peninsula of Baja California. It is widespread in California, USA, where it grows in the California Coast Ranges, Sierra Nevada foothills, some of the Channel Islands, and Peninsular Ranges. The range extends south into the northernmost part of Baja California and north into southern Oregon."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%90%8D%E5%8F%A4%E5%B1%8B%E3%83%93%E3%83%AB%E3%83%82%E3%83%B3%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Dai_Nagoya_Building_Level_5_Sky_garden_2017.jpg","page_title":"大名古屋ビルヂング","context_page_description":"大名古屋ビルヂングは、愛知県名古屋市中村区名駅三丁目に所在する三菱地所所有のオフィス兼商業ビル。なお、この項では2015年に竣工した2代目ビルに加え、1965年竣工の初代ビルについても記述する。"},{"page_url":"https://vec.wikipedia.org/wiki/Massimo_Boldi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Massimo_Boldi.jpg","page_title":"Massimo Boldi","context_page_description":"Massimo Antonio Boldi xe un ator italian, interprete sopratuto de film comedia e protagonista de vari show comici.\\nTra cinema e tełevixion, l'é stà protagonista fin 'deso de oltre 'na sesantina de produxion.\\nAl cinema, el ga fato par ani copia artistica co l'atore roman Christian De Sica. El ga anca lavorà speso con Teo Teocoli, Maurizio Mattioli, Biagio Izzo, Enzo Salvi e Vincenzo Salemme."},{"page_url":"https://nl.wikipedia.org/wiki/Westernielandstermaar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Pieterbuurstermaar_vanaf_Westernielandstermaar.jpg","page_title":"Westernielandstermaar","context_page_description":"Het Westernielandstermaar of kortweg Nielandstermaar is een maar in het noorden van de landstreek Hogeland in de Nederlandse provincie Groningen. Het maar start vanuit de Pieterbuurstermaar bij de boerderij Fraelemaheerd en stroomt van daaruit in oostnoordoostelijke richting langs de boerderijen Huninga en Zijlbrugge naar de vroegere locatie van de Hiddingezijl bij Westernieland, alwaar tot de jaren 1980 een kolk was gelegen. Voorbij deze plek gaat het Westernielandstermaar over in de Oude Riet, die in de Noordpolder overgaat in het Noordpolderkanaal. In de loop der tijd is het maar op veel plekken gekanaliseerd voor de beurtvaart.\\nVia de Pieterbuurstermaar, de Hoornse Vaart en de Kromme Raken is het Westernielandstermaar verbonden met het Reitdiep. Gedacht wordt dat het Westernielandstermaar een restant is van de oude loop van de Hunze omdat het laatste stuk bedijking in Hunsingo hier plaatsvond in 1350."},{"page_url":"https://de.wikipedia.org/wiki/Huzulen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Polska1930.jpg","page_title":"Huzulen","context_page_description":"Die Huzulen, manchmal auch Hutsul oder Hutzul genannt, sind ein Bergvolk in den Karpaten. Viele Huzulen sehen sich heute als Ukrainer, seit der ukrainischen Unabhängigkeit sind im huzulischen Siedlungsgebiet zahlreiche Denkmäler für den Dichter Taras Schewtschenko errichtet worden. Das Identitätsangebot der russinischen Bewegung wird nur von einigen huzulischstämmigen Intellektuellen genutzt, russinischen Aktivisten gelten die Huzulen als „Abtrünnige“."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%8A%D8%A8%D9%88%DA%86%D8%B3%D8%A7_%D8%A7%D9%8A%D9%84%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Nesa_Ilic.jpg","page_title":"نيبوچسا ايليك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nنيبوچسا ايليك لاعب كرة سله من صيربيا."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Stolperstein_Rosa_Abraham%2C_1%2C_Wi%C3%9Fmannstra%C3%9Fe_13%2C_S%C3%BCdstadt%2C_Hannover.jpg","page_title":"Liste der Stolpersteine in Hannover","context_page_description":"Die Liste der Stolpersteine in Hannover enthält die Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Hannover verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hannover lebten und wirkten. In Hannover wurde seit dem Jahr 2007 bisher 423 Gedenksteine an rund 150 verschiedenen Stellen in der Stadt verlegt.\\nDie 10 cm × 10 cm × 10 cm großen Stolpersteine sind als Betonquader mit Messingtafel in den Bürgersteig vor den Häusern eingelassen, in denen die Opfer ihren – oftmals nicht selbst bestimmten – letzten Wohnsitz hatten. Die Aufschriften informieren über ihren Namen, ihr Alter und ihr Schicksal. Die Steine dienen dem Gedenken an die Opfer der nationalsozialistischen Gewaltherrschaft und den Holocaust."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E9%87%8C%E5%BF%92%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sandro_Botticelli_039.jpg","page_title":"卡里忒斯","context_page_description":"卡里忒斯在希腊神话中是体现人生所有美好事物的美惠三女神，她们代表了真善美，因此也成为了艺术家们歌颂的主题之一。她们的名字和人数随不同地区和时期有许多变化。但在赫西俄德笔下她们有三位，从年轻至年长分别为：\\n阿格莱亚\\n欧佛洛绪涅\\n塔利亚\\n在罗马神话里她们被称为Gratiae。德尔斐附近的赛菲索斯河是她们的圣地。"},{"page_url":"https://id.wikipedia.org/wiki/Christopher_Paolini","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Christopher_Paolini_-_Lucca_Comics_and_Games_2012.JPG","page_title":"Christopher Paolini","context_page_description":"Christopher Paolini adalah penulis buku Eragon. Cinta Christopher Paolini pada fantasi dan fiksi ilmiah menginspirasi dirinya untuk memulai menulis novel pertamanya, Eragon, sewaktu lulus SMU pada usia lima belas tahun sesudah bersekolah dirumah seumur hidupnya. Ia menjadi penulis terlaris New York Times pada usia sembilan belas tahun.\\nChristopher Paolini dibesarkan di Paradise Valley, wilayah Montana. Anggota keluarganya meliputi orang tuanya, Kenneth Paolini dan Talita Hodgkinson dan saudara perempuannya, Angela Paolini.\\nHome schooling sepanjang masa pendidikannya, Paolini lulus dari sekolah menengah atas pada usia 15 tahun melalui pengakuan kursus korespondensi dari American School of Correspondence di Lansing, Illinois. Seusai lulus, dia memulai pekerjaannya yang kemudian akan menjadi seri pertama novel Eragon, berlatar alam mistis Alagaesia.\\nPada 2002, Eragon di terbitkan oleh Paolini Internasional LLC, perusahaan orang tua Paolini."},{"page_url":"https://de.wikipedia.org/wiki/Jan-Hendrik_Pelz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Jan-Hendrik_Pelz%2C_Performance_T%C3%BCrkei_2017.png","page_title":"Jan-Hendrik Pelz","context_page_description":"Jan-Hendrik Pelz ist ein deutscher Künstler in der Malerei, Performance, Konzeptkunst und in der Videokunst."},{"page_url":"https://en.wikipedia.org/wiki/Wadi_El_Natrun","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Macarius_Kloster_BW_1.jpg","page_title":"Wadi El Natrun","context_page_description":"Wadi El Natrun is a depression in northern Egypt that is located 23 m below sea level and 38 m below the Nile River level. The valley contains several alkaline lakes, natron-rich salt deposits, salt marshes and freshwater marshes.\\nIn Christian literature it is usually known as Scetis. It is one of the three early Christian monastic centers located in the Nitrian Desert of the northwestern Nile Delta. The other two monastic centers are Nitria and Kellia. Scetis, now called Wadi El Natrun, is best known today because its ancient monasteries remain in use, unlike Nitria and Kellia which have only archaeological remains. The desertified valley around Scetis in particular may be called the Desert of Scetis."},{"page_url":"https://fi.wikipedia.org/wiki/Pierre_Littbarski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Pierre_Littbarski_2006_%28cropped%29.jpg","page_title":"Pierre Littbarski","context_page_description":"Pierre \\"Litti\\" Littbarski on saksalainen jalkapallovalmentaja ja entinen keskikenttäpelaaja."},{"page_url":"https://sh.wikipedia.org/wiki/%C3%9Abeda","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/OratoriJuanCruzUbeda.jpg","page_title":"Úbeda","context_page_description":"Úbeda je grad u provinciji Jaen španjolske autonomne zajednice Andaluzije. Zajedno sa susjednim gradom Baezom uživao je naklonost bogatih obitelji koje su izgradile brojne renesansne palače i crkve koje su izvrsno sačuvane. God. 2003. njihova povijesna središta su upisana na UNESCO-v popis mjesta svjetske baštine u Europi.\\nÚbeda je jedno od najvažnijih naselja provincije Jaén i središte općine Loma de Úbeda. U njoj se nalazi oblasna bolnica, univerzitet, zgrade lokalne uprave, te općinski sud. Úbeda je poljoprivredno središte pokrajine kao jedan od najvećih proizvođača maslinovog ulja. Malo izvan grada nalazi se park prirode Sierra de Cazorla, Segura y las Villas.\\nSvake godine u svibnju održava se glazbeni i plesni festival koji uključuje jazz, flamenco, te simfonijsku i komornu glazbu."},{"page_url":"https://an.wikipedia.org/wiki/Madridejos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Pendon.jpg","page_title":"Madridejos","context_page_description":"Madridejos ye un municipio d'a provincia de Toledo, en a comunidat autonoma de Castiella-La Mancha, Espanya. A suya población ye de 11030 habitants, en una superficie de 262 km² y una densidat de población de 42,09 hab/km²."},{"page_url":"https://no.wikipedia.org/wiki/VM_i_alpint_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Lindsey_Vonn_Altenmarkt-Zauchensee_2009.jpg","page_title":"VM i alpint 2009","context_page_description":"VM i alpint 2009 ble arrangert i Val-d’Isère i Frankrike fra 3. til 15. februar 2009."},{"page_url":"https://an.wikipedia.org/wiki/Aguilar_del_R%C3%ADo_Alhama","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Contrebia_Leukade_01.JPG","page_title":"Aguilar del Río Alhama","context_page_description":"Aguilar del Río Alhama ye un municipio d'A Riocha situato a lo sudeste d'a comunidat, en a comarca de Cervera.\\nA suya población ye de 573 habitants en una superficie de 54,11 km² y una densidat de población de 10,59 hab/km²."},{"page_url":"https://pl.wikipedia.org/wiki/10_Pu%C5%82k_U%C5%82an%C3%B3w_Litewskich","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Odznaka_10_p.u%C5%82.jpg","page_title":"10 Pułk Ułanów Litewskich","context_page_description":"10 Pułk Ułanów Litewskich – oddział kawalerii Samoobrony Litwy i Białorusi, Wojska Litwy Środkowej i Wojska Polskiego II RP.\\nPułk stacjonował w garnizonie Białystok.\\nWchodził kolejno w skład wielkich jednostek kawalerii: VIII BJ → VIII BK → XVIII BK → BK „Białystok” → Podlaskiej BK.\\nŚwięto pułkowe obchodzono 8 maja, w rocznicę dojścia pułku do Dniepru w 1920."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D8%A8%D8%B1%D8%AA_%D8%AC%D8%A7%D9%83%D8%B3%D9%88%D9%86_(%D9%85%D8%AD%D8%A7%D9%85%D9%89)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Roberthjackson.jpg","page_title":"روبرت جاكسون (محامى)","context_page_description":"روبرت جاكسون كان محامى من امريكا."},{"page_url":"https://en.wikipedia.org/wiki/Glossary_of_gymnastics_terms","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Austrian_Future_Cup_2018-11-23_Training_Afternoon_Parallel_bars_%28Martin_Rulsch%29_0152.jpg","page_title":"Glossary of gymnastics terms","context_page_description":"This is a general glossary of the terms used in the sport of gymnastics."},{"page_url":"https://en.wikipedia.org/wiki/Meitetsu_Nagoya_Main_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/MSN-NH35.png","page_title":"Meitetsu Nagoya Main Line","context_page_description":"The Meitetsu Nagoya Main Line or Nagoya Line is a railway line operated by the private railway operator Nagoya Railroad, connecting Toyohashi Station in Toyohashi with Meitetsu Gifu Station in Gifu.\\nSince its amalgamation in 1944 this has been the Meitetsu main line. Many branch lines of Meitetsu have through services to/from the Nagoya Line. Toyokawa, Nishio, Tokoname, and Inuyama lines all have through services bound for Meitetsu Nagoya, making the segment around that station extremely busy. Between Biwajima Junction and Kanayama, 26 trains proceed per hour, even during off-peak periods. All the stations accept manaca, a smart card.\\nThe line largely parallels the Tōkaidō Main Line in the Chūkyō Metropolitan Area. Local traffic on the Nagoya Line used to be much heavier than on the Tōkaidō Main Line, but since the privatization of the Japanese National Railways, transforming into the Central Japan Railway Company in this area, competition has become more significant in the Chūkyō area.\\nDue to historical reasons, the line shares its track between Hirai Junction and Toyohashi Station with the JR Iida Line."},{"page_url":"https://is.wikipedia.org/wiki/Felicia_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Felicia_Day_by_Gage_Skidmore.jpg","page_title":"Felicia Day","context_page_description":"Felicia Day er bandrísk leikkona, höfundur og framleiðandi sem er þekktust fyrir hlutverk sín í Supernatural, Eureka og The Guild."},{"page_url":"https://no.wikipedia.org/wiki/Valpara%C3%ADso_de_Goi%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Divisa_Distrito_Federal-Goi%C3%A1s.jpg","page_title":"Valparaíso de Goiás","context_page_description":"Valparaíso de Goiás er en kommune i delstaten Goiás i sentral-vestregionen av Brasil."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%A7%D8%AA%D8%A7%D9%86_%D8%B1%D8%A7%D8%B3%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Ga%C3%ABtan_Roussel_2010.jpg","page_title":"گاتان راسل","context_page_description":"گاتان راسل خواننده، آهنگ‌نویس و آهنگ‌ساز فرانسوی است. راسل رهبر پیشین خواننده‌های گروه‌های لوئیس اتکی و تارمک بود.\\nراسل دورهٔ تک‌خوانی را شروع کرد و ضبط یک آلبوم در سال ۲۰۰۹ را آغاز نمود. او نسختین آهنگ تک‌خوانی‌اش، Ginger را در ۱۵ مارس ۲۰۱۰ منتشر کرد. Ginger دو آهنگ، تک‌خوانی اول، Help myself و تک‌خوانی دو، Dis-moi encore que tu m’aimes را در بر داشت."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_monarcas_do_Haiti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Faustin_Wirkus_%28cropped%29.jpg","page_title":"Lista de monarcas do Haiti","context_page_description":"O Haiti foi durante três ocasiões uma monarquia, contrariando o regime republicano ou ditatorial existente desde a proclamação, em 1806. Aqui serão mostradas as três ocasiões em que o Haiti foi uma monarquia, contando sobre os monarcas e procedimento da mesma."},{"page_url":"https://pt.wikipedia.org/wiki/Jos%C3%A9_Clemente_Pereira","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jos%C3%A9_Clemente_Pereira_-_Litografia_%28cropped%29.jpg","page_title":"José Clemente Pereira","context_page_description":"José Clemente Pereira, conhecido como José Pequeno, foi um magistrado e político luso-brasileiro de alta relevância para o Império Brasileiro, além de ter sido um participante ativo da Ordem Maçônica.\\nNo tempo das invasões dos franceses em Portugal, José Clemente alistou-se no batalhão acadêmico que se organizou no país e que foi comandado por José Bonifácio de Andrada e Silva. No exército, foi elevado ao posto de capitão e comandante de uma das guerrilhas que mais dano causou às forças francesas. De Portugal, passou a atacar os franceses na Espanha, fazendo parte do famoso exército anglo-luso que tanto ajudou na primeira queda do Império, obrigando-os a evacuar a Península.\\nPermaneceu no exército português por muito tempo, de onde viu a abdicação de Fontainebleau. A consequente paz universal tornou inútil o uso da força. Assim sendo, José Clemente deixa a Europa em 1815 e veio ao Brasil começar uma nova carreira. Desconhecido por aqui, viu-se obrigado a recorrer à advocacia para viver, e assim passou até 1819.\\nLiderou as manifestações populares do Dia do Fico."},{"page_url":"https://it.wikipedia.org/wiki/Lo%C4%8Dica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Roman_provinces_of_Illyricum%2C_Macedonia%2C_Dacia%2C_Moesia%2C_Pannonia_and_Thracia.jpg","page_title":"Ločica","context_page_description":"Ločica fu un antico insediamento militare della provincia romana del Norico nei pressi di Polzela, al centro della costituenda Praetentura Italiae et Alpium, voluta fortemente dall'imperatore Marco Aurelio quale forma di difesa dei valichi alpini orientali dalle genti barbare, che stazionavano a nord del medio corso del Danubio."},{"page_url":"https://en.wikipedia.org/wiki/Fran_Albreht","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Fran_Albreht.jpg","page_title":"Fran Albreht","context_page_description":"Fran Albreht was a Slovenian poet, editor, politician and partisan. He also published under the pseudonym Rusmir.\\nHe was born as Franc Albrecht in the Upper Carniolan town of Kamnik in what was then the Austro-Hungarian Empire. He grew up in a liberal milieu, but he later came closer to more leftist views. He studied at the University of Vienna and became a literary critic and a neo-romantic poet.\\nIn the late 1920s and early 1930s, Albreht was editor of the liberal literary magazine Ljubljanski zvon. After the crisis of the journal in 1932, which emerged from different interpretations of Slovene identity and attitudes towards the centralist policies in the Kingdom of Yugoslavia, Albreht left the journal and established, together with the literary critic Josip Vidmar and author Ferdo Kozak, a new magazine called Sodobnost. Under Albreht, Vidmar and Kozak, the new magazine became the foremost progressive journal in Slovenia, in which also many Marxists and Communists could publish their articles under pseudonyms.\\nAfter the Axis invasion of Yugoslavia in April 1941, Albreht became an active member of the Liberation Front of the Slovenian People in Ljubljana."},{"page_url":"https://ro.wikipedia.org/wiki/Yuva_Bharati_Krirangan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Salt_Lake_Stadium_%28_Yuba_Bharati_Krirangan_%29_Kolkata_India_-_FC_Bayern_Munich_Mohun_Bagan_Oliver_Kahn_67.jpg","page_title":"Yuva Bharati Krirangan","context_page_description":"Yuva Bharati Krirangan, cunoscut ca Stadionul Salt Lake, este un stadion multifuncțional în Bidhannagar, Calcutta, Bengalul de Vest.\\nAcesta este cel mai mare stadion din India, și al doilea stadion ca mărime din lume după capacitate. Recordul de asistență a fost stabilit în 1997, într-un meci dintre East Bengal FC și Mohun Bagan AC, la care au asistat 131.000 de spectatori."},{"page_url":"https://ca.wikipedia.org/wiki/Opus_Dei","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Opusdeicentralhqrome.jpg","page_title":"Opus Dei","context_page_description":"L'Opus Dei, o formalment Prelatura de la Santa Creu i Opus Dei, és una institució de l'Església Catòlica que ensenya que tothom és cridat a buscar la santedat en la vida ordinària. La prelatura està composta majoritàriament per laics, té un presbiterat propi, i està governada per un prelat, escollit per alguns membres i designat pel Papa. El 55% dels membres de l'Opus Dei són dones i prop del 90% viuen a Europa i Amèrica Llatina.\\nFundat el 2 d'octubre de 1928 per Josepmaria Escrivá de Balaguer, canonitzat el 2002, fou aprovat canònicament el 1941 com a pia unió de dret diocesà, pel bisbe de Madrid Leopoldo Eijo y Garay; el 1950, com a institut secular de dret pontifici, per Pius XII, i el 1982 fou erigit en la primera i fins ara única prelatura personal, per Joan Pau II. Els Papes han donat suport a les ensenyances de l'Opus Dei, especialment Joan Pau II. El 2013 el papa Francesc va evocar sant Josepmaria Escrivà de Balaguer com a precursor del Concili Vaticà II al proposar la crida universal a la santedat amb l'Opus Dei."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%A1%D0%B0%D0%BD_%D0%9C%D0%B0%D1%80%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Ghirlandaio%2C_ultima_cena_di_san_marco.jpg","page_title":"Національний музей Сан Марко","context_page_description":"Національний музей Сан Марко — музей у місті Флоренція, створений на базі споруд і збірок колишнього монастиря Сан Марко."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B3%D0%B0%D0%BB%D0%B5%D0%B2%D0%B8%D1%87,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Anatoly_Sagalevich.jpg","page_title":"Сагалевич, Анатолий Михайлович","context_page_description":"Анато́лий Миха́йлович Сагале́вич — советский и российский учёный, исследователь Мирового океана с применением глубоководных обитаемых аппаратов, профессор. Герой Российской Федерации. Младший брат Валерия Сагалевича."},{"page_url":"https://es.wikipedia.org/wiki/Adesmia_exilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Adesmia_exilis.jpg","page_title":"Adesmia exilis","context_page_description":"Adesmia exilis es una especie de planta con flores de la familia Fabaceae. Es originaria de Chile."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%88%D5%B9-%D5%A2%D5%AB%D5%B6%D5%A1%D6%80_%D5%A3%D5%A5%D5%B6%D5%A4%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Nonbinary_flag.svg","page_title":"Ոչ-բինար գենդեր","context_page_description":"Ոչ-բինար կամ գենդերքվիր. գենդերային ինքնությունների լայն սպեկտր է, որոնք բացառապես տղամարդ կամ բացառապես կին չեն համարվում, դուրս են երկբևեռ գենդերային համակարգից։\\nՈչ-բինար ինքնությունները կարող են տեղ գտնել տրանսգենդեր հովանոցի տակ, քանի որ շատ ոչ-բինար մարդիկ նույնականանում են գենդեր/ներ-ի հետ, որոնք տարբերվում են իրենց վերագրած սեռից, բայց պարտադիր չէ, քանի որ որոշ ինտերսեքս մարդիկ նույնպես ոչ-բինար են:\\nՈչ-բինար մարդիկ կարող են իրենց նույնականացնել, որպես երկու կամ ավելի գենդեր ունեցող, չունենալ գենդեր; անցումներ ունենալ գենդերներիի միջև կամ փոփոխական գենդերային ինքնության ունենալ, լինել երրորդ գենդեր կամ այլ գենդերի պատկանել: Ոմանք էլ կարող են ընդհանրապես մերժել գենդերային «ինքնությունները»:\\nԳենդերային ինքնությունը առանձնանում է սեռական կամ ռոմանտիկ կողմնորոշումներից, և ոչ-բինար մարդիկ ունեն տարբեր սեռական կողմնորոշումներ, ինչպես սիսգենդեր մարդիկ:\\nՈչ-բինար գենդերային ինքնությունները կապված չեն որոշակի հստակ գենդերային արտահայտումների հետ, ինչպիսին է անդրոգենությունը: Ոչ-բինար մարդիկ, որպես խումբ, ունեն գենդերային արտահայտումների շատ տարբեր ձևեր:"},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Vith","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/0_Saint-Vith_-_%C3%A9glise_Saint-Guy_%281%29.jpg","page_title":"Saint-Vith","context_page_description":"Saint-Vith est une ville belge située dans la province de Liège, en Région wallonne.\\nElle fait partie de la Communauté germanophone de Belgique et constitue de ce fait l'une des 9 communes de langue allemande de Belgique.\\nElle a donné son nom au Pays de Saint-Vith, région où la langue vernaculaire traditionnelle est le luxembourgeois.\\nSes habitants s'appellent les Saint-Vithois et Saint-Vithoises."},{"page_url":"https://is.wikipedia.org/wiki/B%C3%A1r%C3%B0arbunga","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Sylgj%C3%B6kull_Hamarskriki_1_Iceland.JPG","page_title":"Bárðarbunga","context_page_description":"Bárðarbunga er hæsti punktur á norðvestanverðum Vatnajökli, um 2.000 m að hæð innan Vatnajökulsþjóðgarðs. Undan henni gengur skriðjökullinn Köldukvíslarjökull auk fleiri smærri jökla. Bárðarbunga er stór og öflug megineldstöð og jafnframt víðáttumesta eldstöð landsins, talin vera nálægt 200 km löng og allt að 25 km breið. Bárðarbunga er önnur stærsta eldstöð og næsthæsta fjall landsins. Í Bárðarbungu leynist svo 850 m djúp askja."},{"page_url":"https://de.wikipedia.org/wiki/Giant-Geysir","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/StereographofGiantGeyser.jpg","page_title":"Giant-Geysir","context_page_description":"Der Giant-Geysir ist ein kegelförmiger Geysir im Oberen Geysir-Becken im Yellowstone-Nationalpark im US-Bundesstaat Wyoming. Der Giant-Geysir ist zudem Namensgeber für die Giant-Geysir-Gruppe, zu der selbiger sowie Bijou Geysir und der Mastiff Geysir gehören. Außerdem ist der Geysir namensgebend für die Giant Platform, ein erhöhtes Steinplateau, auf dem sich die drei Geysire befinden. Der Giant Geysir ist vor allem für die spektakulären Fontänen, welche bis zu zwei Meter Durchmesser haben, sowie den rund vier Meter hohen Kegel bekannt."},{"page_url":"https://id.wikipedia.org/wiki/Bandar_Udara_Brisbane","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Cathay_Pacific_Airbus_A330-300_B-LAD.jpg","page_title":"Bandar Udara Brisbane","context_page_description":"Bandar Udara Brisbane adalah satu-satunya bandara yang melayani kota Brisbane dan merupakan bandar udara tersibuk ketiga di Australia setelah Melbourne dan Sydney. Bandar Udara Brisbane telah memenangkan banyak penghargaan. Berlokasi di wilayah kota yang bernama sama, bandara melayani kota Brisbane dan wilayah metropolitan di sekitarnya. Brisbane saat ini melayani 44 destinasi di seluruh negara bagian dan teritori dari Australia.\\nBandara ini menjadi salah satu hub utama bagi Virgin Australia, dan hub reguler bagi anak perusahaan internasional bertarif rendahnya, Pacific Blue Airlines dan menjadi hub kedua bagi Qantas dan anak perusahaan bertarif rendahnya Jetstar. Bandara ini menjadi bagian dari rite udara Brisbane–Sydney, yang merupakan rute udara tersibuk ke-12 di dunia, dan yang ketujuh di Asia Pasifik. Bandara ini juga melayani rute Brisbane–Melbourne, yang merupakan rute penerbangan tersibuk ke-34 di dunia.\\nBandar Udara Brisbane adalah tempat bagi fasilitas perawatan berat 767-300 dan A330 milik Qantas. Virgin Australia memiliki fasilitas perawatan yang lebih kecil bagi armada 737 maskapai ini."},{"page_url":"https://en.wikipedia.org/wiki/Wovoka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Wovoka_Paiute_Shaman.jpg","page_title":"Wovoka","context_page_description":"Wovoka, also known as Jack Wilson, was the Paiute religious leader who founded a second episode of the Ghost Dance movement. Wovoka means \\"cutter\\" or \\"wood cutter\\" in the Northern Paiute language."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BB%9At_Pequin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Chile_pequin_fruit_and_flower_closeup.jpg","page_title":"Ớt Pequin","context_page_description":"Ớt Pequin là một nóng ớt cây trồng thường được sử dụng như một gia vị. Về mặt phân loại, nó được phân loại trong nhiều loại glabriusculum thuộc chủng loài Capsicum annuum.\\nPequin có hình thái nhỏ gọn, cao thường 0,3 đến 0,6 mét, với màu xanh lá cây tươi sáng, lá hình trứng và quả mọng nhỏ hiếm khi vượt quá chiều dài 2 cm. Giống như hầu hết các loại ớt, quả khi chưa chín có màu xanh, chín tới màu đỏ rực rỡ khi trưởng thành. Ớt Pequin rất nóng, thường nóng hơn 5-8 lần so với ớt jalapeños trên thang Scoville. Hương vị được mô tả là chua, vị khói và mùi vị hạt.\\nCái tên Pequin được cho là xuất phát từ tiếng Tây Ban Nha pequeño, có nghĩa là nhỏ. Quả của nó là hình thuôn và được tìm thấy trong tự nhiên từ Tây Nam Mỹ đến Andes. Nó được trồng cả hoang dã và được thu hoạch thương mại ở Mexico.\\nChúng thường được sử dụng phổ biến trong các món muối dưa, salsas, nước sốt, súp và giấm. Thương hiệu sốt nóng Cholula liệt kê ớt piquin và ớt chile de arbol trong số các thành phần của nó.\\nỚt Pequin được đánh giá cao ở Mexico, thường có giá cao hơn 10 lần so với các loại ớt khác, nhưng việc trồng trọt của chúng bị hạn chế do hạt nảy mầm thấp và dễ bị bệnh."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/RAF_N_F9AdmirFleet_1962-94h.svg","page_title":"Пагон","context_page_description":"Пагон — наплечны знак адрозення на форменным адзенні ваеннаслужачых. Паказваюць персанальныя званні, прыналежнасць да віду Узброенных Сіл.\\nУ арміях ВКЛ і Расіі пагоны былі ўведзены ў сярэдзіне XVIII ст., ва УС СССР — у сярэдзіне XX ст.\\nЗахаваліся ва УС і іншых войсках і вайсковых фарміраваннях Рэспублікі Беларусь"},{"page_url":"https://no.wikipedia.org/wiki/Jarl_Hemmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Jarl-Hemmer.jpg","page_title":"Jarl Hemmer","context_page_description":"Jarl Robert Hemmer var en finlandssvensk forfatter. Han debuterte i 1914 med diktsamlingen Rösterna og fikk sitt gjennombrudd med diktsamlingen Rågens rike i 1922. Hemmer fikk Stora Nordiska Romanpriset for sitt verk En man och hans samvete, utgitt 1931.\\nI 1927 kjøpte Hemmer Ängstorp på Eckerö i Ålands skjærgård, et hus fra 1700-tallet som også hadde vært svensk posthus. Ängstorp forble hans sommerhjem til hans død. Et resultat av Ängstorp var romanen Morgongåvan, 1934, som handler om ålandsk allmue på 1880-tallet. Den blev ålenningenes store bok og resulterte i at han fikk De Nios stora pris i 1935.\\nI 1933 overtok Jarl Hemmer forfatterboligen Diktarhemmet i Borgå, og der tok han sitt eget liv på Finlands selvstendighetsdag i 1944.\\nJarl Hemmers foreldrehjem på Skolhusgatan 8 i Vasa, bygget 1886, ble i 1977 donert til friluftsmuseet Stundars utenfor Vasa, der det ble satt opp igjen som Hemmersgården og fyltes med hans etterlatenskaper, som hans enke skjenkte museet i 1979. Samlingen består av bøker, dokument, utklipp og gjenstander."},{"page_url":"https://en.wikipedia.org/wiki/North_Palatinate","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Teilbereiche_der_Pfalz.png","page_title":"North Palatinate","context_page_description":"North Palatinate is a region in southwest Germany with an area of just 650 km², making it the smallest landscape in the Palatinate region of the German state of Rhineland-Palatinate."},{"page_url":"https://de.wikipedia.org/wiki/Siemens_ER20","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/MRB_223_-_IMG_1488_variosLondon.JPG","page_title":"Siemens ER20","context_page_description":"Der Lokomotivtyp Siemens ER20 der Eurorunner-Serie ist eine von Siemens gebaute vierachsige dieselelektrische Lokomotive der mittleren Leistungsklasse. Ein 2.000 Kilowatt leistender Dieselmotor mit angeflanschtem Drehstrom-Asynchrongenerator erzeugt dabei den Strom, mit dem die vier Motoren angetrieben werden. Die Lokomotiven sind mit Wendezug- und Doppeltraktionssteuerung ausgestattet.\\nDas Modell war zunächst im Auftrag der Österreichischen Bundesbahnen gebaut und dort als Reihe 2016 bezeichnet worden. In Deutschland wurde sie zunächst als Baureihe 253 geführt und steht im Fahrzeugeinstellungsregister nun als Baureihe 223."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AA_%D8%A7%D9%84%D8%B3%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Beitalsadu.jpg","page_title":"بيت السدو","context_page_description":"بيت السدو هو بيت تراثي كويتي أسس عام 1979 ليحافظ على صناعة السدو التقليدية والتي تشمل نسيج وحياكة الصوف وصناعة الخيام وبيوت الشعر. كما تقام فيه عدد من المعارض الفنية السنوية والدورات التدريبية."},{"page_url":"https://pl.wikipedia.org/wiki/Zamach_stanu_w_Katalonii_(1936)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Nosaltres_sols_3.png","page_title":"Zamach stanu w Katalonii (1936)","context_page_description":"Zamach stanu w Katalonii (1936) – planowany przez narodowo-socjalistyczną katalońską organizację Estat Català przewrót, mający na celu obalenie autonomicznego rządu Generalitat. W dalszej perspektywie zamachowcy planowali ogłoszenie pełnej niepodległości Katalonii jako państwa neutralnego oraz marginalizację opozycji wewnętrznej, zwłaszcza anarchistów. Przewrotu zamierzano dokonać w listopadzie 1936 roku, wykorzystując siły własnych milicji oraz inflitrowanych przez Estat Català katalońskich formacji wojskowych i porządkowych. Liczono, że zaabsorbowane walkami o Madryt centralne władze Republiki nie będą zdolne do kontrakcji. Zamach nie doszedł do skutku w wyniku przeciwdziałania anarchistów, którzy zdemaskowali część konspiratorów. Służby Generalitat aresztowały lub zatrzymały niektórych przywódcow spisku zanim zdążyli przystąpić do akcji; pozostali w większości zbiegli do Francji. Estat Català została zmarginalizowana, a w Katalonii umocniła się pozycja CNT i FAI. Próba zamachu pozostaje mało znanym epizodem nie tylko w Hiszpanii, ale również w Katalonii. W historiografii jest on dyskutowany w związku z kwestią faszyzmu katalońskiego."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A4%BE%E0%A4%B2_%E0%A4%B5%E0%A4%BF%E0%A4%95%E0%A4%BE%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Walter_de_Maria_Vertikaler_Erdkilometer.jpg","page_title":"बाल विकास","context_page_description":"बाल विकास, मनुष्य के जन्म से लेकर किशोरावस्था के अंत तक उनमें होने वाले जैविक और मनोवैज्ञानिक परिवर्तनों को कहते हैं, जब वे धीरे-धीरे निर्भरता से और अधिक स्वायत्तता की ओर बढ़ते हैं। चूंकि ये विकासात्मक परिवर्तन काफी हद तक जन्म से पहले के जीवन के दौरान आनुवंशिक कारकों और घटनाओं से प्रभावित हो सकते हैं इसलिए आनुवंशिकी और जन्म पूर्व विकास को आम तौर पर बच्चे के विकास के अध्ययन के हिस्से के रूप में शामिल किया जाता है। संबंधित शब्दों में जीवनकाल के दौरान होने वाले विकास को सन्दर्भित करने वाला विकासात्मक मनोविज्ञान और बच्चे की देखभाल से संबंधित चिकित्सा की शाखा बालरोगविज्ञान शामिल हैं। विकासात्मक परिवर्तन, परिपक्वता के नाम से जानी जाने वाली आनुवंशिक रूप से नियंत्रित प्रक्रियाओं के परिणामस्वरूप या पर्यावरणीय कारकों और शिक्षण के परिणामस्वरूप हो सकता है लेकिन आम तौर पर ज्यादातर परिवर्तनों में दोनों के बीच का पारस्परिक संबंध शामिल होता है।\\nबच्चे के विकास की अवधि के बारे में तरह-तरह की परिभाषाएँ दी जाती हैं क्योंकि प्रत्येक अवधि के शुरू और अंत के बारे में निरंतर व्यक्तिगत मतभेद रहा है।\\nकुछ आयु-संबंधी विकास अवधियों और निर्दिष्ट अंतरालों के उदाहरण इस प्रकार हैं: नवजात; शिशु; नन्हा बच्चा; प्रीस्कूली बच्चा; स्कूली बच्चा; किशोर-किशोरी."},{"page_url":"https://nl.wikipedia.org/wiki/Sodingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Sodingen_kirche.jpg","page_title":"Sodingen","context_page_description":"Sodingen is een voormalige gemeente en deel van de Duitse stad Herne. Ten zuiden van Sodingen ligt het recreatiegebied Gysenberg.\\nHet gelijknamige Stadtbezirk Sodingen, bestaande uit Sodingen, Börnig, Holthausen en Horsthausen telt 36.484 inwoners."},{"page_url":"https://pl.wikipedia.org/wiki/B%C3%ADlovice-Lutot%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Kaple_na_n%C3%A1vsi_v_B%C3%ADlovic%C3%ADch%2C_B%C3%ADlovice-Lutot%C3%ADn%2C_okres_Prost%C4%9Bjov.jpg","page_title":"Bílovice-Lutotín","context_page_description":"Bílovice-Lutotín – gmina w Czechach, w powiecie Prościejów, w kraju ołomunieckim. Według danych z dnia 1 stycznia 2012 liczyła 513 mieszkańców.\\nSkłada się z dwóch części:\\nBílovice\\nLutotín"},{"page_url":"https://cs.wikipedia.org/wiki/Wilson%C5%AFv_les","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Brno-%C5%BDabov%C5%99esky_-_Wilson%C5%AFv_les_1.JPG","page_title":"Wilsonův les","context_page_description":"Wilsonův les je lesopark o přibližné rozloze 34,4 hektarů, rozkládající se převážně na jižním okraji městské části Brno-Žabovřesky; jižním cípem však zasahuje i na území sousední městské části Brno-střed. Lesopark se rozkládá na skalnatém východním a severovýchodním svahu Žlutého kopce, na levém břehu řeky Svratky, v katastrálních územích Stránice, Pisárky a Žabovřesky."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%83%D0%BA%D1%80%D0%B5%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Parmigianino%2C_lucrezia_romana%2C_1540.jpg","page_title":"Лукреция","context_page_description":"Лукре́ция — легендарная римская матрона, прославившаяся своей красотой и добродетелью.\\nПо сообщению античных историков, царский сын Секст Тарквиний в 510/508 году до н. э. пленился красотой Лукреции и, угрожая оружием, изнасиловал её. Лукреция рассказала обо всём своему мужу и заколола себя на его глазах. Это событие послужило началом бунта, поднятого Луцием Юнием Брутом и привело к свержению царской власти в Риме и к установлению Республики. Именно поэтому на протяжении веков римской истории и в дальнейшем Лукреция была весьма почитаема, представляя архетипный образец женской чистоты и доблести.\\nВ литературе и изобразительном искусстве Лукреция является символом доблести, не покоренной тиранией, часто ее фигура символизирует Рим, а насильник — образ тирана."},{"page_url":"https://no.wikipedia.org/wiki/Granada_(Nicaragua)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/06.Plaza_de_la_Independencia_de_Granada.JPG","page_title":"Granada (Nicaragua)","context_page_description":"Granada er med en anslått befolkning på 110 326 Nicaraguas fjerde største by og hovedstad i provinsen Granada. Granada har historisk vært blant landets viktigste byer, både økonomisk og politisk. Byen ligger ved den nordvestre bredden av Nicaraguasjøen, og ble grunnlagt av Francisco Hernández de Córdoba 8. desember 1524, som et ledd av den spanske erobringen av Nicaragua. Byen har en rik arv fra kolonitida, og kalles ofte \\"La Gran Sultana del Gran Lago\\", den store sultaninnen ved den store sjøen."},{"page_url":"https://en.wikipedia.org/wiki/Jonesville,_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/First_Baptist_Church%2C_Jonesville_Louisiana.JPG","page_title":"Jonesville, Louisiana","context_page_description":"Jonesville is the largest town in Catahoula Parish, Louisiana, United States, at the confluence of the Ouachita, Tensas, and Little rivers. The three rivers become the Black River at Jonesville.\\nThe Jonesville population was 2,265 at the 2010 census. The parish seat is Harrisonburg to the north, which is even smaller than Jonesville.\\nThe four rivers which intersect near Jonesville are all subject to flooding. There are surrounding soybean and cotton fields. A few plantation houses still stand, reminiscent of the former slavery-based, planter-dominated economy. The population fell significantly when a textile mill shut down in the late 1980s."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%83%90%E3%83%AD%E3%83%BB%E3%83%A1%E3%83%89%E3%83%A9%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Real_Valladolid_-_Rayo_Vallecano_2019-01-05_47_%28cropped%29_Medran.jpg","page_title":"アルバロ・メドラン","context_page_description":"アルバロ・メドラン・フストは、スペイン・アンダルシア州コルドバ県ドス・トーレス出身のサッカー選手。シカゴ・ファイアーFC所属。ポジションはMF。"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D9%84%D9%81%D8%B1%D8%AF_%D8%A7%D9%88%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Wilfred_Owen_plate_from_Poems_%281920%29.jpg","page_title":"ویلفرد اوون","context_page_description":"ویلفرد اوون بریتانیالی یازیچی - .۲۵ ایل عومر ائله‌ایب و ۰۴ نوْوامبر ۱۹۱۸ میلادی تاریخیندا وفات ائدیب. اوْ، اثرلرینی اینگیلیس دیلینده یازیب."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E4%BA%9E%E6%B4%B2%E5%9C%8B%E9%9A%9B%E5%8D%9A%E8%A6%BD%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/HK_Arena_AsiaWorld-Expo_west_side_n_Hong_Kong_Logo.JPG","page_title":"亞洲國際博覽館","context_page_description":"亞洲國際博覽館（英文：AsiaWorld-Expo，AWE，簡稱亞博館）係香港其中一個重要嘅展覽會議場地，喺香港赤鱲角香港國際機場。亞洲國際博覽館大概用咗23.5億港元去起，喺2003年，為咗發展亞洲國際博覽館，香港特區政府、機管局就同國際展覽中心投資有限公司一齊成立咗香港國際展覽中心有限公司，香港特區政府就係主要股東。喺2005年12月21號由香港特別行政區行政長官曾蔭權主持開幕儀式。\\n2018年9月24日，香港機場管理局宣佈收購國際展覽中心投資有限公司持有嘅權益同股權，同埋亞洲國際博覽館管理有限公司嘅擁有權。亞洲國際博覽館由香港特區政府同香港機場管理局共同擁有，香港機場管理局附屬公司亞洲國際博覽館管理有限公司就負責營運管理。\\n亞博館係一個達到咗世界級嘅展覽同活動場地，可以搞展覽、會議、演唱會、體育同各類文娛嘅活動。2012年，喺《CEI Asia magazine》榮膺亞洲三甲，係香港首次有兩座場館（另一座為香港會議展覽中心）一齊躋身三甲之列，成績超越其他城市。"},{"page_url":"https://hu.wikipedia.org/wiki/Jay_Miner","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/JayMiner_Mitch.jpg","page_title":"Jay Miner","context_page_description":"Jay Glenn Miner amerikai villamosmérnök, aki integrált áramkörök, ezen belül is elsősorban multimédia chipek tervezésével foglalkozott az Atarinál, majd onnan kilépve megtervezte és útjára indította az Amigát, melynek okán „az Amiga atyjának” is nevezik."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%93%D5%B8%D6%84%D5%AB%D6%83%D5%BD%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Poughkeepsie_from_across_Hudson_River.jpg","page_title":"Փոքիփսի","context_page_description":"Փոքիփսի, քաղաք Միացյալ Նահանգների Նյու Յորք նահանգի Դաչես շրջանում։ Ըստ 2010 թվականի մարդահամարի վիճակագրական տվյալների՝ բնակչությունը կազմում է 32 736 մարդ։ Դաչես շրջանի շրջանային կենտրոնն է։"},{"page_url":"https://sl.wikipedia.org/wiki/Batiskaf_Trieste","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Trieste_drawing.jpg","page_title":"Batiskaf Trieste","context_page_description":"Trieste je bil batiskaf švicarske proizvodnje, s katerim je bil dosežen rekord v globinskem potopu s človeško posadko. Ta rekord, 10.900 metrov, je bil dosežen 23. januarja 1960 v Marianskem jarku, v Izzivalčevem breznu.\\nBatiskaf je zasnoval Auguste Piccard, Trieste pa je bil splovljen avgusta 1953 v bližini Neaplja. Leta 1958 ga je kupila Vojna mornarica Združenih držav Amerike za 250.000 ameriških dolarjev."},{"page_url":"https://sv.wikipedia.org/wiki/Pellefigue","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Map_commune_FR_insee_code_32309.png","page_title":"Pellefigue","context_page_description":"Pellefigue är en kommun i departementet Gers i regionen Occitanien i sydvästra Frankrike. Kommunen ligger i kantonen Lombez som tillhör arrondissementet Auch. År 2009 hade Pellefigue 121 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Stachel-Segge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/CarexSpicataColl.jpg","page_title":"Stachel-Segge","context_page_description":"Die Stachel-Segge, auch Korkfrüchtige Segge genannt, ist eine Pflanzenart innerhalb der Familie der Sauergrasgewächse. Sie ist von Europa bis Westasien und Nordafrika verbreitet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%92%A2%E9%93%81%E5%86%B6%E9%87%91%E5%AD%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Bas_fourneau.png","page_title":"钢铁冶金学","context_page_description":"鋼鐵冶金學涵蓋鐵及鐵合金的冶煉工藝。鋼鐵冶煉可追溯到史前時期。現存最早的鐵製品，起源於公元前4000年左右的埃及，由源自隕石的鐵鎳合金製成。人們開始從鐵礦中冶煉鐵的最早時間和最早地點尚未有明確的發現。但是，在公元前2000年左右，鐵礦煉鐵的技術已經存在於撒哈拉以南的非洲。公元前1000年左右，人們開始生產熟鐵。熟鐵的大規模使用，開啟了鐵器時代。從中世紀開始，歐洲產生了通過鍛鐵爐從鑄鐵冶煉熟鐵的方法。"},{"page_url":"https://fi.wikipedia.org/wiki/Kaasmarkku","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kaasmarkku_village%2C_Ulvila%2C_Finland.jpg","page_title":"Kaasmarkku","context_page_description":"Kaasmarkku on maaseutukylä ja 607 asukkaan taajama Ulvilan itäosassa Satakunnan maakunnassa. Kaasmarkun merkittävimpiä rakennuksia ovat koulu, VPK:n talo ja rukoushuone. Kaasmarkku sijaitsee lähellä Valtatie 11:tä, joka kulkee Porista Tampereelle. Vuonna 2005 Kaasmarkku valittiin Satakunnan vuoden kyläksi."},{"page_url":"https://es.wikipedia.org/wiki/Nina_Burger","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/20170803_WEURO_DEN_AUT_0361.jpg","page_title":"Nina Burger","context_page_description":"Nina Burger es una exfutbolista austríaca que jugaba como delantera para la selección de Austria y para el SC Sand de la Bundesliga Femenina de Alemania.​\\nEmpezó su carrera en el SV Langenrohr. En 2005 debutó con la selección austríaca y fichó por el SV Neulengbach, gran dominador de la liga austriaca, en el que pasó una década. En 2014 jugó cedida en el Houston Dash de la NWSL, ​ y del 2015 al 2019, jugó para el SC Sand de la Bundesliga alemana.​\\nEl 1 de abril de 2019, Burger se retiró de la selección austríaca siendo la máxima goleadora en su historia, con 53 goles en 108 partidos.​"},{"page_url":"https://ga.wikipedia.org/wiki/Leabharcham","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/The_Story_of_Deirdre_-_Illustration_2.jpg","page_title":"Leabharcham","context_page_description":"Sa Rúraíocht, ba bhean saoi agus buime Dheirdre í Leabharcham d'Eamhain Mhacha."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%B3%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Jessicka.jpg","page_title":"جسیکا","context_page_description":"جسیکا هنرمند، موسیقی‌دان، ترانه‌سرا، و خواننده اهل ایالات متحده آمریکا است. وی از سال ۱۹۹۲ میلادی تاکنون مشغول فعالیت بوده‌است.\\nاز فیلم‌های او می‌توان به بازی در فیلم الی پارکر اشاره کرد."},{"page_url":"https://tr.wikipedia.org/wiki/Ankara_Han","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ankara_Han.jpg","page_title":"Ankara Han","context_page_description":"Mimarı Giulio Mongeri olan yapı 1912 yılında Bankalar Caddesi’nde inşa edilmiştir. İnşa edildikten sonra ilk defa bir sigorta şirketi olarak kullanılan binada günümüze kadar Türkiye Milli Sigorta ve Anadolu Sigorta gibi sigorta şirketleri tarafından kullanılmıştır. Milli Reasürans tarafından satın alınmasıyla beraber katları ayrı ayrı satılmıştır. Günümüzde çeşitli hukuk büroları, sigorta acenteleri ve nakliye şirketleri tarafından kullanılmaktadır."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%BA%D0%BC%D0%BE%D0%BB%D1%96%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%8C%D1%86%D1%8C_(%D0%A0%D0%B0%D1%81%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%96%D0%BC%D0%BF%D1%8D%D1%80%D1%8B%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/%D0%90%D0%BA%D0%BC%D0%BE%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_1900.svg","page_title":"Акмолінская вобласьць (Расейская імпэрыя)","context_page_description":"Акмалінская вобласьць — вобласьць Расейскае імпэрыі. Створаная 19 траўня 1854 году з часткі Омскае вобласьці й Вобласьці сыбірскіх кіргізаў з цэнтрам у Омску. З 1868 году стала называцца Акмалінскай вобласьцю.\\nАкмалінская вобласьць у XIX стагодзьдзі займала значна большую тэрыторыю і была самай шырокай вобласьцю ў Сярэднеазіяцкіх уладаньнях Расеі, куды ўваходзіла разам з Уральскай, Тургайскай, Сяміпалацінскай, Сямірэчанскай, Фэрганскай, Сырдар'інскай, Самаркандзкай і Закасьпійскай абласьцямі.\\nЯна распасьціралася ад Улу-Таў і Ішыма на захадзе да Іртыша на паўночным усходзе прыблізна ад 45° да 54° паўночнае шыраты і ад 82° да 92° усходняй даўгоаты. Плошча яе была 594672,6 км². У цяперашні час гэтыя тэрыторыі занятыя сучаснай Акмалінскай, Петрапаўлаўскай абласьцьмі Казахстана і паўднёвай часткай Омскай вобласьці Расеі.\\nНасельніцтва вобласьці ў 1887 складала 463 347 чалавек, у ліку якіх амаль 100 000 казахаў Дзялілася на паветы: Акмалінскі, Какчатаўскі, Омскі, Петрапаўлаўскі і Атбасарскі.\\nВобласьць у геалягічна дзялілася на тры часткі, якія рэзка адрозьніваюцца адна ад адной па сваіх фізычных уласьцівасьцях."},{"page_url":"https://nl.wikipedia.org/wiki/Ann_Reymen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ann-reymen-1360686582.jpg","page_title":"Ann Reymen","context_page_description":"Ann Reymen is een Vlaams radiopresentatrice."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%96%D7%A3_%D7%98%D7%99%D7%A1%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Jozef_Tiso.jpg","page_title":"יוזף טיסו","context_page_description":"יוזף טיסו, כומר, מדינאי ונשיא מדינת סלובקיה העצמאית, מדינה שהייתה למעשה גרורה של גרמניה הנאצית."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%99%D7%99%D7%9D_%D7%9B%D7%A5_(%D7%A7%D7%A6%D7%99%D7%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D7%97%D7%99%D7%99%D7%9D_%D7%9B%D7%A5_%28cropped%29.jpg","page_title":"חיים כץ (קצין)","context_page_description":"חיים כץ ברחובות קצין צה\\"ל בדימוס בדרגת אלוף-משנה. לחם כמפקד מחלקה במלחמת ההתשה, כמפקד פלוגה במלחמת יום הכיפורים וכמפקד חטיבה במלחמת שלום הגליל. לאחר שחרורו מצה\\"ל עסק בתפקידים כלכליים ובפיתוח אזורי תעשייה."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CF%89%CE%BD%CF%83%CF%84%CE%B1%CE%BD%CF%84%CE%AF%CE%BD%CE%BF%CF%82_%CE%9A%CE%B1%CE%BD%CF%84%CE%B1%CE%BA%CE%BF%CF%85%CE%B6%CE%B7%CE%BD%CF%8C%CF%82_(%CF%83%CF%84%CF%8C%CE%BB%CE%BD%CE%B9%CE%BA%CE%BF%CF%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Constantin_Cantacuzino_%28stolnic%29_2000_Romania_stamp.jpg","page_title":"Κωνσταντίνος Καντακουζηνός (στόλνικος)","context_page_description":"Ο στόλνικος Κωνσταντίνος Καντακουζηνός ήταν λόγιος βογιάρος από την οικογένεια των Καντακουζηνών της Ρουμανίας που επηρέασε την πολιτική και πνευματική ζωή της Βλαχίας. Στο Ρουμανικό πολιτιστικό χώρο αναγνωρίζεται ως εκπρόσωπος του Αναγεννησιακού Ουμανισμού στη Βλαχία, με ιδιαίτερο ενδιαφέρον για την Ιστορία και τη Γεωγραφία.\\nΟ Κωνσταντίνος Καντακουζηνός ήταν ο τριτότοκος γιος του ποστέλνικου Κωνσταντίνου Καντακουζηνού και της Έλενας, κόρης του βοεβόδα Radu. Ο στόλνικος ήταν για 38 χρόνια ο ισχυρός σύμβουλος των ηγεμόνων της Βλαχίας, καθώς ο αδελφός του Σερμπάν Καντακουζηνός ήταν ηγεμόνας της Βλαχίας από το 1678 μέχρι το 1688, τον διαδέχθηκε ο ανεψιός από την αδελφή του Stanca, Κωνσταντίνος Μπρινκοβεάνου, που ηγεμόνευσε από το 1688 μέχρι το 1714 και αυτόν διαδέχθηκε ο γιος του Στέφανος Καντακουζηνός από το 1714 μέχρι το 1716."},{"page_url":"https://fr.wikipedia.org/wiki/Fasim","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/FASIM%2C_1988%2C_San_Andres_Barcelona.jpg","page_title":"Fasim","context_page_description":"Germán Bel, Fasim est né en 1972 à Barcelone en Espagne, c'est un artiste peintre qui compose avec le papier, le collage, la création numérique, la toile et les espaces urbains, il vit et travaille dans sa maison-atelier à Valence en Espagne."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Geotope_im_Landkreis_Neumarkt_in_der_Oberpfalz","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/K%C3%B6nig-Otto-Tropfsteinh%C3%B6hle%2C6.jpg","page_title":"Liste der Geotope im Landkreis Neumarkt in der Oberpfalz","context_page_description":"Diese Liste enthält die Geotope des oberpfälzer Landkreises Neumarkt in der Oberpfalz in Bayern.\\nDie Liste enthält die amtlichen Bezeichnungen für Namen und Nummern des Bayerischen Landesamt für Umwelt sowie deren geographische Lage. Diese Liste ist möglicherweise unvollständig. Im Geotopkataster Bayern sind etwa 3.400 Geotope erfasst. Das LfU sieht einige Geotope nicht für die Veröffentlichung im Internet geeignet. Einige Objekte sind zum Beispiel nicht gefahrlos zugänglich oder dürfen aus anderen Gründen nur eingeschränkt betreten werden."},{"page_url":"https://cs.wikipedia.org/wiki/T%C3%BDr","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Tyr-brakteaten_fr%C3%A5n_Naglum%2C_Trollh%C3%A4ttan_%28SHM_1164%29_tecknad.jpg","page_title":"Týr","context_page_description":"Týr, též Tý, je severský bůh z rodu Ásů. V literatuře bývá označován za boha nebes, války, práva a shromáždění thing, ale jeho skutečná funkce je předmětem mnoha diskusí. Toto božstvo bylo známo i ostatním germánským národům, jeho anglosaský protějšek byl nazýván Tíw, Tiu či Tíg, starohornoněmecký Ziu, gótský Týz. Je s ním spojena runa staršího futharku zvaná tiwaz.\\nŘímany byl Týr ztotožňován s Martem a známe tak nápisy věnované božstvu jménem Mars Thingsus „Mars thingu“. Po vzoru latinského dies Martis „den Martův, úterý“ také vzniklo v germánských jazycích označení tohoto dne jako staroseverské týsdagr nebo anglické tuesday. V jiných germánských jazycích vzniklo označení tohoto dne z výrazů thing a příbuzných, například německé Dienstag nebo nizozemské dingsdag. S Týrem může souviset i bavorské označení úterý Ertag, které nejspíše odkazuje na Irmina či Ermina, který bývá někdy s Týrem ztotožňován."},{"page_url":"https://eu.wikipedia.org/wiki/Divignano","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Divignano_castello.jpg","page_title":"Divignano","context_page_description":"Divignano Italiako udalerri bat da. Novarako probintzian kokatuta dago, Piemonte eskualdean. 1.404 biztanle ditu, 5,1 kilometro koadroko azaleran banatuta."},{"page_url":"https://fr.wikipedia.org/wiki/Ancien_couvent_des_Jacobins_de_Poligny","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Couvent_Jacobins_Poligny_008.JPG","page_title":"Ancien couvent des Jacobins de Poligny","context_page_description":"Le couvent des Jacobins de Poligny est un ancien couvent Jacobins, et une église Notre-Dame de style gothique rayonnant du XIIIᵉ siècle à Poligny dans le Jura en Bourgogne-Franche-Comté. Le couvent est classé aux monuments historiques depuis le 17 août en 1945, et héberge à ce jour le lycée hôtelier Hyacinthe Friant, et la Coopérative Viticole de Poligny du vignoble du Jura."},{"page_url":"https://de.wikipedia.org/wiki/Liste_historischer_Schiffe_der_Royal_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/21_HMS_Danae_Mediterranean_Jan1970.jpg","page_title":"Liste historischer Schiffe der Royal Navy","context_page_description":"Die Liste historischer Schiffe der Royal Navy enthält Namen bekannter Schiffe, die bei der britischen Royal Navy in Dienst standen. In Klammern ist das Jahr der Indienststellung angegeben. Für eine Auflistung heutiger Schiffe siehe Liste von Schiffen der britischen Royal Navy.\\nDas Präfix HMS ist eine Abkürzung für Her Majesty’s Ship, das ab 1789/1790 Namensbestandteil für die Kriegsschiffe der Royal Navy ist."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Hennebont","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/GareHennebontbv1900.jpg","page_title":"Gare d'Hennebont","context_page_description":"La gare d'Hennebont, est une gare ferroviaire française de la ligne de Savenay à Landerneau, située sur le territoire de la commune d'Hennebont, dans le département du Morbihan, en région Bretagne.\\nElle est mise en service en 1862 par la Compagnie du chemin de fer de Paris à Orléans.\\nC'est une gare régionale de la Société nationale des chemins de fer français, desservie par des trains TER Bretagne."},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99%C3%ADda_Armidale","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/HMAS_Broome_%28ACPB_90%29.jpg","page_title":"Třída Armidale","context_page_description":"Třída Armidale je třída hlídkových lodí australského námořnictva. Austrálie získala celkem 14 jednotek této třídy. Mezi jejich hlavní úkoly patří hlídkování, ochrana rybolovu, obrana výhradní ekonomické zóny a potlačování ilegální imigrace. Všechny jednotky jsou v aktivní službě vyjma HMAS Bundaberg, kterou dne 11. srpna 2014 během údržby v doku těžce poškodil požár, a proto byla 18. prosince 2014 vyřazena."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%85%B8%E7%B2%98%E8%86%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Gray1058.png","page_title":"腸粘膜","context_page_description":"腸粘膜は、腸壁の一部を形成し、機能解剖学的に機能に特化した一般の組織と少し異なった形状を有している。腸壁は4つの同軸状の層に分けられる。\\n粘膜\\n粘膜下層\\n筋層\\n外膜または漿膜"},{"page_url":"https://de.wikipedia.org/wiki/Philippinische_Stammest%C3%A4towierung","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Visayans_1.png","page_title":"Philippinische Stammestätowierung","context_page_description":"Die philippinisch Stammestätowierung ist eine bis in die vorkoloniale Zeit der Philippinen zurückreichende Tradition mehrerer Ethnien, für die vor allem die Kopfjägerstämme der nördlichen Kordilleren Luzons bekannt ist. Gängige Motive sind geometrische Elemente wie Linien und Kreise oder Tierschuppen, Tiere und Himmelskörper. Neben Tätowierungen wurden in einigen Regionen ebenso Skarifizierungen durchgeführt."},{"page_url":"https://fr.wikipedia.org/wiki/Lillian_M%C3%BCller","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Lillian_M%C3%BCller.jpg","page_title":"Lillian Müller","context_page_description":"Lillian Müller est un modèle de charme et une actrice de cinéma et de télévision. Elle a été playmate de Playboy en août 1975 puis Playmate de l'Année en 1976."},{"page_url":"https://en.wikipedia.org/wiki/Young_Woman%27s_Journal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/YW_Journal_1889.jpg","page_title":"Young Woman's Journal","context_page_description":"The Young Woman's Journal was an official publication of The Church of Jesus Christ of Latter-day Saints for the Young Ladies' Mutual Improvement Association, then the LDS Church's organization for adolescent females."},{"page_url":"https://fr.wikipedia.org/wiki/Prison_de_Celle","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Celle_JVA_Wappen_Innenhof.JPG","page_title":"Prison de Celle","context_page_description":"La maison d'arrêt de Celle est le centre de détention pour hommes le plus sécurisé de Basse-Saxe, possédant le statut de quartier de haute sécurité."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%BF%E6%B5%8E%E5%AF%BA%E5%A4%A7%E9%9B%84%E5%AE%9D%E6%AE%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Wutai_Guangji_Si_2013.08.28_08-45-08.jpg","page_title":"广济寺大雄宝殿","context_page_description":"广济寺大雄宝殿位于中国山西省五台县台城镇东米市街，2001年被列为第五批全国重点文物保护单位。现为五台县博物馆、五台县文物管理所所在地。\\n广济寺始建于元至正年间，现存大雄宝殿，面阔五间，进深三间，单檐悬山顶，殿内有元代塑像一佛二菩萨三大士十八罗汉。殿前有唐代经幢一座。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%8B%89%E9%BD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Portrait_of_Rhazes_%28al-Razi%29_%28AD_865_-_925%29_Wellcome_L0005053_%28cropped%29.jpg","page_title":"拉齐","context_page_description":"拉齊，波斯醫師、鍊金術師、化學家、哲學家。他博學多才，為早期醫學、化學、音樂和哲學領域做出很大貢獻。醫學方面，他發現天花與麻疹是兩種不同的疾病，並最早闡明了過敏和免疫的原理。化學上，他發現乙醇，並認為元素嬗變為金銀是可能的。他創立了完善的蒸餾和提取方法，並通過蒸餾綠礬和石油，分別發現硫酸和煤油。一生著有200部書籍和文章，記載了他在各領域的探索。"},{"page_url":"https://fr.wikipedia.org/wiki/Moldefjord","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/MF_Romsdal.jpg","page_title":"Moldefjord","context_page_description":"Le Moldefjord est un fjord de Norvège, constituant une partie du Romsdalsfjord, au sud de la commune de Molde.\\nLe fjord débute à l'ouest au détroit de Julsundet qui part vers le nord. Il s'étend sur 13 km de longueur et se poursuit à l'est sous le nom de Fannefjord. La longueur total de ces deux fjords est de 38 km.\\nEn largeur, il s'étend de la ville de Molde à l'archipel de Molde. Ces îles séparent le Moldefjord du reste du Romsdalsfjord. Les plus grandes de ces îles sont Hjertøya, Seterøya et Fårøya.\\nLa limite entre le Moldefjord et le Fannefjord est une ligne imaginaire reliant le quartier de Kviltorp à l'île de Bolsøya."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B9%D8%B1%D9%83%D8%A9_%D8%A7%D9%84%D8%B1%D9%85%D9%84%D8%A9_(1105)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Ramla1105.jpg","page_title":"معركة الرملة (1105)","context_page_description":"المعركة الرملة الثالثة، وقعت في 27 أغسطس 1105 بين الصليبيين من بيت المقدس والفاطميين من مصر. تقع بلدة الرملة على الطريق الممتد بين بيت المقدس إلى عسقلان، وأصبحت لاحقاً من أكبر الحصون الفاطمية في فلسطين. من عسقلان، شن الوزير الفاطمي الأفضل شاهنشاه هجماته السنوية على المملكة الصليبية حديثة النشأة من عام 1099 حتى 1107. من بين ثلاث معارك وقعت في الرملة في أوائل القرن 12، كانت الثالثة الأكثر دموية."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D0%BA%D0%B0%D0%B4_(%D0%95%D1%80%D0%B5%D0%B2%D0%B0%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/2014_Erywa%C5%84%2C_Kaskady_%2802%29.jpg","page_title":"Каскад (Ереван)","context_page_description":"«Каскад» — архитектурно-монументальный комплекс в Ереване. Представляет собой каскад из пяти открытых террас. С 2009 года в комплексе «Каскад» действует художественный музей — Центр искусств Гафесчяна.\\nСтроительство сооружения началось в 1980 году. К 2019 году недостроенной остаётся верхняя часть."},{"page_url":"https://de.wikipedia.org/wiki/Stammesgeschichte_der_Krokodile","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Isisfordia.jpg","page_title":"Stammesgeschichte der Krokodile","context_page_description":"Die heutigen Krokodile sind die modernsten Vertreter einer Entwicklungslinie der Archosaurier, die sich bereits vor etwa 250 Millionen Jahren, in der frühen Trias, von der Linie der Flugsaurier und Dinosaurier getrennt hat."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Waldb%C3%B6ckelheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Katholische_Pfarrkirche_St.Bartholom%C3%A4us_Waldb%C3%B6ckelheim.jpg","page_title":"Liste der Kulturdenkmäler in Waldböckelheim","context_page_description":"In der Liste der Kulturdenkmäler in Waldböckelheim sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Waldböckelheim aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://id.wikipedia.org/wiki/Oxyopes_sunandae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Oxyopes_sunandae_04674.jpg","page_title":"Oxyopes sunandae","context_page_description":"Oxyopes sunandae adalah spesies laba-laba yang tergolong famili Oxyopidae. Spesies ini juga merupakan bagian dari genus Oxyopes dan ordo Araneae. Nama ilmiah dari spesies ini pertama kali diterbitkan pada tahun 1970 oleh Tikader.\\nLaba-laba ini biasanya banyak ditemui di India."},{"page_url":"https://pt.wikipedia.org/wiki/Colleville-Montgomery","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Plage_Colleville-Montgomery.JPG","page_title":"Colleville-Montgomery","context_page_description":"Colleville-Montgomery é uma comuna francesa na região administrativa da Normandia, no departamento Calvados. Estende-se por uma área de 7,73 km². Em 2010 a comuna tinha 2 169 habitantes."},{"page_url":"https://pt.wikipedia.org/wiki/St._Aegyd_am_Neuwalde","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/St._Aegyd_am_Neuwalde-Bf-scan-01.jpg","page_title":"St. Aegyd am Neuwalde","context_page_description":"St. Aegyd am Neuwalde é um município da Áustria localizado no distrito de Lilienfeld, no estado de Baixa Áustria."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AF%9B%E5%88%A9%E5%90%89%E5%B0%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Toukouji-Hagi_09.jpg","page_title":"毛利吉就","context_page_description":"毛利 吉就は、江戸時代前期の大名。長州藩3代藩主。"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Tresneau","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/R%C3%A9quisition_de_l%27argenterie_dans_les_maisons_d%27%C3%A9migr%C3%A9s_%C3%A0_la_R%C3%A9volution.jpg","page_title":"Château de Tresneau","context_page_description":"Le château de Tresneau est un château situé sur la grande route de Paris au Mans, à vingt-deux lieues de Paris, dans la paroisse de Thimert et Ardelles, généralité d'Alençon. Le fief dépend à l'origine de la baronnie de Châteauneuf-en-Thymerais. Le manoir de Tresneau, attesté depuis le XVIᵉ siècle, est transformé ultérieurement en château puis vendu comme bien national à la Révolution Française avant d'être détruit au début du XIXᵉ siècle. Aujourd'hui, seuls une partie des fossés et quelques reliquats de murs attestent de l'emplacement du château disparu."},{"page_url":"https://en.wikipedia.org/wiki/George_F._Kennan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/George_F._Kennan_1947.jpg","page_title":"George F. Kennan","context_page_description":"George Frost Kennan was an American diplomat and historian. He was best known as an advocate of a policy of containment of Soviet expansion during the Cold War. He lectured widely and wrote scholarly histories of the relations between the USSR and the United States. He was also one of the group of foreign policy elders known as \\"The Wise Men\\".\\nDuring the late 1940s, his writings inspired the Truman Doctrine and the U.S. foreign policy of \\"containing\\" the Soviet Union. His \\"Long Telegram\\" from Moscow during 1946 and the subsequent 1947 article The Sources of Soviet Conduct argued that the Soviet regime was inherently expansionist and that its influence had to be \\"contained\\" in areas of vital strategic importance to the United States. These texts provided justification for the Truman administration's new anti-Soviet policy. Kennan played a major role in the development of definitive Cold War programs and institutions, notably the Marshall Plan.\\nSoon after his concepts had become U.S. policy, Kennan began to criticize the foreign policies that he had seemingly helped begin."},{"page_url":"https://sk.wikipedia.org/wiki/Polyp_(medic%C3%ADna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Polyp-2.jpeg","page_title":"Polyp (medicína)","context_page_description":"Polyp je slovo gréckeho pôvodu, ktorým sa označuje výrastok spojený so sliznicou stopkou. Polypy môžu byť kdekoľvek v tráviacom trakte. V našich podmienkach majú najväčší význam polypy hrubého čreva. V súčasnej dobe označujeme ako polypy aj prisadnuté a plošné slizničné útvary. Popis prvého prípadu polypu sa pripisuje Mentzelovi z roku 1721.\\nPodľa vzhľadu a histologického obrazu vieme odhadnúť biologické vlastnosti polypov a polypy rozdeľujeme na:\\nNon-neoplastické polypy:\\nhyperplastické\\nzápalové\\npseudopolypy\\nhamartómy\\nNeoplastické polypy:\\npílovié\\nadenómy\\nkarcinómy\\nNon-neoplastické polypy nemajú ďalšej transformácie na rozdiel od neoplastických lézií. Popis paradigmy sekvencie adenóm - karcinóm bol postulovaný Jackmanom v roku 1951.\\nVzhľadovo sa používa na hodnotenie slizničných lézií Parížska klasifikácia, ktorej základom je hodnotenie morfologických slizničných útvarov v žalúdku podľa. Parížska klasifikácia sa používa na označenie lézií celého tráviaceho traktu.\\nPodľa tohto označujeme polypy, ktoré sú povrchové a budia dojem včasných lézií ako typ 0. Ďalej delíme povrchové lézie na polypoidné a nepolypoidné.\\nPolypoidné lézie\\nstopkaté polypy sa označujú ako 0-Ip"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%97%E0%B5%8D%E0%B4%B0%E0%B5%80%E0%B5%BB_%E0%B4%AA%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B4%BE%E0%B4%AF_%E0%B4%B8%E0%B4%BE%E0%B4%B2%E0%B4%A1%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Som_tam_thai.JPG","page_title":"ഗ്രീൻ പപ്പായ സാലഡ്","context_page_description":"ഗ്രീൻ പപ്പായ സാലഡ് വിളയാത്ത പപ്പായയിൽ നിന്നും ഉണ്ടാക്കുന്ന ഒരു എരിവുള്ള സാലഡ് ആണ്. എത്തിനിക് ലയോ ജനങ്ങളിൽ നിന്നാണ് ഒരുപക്ഷേ ഇതുത്ഭവിച്ചിരിക്കാം എന്നു കരുതുന്നു. ഇത് തെക്കുകിഴക്കൻ ഏഷ്യയിലെ ജനങ്ങളും ഭക്ഷിക്കുന്നുണ്ട്. കംബോഡിയയിൽ ബോക് ഐ' ഹോംഗ് എന്ന് പ്രാദേശികമായി അറിയപ്പെടുന്നു. ലയോസിൽ ടാം സോം അല്ലെങ്കിൽ പ്രത്യേകിച്ച് ടാം മാക്ക് ഹൂങ് എന്നിങ്ങനെ അറിയപ്പെടുന്നു. തായ്ലൻറിൽ സോം ടാം എന്നും വിയറ്റ്നാമിൽ gỏi đu đủ എന്നും അറിയപ്പെടുന്നു. സോം ടാം തായ് വ്യത്യസ്തത CNN Go 2011- ൽ സമാഹരിച്ചതിൽ ലോകത്തിലെ ഏറ്റവും രുചികരമായ 50 ഭക്ഷണപദാർത്ഥങ്ങളിലെ ലിസ്റ്റിൽ 46-ാം സ്ഥാനത്താണ്."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BC%D0%B5%D0%BB%D1%8C%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Mehmels_in_SM.png","page_title":"Мемельс","context_page_description":"Мемельс — громада в Німеччині, розташована в землі Тюрингія. Входить до складу району Шмалькальден-Майнінген. Складова частина об'єднання громад Вазунген-Амт-Занд.\\nПлоща — 6,46 км². Населення становить 334 ос."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC111%E6%88%98%E6%96%97%E6%9C%BA%E4%B8%AD%E9%98%9F_(%E7%BE%8E%E5%9B%BD%E6%B5%B7%E5%86%9B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Fighter_Squadron_111_%28United_States_Navy%29_insignia%2C_1981.png","page_title":"第111战斗机中队 (美国海军)","context_page_description":"第111戰鬥機中隊，也被稱為「夕陽西下」、「落日」、「射日者」等，是美國海軍中由兩支中隊合併而成的戰鬥機中隊，服役期間從1942年到1995年。第一個中隊，最初指定為VF-11，作為一個服役的太平洋艦隊戰鬥機中隊，直到它在1959年解體。在當時，另一個中隊後假設指定其在1995年之前解體。2006年11月，VFC-13基韋斯特被改為VFC-111，綽號命名為「流浪漢」作為其中隊呼號並延用了其徽章。新成立的VFC-111為海軍假想敵中隊，使用戰機為F-5."},{"page_url":"https://de.wikipedia.org/wiki/Church_in_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Newport_Cathedral.jpg","page_title":"Church in Wales","context_page_description":"Die Church in Wales ist die Mitgliedskirche der Anglikanischen Gemeinschaft für Wales. Die Church in Wales ist Mitglied der Porvoo-Gemeinschaft und hat mit diesen Kirchen volle Kirchengemeinschaft vereinbart."},{"page_url":"https://it.wikipedia.org/wiki/Sezze","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/04018_Sezze_LT%2C_Italy_-_panoramio_%283%29.jpg","page_title":"Sezze","context_page_description":"Sezze è un comune italiano di 24 864 abitanti della provincia di Latina nel Lazio.\\nTalvolta il paese è erroneamente citato come Sezze Romano, nome però che appartiene alla sola stazione ferroviaria."},{"page_url":"https://de.wikipedia.org/wiki/Taubenturm_Manoir_du_Repaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Saint-Front-d%27Alemps_Repaire_%286%29.JPG","page_title":"Taubenturm Manoir du Repaire","context_page_description":"Der Taubenturm des Manoir du Repaire in Saint-Front-d’Alemps, einer französischen Gemeinde im Département Dordogne in der Region Nouvelle-Aquitaine, wurde vermutlich im 17./18. Jahrhundert errichtet und steht unter Denkmalschutz.\\nDer rechteckige Taubenturm aus Bruchstein mit Eckquaderung aus Haustein steht am Rande des Manoir. Das Pyramidendach wird von flachen Ziegeln gedeckt."},{"page_url":"https://fi.wikipedia.org/wiki/2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Water_on_the_field_in_Kuortane%2C_Finland_in_2013%288%29.jpg","page_title":"2013","context_page_description":"2013 oli normaalivuosi, joka alkoi tiistaista.\\nYhdistyneiden kansakuntien julistamia vuoden teemoja olivat kansainvälinen kvinoan vuosi ja kansainvälinen vesiyhteistyön vuosi."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E5%B7%A6%E5%96%B6%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%E6%8D%B7%E9%81%8B%E5%B7%A6%E7%87%9F%E7%AB%991%E8%99%9F%E5%87%BA%E5%8F%A3_2008-03-21.jpg","page_title":"新左営駅","context_page_description":"新左営駅は台湾高雄市左営区にある、台湾鉄路管理局縦貫線の駅。\\n併設されている台湾高速鉄道・高雄捷運の左営駅についても本項で述べる。"},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Siracusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Cappella_di_Santa_Lucia_-_Duomo_di_Siracusa.jpg","page_title":"Duomo di Siracusa","context_page_description":"La cattedrale della Natività di Maria Santissima sorge sulla parte elevata dell'isola di Ortigia, incorporando quello che fu il principale tempio sacro in stile dorico della polis di Syrakousai, dedicato ad Atena e convertito in chiesa con l'avvento del cristianesimo.\\nConsiderata la chiesa più importante della città di Siracusa, è entrata a far parte dei beni protetti dall'UNESCO in quanto patrimonio dell'umanità. Il suo stile è all'esterno principalmente barocco e rococò, mentre al suo interno alterna parti risalenti all'epoca siceliota, poiché appartenenti al tempio greco e parti risalenti all'epoca medievale, costruite dai Normanni e così lasciate fino ai giorni attuali. La sua struttura interna è composta in diverse navate e cappelle, le quali hanno uno stile classico e decorato, tipico del barocco anch'esso.\\nDi grande significato religioso, custodisce statue, reliquie e spoglie di santi, martiri e nobili siracusani. I suoi arredi hanno visto il susseguirsi di artisti provenienti da più parti d'Italia e dall'estero. Da sempre simbolo della religiosità siracusana, la cattedrale attraversò le varie fasi storiche e culturali della città."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8E%84%E7%AB%8B%E7%89%B9%E9%87%8C%E4%BA%9E%E7%A6%AE%E5%A4%A9%E4%B8%BB%E6%95%99%E6%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Christian_cross.svg","page_title":"厄立特里亞禮天主教會","context_page_description":"厄利垂亞禮天主教會是羅馬天主教的一部分，為亞歷山大禮拜儀式傳統的一個分支，是東儀天主教會成員之一。該教會是完全與羅馬天主教共融的。易言之他們承認羅馬教宗的領袖地位。現在，它的信徒主要分布在厄利垂亞。現任都主教為吉斯特伯·塔斯法馬連。"},{"page_url":"https://en.wikipedia.org/wiki/Amber","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Amber_Fisher.jpg","page_title":"Amber","context_page_description":"Amber is fossilized tree resin that has been appreciated for its color and natural beauty since Neolithic times. Much valued from antiquity to the present as a gemstone, amber is made into a variety of decorative objects. Amber is used in jewelry. It has also been used as a healing agent in folk medicine.\\nThere are five classes of amber, defined on the basis of their chemical constituents. Because it originates as a soft, sticky tree resin, amber sometimes contains animal and plant material as inclusions. Amber occurring in coal seams is also called resinite, and the term ambrite is applied to that found specifically within New Zealand coal seams."},{"page_url":"https://pl.wikipedia.org/wiki/Allison_Williams","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Allison_Williams_%2827863499619%29_%28cropped%29.jpg","page_title":"Allison Williams","context_page_description":"Allison Williams – amerykańska aktorka, komik i wokalistka. Grała m.in. w serialu Dziewczyny i filmie Uciekaj!"},{"page_url":"https://gl.wikipedia.org/wiki/Agnieszka_Holland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Holland_Agnieszka.JPG","page_title":"Agnieszka Holland","context_page_description":"Agnieszka Holland, nada en Varsovia o 28 de novembro de 1948, é unha directora de cinema e televisión polaca.\\nMoi recoñecida polas súas contribucións á nova vaga do cinema polaco, Agnieszka Holland está considerada como unha das máis prominentes cineastas polacas."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Podol%C3%AD_(Praha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%C4%8Cesk%C3%BD_yacht_klub.jpg","page_title":"Seznam kulturních památek v Podolí (Praha)","context_page_description":"Tento seznam nemovitých kulturních památek v části Podolí v hlavním městě Praze vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nStaré Město, Nové Město, Malá Strana, Hradčany, Josefov, Vyšehrad a z malé části Vinohrady, Holešovice, Podolí a Smíchov jsou od roku 1971 jako Pražská památková rezervace městskou památkovou rezervací. Z Podolí spadá do rezervace oblast s podolskou porodnicí ohraničená územím Vyšehradu, Podolským nábřežím a ulicí U podolského sanatoria."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1937","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/StrengholtWesseling1987.jpg","page_title":"Lijst van personen geboren in 1937","context_page_description":"Dit is een lijst van personen die geboren zijn in 1937.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%A2n_Ch%C3%A2u_(th%E1%BB%8B_x%C3%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Binh_Minh_Bo_song_tan_chau%2C_tp._Tan_chau%2C_Angiang%2C29-10-2013_dyt_-_panoramio.jpg","page_title":"Tân Châu (thị xã)","context_page_description":"Tân Châu là một thị xã thuộc tỉnh An Giang, Đồng bằng sông Cửu Long, Việt Nam.\\nThị xã Tân Châu cùng với huyện Hồng Ngự thuộc tỉnh Đồng Tháp là điểm đầu nguồn của sông Tiền khi chảy vào Việt Nam.\\nThị xã có cửa khẩu quốc tế đường sông Vĩnh Xương. Sản phẩm của thị xã là lụa Tân Châu nổi tiếng bóng láng được nhuộm màu đen bằng trái mặc nưa."},{"page_url":"https://eo.wikipedia.org/wiki/Klaso_EF65_de_JNR","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/EF65-535.JPG","page_title":"Klaso EF65 de JNR","context_page_description":"JNF Klaso EF65 estas elektra lokomotivo de Japana Nacia Fervojo. Ekde 1965 ĝis 1979 la lokomotivo estis produktata en Fuji Electric, Kawasaki Sharyō, Kisha, Nippon Sharyo, Toshiba kaj Toyo. Maksimuma rapideco estas 110 km/h."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Altstadt_(Plauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Stra%C3%9Fberger_Stra%C3%9Fe_5_Plauen_2.JPG","page_title":"Liste der Kulturdenkmale in der Altstadt (Plauen)","context_page_description":"In der Liste der Kulturdenkmale in der Altstadt sind die Kulturdenkmale des Plauener Stadtteils Altstadt verzeichnet, die bis Januar 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale in Plauen."},{"page_url":"https://da.wikipedia.org/wiki/Rigsdagsvalget_i_Finland_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/2015_Finland_opinion_polls.png","page_title":"Rigsdagsvalget i Finland 2015","context_page_description":"Rigsdagsvalget i Finland 2015 blev afholdt den 19. april 2015. Der skulle vælges 200 medlemmer til det finske parlament efter D'Hondts metode. Centerpartiet blev valgets vinder, og deres kandidat Juha Sipilä overtog derfor statsministerposten.\\nIfølge Finlands grundlov skal der holdes rigsdagsvalg hvert fjerde år. Der var 4.463.333 stemmeberettigede til valget i Finland."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%AA%E6%80%A5%E8%A5%BF%E5%AE%AE%E3%82%AC%E3%83%BC%E3%83%87%E3%83%B3%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/HANKYU_NISHINOMIYA_GARDENS.jpg","page_title":"阪急西宮ガーデンズ","context_page_description":"阪急西宮ガーデンズは、兵庫県西宮市にあるショッピングセンターである。阪急西宮スタジアム跡地の再開発として建設され、2008年11月26日にオープンした。オープン時、西日本最大級で国内でも3番目の広さを誇る。"},{"page_url":"https://nl.wikipedia.org/wiki/Bisdom_Patti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Cattedrale_Patti_05.JPG","page_title":"Bisdom Patti","context_page_description":"Het bisdom Patti is een in Italië gelegen rooms-katholiek bisdom met zetel in de stad Patti in de provincie Messina op het eiland Sicilië. Het bisdom behoort tot de kerkprovincie Messina-Lipari-Santa Lucia del Mela en is, samen met het bisdom Nicosia, suffragaan aan het aartsbisdom Messina-Lipari-Santa Lucia del Mela."},{"page_url":"https://en.wikipedia.org/wiki/Michael_Gulezian","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Michael_Gulezian_Sept_7_2010.png","page_title":"Michael Gulezian","context_page_description":"Michael Gulezian is an American composer and fingerstyle guitarist. He is noted for dramatic compositions, a penchant for manipulating metre, an affinity for open tunings, and an unconventionally free two-handed technical approach. Gulezian's use of bottleneck slide on 12-string guitar, coupled with his command of reverse analog reverbs have made his recordings notable for their dream-like sonic atmosphere. Gulezian inhabits a musical territory between his mentor John Fahey and Gulezian's friend and colleague Michael Hedges."},{"page_url":"https://it.wikipedia.org/wiki/%C4%8Cesk%C3%A1_Metuje","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%C4%8Cesk%C3%A1_Metuje_znak.jpg","page_title":"Česká Metuje","context_page_description":"Česká Metuje è un comune della Repubblica Ceca facente parte del distretto di Náchod, nella regione di Hradec Králové."},{"page_url":"https://sv.wikipedia.org/wiki/Narva_f%C3%B6rsamling","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Aleksandri-kirik2.jpg","page_title":"Narva församling","context_page_description":"Narva församling är en församling som tillhör Viru kontrakt inom den Estniska evangelisk-lutherska kyrkan. Församlingen omfattar städerna Narva och Sillamäe, delar av staden Kohtla-Järve samt Vaivara kommun i landskapet Ida-Virumaa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_deutscher_Turmh%C3%BCgelburgen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Turmh%C3%BCgel_Altcastell.JPG","page_title":"Liste deutscher Turmhügelburgen","context_page_description":"Dies ist eine Liste deutscher Turmhügelburgen, die heute noch erhalten oder dokumentiert sind."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%A7%D9%85_%D8%B3%D8%A7%D8%B1%DA%AF%D8%B3%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Aram_Sargsyan_2010.jpg","page_title":"آرام سارگسیان","context_page_description":"آرام زاونی سارگسیان یک سیاست‌مدار اهل ارمنستان است. وی از ۳ نوامبر ۱۹۹۹ تا ۲ مه ۲۰۰۰ نخست وزیر ارمنستان بود. سارگسیان همچنین نماینده دوره‌های سوم و ششم مجلس ملی جمهوری ارمنستان بوده‌است."},{"page_url":"https://nn.wikipedia.org/wiki/Statens_kartverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kartverket_hovedinngang.JPG","page_title":"Statens kartverk","context_page_description":"Statens kartverk eller Kartverket er ei norsk forvaltingsbedrift. Frå mars 2012 blir kortforma Kartverket nytta i det meste av den eksterne kommunikasjonen. Hovudkontoret ligg på Hvervenmoen ved Hønefoss i Ringerike kommune. Forvaltingsmessig er Kartverket lagt under Kommunal- og moderniseringsdepartementet.\\nKartverket si oppgåve er å ivareta behovet i Noreg for kartinformasjon, som kartseriar og eigedomsinformasjon. Dette gjeld både fastlandet, havområda og kystområda rundt Noreg, Svalbard og Jan Mayen."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_D_du_RER_d%27%C3%8Ele-de-France","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Z20500_Corbeil_Essonnes.JPG","page_title":"Ligne D du RER d'Île-de-France","context_page_description":"La ligne D du RER d'Île-de-France, plus souvent simplement nommée RER D, est une ligne du réseau express régional d'Île-de-France qui dessert une grande partie de la région Île-de-France selon un axe nord-sud. Elle relie Orry-la-Ville et Creil au nord à Melun, Corbeil-Essonnes et Malesherbes au sud, en passant par le cœur de Paris.\\nOuverte par étapes de 1987 à 1996, elle est à la fois la première ligne de RER par sa longueur avec 197,073 km et la ligne SNCF la plus fréquentée de France avec 615 000 voyageurs et 466 trains par jour ouvrable en 2016.\\nLa quasi-totalité de la ligne se situe en Île-de-France, donc dans le ressort d'Île-de-France Mobilités mais la section entre la gare de La Borne Blanche et la gare de Creil, au nord, et la gare de Malesherbes, au sud, se situent en dehors de la région, dans l'Oise, région Hauts-de-France, pour les gares situées au-delà de la gare de Survilliers - Fosses, et dans le Loiret, région Centre-Val de Loire, pour Malesherbes. Les gares concernées sont donc aussi hors de la tarification Île-de-France. La ligne comprend trois arrêts dans Paris intra-muros : Gare du Nord, Châtelet - Les Halles et Gare de Lyon."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%D8%B3%DA%A9%D8%A7%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Pescara_2007_-Casa_natale_di_Gabriele_D%27Annunzio-_by-RaBoe_01.jpg","page_title":"پسکارا","context_page_description":"پسکارا ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۲۳۱۰۳ نفر ایمیش. و آبروتزو اوستانیندا یئرلشیب."},{"page_url":"https://war.wikipedia.org/wiki/Rubus_pseudoacer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rubus_pseudoacer.jpg","page_title":"Rubus pseudoacer","context_page_description":"An Rubus pseudoacer in uska species han Magnoliopsida. An Rubus pseudoacer in nahilalakip ha genus nga Rubus, ngan familia nga Rosaceae."},{"page_url":"https://en.wikipedia.org/wiki/Garthamlock","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Craigend_and_Garthamlock_Water_Towers_-_geograph.org.uk_-_83929.jpg","page_title":"Garthamlock","context_page_description":"Garthamlock is a suburb in the north-east of the Scottish city of Glasgow. It is situated north of the River Clyde. Provanhall is the nearest neighbourhood to the east; Craigend is directly to the west with Hogganfield Park and Ruchazie beyond. Garthamlock is separated from Cranhill and Queenslie to the south by the M8 motorway. An area of open ground is to the north. The local landmarks are two water towers, which are illuminated at night.\\nGarthamlock was developed from 1954 onwards as part of the 'Greater Easterhouse' rehousing scheme after the city bought the estate of Garthamlock House; the house was demolished in 1955 to make way for a new secondary school. After many of the original tenements were demolished from the 1980s onwards, the area is now a mix of local authority housing and private stock, particularly following the construction of a major private development by Persimmon Homes in the 2010s.\\nThe Glasgow Fort shopping centre was built to the east of Garthamlock, partly on a disused quarry and partly on the grounds of Provan Hall House and Park."},{"page_url":"https://hu.wikipedia.org/wiki/Wettenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Wappen_Wettenberg.png","page_title":"Wettenberg","context_page_description":"Wettenberg település Németországban, Hessen tartományban. Lakosainak száma 12 541 fő. +/-"},{"page_url":"https://hr.wikipedia.org/wiki/Zvonili_ste,_milorde%3F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Jeffrey_Holland.jpg","page_title":"Zvonili ste, milorde?","context_page_description":"Zvonili ste, milorde? je sitcom televizijskog programa BBC-a, koji su napisali Jimmy Perry i David Croft, tvorci Tatine armije i Hi-de-Hi!. Emitirana je između 1990. i 1993. na BBC-u. Radnja se događa u kući aristokratske obitelji 1920-ih, a radnja se vrti oko obitelji više klase i njihovih slugu u kući u Londonu.\\nU seriji su sudjelovali mnogi glumci koji su se također pojavili u njihovim ranijim serijama, a osobito Paul Shane, Jeffrey Holland i Su Pollard, koji su svi prije bili u sitcomu Hi-de-Hi!; također su bili nazočni Donald Hewlett i Michael Knowles iz filma It Ain't Half Hot Mum, te Bill Pertwee i - povremeno - Frank Williams iz Tatine vojske. Mnogo malih uloga igrali su i drugi alumni Davida Crofta i / ili Jimmy Perryja. Nezaboravljivu glazbenu temu u stilu 1920-ih otpjevao je Bob Monkhouse.\\nEpizode Zvonili ste, milorde? trajale su pedeset minuta, a ne uobičajenih trideset, i pokušali su uvesti refleksivniji pristup i složenije zacrtavanje od ostalih Croft i Perry serijala. Bilo je i manje oslanjanja na lokacije snimanja. Serija po izlasku nije bila najbolje prihvaćena od strane kritičara, ali je s vremenom stekla vjernu publiku."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Wells_Fargo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Wells_Fargo_Silver_Reef_HABS_UT1pv.jpg","page_title":"History of Wells Fargo","context_page_description":"The new company chose to retain the name of \\"Wells Fargo\\" and so this article also includes the history after the merger."},{"page_url":"https://no.wikipedia.org/wiki/Suat_Hayri_%C3%9Crg%C3%BCpl%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Suat_%C3%9Crg%C3%BCpl%C3%BC.jpg","page_title":"Suat Hayri Ürgüplü","context_page_description":"Suat Hayri Ürgüplü var en tyrkisk diplomat, jurist og rikspolitiker som var statsminister i Tyrkia i 1965.\\nSuat Hayri Ürgüplü var sønn av politikeren Ürgüplü Hayri Efendi, en geistlig embetsmann som hadde en sentral rolle i den Ung-tyrkiske bevegelsen. Ürgüplü utannet seg som jurist og arbeidet som dommer før han gikk inn i politikken. Han var også diplomat og var i perioden 1952-60 Tyrkias ambassadør i Bonn, London, Madrid og Washington, DC. Han var også i en periode Tyrkias representant ved Europa-rådet.\\nÜrgüplü ble innvalgt i det tyrkiske parlamentet i 1939 og satt der med noen opphold til 1972. Ved valget i 1961, da de militære gav makten tilbake til de sivile, stilte han seg som uavhengig og ble valgt inn i senatet ved hjelp av Rettspartiet. Han fungerte som senatspresident fra 1963 og frem til han ble statsminister i februar 1965. Han måtte gå av etter et valgnederlag i oktober samme år. Han stilte som statsministerkandidat på ny våren 1972, men trakk kandidaturet etter at president Cevdet Sunay forkastet hans ministerliste. Han trakk seg like etter ut av rikspolitikken."},{"page_url":"https://de.wikipedia.org/wiki/John_Masefield","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/JohnMasefield1912.jpg","page_title":"John Masefield","context_page_description":"John Edward Masefield war ein britischer Autor, der vor allem für seine realistische bis mystische Lyrik bekannt ist. Von 1930 bis zu seinem Tod war Masefield Poet Laureate der britischen Krone."},{"page_url":"https://pl.wikipedia.org/wiki/Cz%C5%82opy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Stork036.jpg","page_title":"Człopy","context_page_description":"Człopy – wieś w Polsce położona w województwie łódzkim, w powiecie poddębickim, w gminie Uniejów.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa konińskiego."},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_Palermo-Punta_Raisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Palermo_Airport_1.jpg","page_title":"Flughafen Palermo-Punta Raisi","context_page_description":"Der Flughafen Palermo-Punta Raisi „Falcone e Borsellino“ ist der internationale Flughafen der italienischen Großstadt Palermo."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8F%B1%E7%94%B0%E6%98%A5%E8%8D%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Hishida_Witwe.jpg","page_title":"菱田春草","context_page_description":"菱田 春草は、明治期の日本画家。横山大観、下村観山とともに岡倉天心の門下で、明治期の日本画の革新に貢献した。本名は三男治。"},{"page_url":"https://it.wikipedia.org/wiki/Alec_B._Francis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Alex_Francis.jpg","page_title":"Alec B. Francis","context_page_description":"Alec B. Francis è stato un attore britannico."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A8%B9%E6%9E%97%E6%BF%9F%E5%AE%89%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/ShuLin_JiAn_Temple_%E6%BF%9F%E5%AE%89%E5%AE%AE%E5%89%AA%E9%BB%8F_b_2018.jpg","page_title":"樹林濟安宮","context_page_description":"树林济安宫全名财团法人新北市树林济安宫，建立于清乾隆五十三年四月于潭底山麓，奉祀保生大帝，名曰济安宫，俗称大道公庙或称潭底庙。每年的3月15日保生大帝圣诞千秋举行保生文化祭，当天举行绕境遍及整个树林全区。"},{"page_url":"https://ast.wikipedia.org/wiki/Llocomotora_de_vapor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tarjeta_Postal_de_Guayaquil.jpg","page_title":"Llocomotora de vapor","context_page_description":"La llocomotora de vapor ye un tipu de llocomotora impulsada pola aición del vapor d'agua. El llocomotores de vapor fueron la forma dominante de traición nos ferrocarriles hasta qu'a mediaos del sieglu XX fueron reemplazaes poles llocomotores diésel y llétriques."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%ADrculo_meridiano","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Transit_Instrument.jpg","page_title":"Círculo meridiano","context_page_description":"El círculo meridiano, también llamado anteojo meridiano, es un instrumento de tránsito consistente en un gran telescopio refractor, que puede girar libremente en torno de un eje horizontal colocado en la dirección Este-Oeste, de manera tal que el anteojo se mueva describiendo el meridiano local."},{"page_url":"https://en.wikipedia.org/wiki/Greeks_in_pre-Roman_Crimea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Chersonesos_ruins.jpg","page_title":"Greeks in pre-Roman Crimea","context_page_description":"Greek city-states began establishing colonies along the Black Sea coast of Crimea in the 7th or 6th century BC. Several colonies were established in the vicinity of the Kerch Strait, then known as the Cimmerian Bosporus. The density of colonies around the Cimmerian Bosporus was unusual for Greek colonization and reflected the importance of the area. The majority of these colonies were established by Ionians from the city of Miletus in Asia Minor. By the mid-1st century BC the Bosporan Kingdom became a client state of the late Roman Republic, ushering in the era of Roman Crimea during the Roman Empire."},{"page_url":"https://en.wikipedia.org/wiki/Tchorek_plaques","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Place_of_National_memory_at_Zygmunta_S%C5%82omi%C5%84skiego_Street_02.JPG","page_title":"Tchorek plaques","context_page_description":"Tchorek plaques are a common design of memorial plaque in Warsaw, Poland, used to commemorate places where battles or executions took place during the German occupation of the city during World War II. They are based on an original design by sculptor Karol Tchorek from 1949.\\nThese plaques were installed at various locations in Warsaw from the 1950s until the end of the communist era in Poland, and are one of the most characteristic elements of the landscape of the capital. Many of the original plaques no longer exist, having been removed or destroyed during the ongoing modernisation and expansion of the city and its transport network. However, in 2013 there were still more than 160 Tchorek plaques within the administrative borders of Warsaw."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8C%B6%E7%B5%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/L%E9%99%86%E7%BE%BD%E8%8C%B6%E7%BB%8F.JPG","page_title":"茶経","context_page_description":"『茶経』は、中国唐代の、陸羽によって著された書物である。当時の茶に関する知識を網羅している。10章3巻。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%93%81%E5%B7%9D%E3%82%B7%E3%83%BC%E3%82%B5%E3%82%A4%E3%83%89%E3%83%95%E3%82%A9%E3%83%AC%E3%82%B9%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Shinagawa_seaside_view_tower1_2009.JPG","page_title":"品川シーサイドフォレスト","context_page_description":"品川シーサイドフォレストは、東京都品川区東品川四丁目にある市街地再開発によって生まれたオフィスビルやショッピングセンターなどの複合施設である。通常は品川シーサイドと呼ばれている。\\n元々は日本たばこ産業品川工場などがあった場所で、工場移転より「品川区東品川4丁目第1地区第1種市街地再開発事業」として、日本たばこ産業と鹿島建設が新駅開業に合わせて事業を推進し、りんかい線・品川シーサイド駅と直結するオフィスビルやホテル、ショッピングセンター、集合住宅などの複合施設へと変わった。\\nまた、当地は京浜急行電鉄・青物横丁駅も近接していることから、交通アクセスも良い。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%82%E5%A0%B4%E8%8A%B1%E5%9C%92%E8%A1%8C%E5%8B%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Two_British_Airborne_troops_dug_in.jpg","page_title":"市場花園行動","context_page_description":"市場花園行動是指在第二次世界大戰期間盟軍發動的一次行動，但行動最後以失敗告終。\\n此次行動包含兩個部份：「市場行動」負責空降奪取荷蘭境內主要河川上9個橋樑的控制權，「花園行動」由地面裝甲部隊快速推進，與空降部隊會合，打通進軍德國的路線。此次空降是史上規模最大的空降部隊作戰。戰略目標是在奪得這些橋樑的控制權後，讓盟軍得以跨越德國邊境上最後的天險萊茵河，趁德軍尚未站穩之際，在短時間內結束第二次世界大戰歐洲戰場戰事。\\n此行動開始之初尚稱成功，盟軍在9月20日時攻下位於奈梅亨的瓦爾橋，然而在阿納姆位於萊茵河上的最後一座橋樑，儘管英軍第1空降師已經堅守超過了最初預期的時間，但因步兵援軍無法抵達而無法奪取，行動失敗。一直到1945年3月，萊茵河仍然是盟軍與德國本土間一直無法跨越的屏障。"},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1985_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Stamps_of_Germany_%28DDR%29_1985%2C_MiNr_2987.jpg","page_title":"Briefmarken-Jahrgang 1985 der Deutschen Post der DDR","context_page_description":"Der Briefmarken-Jahrgang 1985 der Deutschen Post der Deutschen Demokratischen Republik umfasste 50 einzelne Sondermarken, drei Briefmarkenblocks mit fünf Sondermarken und zwei Kleinbogen mit zusammen sieben Sondermarken. Eine dieser Marken wurde auch als Einzelmotiv ausgegeben. Zwölf Briefmarken wurden zusammenhängend gedruckt; dabei gab es zwei Paare mit innenliegendem Zierfeld. In diesem Jahr wurden keine Dauermarken ausgegeben. Insgesamt erschienen 73 Motive.\\nAlle Briefmarken-Ausgaben seit 1964 sowie die 2-Mark-Werte der Dauermarkenserie Präsident Wilhelm Pieck und die bereits seit 1961 erschienene Dauermarkenserie Staatsratsvorsitzender Walter Ulbricht waren ursprünglich unbegrenzt frankaturgültig. Mit der Wiedervereinigung verloren alle Marken nach dem 2. Oktober 1990 ihre Gültigkeit."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%DA%A9%DB%8C_%DA%A9%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Bheki_Cele_at_press_conference_on_crime_at_World_Cup_2010-06-29_1.jpg","page_title":"بکی کلی","context_page_description":"بکی کلی، بیر جنوبی آفریقالی سیاستچی و پولیس مأمورودور."},{"page_url":"https://it.wikipedia.org/wiki/Niki_Lauda","image_url":"https://upload.wikimedia.org/wikipedia/it/8/8a/GP_d%27Italia_1984_-_Monza_-_Alboreto%2C_Lauda_e_Patrese.jpg","page_title":"Niki Lauda","context_page_description":"Andreas Nikolaus Lauda, detto Niki, è stato un pilota automobilistico, imprenditore e dirigente sportivo austriaco.\\nTre volte campione del mondo di Formula 1, come imprenditore ha fondato e diretto tre compagnie aeree, la Lauda Air, la Niki e la Laudamotion; come dirigente sportivo, dopo essere stato consulente per Ferrari e avere diretto per due stagioni la Jaguar Racing, dal 2012 fino alla sua morte ha ricoperto la carica di presidente non esecutivo della Mercedes AMG F1.\\nHa disputato 171 Gran Premi, vincendone 25, segnando 24 pole position e altrettanti giri veloci. Ha avuto una carriera sportiva di grande livello guidando per March, BRM, Ferrari, Brabham e, infine, McLaren.\\nConsiderato uno dei migliori piloti della storia, era soprannominato Il computer per via della sua freddezza al volante.\\nNel 1976, sul circuito del Nürburgring, ebbe un grave incidente che lo lasciò parzialmente sfigurato in viso; da ciò l'abitudine di indossare un berretto rosso, un accessorio presto divenuto iconico nella sua immagine pubblica."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%87%91%E8%9E%8D%E4%BA%BA%E7%89%A9%E8%AA%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/%E5%90%B3%E8%B2%9E%E7%9B%A6.jpg","page_title":"金融人物誌","context_page_description":"《金融人物志》，中国金融年鉴社编订，民国37年11月出版，沈雷春发行，艺文书局印刷，黎明书局经销。此书内容主要是介绍1940年代中国的金融界人物，保留了大量珍贵的历史人物照片。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Wuppertaler_Wohnquartier_Ostersbaum_(A%E2%80%93F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Deweerthstra%C3%9Fe_1_Wuppertal_371.jpg","page_title":"Liste der Baudenkmäler im Wuppertaler Wohnquartier Ostersbaum (A–F)","context_page_description":"Die Liste der Baudenkmäler im Wuppertaler Wohnquartier Ostersbaum (A–F) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Wuppertal-Ostersbaum in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Wuppertal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ast.wikipedia.org/wiki/Dominiu_xapon%C3%A9s_de_Taiw%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Takasago_Volunteer_Corps.JPG","page_title":"Dominiu xaponés de Taiwán","context_page_description":"El dominiu xaponés de Taiwán, el periodu colonial de Taiwán, o la ocupación xaponesa de Taiwán referir al periodu ente'l 22 d'ochobre de 1895 y el 25 d'ochobre de 1945, mientres el cual Taiwán foi una colonia del Imperiu de Xapón. La ocupación de Taiwán foi parte de la política xaponesa d'espansión escontra'l sur qu'empezó nel sieglu XIX.\\nTaiwán foi la primer posesión d'ultramar pa'l xaponeses, que convertiríen la islla nuna verdadera «colonia modelo». La resultancia de la política del gobiernu xaponés foi la meyora de la economía, la industria, l'emplegu y la cultura. Sicasí, el dominiu xaponés de Taiwán tamién tuvo consecuencies negatives, como la represión militar de too intentu de resistencia, la discriminación positiva escontra los naturales de Xapón, o l'aumentu de la prostitución femenina.\\nEl relativu fracasu de la dominación china posterior a la Segunda Guerra Mundial per parte del Kuomintang condució a un ciertu grau de señardá na xeneración de taiwaneses qu'esperimentaren dambes. Esto afectó, hasta ciertu puntu, a cuestiones como la identidá nacional, la identidá étnica y el movimientu d'independencia de Taiwán."},{"page_url":"https://fr.wikipedia.org/wiki/Eyjafjallaj%C3%B6kull","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Eyjafjallaj%C3%B6kull_desde_Landeyjah%C3%B6fn%2C_Su%C3%B0urland%2C_Islandia%2C_2014-08-17%2C_DD_004.JPG","page_title":"Eyjafjallajökull","context_page_description":"L'Eyjafjallajökull est une calotte glaciaire du Sud de l'Islande. D'une superficie de 78 km² environ, il est le sixième plus grand glacier du pays sur les treize calottes glaciaires que compte l'Islande. Ce glacier couvre partiellement un massif volcanique, l'Eyjafjöll, ou plus exactement les Eyjafjöll."},{"page_url":"https://es.wikipedia.org/wiki/Parque_nacional_natural_Purac%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Zona_Purace.jpg","page_title":"Parque nacional natural Puracé","context_page_description":"El Parque Nacional Natural Puracé se encuentra en la reserva de biosfera del cinturón andino, región del macizo colombiano perteneciente a la Cordillera Central de los Andes en Colombia. Su superficie hace parte de los departamentos del Cauca y del Huila. Su altitud es de 4646 msnm; dentro del parque se encuentra el volcán Puracé, que es uno de los volcanes más activos de Colombia.​\\nDentro del paisaje de este parque natural, se levanta imponente el volcán Puracé, parte de la cadena volcánica de los Coconucos. También se engloba parte del Macizo Colombiano, donde nacen cuatro de los ríos más caudalosos de Colombia: Magdalena, Cauca, Caquetá y Patía."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Bilal.jpg","page_title":"محمد","context_page_description":"أَبُو القَاسِم مُحَمَّد بنِ عَبد الله بنِ عَبدِ المُطَّلِب هو رسول الله إلى الإنس والجن بحسب ما يؤمن به المُسلمون ؛ أُرسِل ليعيدهم إلى توحيد الله وعبادته شأنه شأن كل الأنبياء والمُرسَلين، وهو خاتمهم، وأُرسِل للنَّاس كافَّة، ويؤمنون أيضا بأنّه أشرف المخلوقات وسيّد البشر، كما يعتقدون فيه العِصمة. عند ذكر اسمه، يُلحِق المسلمون عبارة «‌صلى الله عليه وسلم» مع إضافة «وآله» و«وصحبه» في بعض الأحيان، لِمَا جاء في القرآن والسنة النبوية مما يحثهم على الصلاة عليه. ترك محمد أثرًا كبيرًا في نفوس المسلمين، وكثرت مظاهر محبّتهم وتعظيمهم له باتباعهم لأمره وأسلوب حياته وتعبده لله، وقيامهم بحفظ أقواله وأفعاله وصفاته وجمع ذلك في كتب عُرفت بكتب السّيرة والحديث النبوي، وبالغ بعضهم حتى احتفل بمولده في شهر ربيع الأول. اعتبره الكاتب اليهودي مايكل هارت أعظم الشخصيّات أثرًا في تاريخ الإنسانية كلّها باعتباره «الإنسان الوحيد في التاريخ الذي نجح نجاحًا مطلقًا على المستوى الديني والدنيوي».\\nوُلد في مكة في شهر ربيع الأول من عام الفيل قبل ثلاث وخمسين سنة من الهجرة، ما يوافق سنة 570 أو 571 ميلادياً و52 ق هـ. ولد يتيم الأب، وفقد أمه في سنّ مبكرة فتربى في كنف جده عبد المطلب، ثم من بعده عمه أبي طالب حيث ترعرع، وكان في تلك الفترة يعمل بالرعي ثم بالتجارة."},{"page_url":"https://no.wikipedia.org/wiki/Pekka_Sammallahti","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Pekka_sammallahti.jpg","page_title":"Pekka Sammallahti","context_page_description":"Pekka Lars Kalervo Sammallahti er professor emeritus i samiske språk ved Giellagas-instituttet ved Universitetet i Uleåborg. Sammallahti er den mest sentrale nålevende utforskeren av samisk."},{"page_url":"https://de.wikipedia.org/wiki/Carrozzeria_Garavini","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/S9_bianchi.jpg","page_title":"Carrozzeria Garavini","context_page_description":"Die Carrozzeria Garavini war ein italienischer Hersteller von Automobilkarosserien, der vor allem in der Zwischenkriegszeit Sonderaufbauten für Chassis von Alfa Romeo, Fiat und Lancia produzierte. Neben Aufbauten für Personenwagen entstanden bei Garavini auch Nutzfahrzeuge und Krankenwagen."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AB%8B%E6%96%B9%E9%AB%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Truncated_triangle_prism.png","page_title":"立方體","context_page_description":"在几何学中，立方体，是由6个正方形面组成的正多面体，故又称正六面体、正方体或正立方体。它有12条棱和8个顶，是五个柏拉图立体之一。\\n立方体是一种特殊的正四棱柱、长方体、三方偏方面体、菱形多面体、平行六面体，就如同正方形是特殊的矩形、菱形、平行四边形一様。立方体具有正八面体对称性，即考克斯特BC₃对称性，施莱夫利符号{4,3}，考克斯特-迪肯符号，其对偶多面体为正八面体。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_WWE_pay-per-view_and_WWE_Network_events","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Wrestlemania35live.jpg","page_title":"List of WWE pay-per-view and WWE Network events","context_page_description":"This is a list of WWE pay-per-view and WWE Network events, detailing all professional wrestling cards promoted on pay-per-view and the WWE Network by WWE.\\nWWE has been broadcasting PPV events since the 1980s, when its classic \\"Big Four\\" events were first established. The company's PPV lineup expanded to a monthly basis in the mid-1990s before expanding even further in the early-2000s. Aside from its standard monthly schedule, WWE produced additional international PPVs between 1997 and 2003. These events were not available in the United States and coincided with overseas tours in the United Kingdom. Following WWE's original brand extension in 2002, the company promoted two touring rosters representing its Raw and SmackDown television programs. The traditional \\"Big Four\\" continued to showcase the entire roster, while the remaining PPV events alternated between Raw and SmackDown cards. A special ECW PPV in 2005 led to the creation of an ECW brand in 2006, which also received its own dedicated PPV events. In March 2007, WWE announced that all subsequent PPV events would feature performers from all brands. In 2008, all WWE PPV events began broadcasting in high-definition."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%80%D0%B0-%D0%9C%D0%B8%D1%82%D1%82%D0%B5%D0%BB%D1%8C%D0%B1%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/%D0%9A%D1%80%D0%B5%D0%BC%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D0%B9_%D0%BB%D0%B0%D0%B3%D0%B5%D1%80%D1%8F_%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D1%80%D0%B5%D0%BB%D1%8C%D0%B5%D1%84.JPG","page_title":"Дора-Миттельбау","context_page_description":"Дора-Миттельбау — нацистский концентрационный лагерь, образован 28 августа 1943 года, в 5 км от города Нордхаузена в Тюрингии, Германия, как подразделение уже существовавшего лагеря Бухенвальд."},{"page_url":"https://is.wikipedia.org/wiki/Central-lei%C3%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/South_Ruislip_stn_building.JPG","page_title":"Central-leið","context_page_description":"Central-leið er leið neðanjarðarlestakerfis Lundúnaborgar. Hún er rauð á litinn á korti kerfisins. Hún er 76 km löng og lengsta leið kerfisins. Leiðin þjónar 49 stöðvum en aðeins 20 þeirra eru neðanjarðar. Lestirnar keyra allt að 110 km/klst og eru þá hröðustu lestir kerfisins.\\nÞó að fyrirtækið Central London Railway væri stofnað árið 1891 með það í hug að byggja járnbraut á milli Shepherd's Bush og Bank var það ekki fyrir 27. júní 1900 að járnbráutin var opnuð opinberlega."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%A4%E3%82%B6%E3%83%83%E3%82%AF%E3%83%BB%E3%83%96%E3%83%AD%E3%83%83%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Isaac_Brock_portrait_1%2C_from_The_Story_of_Isaac_Brock_%281908%29.jpg","page_title":"アイザック・ブロック","context_page_description":"アイザック・ブロックは、イギリス陸軍少将であり、イギリスの植民地アッパー・カナダの統治者であった。戦闘における優れた指揮と戦略家としての名声を得、特に米英戦争においては劣勢であったイギリス軍で、アメリカ軍の侵略に対抗した。この功績でナイトの爵位を授けられ、アッパー・カナダの英雄という呼び名も貰った。\\nブロックは1802年にカナダ駐在となり、アメリカ合衆国とカナダの国境の防衛責任者となった。カナダやイギリスの多くの者が米英戦争を避けられると考えていた時、ブロックは戦争に備えて軍隊や民兵の準備を整え始めた。戦争が始まった時、一般大衆の準備はできており、緒戦のマッキナック砦やデトロイト砦で勝利し、アメリカの侵略を止めた。\\nカナダでは兵士の脱走や反乱という苦難にも直面したが、ブロックの英雄的な行動が称えられ、バス勲章も受章した。また、ショーニー族の指導者テカムセと共に戦う機会もあった。クィーンストン・ハイツの戦いにおけるブロックの戦死は、イギリス軍の指導力にとって大きな痛手となった。"},{"page_url":"https://de.wikipedia.org/wiki/Roncesvalles","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Roncesvalles_conjunto.jpg","page_title":"Roncesvalles","context_page_description":"Roncesvalles ist ein Ort in der Autonomen Region Navarra in Spanien. Er liegt in den Pyrenäen am südlichen Fuß des Ibañeta-Passes am Fluss Urrobi.\\nDie Bekanntheit des Ortes ergibt sich zum einen aus seiner Eigenschaft als wichtige Pilgerstation am Jakobsweg, zum andern durch die Schlacht von Roncesvalles am 15. August 778. Dabei wurde die Nachhut des Truppenzuges Karls des Großen unter der Führung von Roland durch die ortsansässigen Basken vernichtet, was die historische Grundlage für das Rolandslied bildete. Dort selbst lässt der Dichter die Mauren unter Marsilis als gegnerische Akteure auftreten, was aber dem damaligen Zeitgeist geschuldet sein dürfte."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D1%83%D1%88%D0%BA%D0%B0_%D1%8D%D1%84%D0%B8%D0%BE%D0%BF%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Erebia_aethiops.jpg","page_title":"Чернушка эфиопка","context_page_description":"Чернушка эфиопка — дневная бабочка из семейства бархатниц, вид рода Erebia."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%B1%B1%E5%AE%B6_(%E7%8C%B6%E4%BB%96%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Rock_Creek_Store_Winter.JPG","page_title":"山家 (猶他州)","context_page_description":"山家是位於美國猶他州杜申縣的一個非建制地區。"},{"page_url":"https://sv.wikipedia.org/wiki/Betongelement","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/DallasHighFiveSegmentalBridge.jpg","page_title":"Betongelement","context_page_description":"Ett betongelement är en byggnadsdel tillverkad av betong som förtillverkas på en fabrik och som sedan monteras ihop med andra betongelement på byggarbetsplatsen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%9C%D7%92%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Wazazbronocic.svg","page_title":"גלגל","context_page_description":"גלגל הוא מכשיר מכני בצורת גליל או טורוס, אשר פעולתו הבסיסית ביותר היא המרת תנועה סיבובית לתנועה בקו ישר. גלגל עם ציר הוא אחד משש המכונות הפשוטות המוכרות עוד מן העת העתיקה של אירואפרסיה. אופן מתייחס באופן פרטני יותר לגלגל המשמש אמצעי תחבורה.\\nגלגלים אינם קיימים בטבע, והגלגל נחשב לאחת ההמצאות העתיקות החשובות ביותר. כיום הגלגל עם ציר הוא הבסיס לתחבורה ולרוב המכונות שנמצאות בשימוש."},{"page_url":"https://pl.wikipedia.org/wiki/Gewestelijk_ExpresNet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Map_of_the_RER_Bruxelles_-_GEN_Brussels.png","page_title":"Gewestelijk ExpresNet","context_page_description":"Gewestelijk ExpresNet, fr. Réseau express régional bruxellois – szybka kolej miejska Regionu Stołecznego Brukseli w budowie. Planowany termin zakończenia 2012 nie został dotrzymany, prawdopodobny termin to 2028.\\n13 grudnia 2015, uruchomiono tymczasowego podrzednika szybkiej kolei miejskiej - ofertę S. Składa się ona z 12 podmiejskich linii kolejowych."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%95%D7%A4%D7%99%D7%99_%D7%93%D7%94_%D7%9C%D7%95%D7%9D_(A_759)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%D0%A0%D0%B0%D0%B7%D0%B2%D0%B5%D0%B4%D1%8B%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%81%D1%83%D0%B4%D0%BD%D0%BE._%D0%9C%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%BE%D1%80%D1%82._Rodos._Greece._%D0%98%D1%8E%D0%BD%D1%8C_2014_-_panoramio.jpg","page_title":"דיופיי דה לום (A 759)","context_page_description":"דיופיי דה לום (A 759) היא אניית ביון של הצי הצרפתי אשר חלק ממשימותיה הוא איסוף אותות ותקשורת מעבר לקווי האויב"},{"page_url":"https://en.wikipedia.org/wiki/Detention_(imprisonment)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Detencao.jpg","page_title":"Detention (imprisonment)","context_page_description":"Detention is the process whereby a state or private citizen lawfully holds a person by removing their freedom or liberty at that time. This can be due to criminal charges preferred against the individual pursuant to a prosecution or to protect a person or property. Being detained does not always result in being taken to a particular area, either for interrogation or as punishment for a crime.\\nThe term can also be used in reference to the holding of property for the same reasons. The process of detainment may or may not have been preceded or followed with an arrest.\\nDetainee is a term used by certain governments and their armed forces to refer to individuals held in custody, such as those it does not classify and treat as either prisoners of war or suspects in criminal cases. It is used to refer to \\"any person captured or otherwise detained by an armed force.\\" More generally, it means \\"someone held in custody.\\" The prisoners in Guantánamo Bay are referred to as \\"detainees\\".\\nArticle 9 of the Universal Declaration of Human Rights provides that \\"[n]o one shall be subjected to arbitrary arrest, detention or exile.\\""},{"page_url":"https://ca.wikipedia.org/wiki/Artana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Artana_23.JPG","page_title":"Artana","context_page_description":"Artana és un municipi del País Valencià situat a la comarca de la Plana Baixa.\\nLimita amb Onda, Betxí, Nules, la Vall d'Uixó, Alfondeguilla, Eslida, l'Alcúdia de Veo i Tales."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%B9%E0%A9%88%E0%A8%A8%E0%A8%B0%E0%A8%BF%E0%A8%95_%E0%A8%B8%E0%A9%88%E0%A8%82%E0%A8%95%E0%A9%80%E0%A8%8F%E0%A8%B5%E0%A8%BF%E0%A9%B1%E0%A8%9A","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Sienkiewicz_grave.JPG","page_title":"ਹੈਨਰਿਕ ਸੈਂਕੀਏਵਿੱਚ","context_page_description":"ਹੈਨਰਿਕ ਆਦਮ ਅਲੈਗਸਾਂਦਰ ਪਿਊਸ ਸੈਂਕੀਏਵਿੱਚ, Henryk Adam Aleksander Pius Sienkiewicz ਇੱਕ ਪੋਲਿਸ਼ ਪੱਤਰਕਾਰ, ਨਾਵਲਕਾਰ ਅਤੇ ਨੋਬਲ ਇਨਾਮ ਜੇਤੂ ਹੈ। ਉਸ ਦੇ ਇਤਿਹਾਸਕ ਨਾਵਲਾਂ ਲਈ, ਵਿਸ਼ੇਸ਼ ਤੌਰ 'ਤੇ ਉਸ ਦੇ ਅੰਤਰਰਾਸ਼ਟਰੀ ਤੌਰ ਤੇ ਜਾਣੇ ਜਾਂਦੇ ਸਭ ਤੋਂ ਵੱਧ ਵਿਕਣ ਵਾਲੇ ਕੂਓ ਵਾਡਿਸ ਲਈ ਉਸ ਨੂੰ ਸਭ ਤੋਂ ਵੱਧ ਯਾਦ ਕੀਤਾ ਜਾਂਦਾ ਹੈ।\\n1860 ਵਿਆਂ ਦੇ ਅਖੀਰ ਵਿਚ ਰੂਸੀ-ਸ਼ਾਸਤ ਕਾਂਗਰਸ ਪੋਲੈਂਡ ਦੇ ਇਕ ਗ਼ਰੀਬ ਪਰਿਵਾਰ ਵਿਚ ਪੈਦਾ ਹੋਏ, ਉਸਨੇ ਪੱਤਰਕਾਰੀ ਅਤੇ ਸਾਹਿਤਕ ਰਚਨਾਵਾਂ ਨੂੰ ਛਾਪਣਾ ਸ਼ੁਰੂ ਕੀਤਾ। 1870 ਵਿਆਂ ਦੇ ਅਖੀਰ ਵਿੱਚ ਉਸਨੇ ਸੰਯੁਕਤ ਰਾਜ ਅਮਰੀਕਾ ਦੀ ਯਾਤਰਾ ਕੀਤੀ ਅਤੇ ਉਥੋਂ ਅਜਿਹੇ ਲੇਖ ਭੇਜੇ ਜਿਨ੍ਹਾਂ ਨਾਲ ਉਸ ਨੇ ਪੋਲਿਸ਼ ਪਾਠਕਾਂ ਵਿੱਚ ਤਕੜੀ ਪ੍ਰਸਿੱਧੀ ਹਾਸਲ ਕੀਤੀ। 1880 ਦੇ ਦਹਾਕੇ ਵਿਚ ਉਸ ਨੇ ਨਾਵਲ ਲੜੀਆਂ ਦੀ ਸ਼ੁਰੁਆਤ ਕੀਤੀ ਜਿਨ੍ਹਾਂ ਨੇ ਉਸਦੀਪ੍ਰਸਿੱਧੀ ਨੂੰ ਹੋਰ ਵਧਾ ਦਿੱਤਾ। ਉਹ ਛੇਤੀ ਹੀ 19 ਵੀਂ ਅਤੇ 20 ਵੀਂ ਸਦੀ ਦੇ ਪ੍ਰਸਿੱਧ ਪੋਲਿਸ਼ ਲੇਖਕਾਂ ਵਿੱਚੋਂ ਇੱਕ ਬਣ ਗਿਆ ਅਤੇ ਹੋਏ ਅਨੇਕ ਅਨੁਵਾਦਾਂ ਨਾਲ ਉਸ ਨੂੰ ਅੰਤਰਰਾਸ਼ਟਰੀ ਪ੍ਰਸਿੱਧੀ ਪ੍ਰਾਪਤ ਹੋਈ, ਅਤੇ \\"ਇੱਕ ਐਪਿਕ ਲੇਖਕ ਦੇ ਤੌਰ ਤੇ ਵਧੀਆ ਯੋਗਤਾਵਾਂ\\" ਲਈ 1905 ਦਾ ਸਾਹਿਤ ਲਈ ਨੋਬਲ ਪੁਰਸਕਾਰ ਪ੍ਰਾਪਤ ਕਰਨ ਦੇ ਨਤੀਜੇ ਵਜੋਂ ਉਸ ਦੀ ਪ੍ਰਸਿੱਧੀ ਨਵੀਆਂ ਬੁਲੰਦੀਆਂ ਛੂਹ ਗਈ।\\nਉਸਦੇ ਬਹੁਤ ਸਾਰੇ ਨਾਵਲ ਛਪਾਈ ਵਿੱਚ ਰਹਿੰਦੇ ਹਨ।"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%AF%CF%86%CF%89%CE%BD%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/1999_Salt_Lake_City_tornado.jpg","page_title":"Σίφωνας","context_page_description":"Σίφωνας στη Μετεωρολογία ή κοινώς σίφουνας ονομάζεται μια ταχέως περιστρεφόμενη στήλη ανέμου που οφείλεται σε πολύ χαμηλή ατμοσφαιρική πίεση στο κέντρο της στήλης και η οποία αποφύεται από τη βάση τεράστιων καταιγιδοφόρων νεφών, γνωστά ως σωρειτομελανίες, έως το έδαφος. Στις Ηνωμένες Πολιτείες ονομάζεται «tornado» ή ενίοτε στην καθομιλουμένη «twister». Πρόκειται για το πλέον έντονο και βίαιο μετεωρολογικό φαινόμενο και από τα πλέον παράξενα της φύσης. Από την άλλη, συνήθως είναι μικρής διαμέτρου και σύντομης χρονικής διάρκειας και, ως αποτέλεσμα, οι καταστροφές που προκαλεί είναι περιορισμένης έκτασης.\\nΟι σίφωνες αποτελούν μια παγκόσμια απειλή, καθώς εμφανίζονται τακτικά σε πάρα πολλά σημεία του πλανήτη και σε όλες τις ηπείρους, εκτός από την Ανταρκτική. Οι ετήσιες ανθρώπινες απώλειες λόγω των σιφώνων ανέρχονται σε 300 - 400 άτομα παγκοσμίως, σύμφωνα με τις επίσημες εκτιμήσεις του Παγκόσμιου Μετεωρολογικού Οργανισμού."},{"page_url":"https://fr.wikipedia.org/wiki/Nouvelle_Jeunesse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/La_jeunesse.jpg","page_title":"Nouvelle Jeunesse","context_page_description":"Nouvelle Jeunesse, sous-titrée en français La Jeunesse, est une revue fondée en 1915 par Chen Duxiu à Shanghai. Elle joue un rôle majeur dans l'introduction des idées occidentales, tant libérales que marxistes, en Chine au début du XXᵉ siècle, avant de devenir une revue du Parti communiste chinois."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%88%D8%B1%D8%B3%D8%A7%D9%88%D9%8A%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/2004-04-10_Larus_michahellis_ad.jpg","page_title":"نورساويات","context_page_description":"النورساويات هي رتيبة من الطيور تتبع طائفة الطيور من شعبة الحبليات."},{"page_url":"https://eo.wikipedia.org/wiki/Koz%C3%A1rovce","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Kozarovce.jpg","page_title":"Kozárovce","context_page_description":"Kozárovce, hungare Garamkovácsi [garamkovAĉi] estas vilaĝo kaj municipo en Slovakio."},{"page_url":"https://en.wikipedia.org/wiki/Grain_damage","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/John_Deere_9660STS_combine_and_J%26M_auger_wagon.jpg","page_title":"Grain damage","context_page_description":"Grain damage is any degradation in the quality of grain. In the current grain trade, this damage can affect price, feed quality, food product quality, and susceptibility to pest contamination. Between the field and the end use, grain may go through any number of handling operations which can each contribute to grain damage. For example, grain might encounter free fall, conveyors, spouts, grain throwers, elevators, hoppers, dryers, and many more. Overall, these handling methods can be evaluated as to what effect they have on the grain. Damaged grain can often be characterized by the extent to which it reduces storage time. For example, cracked or broken kernels are more susceptible to insect or bacteria as well as chemical degradation. The damage to the actual grain is only one example of losses incurred after harvest. In order to quantify grain damage, one must also understand grain quality. Grain quality is a very broad term and can relate to many topics such as foreign material, chemical compositions, mechanical damage, insect infestations, and many more. These references to quality are highly dependent on the end use of the grain."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_Libye","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ottoman_empire_1481-1683.jpg","page_title":"Histoire de la Libye","context_page_description":"La Libye est un pays d'Afrique du Nord, dont le nom dérive de Libou, un peuple berbère connu depuis l'antiquité.\\nSous l'Antiquité, le nom de ce peuple est également à l'origine de celle de la région du continent communément appelée Libye antique, et de la dénomination de Libyens, qui désigne alors les populations nord-africaines berbères.\\nLe territoire de l'actuelle Libye est au cours de l'Histoire, dominé par divers peuples et États, dont l'Empire romain, l'Empire byzantin, l'Empire ottoman, et enfin au XXᵉ siècle le Royaume d'Italie. À la régence de Tripoli sous l'Empire ottoman, succède, à partir de 1911, la colonie italienne de Libye : à cette occasion, le pays reprend l'appellation de Libye, en vigueur sous l'Antiquité. Ce n'est qu'après la Seconde Guerre mondiale, que la Libye émerge en tant que véritable État souverain.\\nLe Royaume de Libye, proclamé en 1951, est renversé en 1969 lors d'un coup d'État mené par Mouammar Kadhafi. Ce dernier exerce ensuite un pouvoir sans partage sur le gouvernement de la Jamahiriya arabe libyenne, occupant une place singulière sur l'échiquier politique international, jusqu'au déclenchement en 2011 d'une révolte armée contre son régime."},{"page_url":"https://hu.wikipedia.org/wiki/Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Entering_Navajo_Indian_Reservation.jpg","page_title":"Arizona","context_page_description":"Arizona az Amerikai Egyesült Államok 48. tagállama. Az ország délnyugati részen található. Nagyrészt sivatagi éghajlatú, a nyarak nagyon forrók, a telek enyhék. Északi területén fenyvesek találhatók. Határos Új-Mexikó, Utah, Nevada és Kalifornia államokkal és 626 km hosszan a mexikói Sonora és Alsó-Kalifornia államokkal.\\nAz állam legnagyobb városa s egyben a fővárosa is Phoenix.\\nArizona sivatagi klímájáról ismert, ahol a nyár szélsőségesen forró, a tél enyhe, de az állam északi fenyőerdővel borított része és a hegyvidék hidegebb, mint a sivatagi terület. A 2006. július 1-jén készült felmérések szerint Arizona lakossága nőtt a leggyorsabban az Egyesült Államokban, meghaladta az addig vezető helyen álló Nevada államot.\\nA Grand Canyonon kívül több más nemzeti parkja és más védett területe van, ezeken kívül indián rezervátumok is találhatóak itt. 1912. február 14-e óta az USA tagállama."},{"page_url":"https://ms.wikipedia.org/wiki/Diaspora_Tamil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/TamilPopulation-World.png","page_title":"Diaspora Tamil","context_page_description":"Diaspora Tamil adalah kumpulan demografi orang Tamil India atau Sri Lanka yang telah menetap di bahagian-bahagian lain di dunia. Populasi diaspora Tamil boleh didapati di Malaysia, Singapura, Indonesia, Tebing Barat, Réunion, Afrika Selatan, Mauritius, Seychelles, Fiji, Guyana, Burma, Trinidad and Tobago, Perancis, Europe, Australia, kanada dan Amerika Syarikat"},{"page_url":"https://en.wikipedia.org/wiki/Teluk_Penyu_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Panorama_of_Teluk_Penyu_Beach%2C_Cilacap%2C_2015-03-21_01.jpg","page_title":"Teluk Penyu Beach","context_page_description":"Teluk Penyu Beach is a brown sand beach in Cilacap, Central Java. Named for its former sea turtle population, the beach is one of the most popular tourist attractions in the area."},{"page_url":"https://no.wikipedia.org/wiki/Val_di_Sole","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Val_di_Sole_2014.jpg","page_title":"Val di Sole","context_page_description":"Val di Sole er en dal og et forvaltningsdistrikt nordvest i den italienske provinsen Trentino. Dalen gjennomstrømmes av elven Noces øvre løp fra vest mot øst, og munner etter Cavizzana ut i Val di Non ved Lago di Santa Giustina.\\nVal di Sole begrenses av Ortlermassivet i nord og av Presanella- og Brentafjellene i syd. Lengst vest i dalen består det en veiforbindelse over Tonalepasset til Val Camonica i Lombardia.\\nDet italienske språket som tales i Val di Sole og Val di Non har visse fellestrekk med retoromanske språk. Dette kan være rester etter et eldre retoromansk språk, som gradvis har blitt italienisert. Vanligvis regnes språket som en dialekt av italiensk, men det fins også lokale krefter som ønsker å få det anerkjent som et eget minoritetsspråk."},{"page_url":"https://en.wikipedia.org/wiki/Alcathoe_bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Myotis_alcathoe_skull.svg","page_title":"Alcathoe bat","context_page_description":"The Alcathoe bat is a European bat in the genus Myotis. Known only from Greece and Hungary when it was first described in 2001, its known distribution has since expanded to Spain, England, Sweden, and Azerbaijan, among other countries. It is similar to the whiskered bat and other species and is difficult to distinguish from them. However, its brown fur is distinctive and it is clearly different in characters of its karyotype and DNA sequences. Although some genetic data suggest that it is related to Geoffroy's bat, other analyses do not support a close relationship between M. alcathoe and any other species.\\nWith a forearm length of 30.8 to 34.6 mm and body mass of 3.5 to 5.5 g, Myotis alcathoe is a small bat. The fur is usually reddish-brown on the upperparts and brown below, but more grayish in juveniles. The tragus is short, as is the ear itself, and the inner side of the ear is pale at the base. The wings are brown and the baculum is short and broad. M. alcathoe has a very high-pitched echolocation call, with a frequency that falls from 120 kHz at the beginning of the call to about 43 kHz at the end."},{"page_url":"https://pt.wikipedia.org/wiki/Volvo_Cars","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Volvo_logotype_1927.png","page_title":"Volvo Cars","context_page_description":"A Volvo Car Corporation é uma fabricante de automóveis sueca fundada em 1927 em Gotemburgo, Suécia. A empresa tem como acionista majoritário desde 2010 a companhia chinesa Zhejiang Geely Holding Group e como acionistas minoritários as sociedades suecas Första AP-fonden, AMF e Folksam. A sua sede central está em Gotemburgo, Suécia, e a sua sede na China está em Xangai. Os principais locais de produção estão em Gotemburgo, Gent, Chengdu e Daqing e Charleston, enquanto os motores são produzidos em Skövde e Zhangjiakou, e as outras componentes em Olofström.\\nOriginalmente, a Volvo foi constituída como subsidiária da fabricante de rolamentos SKF. Quando a Volvo AB foi introduzida na bolsa de valores sueca, em 1935, a SKF vendeu a maior parte de suas ações na empresa.\\nAté 1999 a Volvo Cars pertenceu à AB Volvo, quando foi adquirida pela Ford Motor Company como parte de seu Premier Automotive Group. Em seguida, a Geely Holding Group comprou a Volvo da Ford em 2010.\\nA Volvo produz modelos que vão desde utilitários esportivos, SWs e sedans até sedans compactos executivos e coupés."},{"page_url":"https://en.wikipedia.org/wiki/Holden_HK","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/1968_Holden_Monaro_%28HK%29_coupe_%2820874083381%29.jpg","page_title":"Holden HK","context_page_description":"The Holden HK series is an automobile which was produced by Holden in Australia from 1968 to 1969. Introduced in January 1968, the HK range progressively replaced the Holden HR series which had been in production since 1966. HK models were both larger and heavier than their predecessors and the range would ultimately include thirteen different models against the eight of the HR range. The Holden HK was marketed under Belmont, Kingswood, Premier, Brougham and Monaro model names."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_%C5%9Bw._Jerzego_i_%C5%9Bw._Jadwigi_w_K%C5%82ecku","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Ko%C5%9Bci%C3%B3%C5%82_w_K%C5%82ecku.JPG","page_title":"Parafia św. Jerzego i św. Jadwigi w Kłecku","context_page_description":"Parafia Świętego Jerzego i Świętej Jadwigi w Kłecku jest jedną z 11 parafii leżącą w granicach dekanatu kłeckiego. Erygowana w XI wieku. Kościół parafialny, po wcześniejszym spaleniu, był odbudowany w latach 1510-1596 w stylu gotyckim; rozbudowany i przebudowany w 1931 roku."},{"page_url":"https://pl.wikipedia.org/wiki/Scalpay","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kyles_Scalpay_slipway_-_geograph.org.uk_-_1035386.jpg","page_title":"Scalpay","context_page_description":"Scalpay – wyspa w archipelagu Hebrydy Zewnętrzne, położona na zachodnim wybrzeżu Wielkiej Brytanii, należąca do Szkocji."},{"page_url":"https://pl.wikipedia.org/wiki/Roz%C5%82upana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Roz%C5%82upana_DK39.jpg","page_title":"Rozłupana","context_page_description":"Rozłupana – skała w grupie Pomorskich Skał po północno-zachodniej stronie Olkusza w województwie małopolskim, w powiecie olkuskim. Skały znajdują się po wschodniej stronie ulicy Długiej w należącym do Olkusza osiedlu Pomorzany. Pod względem geograficznym jest to Płaskowyż Ojcowski na Wyżynie Olkuskiej.\\nRozłupana znajduje się w lesie na szczycie wzniesienia, obok drugiej bezimiennej skały. Pomiędzy nimi jest wąskie przejście. Przełaz to zbudowany z twardych wapieni skalistych ostaniec o wysokości do 6 m, ścianach połogich, pionowych lub przewieszonych. Uprawiana jest na nim wspinaczka skalna o charakterze boulderingowym. Są 4 drogi wspinaczkowe o trudności od VI do VI.2+ w skali krakowskiej. Wszystkie mają zamontowane stałe punkty asekuracyjne.\\nDziób nosorożca; VI.2,\\nFaceci w Rajtuzach; VI.2+,\\nNajkrótsza; VI+,\\nProjekt."},{"page_url":"https://de.wikipedia.org/wiki/Eispickel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ice_axe.jpg","page_title":"Eispickel","context_page_description":"Der Eispickel ist ein Ausrüstungsgegenstand im Alpinismus auf Hochtouren. Er dient dem Bergsteiger als Gehunterstützung auf Fels, Schnee, Firn und Eis, zum Sondieren der Schneeauflage auf Gletscherspalten, zum Klettern im Eis, zum Abbremsen eines Sturzes auf geneigten Schnee- oder Firnflächen mittels Pickelrettungsgriff, als Anker zur Sicherung von Seilpartnern und zur Bergung von in Gletscherspalten Gestürzten. Vor der Einführung der Steigeisen mit Frontalzacken wurde er außerdem zum Schlagen von Stufen im Eis verwendet; in dieser Funktion kommt der Eispickel heute nur dann zur Anwendung, wenn keine Steigeisen verfügbar sind."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%84%D8%BA%D8%A7%D8%B1_%D8%A7%D9%84%D9%81%D9%88%D9%84%D8%BA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/%D0%9C%D0%B5%D1%82%D0%B0%D0%BB%D0%BB%D1%83%D1%80%D0%B3%D0%B8%D1%8F_%D0%92%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%91%D1%83%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D0%B8_13-14_%D0%B2%D0%B5%D0%BA%D0%B0.JPG","page_title":"بلغار الفولغا","context_page_description":"بلغار الفولغا، وتعرف بالمصادر العربيّة التاريخيّة باسم مملكة الصقالبة و مملكة البلقار، دولة بلغارية تاريخية وجدت بين القرنين السابع والثالث عشر حول التقاء نهري فولغا والكاما الموجودة حالياً في روسيا. أسسها ألمش بن يلطوار، والمعروف أيضاً باسم جعفر بن عبدالله، بعد ارتباطه بالدولة العباسية زمن الخليفة جعفر المقتدر الذي أرسل إليه إبن فضلان صاحب الرحلة الشهيرة.\\nيتفق معظم العلماء أن فولغا بلغاريا كانت خاضعة للإمبراطورية الخزرية حتى منتصف القرن العاشر، حتي توقف البلغار عن دفع الجزية لها. بلغار الفولغا حاولوا تحويل فلاديمير الأول حاكم كييف للإسلام؛ ومع ذلك رفض فلاديمير مفهوم الروس التخلي عن النبيذ، الذي أعلن أنه كان \\"فرحة جداً على حياتهم."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB%D0%B5%D1%89%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/%D0%97%D0%B0%D0%BB%D1%96%D1%89%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B1%D1%83%D0%B1%D0%BB%D0%B8%D0%BA.jpg","page_title":"Залещики","context_page_description":"Зале́щики — город, Залещицкий городской совет, Залещицкий район, Тернопольская область, Украина.\\nЯвляется административным центром Залещицкого городского совета, в который не входят другие населённые пункты."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1969_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Stamps_of_Germany_%28DDR%29_1969%2C_MiNr_1505.jpg","page_title":"Briefmarken-Jahrgang 1969 der Deutschen Post der DDR","context_page_description":"Der Briefmarken-Jahrgang 1969 der Deutschen Post der Deutschen Demokratischen Republik umfasste 89 Sondermarken, drei Briefmarkenblocks mit jeweils einer Sondermarke, einen Kleinbogen mit sechs Sondermarken und zwei Dauermarken.\\nInsgesamt wurden 100 Motive ausgegeben.\\nDas größte jemals in der DDR ausgegebene Format hatte eine Briefmarke zum Thema 20 Jahre DDR, sie erschien nur als Markenblock.\\nDiese Marke hatte Abmessungen von ca. 8,6 × 7,6 cm.\\nZum gleichen Anlass wurden die beiden anderen Blocks und weitere 14 Sondermarken ausgegeben.\\nObwohl die Währung der DDR seit dem 1. Januar 1968 Mark der Deutschen Demokratischen Republik hieß, wurden erst in diesem Jahr neue Dauermarken mit dieser Bezeichnung gedruckt. Bis dahin war das gleiche Motiv mit der Angabe MDN in Gebrauch.\\nAlle Briefmarken-Ausgaben seit 1964 sowie die 2-Mark-Werte der Dauermarkenserie Präsident Wilhelm Pieck und die bereits seit 1961 erschienene Dauermarkenserie Staatsratsvorsitzender Walter Ulbricht waren ursprünglich unbegrenzt frankaturgültig. Mit der Wiedervereinigung verloren alle Marken nach dem 2. Oktober 1990 ihre Gültigkeit."},{"page_url":"https://pt.wikipedia.org/wiki/Universidade_de_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Utah_gymnastics_meet.jpg","page_title":"Universidade de Utah","context_page_description":"A Universidade de Utah é uma universidade pública norte-americana de pesquisa, localizada em Salt Lake City, no estado de Utah.\\nEla é uma das dez instituições que fazem parte do sistema de ensino de nível superior de educação do estado de Utah. Fundada em 28 de fevereiro de 1850, possui cerca de 30 mil estudantes.\\nFoi elencada como uma das 50 melhores universidades dos Estados Unidos em 2008\\nFundada pelo mórmon Brigham Young, foi chamado inicialmente de University of Deseret. Dois anos depois, a escola fechou por problemas financeiros, reabrindo em 1867 como universidade privada, sob a direção de David O. Calder.\\nEm 1894 mudou, novamente, para o nome atual."},{"page_url":"https://de.wikipedia.org/wiki/Hanengretji","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Hanengretji_as_seen_from_north.jpg","page_title":"Hanengretji","context_page_description":"Das Hanengretji ist eine Bergkuppe zwischen Davos und Arosa im Kanton Graubünden in der Schweiz mit einer Höhe von 2542 m ü. M. Durch die Nähe zum Skigebiet Schatzalp/Strela ist es ein beliebtes, einfach zu erreichendes Skitourenziel."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D0%B2%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%B8%D1%87%D0%BA%D0%B0_%D1%86%D1%80%D0%BA%D0%B2%D0%B0_%D1%83_%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC_%D0%A1%D0%B0%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Evangelisti%C4%8Dka_crkva_Novi_Sad.JPG","page_title":"Евангеличка црква у Новом Саду","context_page_description":"Евангеличка црква у Новом Саду се налазу на углу улица Масарикове и Јована Суботића. Прве породице словачко-евангеличке вероисповести досељене су у Нови Сад почетком 19. века. Словаке као вредне раднике доводиле су са собом мађарске породице које су их упошљавале на разним служавским пословима. Будући да се радило о сиромашној заједници, Словаци су дуго вршили припреме око изградње свог храма. Верници су коначно сакупили довољно новца и упутили молбу Магистрату који издаје дозволу за градњу одређујући локацију за цркву на ондашњој Сењској пијаци. По пројекту Јозефа Цоцека градња цркве је завршена 1886. године. Црква је складних димензија, једнобродна са барокним торњем и троугаоним фронтоном на главној фасади што објекту даје стилске карактеристике прелазног доба барока у класицизам."},{"page_url":"https://vi.wikipedia.org/wiki/Cusuma","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/01-Cusama_flavifusa%2C_Hampson.JPG","page_title":"Cusuma","context_page_description":"Cusuma là một chi bướm đêm thuộc họ Geometridae."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_Santiago_de_Compostela","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Catedral%2C_Santiago_de_Compostela%2C_Espa%C3%B1a%2C_2015-09-22%2C_DD_05-07_HDR.jpg","page_title":"Catedral de Santiago de Compostela","context_page_description":"La Santa Apostólica y Metropolitana Iglesia Catedral de Santiago de Compostela es un templo de culto católico situado en la ciudad homónima, en el centro de la provincia de La Coruña, en Galicia. Acoge el que, según la tradición, es el sepulcro del Apóstol Santiago, lo cual convirtió al templo en uno de los principales destinos de peregrinación de Europa durante la Edad Media a través del llamado Camino de Santiago, una ruta religiosa que comunicaba la península ibérica con el resto del continente. Esto fue determinante para que los reinos hispánicos medievales participaran en los movimientos culturales de la época; en la actualidad sigue siendo un importante destino de peregrinación. Un privilegio concedido en 1122 por el papa Calixto II declaró que serían «Año Santo» o «Año Jubilar» en Compostela todos los años en que el día 25 de julio, día de Santiago, coincidieran en domingo; este privilegio fue confirmado por el papa Alejandro III en su bula Regis aeterni en 1179.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Greifensee","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Greifensee_%28ZH%29_-_Schloss_IMG_6552.jpg","page_title":"Liste der Kulturgüter in Greifensee","context_page_description":"Die Liste der Kulturgüter in Greifensee enthält alle Objekte in der Gemeinde Greifensee im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Monthairons","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Les_Monthairons_%28Meuse%29_%C3%A9glise%2C_fa%C3%A7ade%2C_statue_A.JPG","page_title":"Les Monthairons","context_page_description":"Les Monthairons est une commune française située dans le département de la Meuse, en région Grand Est."},{"page_url":"https://en.wikipedia.org/wiki/Thorncliffe,_West_Yorkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Houses_in_Thorncliffe_-_geograph.org.uk_-_700171.jpg","page_title":"Thorncliffe, West Yorkshire","context_page_description":"Thorncliffe is a hamlet in the township of Kirkburton, in the Kirklees district, in the county of West Yorkshire, England."},{"page_url":"https://sv.wikipedia.org/wiki/Grand_danois","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Princess_Dagmar%2C_Prince_Vilhelm%2C_Christian_IX_of_Denmark_and_Princess_Alexandra..JPG","page_title":"Grand danois","context_page_description":"Grand danois, en hundras från Tyskland. Den är en molosserhund framavlad som jakthund för högvilt; idag är den sällskapshund. I en undersökning 2012/2013 utnämndes grand danois till en av världens trettio populäraste hundraser."},{"page_url":"https://pl.wikipedia.org/wiki/Alice_in_Chains","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Majestic_Urban_Glass_BAM_Harvey_Flatbush_Av_Fulton_St_jeh.jpg","page_title":"Alice in Chains","context_page_description":"Alice in Chains – amerykański zespół muzyczny utworzony w 1987 w Seattle w stanie Waszyngton z inicjatywy gitarzysty i wokalisty Jerry’ego Cantrella i perkusisty Seana Kinneya. Przez współczesnych historyków i krytyków zaliczany do tzw. Wielkiej Czwórki z Seattle, obok Nirvany, Pearl Jam i Soundgarden.\\nMuzyka Alice in Chains jest mroczna i ciężka, lecz bardzo melodyjna. Odznacza się różnorodnością brzmienia, sprawiającą, że zespół trudno jest przypisać do konkretnego gatunku. Grupa powszechnie identyfikowana jest z nurtem grunge’owym, lecz czerpiąca wpływy z szeroko pojętej muzyki metalowej lat 70., która zawiera w sobie ciężkie riffy inspirowane twórczością Black Sabbath i melodyjnego hard rocka budzącego skojarzenia z dokonaniami Led Zeppelin, przeplatanego łagodniejszymi i utrzymanymi w stylistyce muzyki akustycznej kompozycjami. Rozpoznawalną cechą zespołu są rozbudowane aranżacyjnie utwory oraz charakterystyczny styl wokalny, dla którego typowe są zharmonizowane partie wokalne. Łączny nakład sprzedanych albumów wynosi ponad 25 milionów na całym świecie, w tym 14 na terenie Stanów Zjednoczonych."},{"page_url":"https://gl.wikipedia.org/wiki/Casa_da_Moeda_de_Su%C3%ADza","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Schweiz_Zwei_Franken_1850.jpg","page_title":"Casa da Moeda de Suíza","context_page_description":"A Casa da Moeda de Suíza é unha empresa pública que se encarga da cuñaxe das moedas circulantes e conmemorativas dese país. Depende organicamente do Ministerio Federal de Facenda e traballa en estreita colaboración co Banco Nacional Suízo."},{"page_url":"https://cs.wikipedia.org/wiki/Synagoga_Schomre-Schabos_v_%C4%8Cesk%C3%A9m_T%C4%9B%C5%A1%C3%ADn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%C4%8Cesk%C3%BD_T%C4%9B%C5%A1%C3%ADn_synagogue.jpg","page_title":"Synagoga Schomre-Schabos v Českém Těšíně","context_page_description":"Synagoga Schomre-Schabos v Českém Těšíně je bývalá synagoga vystavěná v eklekticko-mauretánském stylu. Jedná se o jednu ze tří synagog v Moravskoslezském kraji. Nachází se mezi řadovými domy na Božkově ulici. Budova synagogy dnes slouží jako klubovna PZKO.\\nBudovu nechalo vystavět sdružení „Schomre Schabos“. Jednalo se o třípatrovou budovu s modlitebnou, galerií pro ženy, bytem správce a rituální lázní. V uličním průčelí s pětiosou bohatě členěnou fasádou. Vysoká maurská okna s bohatě profilovanými šambránami a římsami, s podstřešní římsou. V přízemí v rohu dvojice vstupních dveří profilovaném portálu s oblouky ve tvaru oslího hřbetu. Kapacita modlitebny a galerie činila 152 mužů a zhruba 100 žen.\\nObjekt je prohlášen kulturní památkou ČR."},{"page_url":"https://cs.wikipedia.org/wiki/Michail_Illarionovi%C4%8D_Kutuzov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Oleszkiewicz-Micha%C5%82_Kutzow.jpg","page_title":"Michail Illarionovič Kutuzov","context_page_description":"Michail Illarionovič kníže Goleniščev-Kutuzov-Smolenskij byl ruský vojevůdce z období napoleonských válek."},{"page_url":"https://fr.wikipedia.org/wiki/Agnos","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Agnos-eglise_001.JPG","page_title":"Agnos","context_page_description":"Agnos est une commune française, située dans le département des Pyrénées-Atlantiques en région Nouvelle-Aquitaine.\\nLe gentilé est Agnosien."},{"page_url":"https://nl.wikipedia.org/wiki/Cynoglossus_lingua","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cynoglossus_lingua_Suzini_96.jpg","page_title":"Cynoglossus lingua","context_page_description":"Cynoglossus lingua is een straalvinnige vissensoort uit de familie van hondstongen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1822 door Hamilton."},{"page_url":"https://cs.wikipedia.org/wiki/C%C3%ADrkev_Je%C5%BE%C3%AD%C5%A1e_Krista_Svat%C3%BDch_posledn%C3%ADch_dn%C5%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Badeniho%2C_u_k%C5%99i%C5%BEovatky_%C5%A0pejchar.jpg","page_title":"Církev Ježíše Krista Svatých posledních dnů","context_page_description":"Církev Ježíše Krista Svatých posledních dnů je největší z mormonských církví, vzešlých z původní organizace Josepha Smitha z roku 1830 v USA. Dnes má přes 16 milionů členů v mnoha zemích světa.\\nCírkev Ježíše Krista Svatých posledních dnů se považuje za obnovenou původní církev založenou Kristem a za jedinou církev na světě, která má v současné době kněžskou pravomoc od Boha a tudíž je jako jediná oprávněna Ježíšem Kristem vykonávat spásné obřady evangelia. Náboženské obřady všech ostatních tradic považuje za neúčinné."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%DA%A9%D8%A7%D8%B3%D8%AA%DB%8C%D9%86_(%D9%BE%DB%8C%E2%80%8C%D8%AC%DB%8C-%DB%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/USS_Castine_%28PG-6%29.jpg","page_title":"یواس‌اس کاستین (پی‌جی-۶)","context_page_description":"یواس‌اس کاستین (پی‌جی-۶) یک کشتی بود که طول آن ۲۰۴ فوت بود. این کشتی در سال ۱۸۹۲ ساخته شد."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%A7%E9%96%A3%E5%BA%9C%E7%89%B9%E5%91%BD%E6%93%94%E7%95%B6%E5%A4%A7%E8%87%A3%EF%BC%88%E6%B6%88%E8%B2%BB%E8%80%85%E5%8F%8A%E9%A3%9F%E5%93%81%E5%AE%89%E5%85%A8%E6%93%94%E7%95%B6%EF%BC%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Mizuho_Fukushima_cropped_2_Mizuho_Fukushima.jpg","page_title":"內閣府特命擔當大臣（消費者及食品安全擔當）","context_page_description":"内阁府特命担当大臣，日本的国务大臣。是内阁府特命担当大臣的一个。通称消费者及食品安全担当大臣。"},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9rytamon_(fille_de_Rams%C3%A8s_II)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Akhmim5.jpg","page_title":"Mérytamon (fille de Ramsès II)","context_page_description":"Mérytamon est une reine d'Égypte de la XIXᵉ dynastie. Elle est la quatrième fille et l'épouse du pharaon Ramsès II, et la troisième fille de la reine Néfertari. Parce qu'elle occupa un rang privilégié dans l'imagerie officielle, elle naquit sûrement avant le couronnement de Ramsès II et fut probablement la plus vieille des filles de Néfertari qui lui ait survécu. Selon Christian Leblanc, pourtant rien n'autorise à voir en elle l'ainée de cette lignée maternelle, puisque sa position varie assez souvent dans les processions princières figurées dans le contexte des temples."},{"page_url":"https://nl.wikipedia.org/wiki/Golf_van_Biskaje","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bay_of_Biscay_from_Terra_%282004-05-17%29.jpg","page_title":"Golf van Biskaje","context_page_description":"De Golf van Biskaje, Spaans: Golfo de Vizcaya, Frans: Golfe de Gascogne, Occitaans: Golf de Gasconha, Baskisch: Bizkaiko Golkoa, is een zeeboezem tussen Frankrijk en Spanje die zich uitstrekt van Bretagne tot de noordkust van Spanje. Het is een deel van de Atlantische Oceaan. De golf is naar de Spaanse provincie Biskaje genoemd.\\nHet zuidelijk deel wordt ook wel Cantabrische Zee genoemd, naar Cantabrië; deze naam, Mar Cantábrico, is in Spanje zelfs gebruikelijker dan Golfo de Vizcaya, behalve in het Baskenland.\\nDe belangrijkste havensteden aan de Golf van Biskaje zijn Lorient, Bordeaux en Bayonne in Frankrijk, en Pasaia, dat bij San Sebastian ligt, Bilbao en Santander in Spanje.\\nHet is een gebied met algenbloei, aan de oppervlakte drijven wolken fytoplankton.\\nOp 22 mei 1703 vond in de Golf van Biskaje een zeeslag plaats, de Slag bij Cap de la Roque. Een koopvaardijvloot beschermd door Nederlandse oorlogsschepen, onder leiding van kapitein Roemer Vlacq, ontmoette op die dag een eskader van Franse oorlogsbodems. De Franse overmacht was echter te groot en het Nederlands flottielje werd tot overgave gedwongen terwijl het handelskonvooi wist te ontsnappen."},{"page_url":"https://ca.wikipedia.org/wiki/Motocr%C3%B2s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Leok.jpg","page_title":"Motocròs","context_page_description":"El motocròs és una modalitat de motociclisme que consisteix a disputar curses de velocitat en un circuit de terreny accidentat a camp obert i en la qual diferents participants disputen una cursa amb l'objectiu d'arribar primer a la meta. Els obstacles són formats normalment per desnivells, rampes, camins empedregats, passos de riu, etc., i es procura que només una desena part del recorregut sigui transitable òptimament. Els pilots fan servir motocicletes especials, amb manillar alt, parafangs molt separats de les rodes i rodes amb tacs de goma per tal d'aconseguir més adherència al terreny"},{"page_url":"https://sv.wikipedia.org/wiki/Sete_Fontes_(Braga)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Sete_Fontes.JPG","page_title":"Sete Fontes (Braga)","context_page_description":"Sete Fontes är en del av ett stort vattenförsörjningssystem som byggdes i mitten av 1700-talet, som levererade dricksvatten i kommunen Braga i norra Portugal, fram till första halvan av 2000-talet. I dag finns det bara 13 källor kvar, efter förstörelsen av en i början av 1990, för att möjliggöra byggandet av bostadshus. Bland de återstående delarna av Sete Fontes finns de runda byggnaderna Mãe de àguas, som är anslutna via akvedukter i marknivå och genom underjordiska tunnlar, så kallade minas. Systemet är ett portugisiskt nationalmonument."},{"page_url":"https://cs.wikipedia.org/wiki/Breguet_Atlantic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Breguet_Atlantic_weapon_bay_with_torpedos_2.jpg","page_title":"Breguet Atlantic","context_page_description":"Breguet Br.1150 Atlantic je průzkumný letoun dlouhého doletu, navržený pro působení nad hladinou moře. Je používán několika státy v rámci NATO k průzkumu, námořnímu hlídkování a k boji proti ponorkám. Letoun je rovněž schopen nést střely vzduch-země. Atlantique 2 je vylepšená verze, která byla vyráběna pro francouzské námořnictvo v 80. letech 20. století."},{"page_url":"https://fr.wikipedia.org/wiki/Roz-sur-Couesnon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Roz-sur-Couesnon_%2835%29_%C3%89glise_01.JPG","page_title":"Roz-sur-Couesnon","context_page_description":"Roz-sur-Couesnon est une commune française située dans le département d'Ille-et-Vilaine en région Bretagne et peuplée de 1 003 habitants."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B1%D9%82%D9%8A%D9%85_%D8%A7%D9%84%D9%85%D9%86%D8%A7%D8%B2%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Domovn%C3%AD_%C4%8D%C3%ADsla_Z%C3%A1b%C4%9Bhlice.jpg","page_title":"ترقيم المنازل","context_page_description":"ترقيم المنازل ‏ هو إعطاء رقم فريد لكل مبنى في الشارع أو المنطقة، بهدف تسهيل تحديد موقع مبنى معين. يكون رقم المنزل عادةً جزءًا من عنوان السكن. يصف المصطلح رقم أي مبنى مع صندوقه البريدي، أو أرض خالية حتى. تختلف مخططات ترقيم المنزل حسب الموقع، وفي حالات عديدة ضمن المدن حتى. تُطلق أسماء على المنازل في بعض مناطق العالم، بما فيها المناطق النائية عادةً ولكنها لا تُعطى أرقام."},{"page_url":"https://sh.wikipedia.org/wiki/Nacionalni_univerzitet_Turkmenistana","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Universiteit_van_Ashgabat_%283406774006%29.jpg","page_title":"Nacionalni univerzitet Turkmenistana","context_page_description":"Nacionalni univerzitet Turkmenistana vodeći je univerzitet u centralnoazijskoj državi Turkmenistan, smješten u glavnom gradu Ašhabadu. Institucija je osnovana 1950. godine u periodu Turkmenske Sovjetske Socijalističke Republike i nosi ime po turkmenskom pjesniku Mahtumkuli. Prije 1993. godine univerzitet je nosio ime Maksima Gorkog. Univerzitet je osnovan 1950. reorganizacijom pedagoškog instituta koji je u gradu djelovao od 1931. godine.\\nUniverzitet ima uspostavljenu međunarodnu suradnju sa Moskovskim državnim univerzitetom, Državnim univerzitetom u Bakuu, Univerzitetom u Jerevanu i Bjeloruskim državnim univerzitetom."},{"page_url":"https://de.wikipedia.org/wiki/St._Gallus_(Kirchzarten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/St._Gallus_%28Kirchzarten%29_8008.jpg","page_title":"St. Gallus (Kirchzarten)","context_page_description":"St. Gallus ist die römisch-katholische Pfarrkirche von Kirchzarten, war aber für Jahrhunderte die Pfarrkirche des gesamten Einzugsgebietes der Dreisam von den Schwarzwaldhöhen bis zum Zartener Becken mit Ausnahme des Kappler Tals im Westen. Sie ist benannt nach Gallus, dem Gründungsheiligen des Benediktinerklosters St. Gallen, und gehört zur Seelsorgeeinheit Dreisamtal im Dekanat Neustadt des Erzbistums Freiburg. Mit ihrer Lage inmitten des ummauerten, auch wo er aufgelassen ist als Freifläche erhaltenen Friedhofs, mit dem Pfarrhaus und dem Kaplaneihaus, mit ihrem Reichtum an Geschichtsdenkmälern und mit dem regelmäßig bewohnten Storchennest auf dem Turm ist sie der wenig entstellte, ästhetisch anziehende Mittelpunkt von Kirchzarten."},{"page_url":"https://ru.wikipedia.org/wiki/Bandini_Automobili","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Bandinicollection.jpg","page_title":"Bandini Automobili","context_page_description":"Bandini Automobili — итальянский производитель автомобилей, существовавший с 1946 по 1992 год. Своё название он получил от фамилии основателя, Иларио Бандини."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D9%85%DB%8C%D9%86%D8%A7_%D9%88%DB%8C%D9%84%DA%A9%D9%88%D9%88%DB%8C%D8%AA%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Powiat_bielski_%28%C5%9Bl%C4%85ski%29_-_Wilkowice.png","page_title":"قمینا ویلکوویتسه","context_page_description":"قمینا ویلکوویتسه لهیستان‌دا بیر یاشاییش منطقه‌سی‌دیر 33.9 کیلومتر موربّع ساحه‌سی وار. و سیلسیان اوستانیندا یئرلشیر."},{"page_url":"https://de.wikipedia.org/wiki/Joey_Graceffa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Joey_Graceffa.jpg","page_title":"Joey Graceffa","context_page_description":"Joseph Michael „Joey“ Graceffa ist ein US-amerikanischer Schauspieler, Autor und Webvideoproduzent."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Sternberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/SternbergAmMarkt8.jpg","page_title":"Liste der Baudenkmale in Sternberg","context_page_description":"In der Liste der Baudenkmale in Sternberg sind alle Baudenkmale der Stadt Sternberg und ihrer Ortsteile aufgelistet."},{"page_url":"https://de.wikipedia.org/wiki/Kleinkaliber","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Kaliber_KleinKaliber_Display_01.jpg","page_title":"Kleinkaliber","context_page_description":"Als Kleinkaliber wurden bis in die 1950er Jahre alle Patronen mit einem Geschossdurchmesser unter 7 mm bezeichnet. Heute sind hauptsächlich die Patronen im Kaliber .22 gemeint, sofern sie über Randfeuerzündung verfügen. Kleinkaliber-Patronen zeichnen sich auch durch ihren günstigen Preis und ihren geringen Rückschlag aus."},{"page_url":"https://ca.wikipedia.org/wiki/Anna_Simon_i_Mar%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Anna_Sim%C3%B3n.jpg","page_title":"Anna Simon i Marí","context_page_description":"Anna Simon i Marí és una periodista i presentadora de televisió catalana.\\nLlicenciada en Periodisme, Anna Simon començà amb 22 anys presentant a Teletaxi TV. Després d'un breu pas per Antena 3 i Telecinco en programes de Call TV, el 2008 va fitxar per Cuatro com a reportera de Éstas no son las noticias, on apareixia una vegada cada setmana realitzant un reportatge en directe sobre una investigació que havia realitzat sobre algun anunci que havia vist en la premsa sobre negocis telefònics. El 2009, a més, feia de representant d'un dels grups de cada programa de La 1 Los mejores años de nuestra vida canción a canción, juntament amb Ángela Fuente.\\nEl 2008 es va incorporar a Tú sí que vales, on entrevistava els participants entre bastidors, i el 2010 va ser la condutora de La jaula, un programa de tertúlia rosa. Posteriorment, va treballar a TV3, on va participar en els programes Divendres i TVist, fins que el 2010 va fitxar pel programa Tonterías las justas de Cuatro, espai que el 2011 es convertiria en Otra movida al canal Neox."},{"page_url":"https://ja.wikipedia.org/wiki/2008%E5%B9%B4%E4%B8%96%E7%95%8C%E3%83%95%E3%82%A3%E3%82%AE%E3%83%A5%E3%82%A2%E3%82%B9%E3%82%B1%E3%83%BC%E3%83%88%E9%81%B8%E6%89%8B%E6%A8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/2008_WC_Ladies_Podium.jpg","page_title":"2008年世界フィギュアスケート選手権","context_page_description":"2008年世界フィギュアスケート選手権は、2008年3月17日から23日にかけて、スウェーデン・ヨーテボリのスカンジナヴィアムで開催されたフィギュアスケートの世界選手権。スウェーデンでの開催は1976年世界選手権以来32年ぶり、ヨーテボリ開催は1976年以来32年ぶり2回目。"},{"page_url":"https://oc.wikipedia.org/wiki/Aquil%C3%A9gia_pirenenca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Aquilegia_pyrenaica.jpg","page_title":"Aquilégia pirenenca","context_page_description":"L'aquilégia deus Pirenèus o fliscòt, campaneta o guant de Nosta Dauna, qu'ei ua espècia de plantas erbacèas deu genre Aquilegia, de la familha de las Ranunculaceae. Qu'ei riala e endemica deus Pirenèus. De petita talha enter 10 e 25 centimètres."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E9%A3%AF%E7%94%91%E6%B4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Tsang_Pang_Kok_and_Conic_Island%2C_Hong_Kong_1.jpg","page_title":"飯甑洲","context_page_description":"飯甑洲是香港西貢的一個外海小島，位於浪茄灣東面海角罾棚角對開海面數百米，面積細小，僅長300米，闊100米，最高點僅逾50米。在陸上，從獨孤山和標尖角之間和罾棚角頂等空曠山徑上都可清楚看到飯甑洲。從萬宜水庫東壩和弱波堤上亦可遠眺飯甑洲。\\n飯甑洲上並沒有居民居住。在礁石上建有一盞海上導航燈，燈塔旁有一座簡單登岸碼頭。\\n「甑」字讀作「曾」，是古代蒸飯的一種瓦器。"},{"page_url":"https://it.wikipedia.org/wiki/Erlotinib","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Erlotinib-1m17-3D-balls.png","page_title":"Erlotinib","context_page_description":"L'Erlotinib, prodotto dalla Genentech e commercilizzato da Roche, è un farmaco usato per il trattamento dei tumori, in particolare del tumore del polmone non-microcitoma e del cancro del pancreas."},{"page_url":"https://pl.wikipedia.org/wiki/Joseph_Darnand","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Joseph_Darnand_c1940.jpg","page_title":"Joseph Darnand","context_page_description":"Joseph Darnand – francuski działacz skrajnie prawicowy, szef kombatanckiej organizacji Francuski Legion Weteranów, prorządowej milicji Legionowa Służba Porządkowa i kolaboracyjnej Milicji Francuskiej we Francji Vichy, jednocześnie szef policji i sekretarz generalny ds. bezpieczeństwa oraz sekretarz spraw wewnętrznych."},{"page_url":"https://ca.wikipedia.org/wiki/Bailleul_(Somme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bailleul2b.JPG","page_title":"Bailleul (Somme)","context_page_description":"Bailleul és un municipi francès, situat al departament del Somme i a la regió dels Alts de França. L'any 2007 tenia 259 habitants."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrale_di_San_Michele_(Alba_Iulia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Gyulafeh%C3%A9rv%C3%A1r_Hunyadi_J%C3%A1nos_s%C3%ADrja.jpg","page_title":"Cattedrale di San Michele (Alba Iulia)","context_page_description":"La cattedrale cattolica di San Michele di Alba Iulia, è la chiesa madre dell'Arcidiocesi di Alba Iulia in Romania."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%A9%E3%82%BB%E3%83%8B%E3%82%A2%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Sarracenia_Flava_JPG01.jpg","page_title":"サラセニア科","context_page_description":"サラセニア科は、真正双子葉類ツツジ目に属し、ここに属する全種が食虫植物からなる植物群である。なお、クロンキスト体系ではウツボカズラ目に、新エングラー体系ではサラセニア目とされている。\\n三つの属が含まれる。いずれも筒状の葉を持ち、落とし穴式で虫を捕らえる食虫植物である。捕虫葉には液体がたまり、そこに獲物が落ち込んで溺れ死ぬが、同様の構造を持つウツボカズラ類のように消化酵素は分泌せず、内部に生息する細菌によって分解されることによって遊離した栄養素を吸収する。貧栄養の湿地に成育し、茎は地表を短く這い、花茎は長く伸びて、先端に少数の花をぶら下げるようにつける。また、食虫植物としては例外的に根の発達がよい。"},{"page_url":"https://id.wikipedia.org/wiki/Melaleuca_uncinata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Melaleuca_uncinata_%28leaves%2C_fruits%29.JPG","page_title":"Melaleuca uncinata","context_page_description":"Melaleuca uncinata, umumnya dikenal sebagai broombush, broom honeymyrtle atau brushwood, suatu tumbuhan dalam keluarga Melaleuca yang aslinya tumbuh di bagian selatan Australia. Dipanen dari alam, dan ditanam pada perkebunan, untuk pagar broombush. Nama Noongar tumbuhan ini adalah kwytyat dan yilbarra."},{"page_url":"https://eo.wikipedia.org/wiki/Petronas-turoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/KLCC001.JPG","page_title":"Petronas-turoj","context_page_description":"La Petronas-turoj en Kuala-Lumpuro en Malajzio estas duobla turo kaj ili estis la plej altaj konstruaĵoj en la Mondo, antaŭ ol Taipei 101 konstruiĝis. Do ili estis la plej altaj konstruaĵoj ekde la jaro 1998 ĝis 2004 mezurita de la nivelo de la ĉefa enirejo ĝis la struktura supro, la originala referencsistemo de Konsilantaro por Altaj Konstruaĵoj kaj Urbaj Loĝejoj uzita de la jaro 1969.\\nLa turoj estis konstruataj de la jaro 1992 ĝis 1998. La turoj havas 88 etaĝojn kaj la supra etaĝo estas en nivelo de 375.0 metroj. La tegmento estas en nivelo de 378.6 metroj; inkludante la antenon, la alto estas 451,9 metroj. La konstruaĵoj havas entute 395 000 m² da plankspaco."},{"page_url":"https://az.wikipedia.org/wiki/Pfals-Zveybr%C3%BCkgen-Kliburq_s%C3%BClal%C9%99si","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Adolf_Johan_av_Pfalz_i_VJs_julnummer_1942.jpg","page_title":"Pfals-Zveybrükgen-Kliburq sülaləsi","context_page_description":"Pfals-Zveybrükgen-Kliburq sülaləsi Pfals-Zveybrükgen sülaləsinin bir qolu olub Zveybrükgen palatin-qraflığı və İsveç krallığını idarə etmiş bir sülalədir."},{"page_url":"https://id.wikipedia.org/wiki/Palung_Mariana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pacific_Ocean.png","page_title":"Palung Mariana","context_page_description":"Palung Mariana atau Palung Marianas adalah palung yang paling dalam yang diketahui, dan lokasi terdalamnya berada di kerak Bumi. Palung ini terletak di dasar barat laut Samudra Pasifik, sebelah timur Kepulauan Mariana di 11° 21' Lintang Utara dan 142° 12' Bujur Timur, dekat juga dengan negara Jepang. Palung ini merupakan batasan di mana dua lempeng tektonik bertemu, zona subduksi di mana Lempeng Pasifik disubduksi di bawah Lempeng Filipina. Kedalaman dari palung ini jauh di bawah permukaan laut, lebih jauh dari ketinggian Gunung Everest di atas permukaan laut.\\nPalung ini memiliki kedalaman maksimum 10.911 meter di bawah permukaan laut. Kalau dihitung menurut garis lintang dan garis bujur Bumi, palung ini berada 6.366,4 km dari pusat Bumi. Samudra Arktik, di sisi lain, dengan kedalaman 4 km, memiliki jarak dasar laut dengan pusat bumi sebesar ~6.352,8 km, 13,6 km lebih dekat.\\nPertama kali diteliti pada 1951 oleh kapal Angkatan Laut Britania, Challenger II, yang memberikan nama titik terdalam dari palung tersebut Kedalaman Challenger. Menggunakan gema suara, Challenger II mengukur kedalam 5.960 fathom pada 11° 19' U, 142° 15' T."},{"page_url":"https://de.wikipedia.org/wiki/Ina_Scharrenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Restaurierung_r%C3%B6mische_Wasserleitung_aus_H%C3%BCrth-2144.jpg","page_title":"Ina Scharrenbach","context_page_description":"Ina Scharrenbach ist eine deutsche Politikerin. Sie war Abgeordnete im 16. Landtag von Nordrhein-Westfalen und ist seit dem 30. Juni 2017 Ministerin für Heimat, Kommunales, Bauen und Gleichstellung des Landes Nordrhein-Westfalen im Kabinett Laschet."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%95%E0%A5%8D%E0%A4%B0%E0%A4%BF%E0%A4%95%E0%A5%87%E0%A4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Muralitharan_bowling_to_Adam_Gilchrist.jpg","page_title":"क्रिकेट","context_page_description":"क्रिकेट एक बल्ले और गेंद का दलीय खेल है जिसकी शुरुआत दक्षिणी इंग्लैंड में हुई थी।\\nइसका सबसे प्राचीन निश्चित संदर्भ १५९८ में मिलता है, अब यह १०० से अधिक देशों में खेला जाता है। क्रिकेट के कई प्रारूप हैं, इसका उच्चतम स्तर टेस्ट क्रिकेट है, जिसमें वर्तमान प्रमुख राष्ट्रीय टीमें भारत, ऑस्ट्रेलिया, दक्षिण अफ्रीका, इंग्लैण्ड, श्रीलंका, वेस्टइंडीज, न्यूजीलैण्ड, पाकिस्तान, ज़िम्बाब्वे, बांग्लादेश अफ़ग़ानिस्तान और आयरलैण्ड हैं। अप्रैल 2018 में, आईसीसी ने घोषणा की कि वह 1 जनवरी 2019 से अपने सभी 120सदस्यों को ट्वेन्टी-२० अंतरराष्ट्रीय की मान्यता प्रदान क्रिकेट के बल्ले से गेंद को खेलता है। इसी बीच गेंदबाज की टीम के अन्य सदस्य मैदान में क्षेत्ररक्षक के रूप में अलग-अलग स्थितियों में खड़े रहते हैं, ये खिलाड़ी बल्लेबाज को दौड़ बनाने से रोकने के लिए गेंद को पकड़ने का प्रयास करते हैं और यदि सम्भव हो तो उसे आउट करने की कोशिश करते हैं। बल्लेबाज यदि आउट नहीं होता है तो वो विकेटों के बीच में भाग कर दूसरे बल्लेबाज से अपनी स्थिति को बदल सकता है, जो पिच के दूसरी ओर खड़ा होता है। इस प्रकार एक बार स्थिति बदल लेने से एक रन बन जाता है। यदि बल्लेबाज गेंद को मैदान की सीमारेखा तक हिट कर देता है तो भी रन बन जाते हैं।"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%AE%E0%A7%8D%E0%A6%AA%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Cricket_Umpire.jpg","page_title":"আম্পায়ার","context_page_description":"আম্পায়ার একজন বিচারক ও কর্তৃপক্ষ হিসেবে ক্রিকেটের নিয়ম-কানুনের যথাযথ প্রয়োগপূর্বক খেলা পরিচালনা করে থাকেন। ম্যাচ রেফারি মাঠের বাইরে অবস্থানকারী কর্মকর্তা হিসেবে থাকেন। তিনি বিচারকরূপে ক্রিকেট খেলায় যাবতীয় নিয়ম-কানুনের যথাযথ প্রয়োগ এবং আইসিসি প্রণীত আচরণবিধি অপব্যবহারে জরিমানা নির্ধারণ করেন। কিন্তু মাঠে অবস্থানকারী দুই জন আম্পায়ারই ক্রিকেট খেলা পরিচালনায় প্রধান ভূমিকা রাখেন। তবে, প্রয়োজনীয় ও নিখুঁত সিদ্ধান্ত প্রদানের জন্যে মাঠের বাইরে থার্ড আম্পায়ার অবস্থান করে তাকে কিংবা তাদেরকে সহায়তা করেন।"},{"page_url":"https://en.wikipedia.org/wiki/Odder_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Odderbanen.jpg","page_title":"Odder Line","context_page_description":"The Odder Line, also known formerly as the Hads-Ning Herreders Jernbane, is a 26.5 km long standard-gauge single-track light-rail line which connects the city of Aarhus to the town of Odder in the Central Denmark Region. The Odder Line has its own route between Rosenhøj and Odder, and parallels the mainline between Rosenhøj and Aarhus.\\nThe line, first opened in 1884, was originally operated by the HHJ, which merged with the Lemvigbane in 2008 to form Midtjyske Jernbaner. From 2012 to 2016 services on the line were operated by DSB as part of Aarhus Nærbane.\\nThe line was rebuilt in 2016-2018 to convert it into an electrified Aarhus Letbane route, operated by Midttrafik, with new tram-trains entering service in August 2018."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Penguasa_Belanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Queen_Wilhelmina_of_the_Netherlands.jpg","page_title":"Daftar Penguasa Belanda","context_page_description":"Halaman ini memuat daftar penguasa Belanda sejak 1581 sampai sekarang, mulai dari pemerintahan Republik Belanda hingga ke pemerintahan Monarki Belanda."},{"page_url":"https://sk.wikipedia.org/wiki/NGC_1373","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/NGC_1373_DSS.jpg","page_title":"NGC 1373","context_page_description":"NGC 1373 je galaxia v súhvezdí Pec, ktorú objavil anglický astronóm John Herschel 29. novembra 1837.\\nJej zdanlivá hviezdna veľkosť je 12,4."},{"page_url":"https://en.wikipedia.org/wiki/List_of_former_Star_Magic_artists","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Marc_Abaya.jpg","page_title":"List of former Star Magic artists","context_page_description":"This is a list of former artists of ABS-CBN's Star Magic."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9B%D7%A8%D7%99%D7%A1%D7%98%D7%99%D7%90%D7%9F_%D7%A7%D7%99%D7%99%D7%92%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sii%2C_Christian_campe%C3%B3n_de_ECW.jpg","page_title":"כריסטיאן קייג'","context_page_description":"וויליאם ג'ייסון ריסו הוא שחקן ומתאבק עבר קנדי, המוכר בעיקר בשל תקופתו בארגון ההיאבקות WWE, שבו הופיע תחת שם הבמה שלו, כריסטיאן, שהיא הגרסה המקוצרת לשם הבמה, כריסטיאן קייג', שבו השתמש במהלך שהותו בארגון Total Nonstop Action Wrestling‏. ריסו החל להתאבק ביוני 1995 לאחר שהתאמן תחת הדרכתם של דורי פאנק ג'וניור ורון האצ'יסון.\\nריסו החל להתאבק בארגונים העצמאיים הקנדיים בשנת 1994, לעיתים כמתאבק יחידים ולעיתים כמתאבק זוגות ביחד עם חברו הטוב, אדם קופלנד. ארבע שנים לאחר מכן, ריסו חתם על חוזה פיתוח בארגון ה-World Wrestling Federation‏, כך שהוא היה מעורב בעלילה, שבה הוא האח של אדג'. ריסו ערך את קרב הבכורה שלו בשנה לאחר מכן ובמהרה זכה באליפות הראשונה שלו, שהייתה האליפות במשקל בינוני. אדג' וכריסטיאן מיתגו את עצמם כצמד בעל דמויות רעות וביחד הם הצליחו לזכות באליפות הזוגות שבע פעמים. בשנת 2001, נפרדו דרכי השניים, וכריסטיאן הפך למתאבק יחידים. בתחרות היחידים, כריסטיאן זכה באליפות אירופה, באליפות ההארדקור ובאליפות הבין יבשתית של ה-WWF/E.\\nבנובמבר 2005, ריסו חתם בארגון בארגון Total Nonstop Action Wrestling‏ תחת שם הבמה כריסטיאן קייג' ובמהלך שהותו בארגון הוא זכה פעמיים באליפות העולם במשקל כבד של NWA. הוא עזב את הארגון לקראת סוף שנת 2008 ושב בחזרה לארגון ה-WWE."},{"page_url":"https://bs.wikipedia.org/wiki/Olivia_Williams","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Olivia_Williams_%28Berlin_Film_Festival_2010%29_cropped.jpg","page_title":"Olivia Williams","context_page_description":"Olivia Haigh Williams engleska filmska, pozorišna i televizijska glumica koja se pojavljivala u američkim i britanskim filmovima, kao i u televizijskim serijama. Rođena je u Camden Townu, London, Engleska. Oboje njenih roditelja su advokati."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Naumburg_(Saale)/Ortsteile","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Rittergut_Kreipitzsch_-2.jpg","page_title":"Liste der Kulturdenkmale in Naumburg (Saale)/Ortsteile","context_page_description":"In der Liste der Kulturdenkmale in Naumburg (Saale)/Ortsteile sind alle Kulturdenkmale der Ortsteile der Stadt Naumburg (Saale) außerhalb der Kernstadt aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%AD%AB%E4%B8%AD%E5%B1%B1%E5%A4%A7%E5%85%83%E5%B8%A5%E5%BA%9C%E7%B4%80%E5%BF%B5%E9%A4%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Sun_yat-sen_offical_room.JPG","page_title":"孫中山大元帥府紀念館","context_page_description":"孙中山大元帅府纪念馆，位于广东省广州市海珠区纺织路东沙街18号，是以全国重点文物保护单位“广州大元帅府旧址”为依托建立的遗址性纪念馆。该处旧为孙中山于1917年兴建于此地的广东大元帅府。于2006年5月1日正式对外开放。"},{"page_url":"https://id.wikipedia.org/wiki/Tangga_Batu_Timur,_Tampahan,_Toba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Welcome_Gate_to_Tangga_Batu_Timur%2C_Tampahan%2C_Toba_Samosir.jpg","page_title":"Tangga Batu Timur, Tampahan, Toba","context_page_description":"Tangga Batu Timur adalah salah satu desa di Kecamatan Tampahan, Kabupaten Toba Samosir, Provinsi Sumatra Utara, Indonesia.\\nKepala Desa Tangga Batu Timur saat ini adalah Manalsal Tampubolon."},{"page_url":"https://en.wikipedia.org/wiki/Bagad_Kemper","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/FIL_2012_-_Championnat_national_des_bagado%C3%B9_-_premi%C3%A8re_cat%C3%A9gorie_-_Bagad_Kemper-4.jpg","page_title":"Bagad Kemper","context_page_description":"Bagad Kemper is one of the oldest bagad, Breton pipe bands. Formed in 1949, its first president was none other than Loeïz Ropars, renovator of the Fest Noz and kan ha diskan singer. This ensemble holds the record for the most national Championship title wins.\\nOver time, this bagad has gradually reoriented itself toward collaborations with musicians from other traditions, like the Galician Susana Seivane and Carlos Núñez or South-African Johnny Clegg. Bagad Kemper were also a main feature of the very successful Heritage des Celtes series of concerts, which brought together musicians from all horizons of the Celtic world. They celebrated their 60th anniversary with Breizh Balkanik, a show blending Balkan and Breton music worlds, with the Breton singer Erik Marchand. Except Dan Ar Braz, the bagad also accompanied on stage the band Red Cardell."},{"page_url":"https://la.wikipedia.org/wiki/Nov%C3%A9ant-sur-Moselle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Debut_aqueduc_Noveant_Moselle.jpg","page_title":"Novéant-sur-Moselle","context_page_description":"Novéant-sur-Moselle est commune 1959 incolarum praefecturae Mosellae in Franciae orientalis regione Lotharingia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%88%80%E6%84%9B%E8%88%87%E7%BE%A9%E5%8B%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%E6%81%8B%E7%88%B1%E4%B8%8E%E4%B9%89%E5%8A%A1%E5%89%A7%E7%85%A72.jpg","page_title":"戀愛與義務","context_page_description":"戀愛與義務是一部根據波蘭裔中國女作家華羅琛的同名小說改編，中國聯華影業公司於1931年出品的黑白無聲電影，由卜萬蒼執導，阮玲玉及金焰領銜主演。多年來原以為電影底片已經散佚，直到唯一的完整拷貝在1990年代於烏拉圭被發現並進行修復後終於又重見天日。"},{"page_url":"https://es.wikipedia.org/wiki/Miniopterus_schreibersii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Miniopterus_schreibersii_range_Map.png","page_title":"Miniopterus schreibersii","context_page_description":"El murciélago de cueva es un murciélago microquiróptero de la familia de los vespertiliónidos.\\nM. schreibersii es la única especie de murciélago de Europa que presenta implantación diferida del blastocito.\\nLa posición taxonómica del género Miniopterus está en discusión; algunos autores lo sitúan dentro de una familia propia, Miniopteridae, pero estudios más recientes lo consideran una subfamilia de los vespertiliónidos."},{"page_url":"https://ms.wikipedia.org/wiki/Billie_Lourd","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Billie_Lourd_2015.jpg","page_title":"Billie Lourd","context_page_description":"Billie Catherine Lourd ialah seorang pelakon wanita Amerika Syarikat. Beliau terkenal dengan watak sebagai Chanel #3 dalam siri komedi seram Fox Scream Queens dan untuk peranannya dalam siri antologi seram FX American Horror Story. Beliau juga muncul sebagai Leftenan Connix dalam trilogi sekuel Star Wars. Lourd ialah anak tunggal pelakon Carrie Fisher."},{"page_url":"https://es.wikipedia.org/wiki/Costa_mar%C3%ADtima_de_meseta_de_la_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/BrownSkua4.JPG","page_title":"Costa marítima de meseta de la Argentina","context_page_description":"Se denomina costa marítima de meseta de la Argentina a la sección mayor del borde costero de ese país en su porción sudamericana, la que es bañada por las aguas del mar Argentino del océano Atlántico sudoccidental. Obtiene su nombre del rasgo principal de este litoral, las elevadas y continuas barrancas acantiladas que caen a pique sobre las aguas de la pleamar, las que representan, en el borde continental emergido, el primer escalón de una serie de mesetas escalonadas que determina un ascenso general en la altitud en dirección hacia el oeste.\\nSuelen ser denominadas también costa marítima patagónica de la Argentina, sin embargo, esta denominación es ambigua o parcial, pues bajo el concepto Patagonia cubriría las costas del partido de Patagones las que pertenecen al tramo pampeano o de llanura. Asimismo, genera conflicto en su extremo sur, ya que cubre solo parcialmente las costas fueguinas, correspondiéndole el resto a la totalidad de las costas argentinas de montaña.\\nEl rasgo más singular de estas costas es la península Valdés.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BE%B2%E6%A5%AD%E7%B6%93%E6%BF%9F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/President_Coolidge_veto_of_McNary%E2%80%93Haugen_Farm_Relief_Bill_cartoon.jpg","page_title":"農業經濟學","context_page_description":"農業經濟學，簡稱農經學，是一門關注農業生產及糧食分配的應用經濟學。農經學關注土地利用，著重於最大限度地提高作物產量，同時保持良好的土壤生態系統。整個20世紀，紀律擴大，現行的學科範圍更廣泛。今天的農業經濟學包括各種應用領域，與傳統經濟學有很大的重疊。農業經濟學家為經濟學、計量經濟學、發展經濟學、和環境經濟學研究做出了重大貢獻。農業經濟學影響了食品政策、農業政策以及環境政策。"},{"page_url":"https://ceb.wikipedia.org/wiki/Cumbria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Cumbria_banner_Grasmere.jpg","page_title":"Cumbria","context_page_description":"Kondado ang Cumbria sa Hiniusang Gingharian. Nahimutang ni sa apil sa nasod sa Inglatera, sa sentro nga bahin sa nasod, 400 km sa amihanan-kasadpan sa London ang ulohan sa nasod. Adunay 496,200 ka molupyo. Naglangkob kin og 6.8 ka kilometro kwadrado. Cumbria nga nahimutang sa lanaw sa Ullswater.\\nAng yuta sa Cumbria kay patag sa amihanan, apan sa habagatan nga kini mao ang kabungtoran.\\nCumbria may sa mosunod nga mga subdibisyon:\\nCastle Sowerby\\nAllerdale District\\nBarrow-in-Furness District\\nCarlisle District\\nCopeland District\\nEden District\\nSouth Lakeland District\\nBlawith and Subberthwaite\\nCrook\\nEskdale\\nGosforth\\nWasdale\\nWharton\\nBlennerhasset and Torpenhow\\nStainton\\nBroughton\\nCockermouth\\nDearham\\nEmbleton\\nHayton and Mealo\\nHolme Low\\nArthuret\\nBurgh By Sands\\nCumrew\\nDalston\\nOrton\\nSt. Cuthbert Without\\nBootle\\nDistington\\nLowca\\nLowside Quarter\\nMillom\\nMillom Without\\nParton\\nPonsonby\\nSeascale\\nAsby\\nClifton\\nColby\\nCrackenthorpe\\nCulgaith\\nGlassonby\\nGreat Salkeld\\nGreat Strickland\\nGreystoke\\nHelbeck\\nHesket\\nKirkby Thore\\nLangwathby\\nMungrisdale\\nMurton\\nOrton\\nSkelton\\nThrelkeld\\nWarcop\\nBarbon\\nBurton-in-Kendal\\nHolme\\nHutton Roof\\nKirkby Lonsdale\\nLower Holker\\nMansergh\\nPennington\\nSatterthwaite\\nSedbergh\\nSedgwick\\nHayton"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_class%C3%A9s_du_gouvernorat_de_Tunis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Borj_Sidi_Yahia_2.JPG","page_title":"Liste des monuments classés du gouvernorat de Tunis","context_page_description":"Cette liste des monuments classés du gouvernorat de Tunis est une liste des monuments historiques et archéologiques protégés et classés du gouvernorat de Tunis établie par l'Institut national du patrimoine de Tunisie."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%87%E8%91%89%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/DE7071_normal.jpg","page_title":"万葉線","context_page_description":"万葉線は、富山県高岡市と同県射水市を結ぶ高岡軌道線と新湊港線を併せた総称。また、それらの路線を運営する第三セクター方式の鉄道会社である万葉線株式会社のこと。"},{"page_url":"https://it.wikipedia.org/wiki/Carl_Fogarty","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/CarlFogartyTT92CregNyBaa.jpg","page_title":"Carl Fogarty","context_page_description":"Carl George Fogarty è un pilota motociclistico britannico, quattro volte campione mondiale Superbike. Anche suo padre, George Fogarty, ha corso come pilota motociclistico professionista.\\nFoggy viene soprannominato \\"The King\\" proprio per essere stato il pilota più vincente del mondiale Superbike in termini di campionati del mondo e numero di gare vinte: quattro titoli mondiali e 59 gare vinte in sella alle Ducati 916 e 996 del team ufficiale, prima di essere superato, nel 2018 da Jonathan Rea. I successi di Fogarty sono stati paragonati a quelli dell'australiano Mick Doohan cinque volte campione del mondo della classe 500 e vincitore della categoria negli stessi anni di Fogarty."},{"page_url":"https://es.wikipedia.org/wiki/Econom%C3%ADa_de_Canarias","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Banana_plantation.jpg","page_title":"Economía de Canarias","context_page_description":"La economía de las Islas Canarias en la actualidad está basada en el sector terciario, principalmente turismo, lo que ha propiciado el desarrollo de la construcción. Las islas son uno de los lugares turísticos más visitados del mundo per cápita, encontrándose en el sexto lugar del índice de intensidad turística, en el que las Islas Baleares ocupan el tercer puesto con 1,2 millones de habitantes y 16,5 millones de turistas, por otro lado está Hawai con 1,4 millones de habitantes y 9,8 millones de turistas en 2018. El volumen de deuda respecto al PIB canario es del 13%, pasando de 1000 millones de deuda en 2008 a casi 7000 millones en 2018. El aspecto más importante de la economía de las islas es probablemente la fuga de capitales de la industria turística, con empresas inglesas, alemanas, escandinavas, españolas y de otros países que extraen las ganancias obtenidas en el archipiélago, invirtiendo el dinero en sus países correspondientes. Además otro factor importante de esta fuga de capitales es el hecho de que estas empresas pagan los impuestos de sus beneficios anuales en sedes centrales ubicadas en ciudades de la geografía española."},{"page_url":"https://de.wikipedia.org/wiki/Freil%C3%A4nder_Alm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Freil%C3%A4nder_Alm_von_Stockeralm_Ri_Norden.jpg","page_title":"Freiländer Alm","context_page_description":"Die Freiländer Alm ist eine Almregion in der Koralpe in der Steiermark und gehört zur Stadtgemeinde Deutschlandsberg im Bezirk Deutschlandsberg."},{"page_url":"https://fr.wikipedia.org/wiki/12e_%C3%A9tape_du_Tour_de_France_2004","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Basso_Armstrong_Tourmalet_2004.jpg","page_title":"12e étape du Tour de France 2004","context_page_description":"La 12ᵉ étape du Tour de France 2004 s'est déroulée le 16 juillet 2004. Le parcours s'étendait sur 197 kilomètres et reliait Castelsarrasin à La Mongie. L'Italien Ivan Basso s'est imposé devant l'Américain Lance Armstrong. Le Français Thomas Voeckler garde le maillot jaune à l'issue de l'étape."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%83%A1%E5%B1%B1%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Koriyama_Government_Complex.jpg","page_title":"郡山市","context_page_description":"郡山市は、福島県中通り中部に位置する市。中核市に指定されている。\\n郡山都市圏の中心都市であり、東北地方では宮城県仙台市に次ぐ経済規模を持つ。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B9%D9%84%D9%89_%D8%AE%D8%A7%D9%85%D9%86%D8%A6%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Khamenei_signature.png","page_title":"على خامنئى","context_page_description":"على حسينى خامنئى هو المرشد الاعلى للثورة الاسلامية الايام دى، ومن المرجعيات الدينية الشيعية فى إيران."},{"page_url":"https://en.wikipedia.org/wiki/Pustular_psoriasis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Psoriasis_manum.jpg","page_title":"Pustular psoriasis","context_page_description":"The term pustular psoriasis is used for a heterogeneous group of diseases that share pustular skin characteristics."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Logatec_Kong-si%C4%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Logatec_-_cerkev_Ro%C5%BEnovenske_Matere_bo%C5%BEje.jpg","page_title":"Logatec Kong-siā","context_page_description":"Logatec Kong-siā sī Slovenia Kiōng-hô-kok ê chi̍t ê kong-siā."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B8%D0%BB%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%BC%D0%B8_(1877)","image_url":"https://upload.wikimedia.org/wikipedia/ru/b/bb/Thomas_Carter_Wilson.jpg","page_title":"Уилсон, Томми (1877)","context_page_description":"То́мас Ка́ртер Уи́лсон, также известный как То́мми Уи́лсон англ. Tommy Wilson — английский футболист, крайний нападающий."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_Novakovi%C4%87_%C3%A0_Kraljevo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Novakovi%C4%87a_ku%C4%87a_%280%29.jpg","page_title":"Maison Novaković à Kraljevo","context_page_description":"La maison Novaković à Kraljevo se trouve à Kraljevo et dans le district de Raška, en Serbie. Elle est inscrite sur la liste des monuments culturels protégés de la République de Serbie."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%AE%89%E5%85%A8%E5%B7%A5%E7%A8%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/ISS_impact_risk.jpg","page_title":"安全工程","context_page_description":"安全工程是一门确保工程系统提供足够安全程度的工程科学。安全工程和系统工程、工业工程及其子领域系统安全工程密切相关。安全工程可确保一个生命关键系统的行为符合需求，甚至可能在部分零件损坏时仍可符合需求。"},{"page_url":"https://fr.wikipedia.org/wiki/NGC_3215","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/NGC_3215_SDSS.jpg","page_title":"NGC 3215","context_page_description":"NGC 3215 est une galaxie spirale barrée relativement éloignée et située dans la constellation du Dragon à environ 431 millions d'années-lumière de la Voie lactée. Elle a été découverte par l'astronome germano-britannique William Herschel en 1802.\\nNGC 3215 en compagnie de NGC 3212 figurent dans l'atlas des galaxies particulières de Halton Arp sous la cote Arp 181. Ces deux galaxies sont à peu près à la même distance de la Voie lactée et si l'on tient compte de l'image de l'étude SDSS, elles semblent en en interaction gravitationnelle."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D1%82_%D0%9B%D0%B0%D1%80%D1%81%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Blick_vom_Castell_Bellver_auf_den_Yachthafen_von_Palma_de_Mallorca_-_panoramio.jpg","page_title":"Бент Ларсен","context_page_description":"Єрґен Бент Ларсен — данський шахіст, шаховий журналіст, публіцист і коментатор. Один із найсильніших шахістів світу 1960—1970-х років. Найкращий данський шахіст усіх часів, найуспішніший скандинавський гросмейстер до появи Магнуса Карлсена. Вирізнявся нешаблонною, агресивною та ризикованою грою, заради якої часто відмовлявся від нічиїх.\\nМіжнародний майстер, гросмейстер. Перший володар «Оскара» — нагороди найкращому шахістові світу за підсумками року. Наприкінці 1960-х років за численні турнірні успіхи отримав від журналістів прізвисько «турнірний чемпіон світу». Очолював збірну світу під час «Матчу століття»: СРСР — решта світу.\\nТільки він і Михайло Таль вигравали по три міжзональні турніри. Ларсен робив це в 1964, 1967 і 1976 роках. Учасник матчів претендентів 1965, 1968, 1971 і 1977 років. Бент Ларсен і Боббі Фішер були єдиними представниками Заходу, які могли в той період успішно боротися з радянською шаховою гегемонією. Після розгрому від Фішера з рахунком 0:6 у півфіналі матчів претендентів 1971 і посереднього виступу в міжзональному турнірі 1973 року спортивні результати данця почали погіршуватися."},{"page_url":"https://fr.wikipedia.org/wiki/Isotta_Nogarola","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Isotta_Nogarola.jpg","page_title":"Isotta Nogarola","context_page_description":"Isotta Nogarola, née et morte à Vérone, est une écrivaine humaniste de la Renaissance italienne, connue également pour ses talents d'oratrice. Elle est considérée comme une des protoféministes italiennes. Elle est mentionnée sur l'installation artistique The Dinner Party de Judy Chicago. À Vérone, une place et une école portent son nom."},{"page_url":"https://en.wikipedia.org/wiki/Hercules_Transit_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hercules_Transit_Center6.png","page_title":"Hercules Transit Center","context_page_description":"Hercules Transit Center is a major commuter hub in the western Contra Costa County city of\\nHercules, California. It is anchored by WestCAT bus services. The center was originally on San Pablo Avenue. In August 2009, the transit center was relocated to the other side of I-80 with additional paid parking.\\nThe transit center is a pulse transfer point for various local feeder bus lines from the adjacent areas of Hercules, Pinole, Rodeo, the northern Hilltop area of Richmond, Bayview-Montalvin, and Tara Hills.\\nThe feeder services feed express commuter bus service to El Cerrito del Norte BART station in El Cerrito, downtown Martinez and Martinez Amtrak station. These services provide transfers to AC Transit at Richmond Parkway Transit Center, shopping areas at Hilltop Mall Shopping Center and Pinole Vista Shopping Center and transbay service to the San Francisco Transbay Terminal.\\nThe westbound weekday morning commute from this point south towards the San Francisco–Oakland Bay Bridge is the most congested in the San Francisco Bay Area since 2001 according to Caltrans.\\nStudies have been concluded as to the feasibility of running BART service to the Transit Center."},{"page_url":"https://sv.wikipedia.org/wiki/Brienomyrus_longianalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Brienomyrus_longianalis.jpg","page_title":"Brienomyrus longianalis","context_page_description":"Brienomyrus longianalis är en fiskart som först beskrevs av Boulenger, 1901. Brienomyrus longianalis ingår i släktet Brienomyrus och familjen Mormyridae. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade."},{"page_url":"https://pl.wikipedia.org/wiki/Bollengo","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Bollengo_Campanile_Romanico_2.JPG","page_title":"Bollengo","context_page_description":"Bollengo – miejscowość i gmina we Włoszech, w regionie Piemont, w prowincji Turyn.\\nWedług danych na rok 2004 gminę zamieszkiwało 1996 osób, 142,6 os./km²."},{"page_url":"https://es.wikipedia.org/wiki/Instituto_de_Estad%C3%ADstica_de_la_Universidad_de_Par%C3%ADs_VI","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Albert_Jacquard_-_May_2009.jpg","page_title":"Instituto de Estadística de la Universidad de París VI","context_page_description":"El ISUP es una escuela de estadística basada en París, que en este momento funciona en dos emplazamientos, uno en las proximidades de la plaza Italia, y otro frente a la plaza Jussieu.\\nEsta institución propone especializaciones en Actuaría, Bioestadística, Industria, y Servicios."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%BCnster","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Germany%2C_Nordrhein-Westfalen%2C_M%C3%BCnster_%281%29%2C_Erbdrostenhof.JPG","page_title":"Münster","context_page_description":"Münster is an independent city in North Rhine-Westphalia, Germany. It is in the northern part of the state and is considered to be the cultural centre of the Westphalia region. It is also capital of the local government region Münsterland. Münster was the location of the Anabaptist rebellion during the Protestant Reformation and the site of the signing of the Treaty of Westphalia ending the Thirty Years' War in 1648. Today it is known as the bicycle capital of Germany.\\nMünster gained the status of a Großstadt with more than 100,000 inhabitants in 1915. As of 2014, there are 300,000 people living in the city, with about 61,500 students, only some of whom are recorded in the official population statistics as having their primary residence in Münster."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%82%D8%B8%D8%A9_%D9%81%D9%8A%D9%86%D9%8A%D8%BA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Joyce_wake.jpg","page_title":"يقظة فينيغان","context_page_description":"جنازة فينيغان أو بعث آل فينيغان ‏، عمل روائي للكاتب الأيرلندي جيمس جويس. تُعتبر هذه الرواية من الروايات الأكثر تعقيدًا نظرًا لأسلوب كتابتها التجريبي ونقدها الإيجابي باعتبارها واحدة من أصعب الأعمال الروائية في اللغة الإنجليزية. وتُعتبر هذه الرواية، التي كُتِبَت في باريس على مدار سبعة عشر عامًا ونُشِرَت عام 1939، آخر أعمال جويس. تتميّز الرواية بلغة ومعانٍ غامضة إلى حد كبير، إذ تمزج بين الكلمات المعجمية الإنجليزية القياسية والكلمات المُستحدثة والجناس وتعابير لغوية متعددة مُحدِثةّ تأثيرًا فريدًا من نوعه. يعتقد العديد من النقاد أن استخدام جويس لهذه التقنية كان بمثابة محاولة منه لاستعادة تجربة النوم والأحلام. نظرًا للتجارب اللغوية في العمل واستخدام جويس لتقنيات مثل سيل الوعي والإشارات الضمنية والتداعي الحُرّ وتخلّيه عن أسلوب السرد القصصي، تُعتبر هذه الرواية من أقل الروايات قراءةً بين الجمهور.\\nعلى الرغم من الصعوبات التي واجهها القُرّاء والنقاد، إلا أنهم توصّلوا نهايةّ إلى إجماع واسع حول مجموعة الشخصيات الرئيسية في الرواية، وبدرجة أقل، إلى حبكتها، لكن التفاصيل الرئيسية بقيت مراوغة. تناقش هذه الرواية، بطريقة غير تقليدية، عائلة إيرويكر، والتي تتألف من الأب «إتش سي إي» والأم «إيه إل بي» وأطفالهما الثلاثة «شيم» وهو كاتب، و«شون» ساعي البريد، و«إيسي»."},{"page_url":"https://sh.wikipedia.org/wiki/Kornet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Cornet-Bb-large.jpg","page_title":"Kornet","context_page_description":"Kornet je član limene obitelji glazbenih instrumenata. Iako se koristi povremeno u orkestrima, najistaknutije mjesto korneta je u limenim glazbama, vojnim orkestrima i jazz ansamblima. Po obliku je sličan trublji, ali je kraći od nje. Svira se na isti način kao i ona: koristeći se ventilima i napetošću usana da bi se mijenjali tonovi.\\nMeđutim, postoji nekoliko važnih osobina koje čine kornet jedinstvenim, kao što su njegov dublji, uži pisak. Taj pisak čini instrument elastičnijim, jer omogućava sviraču da djelotvornije kontrolira svoj ton. Kornet je također nešto manji od trublje, iako katkad svirači dodaju dugački krak na pisak kako bi stvorili dodatno dugu sviralu.\\nKornet ne treba miješati sa istim, instrumentom u srednjem vijeku i renesansi, koji je koristio pisak s kapicom na drvenom tijelu ili s instrumentom od slonovače s rupama za prste slične onima na drvenim puhačkim instrumentima."},{"page_url":"https://en.wikipedia.org/wiki/Virgin_Money_UK_plc","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Yorkshire_Bank.JPG","page_title":"Virgin Money UK plc","context_page_description":"Virgin Money UK plc is a holding company that owns Clydesdale Bank plc, which in turn trades as Clydesdale Bank, Yorkshire Bank and Virgin Money in the United Kingdom. It was formed as CYBG plc by National Australia Bank in February 2016, in advance of the divestment of its UK business through a stock market flotation. It is listed on the London Stock Exchange and Australian Securities Exchange; it is also a constituent of the FTSE 250 Index."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%DA%86%D9%88%D9%84%D9%81%D9%88%D8%B1_%D8%B3%DA%A4%D9%8A%D8%B1%D9%8A%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Eyj%C3%B3lfur_Sverrisson.jpg","page_title":"ايچولفور سڤيريسون","context_page_description":"ايچولفور سڤيريسون لاعب كورة قدم من ايسلاندا."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Drepana","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Rostre_Iles_Egates_Marcus_Populicius.png","page_title":"Battle of Drepana","context_page_description":"The naval Battle of Drepana took place in 249 BC during the First Punic War near Drepana in western Sicily, between a Carthaginian fleet under Adherbal and a Roman fleet commanded by Publius Claudius Pulcher.\\nPulcher was blockading the Carthaginian stronghold of Lilybaeum when he decided to attack their fleet, which was in the harbour of the nearby city of Drepana. The Roman fleet sailed by night to carry out a surprise attack but became scattered in the dark. Adherbal was able to lead his fleet out to sea before it was trapped in harbour; having gained sea room in which to manoeuvre he then counter-attacked. The Romans were pinned against the shore, and after a day of fighting were heavily defeated by the more manoeuvrable Carthaginian ships with their better-trained crews. It was Carthage's greatest naval victory of the war; they turned to the maritime offensive after Drepana and all but swept the Romans from the sea. It was seven years before Rome again attempted to field a substantial fleet, while Carthage put most of its ships into reserve to save money and free up manpower."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Kartoffelsorten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Catalogue_of_seed_potatoes_%281891%29_%2820397449419%29.jpg","page_title":"Liste von Kartoffelsorten","context_page_description":"Die Liste von Kartoffelsorten verzeichnet über 2.900 Sorten der Kartoffel mit über 3.000 Namen und mehr als 290 Bildern. Sie erhebt dabei keinen Anspruch auf Vollständigkeit."},{"page_url":"https://da.wikipedia.org/wiki/Litteratur","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Printing3_Walk_of_Ideas_Berlin.JPG","page_title":"Litteratur","context_page_description":"Litteratur - moderne afledning af latin: littera; bogstav - betegner næsten enhver form for skrift, og \\"...hele bogverdenen;\\". Termen bruges hovedsageligt om prosa, både fiktion og sagprosa, drama og poesi, og da tekster også kan fortælles og synges omfatter det også sange og eventyr. Ældre tekster, såsom legender og historiske myter, er også omfattet og endda middelalderen liturgiske og teologiske tekster. Men i det hele taget er termen netop meget inklusiv. Tekster der ikke regnes for litteratur er for eksempel regnskaber og skøder."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ch%C3%A2teaux_du_Loiret","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/CP_Ch%C3%A2teau-Renard_ch%C3%A2teau_et_miroir.jpg","page_title":"Liste des châteaux du Loiret","context_page_description":"La liste des châteaux du Loiret recense de manière non exhaustive les châteaux au sens large du terme situés sur le territoire du département français du Loiret en région Centre-Val de Loire.\\nIl est fait mention du statut des édifices dans la base Mérimée contenant des informations provenant du service des monuments historiques et de l'inventaire général du patrimoine culturel."},{"page_url":"https://bs.wikipedia.org/wiki/Equisetum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Equisetum_telmateia_stem.jpg","page_title":"Equisetum","context_page_description":"Equisetum je rod preslica, jedan od tri roda biljne porodice Equisetaceae iz razreda Equisetopsida. Obuhvata dvadesetak vrsta zeljastih trajnica s puzavim podankom i nadzemnom člankovitom, jednostavnom ili pršljenasto razgranatom stabljikom.\\nRod Calamites iz porodice Calamitaceae obilan je u naslagima uglja iz karbona"},{"page_url":"https://ceb.wikipedia.org/wiki/Turdus_pilaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Turdus_pilaris_1_%28Martin_Mecnarowski%29.jpg","page_title":"Turdus pilaris","context_page_description":"Espesye sa langgam ang Turdus pilaris. Una ning gihulagway ni Linnaeus ni adtong 1758. Ang Turdus pilaris sakop sa kahenera nga Turdus sa kabanay nga Turdidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Dottertukan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ramphastos_vitellinus_-Brazil-8.jpg","page_title":"Dottertukan","context_page_description":"Der Dottertukan, auch Zitronentukan, Arieltukan oder Kulmtukan genannt, ist eine Vogelart aus der Familie der Tukane. Er kommt ausschließlich in Südamerika vor. Es handelt sich um einen großen Tukan, er kann nur mit dem noch größeren Weißbrusttukan verwechselt werden. Die beiden Arten unterscheiden sich jedoch auch durch ihr Rufrepertoire. Für den Dottertukan wurden mehrere Unterarten beschrieben, die sich in der Gesichts-, Schnabel- und Brustfärbung teils deutlich unterscheiden.\\nDie IUCN stuft den Dottertukan als ungefährdet ein. Angaben zum Weltbestand gibt es nicht, er wird jedoch als relativ häufig bezeichnet. Da Dottertukane häufiger in den Vogelhandel gelangen, werden sie seit 1992 im Anhang II/B des Washingtoner Artenschutzübereinkommens geführt."},{"page_url":"https://sv.wikipedia.org/wiki/Paepalanthus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Paepalanthus_polyanthus_2.jpg","page_title":"Paepalanthus","context_page_description":"Paepalanthus är ett släkte av gräsväxter. Paepalanthus ingår i familjen Eriocaulaceae."},{"page_url":"https://de.wikipedia.org/wiki/Ybyrapora_sooretama","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ybyrapora-sooretama-juvenile.jpg","page_title":"Ybyrapora sooretama","context_page_description":"Ybyrapora sooretama ist eine Spinnenart aus der Familie der Vogelspinnen. Sie wurde 2009 erstbeschrieben. Die Art wurde nach dem Naturreservat Sooretama benannt und ist dort sehr wahrscheinlich endemisch. Sie ist möglicherweise durch Veränderungen ihres natürlichen Habitats durch den Menschen wie beispielsweise illegale Abholzungen und Schmuggel bedroht."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D0%BA%D1%96%D1%88%D0%BD%D0%B8%D0%B9_%D1%87%D0%B0%D1%81%D0%BE%D1%81%D0%BB%D0%BE%D0%B2_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D0%B0_%D0%91%D0%B5%D1%80%D1%80%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Les_Tr%C3%A8s_Riches_Heures_du_duc_de_Berry_f%C3%A9vrier.jpg","page_title":"Розкішний часослов герцога Беррійського","context_page_description":"«Розкішний часослов герцога Беррійського» — ілюмінований рукопис XV століття. Найвідомішими зображеннями часослова є 12 мініатюр циклу «Пори року» з зображеннями розваг знаті або сільських робіт на фоні середньовічних замків.\\nРукопис був замовлений мініатюристам братам Полю, Жану і Ерману Лімбургам герцогом Жаном Беррійським у 1410–1411 роках і залишився незавершеним після смерті трьох художників і їх замовника в 1416 році. Ймовірно, він був доповнений в календарній частині анонімним майстром у 1440–1450-х роках. Деякі історики мистецтва вважають, що цим художником був Бартелемі д'Ейк. У 1485–1486 роках манускрипт був доопрацьований художником Жаном Коломбом на замовлення Карла I Савойського, проте деякі аркуші залишилися незавершеними. Придбаний герцогом Омальським в 1856 році, часослов зберігається в його замку Шантійї. Разом з маєтком і зібранням творів мистецтва, що в ньому знаходяться, часослов був переданий герцогом французькій державі; за його заповітом манускрипт, як і інші експонати, ніколи не повинен залишати межі Шантійї."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C_%D0%90%D1%88%D0%BE%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ningbo_Ayuwang_Si_2013.07.28_13-57-48.jpg","page_title":"Монастырь Ашоки","context_page_description":"Монастырь Ашоки или Монастырь короля Ашоки — чань-буддийский монастырь, расположенный в пригородном районе Иньчжоу города Нинбо в китайской провинции Чжэцзян.\\nОснование монастыря восходит к 282 году. Монастырь назван в честь третьего императора империи Маурьев Ашоки.\\nСогласно легенде, Ашока считал район Нинбо местом уединённым и спокойным. Вскоре туда отправился старший монах в поисках места для основания нового храма. Услышав звук горячего источника, монах пошёл на звук и перед ним чудесным образом возник храм. Позже в 405 году рядом со старым храмом был построен новый, Храм Ступы, а также многие другие здания.\\nВ монастыре находится теменная кость Будды Шакьямуни — одна из 84 000 реликвий, собранных по приказу Ашоки, первого могущественного индийского покровителя буддизма. Реликвия находится в семиступенчатой каменной ступе, расположенной в Зале ступы.\\nВажными зданиями монастыря является зал Ступы, где находится реликвия Будды Шакьямуни и главный зал. Храм также является важным центром чань-буддизма и японского направления дзен-буддизма. В 2006 году монастырь был внесён в список охраняемых памятников КНР под номером 6-545."},{"page_url":"https://de.wikipedia.org/wiki/Schempp-Hirth_Nimbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Mini-Nimbus-hinten.jpg","page_title":"Schempp-Hirth Nimbus","context_page_description":"Schempp-Hirth Nimbus ist ein von Klaus Holighaus konstruiertes Segelflugzeug. Hersteller ist Schempp-Hirth in Kirchheim.\\nBis auf den Mini-Nimbus haben alle Nimbus-Typen mehr als 20 m Spannweite, sie fliegen also in der Offenen Klasse.\\nDer Mini-Nimbus hingegen fliegt in der Rennklasse."},{"page_url":"https://nl.wikipedia.org/wiki/Koetze_Tibbe","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Kropswolde_-_Windmotor_Koetze_Tibbe.jpg","page_title":"Koetze Tibbe","context_page_description":"Koetze Tibbe of Koetse Tibbe is een poldermolen nabij het Groninger dorp Kropswolde, dat in de Nederlandse gemeente Midden-Groningen ligt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_former_synagogues_in_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Blackpool_United_Hebrew_Synagogue_3.jpg","page_title":"List of former synagogues in the United Kingdom","context_page_description":"This list of former synagogues in the United Kingdom consists of buildings in England, Scotland, Wales and Northern Ireland which were previously used as synagogues; for a list of current Jewish communities or congregations, see List of Jewish communities in the United Kingdom."},{"page_url":"https://de.wikipedia.org/wiki/Josefa_Schellmoser","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/2020-01-19_Mascot_Ceremony_Women%27s_Skeleton_%282020_Winter_Youth_Olympics%29_by_Sandro_Halank%E2%80%93040.jpg","page_title":"Josefa Schellmoser","context_page_description":"Josefa Schellmoser ist eine deutsche Skeletonpilotin. Sie nahm 2020 im Skeleton für Deutschland an den Olympischen Jugend-Winterspielen teil und gewann dabei die Silbermedaille."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_Ravenscrag","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Pavillon_Irving_Ludmer_%28McGill_University%29_03.jpg","page_title":"Maison Ravenscrag","context_page_description":"La maison Ravenscrag est une maison bourgeoise située dans le quartier du Mille carré doré de l'arrondissement Ville-Marie à Montréal au Canada.\\nCette maison est successivement la résidence de Sir Hugh Allan de 1863 à 1882 et de son fils aîné Sir Hugh Montagu Allan de 1882 à 1940. En 1940, cette maison devient la propriété de l’hôpital Royal Victoria. Depuis 1943, l'édifice abrite l’institut Allan Memorial qui héberge le département de psychiatrie de l’hôpital et du centre universitaire de santé McGill.\\nConstruite essentiellement entre 1861 et 1863, cette résidence est principalement conçue et réalisée par l’architecte Victor Roy dans le style italianisant en suivant les principes de l'architecture victorienne. L’architecte John William Hopkins de la firme William & Wily contribue également à la conception et à la réalisation de plusieurs pièces de la maison. La demeure comporte à l’origine plus de 72 pièces et est pourvue de l’équipement le plus avancé de son temps, notamment en termes de plomberie et de chauffage.\\nHugh Allan baptise sa résidence « Ravenscrag » à la suite de sa construction dans les années 1860."},{"page_url":"https://pt.wikipedia.org/wiki/Campanha_de_Gal%C3%ADpoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Map_of_Turkish_forces_at_Gallipoli_April_1915.png","page_title":"Campanha de Galípoli","context_page_description":"A Campanha de Galípoli, também conhecida como Batalha dos Dardanelos, teve como palco a península de Galípoli na Turquia, de 25 de abril de 1915 a 9 de janeiro de 1916, durante a Primeira Guerra Mundial. Foi uma das campanhas mais custosas e trágicas da guerra. Forças britânicas, francesas, australianas e neozelandesas desembarcaram em Galípoli, numa tentativa de invasão da Turquia e captura do estreito de Dardanelos. A tentativa falhou, com pesadas perdas para ambos os lados. Os aliados se retiraram do local durante os meses de dezembro de 1915 e janeiro de 1916.\\nAs divisões ANZAC se viram especialmente danificadas, e esta campanha passou a significar certa dissensão por parte do aliados oriundos da Nova Zelândia e da Austrália, que acusaram as tropas britânicas de arrogância, crueldade e inaptidão, bem como principais responsáveis pelo fracasso das operações. O Anzac Day continua a ser a comemoração mais significativa dos veteranos na Austrália e na Nova Zelândia, superando o Dia do Armistício / Dia da Lembrança.\\nA Campanha de Galípoli repercutiu profundamente em todas as nações envolvidas."},{"page_url":"https://ceb.wikipedia.org/wiki/Velinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Velinga_kyrka_Sweden_01.jpg","page_title":"Velinga","context_page_description":"Parokya ang Velinga sa Sweden. Nahimutang ni sa munisipyo sa Tidaholms kommun ug lalawigan sa Västra Götalands län, sa habagatang bahin sa nasod, 280 km sa habagatan-kasadpan sa Estokolmo ang ulohan sa nasod. Adunay 254 ka molupyo.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://es.wikipedia.org/wiki/Cuarentena_en_India_de_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Blocking_of_street_during_Corona_crisis_in_Kolkata_01.jpg","page_title":"Cuarentena en India de 2020","context_page_description":"La Cuarentena de India fue declarada por el primer ministro Narendra Modi el 24 de marzo de 2020, por 21 días, limitando el movimiento de las 1.300 millones de personas de la India como medida preventiva contra la Pandemia de enfermedad por coronavirus en India.​ Esto fue ordenado después de que voluntarios públicos quedaran 14 horas en un toque de queda público el 22 de marzo, seguido por la ejecución de una serie de reglas en las partes del país afectadas por el COVID-19.​​\\nObservadores declararon que el confinamiento había retrasado el índice de crecimiento de la pandemia para el 6 de abril a un índice de duplicarse cada seis días, y del 18 abril, a un índice de duplicarse cada ocho días.​​\\nCuando terminó el primer confinamiento, gobiernos estatales y comités locales recomendaron extenderlo.​ Los gobiernos estatales de Odisha y de Punyab se adelantaron al extender el confinamiento hasta el 1 de mayo.​ Maharashtra, Karnataka, Bengala Occidental y Telangana hicieron lo mismo tiempo después.​​"},{"page_url":"https://ga.wikipedia.org/wiki/Ben_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Official_portrait_of_Ben_Lake_crop_2.jpg","page_title":"Ben Lake","context_page_description":"Is polaiteoir Breatnach de chuid Plaid Cymru é Ben Morgan Lake. Rugadh é ar an 22 Eanáir 1993. I mí Mheitheamh 2017, bhí sé tofa don chéad uair mar theachta parlaiminte do Ceredigion."},{"page_url":"https://es.wikipedia.org/wiki/Sombra_de_ojos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/A_woman_wearing_Eye_Shadow.jpg","page_title":"Sombra de ojos","context_page_description":"La sombra de ojos es un cosmético que se aplica en los párpados y debajo de las cejas. Comúnmente se utilizan para darles tonalidades y luz a los ojos.\\nLas sombras de ojos proveen profundidad y dimensión a los ojos, complementan el color de los mismos, o simplemente atraen la atención. Existe en diferentes colores y texturas. Generalmente están hechos de polvos, pero pueden encontrarse en forma de líquido, de lápiz o de crema.\\nLas civilizaciones alrededor del mundo utilizan sombra de ojos, principalmente las mujeres, pero también los hombres en algunos casos. En el mundo occidental es un cosmético exclusivamente femenino. En promedio, la distancia entre las pestañas y las cejas es el doble en tamaño en las mujeres que en los hombres. Así, las sombras de ojos más pálidas agrandan el área y dan un efecto muy femenino.\\nEn la subcultura gótica, las sombras empleadas son negras o muy oscuras, otros tipos de maquillaje como el rímel son populares en ambos géneros.\\nMucha gente usa sombra de ojos simplemente para favorecer su apariencia, pero también se utiliza en los teatros y en otras obras, para crear un aspecto memorable, con colores brillantes y a veces poco comunes."},{"page_url":"https://fr.wikipedia.org/wiki/Vincelles_(Sa%C3%B4ne-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/VincellesChurch.JPG","page_title":"Vincelles (Saône-et-Loire)","context_page_description":"Vincelles est une commune française située dans le département de Saône-et-Loire en région Bourgogne-Franche-Comté."},{"page_url":"https://fi.wikipedia.org/wiki/Loranthaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Dendrophthoe_falcata_10.JPG","page_title":"Loranthaceae","context_page_description":"Loranthaceae on kasviheimo koppisiemenisten Santalales-lahkossa. Heimoa on aiemmin kutsuttu mistelikasveiksi, mutta mistelien osoittauduttua santelikasvien heimoon kuuluviksi, kyseinen nimi ei enää ole sopiva."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Upper_Silesia_coat_of_arms.png","page_title":"Исторические области Польши","context_page_description":"Исторические области Польши — регионы, которые были связаны с Польским государством на протяжении его истории, или находятся в современной Польше, без включения их в её административное деление. Есть несколько исторических и культурных регионов Польши, которые являются этнографическими областями. Их точные границы не могут быть определены, так как регионы не являются официальными политическими или административными единицами. Они разделяются по культуре, народным традициям, традиционным образам жизни, песням, сказкам и т.д. В какой-то степени, регионы соответствуют зонам диалектов польского языка. Список не может быть однозначно определён."},{"page_url":"https://ia.wikipedia.org/wiki/Holomycota","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/European_Panther.jpg","page_title":"Holomycota","context_page_description":"Holomycota es un no value de Opisthokonta.\\nIste articulo pecietta ha essite generate automaticamente a base de Wikidata. Pro render le pagina modificabile, publica in modo fonte un prime version con iste linea: {{subst:Autopagina/articulo/subclasse de biota}} e retorna postea al modification."},{"page_url":"https://pt.wikipedia.org/wiki/Wittingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Junkerhof.jpg","page_title":"Wittingen","context_page_description":"Wittingen é uma cidade da Alemanha localizada no distrito de Gifhorn, estado de Baixa Saxônia."},{"page_url":"https://pt.wikipedia.org/wiki/Mosteiro_de_Santa_Maria_de_Montederramo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Claustro_reglar_montederramo.jpg","page_title":"Mosteiro de Santa Maria de Montederramo","context_page_description":"O Mosteiro de Santa Maria de Montederramo é um mosteiro medieval possivelmente fundado no século X e que chegou a se tornar um dos mosteiros de maior poder econômico e social durante muitos anos na Galiza. Atualmente, o seu templo é um dos melhores exemplos do estilo Herreriano."},{"page_url":"https://en.wikipedia.org/wiki/1964_Republican_Party_presidential_primaries","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Rockefeller_NELSON.jpg","page_title":"1964 Republican Party presidential primaries","context_page_description":"The 1964 Republican presidential primaries were the selection process by which voters of the Republican Party chose its nominee for President of the United States in the 1964 U.S. presidential election. Senator Barry Goldwater of Arizona was selected as the nominee through a series of primary elections and caucuses culminating in the 1964 Republican National Convention held from July 13 to July 16, 1964, in San Francisco, California."},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_Peru","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Gocta.jpg","page_title":"Tourism in Peru","context_page_description":"Since the 2000s, Tourism in Peru makes up the nation's third largest industry, behind fishing and mining. Tourism is directed towards archaeological monuments, ecotourism in the Peruvian Amazon, cultural tourism in colonial cities, gastronomic tourism, adventure tourism, and beach tourism. According to a Peruvian government study, the satisfaction rate for tourists after visiting Peru is 94%. Tourism is the most rapidly growing industry in Peru, growing annually at a rate of 25% over the past five years. Tourism is growing in Peru faster than any other country in South America. Iperú is the Peruvian national tourist office."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_East_Staffordshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Dunstall_Hall_%283476047556%29.jpg","page_title":"Grade II* listed buildings in East Staffordshire","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of East Staffordshire in Staffordshire."},{"page_url":"https://sv.wikipedia.org/wiki/Slaget_om_Helsingfors","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Portun_pataljoona_%282%29.jpg","page_title":"Slaget om Helsingfors","context_page_description":"Slaget om Helsingfors var ett slag under finska inbördeskriget som ägde rum den 11–13 april 1918 i Helsingfors, då tyska Östersjödivisionen erövrade staden från de röda. Tyskarna hade landstigit i Hangö en dryg vecka tidigare och avancerade snabbt mot Helsingfors. Under slaget om Helsingfors understöddes de av de vita skyddskårerna, vars deltagande i slaget dock var mycket begränsat. 54 tyskar, 23 vita och cirka 400 röda stupade under slaget och flera tusen röda togs till fånga och internerades.\\nDen tyske generalmajoren Rüdiger von der Goltz gav order om intagning av Helsingfors torsdagen den 11 april. Första dagen koncentrerades striderna till Esbo och på fredagsmorgonen nådde tyskarna nuvarande Mannerheimvägen och Böle i Tölöviken. Efter intensiva gatustrider kapitulerade de rödas högkvarter i Smolna den 13 april, varefter tyskarna inledde beskjutning av de röda fästena i Broholmen och Hagnäs. Samma dag kapitulerade de röda, men striderna fortsatte ännu till den 14 april då de rödas sista bastioner erövrades."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_in_Klagenfurt_am_W%C3%B6rthersee","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/KS01_Lindenalle_Ebenthal.JPG","page_title":"Liste der Naturdenkmäler in Klagenfurt am Wörthersee","context_page_description":"Die Liste der Naturdenkmäler in Klagenfurt am Wörthersee listet die als Naturdenkmal ausgewiesenen Objekte in Klagenfurt am Wörthersee im Bundesland Kärnten auf."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D1%80%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Djerba_lever_soleil.jpg","page_title":"Джерба","context_page_description":"Джерба или Джарба е остров на Тунис в област Меденин. Намира се в залива Габес на Средиземно море."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B9%95%E6%9C%AB%E6%9C%9F%E3%81%AE%E6%96%87%E5%8C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Hiroshige_Van_Gogh_1.JPG","page_title":"幕末期の文化","context_page_description":"幕末期の文化または開国期の文化とは、江戸幕府が開国に踏み切った1854年ころから大政奉還によって幕府が倒壊、明治維新をむかえる1868年ころまでの日本の文化。日本史の時代区分では江戸時代末期にあたり、当時使用された元号は旧い順に嘉永・安政・万延・文久・元治・慶応である。本格的に西洋文明との接触が始まったことで、その受容と対応のあり方が問われる一方、政治的激動の時代であり、文化の様態もまた強い政治性・軍事性を帯びている。"},{"page_url":"https://sv.wikipedia.org/wiki/Dickson_(sl%C3%A4kt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Oskar_Dickson_%281823-1897%29.jpg","page_title":"Dickson (släkt)","context_page_description":"Dickson är en svensk köpmannafamilj, känd för sin verksamhet i Göteborg under 1800-talet inom bland annat sågverk, handel, rederi samt genom sina donationer. Några familjemedlemmar blev kända träpatroner och familjefirman James Dickson & Co kom att anklagas för baggböleri.\\nSläkten härstammar ursprungligen från Kelso i Skottland, och anses utgöra en gren av den gamla skotska släkten Keith. Namnets språkliga rot utgör den familjära formen för Richard, alltså \\"Richards son\\". Ursprunget till namnet Dickson är en Richard Keith, som kallades Dick. Hans son Thomas började kalla sig Dickson."},{"page_url":"https://af.wikipedia.org/wiki/Vilnius","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Vilnele_river.jpg","page_title":"Vilnius","context_page_description":"Vilnius is die hoofstad van Litaue en die administratiewe gewes Vilnius. Vilnius, wat in die suid-ooste van die land aan die monding van die Vilnia-rivier in die Neris en net sowat veertig kilometer van die Wit-Russiese grens af geleë is, is ook die grootste stad van Litaue met 'n bevolking van 540 000.\\nVilnius het in die 13de eeu rondom 'n ou vesting ontstaan en is deur grootvors Gediminas in 1322/1323 tot die hoofstad van Litaue verklaar. Vilnius het hierdie funksie tot in die jaar 1795 vervul. Die Rooms-Katolieke bisdom Vilnius is in 1387 gestig, en in dieselfde jaar het Vilnius stadstatus volgens die Maagdenburgse Reg gekry. Die stadsmuur is in die vroeë 16de eeu voltooi.\\nIn die tydperk tussen 1794 en 1915 het Vilnius onder Russiese heerskappy gestaan en het vervolgens tot in 1939 deel van Pole uitgemaak. In die periodes tussen 1915 en 1918 en tussen 1941 en 1944 is Vilnius deur Duitse troepe beset. Ná 'n kortstondige periode as administratiewe sentrum in 1940/1941 is Vilnius sedert 1945 die hoofstad van Litaue."},{"page_url":"https://de.wikipedia.org/wiki/Musikantenland-Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dh-musikantenlandmuseum-01.jpg","page_title":"Musikantenland-Museum","context_page_description":"Das Pfälzer Musikantenland-Museum auf Burg Lichtenberg bei Thallichtenberg im Landkreis Kusel dokumentiert die Geschichte des Pfälzer Wandermusikantentums, dessen Blütezeit zwischen 1850 und dem Ersten Weltkrieg lag.\\nGezeigt werden unter anderem historisches Notenmaterial, Fotos der Musikkapellen und Musiker sowie Reisesouvenirs aus fremden Ländern. Neben einer umfangreichen Sammlung von Musikinstrumenten, die mit den Wandermusikanten einst die ganze Welt bereisten, wird auch die Arbeit der Instrumentenbauer, damals ein blühender Handwerkszweig, dokumentiert. Mehrere Figurengruppen zeigen das Leben der Musikanten und ihrer Familien. Die Exponate stammen aus dem Nachlass der Musikanten. Auch Musikaufnahmen der Werke der Wandermusikanten können von den Besuchern angehört werden. Das Museum verfügt ferner über ein historisches Bildarchiv, ein Literaturarchiv sowie ein Archiv handgeschriebener Noten, die auf Anfrage für Recherchen genutzt werden können.\\nDas Pfälzer Musikantenland-Museum wurde 1984 in der Zehntscheune der Burg Lichtenberg im Musikantenland eröffnet."},{"page_url":"https://fr.wikipedia.org/wiki/La_Patagonia_rebelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/LaPatagoniaRebelde-1974.jpg","page_title":"La Patagonia rebelde","context_page_description":"La Patagonia rebelde est un film historique argentin réalisé par Héctor Olivera, sorti en 1974. Il porte à l'écran la lutte sociale et la répression tragique de la Patagonie rebelle en 1920 et 1921, d'après l'enquête d'Osvaldo Bayer. Lauréat d'un Ours d'argent à la Berlinale 1974, le film fut rapidement censuré en Argentine, jusqu'à la fin de la dictature en 1984."},{"page_url":"https://vi.wikipedia.org/wiki/Lambis_truncata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Lambis_truncata_sebae_28a.jpg","page_title":"Lambis truncata","context_page_description":"Lambis truncata là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Strombidae."},{"page_url":"https://et.wikipedia.org/wiki/Saksi-Weissenfelsi_Magdalena_Sibylle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Magdalena_Sibylle_of_Saxe-Weissenfels.jpg","page_title":"Saksi-Weissenfelsi Magdalena Sibylle","context_page_description":"Saksi-Weissenfelsi Magdalena Sibylle isa oli August I ja ema Mecklenburg-Schwerini Anna Maria. Magdalena Sibylle isapoolne vanaisa oli Johann Georg I ja vanaema oli Preisi Magdalena Sibylle.\\n14. novembril 1669 abiellus Magdalena Sibylle Saksi-Gotha-Altenburgi hertsogi Friedrich I-ga.\\nAnna Sophie\\nDorothea Marie\\nFriedrich II, Saksi-Gotha-Altenburgi hertsog\\nJohanna"},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Hato_Mayor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Poblacion_por_municipio_Hato_Mayor.png","page_title":"Provincia de Hato Mayor","context_page_description":"Hato Mayor tiene una de las 32 provincias de la República Dominicana; forma parte de la Región Este, junto a las provincias de Monte Plata, La Romana, San Pedro de Macorís, El Seibo y La Altagracia. La capital provincial es la ciudad de Hato Mayor del Rey, comúnmente conocida como Hato Mayor.\\nEs una de las provincias más reciente del país; fue creada el 3 de diciembre de 1984 por medio de la Ley No. 245 pero entró en vigencia el 1 de enero, 1992.​ Sus primeras autoridades fueron escogidas en las elecciones de 16 de mayo de 1992. La provincia quedó integrada por los municipios Hato Mayor del Rey, Sabana de la Mar y El Valle. Hato Mayor fue declarada como la primera provincia Ecoturística de la República Dominicana, mediante la Ley 77-02 del 19 de junio de 2002, ya que encierra ecosistemas de gran valor para la preservación de la biodiversidad del país.​"},{"page_url":"https://ms.wikipedia.org/wiki/Sedap_Malam","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Sukarsih%2C_Film_Varia_1.6_%28May_1954%29%2C_p12.jpg","page_title":"Sedap Malam","context_page_description":"Sedap Malam ialah sebuah filem Indonesia 1950 arahan Ratna Asmara dan terbitan Djamaluddin Malik untuk Persari. Dibintangi oleh Sukarsih dan M. Pandji Anom, ia mengisahkan seorang wanita yang terjerumus ke pelacuran selepas suaminya berkahwin dengan wanita lain. Ia merupakan penerbitan pertama Persari dan filem pertama yang diarahkan oleh seorang wanita dalam sejarah Indonesia."},{"page_url":"https://lv.wikipedia.org/wiki/%C4%8Ca%C4%8Daka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hotel_Beograd_u_%C4%8Ca%C4%8Dku.jpg","page_title":"Čačaka","context_page_description":"Čačaka ir pilsēta Serbijā, Moravicas apgabala administratīvais centrs. Tā atrodas Rietumu Moravas ielejā, Šumadijas reģionā. Saskaņā ar 2011. gada tautas skaitīšanas datiem, pilsētas urbānajā daļā dzīvoja 73 331 iedzīvotājs, bet administratīvajās robežās 115 337 iedzīvotāji.\\nČačaka ir viens no centrālās Serbijas galvenajiem ekonomikas centriem. Tā atrodas 144 km uz dienvidiem no valsts galvaspilsētas Belgradas"},{"page_url":"https://az.wikipedia.org/wiki/Hisar_m%C9%99scidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Hisar_Camii3.jpg","page_title":"Hisar məscidi","context_page_description":"Hisar məscidi — İzmirin Konak ilçəsində, Kemeraltı, Kızlarağası hanı və adını verdiyi Hisarönü bölgəsi yaxınlığında məscid."},{"page_url":"https://en.wikipedia.org/wiki/780_N._Highland_Ave.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/780_n_highland_2011.jpg","page_title":"780 N. Highland Ave.","context_page_description":"780 North Highland Avenue is a historic building in the Virginia-Highland neighborhood of Atlanta, Georgia. It is a contributing property to the Virginia-Highland Historic District, registered on the National Register of Historic Places. The NRHP designation, however, affords no prevention of either demolishing the building or altering its exterior—only designation as a local historic district does so."},{"page_url":"https://es.wikipedia.org/wiki/Racing_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ferro_badge.png","page_title":"Racing Club","context_page_description":"Racing Club, conocido como Racing Club de Avellaneda o simplemente Racing, es una entidad deportiva oriunda de Argentina, fundada el 25 de marzo de 1903, ubicada en la Ciudad de Avellaneda, Provincia de Buenos Aires.​ Si bien su principal actividad deportiva es el fútbol masculino profesional, que milita en la Primera División, también se practican otros deportes profesionales como fútbol femenino, básquet, futsal y hockey, mientras que tenis, boxeo, vóley, handball, judo, patín artístico, aikido, gimnasia artística, taekwondo, muay thai, sipalki-do, fútbol playa, atletismo, natación y saltos ornamentales son deportes amateur.​​\\nSu estadio, llamado Presidente Perón, es el segundo con más aforo del país con una capacidad de más de 60.000 espectadores y se ubica sobre las calles Orestes Osmar Corbatta y Mozart, en la Ciudad de Avellaneda en el sur del Gran Buenos Aires.​\\nLos colores que identifican a la institución son el celeste y el blanco en honor a los colores patrios de la República Argentina.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%83%D1%81%D1%82%D1%96%D0%B1%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Friezen_vallen_de_toren_van_Damiate_aan.jpg","page_title":"Фустібал","context_page_description":"Фустібал — середньовічна ручна метальна зброя, призначена для метання каменів вагою до 0,5 кг.\\nФустібали застосовувалися під час облог фортець і в морських битвах. Найбільш ранні згадки відносяться IV століття н. е. найпізніші - до 14 століття.\\nФустібал являв собою пращу, прикріплену до довгої палиці з метою збільшити розмах снаряда в пращі, збільшити початкову швидкість снаряда і дальність його польоту.\\nНадалі фустібал еволюціонував в станковий метальний агрегат, а далі в требушет."},{"page_url":"https://es.wikipedia.org/wiki/Convolosaurus_marri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Articulated_Convolosaurus.PNG","page_title":"Convolosaurus marri","context_page_description":"Convolosaurus marri es la única especie conocida del género extinto Convolosaurus de dinosaurio ornitisquio ornitópodo, que vivió a mediados del período Cretácico, hace 125 millones de años, durante el Aptiense en lo que es hoy Norteamérica."},{"page_url":"https://es.wikipedia.org/wiki/Capilla_de_Nuestra_Se%C3%B1ora_del_Baluarte","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Nossa_Senhora_do_Baluarte_-_troneira.jpg","page_title":"Capilla de Nuestra Señora del Baluarte","context_page_description":"La capilla de Nuestra Señora del Baluarte, es una pequeña capilla situada en la localidad de Isla de Mozambique, en la isla del mismo nombre, provincia de Nampula, Mozambique, en el exterior de la Fortaleza de San Sebastián, a los pies de su baluarte norte. Forma parte del conjunto monumental de la ciudad que está declarado Patrimonio de la Humanidad por la UNESCO desde 1991."},{"page_url":"https://de.wikipedia.org/wiki/Schanzenkopf_(Schwedenschanze)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Schwedenschanze1.JPG","page_title":"Schanzenkopf (Schwedenschanze)","context_page_description":"Der Schanzenkopf ist ein 365 Meter hoher Berg im Spessart im bayerischen Landkreis Aschaffenburg. Am Rande des Berges befindet sich die Landesgrenze zu Hessen."},{"page_url":"https://pt.wikipedia.org/wiki/Mamute_Yuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%D0%9C%D0%B0%D0%BC%D0%BE%D0%BD%D1%82%D1%91%D0%BD%D0%BE%D0%BA_%D0%AE%D0%BA%D0%B0.JPG","page_title":"Mamute Yuka","context_page_description":"Mamute Yuka é a carcaça de um mamute-lanoso encontrada em agosto de 2010, bem preservada, ao longo da costa de Oyogos Yar, aproximadamente a 30 km oeste da foz do rio Kondratievo, na Sibéria na região do mar de Laptev. Yuka é uma múmia de uma jovem fêmea que foi encontrada perto e nomeada após a vila de Yukagir, cuja população local a descobriu. Esta múmia gigantesca foi encontrada como uma saliência de cerca de 4 metros acima do nível da praia, em um penhasco. Após sua descoberta, Yuka passou dois anos armazenada e preservada em uma geladeira natural, o permafrost local, em Yukagir. Naquela época, os primeiros cientistas, P. Lazarev e S. Grigoriev, do Museu Mammoth chegaram para estudar esses restos mumificados. Até então, mais de 100 metros do penhasco baixo foi lavado. De Yukagir, o mamute Yuka foi transportado para a Academia de Ciências Sakha em Yakutsk. Desde outubro de 2014, o mamute está em exibição em Moscou e é considerado o mamute siberiano mais bem preservado descoberto até agora.\\nO penhasco voltado para o norte era composto de loess que faz parte de um rico yedoma contendo fósseis do Pleistoceno Tarde, exposto pela erosão costeira."},{"page_url":"https://nl.wikipedia.org/wiki/Numbat","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Leefgebied_numbat.JPG","page_title":"Numbat","context_page_description":"De numbat of buidelmiereneter is een Australisch buideldier ter grootte van een eekhoorn, dat leeft in het zuidwestelijk deel van Australië. Het is de enige soort van de familie Myrmecobiidae."},{"page_url":"https://fr.wikipedia.org/wiki/Jan_Eduard_de_Quay","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Quay%2C_Prof._dr._J.E._de_-_SFA002004996.jpg","page_title":"Jan Eduard de Quay","context_page_description":"Jan Eduard de Quay, né le 26 août 1901 à Bois-le-Duc et mort le 4 juillet 1985 à Beers, est un homme d'État néerlandais. Membre du Parti populaire catholique, il est Premier ministre des Pays-Bas du 19 mai 1959 au 24 juillet 1963. Personnalité controversée en raison de ses activités pendant la Seconde Guerre mondiale, De Quay est commissaire de la Reine au Brabant-Septentrional de 1946 à 1959, ainsi que vice-Premier ministre et ministre des Transports, des Travaux publics et de la Gestion de l'eau sous Jelle Zijlstra de 1966 à 1967."},{"page_url":"https://sv.wikipedia.org/wiki/Supreme_Commander_of_the_Allied_Powers","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/DN-Tower-02.jpg","page_title":"Supreme Commander of the Allied Powers","context_page_description":"Supreme Commander of the Allied Powers, överbefälhavare för de allierade styrkorna, var general Douglas MacArthurs titel under ockupationen av Japan efter andra världskriget. Även om det har funnits och finns andra med titeln Supreme Allied Commander, är det endast MacArthur som förlänats SCAP-titeln i sig.\\nMacArthur var övertygad om att hans närvaro som överbefälhavare – och som amerikanernas representant – var helig. I ett tal som han höll på sitt örlogsfartyg, efter att den ovillkorliga kapitulationen hade undertecknats den 2 september 1945, meddelade han att \\"Det heliga uppdraget har slutförts\\".\\nI Japan omnämns befattningen allmänt som GHQ, då SCAP även syftade på ockupationsbyråerna, inklusive såväl flera hundratals amerikanska statstjänstemän som militär personal. Några av dessa författade i realiteten det första utkastet till den japanska författningen, vilken Japans parlament sedan godkände efter några smärre ändringar.\\nDenna verksamhet ledde till att McArthur sågs som en ny imperiemakt i Japan av många japanska politiker och civilpersoner, och ansågs till och med vara en pånyttfödelse av ett shogunvälde, vilket rådde i Japan tills meijirestaurationen."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%BB%D5%A1%D5%A3%D5%A5%D5%BF%D6%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Babylonian_marriage_market.jpg","page_title":"Միջագետք","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Միջագետք\\nՄիջագետք, պատմական տարածք Արևմտյան Ասիայում, որը գտնվում է Տիգրիս և Եփրատ գետերի համակարգում, ներկայումս այս տարածքը համապատասխանում է Իրաքի, Քուվեյթի, Սաուդյան Արաբիայի հյուսիսային հատվածի, Սիրիայի արևելյան հատվածի, Հարավարևելյան Թուրքիայի, թուրք-սիրիական և իրան-իրաքյան սահմանների երկայնքով ձգվող շրջաններին:\\nՄ.թ.ա. 539 թվականին Բաբելոնի անկումից հետո, երբ Աքեմենյան Պարսկաստանը գրավում է այն, արդեն իսկ պատմական հնագույն աղբյուրներում հիշատակվում է, որ շումերներն ու աքքադացիները գերիշխանություն են հաստատել Միջագետքում: Մ.թ.ա. 332 թվականին Միջագետքը հայտնվել է Ալեքսանդր Մեծի տիրապետության տակ, իսկ նրա մահից հետո այն դարձել է հունական Սելևկյանների կայսրության գերիշխանության տակ:"},{"page_url":"https://en.wikipedia.org/wiki/Pitch-up","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Canadian_CF-18.jpg","page_title":"Pitch-up","context_page_description":"In aerodynamics, pitch-up is an uncommanded nose-upwards rotation of an aircraft. It is an undesirable characteristic that has been observed mostly in experimental swept-wing aircraft at high subsonic Mach numbers or high angle of attack."},{"page_url":"https://sk.wikipedia.org/wiki/Vielle-Adour","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Map_commune_FR_insee_code_65464.png","page_title":"Vielle-Adour","context_page_description":"Vielle-Adour je francúzska obec, ktorá sa nachádza v departemente Hautes-Pyrénées, v regióne Midi-Pyrénées."},{"page_url":"https://ceb.wikipedia.org/wiki/Wolfgang_Amadeus_Mozart","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Martini_bologna_mozart_1777.jpg","page_title":"Wolfgang Amadeus Mozart","context_page_description":"Si Wolfgang Amadeus Mozart usa ka bantogang Austryanong kompositor. Usa siya sa kinadak-ang tawo sa kalibutan sa musika. Uban sa mga gikumposo niya ang opera nga Don Giovanni ug ang Le Nozze di Figaro. Naghatag siya og impluwensya sa musika sa kalibutan."},{"page_url":"https://pt.wikipedia.org/wiki/10.000_a.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Mar%C3%B3ti-Atlantisz_1.jpg","page_title":"10.000 a.C.","context_page_description":"10,000 BC é um filme estadunidense lançado em 2008, estrelado por Steven Strait e Camilla Belle, e dirigido por Roland Emmerich. O filme se passa na pré-histórica e descreve as jornadas de uma tribo pré-histórica de caçadores de mamutes. A história ocorrer durante o período entre o Paleolítico e o Neolítico. Sendo o filme uma ficção, permite muitos anacronismos durante o período em questão.\\nCom um orçamento de 105 milhões de dólares, o filme arrecadou US$269.784.201 mundialmente em bilheterias. Foi recebido de forma negativa pela crítica especializada, obtendo uma média de 8% de aprovação no Rotten Tomatoes, que se baseou em 142 resenhas."},{"page_url":"https://vi.wikipedia.org/wiki/Bernard_C._Webber","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/USCG_Petty_Officer_Bernard_C._Webber_lead_the_dramatic_rescue_of_33_sailors_from_the_stricken_freighter_Pendleton_-a.jpg","page_title":"Bernard C. Webber","context_page_description":"Bernard Challen Webber là một nhân viên cứu hộ bờ biển người Mỹ. Ông là một hạ sĩ quan cho Trạm Chatham, bang Massachusetts và nhiệm vụ của ông là lái tàu Xuồng cứu sinh CG 36500. Webber và ba thuyền viên của ông đã giải cứu các thuyền viên của tàu chở dầu bị gặp nạn SS Pendleton, vốn đã bị vỡ làm đôi trong một cơn bão khủng khiếp ngày 18 tháng 2 năm 1952 ở vịnh Cape Cod. Webber đã lái chiếc xuồng cứu sinh dài 36 bộ Anh tới cứu 32 người trong tổng số 33 người bị mắc kẹt ở phần đuôi của tàu Pendleton và bỏ xác của con tàu Pendleton ở lại."},{"page_url":"https://fr.wikipedia.org/wiki/John_Alexander_Logan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/John_A._Logan_%28general%29.jpg","page_title":"John Alexander Logan","context_page_description":"John Alexander Logan est un soldat et homme politique américain du XIXᵉ siècle, sénateur de l'Illinois et candidat à la vice-présidence en 1884."},{"page_url":"https://ru.wikipedia.org/wiki/Phoneutria_nigriventer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Aranha_armadeira%28Phoneutria_nigriventer%29_por_Rodrigo_Tetsuo_Argenton_%284%29.jpg","page_title":"Phoneutria nigriventer","context_page_description":"Phoneutria nigriventer - вид чрезвычайно ядовитого паука семейства Ctenidae, обитающего в Южной Америке.[1] наряду с Phoneutria fera, его иногда называют бразильским блуждающим пауком.Его укус может вызвать эрекцию, которая длится несколько часов"},{"page_url":"https://en.wikipedia.org/wiki/Novation_Digital_Music_Systems","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Remote_25.jpg","page_title":"Novation Digital Music Systems","context_page_description":"Novation Digital Music Systems Ltd. is a British musical equipment manufacturer, founded in 1992 by Ian Jannaway and Mark Thompson as Novation Electronic Music Systems. Today the company specializes in MIDI controllers with and without keyboards, both analog and virtual analog performance synthesizers, grid-based performance controllers, and audio interfaces. At present, Novation products are primarily manufactured in China."},{"page_url":"https://ca.wikipedia.org/wiki/Saint-Christophe_(Viena)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Map_commune_FR_insee_code_86217.png","page_title":"Saint-Christophe (Viena)","context_page_description":"Saint-Christophe és un municipi francès, situat al departament de la Viena i a la regió de la Nova Aquitània. L'any 2007 tenia 347 habitants."},{"page_url":"https://da.wikipedia.org/wiki/Eritrea","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Tour_of_Asmara_Cycling_race%2C_Asmara_Eritrea.jpg","page_title":"Eritrea","context_page_description":"Eritrea er et land i det nordlige Østafrika. Landet grænser op til Sudan i vest, Etiopien i syd og Djibouti i sydøst. Landets øst- og nordøstlige side er det Røde Havs kyst, hvor Dahlakøerne ligger. Området var tidligere en italiensk koloni, blev annekteret af Etiopien i 1952 og efter løsrivelseskrig og folkeafstemning selvstændigt i 1993. Landet er rigt på råstoffer, blandt andre guld, sølv, nikkel, olie og naturgas.\\nDer findes ni folkegrupper i landet. Landet er domineret af semitisk talende folkegrupper, som udgør omkring 85% af den samlede befolkning. De to dominerende sprog er tigrinja og arabisk. De to største religioner i Eritrea er kristendom og islam, idet kristne udgør et klart flertal.\\nPolitisk er landet de facto et diktatur. Den eritreanske regerings vigtigste udviklingsprojekt er den så kaldte Warsai-Yekalo-kampagne, en samfundstjeneste, hvor alle - også kvinder - skal bidrage til landets opbygning ved at arbejde for staten. Disse ofte unge eritreanere arbejder blandt andet med reparation og byggeri af infrastrukturen, dæmninger, jordbrug, skoler, klinikker, sygehuse etc."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BB%D0%BA%D1%81%D0%B2%D0%B0%D0%B3%D0%B5%D0%BD_%D0%BF%D0%B0%D1%81%D0%B0%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Volkswagen_Passat_GLX_VR6_sedan.jpg","page_title":"Фолксваген пасат","context_page_description":"Фолксваген пасат је аутомобил који производи немачка фабрика аутомобила Фолксваген. Производи се од 1973. године и један је од најпродаванијих аутомобила у свету. Досад је произведен у осам генерација. Позициониран је између голфа односно џете и луксузне лимузине фаетона. Овај аутомобил је широм света познат и по различитим називима, као што су Dasher, Santana, Quantum, Magotan, Corsar и Carat. Пасат осме генерације је 2015. године изабрана за најбољи европски аутомобил."},{"page_url":"https://de.wikipedia.org/wiki/Nintendo_Classic_Mini:_Nintendo_Entertainment_System","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/NCM_Konsole.jpg","page_title":"Nintendo Classic Mini: Nintendo Entertainment System","context_page_description":"Das Nintendo Classic Mini: Nintendo Entertainment System in Europa und Australien, alternativ NES Classic Edition in Nordamerika, ist eine am 11. November 2016 in Europa, Australien und Nordamerika erschienene Spielkonsole von Nintendo. Die Spielekonsole ist eine technisch verbesserte und kompaktere Neuauflage des Nintendo Entertainment Systems von 1985.\\n2017 erschien mit dem Nintendo Classic Mini: Super Nintendo Entertainment System eine Nachfolgerkonsole."},{"page_url":"https://en.wikipedia.org/wiki/Handley_Page_Hampden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Loading_bombs_onto_a_World_War_II_Handley_Page_Hampden_%284821425043%29.jpg","page_title":"Handley Page Hampden","context_page_description":"The Handley Page HP.52 Hampden was a British twin-engine medium bomber of the Royal Air Force. It was part of the trio of large twin-engine bombers procured for the RAF, joining the Armstrong Whitworth Whitley and Vickers Wellington. The newest of the three medium bombers, the Hampden was often referred to by aircrews as the \\"Flying Suitcase\\" because of its cramped crew conditions. The Hampden was powered by Bristol Pegasus radial engines but a variant known as the Handley Page Hereford had in-line Napier Daggers.\\nThe Hampden served in the early stages of the Second World War, bearing the brunt of the early bombing war over Europe, taking part in the first night raid on Berlin and the first 1,000-bomber raid on Cologne. When it became obsolete, after a period of mainly operating at night, it was retired from RAF Bomber Command service in late 1942. By 1943, the rest of the trio were being superseded by the larger four-engined heavy bombers such as the Avro Lancaster."},{"page_url":"https://hu.wikipedia.org/wiki/M%C3%A1sodik_marne-i_csata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/The_School_and_Belleau_Woods.jpg","page_title":"Második marne-i csata","context_page_description":"A második marne-i csata, vagy reims-i csata az utolsó jelentősebb német offenzíva volt a nyugati fronton az első világháború alatt. A német támadást meghiúsította az antant hadserege, amikor az ellentámadást vezette francia erők és több száz tankjuk túlterhelte a németek jobbszárnyát, ezzel súlyos csapást mérve rájuk, és visszavonulásra késztetve őket. A csatát követően a Német Birodalom folyamatos hátrálásra volt késztetve, míg az antant három hónap alatt térde kényszerítette."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Cadaujac","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Statuaire_-_IMG_3171-27.jpg","page_title":"Église Saint-Pierre de Cadaujac","context_page_description":"L'église Saint-Pierre est une église catholique située dans la commune de Cadaujac, dans le département de la Gironde, en France."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%BE%D5%A1%D5%BF%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/2008-05-21_13_05_27_Iceland-Sk%C3%BAtusta%C3%B0ir.jpg","page_title":"Միվատն","context_page_description":"Միվատն, լիճ Իսլանդիայի հյուսիսում:"},{"page_url":"https://id.wikipedia.org/wiki/Cosimo_I_de%27_Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Cosimo-GDuke-BR.jpg","page_title":"Cosimo I de' Medici","context_page_description":"Cosimo I de' Medici merupakan Adipati Firenze kedua yang memerintah dari tahun 1537 hingga 1569, ketika ia menjadi Adipati Agung Toscana pertama, sebuah gelar yang ia pegang hingga kematiannya."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8E%AB%E5%8A%9B%E8%BE%BE%E7%93%A6%E8%BE%BE%E6%96%A1%E5%B0%94%E6%97%8F%E8%87%AA%E6%B2%BB%E6%97%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/ChinaHulunbuirMorindawa.png","page_title":"莫力达瓦达斡尔族自治旗","context_page_description":"莫力达瓦达斡尔族自治旗是中国内蒙古自治区呼伦贝尔市下属的一个自治旗，面积为10985平方公里，人口约29万。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Moutiers-les-Mauxfaits","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Eglise_des_Moutiers..JPG","page_title":"Liste der Monuments historiques in Moutiers-les-Mauxfaits","context_page_description":"Die Liste der Monuments historiques in Moutiers-les-Mauxfaits führt die Monuments historiques in der französischen Gemeinde Moutiers-les-Mauxfaits auf."},{"page_url":"https://en.wikipedia.org/wiki/Seth_Doege","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/SETH_RUN_vs_idalou.jpg","page_title":"Seth Doege","context_page_description":"Seth Colton Doege is an American football coach and former quarterback, currently working as an offensive quality control analyst for USC. After playing college football for Texas Tech University, he was signed by the Atlanta Falcons as an undrafted free agent in 2013. On February 27, 2014, he was signed to the Saskatchewan Roughriders of the Canadian Football League. Doege was Texas Tech's starting quarterback for the 2011 and 2012 seasons. He was wide receivers coach for Bowling Green."},{"page_url":"https://en.wikipedia.org/wiki/Woodblock_printing","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Pen_ts%27ao%2C_woodblock_book_1249-ce.png","page_title":"Woodblock printing","context_page_description":"Woodblock printing or block printing is a technique for printing text, images or patterns used widely throughout East Asia and originating in China in antiquity as a method of printing on textiles and later paper. As a method of printing on cloth, the earliest surviving examples from China date to before 220 AD. Woodblock printing existed in Tang China during the 7th century AD and remained the most common East Asian method of printing books and other texts, as well as images, until the 19th century. Ukiyo-e is the best-known type of Japanese woodblock art print. Most European uses of the technique for printing images on paper are covered by the art term woodcut, except for the block-books produced mainly in the 15th century in India."},{"page_url":"https://en.wikipedia.org/wiki/Embraer_E-Jet_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Air_Canada.jpg","page_title":"Embraer E-Jet family","context_page_description":"The Embraer E-Jet family is a series of narrow-body short- to medium-range twin-engine jet airliners, carrying 66 to 124 passengers commercially, manufactured by Brazilian aerospace manufacturer Embraer. The aircraft family was first introduced at the Paris Air Show in 1999 and entered production in 2002. The series has been a commercial success primarily due to its ability to efficiently serve lower-demand routes while offering many of the same amenities and features of larger jets. The aircraft is used by mainline and regional airlines around the world but has proven particularly popular with regional airlines in the United States."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%88%D0%B0%D0%B7%D0%B8%D1%86%D0%B8_%D0%B2%D0%BE_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Romance_20c_en.png","page_title":"Јазици во Европа","context_page_description":"Повеќето од јазиците во Европа се од индоевропско потекло. Тие се поделени во голем број на подгрупи, вклучувајќи ги романската, германската, балтословенската, грчката и други. Уралските јазици исто така имаат присуство во Европа, вклучувајќи ги националните јазици унгарски, фински и естонски. Турската и Монголската група исто така имаат неколку европски членови, додека севернокавкаската и картвелската група се важни за југоисточните делови на географска Европа. Баскискиот јазик на западните Пиринеи е изолиран јазик неповрзан со никоја друга група, додека малтешкиот е единствениот семитски во Европа со национален јазичен статус."},{"page_url":"https://en.wikipedia.org/wiki/Association_for_Relations_Across_the_Taiwan_Straits","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Msc_2006-Sunday%2C_11.00_-_13.00-Zhang.jpg","page_title":"Association for Relations Across the Taiwan Straits","context_page_description":"The Association for Relations Across the Taiwan Straits is an organization set up by the People's Republic of China for handling technical or business matters with the Republic of China.\\nThe ROC counterpart to ARATS is the Straits Exchange Foundation.\\nThe foundation's founding chairman was former Shanghai mayor Wang Daohan, honorary chairman Rong Yiren. Negotiations with SEF stopped in 1999, and after Wang's death in 2005, no new chair was appointed until 2008. Following the election of Ma Ying-jeou to the presidency of the Republic of China on Taiwan, talks between ARATS and SEF have restarted and progress was made in the areas of transport and economy such as the Three links in 2008 and Economic Cooperation Framework Agreement in 2010. Chen Yunlin, who was formerly head of the State Council Taiwan Affairs Office, was the head of ARATS from 2008 to 2013. He has met his counterpart Chiang Pin-kung in 2008."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BE%D1%81%D0%BD%D1%8B%D1%86%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sosnytskyi-Raion.png","page_title":"Сосныцкі раён","context_page_description":"Сосныцкі раён — адміністрацыйная адзінка ў складзе Чарнігаўскай вобласці Украіны. Адміністрацыйны цэнтр — Сосныця.\\nУтвораны ў 1935 годзе. Насельніцтва раёна на 1 лютага 2015 года складае 18915 чалавек, плошча — 916 км²."},{"page_url":"https://nl.wikipedia.org/wiki/Raczy%C5%84skipaleis_(Rogalin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Rogalin_palac_%281%29.jpg","page_title":"Raczyńskipaleis (Rogalin)","context_page_description":"Het Raczyńskipaleis in Rogalin in Groot-Polen is een laatbarok paleis met bijgebouwen in palladianismestijl. Dit kasteel is gebouwd voor de paltsgraaf van Groot-Polen: Kazimierz Raczyński in de laat-18e eeuw. De architect die het paleis ontworpen heeft is de Italiaans-Poolse architect Domenico Merlini. Dit kasteel ligt zo'n 20 km ten zuiden van Poznan en is een van de bijzondere bezienswaardigheden in Groot-Polen. Tevens de hoofdresidentie van de familie Raczyński."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A3%AF%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/YokohamaCivicYachtHarbor.JPG","page_title":"磯子","context_page_description":"磯子は、横浜市磯子区の北部の町名。現行行政地名は磯子一丁目から磯子八丁目。郵便番号は235-0016。本稿では、区制施行後に旧磯子町から分離した磯子台についても述べる。なお、磯子台の郵便番号は235-0019。また、どちらも住居表示実施済み区域。"},{"page_url":"https://fr.wikipedia.org/wiki/Charles_Simon_(dirigeant_sportif)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Charles_Simon.png","page_title":"Charles Simon (dirigeant sportif)","context_page_description":"Charles Simon est un dirigeant sportif français né à Paris le 25 septembre 1882 et mort au combat à Écurie le 15 juin 1915. Il est, avant la Première Guerre mondiale, secrétaire général de la Fédération gymnastique et sportive des patronages de France et de l'Union internationale des œuvres catholiques d'éducation physique.\\nC'est pour défendre le développement du football qu'il fonde et préside également un éphémère comité français interfédéral. Celui-ci, où Henri Delaunay lui succède, donne naissance en 1919 à la Fédération française de football. Le nom de Charles Simon est attaché à la coupe de France de football depuis sa création en 1917."},{"page_url":"https://fr.wikipedia.org/wiki/Couronne_du_Saint-Empire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Weltliche_Schatzkammer_Wien_%28194%29b.JPG","page_title":"Couronne du Saint-Empire","context_page_description":"La couronne du Saint-Empire était depuis le haut Moyen Âge la couronne des rois et empereurs du Saint-Empire romain germanique. À partir de l’avènement de Conrad II, la plupart des souverains germaniques l'ont ceinte. Outre le crucifix de l'Empire, l’épée impériale et la Sainte lance, cette couronne fut le principal bijou des regalia du Saint-Empire. Lors de la cérémonie du couronnement, l'archevêque de Mayence remettait solennellement au nouveau monarque le sceptre et l’orbe. Ainsi la couronne et le cabochon disparu qui l'ornait, appelé « Orphanus », devint-elle le symbole du pouvoir des rois : un couronnement sans ces insignes était généralement considéré comme illégitime. Il n'est pas jusqu'à la fonction religieuse du monarque qui ne fut symbolisée par des miniatures gravées sur cette couronne.\\nAujourd'hui, la couronne impériale est conservée avec les autres regalia dans le trésor impérial de Vienne, au château de Hofburg."},{"page_url":"https://no.wikipedia.org/wiki/Schloss_Blutenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Blutenburg%2C_Eingang_Castle_in_Much_02-2005.jpg","page_title":"Schloss Blutenburg","context_page_description":"Jagdschloss Blutenburg ligger i den vestlige del av München, i bydelen Obermenzing. Idag huser slottet det internasjonale ungdomsbiblioteket og Erich Kästner-biblioteket. Det internasjonale ungdomsbiblioteket består bl.a. av Michael Ende-museet.\\nSlottet ble bygget mellom 1431 og 1440 av hertug Albrecht III av Bayern som landeiendom. Hans sønn hertug Sigismund abdiserte senere og trakk seg tilbake til slottet, hvor han viet seg til oppførelse av kirker og borger. Han utvidet også Schloss Blutenburg.\\nIfølge tradisjonen skal slottet ha blitt ødelagt av svenskene under tredveårskrigen, men denne ødeleggelsen fant ifølge nyere historieforskning trolig ikke sted.\\nDa kurfyrstinne Henriette Adelaide fikk slottet og hoffmarken Menzing i gave i 1663 var interessen for dette jaktområdet ikke lenger til stede, og det bayerske hoffet brukte Schloss Nymphenburg som sommerresidens.\\nNotaren friherre Anton von Berchem, kurfyrstinnens testamentsfullbyrder, overtok slottet i 1676 til en pris som lå langt under verdien, og lot anlegget sanere og ombygge. Da Berchem døde i 1702 måtte arvingene gi hoffmarken tilbake til kurfyrste Maximilian II Emanuel."},{"page_url":"https://eo.wikipedia.org/wiki/Dubutila_dusulfido","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/1-Butanethiol-3D-balls.png","page_title":"Dubutila dusulfido","context_page_description":"Dubutila dusulfido aŭ C₈H₁₈S₂ estas kemia kombinaĵo, apartenanta al la funkcia grupo de la dusulfidoj de la sulfida acido kaj tiobutanolo. Dubutila dusulfido estas senkolora aŭ blanka likvaĵo kun penetranta malagrabla odoro, analiza reakciaĵo uzata en kemiaj sintezoj kaj en la fabrikado de kosmetikaĵoj kaj farmaciaĵoj. Dubutila dusulfido estas malmulte solvebla en akvo, sed tute solvebla en alkoholo, duetila etero, kloroformo kaj plejmulto el la organikaj solvantoj. Dubutila dusulfido reakcias kun fortaj oksidigagentoj kaj fortaj bazoj. Sulfidaj esteroj malkomponiĝas per varmigo aŭ kun la tempopaso en sulfuro aŭ sulfuraj derivaĵoj."},{"page_url":"https://mg.wikipedia.org/wiki/Roberto_Hilbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Roberto-Hilbert.jpg","page_title":"Roberto Hilbert","context_page_description":"Roberto Hilbert dia mpilalao baolina kitra mizaka ny zom-pirenen'i Alemaina teraka ny 16 Oktobra 1984 tao Forchheim"},{"page_url":"https://it.wikipedia.org/wiki/Castello_di_Caen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Chateau_Caen.jpg","page_title":"Castello di Caen","context_page_description":"Il castello di Caen è una struttura fortificata che sorge su un promontorio roccioso che domina la città di Caen e la vallata del fiume Orne, su un'altura di una ventina di metri."},{"page_url":"https://da.wikipedia.org/wiki/Ludwig_B%C3%B6rne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/B%C3%B6rne%2C_Ludwig.jpg","page_title":"Ludwig Börne","context_page_description":"Carl Ludwig Börne var en tysk forfatter.\\nHan var søn af en jødisk bankier og hed oprindelig Juda Löb Baruch. Faderen ønskede, han skulde studere medicin, og han fik sin første uddannelse hos den ansete læge Markus Herz i Berlin. Som et litterært minde om Börnes ophold i den preussiske hovedstad kan man betragte hans breve til Henriette Herz, Markus Herz’ hustru, for hvem han nærede en sværmerisk lidenskab. Da Herz pludselig døde i 1804, blev Börne sendt til Halle, hvor han fortsatte sin medicinske uddannelse under den fremragende læge Reils ledelse, men snart foretrak statsvidenskabelige studier. Han tog senere til Giessen og Heidelberg og vendte så i 1809 tilbage til Frankfurt, hvor han blev aktuar i politidirektionen, men afskedigedes som jøde 1813, da hertugdømmet Frankfurt ophørte at eksistere. Sine første artikler - omhandlende jødernes forhold i den frie rigsstad - skrev han i \\"Frankfurter Journal\\". Han lod sig 1818 døbe, da han mere og mere havde følt sig fremmed over for jødedommen og sine trosfæller. Han vandt nu ry som en skarp polemiker og skrev ypperligt formede, bidende vittige artikler i sine tidsskrifter \\"Die Zeitschwingen\\" og \\"Die Wage\\"."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_999_Frauen_des_Heritage_Floor/Hrotsvit","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Ecclesiae_Anglicanae_Trophae_-_Plate_18.jpg","page_title":"Liste der 999 Frauen des Heritage Floor/Hrotsvit","context_page_description":"Diese Liste beschreibt das Gedeck für Hrotsvit auf dem Tisch der Kunstinstallation The Dinner Party von Judy Chicago. Sie ist Teil der Liste der 999 Frauen des Heritage Floor, die den jeweiligen Gedecken auf dem Tisch zugeordnet sind. Die Namen der 999 Frauen befinden sich auf den Kacheln des Heritage Floor, der unterhalb des Tisches angeordnet, zur Kunstinstallation gehört."},{"page_url":"https://nl.wikipedia.org/wiki/Ophiogomphus_rupinsulensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Rusty-snaketail-top-990a8300.jpg","page_title":"Ophiogomphus rupinsulensis","context_page_description":"Ophiogomphus rupinsulensis is een libellensoort uit de familie van de rombouten, onderorde echte libellen.\\nDe wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1862 door Walsh."},{"page_url":"https://en.wikipedia.org/wiki/Santiago_Metro_Line_9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Linea_9_Metro_de_Santiago_mapa.png","page_title":"Santiago Metro Line 9","context_page_description":"Santiago Metro Line 9 it will be a new line that will form part of the Santiago Metro and will have an approximate extension of 17 kilometers, connecting the communes of Santiago in the center and La Pintana in the south of the Chilean capital.\\nIt will connect with line 1 at Santa Lucía, with line 3 at Matta, with line 6 at Bío Bío and with line 4A at Santa Rosa."},{"page_url":"https://da.wikipedia.org/wiki/D%C3%B8de_i_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/ALLAIS_PN_Maurice-24x30-2001b.jpg","page_title":"Døde i 2010","context_page_description":"Døde i 2010 er en liste over notable personer, der er afgået ved døden i 2010."},{"page_url":"https://fr.wikipedia.org/wiki/Victor_Hugues","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Vernet-entre-port-Marseille.jpg","page_title":"Victor Hugues","context_page_description":"Jean-Baptiste Victor Hugues, né à Marseille le 20 juillet 1762 et mort à Cayenne le 12 août 1826, est un révolutionnaire français qui gouverna la Guadeloupe de 1794 à 1798, puis la Guyane de 1799 à 1809.\\nEn tant qu'administrateur français dans les colonies, il participe à l'application de l'abolition de l'esclavage à la Guadeloupe, puis à son rétablissement en Guyane."},{"page_url":"https://es.wikipedia.org/wiki/Escultura_de_M%C3%A9xico","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Manzanillo_centro.JPG","page_title":"Escultura de México","context_page_description":"La escultura es una de las artes más antiguas de México. En el México prehispánico está presente en pirámides, sanitarios, explanadas y objetos comunales; ejemplo de ello son las esculturas olmecas, mayas, teotihuacanas, tarascas, mixtecas y aztecas.\\nMuchas de estas esculturas han sido catalogadas como obras maestras y destacan por su monumentalidad, pues muchas de ellas son enormes y expuestas para ser vistas públicamente; entre las que podemos destacar están: la Coyolxauhqui, el templo de la Serpiente Emplumada en Xochicalco, las numerosas estelas mayas que relatan acontecimientos de carácter político e histórico y la estatua de Tlaloc en el Museo Nacional de Antropología."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%9E%E6%AD%B7%E5%B1%B1%E5%A4%A7%E4%B8%B9%E5%B0%BC%E5%A3%ABEnviro_500_MMC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/6300_at_Pedder_St%2C_Queen%27s_Rd_C_%2820190128103018%29.jpg","page_title":"亞歷山大丹尼士Enviro 500 MMC","context_page_description":"亞歷山大丹尼士Enviro 500MMC是一款由英國亞歷山大丹尼士生產的3軸雙層巴士，它也是亞歷山大丹尼士製造的其中一款Enviro系列巴士。它是全球最暢銷的3軸雙層巴士，由2012年至今已售出超過4,500輛，也是香港多間專營巴士公司車隊中為數最多的巴士型號。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Sterzing","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Vipiteno_St._Salvator_02.JPG","page_title":"Liste der Baudenkmäler in Sterzing","context_page_description":"Die Liste der Baudenkmäler in Sterzing enthält die 131 als Baudenkmäler ausgewiesenen Objekte auf dem Gebiet der Gemeinde Sterzing in Südtirol.\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Baudenkmäler in Südtirol. Dabei kann es sich beispielsweise um Sakralbauten, Wohnhäuser, Bauernhöfe und Adelsansitze handeln. Die Reihenfolge in dieser Liste orientiert sich an der Bezeichnung, alternativ ist sie auch nach der Adresse oder dem Datum der Unterschutzstellung sortierbar."},{"page_url":"https://ms.wikipedia.org/wiki/Miss_World_1985","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Miss_World_1985_Map.PNG","page_title":"Miss World 1985","context_page_description":"Miss World 1985 ialah pertandingan kecantikan Miss World ke-35 yang diadakan pada 14 November 1985 di Royal Albert Hall London, England. Ia disertai oleh 78 peserta. Miss World 1984, Astrid Carolina Herrera dari Venezuela, memahkotakan pengganrinya, Hólmfríður Karlsdóttir dari Iceland sebagai Miss World yang baru."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%AA%E3%83%84%E3%83%85%E3%83%A9%E3%83%95%E3%82%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Cocculus_orbiculatus3.jpg","page_title":"アオツヅラフジ","context_page_description":"アオツヅラフジはツヅラフジ科のつる性落葉木本。有毒の植物で、別名、カミエビとよばれる 。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%B9%D0%B2%D0%BB%D0%B5%D1%82-%D0%BF%D0%B5%D1%80%D0%B5%D1%82%D0%B2%D0%BE%D1%80%D0%B5%D0%BD%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Jpeg2000_2-level_wavelet_transform-lichtenstein.png","page_title":"Вейвлет-перетворення","context_page_description":"В математиці, серії вейвлетів є подання квадратної інтегрованої функції за певною ортонормованої серії, породженої вейвлетом. В даний час, вейвлет-перетворення є одним з найбільш популярних тимчасових частот-перетворювань. У даній статті наводиться формальне та математичне визначення ортонормованого вейвлета, та інтегрального вейвлет-перетворення."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B8%9A%E0%B8%AD%E0%B8%95%E0%B8%AA%E0%B8%A7%E0%B8%B2%E0%B8%99%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Gaberone_aerial.jpg","page_title":"ประเทศบอตสวานา","context_page_description":"บอตสวานา หรือชื่อทางการคือ สาธารณรัฐบอตสวานา เป็นประเทศหนึ่งในภูมิภาคแอฟริกาใต้ และเป็นประเทศที่ไม่มีทางออกสู่ทะเล มีอาณาเขตดังนี้ ทิศใต้ติดกับประเทศแอฟริกาใต้ ทิศตะวันตกติดกับประเทศนามิเบีย ทิศเหนือติดกับประเทศแซมเบีย ทิศตะวันออกเฉียงเหนือติดกับประเทศซิมบับเว"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B8%D1%88%D0%B8%D1%86%D1%8F_(%D0%9A%D0%B0%D0%BC%27%D1%8F%D0%BD%D0%BA%D0%B0-%D0%91%D1%83%D0%B7%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Tyshycia_KamiankaBuska_Raion_Church.jpg","page_title":"Тишиця (Кам'янка-Бузький район)","context_page_description":"Тишиця — село в Україні, в Кам'янка-Бузькому районі Львівської області. Населення становить 306 осіб. Орган місцевого самоврядування - Стародобротвірська сільська рада."},{"page_url":"https://eo.wikipedia.org/wiki/Jarmilo_de_Rusio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/InsideTheKremlin.jpg","page_title":"Jarmilo de Rusio","context_page_description":"La Jarmilo de Rusio estas monumento situanta en Velikij Novgorod, Rusio, kaj konstruita en 1862 je honoro de la miljara jubileo de la legenda alvoko de Varengoj en Rusjon. Aŭtoroj de la projekto estis Miĥail Mikeŝin, Ivan Ŝreder kaj arkitekto Viktor Gartman. La monumento situas en la Kremlo de Novgorod."},{"page_url":"https://fr.wikipedia.org/wiki/Roselin_de_Sillem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Naturalis_Biodiversity_Center_-_ZMA.AVES.43449_1_LAT_-_Leucosticte_sillemi_Roselaar%2C_1992_-_Fringillidae_-_skin_specimen.jpeg","page_title":"Roselin de Sillem","context_page_description":"Le Roselin de Sillem est une espèce de passereau de la famille des Fringillidae qui n'est connu que par deux spécimens mâles collectés lors de l'expédition néerlandaise de 1929-1930 au Karakoroum. En 2012, l'oiseau est photographié à 1 500 km du lieu de collecte des types de l'espèce."},{"page_url":"https://en.wikipedia.org/wiki/Unity_for_Change","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Federacion_Regionalista_Verde_Social.png","page_title":"Unity for Change","context_page_description":"Unity for Change is a Chilean political coalition of left-wing and center-left parties with a Marxist-Leninist, progressive, ecologist and regionalist ideology.\\nThe political alliance was created after the victory of the conservative coalition Chile Vamos in the 2017 general election."},{"page_url":"https://ca.wikipedia.org/wiki/Territori_no_organitzat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/USA_Territorial_Growth_1900.jpg","page_title":"Territori no organitzat","context_page_description":"Un territori no organitzat és una regió de terra que no té un sistema de govern constitucional. En la pràctica, aquests territoris, amb prou feines són poblats. Un territori no organitzat no significa que sigui un territori no reclamat, ni que no tingui representació pel govern.\\nEn la pràctica, un territori no organitzat podria tenir el següent:\\nUna àrea en la qual el control efectiu del govern no ha estat establert com avui dia. Aquest ha estat l'ús històric normal, i indica, per exemple, als antics territoris dels EUA, on el govern dels EUA només exercia el control de passatgers quan les seves forces estaven presents.\\nUna àrea en la qual el govern local no existeix, o existeix només una forma embrionària de governs locals, els serveis són per tant, proporcionats pel govern federal o estatal, o unitat constitutiva. Aquest és el significat dels territoris no organitzats d'avui dia.\\nEl terme té diverses denotacions i connotacions en funció de la utilització adequada i el context."},{"page_url":"https://eu.wikipedia.org/wiki/Makako","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Macaca_tonkeana_groupe.jpg","page_title":"Makako","context_page_description":"Makakoak dira Macaca generoko primateak. Catarrhini tximinoen genero bat dira, Cercopithecidae familiakoa. Gizakiez gain tropikoetatik kanpo bizitzera ohitu diren primate bakarrak dira. Afrika, Gibraltar, Txina edo Japonian bizi dira. 22 espezie ezagutzen dira, euren artean Rhesus makakoa eta Berberia makakoa. Espezieetako batzuk ez dute isatsik, eta beste batzuk badute, nahiz eta garapena ezberdina izan daitekeen.\\nEspezieetako batzuk esperimentutan erabili dira. 1990eko hamarkadan herpes-Baren garraiatzaile izan zitezkeela aurkitu zen eta, beraz, gizakiak kutsatu ahal dituztela, beste primate batzuen artean."},{"page_url":"https://hu.wikipedia.org/wiki/Oberdischingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Oberdischingen-reihe.jpg","page_title":"Oberdischingen","context_page_description":"Oberdischingen település Németországban, azon belül Baden-Württembergben. Lakosainak száma 2129 fő. +/-"},{"page_url":"https://de.wikipedia.org/wiki/Walzzeichen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Walzzeichen_Peic_Kladno_1908.JPG","page_title":"Walzzeichen","context_page_description":"Mit Walzzeichen bezeichnet man die Kennzeichnung eines aus Metall gewalzten Trägers oder einer Schiene. Die Kennzeichnung wird als Negativform in das Fertigkaliber der Walze graviert und ergibt auf dem Produkt eine erhabene Schrift oder erhabene Zeichen, deren Art und Größe zum Beispiel für Vignolschienen in der europäischen Norm EN 13674-1 festgelegt ist. Aus dem üblichen Umfang der Walzen ergibt sich ein Abstand der Walzzeichen bei Trägern und Schienen von rd. 2–3 m zueinander.\\nEin Walzzeichen kann enthalten:\\ndas Logo des Herstellers\\nden Namen des Herstellers\\nden Herstellungsort\\ndas Produktionsjahr\\nein Kennzeichen für die Produktqualität\\nein Kennzeichen für das Herstellungsverfahren"},{"page_url":"https://de.wikipedia.org/wiki/Stadttheater_am_Brausenwerth","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Brausenwerther_Platz%2C_Elberfeld%2C_etwa_1895.jpg","page_title":"Stadttheater am Brausenwerth","context_page_description":"Das Stadttheater am Brausenwerth war ein Theater, das von 1888 bis 1943 auf dem Brausenwerther Platz 2 in Elberfeld bestand."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%86%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Coluber_constrictor_anthicus.jpg","page_title":"حنش","context_page_description":"الحنش هو جنس من الزواحف يتبع الفصيلة الأحناش من رتبة الحرشفيات."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Wolkenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Bf_Wolkenstein_Empfangsgeb%C3%A4ude_%281%29.jpg","page_title":"Bahnhof Wolkenstein","context_page_description":"Der Bahnhof Wolkenstein ist der Bahnhof der Stadt Wolkenstein im sächsischen Erzgebirgskreis. Von 1892 bis 1986 zweigte hier die Schmalspurbahn nach Jöhstadt ab, die heute unter dem Namen „Preßnitztalbahn“ bekannt ist."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%88%D0%B0%D0%B1%D0%BB%D0%B0%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Jablanik_-_zapadna_Srbija_-_mesto_Debelo_brdo_-_Na_putu_ka_vrhu_Jablanika_-_Detalj_106.jpg","page_title":"Јабланик","context_page_description":"Јабланик је планина у западној Србији, у групи Ваљевских планина. Највиши врх је Јабланик са 1.275 м. Изграђена је претежно од дијабаз-рожанаца, делом од серпентина а највиши делови грађени су од тријаских кречњака. Годишње прима просечно 1.800 мм падавина. Под травнатим пашњацима на високим заравнима саграђене су појате. Поред Јабланика пролази пут Ваљево - Рогачица."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_%C5%9Bw._Anny_w_Krzy%C5%BCanowicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/KO%C5%9ACI%C3%93%C5%81_pw._%C5%9Bw_Anny_KRZY%C5%BBANOWICE.jpg","page_title":"Parafia św. Anny w Krzyżanowicach","context_page_description":"Parafia św. Anny w Krzyżanowicach – rzymskokatolicka parafia dekanatu Tworków diecezji opolskiej.\\nParafia została utworzona w 1285. Została wymieniona w spisie świętopietrza, sporządzonym przez archidiakona opolskiego Mikołaja Wolffa w 1447, pośród innych parafii archiprezbiteratu w Raciborzu, pod nazwą Krzyzanowicz. W granicach Polski i diecezji opolskiej od końca II wojny światowej.\\nObecny kościół parafialny został wpisany do rejestru zabytków 17 lutego 1955."},{"page_url":"https://es.wikipedia.org/wiki/Medida_de_la_pobreza","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Life_Expectancy_2008_Estimates_CIA_World_Factbook.png","page_title":"Medida de la pobreza","context_page_description":"La pobreza se mide en porcentajes.​ Primero se decide el tipo de pobreza que se desea medir, y después se averigua el porcentaje de población que lo padece. Por ejemplo en 2012 el 45,5 % de la población de México se encontraba en situación de pobreza.​"},{"page_url":"https://eu.wikipedia.org/wiki/Playmobil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Playmobil_Park.jpeg","page_title":"Playmobil","context_page_description":"Playmobil Brandstäter taldeak ekoiztutako plastikozko jostailu lerro bat da, egoitza Alemaniako Zirndorf hirian duena.\\nJostailu hauen oinarria 7,5 cm-ko altuera duen panpina bat da. Mugitu daitezkeen atalak burua, besoak eta hankak dira eta antzinatasunaren arabera eskumuturrak ere bai. Osagarri, eraikin, ibilgailu eta animalia mota asko ere Playmobil linearen parte dira. Ezaugarri hauei esker, haurrak mugimendua eta ahotsa emanez kontrola hartzeko eszenatoki eta egoera ugari sor daitezke.\\nPlaymobilen jostailuak serie tematikoetan ekoizten dira, baita banakako irudi berezietan eta jokoetan ere. Sustapen-produktu bakarrak oso kopuru mugatuetan ekoizten dira batzuetan. Praktika horiek bildumagile komunitate garrantzitsu bat sortzen lagundu dute. Bildumagileen jarduerak bildumagintzatik eta jolas libretik haratago doaz, eta pertsonalizazioa, miniaturazko gerra-jokoa eta stop motion istorio eta filmen sorkuntza, edo, besterik gabe, dekorazio gisa, sartzen dira."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E9%87%91%E7%AE%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Infuehr-Oesterreich-Gold-trocken-effekt.jpg","page_title":"金箔","context_page_description":"金箔是一種黃金製品，通過錘打，使黃金變為極薄的薄片，常用於貼金。金箔有不同的純度，常見的是22k金，含金量為91%，24k金為純金。也有銀色的金箔，含金量約為50%。\\n將金箔貼在物體表面稱為貼金，傳統的貼金要用手來完成，已經傳承了數百年。"},{"page_url":"https://en.wikipedia.org/wiki/Dun_Mountain_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Opening_of_Dun_Mountain_tramway%2C_Nelson_region%2C_3_Feb_1862%2C_Alexander_Turnbull_Library%2C_1_of_2-018188-F.jpg","page_title":"Dun Mountain Railway","context_page_description":"The Dun Mountain Railway was a privately owned and operated 3 ft narrow gauge, 21.5 km long horse-drawn tramway from chromite mines in the vicinity of Duppa Lode on the eastern slopes of Wooded Peak to Nelson port in the Tasman District of New Zealand's South Island. It operated from 3 February 1862 to 30 May 1901, with the last mineral traffic on the incline section operated in January 1866.\\nThis line was the first \\"railway\\" to be opened and operated in New Zealand, preceding the first public railway and the first railway to be operated by steam trains, the line between Ferrymead and Christchurch, which opened on 1 December 1863. The city of Nelson had the first city tramway to both open and close in New Zealand."},{"page_url":"https://qu.wikipedia.org/wiki/%C3%91a%C3%B1u_ch%27unchul","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Stomach_colon_rectum_diagram-es.svg","page_title":"Ñañu ch'unchul","context_page_description":"Ñañu ch'unchul nisqaqa runap wiksanpi kaq mikhuna yawrinmi, ñañu kaq ch'unchulpa rakinmi. Kurku ñañu ch'unchulpiqa mikhusqa suyk'upinpa hillinwan, kukupinmanta hamuq hayaqiwan ukhunchakunmi.‎"},{"page_url":"https://ro.wikipedia.org/wiki/Breiholz","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Breiholz_in_RD.png","page_title":"Breiholz","context_page_description":"Breiholz este o comună din landul Schleswig-Holstein, Germania."},{"page_url":"https://mg.wikipedia.org/wiki/Sevila","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/La_sevilla_del_sigloXVI.jpg","page_title":"Sevila","context_page_description":"Tanàna any atsimon'i Espaina Sevila, izy no renivohitra ny faritany ny Sevila sy renivohitra ny Andalosia."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%DB%8C%D8%B1%DB%8C%D9%86%D8%AC%DB%8C_%D8%A7%D8%AA%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Alter_Markt_%28Magdeburg-Altstadt%29.Magdeburger_Reiter_edit.jpg","page_title":"بیرینجی اتوی","context_page_description":"بیرینجی اتوی بیر شاهی ایدی. ۲ فوریه ۹۶۲ – ۷ مئی ۹۷۳ ایل‌لر آراسیندا حؤکومت ائدیب. مسیحیت دینینه اعتیقاد ائتمیشدی. آتاسی هاینریش مرغقیر دیر."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_estalinista","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Moscow_textile_institute.jpg","page_title":"Arquitectura estalinista","context_page_description":"La arquitectura estalinista, también conocida como gótico estalinista, o clasicismo socialista, corresponde a la arquitectura de la Unión Soviética bajo la dirección de Iósif Stalin, entre 1933, cuando se aprobado oficialmente el proyecto de Borís Iofán para el Palacio de los Soviets, y 1955, cuando Nikita Jrushchov condenó los «excesos» de las últimas décadas y disolvió la Academia Soviética de Arquitectura. La arquitectura estalinista se asocia con el realismo socialista, una escuela de arte y arquitectura."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D9%86%D9%88%D9%86_1100_%D8%AF%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Canon_EOS_Kiss_X50_red.jpg","page_title":"كانون 1100 دي","context_page_description":"كانون 1100 دي ‏ وفي اليابان تسمى EOS Kiss X50 وفي أمريكا EOS Rebel T3 هي كاميرا احترافية للمبتدئين. 12.2 ميجا بيكسل من إنتاج شركة كانون والتي طرحت في الأسواق في فبراير 2011"},{"page_url":"https://cs.wikipedia.org/wiki/Doln%C3%AD_Chvatliny","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Doln%C3%AD_Chvatliny%2C_Man%C4%8Dice%2C_east_part.jpg","page_title":"Dolní Chvatliny","context_page_description":"Dolní Chvatliny jsou obec ležící v okrese Kolín 11 km jihozápadně od Kolína. Žije zde 485 obyvatel a rozkládají se na ploše 1221 ha. V roce 2011 zde bylo evidováno 217 adres. Součástí obce jsou i vesnice Horní Chvatliny a Mančice.\\nDolní Chvatliny je také název katastrálního území o rozloze 5,83 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Trou_d%E2%80%99Uri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Andermatt_-_Urnerloch_Tunnel_%2818589156200%29.jpg","page_title":"Trou d’Uri","context_page_description":"Le Trou d’Uri est un tunnel situé dans le canton d’Uri, en Suisse, près d’Andermatt, sur la route du col du Saint-Gothard. Il s’agit du premier tunnel routier de Suisse et le premier tunnel sur une route alpine.\\nLe tunnel, situé sur la route principale 2, relie la partie sud des gorges des Schöllenen avec la vallée d’Urseren. Il se trouve en amont du Pont du Diable à une altitude d'environ 1 430 m."},{"page_url":"https://it.wikipedia.org/wiki/XIV_Korpus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/14._Korpus.jpg","page_title":"XIV Korpus","context_page_description":"Il XIV Korpus, in cirillico Четрнаести српски корпус, in serbo-croato Četrnaesti srpski korpus, è stata una formazione militare dell'Esercito Popolare di Liberazione della Jugoslavia che venne costituita il 6 settembre 1944 in Serbia orientale per contribuire alla sconfitta degli occupanti tedeschi e dei collaborazionisti cetnici, durante la Seconda guerra mondiale sul Fronte jugoslavo."},{"page_url":"https://br.wikipedia.org/wiki/La_Croix-Avranchin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/La_Croix-Avranchin_%2850%29_%C3%89glise.jpg","page_title":"La Croix-Avranchin","context_page_description":"La Croix-Avranchin a oa ur gumun eus departamant Manche e Bro-C'hall. Bodet e oa gant c'hwec'h kumun-all d'ar 1 a viz Genver 2017 d'ober ur gumun nevez: Saint-James."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%90%EC%9A%B0%ED%8A%80%ED%94%84%EB%A1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Socrates_Louvre.jpg","page_title":"에우튀프론","context_page_description":"《에우튀프론》은 플라톤의 초기 대화편으로, 저술 시기는 기원전 399년 이후이다. 소크라테스의 재판을 앞두고, 자신이 경건함에 대해 잘 알고 있다고 주장하는 에우튀프론과 소크라테스가 대화를 나눈다는 내용이다. 이 책의 주제는 '경건함'에 대한 것이다. 당시 그리스에는 다섯 가지 덕목들이 있었는데 그 가운데 하나가 경건함이었다. 다른 것들은 정의, 절제, 용기 그리고 지혜였다. 철학적으로 특별한 의미를 갖는 작품은 아니며 어수룩한 젊은이를 두고 말꼬리를 잡는 식의 대화이다."},{"page_url":"https://en.wikipedia.org/wiki/Robert_Woodward_(architect)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Canberra_Times_Fountain_January_2014.jpg","page_title":"Robert Woodward (architect)","context_page_description":"Robert Raymond Woodward AM was an Australian architect who gained widespread recognition for his innovative fountain designs."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D9%84%D9%8A_%D8%AC%D9%8A%D9%85%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lilly_James_%2835036323024%29.jpg","page_title":"ليلي جيمس","context_page_description":"ليلي جيمس ‏ هي ممثلة بريطانية، ولدت في 5 أبريل 1989 في Esher في المملكة المتحدة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%83%D0%B7%D0%B5%D0%B5%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Moscow_StNicholasChurchTolmachy_F47.jpg","page_title":"Список музеев Москвы","context_page_description":"В списке музеев Москвы перечислены музеи, находящиеся в городе Москве в черте Московской кольцевой автодороги федерального, московского и иного подчинения, а также некоторые частные музеи.\\nПримечание: некоторые маленькие и ведомственные музеи работают только по предварительной записи и/или только для экскурсионных групп.\\nСписок неполный."},{"page_url":"https://da.wikipedia.org/wiki/Langelandsfestivalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Poppen.jpg","page_title":"Langelandsfestivalen","context_page_description":"Langelandsfestival er en musikfestival, der afholdes hvert år i uge 30 på en række marker ved Rudkøbing og ud mod Det Sydfynske Øhav. Langelandsfestival blev grundlagt i 1991 af Troels Hersom, der solgte festivalen til Allan K. Pedersen i 2006, efter festivalen var løbet ind økonomiske problemer. I 2020 fejrer festivalen sit 30 års jubilæum."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%9C%E0%A5%8B%E0%A4%B2%E0%A5%87%E0%A4%A8_%E0%A4%AC%E0%A5%8D%E0%A4%B2%E0%A4%BE%E0%A4%B2%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/JoleneBlalockEgyptCropped.jpg","page_title":"जोलेन ब्लालक","context_page_description":"जोलेन किङ ब्लालक एक अमेरिकी चलचित्र तथा टेलिभिजन अभिनेत्री तथा मोडल हुन् । उनले स्टार ट्रेकमा गरेको अभिनयको लागि उसको प्रशंशक उनलाई मन पराउँछन् । यस बाहेक उनी विभिन्न टेलिभिजन चलचित्र तथा टेलिभिजन कार्यक्रममा पाहुनाको रूपमा कार्य गरेकी छिन ।"},{"page_url":"https://sv.wikipedia.org/wiki/Peter_Gudmundson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Peter_Gudmundson.jpg","page_title":"Peter Gudmundson","context_page_description":"Peter Gudmundson, född 1955, är en svensk forskare inom materialmekanik, professor vid Kungliga Tekniska högskolan. Peter Gudmundson var KTH:s rektor från den 12 november 2007 till 12 november 2016.\\nPeter Gudmundson blev civilingenjör i teknisk fysik vid KTH 1979 och tog doktorsexamen i hållfasthetslära vid KTH 1982. Han spelade ishockey i AIK under studietiden vid KTH. Peter Gudmundson arbetade vid Brown Boveri Research Centre i Baden i Schweiz åren 1979–1983, var därefter konsult vid Tre Konsulter AB i Vaxholm 1983–1986, återvände därefter till KTH som universitetslektor vid institutionen för hållfasthetslära åren 1986–1989 och var därefter VD för forskningsinstitutet Swedish Institute of Composites i Piteå 1989–1993. Peter Gudmundson återvände 1993 till KTH som professor i materialmekanik, och var prodekanus i KTH:s fakultetsnämnd 2007.\\nDen 8 november 2007 utsåg regeringen Peter Gudmundson till rektor för KTH med förordnande från den 12 november 2007 till 11 november 2013. Han är kabinettskammarherre vid Kungl. Hovstaterna sedan 2011."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D1%84,_%D0%91%D0%BE%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Botho_Graef.jpg","page_title":"Греф, Бото","context_page_description":"Франц Бото Греф — немецкий археолог и историк искусства. Педагог."},{"page_url":"https://de.wikipedia.org/wiki/Trinkgef%C3%A4%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Kirchenschatz_Stadtpfarrkirche_Rapperswil_-_Messkelch_Sp%C3%A4trenaissance_1611_-_Stadtmuseum_Rapperswil_2012-12-01_16-24-57.JPG","page_title":"Trinkgefäß","context_page_description":"Trinkgefäße sind Gefäße, die der Bereitstellung der Getränke zu ihrem Verzehr dienen.\\nMan kann Trinkgefäße nach ihrem Material, ihrer Form und ihrem Inhalt sowie ggf. ihrem Zweck unterscheiden."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Amsterdam-Zuid","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Olympiaschool_Speelgebouw_z.w..JPG","page_title":"Lijst van rijksmonumenten in Amsterdam-Zuid","context_page_description":"Een overzicht van rijksmonumenten in de stad Amsterdam. Van de 7324 inschrijvingen in Amsterdam liggen er 305 in stadsdeel Zuid."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D0%B2_(%D0%BA%D0%BE%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Kung%C3%A4lvs_stadshus.JPG","page_title":"Кунгельв (комуна)","context_page_description":"Комуна Кунгельв — адміністративно-територіальна одиниця місцевого самоврядування, що розташована в лені Вестра-Йоталанд у південно-західній Швеції.\\nКунгельв 221-а за величиною території комуна Швеції. Адміністративний центр комуни — місто Кунгельв."},{"page_url":"https://fr.wikipedia.org/wiki/T%C3%A9trapode_(structure)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Wave_dissipating_blocks.jpg","page_title":"Tétrapode (structure)","context_page_description":"Un tétrapode est une structure à quatre pieds, plus particulièrement utilisée en ingénierie hydraulique comme élément de brise-lames, c'est-à-dire pour résister à la houle et aux vagues."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%AB%D5%BF%D5%AB%D5%AC%D5%AB%D5%A1%D5%B6%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Pitigliano_001.jpg","page_title":"Պիտիլիանո","context_page_description":"Պիտիլիանո, կոմունա Իտալիայում, գտնվում է Տոսկանա մարզում՝ Գրոսետո գավառում։\\nԲնակչությունը կազմում է 4014 մարդ ։ Խտությունը՝ 39 մարդ/կմ²։ Տարածքը՝ 103 կմ²։ Էլեկտրոնային փոստ՝ 58017։ Հեռախոսային կոդ՝ 0564։"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lieux_patrimoniaux_du_comt%C3%A9_de_Carleton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Hartland_-_Dr_Walter_Chesnut_Library.JPG","page_title":"Liste des lieux patrimoniaux du comté de Carleton","context_page_description":"Cet article recense les lieux patrimoniaux du comté de Carleton inscrit au répertoire des lieux patrimoniaux du Canada, qu'ils soient de niveau provincial, fédéral ou municipal."},{"page_url":"https://da.wikipedia.org/wiki/Meckenbeuren","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Meckenbeuren_im_Bodenseekreis.png","page_title":"Meckenbeuren","context_page_description":"Meckenbeuren er en kommune i Bodenseekreis i den tyske delstat Baden-Württemberg. Med 13.520 indbyggere er Meckenbeuren den største landkommune i Oberschwaben."},{"page_url":"https://en.wikipedia.org/wiki/Rogers_Pass_(British_Columbia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Rogers_Pass_Mount_Carroll_BC_1887.jpg","page_title":"Rogers Pass (British Columbia)","context_page_description":"Rogers Pass is a high mountain pass through the Selkirk Mountains of British Columbia, but the term also includes the approaches used by the Canadian Pacific Railway and the Trans-Canada Highway. In the heart of Glacier National Park, this tourism destination since 1886 is a National Historic Site."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_Hampden-Turner","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/7_Dimensions_of_culture.svg","page_title":"Charles Hampden-Turner","context_page_description":"Charles Hampden-Turner est un chercheur et auteur néerlandais spécialiste — concurremment aux travaux de Geert Hofstede — des valeurs d'entreprise, de la culture d'entreprise et plus spécialement du multiculturalisme et de l'entreprise multiculturelle.\\nIl a écrit la plupart de ses livres sur ce sujet en collaboration étroite avec Fons Trompenaars."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BB%D1%81_%D0%93%D1%83%D1%81%D1%82%D0%B0%D1%84_%D0%94%D0%B0%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Nils_Gustaf_Dal%C3%A9n.jpg","page_title":"Нилс Густаф Дален","context_page_description":"Нилс Густаф Дален — физик, мөһәндис, уйлап табучы, эшкуар, башкарма директор. Физика өлкәсендә Нобель премиясе иясе."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A5%BF%E8%92%99%C2%B7%E7%B4%90%E5%BA%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Simon_Newcomb_01.jpg","page_title":"西蒙·紐康","context_page_description":"西蒙·纽康，美国籍加拿大天文学家、数学家暨科幻小说作家。虽然他只接受过短期学校教育，却在钟表学、经济学及数学上有所贡献。"},{"page_url":"https://fi.wikipedia.org/wiki/Virtasalmen_kirkko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Virtasalmen_kirkko_1.jpg","page_title":"Virtasalmen kirkko","context_page_description":"Virtasalmen kirkko on Pieksämäen Virtasalmella sijaitseva evankelis-luterilainen kirkko. Nykyinen kirkko on seurakunnan toinen kirkko ja se valmistui vuonna 1978 tulipalossa äitienpäivän aattona vuonna 1976 tuhoutuneen kirkon viereen.\\nUuden kirkon seinissä on käytetty Virtasalmen Ankeleen kaivoksen dolomiittikalkkikiveä ja siinä on korkea paanukatto. Kirkon lattia on niinikään kalkkikiveä ja sitä on myös alttarissa ja saarnastuolissa. Kirkossa on 18-äänikertaiset Hans Heinrichin rakentamat urut. Hollantilaista valutyötä olevat kirkonkellot on sijoitettu erilliseen kellotapuliin.\\nVirtasalmen ensimmäinen kirkko oli puinen päätytornillinen ristikirkko, joka oli vihitty käyttöön 20. elokuuta 1882. Kirkon oli suunnitellut arkkitehti Konstantin Kiseleff. Kirkko paloi 8. toukokuuta 1976 aamuyöllä, tulipalon syynä olivat vialliset sähköjohdot. Nykyisen kirkon pohjoispuolella on vanhan kirkon alttarisakaran kivijalka ja sen keskellä suihkukaivo.\\nVirtasalmen seurakunnasta tuli erillinen seurakunta vuonna 1894, sitä ennen vuodesta 1866 alkaen se oli ollut Pieksämäen rukoushuonekunta. Vanha kirkko oli peräisin tuolta ajalta."},{"page_url":"https://hu.wikipedia.org/wiki/Kainach_bei_Voitsberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Kainach_bei_Voitsberg_im_Bezirk_VO.png","page_title":"Kainach bei Voitsberg","context_page_description":"Kainach bei Voitsberg osztrák község Stájerország Voitsbergi járásában. 2017 januárjában 1647 lakosa volt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B0%D1%80%D0%BE%D0%B2%D1%8B%D0%B9_%D1%83%D0%B7%D0%BE%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Moire_ecart_angulaire.png","page_title":"Муаровый узор","context_page_description":"Муа́ровый узор — узор, возникающий при наложении двух периодических сетчатых рисунков. Явление обусловлено тем, что повторяющиеся элементы двух рисунков следуют с немного разной частотой и то накладываются друг на друга, то образуют промежутки.\\nМуаровый узор наблюдается при наложении друг на друга различных частей тюлевых занавесок.\\nТермин «муаровый» происходит от названия ткани муар, при изготовлении которой использовалось данное явление.\\nМуаровый узор возникает при цифровом фотографировании и сканировании сетчатых и других периодических изображений, если их период близок к расстоянию между светочувствительными элементами оборудования. Этот факт используется в одном из механизмов защиты денежных знаков от подделки: на купюры наносится волнообразный рисунок, который при сканировании может покрыться очень заметным узором, отличающим подделку от оригинала."},{"page_url":"https://nl.wikipedia.org/wiki/Klaartje_de_Zwarte-Walvischbrug","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/2019_Brug_1925%2C_naamplaat.jpg","page_title":"Klaartje de Zwarte-Walvischbrug","context_page_description":"De Klaartje de Zwarte-Walvischbrug is een bouwkundig kunstwerk in Amsterdam-Oost.\\nHet vormt met brug 159 en de Jaap Kunstbrug de verbinding tussen de noord- en zuidkant van het Oosterpark dat door midden gesneden lijkt door een vijver.\\nDe brug komt al voor op de tekeningen van de parkarchitect Leonard Springer uit 1893 en ook op de stadsplattegrond uit 1913 is een brug te zien. Echter, zo veelvuldig als brug 159 nabij uitgang Linnaeusstraat en Muiderkerk is gefotografeerd, zo weinig beelden zijn er van de bruggen 1925 en 1926 die meer centraal in het park liggen. In 1988 werd het Oosterpark gerenoveerd en werden ook de twee bruggen opnieuw gelegd. Zij kregen het uiterlijk mee van bruggen die elders in de stad in parken werden neergelegd; leuningen van zware houten balken vermoedelijk naar een ontwerp van Dirk Sterenberg werkend voor de Dienst der Publieke Werken. In 2016 werd die brug gerenoveerd en kreeg simpeler balustrades."},{"page_url":"https://tr.wikipedia.org/wiki/Cape_Kolonisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Cape_Colony00.jpg","page_title":"Cape Kolonisi","context_page_description":"Cape Kolonisi, Hollanda'nın Güney Afrika'daki ilk göçmen kolonisi, daha sonra Birleşik Krallık egemenliğine geçmiştir. Merkezi bugünkü Cape Town'du.\\nHollanda Doğu Hindistan Şirketi'nin kontrolü altında Hollandalı denizci Jan van Riebeeck tarafından 1652 yılında Ümit Burnu yakınlığında elverişli bir koy olan Table Koyu'nda kurulmuştur.\\nHollanda'nın tüm göçmen kolonileri içinde ve Avrupalıların Afrika'daki göçmen kolonileri arasında en başarılısıydı.\\nHollandalılar; kendilerine katılan Almanlar ve Fransız Huguenotlarla beraber burada Afrika'nın beyaz tenli topluluğu olan ve sayıları 3 milyonu bulan Afrikanerleri oluşturmuşlardır. Bu topluluk Hollandaca temelinde gelişen yeni bir dil olan Afrikaanca konuşmaktadır.\\nKoloninin 1806 yılında Birleşik Krallık'ın egemenliğine geçmesiyle, burada Britanya Adaları'ndan çıkma insanların sayısı artmaya başlamıştır."},{"page_url":"https://en.wikipedia.org/wiki/Hagenow_Land%E2%80%93Bad_Oldesloe_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Berkenthin_Kaiserbahn_ungenutzte_Br%C3%BCcke_2014-02-16_4.JPG","page_title":"Hagenow Land–Bad Oldesloe railway","context_page_description":"The Hagenow Land–Bad Oldesloe railway was a railway line in the states of Mecklenburg-Vorpommern and Schleswig-Holstein. It linked the towns of Hagenow, Ratzeburg and Bad Oldesloe with each other and formed with lines continuing via Bad Segeberg and Neumünster the shortest rail link between Berlin and Kiel, the difference with the other two routes is about 55 kilometres in each case. Today, only the short section between the stations of Hagenow Land and Hagenow Stadt is regularly served by passenger services, although the Hollenbek–Ratzeburg section is used for draisine rides. The Hagenow–Zarrentin section is served occasionally. The other sections are closed and dismantled. Its alternative name Kaiserbahn refers to Emperor Wilhelm II, who often used it."},{"page_url":"https://lt.wikipedia.org/wiki/Jiezno_senosios_kapin%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Jiezno_senosios_kapin%C4%97s_5.jpg","page_title":"Jiezno senosios kapinės","context_page_description":"Jiezno senosios kapinės – riboto naudojimo, veikiančios kapinės, esančios Vilniaus g. Jiezne, Jiezno seniūnijoje, Prienų rajone, rytinėje miesto dalyje, prie kelio 3309 Jieznas–Sobuva, 0,5 km į šiaurės rytus nuo Jiezno Šv. arkangelo Mykolo ir Jono Krikštytojo bažnyčios.\\nJiezno senosios kapinės yra vienos didžiausių ir seniausių apylinkėse kapinių. Jose gausu didikų, kunigų, 1794 m. sukilimo, 1831 m. sukilimo, 1863 m. sukilimo dalyvių, Lietuvos savanorių, laisvės gynėjų ir kitų žinomų žmonių bei parapijiečių kapų."},{"page_url":"https://hu.wikipedia.org/wiki/Sankt_Johann_in_der_Haide","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Unterlungitz-Ortskapelle_3027.jpg","page_title":"Sankt Johann in der Haide","context_page_description":"Sankt Johann in der Haide osztrák község Stájerország Hartberg-fürstenfeldi járásában. 2017 januárjában 2143 lakosa volt."},{"page_url":"https://ceb.wikipedia.org/wiki/Sesbania_grandiflora","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Steamed_vegetables_CM.jpg","page_title":"Sesbania grandiflora","context_page_description":"Espesye sa sitaw nga una nga gihulagway ni Carl von Linné, ug nga gihatagan sa eksakto nga ngalan ni Christiaan Hendrik Persoon ang Sesbania grandiflora. Ang Sesbania grandiflora sakop sa kahenera nga Sesbania sa kabanay nga Fabaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://simple.wikipedia.org/wiki/Crato","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/CHAPADA_DO_ARARIPE_01.jpg","page_title":"Crato","context_page_description":"Crato is a city in the south of state of Ceará in Cariri. Crato is called the \\"Oasis do Cariri\\". It is next to the state of Pernambuco. Is at the foot of the Araripe Plateau. Have a population formed by 130.064 According to IBGE"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%B1%E7%9B%B8%E5%85%A7%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Higashiainonai_station03.JPG","page_title":"東相內站","context_page_description":"東相內車站位於北海道北見市東相內町，是北海道旅客鐵道石北本線上的站。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D1%83-%D0%92%D0%B5%D1%80%D0%B4%D0%B8_(%D0%A1%D0%B0%D0%BD-%D0%9F%D0%B0%D1%83%D0%BB%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Brasao_ouro_verde.jpg","page_title":"Ору-Верди (Сан-Паулу)","context_page_description":"Ору-Верди — муниципалитет в Бразилии, входит в штат Сан-Паулу. Составная часть мезорегиона Президенти-Пруденти. Входит в экономико-статистический микрорегион Драсена. Население составляет 7189 человек на 2006 год. Занимает площадь 266,452 км². Плотность населения — 27,0 чел./км².\\nПраздник города — 23 марта."},{"page_url":"https://en.wikipedia.org/wiki/Travellers_Rest_(Nashville,_Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Travellers_Rest_Nashville_TN_2013-07-20_016.jpg","page_title":"Travellers Rest (Nashville, Tennessee)","context_page_description":"Travellers Rest is a historic plantation house in Nashville, Tennessee."},{"page_url":"https://fr.wikipedia.org/wiki/AC_Cobra","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/AC_Cobra_in_the_pits_at_Laguna_Seca%27s_Historic_car_races_IMG_7156.jpg","page_title":"AC Cobra","context_page_description":"L'AC Cobra est une voiture de sport anglo-américaine des années 1960-1970, châssis et caisse de AC anglais, moteur V8 et boîte de vitesses manuelle à quatre rapports Ford USA."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D9%84%D8%A7_%D8%AC%D8%A7%D9%84%D8%A7%D9%83%D8%AA%D9%8A%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Gala_Galaction_%281%29.jpg","page_title":"جالا جالاكتيون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجالا جالاكتيون كان صحفى من رومانيا."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89glise_Notre-Dame_de_l%27Assomption,_Rouffach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Braun-%C3%A9glise-de-Rouffach.jpg","page_title":"Église Notre-Dame de l'Assomption, Rouffach","context_page_description":"The Église Notre-Dame de l'Assomption is a Roman Catholic parish church of the town of Rouffach in southern Alsace. It is one of the largest medieval churches in the Haut-Rhin département of France. The church is also known as Saint-Arbogast Church.\\nIt lies on the \\"Route Romane d'Alsace\\". Although work started in the 11th century and was carried on with interruptions until 1870, the building remains unfinished."},{"page_url":"https://es.wikipedia.org/wiki/Lynn_Williams","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Lynn_Williams_%2836728166714%29.jpg","page_title":"Lynn Williams","context_page_description":"Lynn Williams es una futbolista estadounidense. Juega como delantera y su equipo actual es el North Carolina Courage de la National Women's Soccer League de Estados Unidos.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AF%89%E6%B1%9F%E6%96%B9%E5%AF%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Koie_houju_haka.jpg","page_title":"鯉江方寿","context_page_description":"鯉江 方寿は、尾張国知多郡常滑村出身の陶芸家。鯉江小三郎家三代目である。\\n父の鯉江方救と共に常滑焼の鉄砲窯を改良し、真焼窯を考案した。1835年に真焼窯を親子で完成させたとされ、1874年には真焼土管の国産化に成功し、常滑焼の基礎を築いたとして名高い。\\n中国人を招聘、また、常滑焼を代表する朱泥の急須作りを導入し、その他には美術研究所の埋め立て事業、開所を行った。"},{"page_url":"https://pl.wikipedia.org/wiki/Mumu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Cocker_Spaniel_from_1915.JPG","page_title":"Mumu","context_page_description":"Mumu, ros. Муму́ – opowiadanie Iwana Turgieniewa, napisane w 1852 roku. Zostało opublikowane w czasopiśmie Sowriemiennik w 1854 roku. Głównymi bohaterami utworu są głuchoniemy stróż Gierasim i jego pies – suka Mumu."},{"page_url":"https://de.wikipedia.org/wiki/PGC_1803573","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/NGC_0672_SDSS.jpg","page_title":"PGC 1803573","context_page_description":"LEDA/PGC 1803573 ist eine Galaxie im Sternbild Dreieck am Nordsternhimmel, die schätzungsweise 506 Millionen Lichtjahre von der Milchstraße entfernt ist. Im selben Himmelsareal befinden sich u. a. die Galaxien NGC 670, NGC 672, IC 1727, IC 1731."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%9D%9E%E7%BB%93%E6%9E%84%E7%BD%91%E6%A0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Unstructured_grid.svg","page_title":"非结构网格","context_page_description":"非結構網格是沒有規則拓撲關係的網格，它通常由 polygon triangulation 組成。\\n網格中的每個每個元素都可以是二維的多邊形或者三維多面體，其中最常見的是二維的三角形以及三維的四面體。\\n在每個元素之間沒有隱含的連通性。"},{"page_url":"https://ceb.wikipedia.org/wiki/Idesia_polycarpa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Idesia_polycarpa_var_vestida_-_Vue_g%C3%A9n%C3%A9rale.jpg","page_title":"Idesia polycarpa","context_page_description":"Espesye sa tanom nga bulak ang Idesia polycarpa. Una ning gihulagway ni Carl Maximowicz. Ang Idesia polycarpa sakop sa kahenera nga Idesia sa kabanay nga Salicaceae. Usa ka matang nga nahiubos niini atong makita I. p. vestita."},{"page_url":"https://es.wikipedia.org/wiki/Loma_Mar%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Loma_Mar%C3%ADa_-_Open_Street_Map.png","page_title":"Loma María","context_page_description":"Loma María o Lomas de Mary ​ es el nombre que recibe una elevación mesetaria aislada ubicada entre las ciudades de Puerto Madryn y Trelew, en la provincia del Chubut. Al norte se ubica el Bajo Simpson.​"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%88%D9%84%D9%8A%D9%87_%D8%B1%D8%A7%D8%AA%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Oleg_Ratiy_1970.jpg","page_title":"اوليه راتى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاوليه راتى لاعب كورة قدم من اوكرانيا."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B2%E0%A6%BF%E0%A6%AC%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE_%E0%A6%AC%E0%A6%BF%E0%A6%B6%E0%A7%8D%E0%A6%AC%E0%A6%AC%E0%A6%BF%E0%A6%A6%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%B2%E0%A6%AF%E0%A6%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Univesity_of_Libya_logo.JPG","page_title":"লিবিয়া বিশ্ববিদ্যালয়","context_page_description":"লিবিয়া বিশ্ববিদ্যালয় বেনগাজি এবং ত্রিপোলী, লিবিয়া তে অবস্থিত একটি সরকারি বিশ্ববিদ্যালয়। ১৯৫৫ সালে এটি প্রতিষ্ঠিত হয় এবং ১৯৭৩ সালে এটি ভেঙ্গে দেওয়া হয়। বিশ্ববিদ্যালয়টি পরে ত্রিপোলী বিশ্ববিদ্যালয় এবং বেনগাজি বিশ্ববিদ্যালয় নামে দুটি বিশ্ববিদ্যালয়েে ভাগ হয়।"},{"page_url":"https://ca.wikipedia.org/wiki/Carnaval_de_Barranquilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mural_Congo.jpg","page_title":"Carnaval de Barranquilla","context_page_description":"El Carnaval de Barranquilla és la festa folklòrica i cultural més important de Colòmbia. Més d'un milió de persones, entre visitants i locals participen anualment a la festa, la qual se celebra des del dissabte fins al dimarts anteriors al Dimecres de cendra. La temporada de Carnestoltes comença el dissabte abans del Dimecres de cendra, quan comencen les festes públiques, no obstant això, altres activitats directament relacionades amb el carnestoltes se succeeixen durant gran part de l'any. El naixement del carnestoltes de Barranquilla es va donar al segle XIX, actualment participen prop de cinc-centes agrupacions folklòriques i genera aproximadament quaranta mil milions de pesos en ingressos.\\nEl Carnaval de Barranquilla és un esdeveniment cultural en el qual s'expressen totes les varietats culturals i el folklore de la Costa Carib colombiana, així com les més variades manifestacions culturals locals, la música popular i el ball. Constitueix l'aspecte més representatiu de la ciutat que cada any atreu a propis i a estranys. Algunes de les disfresses més tradicionals del Carnaval de Barranquilla són el de Marimonda, el Gargot, el Congo i el Monocuco."},{"page_url":"https://cs.wikipedia.org/wiki/Jean-Claude_Killy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Jean-Claude_Killy.jpg","page_title":"Jean-Claude Killy","context_page_description":"Jean-Claude Killy je někdejší francouzský sjezdař. Stal se nejúspěšnějším závodníkem na ZOH v Grenoblu v roce 1968, když získal olympijské zlato ve všech tehdejších mužských disciplínách alpského lyžování – slalomu, obřím slalomu i sjezdu. Šestkrát také zvítězil v závodech Světového poháru."},{"page_url":"https://en.wikipedia.org/wiki/Worcester_City_Hall_and_Common","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Burnside_Fountain_-_Worcester%2C_MA_-_DSC05763.jpg","page_title":"Worcester City Hall and Common","context_page_description":"The Worcester City Hall and Common, the civic heart of the city, are a historic city hall and town common at 455 Main Street in Worcester, Massachusetts. The city hall and common were added to the National Register of Historic Places in 1978."},{"page_url":"https://en.wikipedia.org/wiki/Arreau","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Arreau_place_Mairie.JPG","page_title":"Arreau","context_page_description":"Arreau is a commune in the Hautes-Pyrénées department in southwestern France.\\nIt is situated on the former Route nationale 618, the Route of the Pyrénées. Arreau is at the crossroads of the Louron valley and the Aure valley."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_l%27empire_colonial_fran%C3%A7ais_pendant_la_Seconde_Guerre_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Japanese_troops_entering_Saigon_in_1941.jpg","page_title":"Histoire de l'empire colonial français pendant la Seconde Guerre mondiale","context_page_description":"L’empire colonial français a connu, pendant la période 1940-1945 de la Seconde Guerre mondiale, une situation évolutive et contrastée. À l'issue de la bataille de France, la métropole a été occupée par l'Allemagne nazie et l'Italie. Selon l'armistice du 22 juin 1940, les divers territoires du second espace colonial français – incluant l'actuelle France d'outre-mer – restaient sous la souveraineté du nouveau gouvernement de Vichy. À de rares exceptions près, comme le Protectorat français de Tunisie à partir de la fin 1942, les territoires de l'Empire français n'ont pas été occupés par la Wehrmacht. Dès l'été 1940, des colonies et des territoires d'outre-mer commencent à se rallier à la France libre. Des réseaux de résistance se mettent également en place, notamment en Algérie française. À la mi-1943, l'intégralité du territoire colonial et d'outre-mer a basculé dans le camp de la résistance, à l'exception de quelques possessions asiatiques, dont la principale est l'Indochine française. Ce dernier territoire occupe une place particulière, étant concerné par les visées de l'empire du Japon."},{"page_url":"https://nl.wikipedia.org/wiki/Moskee_van_de_sjah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Naghsh-e-jahan_masjed-e-shah_esfahan.jpg","page_title":"Moskee van de sjah","context_page_description":"De Moskee van de sjah of de Koningsmoskee is een moskee in de Iraanse stad Isfahan.\\nDe moskee wordt ook wel de Moskee van de imam genoemd. Imam verwijst in dit geval naar ayatollah Khomeini.\\nDe bouw van de moskee begon in 1611 in opdracht van sjah Abbas de Grote. De moskee moest de vrijdagmoskee van Isfahan vervangen. De bouw was klaar in 1630.\\nDe iwan, de ingang, ligt evenwijdig aan het Plein van de Emam en wordt geflankeerd door een dubbele galerij. De rest van de moskee ligt daarachter en staat onder een hoek van ongeveer 45 graden met het plein, in de richting van Mekka. Het 'plafond' van de iwan is opgebouwd uit muqarnas.\\nHet gebouw zelf meet 130 × 100 meter en heeft een binnenplaats van 70 × 70 meter. Om de binnenplaats bevinden zich kleinere gebedsruimtes en ruimtes voor de madrassa.\\nDe koepel van de moskee is 52 meter hoog en is lichtblauw van kleur.\\nSommige delen van het gebouw zijn bekleed met schitterende mozaïeken. De rest van het gebouw is bekleed met zevenkleurige geglazuurde tegels, die goedkoper zijn dan mozaïek. Het gebouw heeft een band met witte letters met religieuze teksten, uitgevoerd in de tuluth-kalligrafie."},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4nergaleas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%C3%96stra_Hamnen_i_Lidk%C3%B6ping%2C_sedd_fr%C3%A5n_J%C3%A4rnv%C3%A4gsbron%2C_den_9_maj_2006.JPG","page_title":"Vänergaleas","context_page_description":"En Vänergaleas är en typ av segelfartyg som kan ses som en större efterträdare till fartygstypen bojorten. Vänergaleasen har anpassats till ett särskilt område, nämligen Vänern med anslutande sluss- och kanalsystem. De har fått sin längd och bredd efter slussarna i Trollhätte kanal. Som helhet innebär Vänergalesen ett brott med tidigare byggtradition vid den stora transportzonen vid Vänern."},{"page_url":"https://no.wikipedia.org/wiki/Gonzalo_Higua%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Higua%C3%ADn_20180626.jpg","page_title":"Gonzalo Higuaín","context_page_description":"Gonzalo Gerardo Higuain er en argentinsk-fransk fotballspiller som spiller for den italienske klubben Juventus."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A7%E0%B5%82%E0%B4%AE%E0%B4%95%E0%B5%87%E0%B4%A4%E0%B5%81%E0%B4%B5%E0%B4%BF%E0%B4%A8%E0%B5%8D%E0%B4%B1%E0%B5%86_%E0%B4%B5%E0%B4%BE%E0%B5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Iss030e015472_Edit.jpg","page_title":"ധൂമകേതുവിന്റെ വാൽ","context_page_description":"ധൂമകേതുവിന്റെ വാൽ, കോമ എന്നിവ സുര്യനടുത്തുകൂടി പോകുമ്പോൾ സൂര്യൻ ധൂമകേതുവിനെ പ്രകാശം നൽകി തിളക്കമുള്ളതാക്കുന്നു. ആന്തര സൗരയൂഥത്തിലൂടെ ധൂമകേതു സഞ്ചരിക്കുമ്പോൾ അതിനെ ഇങ്ങനെ സൂര്യപ്രകാശത്താൽ തിളങ്ങി ഭൂമിയിൽനിന്നും കാണുമാറാകുന്നു. ആന്തര സൗരയൂഥത്തെ ഒരു ധൂമകേതു സമീപിക്കുമ്പോൾ സൂര്യകിരണങ്ങൾ ധൂമകേതുവിന്റെ ഉള്ളിലുള്ള, എളുപ്പം ആവിയാക്കപ്പെടാൻ ഇടയുള്ള വസ്തുക്കൾ ആവിയാക്കപ്പെടുകയും അതിന്റെ ന്യൂക്ലിയസിൽ നിന്നും പുറത്തുവരുകയും, അതിനകത്തുള്ള പൊടിപടലങ്ങൾ ഇതിനോടുകൂടി ബഹിർഗമിക്കുകയും ചെയ്യുന്നു. പൊടിപടലങ്ങളും വാതകങ്ങളുമായി പ്രത്യേകം വാലുകൾ വ്യത്യസ്ത പ്രതിഭാസങ്ങളാൽ ഉണ്ടാകുന്നു. പൊടിപടലങ്ങൾ സൂര്യപ്രകാശം നേരിട്ട് പ്രതിഫലിപ്പിക്കുന്നു. വാതകങ്ങൾ അയണീകരണം മൂലം തിളങ്ങുന്നു. മങ്ങിയ മിക്ക ധൂമകേതുക്കളേയും ദൂരദർശിനികൾ ഇല്ലാതെ കാണാൻ കഴിയില്ല. ഓരോ പത്തു വർഷം കൂടുമ്പോഴെങ്കിലും നഗ്നനേത്രങ്ങൾകൊണ്ടു കാണാനാവുംവിധം തീക്ഷ്ണമായ പ്രകാശമുള്ളവയായിരിക്കും."},{"page_url":"https://es.wikipedia.org/wiki/Galliate_Lombardo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Map_of_comune_of_Galliate_Lombardo_%28province_of_Varese%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Galliate Lombardo","context_page_description":"Galliate Lombardo es una localidad y comune italiana de la provincia de Varese, región de Lombardía, con 955 habitantes."},{"page_url":"https://nl.wikipedia.org/wiki/Onze-Lieve-Vrouw_van_Goede_Raadkerk_(Den_Haag)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/GoedeRaadKerkDenHaag1.JPG","page_title":"Onze-Lieve-Vrouw van Goede Raadkerk (Den Haag)","context_page_description":"De Onze-Lieve-Vrouw van Goede Raadkerk, of kortweg de Goede Raadkerk is een rooms-katholiek kerkgebouw aan de Bezuidenhoutseweg in de Haagse wijk Bezuidenhout. De kerk is gewijd aan Onze Lieve Vrouw van Goede Raad. Tegenwoordig wordt de kerk gebruikt door de Engelstalige katholieke parochie Church of Our Saviour."},{"page_url":"https://pl.wikipedia.org/wiki/East_Indiaman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/The_Mellish_in_Sydney_Harbour.jpg","page_title":"East Indiaman","context_page_description":"East Indiaman - duży, uzbrojony statek handlowy o napędzie żaglowym, zdolny do dalekich, samodzielnych podróży do Indii, Chin lub Indii Holenderskich. Używany głównie przez floty handlowe Brytyjskiej Kompanii Wschodnioindyjskiej oraz Holenderskiej Kompanii Wschodnioindyjskiej od początku XVII wieku do lat trzydziestych XIX wieku.\\nNazwa East Indiaman wywodzi się od angielskiego terminu oznaczającego okręt wojenny: Man of War. W tym przypadku oznaczało to, że statek handlowy w służbie Kompanii Wschodnioindyjskiej był jednocześnie okrętem wojennym.\\nZa pierwszy statki tego typu uważa się wodowany uroczyście w obecności króla Jakuba I w Depford w roku 1610 \\"Trade's Increase\\" o wyporności 1293 ton. Był to największy statek, jaki do tej pory zbudowano w Anglii. Wkrótce też powstał drugi podobny statek \\"Peppercorn\\". Chociaż Kompania Wschodnioindyjska zaprzestała wkrótce budowy statków we własnej stoczni, a zaczęła je dzierżawić od prywatnych właścicieli, wszystkie statki musiały spełniać wymagania techniczne stawiane przez Dyrekcję Kompanii. Były to duże, zwykle trzymasztowe, silnie uzbrojone statki zdolne do odbycia 6-8 podróży na Wschód i z powrotem."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_gesch%C3%BCtzten_Landschaftsteile_im_Bezirk_S%C3%BCdoststeiermark","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/GLT_293_Gr%C3%A4berfeld_H%C3%BCgelstaudach.jpg","page_title":"Liste der geschützten Landschaftsteile im Bezirk Südoststeiermark","context_page_description":"Die Liste der geschützten Landschaftsteile im Bezirk Südoststeiermark enthält die geschützten Landschaftsteile im Bezirk Südoststeiermark."},{"page_url":"https://en.wikipedia.org/wiki/Native_Americans_in_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Flag_of_the_Paiute_Indian_Tribe_of_Utah.png","page_title":"Native Americans in Utah","context_page_description":"Indigenous peoples have lived in the area now known as the state of Utah for thousands of years. Today they are divided into five main groups: Utes, Goshutes, Paiutes, Shoshone, and Navajo. Each occupies a different region within the state, many of which regions extend across borders into other states. In the 2010 census, there were a total of 32,927 American Indian and Alaska Natives living within the state, which totaled to 1.19% of the total population of Utah."},{"page_url":"https://es.wikipedia.org/wiki/Jorge_Bonsor","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Castillo_de_Luna.jpg","page_title":"Jorge Bonsor","context_page_description":"George Edward Bonsor fue un conocedor de antigüedades, pintor, arqueólogo, historiador y ceramólogo nacido en Francia, de nacionalidad británica y residente en España. También fue conocido como Jorge Bonsor por amigos y vecinos de las localidades andaluzas en las que vivió: Carmona, donde se inició como arqueólogo privado y donde fue nombrado hijo predilecto poco antes de su fallecimiento y Mairena del Alcor, donde adquirió el castillo de la localidad para habilitarlo posteriormente como su propia vivienda.\\nFue un gran defensor del mantenimiento de los yacimientos arqueológicos y precursor de la arqueología moderna en España, además de que descubrió numerosos yacimientos en Andalucía Occidental, como la necrópolis y el anfiteatro de Carmona, los yacimientos de Los Alcores, Setefilla en Lora del Río y excavó en Baelo Claudia en Cádiz. Escribió varias publicaciones relacionadas con sus descubrimientos y obtuvo nombramientos en varias instituciones académicas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BC%D0%B5%D1%80,_%D0%A3%D0%B8%D0%BD%D1%81%D0%BB%D0%BE%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Winslow_Homer_-_The_Fog_Warning_-_Google_Art_Project.jpg","page_title":"Хомер, Уинслоу","context_page_description":"Уинслоу Хомер — американский художник и график, основоположник американской реалистической живописи. Наиболее знаменит своими морскими пейзажами. Известен как своими работами маслом, так и акварелью. Большинство исследователей рассматривают Хомера как крупнейшую фигуру в американском искусстве XIX века, оказавшую влияние на всё последующее развитие американской живописи.\\nХомер принадлежал к первому поколению американских художников, создавших собственную американскую художественную школу. В то время как большинство его современников рассматривали европейское искусство в качестве идеала, Хомер, хотя и испытывал влияние самых разнообразных художественных течений, в своём творчестве прежде всего основывался на чисто американских сюжетах.\\nТворчество Хомера разделяется на два заметно отличающихся периода: до начала 1880-х годов, когда он живёт в основном в Нью-Йорке и в его живописи преобладают светлые солнечные пейзажи и сцены, и с середины 1880-х годов, в штате Мэн, после двухлетнего перерыва, который художник провёл в Англии. Для последнего периода больше характерны тёмные тона и сцены насилия и трагедии."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Kuntzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Map_commune_FR_insee_code_57372.png","page_title":"Kuntzig","context_page_description":"Kuntzig sī ūi-tī Hoat-kok Lorraine toā-khu Moselle koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Ofanto","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/PONTE_OFANTO.png","page_title":"Ofanto","context_page_description":"The Ofanto, known in ancient times as Aufidus or Canna, is a 170-kilometre river in southern Italy that flows through the regions of Campania, Basilicata, and Apulia, into the Gulf of Manfredonia near Barletta."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Wojciecha_w_Jele%C5%9Bni","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Jelesnia_Church_front.JPG","page_title":"Kościół św. Wojciecha w Jeleśni","context_page_description":"Kościół świętego Wojciecha w Jeleśni – barokowy kościół należący do parafii pod wezwaniem świętego Wojciecha w Jeleśni. Znajduje się w górnej części wsi, przy drodze głównej, prowadzącej na granicę polsko-słowacką w Korbielowie. Kościół o cechach pseudobazyliki: trzy nawy, nawa główna bez okien; orientowany. Budynek został wpisany do rejestru zabytków dnia 20 sierpnia 1986 roku. W zewnętrznej architekturze kościoła widoczne są wpływy słowackie.\\nKościół posiada wieżę kwadratową o dwóch kondygnacjach z uskokami i zaokrągleniami na narożnikach, zakończoną zwieńczeniem w postaci kopulastego hełmu. We wnęce ustawionej w stronę drogi głównej znajduje się Pieta; dawniej umieszczony był krucyfiks."},{"page_url":"https://en.wikipedia.org/wiki/Navicella_(mosaic)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Engraving_of_the_portico_of_Old_St._Peter%27s_Basilica.jpg","page_title":"Navicella (mosaic)","context_page_description":"The Navicella or Bark of St. Peter, of Old Saint Peter's Basilica in Rome, was a large and famous mosaic by Giotto di Bondone that occupied a large part of the wall above the entrance arcade, facing the main facade of the basilica across the courtyard. It depicted the version from the Gospel of Matthew of Christ walking on the water, the only one of the three gospel accounts where Saint Peter is summoned to join him. It was almost entirely destroyed during the construction of the new Saint Peter's Basilica in the 17th century, but fragments were preserved from the sides of the composition, and what is effectively a new work, incorporating some original fragments, was restored to a position at the centre of the portico of the new building in 1675.\\nThe mosaic, designed to be seen from a distance, was extremely large. A full-scale copy in oil, commissioned by the Vatican from Francesco Berretta in 1628, after much of the work had already been lost round the edges, measures 7.4 by 9.9 metres. The full mosaic was probably about 9.4 by 13 metres, with an inscription in Latin verse running below the image."},{"page_url":"https://fr.wikipedia.org/wiki/Fran_Kirby","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Fran_Kirby_Lewes_FC_Women_1_Chelsea_Women_2_Conti_Cup_02_11_2019-519_%2849006183211%29.jpg","page_title":"Fran Kirby","context_page_description":"Francesca Kirby, connue sous le nom de Fran Kirby, est une footballeuse internationale anglaise née le 29 juin 1993 à Reading. Elle joue au poste d'attaquante avec le club de Chelsea et l'équipe d'Angleterre féminine."},{"page_url":"https://sl.wikipedia.org/wiki/Abigail_Breslin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Abigail_Breslin.jpg","page_title":"Abigail Breslin","context_page_description":"Abigail Kathleen Breslin, ameriška gledališka, filmska in televizijka igralka, * 14. april 1996, New York, New York, Združene države Amerike.\\nAbigail Breslin je ena izmed najmlajših igralk, kar jih je bilo kdaj nominiranih za oskarja. Pri komaj treh letih je pričela igrati v reklamah in pri petih je posnela svoj filmski prvenec, Znamenja. Nato je zaigrala v filmih, kot so Naša mala mis, Otok male Nim, Definitely, Maybe, My Sister's Keeper, Dobrodošli v deželi zombijev in Rango."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_d%27al-Andalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/P%C3%A9ninsule_ib%C3%A9rique_en_929.png","page_title":"Histoire d'al-Andalus","context_page_description":"L'histoire d'al-Andalus recouvre les événements survenus au Moyen Âge, notamment entre 711 et 1492, sur l'ensemble des terres de la péninsule Ibérique sous domination musulmane."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_L%C3%BCbben_(Spreewald)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Lubolzer_Hauptstra%C3%9Fe_61_L%C3%BCbben.jpg","page_title":"Liste der Baudenkmale in Lübben (Spreewald)","context_page_description":"Die Liste der Baudenkmale in Lübben (Spreewald) enthält alle Baudenkmale der brandenburgischen Gemeinde Lübben (Spreewald) und ihrer Ortsteile. Grundlage ist die Landesdenkmalliste mit Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Lübben (Spreewald) aufgeführt."},{"page_url":"https://it.wikipedia.org/wiki/Ferrovia_Bolzano-Caldaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bolzano-Caldaro_railway_postage_stamp.jpg","page_title":"Ferrovia Bolzano-Caldaro","context_page_description":"La ferrovia Bolzano-Caldaro, nota anche come ferrovia elettrica transatesina era una linea ferroviaria a scartamento normale che collegava la città di Bolzano con il comune di Caldaro, in provincia autonoma di Bolzano, attraversando il territorio dell'Oltradige.\\nEntrata in esercizio nel 1898, era servita da traffico passeggeri fino al 1963 e da convogli merci fino al 1971, anno in cui venne chiusa e successivamente disarmata.\\nLa tratta era conosciuta localmente con i soprannomi tedeschi Kaltererbahnl e Lepsbahnl, nonché in italiano come \\"vacca di Caldaro\\"."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_aeronaves_de_Santos-Dumont","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Dummont_barca.jpg","page_title":"Lista de aeronaves de Santos-Dumont","context_page_description":"Ao longo de sua carreira, o pioneiro da aviação Alberto Santos-Dumont projetou, construiu, e demonstrou uma variedade de aeronaves — balões, dirigíveis, monoplanos, biplanos, e um helicóptero."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B6%E0%B2%BF%E0%B2%AF%E0%B3%8B%E0%B2%AE%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Xiaomi_Mi4.jpg","page_title":"ಶಿಯೋಮಿ","context_page_description":"ಶಿಯೋಮಿ ಕಂಪನಿಯು ಚೀನಾ ದೇಶದ ಖಾಸಗಿ ಸ್ವಾಮ್ಯದ ಚೀನಾದ ಸ್ಮಾರ್ಟ್ ಪೋನ್ ತಯಾರಿಕೆ ಕಂಪನಿಯಾಗಿದೆ.ಶಿಯೋಮಿ ಕಂಪನಿಯನ್ನು ಮಿ ರೆಡಮಿ ಎಂದುಸಂಬೋದಿಸಲಾಗುತ್ತದೆ.ಆದರೆ ಪ್ರಚಲಿತ ವಿದ್ಯಮಾನದಲ್ಲಿ ಶಿಯೋಮಿ ರೆಡಮಿ ಯನ್ನು ತನ್ನ ಪ್ರತ್ಯೇಕ ಅಂಗಸಂಸ್ಥೆಯನ್ನಾಗಿ ಮಾರ್ಪಡಿಸಿದೆ. ಈ ಶಿಯೋಮಿ ಸಂಸ್ಥೆ ಬೀಜಿಂಗ್ನಲ್ಲಿ ತನ್ನ ಪ್ರಧಾನ ಕಚೇರಿಯನ್ನು ಹೊಂದಿದೆ. ಲೀ ಜುನ್ ಇದರ ಸಂಸ್ಥಾಪಕರು. ಶಿಯೋಮಿ ಕೇವಲ ಸ್ಮಾರ್ಟ್ ಫೋನ್ ಮಾತ್ರವಲ್ಲದೆ ಟಿವಿ, ಮೊಬೈಲ್ ಪರಿಕರಗಳು, ಬ್ಯಾಗ್, ಕನ್ನಡಕ, ಹೀಗೆ ಸಾವಿರಾರು ಉತ್ಪನಗಳನ್ನ ಚೀನಾದಲ್ಲಿ ಉತ್ಪಾದಿಸುತ್ತದೆ. ಆದರೆ ಆಯ್ದ ಕೇಲವೆ ಉತ್ಪನಗಳನ್ನು ಮಾತ್ರ ಭಾರತದಲ್ಲಿ ಮಾರಾಟ ಮಾಡುತ್ತಿದೆ. ಶೀಯೊಮಿ 2018 ರಲ್ಲಿ ಪ್ರಪಂಚದ 4 ನೇ ಅತಿ ದೊಡ್ಡ ಸ್ಮಾರ್ಟ್ಫೋನ್ ತಯಾರಕ ಕಂಪನಿಯಾಗಿದ್ದು ಶೇಕಡಾ 8% ಮಾರುಕಟ್ಟೆಯ ಪಾಲುದಾರಿಕೆಯನ್ನು ಹೊಂದಿದ್ದು 2018ನೆ ವರ್ಷದಲ್ಲಿ ಶೇಕಡಾ ೨೬% ಅಭಿವೃದ್ಧಿ ಹೂಂದಿದೆ. ಅದೇ ಭಾರತದಲ್ಲಿ ಸ್ಯಾಮ್ಸಂಗ್ ಕಂಪನಿಯನ್ನು ಹಿಂದಿಕ್ಕಿ ಭಾರತದ ನಂ.1 ಸ್ಮಾರ್ಟ್ ಫೋನ್ ಕಂಪನಿಯಾಗಿ ಮುಂದುವರಿದಿದೆ ಭಾರತದ ಸ್ಮಾರ್ಟ್ ಫೋನ್ ಮಾರುಕಟ್ಟೆಯಲ್ಲಿ ಶೀಯೊಮಿ ಶೇಕಡಾ 26% ಪಾಲನ್ನು ಹೊಂದಿದೆ. ಚೀನಾದಲ್ಲಿ ತಯಾರಾದ ತನ್ನ ಉತ್ಪನಗಳನ್ನು ಭಾರತದಲ್ಲಿ ಜೋಡಿಸುವ ಕಾರ್ಯವನ್ನು ಕೈಗೊಂಡಿದ್ದು ಆಂಧ್ರಪ್ರದೇಶ ದಿಲ್ಲಿ ಇಂತಹ ಒಂದು ಜೋಡಣೆ ಕೇಂದ್ರವಿದ್ದು, ತನ್ನ ಉತ್ಪನಗಳ ಮಾರಾಟಕ್ಕಾಗಿ ಶೀಯೋಮಿ ಕೇವಲ ಆನ್ಲೈನ್ ಮತ್ತು ತನ್ನದೆ ಸ್ಟೋರ್ ಗೋಳನ್ನು ಮತ್ತು ದುರಸ್ತಿ ಕೇಂದ್ರವನ್ನು ತೆರೆದು ಉತ್ತಮ ಸೇವೆಯನ್ನು ನೀಡುವುದರ ಮೂಲಕ ಭಾರತದ ಗ್ರಾಹಕರ ಮನೆ ಗೆದ್ದಿದೆ."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%AD%E3%81%84%E5%9C%B0%E5%90%8D%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Comunne_Y_picardhiv68.jpg","page_title":"短い地名の一覧","context_page_description":"短い地名の一覧\\nここでは、ラテン文字、ないし、仮名表記したときに、文字数が少ない、短い地名の例を、以下の原則により列挙する。\\n日本語版、または、いずれかの言語版に記事が存在する地名を採録の対象とし、他言語版の同様の一覧に含まれていても記事へのリンクがないものは含まない。\\n別称や、現在は使われていない過去の地名でも、独立した記事、ないし、独立した記事への転送が存在するものは採録する。\\n中国などの歴史上の国名などは、現在における地域名称としての記事が存在するものだけを収録する。\\n伝説上の都市名などは、遺跡等の裏付けがあり、考古学的証拠に基づいた当該地の比定がなされているものは収録する。\\nアルファベット表記の1文字、および、2文字の地名については、「山」、「川」、「市」などに相当する単語を含まずに字数を数える。ただし、中国語、朝鮮語などの地名に見える「州」は名称の一部とみなした。"},{"page_url":"https://pl.wikipedia.org/wiki/Thivet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Thivet_Carte_postale_10.jpg","page_title":"Thivet","context_page_description":"Thivet – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Górna Marna.\\nWedług danych na rok 1990 gminę zamieszkiwało 295 osób, a gęstość zaludnienia wynosiła 19 osób/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Cariniana","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Jequitiba_de_1500_anoscarangola.jpg","page_title":"Cariniana","context_page_description":"Cariniana är ett släkte av tvåhjärtbladiga växter. Cariniana ingår i familjen Lecythidaceae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/William_Jackson_Hooker","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Curtis%27s_botanical_magazine_%28Plate_3088%29_%288410403017%29.jpg","page_title":"William Jackson Hooker","context_page_description":"Sir William Jackson Hooker KH FRS FRSE FLS was an English botanist and botanical illustrator. The standard author abbreviation Hook. is used to indicate this person as the author when citing a botanical name.\\nBorn and educated in Norwich, an inheritance gave him the means to travel and to devote himself to the study of natural history, particularly botany. He published his account of an expedition to Iceland in 1809, but only after his notes and specimens were destroyed during his voyage home. He married Maria, the eldest daughter of the Norfolk banker Dawson Turner, in 1815, afterwards living in Halesworth for eleven years, where he established a herbarium that was renowned amongst botanists at the time.\\nHe held the post of Regius Professor of Botany at Glasgow University, where he worked with the botanist and lithographer Thomas Hopkirk. Hooker enjoyed the friendship and support of Sir Joseph Banks for his exploring, collecting and organising work. in 1841 he succeeded William Townsend Aiton as Director of the Royal Botanic Gardens, Kew."},{"page_url":"https://it.wikipedia.org/wiki/Sigesbeckia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/4270-Sigesbeckia_serrata.jpg","page_title":"Sigesbeckia","context_page_description":"Sigesbeckia è un genere di piante arbustive annuali appartenente alla famiglia Asteraceae."},{"page_url":"https://be.wikipedia.org/wiki/Liza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Mullet_2008_G1.jpg","page_title":"Liza","context_page_description":"Liza — найбуйнейшы з 17 вядомых родаў рыб сямейства Кефалевыя."},{"page_url":"https://es.wikipedia.org/wiki/Sendero_del_Priorato_GR-174","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Albarca2.jpg","page_title":"Sendero del Priorato GR-174","context_page_description":"El sendero del Priorato, conocido como GR-174 en la clasificación de los senderos de Gran Recorrido o senderos GR, en un sendero que discurre por la comarca del Priorato, en Cataluña, entre viñedos. Empieza en el coll de la Teixeta, entre el Bajo Campo y el Priorato, a 546 m, y termina en Albarca, en el parque natural de la Sierra del Montsant, a 815 m.​\\nEl Priorato es una comarca muy montañosa, que se extiende entre la sierra de la Llena, al norte, de origen sedimentario, y la cordillera costero-catalana, al sur, calcárea. Ambas tienen un origen geológico reciente cuyas formas están modeladas únicamente por la erosión. Sin embargo, con estas excepciones, la mayor parte del Priorato tiene origen paleozóico, de cientos de millones de años modelados por la climatología. La tierra cultivable está formada por pizarra descompuesta conocida como llicorella en catalán. El GR-174, antes conocido como GR 7-4, une el GR-7 y su variante el GR 7-1, pasando por todos los pueblos del Priorato por lo que no pasa el GR-7.​"},{"page_url":"https://de.wikipedia.org/wiki/JGR-Klasse_7000","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Fahrwerk_ESS_3000.svg","page_title":"JGR-Klasse 7000","context_page_description":"Die Klasse 7000, ab 1928 als ED54 bezeichnet, war eine Schnellzuglokomotive der Japanese Government Railways mit Buchli-Antrieb. Die beiden Lokomotiven dieser Baureihe waren nur gut zwanzig Jahre im Einsatz, weil die Bahn mit der Wartung der Antriebe, die nur bei diesen beiden Lokomotiven angewandt wurden, nicht zurechtkam."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%9A%D0%BB%D0%B0%D1%80%D0%BA_%D0%A0%D0%BE%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/James_Ross_ESP.svg","page_title":"Джеймс Кларк Рос","context_page_description":"Сър Джеймс Кларк Рос е английски военноморски офицер, пътешественик-изследовател, контраадмирал. Участва в 11 полярни експедиции, от които осем в Арктика и три в Антарктика. Открива море Рос и Земя Виктория на Антарктида."},{"page_url":"https://pl.wikipedia.org/wiki/Ettrick_(zatoka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Ettrick_Bary%2C_Bute_%28269960308%29.jpg","page_title":"Ettrick (zatoka)","context_page_description":"Zatoka Ettrick – niewielka zatoka w zachodniej części wyspy Bute w szkockim regionie Argyll and Bute. Ettrick znana jest z piaszczystej plaży o długości około 1,7 km i szerokości od 0 do 500 m. Najbliższym miastem jest Rothesay.\\nNieco w głębi lądu znajduje się formacja ośmiu kamieni zwana Ettrick Bay Stone Circle. Na południe od zatoki można napotkać rzadkie gatunki ptaków wodnych. Na północnym krańcu Ettrick znajduje się restauracja Ettrick Bay Tearoom.\\nW latach 1902–36 Ettrick połączona byłą z Rothesay oraz Port Bannatyne elektryczną linią tramwajową.\\nDodatkową atrakcję zatoki stanowił znajdujący się w płytkiej wodzie wrak statku. Uszkodzony jednak przez sztorm, został ostatecznie rozebrany"},{"page_url":"https://fr.wikipedia.org/wiki/Chercheur","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Biotechnology_lab.jpg","page_title":"Chercheur","context_page_description":"Un chercheur ou une chercheuse désigne une personne dont le métier consiste à faire de la recherche scientifique. Il est difficile de bien cerner le métier de chercheur tant les domaines de recherche sont diversifiés et impliquent d'importantes différences dans la pratique de ce travail\\nLe manuel de Frascati, édité par l'OCDE, le définit ainsi : « Spécialiste travaillant à la conception ou à la création de connaissances, de produits, de procédés, de méthodes et de systèmes nouveaux et à la gestion des projets concernés ». Longtemps lié à la condition de professeur d'université et réservé à l'élite intellectuelle dans le monde occidental, le métier de chercheur à part entière s'est institutionnalisé avec la création d'organismes dont la vocation première était l'avancement de la science."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BA%AA%E5%B9%B3%E6%A2%A8%E8%8A%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Rika_Kihira-GPFrance_2018-Gala-IMG_7213_%28cropped%29.JPG","page_title":"纪平梨花","context_page_description":"紀平梨花生於兵庫縣西宮市，是一名日本女子花式滑冰運動員。她第一次接觸滑冰是在3歲的時候，當時她隨母親和姐姐一同來到滑冰場，5歲時，她開始練習滑冰。她在2016–17賽季首度在青少年花式滑冰大獎賽中亮相。2018年，她進入通信制高中N高等學校就讀。之後她在2018–19賽季完成自己的成年組首秀，她在該賽季大獎賽的NHK杯、法國賽以及總決賽和四大洲錦標賽均奪得冠軍，成為2022年北京冬奧周期日本花滑界最受期待的女選手。"},{"page_url":"https://en.wikipedia.org/wiki/Moje_Menhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Harpyen%2C_Zyklus_FABELWESEN_nach_J.L.Borges.jpg","page_title":"Moje Menhardt","context_page_description":"Moje Menhardt is an Austrian painter."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D1%80%D1%8D%D0%B9%D0%BF%D1%84%D1%80%D1%83%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Starr_071024-0114_Citrus_x_paradisi.jpg","page_title":"Грэйпфрут","context_page_description":"Грэйпфрут — субтрапічнае вечназялёнае дрэва роду цытрус сямейства рутавых, а таксама яго плод, які дасягае ў дыяметры 10-15 см.\\nПершым грэйпфрут апісаў батанік-святар Грыфітс Х'юджас ў 1750-м годзе. Ён назваў садавіну «забароненым плодам», пазней грэйпфрут пачалі называць «маленькім шэдакам» з-за яго падабенства з памела, якое тады называлі шэдакам, а ў 1814-м годзе на Ямайцы гандляры перайменавалі плод у грэйпфрут. Пасля 1880 пачаўся хуткі рост прамысловай вытворчасці гэтай культуры ў ЗША, затым у краінах Карыбскага басейна, Бразіліі, Ізраілі і Паўднёва-Афрыканскай Рэспубліцы, а ў XX стагоддзі грэйпфрут заняў вядучае месца на сусветным фруктовым рынку.\\nВонкава грэйпфрут падобны да ​​апельсіна, але мякаць яго кіслейшая, з прысмакам горычы. Грэйпфрут з'яўляецца, як мяркуецца, вынікам прыроднай гібрыдызацыі апельсіна і памела. Пры гэтым ён значна бліжэй да другога, чым да першага. Пасля на яго аснове былі створаны танжэла і мінеола."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%9E%E5%A5%88%E5%B7%9D%E7%9C%8C%E3%81%AE%E5%B1%B1%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Kegonyama.JPG","page_title":"神奈川県の山一覧","context_page_description":"神奈川県の山一覧とは、神奈川県にある山を一覧にしたものである。県境にある山も含む。\\n神奈川県で一番高い山は、標高1,673mの蛭ヶ岳である。"},{"page_url":"https://pt.wikipedia.org/wiki/Holacanthus_passer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Holacanthus_passer_3.jpg","page_title":"Holacanthus passer","context_page_description":"O peixe-anjo rei ou peixe-anjo passer é uma espécie de peixe da família pomacanthidae do gênero Holacanthus."},{"page_url":"https://de.wikipedia.org/wiki/FS_E.402A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Electric_locomotive_at_Milano_C_%28507528380%29.jpg","page_title":"FS E.402A","context_page_description":"Die E.402A ist eine Elektrolokomotivbaureihe der italienischen Staatsbahnen Ferrovie dello Stato, von der zwischen 1994 und 1996 insgesamt 45 Fahrzeuge gebaut wurden."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%B2%D0%BA%D1%91%D1%80-%D0%BB%D0%B5-%D0%93%D1%80%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Cr%C3%A8vecoeur_HDV.jpg","page_title":"Кревкёр-ле-Гран","context_page_description":"Кревкёр-ле-Гран — город на севере Франции, в департаменте Уаза. Находится в регионе О-де-Франс, округ Бове, кантон Сен-Жю-ан-Шоссе, в 38 км к юго-западу от Амьена и в 21 км к северу от Бове, в 9 км от автомагистрали А16 \\"Европейская\\".\\nНаселение — 3 538 человек."},{"page_url":"https://pt.wikipedia.org/wiki/Manuel_de_Santa_In%C3%AAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Frei_Manuel_Santa_Ines_Portugal.jpg","page_title":"Manuel de Santa Inês","context_page_description":"Frei Manuel de Santa Inês Eclesiástico português, Bispo do Porto.\\nEra filho de lavradores de Rio Tinto. Aos dezoito anos, entrou para o Colégio dos Grilos ou Mosteiro dos Religiosos Ermitas Descalços de Santo Agostinho, onde professou em 1781, adoptando então o nome de Frei Manuel de Santa Inês.\\nOcupou diversos cargos eclesiásticos incluindo o de Bispo do Porto, mas o titulo não lhe foi confirmado pelo Papa.\\nFoi um liberal convicto.\\nMorreu em 1840, aos 78 anos de idade, tendo sido sepultado no Cemitério da Lapa, no Porto."},{"page_url":"https://az.wikipedia.org/wiki/Altsek_xan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bulgarian_khan_Alcek_monument_in_Celle_di_Bulgheria_-_Italy.jpg","page_title":"Altsek xan","context_page_description":"Altsek xan — Bulqar şahzadəsi, Kubrat xanın ən kiçik oğlu. 631-ci ildə qardaşı Batbayan xandan ayrılaraq Avar xaqanlığına sığınmışdı. Lakin burada çox qala bilməyərək üsyan etmiş və xaqanın qəzəbinə uğramışdır. Bundan sonra Bavariyaya gedən və I Daqobertdən sığınacaq tələb edən şahzadə xəyanətə uğradı və bu dəfə İtaliyaya köçməyə məcbur oldu. 9000 qəbilə üzvündən 800ü sağ qalmışdı. Lombard kralı I Qrimoald tərəfindən ona \\"qastald\\" titulu verilərək cənubi İtaliyadakı Sepino, Boyano, İserniya şəhərləri onun sərəncanıma verildi."},{"page_url":"https://es.wikipedia.org/wiki/J%C3%B3dar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Bandera_J%C3%B3dar.svg","page_title":"Jódar","context_page_description":"Jódar es un municipio español situado en el centro-sur en la provincia de Jaén, comunidad autónoma de Andalucía, a 647 metros de altitud en la falda del cerro de San Cristóbal, dentro de la Serrezuela, una estribación al norte del macizo de Sierra Mágina. Posee una ubicación privilegiada, en el centro de la mitad meridional de la provincia, a un paso de las ciudades Patrimonio de la Humanidad, Úbeda y Baeza; así como del parque natural de Sierra Mágina y el parque natural de Cazorla, Segura y las Villas, declarado este último Reserva de la Biosfera por la UNESCO.\\nJódar, es el municipio más poblado de la comarca de Sierra Mágina y cabecera de la misma. Por su situación al noroeste de la comarca, es puerta de entrada a la comarca de Sierra Mágina límitrofe con la provincia de Granada al sur. Su término municipal posee una extensión de 149,33 kilómetros cuadrados y está bañado por los ríos Guadalquivir, Jandulilla y Arroyo de la Condesa."},{"page_url":"https://ceb.wikipedia.org/wiki/Salgar_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Cadenas_monta%C3%B1osas_que_rodean_al_municipio_de_Salgar.jpg","page_title":"Salgar (munisipyo)","context_page_description":"Munisipyo ang Salgar sa Kolombiya. Nahimutang ni sa departamento sa Departamento de Antioquia, sa amihanan-kasadpang bahin sa nasod, 260 km sa amihanan-kasadpan sa Bogotá ang ulohan sa nasod. Adunay 18,206 ka molupyo. Naglangkob kin og 423 ka kilometro kwadrado.\\nAng yuta sa Salgar kay kabukiran sa sidlakan, apan sa kasadpan nga kini mao ang kabungtoran.\\nAng kasarangang giiniton 18 °C. Ang kinainitan nga bulan Pebrero, sa 20 °C, ug ang kinabugnawan Nobiyembre, sa 16 °C. Ang kasarangang pag-ulan 2,868 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 350 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 101 milimetro."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80%D1%96%D0%BE_%D0%A3%D0%BD%D0%B0%D0%BC%D1%83%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Athletic_1931_%28Unamuno%29.jpg","page_title":"Вікторіо Унамуно","context_page_description":"Вікторіо Унамуно Ібарсабаль — іспанський футболіст, що грав на позиції нападника, флангового півзахисника.\\nВиступав, зокрема, за клуби «Атлетік» та «Реал Бетіс».\\nТриразовий чемпіон Іспанії. Чотириразовий володар Кубка Іспанії з футболу."},{"page_url":"https://ca.wikipedia.org/wiki/Gran_Idea","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Map_Greece_expansion_1832-1947-fr.svg","page_title":"Gran Idea","context_page_description":"La Gran Idea ha estat l'expressió del sentiment nacionalista grec durant els segles XIX i XX. Era un concepte d'irredemptista que aspirava a unir tots els grecs dins d'un sol estat-nació amb capital a Constantinoble, per tal com una gran part de les poblacions gregues havien quedat sota l'Imperi Otomà després de la independència del nou estat grec el 1832.\\nEl terme va ser inventat a 1844 per Ioannis Koletis, primer ministre del rei Otó I de Grècia, durant els debats que van portar a la promulgació de la Constitució de 1844. Tot i que l'expressió era nova el 1844, el concepte ja era present en la tradició popular grega, nodrida de profecies i oracles que havien mantingut vives les esperances d'un eventual alliberament del poder turc Com deia la dita popular:\\nLa \\"Gran Idea\\" ha dominat la política exterior i la interior de l'estat grec modern: des de la Guerra d'independència de Grècia de 1820 i fins al problema de Xipre de 1970, tot passant per les Guerres Balcàniques a principis del segle 20, la derrota grega a la Guerra grecoturca que va seguir la Primera Guerra Mundial, i el posterior intercanvi de poblacions entre Grècia i Turquia."},{"page_url":"https://eo.wikipedia.org/wiki/Pre%C4%9Dejo_Sanktaj_Petro_kaj_Pa%C5%ADlo_(Szeny%C3%A9r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Szeny%C3%A9r_l%C3%A9gifot%C3%B3.jpg","page_title":"Preĝejo Sanktaj Petro kaj Paŭlo (Szenyér)","context_page_description":"La preĝejo Sankta Petro kaj Sankta Paŭlo estas romkatolika monumento historia en vilaĝo Szenyér."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_plus_anciennes_%C3%A9glises_des_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Mission_San_Diego_de_Alcal%C3%A1_-_church.jpg","page_title":"Liste des plus anciennes églises des États-Unis","context_page_description":"La classification de la plus ancienne église des États-unis doit être divisée en deux parties, la plus ancienne dans le sens du plus ancien édifice, et la plus ancienne dans le sens de la plus ancienne communauté.\\nCet article traite des églises au sens d'edifices. On peut distinguer entre les églises qui ont été utilisées en continu comme telles, et celles qui ont été converties à d'autres fins.\\nEn outre, le territoire des États-Unis a changé de définition au cours de son histoire : certaines de ces églises sont situées dans des zones des treize colonies d'origine qui forment les États-Unis en 1776. D'autres ont été construites dans les États et territoires qui ont été annexés plus tard, comme le Nouveau-Mexique et à Porto Rico."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BD%D0%B0_%D0%A1%D0%B0%D0%B1%D0%B8%D1%81%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/SamberMerbesleCh%C3%A2teau.jpg","page_title":"Битва на Сабисе","context_page_description":"Битва на Сабисе — сражение между племенами белгов под предводительством Бодуогната и восемью римскими легионами Юлия Цезаря, произошедшее в 57 году до н. э. на реке Сабис."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%A1%D0%B0%D0%BC%D0%B0%D1%80%D0%BA%D0%B0%D0%BD%D0%B4%D0%B0_%C2%AB%D0%90%D1%84%D1%80%D0%B0%D1%81%D0%B8%D0%B0%D0%B1%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Afrasiyab_museum_preislamic_object_7_ossuary_with_imprints_of_man%27s_head_%28Samarkand%2C_V-VII_centuries%29.JPG","page_title":"Музей истории Самарканда «Афрасиаб»","context_page_description":"Музей истории Самарка́нда «Афрасиа́б» — музей, расположенный в Самарканде. Посвящен истории города Самарканда и его окрестностей. Здание музея расположено в северо-восточной части города, возле древнего городища Афрасиаб, который является одним из крупнейших археологических памятников в мире.\\nЗдание музея было построено в честь 2500-летнего юбилея Самарканда по инициативе руководства Узбекистана, архитектором является Шмавон Азатян, 1970 год.\\nМузей рассказывает о истории основания города Самарканда, о его дальнейшей истории, рассказывает о городище Афрасиаб. В музее представлены различные экспонаты, в том числе найденные артефакты в ходе раскопок на территории Афрасиаба, Самарканда и их окрестностей. Среди них, остатки древних клинков, оссуарии, ножей и других режущих предметов, стрел, монет, керамики, древние рукописи и книги, статуэтки и другие древние повседневные предметы. Одним из примечательных экспонатов является уникальные сохранившиеся фрески самаркандского дворца, принадлежащего династии Ихшидов. В музее часть экспонатов связана с доисламской эпохой, частично связано с местным вариантом зороастризма, который был основной религией в Согде до прихода ислама."},{"page_url":"https://nn.wikipedia.org/wiki/Artos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/2013-08-14--Artoklasia_during_Feast_of_the_Dormition_of_the_Virgin_Mary.JPG","page_title":"Artos","context_page_description":"Artos er eit stykke heva brød som blir signa under gudstenesta i ortodoks og orientalsk katolsk kristendom.\\nTil påske blir det brukt ein stor artos med eit segl som syner oppståinga til Kristus. Mindre brød blir signa i eit rituale kalla artoklasia og i samband med andre høve som festdagar for helgenar, bryllaup, minnegudstenester og likande.\\nEtter signinga blir dei skorne opp og delte ut til kyrkjelyden."},{"page_url":"https://it.wikipedia.org/wiki/Mikulovice_(Vyso%C4%8Dina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Mikulovice_center.jpg","page_title":"Mikulovice (Vysočina)","context_page_description":"Mikulovice è un comune della Repubblica Ceca facente parte del distretto di Třebíč, nella regione di Vysočina."},{"page_url":"https://ro.wikipedia.org/wiki/Lactarius_quietus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Lactarius_quietus1.jpg","page_title":"Lactarius quietus","context_page_description":"Lactarius quietus din încrengătura Basidiomycota în familia Russulaceae și de genul Lactarius, este o specie de ciuperci comestibile de valoare culinară foarte scăzută, denumită în popor lăptuca ploșnițelor. Acest burete foarte răspândit de la câmpie la munte coabitează, fiind un simbiont micoriza. În România, Basarabia și Bucovina de Nord crește fără pretenție la sol în șiruri sau cercuri mari, în păduri de foioase, plantații forestiere și parcuri strict numai sub stejari. Timpul apariției este din iunie până în noiembrie.\\nEpitetul buretelui este derivat din cuvântul latin, fiind probabil numit astfel datorită suprafeței mate, „liniștite” și colorației puțin bătătoare la ochi."},{"page_url":"https://lv.wikipedia.org/wiki/%C5%BDabno","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Dom_kultury_zabno.jpg","page_title":"Žabno","context_page_description":"Žabno ir pilsēta Polijas dienvidos, Mazpolijas vojevodistē uz ziemeļiem no Tarnovas pie Dunajecas upes."},{"page_url":"https://lv.wikipedia.org/wiki/Papagai%C4%BCi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Parrot_range.png","page_title":"Papagaiļi","context_page_description":"Papagaiļi, papagaiļveidīgie ir viena no putnu klases kārtām, kas pieder papagaiļu un zvirbuļu virskārtai. Tā apvieno 398 putnu sugas, kas tiek iedalītas 4 dzimtās, bet tās savukārt 3 virsdzimtās. Papagaiļveidīgo putnu tuvākie radinieki ir zvirbuļveidīgie.\\nPapagaiļi, līdzīgi kā kraukļi, vārnas, sīļi un žagatas, ir vieni no inteliģentākajiem putniem pasaulē. Vairākas sugas spēj imitēt cilvēka balsi, tādēļ tās kļuvušas par populāriem mājas mīluļiem. Papagaiļi parasti dzīvo ilgāk nekā lielākā daļa citu dzīvnieku. Ir reģistrēts, ka papagailis nodzīvojis pat 82 gadus. Daudzu papagaiļu sugu izdzīvošana mūsdienās ir apdraudēta, tā kā tos gan medī, gan ķer dzīvus pārdošanai, gan izcērt mežus, iznīcinot to dzīves vidi."},{"page_url":"https://fr.wikipedia.org/wiki/Assassinat_d%27Abraham_Lincoln","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Johnwilkesboothgun.JPG","page_title":"Assassinat d'Abraham Lincoln","context_page_description":"L’assassinat d'Abraham Lincoln a eu lieu le 14 avril 1865 à Washington. Le seizième président des États-Unis, Abraham Lincoln, est tué par balle alors qu'il assiste à la représentation de la pièce de Tom Taylor, Our American Cousin, au théâtre Ford en compagnie de son épouse et de deux invités. L'assassin de Lincoln, l'acteur et sympathisant de la cause confédérée John Wilkes Booth, a recruté plusieurs complices, dont Lewis Powell et George Atzerodt, qu'il a chargé d'assassiner respectivement le secrétaire d'État William H. Seward et le vice-président Andrew Johnson. Par ce triple meurtre, Booth espère créer le chaos et renverser le gouvernement de l'Union. Malgré la mort de Lincoln, son complot échoue : Powell agresse Seward, mais ce dernier se remet de ses blessures, et Atzerodt, pris de panique, s'enfuit de Washington sans avoir vu Johnson.\\nLa chasse à l'homme est organisée par l'armée sitôt après l'attentat. Powell est arrêté le 17 avril et Atzerodt le 20. Booth et l'un de ses complices, David Herold, après avoir fui les lieux de leur forfait, se retrouvent dans le Maryland et parviennent à échapper à leurs poursuivants jusqu'au 26 avril."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%AB%D5%B6%D5%A3%D5%A1%D5%BA%D5%B8%D6%82%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/The_Esplanade_%E2%80%93_Theatres_on_the_Bay.jpg","page_title":"Սինգապուր","context_page_description":"Սինգապուր, պաշտոնապես\` Սինգապուրի Հանրապետություն, ինքնիշխան քաղաք-պետություն և կղզիներ Հարավ-Արևելյան Ասիայում։ Գտնվում է Մալայան թերակղզու ծայրամասում, նրանից անջատված է Ջոհորի նեղուցով: Հարավում սահմանակից է Ինդոնեզիայի Ռիաու կղզիներին, իսկ հյուսիսում\` Արևմտյան Մալայզիային: Սինգապուրի տարածքը կազմում են մեկ գլխավոր կղզին և 62 մանր կղզյակները: Անկախություն ձեռք բերելուց ի վեր հողի մելիորացման շնորհիվ կղզու տարածքը մեծացրել են 23 %-ով:\\nՍինգապուրն առևտրաֆինանսական ու տրանսպորտային համապարփակ հանգույց է: Արդի աշխարհի միակ կղզային քաղաք-պետությունն է։"},{"page_url":"https://ro.wikipedia.org/wiki/Cantonul_Marseille-Les_Cinq-Avenues","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Cantons_de_Marseille-Les_Cinq_Avenues.png","page_title":"Cantonul Marseille-Les Cinq-Avenues","context_page_description":"Cantonul Marseille-Les Cinq-Avenues este un canton din arondismentul Marseille, departamentul Bouches-du-Rhône, regiunea Provence-Alpes-Côte d'Azur, Franța."},{"page_url":"https://pl.wikipedia.org/wiki/Paw%C5%82owice_(Wroc%C5%82aw)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Wroc%C5%82aw_Paw%C5%82owice.png","page_title":"Pawłowice (Wrocław)","context_page_description":"Pawłowice – wrocławskie osiedle, będące jednostką pomocniczą gminy, na terenach dawnej dzielnicy Psie Pole.\\nW latach 1874–1945 Pawłowice administracyjnie wchodziły w skład Amtsbezirk Bischwitz, dystryktu-powiatu Biskupice Widawskie. W latach 1945–1954 wchodziły w skład gminy Skarszyn. Następnie funkcjonowały jako gromada.\\nOsiedle od północy graniczą z gminami Wisznia Mała i Długołęka, od południowego wschodu z Zakrzowem, a od południowego zachodu z Kłokoczycami. Komunikację zbiorową z innymi osiedlami zapewnia Miejskie Przedsiębiorstwo Komunikacyjne we Wrocławiu oraz przewoźnik Sevibus."},{"page_url":"https://en.wikipedia.org/wiki/Cuisine_of_Guinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Wooden_Pestle_and_Mortar.jpg","page_title":"Cuisine of Guinea","context_page_description":"Guinean cuisine includes the traditional dishes of fou fou, boiled mango, fried plantains, patates and pumpkin pie."},{"page_url":"https://en.wikipedia.org/wiki/Diviner_(album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Dreamtime_at_Fingal.jpg","page_title":"Diviner (album)","context_page_description":"Diviner is the debut studio album by English musician Hayden Thorpe. It was released on 24 May 2019 by Domino Recording Company.\\nDiviner is the first solo work from Thorpe since the dissolution of Wild Beasts, a band which Thorpe was a member of for over fifteen years. The album was written by Hayden Thorpe in Los Angeles, London, Kendal, and Cornwall. It was recorded over the course of 2018 with producer and close friend Leo Abrahams at Thorpe's London flat and at Abrahams' studio in Cornwall. The album's musical style is more stripped down compared to Thorpe's previous work. It was preceded by the singles \\"Diviner\\", \\"Love Crimes\\", and \\"Earthly Needs\\"."},{"page_url":"https://pl.wikipedia.org/wiki/Stara_%C5%81ubianka","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Stara_Lubianka_church.jpg","page_title":"Stara Łubianka","context_page_description":"Stara Łubianka – wieś w Polsce położona w województwie wielkopolskim, w powiecie pilskim, w gminie Szydłowo. Wieś jest siedzibą sołectwa „Stara Łubianka” w którego skład wchodzi również miejscowość Czaplino.\\nWieś królewska Łubianka należała do starostwa ujskiego, pod koniec XVI wieku leżała w powiecie poznańskim województwa poznańskiego. W latach 1946–54 siedziba gminy Stara Łubianka. W latach 1975–1998 miejscowość administracyjnie należała do województwa pilskiego.\\nStara Łubianka leży przy drodze Piła – Wałcz, 1 km na zachód od linii kolejowej Piła Główna – Ustka, 12 km na północny zachód od Piły.\\nWieś istniała już w XV w. Pierwsza wzmianka pochodzi z 1510 roku, należała wtedy do starostwa ujsko-pilskiego. W XVII i XVIII w. była siedzibą starosty ujsko-pilskiego. W 1627 r. zbudowano we wsi browar, przeniesiony następnie do Ujścia. W lipcu 1831 Prusacy przeprowadzili w miejscowym kościele rewizję, poszukując broni, ukrytej rzekomo dla żołnierzy powstania listopadowego.\\nKościół ufundowała królowa Konstancja w 1606 r. Obecny neogotycki budynek pochodzi z 1855 r. W 1641 r. istniała przy kościele szkoła. Na cmentarzu obejrzeć można nagrobki z polskimi napisami z początku XX w."},{"page_url":"https://nl.wikipedia.org/wiki/Sphinx_eremitoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Sphinx_ermitoides_sjh.JPG","page_title":"Sphinx eremitoides","context_page_description":"Sphinx eremitoides is een vlinder uit de familie van de pijlstaarten. De wetenschappelijke naam van de soort werd in 1874 gepubliceerd door Strecker."},{"page_url":"https://ceb.wikipedia.org/wiki/Copera_annulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Copera_annulata_%28male%29.JPG","page_title":"Copera annulata","context_page_description":"Espesye sa alindanaw nga una nga gihulagway ni Selys ni adtong 1863 ang Copera annulata. Ang Copera annulata sakop sa kahenera nga Copera sa kabanay nga Platycnemididae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E6%B5%B7%E6%96%B0%E5%AE%9D%E5%87%BA%E5%85%A5%E5%8F%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Tokai-Shimpo_EXIT_20150812A.JPG","page_title":"東海新宝出入口","context_page_description":"東海新宝出入口は、愛知県東海市新宝町にある名古屋高速4号東海線の出入口である。"},{"page_url":"https://nn.wikipedia.org/wiki/Marko_Perkovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Marko_Perkovic_Thompson_23082013_02_roberta_f.jpg","page_title":"Marko Perković","context_page_description":"Marko Perković er ein kroatisk songar."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/USSR-1991-comm-1ruble-CuNi-a.jpg","page_title":"Монеты СССР","context_page_description":"Монетами СССР являются все монеты, выпущенные Государственным банком СССР с момента его создания в 1923 году и до момента распада СССР в 1991 году и монеты РСФСР. За это время в результате проведения череды экономических реформ монеты несколько раз меняли внешний вид, состав номиналов, а также металл, из которого их чеканили.\\nВ СССР в регулярном обращении находились монеты достоинством в 1/2 копейки, в 1, 2, 3, 5, 10, 15, 20 и 50 копеек, а также монеты в 1 рубль, 5 рублей и 10 рублей. С 1960-х годах выпускались также памятные и юбилейные монеты различных номиналов."},{"page_url":"https://es.wikipedia.org/wiki/Ring_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Men_watching_road_work_on_Kabul-Kandahar_Highway_in_2003.jpg","page_title":"Ring Road","context_page_description":"La Ring Road es una carretera en construcción de un carril por sentido que circunvala todo Afganistán uniendo sus 32 provincias y capitales más importantes. El objetivo de esta vía asfaltada es lograr que el país, que carece de salida al mar, pueda explotar su ventaja geoestratégica como encrucijada en las relaciones comerciales entre Asia Central y Sudeste Asiático.\\nLa carretera, de unos 3.000 km de longitud, se inició en la década de los 60 del siglo XX con la ayuda de Estados Unidos, que financió el tramo entre Kabul y Kandahar. Tras la invasión soviética los rusos tomaron el relevo en su construcción. Desde entonces las sucesivas guerras y la falta de mantenimiento la degradaron enormemente.​\\nDesde el año 2000 se han invertido más de 3.000 millones de dólares para su reconstrucción, aportados fundamentalmente por el Banco Asiático de Desarrollo, Estados Unidos y China entre otros.​ En la actualidad el último tramo que queda por construir, de unos 251 km de longitud, se encuentra en la provincia de Badghis y une Laman, en el límite con la provincia de Herat, con Qaisar, en la provincia de Faryab."},{"page_url":"https://en.wikipedia.org/wiki/Johann_Dieter_Wassmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Schloss_Sanssouci%2C_Potsdam%2C_1896.jpg","page_title":"Johann Dieter Wassmann","context_page_description":"Johann Dieter Wassmann is a fictitious artist and sewerage engineer, purportedly from Leipzig, Saxony, in east-central Germany. He is the creation of the American-born artist and writer Jeff Wassmann. As a result of the widespread dissemination of his work, Johann Dieter Wassmann is sometimes mistakenly cited as a lesser-known figure among late-19th-century European artists; he is most often identified as an early purveyor of the Dada and Surrealist movements and has become closely associated with several notable artists of the first half of the 20th century, including Kurt Schwitters, Marcel Duchamp, Eugène Atget and Joseph Cornell."},{"page_url":"https://sv.wikipedia.org/wiki/Branden_i_Triangle_Shirtwaist-fabriken","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/TriangleTradeParade.jpg","page_title":"Branden i Triangle Shirtwaist-fabriken","context_page_description":"Branden i Triangle Shirtwaist-fabriken var en brand i New York den 25 mars 1911. 146 personer dog i branden, som kom att leda till förändringar i amerikansk arbetsmiljölagstiftning, brandsäkerhet och ökat engagemang i fackföreningar.\\nThe Triangle Shirtwaist Company ägdes av Max Blanck och Isaac Harris och höll till i de tre översta våningarna i tiovåningshuset Asch Building på Washington Place på Manhattan, New York. Fabriken hade råkat ut för bränder tidigare, dock när ingen personal var där.\\nDen 25 mars 1911 började branden på åttonde våningen och spred sig till nionde och tionde våningarna. En förbipasserande larmade brandkåren som anlände inom kort. Branden släcktes inom en halvtimme. De flesta kunde dock inte ta sig ut. En brandstege kollapsade och en trappa var blockerad av eld och rök. Dörren till trappan på nionde våningen var låst, vilket gjorde att många brann inne. Många hoppade ut genom fönster ner på gatan.\\nFabrikens ägare hade låst dörren på nionde våningen för att förhindra de anställda att stjäla. I rättegången berättade Harris om tidigare stölder, men erkände att dessa aldrig uppgått till ett värde av mer än $25 på ett år."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AC_%D9%86%D9%88%D8%A8%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Reg_Noble%2C_Toronto_Arenas.jpg","page_title":"ريج نوبل","context_page_description":"ريج نوبل هو لاعب هوكي الجليد كندي، ولد في 23 يونيو 1895 في كولينجوود في كندا، وتوفي في 19 يناير 1962."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%A4%D5%AB%D5%B6%D5%BD%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D5%8A%D5%A5%D5%B6%D5%A6%D5%A1%D5%B5%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Flag_of_Vadinsky_rayon_%28Penza_oblast%29.png","page_title":"Վադինսկի շրջան (Պենզայի մարզ)","context_page_description":"Վադինսկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Պենզայի մարզում։\\nՍտեղծվել է 1928 թվականին։ Վարչական կենտրոնը՝ Վադինսկ։"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Harris_(Minnesota)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/MNMap-doton-Harris.png","page_title":"Harris (Minnesota)","context_page_description":"Harris sī Bí-kok Minnesota chiu Chisago kūn ê chi̍t ê chng-thâu."},{"page_url":"https://en.wikipedia.org/wiki/Stuttgart-Untert%C3%BCrkheim%E2%80%93Kornwestheim_railway","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Schnarrenbergtunnel.JPG","page_title":"Stuttgart-Untertürkheim–Kornwestheim railway","context_page_description":"The Stuttgart-Untertürkheim–Kornwestheim railway is an 11.5-kilometre-long freight bypass in the German state of Baden-Württemberg. The double-track electrified main line connects Untertürkheim with Kornwestheim and serves primarily as a bypass for freight around Stuttgart Central Station. In the Deutsche Bahn timetable as route 790.11."},{"page_url":"https://nn.wikipedia.org/wiki/Skatt%C3%B8rsundet_bru","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Skatt%C3%B8rsundet_bru_1.jpg","page_title":"Skattørsundet bru","context_page_description":"Skattørsundet bru er ei platebru som kryssar Skattørsundet mellom Kågen og Skjervøya i Troms. Brua er 804 meter lang, med lengste spenn 32 meter. Ho vart opna i 1971 og er ein del av riksveg 866. Saman med Maursundtunnelen knyter ho Skjervøy til fastlandet."},{"page_url":"https://pt.wikipedia.org/wiki/Jogos_de_c%C3%B3digo_aberto","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Tremulous_-_human_base_goons.jpg","page_title":"Jogos de código aberto","context_page_description":"Jogos de código aberto são jogos dos quais o seu código está disponível. Geralmente eles são distribuídos livremente e algumas vezes são multiplataforma. Inclusive, muitos deles são incluídos em distribuições Linux. Jogos de código aberto que são software livre e contém conteúdo exclusivamente livre são também chamados de jogos livres. Todos os jogos livres são código aberto, mas nem todo jogo de código aberto é livre.\\nNo geral, jogos de código aberto são desenvolvidos por grupos pequenos de pessoas no seu tempo livre, e o lucro não é o foco principal. Quase todos os jogos de código aberto são projetos executados por voluntários, e como tal, desenvolvedores de jogos livres geralmente são hobistas e entusiastas. A consequência disso é que jogos de código aberto geralmente levam mais tempo para se tornarem maduros, e nem sempre tem a qualidade de jogos profissionais. Um dos desafios de construir conteúdo de alta qualidade para jogos é que requer ferramentas caras como modeladores 3D ou um conjunto de ferramentas para level design. Se bem que o Blender é uma das ferramentas de software livre que está ajudando a mudar esta realidade."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelmshavener_Gorch-Fock-Marathon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/WHV-Marathon-2.jpg","page_title":"Wilhelmshavener Gorch-Fock-Marathon","context_page_description":"Der Wilhelmshavener Gorch-Fock-Marathon ist ein Marathonlauf in Wilhelmshaven, der seit 2006 jährlich im Mai/Juni stattfindet. Im Rahmen der Veranstaltung finden außerdem ein Halbmarathon und ein 10-Kilometer-Lauf sowie diverse Schüler- und Kinderläufe statt. Organisator der Veranstaltung ist die Evangelische Arbeitsgemeinschaft für Soldatenbetreuung."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF_%E0%AE%89%E0%AE%AF%E0%AE%B0%E0%AF%8D_%E0%AE%A8%E0%AF%80%E0%AE%A4%E0%AE%BF%E0%AE%AE%E0%AE%A9%E0%AF%8D%E0%AE%B1%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Bombay-High-Court.jpg","page_title":"இந்திய உயர் நீதிமன்றங்கள்","context_page_description":"இந்தியாவின் நீதியாண்மை அமைப்பு அதன் உச்ச நீதிமன்றத்தால் வரையறுக்கப்பட்டதாகும். இதன் படி அமைக்கப்பட்ட 25இந்திய உயர் நீதிமன்றங்கள்' தத்தம் வரம்பிற்குட்பட்ட மாநிலங்களில் நீதிமுறைப் பணிகளை செலுத்துகின்றன. இந்தியாவின் மாநிலங்கள் மற்றும் ஒன்றிய பகுதிகள் இவற்றின் நீதியாண்மையின்கீழ் வருகின்றன.\\nவரையரை\\nஉயர்நீதிமன்றங்களுக்கு கீழ் உரிமை இயல் நீதிமன்றங்கள், குடும்ப நல நீதிமன்றங்கள், குற்றவியல் நீதிமன்றங்கள் மற்றும் இதர மாவட்ட நீதிமன்றங்கள் செயல்படுகின்றன.\\nதண்டணை அதிகாரம்\\nஉயர்நீதிமன்றங்களின் மூல நீதிமுறைமையின் முதன்மையானது மாநிலத்தின் உரிமை இயல் நீதிமன்றங்களை உள்ளடக்கியது ஆகும். மற்றும் தண்டிக்கப்படக்கூடிய குற்றங்கள், மரண தண்டணை விதிக்கக்கூடிய குற்றங்களை விசாரிப்பதும் அகும்.\\nவிசாரணை அதிகாரம்\\nகீழ் நீதிமன்றங்களால் வழங்கப்படும் மேல்முறையீட்டு மனுக்கள் மற்றும் அழைப்பாணை மனுக்கள் போன்ற வழக்குகளை இந்திய அரசியல் சட்ட விதி 224-ன் படி விசாரணை செய்யும்.\\nஇந்திய அரசியலமைப்புச் சட்டம்\\nஉயர்நீதிமன்றங்கள் இந்திய அரசியலமைப்புச் சட்டத்தின் பகுதி 4, அத்தியாயம் 5, விதி 214 ன் படி நிறுவப்பட்டுள்ளன."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%B8%D5%BD%D5%A5_%D4%BD%D5%B8%D6%82%D5%AC%D5%AB%D5%B8_%D5%A4%D5%A5_%D5%8D%D5%B8%D5%B8%D6%82%D5%A6%D5%A1_%D5%8A%D5%AB%D5%B6%D5%BF%D5%B8%D6%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/PAISAJE_LACUSTRE_CON_VACAS.jpg","page_title":"Խոսե Խուլիո դե Սոուզա Պինտու","context_page_description":"Խոսե Խուլիո դե Սոուզա Պինտուն, պորտուգալացի նկարիչ, որը ստեղծագործել է նատուրալիզմի ոճով:"},{"page_url":"https://tl.wikipedia.org/wiki/Uvira","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Uvira%2C_Sud_Kivu%2C_RD_Congo_-_Vue_a%C3%A9rienne_de_la_ville_d%27Uvira_depuis_un_h%C3%A9licopt%C3%A8re_Puma_de_la_MONUSCO._%2824887739354%29.jpg","page_title":"Uvira","context_page_description":"Ang Uvira ay isang lungsod sa lalawigan ng Timog Kivu sa Demokratikong Republika ng Congo. Matatagpuan ito sa dulong hilaga ng Lawa ng Tanganyika. Pinaglilingkuran ito ng Uvira Mental Health Center.\\nIsa rin itong diyosesis ng Katolikong Romano, isang supragano ng arkidiyosesis ng Bukavu."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D0%BB%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Harlem_135_st_7th_ave.jpg","page_title":"Гарлем","context_page_description":"Гарлем — раён у паўночнай частцы нью-ёркскай акругі Манхэтэн, традыцыйна лічыцца афраамерыканскім сектарам горада, а таксама радзімай гангстэраў і апорай развіцця афраамерыканскіх крымінальных груповак."},{"page_url":"https://ro.wikipedia.org/wiki/Mike_Myers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Mike_Myers_David_Shankbone_2010_NYC.jpg","page_title":"Mike Myers","context_page_description":"Mike Myers este un actor, scenarist, producător și cântăreț canadian, cunoscut pentru seriile Austin Powers și Shrek."},{"page_url":"https://fr.wikipedia.org/wiki/Ballon_captif","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Ballon_de_Paris_4.jpg","page_title":"Ballon captif","context_page_description":"Le ballon captif est un type d'aérostat, un ballon relié au sol par un câble et piloté par un aérostier.\\nLa différence avec un ballon à gaz est qu'il est de même gonflé par un gaz plus léger que l'air, aujourd'hui de l'hélium, mais retenu par un câble enroulé sur une grosse bobine de treuil située sous le sol.\\nAu fur et à mesure que la bobine se déroule, le ballon monte et soulève la nacelle, les passagers ou la charge utile naturellement à l'analogue d'un ascenseur, mais souvent sans rail de guidage amenant quelques balancements longitudinaux en cas de vent.\\nPour des raisons de sécurité, il n'est pas exploité à partir d'une certaine vitesse du vent selon ses caractéristiques de forme, de volume et de construction.\\nPour ramener le ballon au sol, il suffit de faire ré-enrouler le câble sur la bobine.\\nLe ballon est équipé d' un système pouvant être piloté en sécurité en cas de rupture du câble.\\nIl existe trois types de ballon captif :\\nballon captif, maintenu par câble.\\nballon captif mobile terrestre.\\nballon captif mobile maritime, le ballon est maintenu par un câble à une structure flottante lui permettant de se déplacer sur la mer avec le vent comme énergie propulsive."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%97%D7%A1%D7%99_%D7%94%D7%9E%D7%9E%D7%9C%D7%9B%D7%94_%D7%94%D7%9E%D7%90%D7%95%D7%97%D7%93%D7%AA%E2%80%93%D7%98%D7%A8%D7%99%D7%A0%D7%99%D7%93%D7%93_%D7%95%D7%98%D7%95%D7%91%D7%92%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Trinidad_and_Tobago_United_Kingdom_Locator.png","page_title":"יחסי הממלכה המאוחדת–טרינידד וטובגו","context_page_description":"יחסי הממלכה המאוחדת–טרינידד וטובגו הם היחסים הדיפלומטיים הרשמיים שבין הרפובליקה של טרינידד וטובגו לבין הממלכה המאוחדת של בריטניה הגדולה וצפון אירלנד. טרינידד וטובגו מיוצגת בממלכה המאוחדת באמצעות נציגות גבוהה שהיא מחזיקה בלונדון. הממלכה המאוחדת מיוצגת בטרינדד וטובגו באמצעות נציגות גבוהה שהיא מחזיקה בפורט אוף ספיין. שתי המדינות הם חברות מלאות בחבר העמים הבריטי. מאז עצמאותה של טרינידד וטובגו ב-1962, היחסים בין שתי המדינות ידידותיים וישנם תחומים רבים אשר גם טרינידד וטובגו וגם הממלכה המאוחדת מפעילים את היחסים כאשר הם עוסקים בהם. יש קשרים תרבותיים וחברתיים בין שני העמים. בטרינידד וטובגו, אנגלית היא אחת השפות הרשמיות, וקריקט הוא ענפי הספורט הפופולריים ביותר. בבריטניה, קרנבל הקריביים שמתרחש כל שנה בטרינידד וטובגו מאוד פופולרי."},{"page_url":"https://es.wikipedia.org/wiki/Mario_Theissen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mario_Theissen_01.JPG","page_title":"Mario Theissen","context_page_description":"Mario Theissen fue director de BMW Motorsport y jefe del equipo de Fórmula 1 BMW Sauber desde el año 2006 hasta 2009.​​\\nDespués de graduarse en la Universidad RWTH de Aquisgrán con un doctorado en ingeniería mecánica, se unió a BMW en 1977. Se convirtió en el Director de BMW Motorsport en abril de 1999.​\\nBMW entró en la Fórmula 1 con un acuerdo de asociación con Williams F1 firmado en 1998, de modo que Theissen pasó a participar en la máxima categoría desde el año 2000. En 2001, BMW fue acreditado con tener el motor más poderoso de la parrilla. Los resultados, aunque buenos, no respondieron a tal calificación. BMW acabaría desvinculándose de la escudería inglesa y posteriormente, en 2006, compraría la escudería Sauber para iniciar su participación en la F1 bajo el nombre de BMW Sauber, cosechando buenos resultados bajo la dirección de Theissen.\\nTras un 2007 en el que se revelaron como la tercera escudería del mundial, BMW consiguió su primera pole position, su primera victoria y su primer doblete en la temporada 2008 gracias a Robert Kubica."},{"page_url":"https://ca.wikipedia.org/wiki/Carroll_(Nebraska)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Carroll%2C_Nebraska_N_end_from_E.JPG","page_title":"Carroll (Nebraska)","context_page_description":"Carroll és una població dels Estats Units a l'estat de Nebraska. Segons el cens del 2000 tenia una població de 238 habitants."},{"page_url":"https://pt.wikipedia.org/wiki/Rede_de_Reservas_dos_Recifes_da_Barreira_do_Belize","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%27Brain%27_coral.JPG","page_title":"Rede de Reservas dos Recifes da Barreira do Belize","context_page_description":"A Reserva do Sistema da Barreira de Recifes em Belize é a maior barreira de recifes do hemisfério norte e a segunda maior do mundo. Tem 300 km. Os sete locais incluídos nesta nomeação ilustram a história evolutiva do desenvolvimento do recife, além de serem um habitat importante para espécies ameaçadas, inclusive tartarugas marinhas, manatins e o crocodilo-marinho-americano.\\nA Barreira de Corais, em 2018, foi removida da lista da Organização das Nações Unidas para a Educação, a Ciência e a Cultura dos sítios do Patrimônio Mundial ameaçados de extinção."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_S%C4%83ucani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/RO_BH_Saucani_2011.95.jpg","page_title":"Biserica de lemn din Săucani","context_page_description":"Biserica de lemn din Săucani, comuna Răbăgani, județul Bihor, datează din secolul XVIII. Are hramul „Nașterea Maicii Domnului”. Biserica nu se află pe noua listă a monumentelor istorice."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%B4%D0%BE%D0%BB%D0%BB%D0%B0%D1%80%D0%B0_(%D0%A1%D0%A8%D0%90)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Franklin_HalfReverse.png","page_title":"Полдоллара (США)","context_page_description":"Полдоллара — монеты США, которые чеканятся с 1794 по сегодняшний день. Первоначально номинал монет обозначался как Fifty cents or half a dollar, с 1839 года — Half dollar. Имеют множество разновидностей. На 2010 год в обиходе находятся монеты с изображением Кеннеди. С 2002 года выпускаются относительно небольшими тиражами, в основном для подарочных наборов монет США и коллекционеров."},{"page_url":"https://pl.wikipedia.org/wiki/Litice_(zamek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Litice_P5110673.jpg","page_title":"Litice (zamek)","context_page_description":"Litice − gotycki XIII-wieczny zamek w Czechach, w powiecie Ústí nad Orlicí, w miejscowości Litice nad Orlicí, 7 km na zachód od miasta Žamberk. Zamek został ufundowany przez ostatnich Przemyślidów."},{"page_url":"https://it.wikipedia.org/wiki/Choreutinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/A36-20130606-059_%289551563233%29.jpg","page_title":"Choreutinae","context_page_description":"Choreutinae Stainton, 1858 è una sottofamiglia di lepidotteri, appartenente alla famiglia Choreutidae, diffusa in tutti i continenti con circa 350 specie."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%A6%E7%BF%B0%C2%B7%E5%9D%8E%E8%B4%9D%E5%B0%94_(%E7%BE%8E%E5%86%9B%E4%B8%8A%E5%B0%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Honduras_Senior.jpg","page_title":"约翰·坎贝尔 (美军上将)","context_page_description":"约翰·弗朗西斯·坎贝尔，美国陆军上将，1979年从西点毕业，获得军官委任，曾为驻阿富汗国际维和部队司令，兼驻阿美军司令，兼坚定支持任务司令，于2014年8月26日上任，接替出任美国海军陆战队司令的约瑟夫·邓福德陆战队上将。坎贝尔上将此前担任陆军第一副参谋长。他于2016年退休。"},{"page_url":"https://es.wikipedia.org/wiki/Bor%C5%A1ice","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Bor%C5%A1ice%2C_znak.jpg","page_title":"Boršice","context_page_description":"Boršice es una localidad del distrito de Uherské Hradiště en la región de Zlín, República Checa, con una población estimada a principio del año 2018 de 2171 habitantes.\\nSe encuentra ubicada al sur de la región, en la zona más occidental de los montes Cárpatos, al este de Brno, cerca de la orilla del río Morava —un afluente izquierdo del Danubio— y de la frontera con Eslovaquia y con la región de Moravia Meridional.​"},{"page_url":"https://de.wikipedia.org/wiki/Miwa_Fukuhara","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Miwa_Fukuhara_1960.jpg","page_title":"Miwa Fukuhara","context_page_description":"Miwa Fukuhara ist eine ehemalige japanische Eiskunstläuferin, die im Einzellauf startete.\\nFukuhara wurde 1960 und von 1962 bis 1966 japanische Meisterin. Siebenmal nahm sie an Weltmeisterschaften teil. Ihr bestes Ergebnis war der sechste Platz, den sie bei den Weltmeisterschaften 1963, 1964 und 1965 erreichte. Es war die bis zu diesem Zeitpunkt beste Platzierung einer Japanerin bei Weltmeisterschaften. Zweimal vertrat Fukuhara Japan bei Olympischen Spielen. 1960 wurde sie 21. und 1964 in Innsbruck schaffte sie mit dem Erreichen des fünften Platzes das bis 1992 beste Abschneiden einer Japanerin im Eiskunstlauf bei Olympischen Spielen."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%DA%AF%D8%A7_%D8%AF%D9%84%D8%A7-%D9%88%D8%B3-%DA%A9%D8%A7%D8%B1%D8%AF%D9%88%D9%81%D8%B3%DA%A9%D8%A7%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Olga_kardovskaya_portret_ahmatovoy_1914_szh_16.jpg","page_title":"الگا دلا-وس-کاردوفسکایا","context_page_description":"اُلگا دِلا-وُس-کاردوفسکایا یک نقاش اهل اوکراین بود.\\nاو تحصیلات مقدماتی خود را در شهرهای خارکیف و سن پترزبورگ به اتمام رساند و سپس به مونیخ رفت تا مدرسهٔ آنتون آشبه تحصیل کند."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%BF%CE%BD%CE%AE_%CE%9F%CF%83%CE%AF%CE%BF%CF%85_%CE%9B%CE%BF%CF%85%CE%BA%CE%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%CE%9A%CE%AC%CF%83%CF%84%CF%81%CE%BF_%CE%9F%CF%83%CE%AF%CE%BF%CF%85_%CE%9B%CE%BF%CF%85%CE%BA%CE%AC_2.jpg","page_title":"Μονή Οσίου Λουκά","context_page_description":"Η Μονή Οσίου Λουκά, η Αγιά-Σοφιά της Ρούμελης\\nείναι χτισμένη σε υψόμετρο 430 μ. στις δυτικές υπώρειες του Ελικώνα στο Στείρι Βοιωτίας. Αποτελεί ένα από τα σημαντικότερα μνημεία της μεσοβυζαντινής τέχνης και αρχιτεκτονικής και περιλαμβάνεται στον κατάλογο μνημείων παγκόσμιας κληρονομιάς της UNESCO από κοινού με τα άλλα δύο σωζόμενα μοναστήρια της μεσοβυζαντινής περιόδου στην Ελλάδα, τη Νέα Μονή και τη Μονή Δαφνίου. Ο Όσιος Λουκάς είναι ωστόσο μεγαλύτερος και διαφέρει από το Δαφνί και τη Νέα Μονή στο ότι είναι αφιερωμένος σε ένα μοναδικό Όσιο, τον Όσιο Λουκά τον Στειριώτη."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D8%B1%DB%8C%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Vierinia.JPG","page_title":"ویرینیا","context_page_description":"ویرینیا بیر فوتبالیست. پائوک فوتبال کولوبو و پورتوقال میلّی تیمی ترکیبینده چیخیش ائدیب و هافبک موقعیتینده اوْیناییب. یورو ۲۰۱۶ و فیفا دونیا کاپی ۲۰۱۴ اوْیونلاریندا مئیدانا گئدیب."},{"page_url":"https://en.wikipedia.org/wiki/Museu_Nacional_de_Belas_Artes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Americo-ava%C3%AD.jpg","page_title":"Museu Nacional de Belas Artes","context_page_description":"The Museu Nacional de Belas Artes is a national art museum located in the city of Rio de Janeiro, Brazil. The museum, officially established in 1937 by the initiative of education minister Gustavo Capanema, was inaugurated in 1938 by President Getúlio Vargas. The museum collection, on the other hand, takes its rise in the transfer of the Portuguese Court to Brazil in the early 19th century, when King John VI brought along with him part of the Portuguese Royal Collection. This art collection stayed in Brazil after the King's return to Europe and became the core collection of the National School of Fine Arts. When the museum was created in 1937, it became the heir not only the National School collection, but also of its headquarters, a 1908 eclectic style building projected by Spanish architect Adolfo Morales de los Ríos.\\nThe Museu Nacional de Belas Artes is one of the most important cultural institutions of the country, as well as the most important museum of Brazilian art, particularly rich in 19th-century paintings and sculptures."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%BD%D0%B3%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B5%D0%B2%D0%B5%D0%B4%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Museum_Study_of_local_lore.jpg","page_title":"Кунгурский краеведческий музей","context_page_description":"Краеведческий музей города Кунгура основан в 1909 году, открылся 19 февраля 1911.\\nМузей расположен в трёх зданиях: Дом воеводы, малый гостиный двор, надворные постройки особняка купца Дубинина.\\nОсновная экспозиция — в Доме воеводы. Двухэтажное здание музея располагается в самом центре Кунгура, на высоком берегу реки Сылвы. В постоянной экспозиции музея отделы природы, истории и новейшей истории. Искусство представлено во временных экспозициях. В музее можно познакомиться с геологической историей Кунгурского края, его прошлым и настоящим.\\nВ малом гостином дворе проходят художественные выставки. В надворных постройках особняка купца Дубинина хранятся фонды музея."},{"page_url":"https://en.wikipedia.org/wiki/Konka_(river)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/%D0%9A%D1%96%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%B2_%D0%9E%D1%80%D1%96%D1%85%D0%BE%D0%B2%D0%BE%D0%BC%D1%83.JPG","page_title":"Konka (river)","context_page_description":"The Konka is a left tributary of the Dnieper, flowing through the Zaporizhia Oblast. It is 146 kilometres long, and has a drainage basin of 2,580 square kilometres. Among cities that located on the river are Polohy, Orikhiv and others.\\nThe name is a local adaptation of the Crimean Tatar name of the river Yilki Su which means a water of wild horses. At the mouth of the river was located a residence of Beylerbey Mamai. In 18th century it served as a border between the Russian Empire and the Ottoman Empire."},{"page_url":"https://af.wikipedia.org/wiki/P._D._James","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/PD_James_Cologne.JPG","page_title":"P. D. James","context_page_description":"Phyllis Dorothy James, Baroness James of Holland Park, OBE, FRSA, FRSL, algemeen bekend as P. D. James, was 'n Engelse skryfster van misdaadfiksie en 'n lewenslange konserwatiewe lid van die Britse Hoërhuis. Sy het veral bekendheid verwerf met haar speurromans rondom die polisieman en digter Adam Dalgliesh."},{"page_url":"https://vi.wikipedia.org/wiki/Chlorocoma_stereota","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Chlorocoma_stereota.jpg","page_title":"Chlorocoma stereota","context_page_description":"Chlorocoma stereota là một loài bướm đêm thuộc họ Geometridae. Nó được tìm thấy ở Úc, bao gồm Victoria. Con trưởng thành có màu xanh lá cây. Mỗi cánh có một đường gần rìa màu trắng còn bụng có đường kẻ trắng."},{"page_url":"https://cs.wikipedia.org/wiki/Baldovec","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Lom%2C_Baldovec%2C_Rozst%C3%A1n%C3%AD%2C_okres_Prost%C4%9Bjov_%2803%29.jpg","page_title":"Baldovec","context_page_description":"Baldovec je místní část obce Rozstání v okrese Prostějov v Olomouckém kraji.\\nCelé území je obklopeno lesem a vede sem pouze jedna silnice, která je ovšem v zimě dobře udržovaná. V Baldovci se nachází významný kamenolom."},{"page_url":"https://en.wikipedia.org/wiki/Depresszi%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/IDepresszi%C3%B3_3.jpg","page_title":"Depresszió","context_page_description":"Depresszió is a Hungarian Metal and Rock band, formed in late 1999 by Ferenc Halász, Dávid Nagy, and Roland Reichert, with Ádám Hartmann joining in shortly afterwards to create the band. In 2000, they first got their own concert. In August 2000, their first full-length album was recorded. They have 7 studio albums, 1 EP, and 3 DVDs so far. In late 2013, they announced to participate in A Dal 2014 with the song Csak a zene, which managed to get to the final, but not qualify for the super-final."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Ciclidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Petenia_splendida.jpg","page_title":"Specie di Ciclidi","context_page_description":"Lista delle specie di Cichlidae."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9C%E0%B0%AE%E0%B1%8D%E0%B0%AE%E0%B1%82_%E0%B0%95%E0%B0%BE%E0%B0%B6%E0%B1%8D%E0%B0%AE%E0%B1%80%E0%B0%B0%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Srinagar.jpg","page_title":"జమ్మూ కాశ్మీరు","context_page_description":"జమ్మూ కాశ్మీరు, కాశ్మీరీ:ज्वम त॒ कॅशीर, హిందీ:जम्मू और कश्मीर, ఉర్దూ:جموں و کشمیر, లఢక్, ladak భారతదేశంలో ఉత్తరపుకొనన, హిమాలయ పర్వతసానువుల్లో ఒదిగిఉన్న కేంద్రపాలిత ప్రాంతాలు. దీనికి ఉత్తరాన, తూర్పున చైనా, పశ్చిమాన పాకిస్తాన్ దేశాలతో అంతర్జాతీయ సరిహద్దులున్నాయి. దక్షిణాన హిమాచల్ ప్రదేశ్ రాష్ట్రమున్నది.\\nజమ్మూ-కాశ్మీరు కేంద్ర పాలిత ప్రాంతం లో రెండు విభాగాలున్నాయి.\\nజమ్ము ప్రాంతం: ప్రధానంగా హిందువులు ఉన్న ప్రాంతం. రాజధాని నగరం పేరు కూడా 'జమ్ము'యే. జమ్ము నగరం మందిరాల నగరంగా ప్రసిద్ధం.\\nకాశ్మీరు లోయ: కనులకింపైన పర్వతశ్రేణులతోనూ, సెలయేర్లతోనూ, సరస్సులతోనూ భూతల స్వర్గంగా పేరు పొందింది. ఇక్కడి శ్రీనగర్ ముఖ్య నగరం, వేసవికాలపు రాజధాని. కాశ్మీరులో ముస్లిం మతస్తులు అధిక శాతంలో ఉన్నారు. రాజకీయంగా ఇది చాలా వివాదాస్పదమైన ప్రాంతం. భారతదేశం, పాకిస్తాన్‌ల మధ్య రెండు యుద్ధాలకు కారణం. ఇప్పటికీ వేర్పాటు వాదం, ఉగ్రవాదం ఇక్కడ ప్రబలంగా ఉన్నాయి\\n2. కేంద్ర పాలిత ప్రాంతం లడఖ్: ఇది హిమాలయశిఖరాల మధ్య ఉన్న పీఠభూమి. బౌద్ధ మతస్తులు ఎక్కువగా ఉన్నందున దీనిని \\"చిన్న టిబెట్\\" అంటారు.లేహ్ \\" ఇక్కడి ప్రధాన పట్టణం.\\nకాని జమ్ము-కాశ్మీరు రెండు ప్రాంతాలలోనూ హిందూ, ముస్లిం, సిక్కు, అలాగే లఢక్ లో బౌద్ధ మతస్తులు విస్తరించి ఉన్నారు."},{"page_url":"https://da.wikipedia.org/wiki/Jaroslav_Heyrovsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Heyrovsky_deska.jpg","page_title":"Jaroslav Heyrovský","context_page_description":"Jaroslav Heyrovský var en tjekkisk kemiker og opfinder. Heyrovský var opfinderen af den polarografiske metode, og bagmanden bag den elektroanalytiske metode. Han modtog nobelprisen i kemi i 1959. Hans primære arbejdsområde var polarografi."},{"page_url":"https://eu.wikipedia.org/wiki/Rabenstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Rabenstein-Fl%C3%A4ming_in_PM.png","page_title":"Rabenstein","context_page_description":"Rabenstein Alemaniako udalerria da. Brandenburgo estatuan kokatuta dago, Potsdam-Mittelmark barrutian. 2014an 838 biztanle zituen 79,18 kilometro koadrotan banatuta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%B1%D0%B8%D0%B9%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Soue_Gabillou_aval.JPG","page_title":"Габийу","context_page_description":"Габийу́ — коммуна во Франции, находится в регионе Аквитания. Департамент — Дордонь. Входит в состав кантона От-Перигор-Нуар. Округ коммуны — Перигё.\\nКод INSEE коммуны — 24192."},{"page_url":"https://es.wikipedia.org/wiki/Invernadero_del_Hong_Kong_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Dry_Plant_House_-_Hong_Kong_Park_Conservatory_-_IMG_9830.JPG","page_title":"Invernadero del Hong Kong Park","context_page_description":"El Invernadero del Parque Hong Kong, en inglés: Park Hong Kong Conservatory ó también Forsgate Conservatory, es un invernadero y jardín botánico con una extensión de 1.400 m² que se encuentra en el interior del Parque de Hong Kong en el Distrito Central de Hong-Kong."},{"page_url":"https://it.wikipedia.org/wiki/Elezioni_presidenziali_negli_Stati_Uniti_d%27America_del_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Cheri_Honkala.jpg","page_title":"Elezioni presidenziali negli Stati Uniti d'America del 2012","context_page_description":"Le elezioni presidenziali negli Stati Uniti d'America del 2012 si sono tenute il 6 novembre. Esse hanno visto la vittoria di Barack Obama, Presidente uscente sostenuto dal Partito Democratico, che ha sconfitto Mitt Romney, sostenuto dal Partito Repubblicano.\\nLe elezioni presidenziali si sono tenute contestualmente alle elezioni parlamentari, per il rinnovo della Camera dei Rappresentanti e di 33 seggi del Senato.\\nIn 13 Stati si sono inoltre tenute le elezioni governatoriali. Il presidente uscente, Barack Obama, ha sconfitto il candidato repubblicano Romney, ottenendo circa 65.900.000 voti e 332 voti elettorali. Romney ha segnato però un generale recupero di consensi, ottenendo circa 61.000.000 di voti e 206 voti elettorali."},{"page_url":"https://de.wikipedia.org/wiki/Zyta_Gilowska","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gilowska_Zyta_%28cropped%29.jpg","page_title":"Zyta Gilowska","context_page_description":"Zyta Janina Gilowska war eine polnische Wirtschaftswissenschaftlerin und Politikerin. Sie war zeitweise polnische Finanzministerin."},{"page_url":"https://fi.wikipedia.org/wiki/P%C3%A4lk%C3%A4neen_vaakuna","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/P%C3%A4lk%C3%A4ne.vaakuna.1965.svg","page_title":"Pälkäneen vaakuna","context_page_description":"Pälkäneen vaakuna on Pälkäneen kunnan tunnus, ja sen on suunnitellut Gustaf von Numers. Vaakunan selitys on ”sinisessä kentässä hopeinen, kultaemiöinen lumpeenkukka”, ja se on alun perin vahvistettu kunnanvaakunaksi Luopioisille 2. marraskuuta 1960. Aihe viittaa Kukkiajärveen, jolla oli keskeinen sijainti Luopioisten kunnassa. Vaakunasta tuli Pälkäneen kunnanvaakuna vuonna 2007 Pälkäneen ja Luopioisten kuntaliitoksen yhteydessä.\\nAlkuperäinen Pälkäneelle 3. toukokuuta 1965 vahvistettu vaakuna oli myös Gustaf von Numersin suunnittelema. Sen vaakunaselitys on ”punaisessa kentässä alaisesta kärjestä nouseva kirkonkukko pidellen kynsissään keppiä; kaikki hopeaa”. Aihe on piirretty kirkon tuuliviirin muotoon, jolla viitataan pitäjän raunioituneeseen keskiaikaiseen harmaakivikirkkoon. Viirin aapiskukon muoto viittaa Pälkäneen ABC-kirjaan, jonka painolaatat kirjanpainaja Daniel Medelplan kaiversi puusta Pälkäneellä 1719. Vaakuna muuttui epäviralliseksi kotiseutuvaakunaksi vuoden 2007 kuntaliitoksessa. Pälkäneellä toimivan Uotilan Leipomon pakkauksissa on edelleen käytössä tämä kunnan vanha vaakuna."},{"page_url":"https://en.wikipedia.org/wiki/Ruinen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Kerk_op_brink_van_Ruinen.jpg","page_title":"Ruinen","context_page_description":"Ruinen is a village in the Dutch province of Drenthe. It is located in the municipality of De Wolden, about 10 km northwest of Hoogeveen.\\nRuinen was a separate municipality until 1998, when it became part of De Wolden. The windmill De Zaandplatte has been restored and is open to the public."},{"page_url":"https://no.wikipedia.org/wiki/Frankerriket","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Frankish_Empire_481_to_814-NO.svg","page_title":"Frankerriket","context_page_description":"Frankerriket, også omtalt som Frankia, henviser til kongeriket til frankerne i senantikken og tidlig middelalder. Frankerne var en sammenslutning av flere vestgermanske stammer som opprettet et rike i Gallia, da bestående av en gallisk-romersk bosetning. Det er et område som løselig sett utgjør dagens Frankrike og deler av dagens Tyskland. Kongeriket ble opprettet med Klodvig I som den første kronete kongen av frankerne i 496. Ved bortimot vedvarende krigføring av Pipin av Herstal, Karl Martell, Pipin den yngre, Karl den store og Ludvig den fromme — far, sønn, sønnesønn, oldebarn og oldebarns sønn — ble den største utvidelsen av det frankiske riket sikret tidlig på 800-tallet.\\nDen germanske skikk og tradisjon med å dele arven likt mellom brødrene førte til at det frankiske riket ble styrt i navnet som en enhet, men inndelt i flere regna. De geografiske områdene og antallet inndelinger varierte over tid, men den særskilte betegnelsen Frankerriket kom generelt til å vise til kun ett regnum, det til Austrasia, sentrert mellom elvene Rhinen og Maas i nordlige Europa. Tidvis innbefattet begrepet også Neustria, nord for elven Loire og vest for elven Seinen."},{"page_url":"https://cy.wikipedia.org/wiki/Albemarle,_Gogledd_Carolina","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Derek-Colanduno-Face.jpg","page_title":"Albemarle, Gogledd Carolina","context_page_description":"Dinas yn Stanly County, yn nhalaith Gogledd Carolina, Unol Daleithiau America yw Albemarle, Gogledd Carolina. ac fe'i sefydlwyd ym 1826.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: UTC−05:00."},{"page_url":"https://eu.wikipedia.org/wiki/Warwick_(Georgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/GAMap-doton-Warwick.PNG","page_title":"Warwick (Georgia)","context_page_description":"Warwick Georgiako estatuko hiri bat da. Pike County konderrian kokatua dago. 2010ean 423 biztanle zituen, 2,10 kilometro koadrotan banatuta."},{"page_url":"https://fr.wikipedia.org/wiki/Him%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Palermo-Museo-Archeologico-bjs-13.jpg","page_title":"Himère","context_page_description":"Himère ou Himera est une ancienne cité grecque de la Grande-Grèce, fondée près du fleuve Himeras en 648 av. J.-C. et annihilée par les forces carthaginoises en 408 av. J.-C. Située sur la côte septentrionale de la Sicile, à l'est de Palerme, le site archéologique appartient à la commune actuelle de Termini Imerese."},{"page_url":"https://eu.wikipedia.org/wiki/Bl%C3%A9court_(Marne_Garaia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Blecourt_a_publier2.jpg","page_title":"Blécourt (Marne Garaia)","context_page_description":"Blécourt Frantziako udalerria da, Marne Garaia departamenduan dagoena, Ekialde Handia eskualdean. 2013an 109 biztanle zituen."},{"page_url":"https://id.wikipedia.org/wiki/Thomas_M%C3%BCller","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Thomas_M%C3%BCller%2C_Germany_national_football_team_%2805%29.jpg","page_title":"Thomas Müller","context_page_description":"Thomas Müller adalah pemain sepak bola asal Jerman yang bermain dan menjadi wakil kapten untuk Bayern München dan tim nasional Jerman. Sebagai pemain yang serba guna, Müller bermain sebagai gelandang atau penyerang, dan telah bermain dalam berbagai posisi menyerang – gelandang serang, penyerang bayangan, penyerang tengah, serta pemain sayap. Dia dipuji karena pengaturan posisi, kerja tim dan stamina, tingkat produktivitas, serta konsistensi dalam mencetak dan menciptakan gol.\\nSebagai produk dari sistem akademi usia muda, dia memulai musim pertamanya secara penuh pada musim 2009–2010 setelah Louis van Gaal ditunjuk sebagai pelatih utama; dia bermain di hampir seluruh pertandingan hingga klub memenangkan gelar double di Bundesliga dan DFB-Pokal, serta mencapai Final Liga Champions UEFA 2010. Müller mencetak 23 gol pada musim 2012–2013 saat Bayern memenangkan treble historis; gelar di Bundesliga, DFB-Pokal, dan Liga Champions.\\nMüller masuk ke dalam tim nasional Jerman pada tahun 2010. Pada Piala Dunia 2010 dia mencetak lima gol dalam enam pertandingan saat Jerman meraih peringkat ketiga."},{"page_url":"https://en.wikipedia.org/wiki/Queen%27s_Head,_Bramfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Queens_Head%2C_Bramfield_-_geograph.org.uk_-_1549338.jpg","page_title":"Queen's Head, Bramfield","context_page_description":"The Queen's Head is a pub in Bramfield, Suffolk, England. The pub was formerly known as the \\"Skeltons\\". It is a Grade II listed building, which dates back to the C16th.\\nIt is 15 minutes from the coastal town of Southwold, and is in the centre of the village of Bramfield, Suffolk.\\nThe pub has received recognition for its food. It won The Good Food Guide pub of the year twice in a row and was in The Good Pub Guide, The Good Food Guide, AA Pub Guide and Michelin Guide to Eating Out in Pubs in 2008.\\nAfter 30 years of ownership, the pub was sold in late 2015 by Adnams PLC.\\nThe new owners, Barsham Securities Limited, planned to refurbish the building and modernise the kitchen before leasing to a new tenant."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%82%E3%81%B6%E3%81%AA%E3%81%84%E5%88%91%E4%BA%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Kanagawa_small_and_medium-sized_enterprises_center.JPG","page_title":"あぶない刑事","context_page_description":"『あぶない刑事』は、1986年10月から1987年9月にかけて日本テレビ系列で放送された連続テレビドラマ。その後、翌年にはテレビシリーズ第2作『もっとあぶない刑事』が放送された他、映画、テレビスペシャルといったシリーズ展開も行われた。略称は『あぶデカ』。"},{"page_url":"https://en.wikipedia.org/wiki/GHV2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Madonna_platinum_record_2.png","page_title":"GHV2","context_page_description":"GHV2 is the second greatest hits album by American recording artist Madonna. Maverick and Warner Bros. Records released it on November 12, 2001, coinciding with the video album, Drowned World Tour 2001. A follow-up to The Immaculate Collection, GHV2 contains a collection of singles during the second decade of Madonna's career. Madonna mentioned that she only included \\"songs that I could listen to five times in a row\\" on it. The album did not contain any new songs, but a promotional single titled \\"GHV2 Megamix\\", was released, which contained remixes by Thunderpuss, John Rocks & Mac Quayle and Tracy Young. A promotional remix album was also issued, titled GHV2 Remixed: The Best of 1991–2001.\\nGHV2 received generally positive reviews from music critics, who deemed it as an essential compilation, although some criticized the absence of new material. Commercially, the compilation was successful, peaking at number seven on the US Billboard 200 and was certified platinum by the Recording Industry Association of America. Elsewhere, GHV2 also attained success, reaching the top five in Australia, Germany, the United Kingdom and several other European countries."},{"page_url":"https://fr.wikipedia.org/wiki/Armie_Hammer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hammer_and_Chalamet_at_Berlinale_2017.jpg","page_title":"Armie Hammer","context_page_description":"Armand Douglas Hammer, dit Armie Hammer, né le 28 août 1986 à Los Angeles, est un acteur américain.\\nIl est l'arrière-petit-fils du magnat du pétrole, philanthrope et collectionneur d'art Armand Hammer."},{"page_url":"https://la.wikipedia.org/wiki/Hostis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Yevgeny_Onegin_by_Repin.jpg","page_title":"Hostis","context_page_description":"Hostis, ut scribit Aegidius Forcellini, lexicographus Italus, est \\"is, cum quo publice bellum habemus. Qua significatione ab inimico differt, qui est is, quocum pictura ad Alexandri Puškin fabulam poeticam Eugenius Onegin illustrandam habemus privata odia. Distingui etiam sic possunt, ut inimicus sit qui nos odit; hostis qui oppugnat\\". Exempli gratia, apud Ciceronem legimus:\\nOmnis, qui libere de re publica sensimus, qui dignas nobis sententias diximus, qui populum Romanum liberum esse voluimus, statuit ille quidem non inimicos, sed hostis: maiora tamen in nos quam in hostem supplicia meditatur: mortem naturae poenam putat esse, iracundiae tormenta atque cruciatum.\\nSolis autem cum hostibus bellum geri licet; propterea status hostium iure quoque constitutus est: 'Hostes hi sunt, qui nobis aut quibus nos publice bellum decrevimus; ceteri latrones aut praedones sunt.'"},{"page_url":"https://en.wikipedia.org/wiki/St._Mary%27s_College_of_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Margaret_Brent_Hall.jpg","page_title":"St. Mary's College of Maryland","context_page_description":"St. Mary's College of Maryland is a public, liberal arts college in St. Mary's City, Maryland. Established in 1840, St. Mary's College of Maryland is an honors college that claims to \\"offer an experience similar to that of an elite liberal arts college.\\" With about 1,800 enrolled students, the institution offers bachelor's degrees in 24 disciplines, as well as a master's program and certification programs.\\nThe college is located in St. Mary's City, Maryland and shares much of its campus with Historic St. Mary's City, the site of Maryland's first colony and first capital. It is also the site of the fourth colony in British North America.\\nThe Historical Archaeology Field School is jointly operated by St. Mary's College of Maryland and Historic St. Mary's City. The campus and the rest of St. Mary's City combined are considered to be one of the premier archaeological sites in the United States.\\nIn 2020, U.S. News and World Report's annual \\"Best Colleges and Universities\\" report ranked St. Mary's College as the 5th best \\"Public Liberal Arts College\\" in the country; St. Mary's was tied for #92 in the \\"National Liberal Arts Colleges\\" category, which includes private schools."},{"page_url":"https://en.wikipedia.org/wiki/It%27s_Too_Late_to_Stop_Now","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Rainbow_theatre_london.jpg","page_title":"It's Too Late to Stop Now","context_page_description":"It's Too Late to Stop Now is a 1974 live double album by Northern Irish singer-songwriter Van Morrison. It features performances that were recorded in concerts at the Troubadour in Los Angeles, California; the Santa Monica Civic Auditorium, and the Rainbow in London, during Morrison's three-month tour with his eleven-piece band, the Caledonia Soul Orchestra, from May to July 1973. Frequently named as one of the best live albums ever, It's Too Late to Stop Now was recorded during what has often been said to be the singer's greatest phase as a live performer."},{"page_url":"https://oc.wikipedia.org/wiki/Gr%C3%A8cia_antica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Colonizacion_antica_de_Mediterran%C3%A8a.png","page_title":"Grècia antica","context_page_description":"Grècia antica es l'ensems dei civilizacions que visquèron sus lo territòri grèc fins a la fin de l'Antiquitat. Acomencèt son desvolopament tre lo sègle XVI avC amb la civilizacion micenèa qu'existiguèt fins vèrs la mitat dau sègle XII avC. Aquela disparicion foguèt marcada per de migracions dau pòple dorian que marquèron lo començament d'una èra novèla en Grècia. L'apogèu d'aquela civilizacion aguèt luòc durant lo sègle V avC amb la resisténcia a l'invasion de l'Empèri Pèrsa puei lo raionament culturau dau periòde classic. Pasmens, lei ciutats-estats principalas de Grècia s'encalèron dins de conflictes intèrnes per l'egemonia. Tre la mitat dau sègle IV avC, lo país passèt sota la dominacion de Macedònia puei de l'Empèri Roman.\\nLa produccion scientifica e cultura de la Grècia antica aguèt un ròtle primordiau dins l'aparicion e la formacion de la cultura occidentala modèrna. Ansin, lei Grècs ancians son generalament considerats coma leis inventors de la filosofia o de la recèrca scientifica en astronomia, en matematicas o en medecina. La literatura grèga joguèt tanben un ròtle major especialament au nivèu dau teatre o de la poesia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B4%D0%BC%D0%B0%D1%81%D0%B8%D0%B2%D0%BD%D0%B0_%D1%87%D0%BE%D1%80%D0%BD%D0%B0_%D0%B4%D1%96%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Rxj1242_comp.jpg","page_title":"Надмасивна чорна діра","context_page_description":"Надмасивна чорна діра — чорна діра з масою близько 10⁵—10¹⁰ мас Сонця. Станом на 2014 рік надмасивні чорні діри виявлено в центрах багатьох галактик, зокрема, у Чумацькому Шляху. Надмасивні чорні діри мають специфічні властивості, які відрізняють їх від менших чорних дір:\\nПарадоксально, проте середня густина надмасивної чорної діри може бути дуже малою. Це пояснюється тим, що радіус Шварцшильда прямо пропорційний масі, а щільність — обернено пропорційна об'єму. Оскільки обсяг кулястого об'єкта прямо пропорційний кубу радіуса, а маса росте лише лінійно, то обсяг зростає швидше, ніж маса. У результаті середня густина чорної діри зменшується зі збільшенням її радіусу.\\nПрипливні сили біля горизонту подій значно слабші через те, що центральна сингулярність розташована настільки далеко від горизонту, що гіпотетичний астронавт, яки подорожує до центру чорної діри, може не відчути впливу екстремальних припливних сил доки не зануриться в неї досить глибоко."},{"page_url":"https://en.wikipedia.org/wiki/Antheridium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Chara_contraria_oogon.jpeg","page_title":"Antheridium","context_page_description":"An antheridium is a haploid structure or organ producing and containing male gametes. The plural form is antheridia, and a structure containing one or more antheridia is called an androecium. \\"Androecium\\" is also used as the collective term for the stamens of flowering plants.\\nAntheridia are present in the gametophyte phase of cryptogams like bryophytes and ferns. Many algae and some fungi, for example ascomycetes and water moulds, also have antheridia during their reproductive stages. In gymnosperms and angiosperms, the male gametophytes have been reduced to pollen grains and in most of these the antheridia have been reduced to a single generative cell within the pollen grain. During pollination, this generative cell divides and gives rise to sperm cells.\\nThe female counterpart to the antheridium in cryptogams is the archegonium, and in flowering plants is the gynoecium.\\nAn antheridium typically consists of sterile cells and spermatogenous tissue. The sterile cells may form a central support structure or surround the spermatogenous tissue as a protective jacket. The spermatogenous cells give rise to spermatids via mitotic cell division."},{"page_url":"https://pt.wikipedia.org/wiki/Acinonyx_jubatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Acinonyx_jubatus_King_Cheetah.jpg","page_title":"Acinonyx jubatus","context_page_description":"O guepardo ou chita é um animal da família dos felídeos, ainda que de comportamento atípico, se comparado com outros da mesma família. É a única espécie vivente do gênero Acinonyx. Tendo como habitat a savana, vive na África, península Arábica e no sudoeste da Ásia. Também é conhecido pelos nomes de cheetah, cheetah-africana, lobo-tigre, leopardo-caçador ou onça-africana. Fisicamente, o guepardo ou chita é significativamente parecido com o leopardo. As almofadas das patas da chita têm ranhuras para se moverem melhor em alta velocidade, e sua longa cauda serve para lhe dar estabilidade nas curvas em alta velocidade. Cada chita pode ser identificada pelo padrão exclusivo de anéis existentes em sua cauda, tem uma cabeça pequena e aerodinâmica e uma coluna incrivelmente flexível, são habilidades que ajudam bastante na hora da perseguição.\\nÉ um animal predador, preferindo uma estratégia simples: caçar as suas presas através de perseguições a alta velocidade, em vez de táticas como a caça por emboscada ou em grupo, mas por vezes, pode caçar em dupla. Consegue atingir velocidades de 115 km/h, por curtos períodos de cada vez, sendo o mais rápido de todos os animais terrestres."},{"page_url":"https://en.wikipedia.org/wiki/Tin_tabernacle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Tin_Chapel%2C_Sole_Street%2C_Kent.jpg","page_title":"Tin tabernacle","context_page_description":"A tin tabernacle is a type of prefabricated ecclesiastical building made from corrugated galvanised iron. They were developed in the mid-19th century initially in the United Kingdom. Corrugated iron was first used for roofing in London in 1829 by civil engineer Henry Robinson Palmer, and the patent was later sold to Richard Walker who advertised \\"portable buildings for export\\" in 1832. The technology for producing the corrugated sheets improved, and to prevent corrosion, the sheets were galvanised with a coating of zinc, a process developed by Stanislas Sorel in Paris in the 1830s. After 1850, many types of prefabricated buildings were produced, including churches, chapels and mission halls."},{"page_url":"https://de.wikipedia.org/wiki/Maria_von_M%C3%B6rl","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Portrait_of_MARIA_VON_MORL.jpg","page_title":"Maria von Mörl","context_page_description":"Maria von Mörl, voller Name Maria Theresia von Mörl zu Pfalzen und Sichelburg war eine Tiroler Adelige, Mystikerin und Stigmatisierte, sie wird in der Literatur als „ekstatisches Fräulein“ bezeichnet."},{"page_url":"https://es.wikipedia.org/wiki/Turismo_en_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Playa_El_Agua.JPG","page_title":"Turismo en Venezuela","context_page_description":"El turismo en Venezuela se desarrolló considerablemente en las últimas décadas, particularmente por su favorable posición geográfica, la variedad de paisajes, la riqueza de la flora y fauna, las manifestaciones artísticas y el privilegiado clima tropical del país, que permite disfrutar de cada región durante todo el año."},{"page_url":"https://nl.wikipedia.org/wiki/Cyphomyrmex","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Cyphomyrmex_rimosus_casent0179472_profile_1.jpg","page_title":"Cyphomyrmex","context_page_description":"Cyphomyrmex is een geslacht van vliesvleugelige insecten van de familie Mieren."},{"page_url":"https://sh.wikipedia.org/wiki/Philip_Dorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Philip_Dorn_in_Reunion_in_France_trailer.jpg","page_title":"Philip Dorn","context_page_description":"Philip Dorn, rođen kao Hein van der Niet i ponekad poznat i pod umjetničkim pseudonimom Fritz van Dungen, bio je nizozemski glumac poznat po nastupima u klasičnim hollywoodskim filmovima. Karijeru je započeo u domovini, a nastavio u Njemačku, nakon što je nakon njemačke invauije prebjegao u SAD. Spoecijalnost su mu bile uloge \\"egzotičnih\\" evropskih ljubavnika, kao i antinacističkih boraca u propagandim filmovima za vrijeme Drugog svjetskog rata, a što je uključilo i lik Draže Mihailovića u filmu Chetniks! The Fighting Guerillas. 1950-ih se vratio u Evropu, ali je relativno rano morao prekinuti karijeru zbog moždanog udara."},{"page_url":"https://es.wikipedia.org/wiki/Teupasenti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Teupasenti_Town_%28El_Paraiso%29_Honduras_C._A._-_panoramio.jpg","page_title":"Teupasenti","context_page_description":"Teupasenti es un municipio del departamento de El Paraíso, Honduras."},{"page_url":"https://hu.wikipedia.org/wiki/Ur%C3%A1n-235","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Kernzerfall.svg","page_title":"Urán-235","context_page_description":"Az urán-235, jelöléssel ²³⁵U az urán egyik izotópja, a természetes uránban csak 0,72%-ban fordul elő, ezért a reaktorokban dúsított uránt használnak. A jóval nagyobb részarányú ²³⁸U-cal ellentétben hasítható, azaz nukleáris láncreakció fenntartására képes – az egyetlen hasítható izotóp, mely primordiális nuklid vagy még jelentős mennyiségben előfordul a természetben.\\nFelezési ideje 703,8 millió év ezért 97%-a mára már elbomlott. 1935-ben fedezte fel Arthur Jeffrey Dempster. Teljes effektív hatáskeresztmetszete lassú termikus neutronokra körülbelül 504,81 barn, gyors neutronokra nagyságrendileg 1 barn. Az elnyelt neutronok nagy többsége, de nem mind okoz hasadást, néhány esetben a befogás révén ²³⁶U keletkezik."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_byggnader_i_Helsingborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/S%C3%B6derporthuset.jpg","page_title":"Lista över byggnader i Helsingborg","context_page_description":"Helsingborg är centralort i Helsingborgs kommun och ligger i Skåne län. Orten hade 104 250 invånare år 2015 och utgör befolkningsmässigt Sveriges nionde största tätort, Skånes andra största tätort och ingår i Öresundsregionen. Helsingborg ligger vid Öresunds smalaste del, där endast 3 750 meter skiljer staden från Helsingör i Danmark. Stadens geografi domineras av den branta sluttningen Landborgen som löper längs Öresund, något indragen från kusten. Mellan strandterrassen och landborgsterrassen finns ett antal raviner som bildats under den senaste istiden.\\nHelsingborgs historia sträcker sig tillbaka till vikingatiden. Den viktiga plats där Öresund är som smalast har gett staden en strategisk position under lång tid. På medeltiden var staden och dess slott ett av Nordens mäktigaste fästen och därmed inblandad i mycket av den tidens maktspel. Under århundradena har Helsingborg varit platsen för flera politiska konflikter och strider. De många krigen mellan Sverige och Danmark gick hårt åt staden och dess bebyggelse, men sedan 1700-talet har staden levt i fred och på 1800-talet lyckades Helsingborg återhämta sig ordentligt."},{"page_url":"https://ast.wikipedia.org/wiki/Lincoln_Continental","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/2017_Lincoln_Continental.JPG","page_title":"Lincoln Continental","context_page_description":"El Lincoln Continental ye un automóvil de luxu producíu pola firma estauxunidense Lincoln —una compañía de Ford Motor Company— ente los años 1939 y 2002. En 2016 Ford volvió a entamar la producción d'esti llexendariu vehículu nun intentu reinventase nel mercáu estauxunidense y el chinu.\\nAnguaño la producción del Continental centrar en Flat Rock, Michigan, Estaos Xuníos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D1%8F%D0%B6_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_2000)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Leonardo_DiCaprio.jpeg","page_title":"Пляж (фильм, 2000)","context_page_description":"«Пляж» — приключенческая драма 2000 года режиссёра Дэнни Бойла с Леонардо Ди Каприо в главной роли, снятая по одноимённому роману-бестселлеру Алекса Гарленда."},{"page_url":"https://vi.wikipedia.org/wiki/Chu_tr%C3%ACnh_Rankine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Rankine_cycle_layout.png","page_title":"Chu trình Rankine","context_page_description":"Chu trình Rankine là một mô hình được sử dụng để dự đoán hiệu suất của các hệ thống tua bin hơi nước. Nó cũng được sử dụng để nghiên cứu hiệu suất của động cơ hơi nước qua lại. Chu trình Rankine là một chu trình nhiệt động lý tưởng hóa của động cơ nhiệt chuyển đổi nhiệt thành công cơ học trong khi trải qua thay đổi pha. Đó là một chu trình lý tưởng hóa trong đó tổn thất ma sát ở mỗi trong bốn thành phần bị bỏ qua. Nhiệt được cung cấp bên ngoài vào một vòng kín, thường sử dụng nước làm chất lỏng làm việc. Nó được đặt theo tên của William John Macquorn Rankine, một giáo sư đa khoa người Scotland và Đại học Glasgow."},{"page_url":"https://no.wikipedia.org/wiki/Kungshamn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kungshamn_sm%C3%B6gen.jpg","page_title":"Kungshamn","context_page_description":"Kungshamn er et tettsted i Västra Götalands län i landskapet Bohuslän i Sverige. Det er Sotenäs kommunes administrasjonssenter. I 2010 hadde tettstedet 2 814 innbyggere.\\nKungshamn ligger på en halvøy på Sveriges vestkyst nord for Lysekil."},{"page_url":"https://es.wikipedia.org/wiki/Eidsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Norway_%C3%98stfold_-_Eidsberg.svg","page_title":"Eidsberg","context_page_description":"Eidsberg es un municipio en la provincia de Østfold, Noruega. Tiene una población de 11 353 habitantes según el censo de 2015.​ Limita con los municipios de Rakkestad, Askim, Skiptvet, Trøgstad y Marker en Østfold, y Aurskog-Høland en Akershus. Su centro administrativo es el pueblo de Mysen\\nEidsberg se estableció como municipio el 1 de enero de 1838. El pueblo de Mysen fue separado de Eidsberg para formar un municipio propio el 1 de julio de 1920, pero se volvió a unir el 1 de enero de 1961."},{"page_url":"https://sv.wikipedia.org/wiki/Inkarvilleasl%C3%A4ktet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Incarvillea_arguta_1.jpg","page_title":"Inkarvilleasläktet","context_page_description":"Inkarvilleasläktet är ett släkte i familjen katalpaväxter med 16 arter spridda från Centralasien till Mongoliet, Kina, Pakistan och Indien. Några arter kan odlas som trädgårdsväxter i södra Sverige."},{"page_url":"https://fr.wikipedia.org/wiki/Ludi_scaenici","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Phersu.jpg","page_title":"Ludi scaenici","context_page_description":"Les ludi scaenici étaient les jeux pratiqués par les Étrusques souvent inspirés des pratiques attiques ou grecques, et repris ensuite par les Romains. Comme pour nombre de leurs pratiques, les seules traces sont les représentations sur les fresques de leurs tombes."},{"page_url":"https://fr.wikipedia.org/wiki/Centrale_thermique_de_Bouchain","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Centrale_Thermique_de_Bouchain-007.JPG","page_title":"Centrale thermique de Bouchain","context_page_description":"La centrale thermique de Bouchain était initialement une centrale électrique française fonctionnant au charbon et située à Bouchain dans le département du Nord et exploitée par EDF. Mise en service en 1970, elle a cessé sa production en avril 2015.\\nEn partenariat avec General Electric, EDF a construit à proximité immédiate une nouvelle installation en cycle combiné au gaz naturel fonctionnant au combustible gazeux, qui a été mise en service industriel le 26 juillet 2016.\\nLa centrale thermique de Bouchain est la seule à disposer d'une tour aéroréfrigérante d'une hauteur de 125 mètres, visible de très loin. Ce réfrigérant utilise les eaux du canal de l'Escaut se trouvant à proximité.\\nEn 2016, elle est élue par le Guinness Book la centrale la plus performante au monde et devrait fournir de l'électricité à 680 000 foyers grâce à une turbine GE de type 9 HA en cycle combiné, à cette date la plus grande au monde."},{"page_url":"https://sr.wikipedia.org/wiki/Fenilbenzimidazol_sulfonska_kiselina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Phenylbenzimidazole-sulfonic-acid-3D-spacefill.png","page_title":"Fenilbenzimidazol sulfonska kiselina","context_page_description":"Fenilbenzimidazol sulfonska kiselina je organsko jedinjenje, koje sadrži 13 atoma ugljenika i ima molekulsku masu od 274,295 Da."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Belleserre","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Belleserre_-_Le_Monument_aux_Morts.jpg","page_title":"Belleserre","context_page_description":"Belleserre sī ūi-tī Hoat-kok Midi-Pyrénées toā-khu Tarn koān ê chi̍t ê commune."},{"page_url":"https://nl.wikipedia.org/wiki/Alburnus_macedonicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Alburnus_macedonicus.jpg","page_title":"Alburnus macedonicus","context_page_description":"Alburnus macedonicus is een straalvinnige vissensoort uit de familie van de eigenlijke karpers. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1928 door Karaman."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Prahova","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Brebu_2014_Biserica_01.jpg","page_title":"Listă de localități din județul Prahova","context_page_description":"Lista de mai jos cuprinde toate localitățile din județ în ordine alfabetică.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B8%82%E5%8D%97%E5%8C%BA%E4%B8%80%E8%88%AC%E4%B8%8D%E5%8F%AF%E7%A7%BB%E5%8A%A8%E6%96%87%E7%89%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%E9%9D%92%E5%B2%9B%E9%BE%99%E5%8F%A3%E8%B7%AF5%E5%8F%B7_2013-08-18.jpg","page_title":"市南区一般不可移动文物","context_page_description":"市南區未核定為文物保護單位的不可移動文物，是由青島市市南區人民政府制定並對外公布的不可移動文物名錄。2009年7月27日，市南區政府發布《關於公布市南區第一批區級文物保護單位和未核定文物保護單位的通知》，公布了第一批市南區文物保護單位15處和市南區轄區內第三次全國文物普查新發現的不可移動文物共39處。2012年11月6日公布了另一批不可移動文物共207處。此兩批文物受《中華人民共和國文物保護法》等法律法規保護。其中部分文物現已列入第二批市南區文物保護單位名單。"},{"page_url":"https://ru.wikipedia.org/wiki/Lockheed_P-2_Neptune","image_url":"https://upload.wikimedia.org/wikipedia/ru/b/b7/J34_Engine_Nacelle_on_P2V-5F.jpg","page_title":"Lockheed P-2 Neptune","context_page_description":"Локхид P-2 «Нептун» — американский базовый патрульный самолёт."},{"page_url":"https://nl.wikipedia.org/wiki/Gaziantep_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Gaziantep.jpg","page_title":"Gaziantep (stad)","context_page_description":"Gaziantep, voorheen en informeel Antep, is een stad in het zuidoosten van Turkije in zuidoostelijke Anatolië en is de hoofdstad van de gelijknamige provincie Gaziantep. De stad ligt ten oosten van Adana en ten noordoosten van Iskenderun, niet ver van de Eufraat en de grens met Syrië. De afstand tot de Middellandse Zee is ongeveer 120 kilometer. De stad heeft twee stedelijke districten binnen zijn gemeentegrenzen, namelijk Şahinbey en Şehitkamil. In 2000 had de stad 853.513 inwoners, dat inmiddels naar 1.465.019 is gestegen, waarmee Gaziantep de op vijf na grootste stad van Turkije is. Daarnaast is het ook een van de oudste steden ter wereld."},{"page_url":"https://sv.wikipedia.org/wiki/Katarinabergets_skyddsrum","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Katarinabergets_skyddsrum_byggs_1955b.jpg","page_title":"Katarinabergets skyddsrum","context_page_description":"Katarinabergets skyddsrum ligger insprängt i Katarinaberget på Södermalm i Stockholm. Skyddsrummet är stadens största skyddsrum för civilbefolkning, byggt mellan 1952 och 1957 och nyttjas som bilgarage i fredstid. När det stod färdigt 1957 var det världens största atombombssäkra skyddsrum och Europas största parkeringshus. Anläggningen hade plats som skyddsrum för cirka 20 000 personer respektive som P-hus för 550 bilar."},{"page_url":"https://es.wikipedia.org/wiki/Fragaria_chiloensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Schmidtmeyer-_Scharf%2C_George_Johann_-_3_Mapuche_women_-JCB_Library_2.1.jpg","page_title":"Fragaria chiloensis","context_page_description":"La frutilla chilena, fresa chilena o frutilla blanca, frutilla de arena, frutilla de la costa de Chiloé o frutilla silvestre​, es una planta herbácea perenne de la familia de las rosáceas, que crece en América del Norte y América del Sur en una gran variedad de climas y suelos. Junto con F. virginiana, es la progenitora del fresón o frutilla ananá, la variedad más consumida actualmente."},{"page_url":"https://en.wikipedia.org/wiki/Nicolai_Jacob_Marstrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Petra_Ottilia_Marstrand.jpg","page_title":"Nicolai Jacob Marstrand","context_page_description":"Nicolai Jacob Marstrand was a Danish mechanician and inventor. He was the father of painter Wilhelm Marstrand."},{"page_url":"https://pt.wikipedia.org/wiki/Giovanni_Gerbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Giovanni_Gerbi_1920.jpg","page_title":"Giovanni Gerbi","context_page_description":"Giovanni Gerbi foi um ciclista italiano, profissional desde 1904 até 1932. Durante a sua carreira como profissional tem conseguido vitórias em clássicas italianas como o Giro de Lombardia ou a Milano-Torino. Conseguiu subir duas vezes ao pódio do Giro d'Italia como terceiro classificado, durante os Giro d'Italia de 1911 e 1912, sendo seu segundo pódio uma edição na que não teve classificação individual. Foi terceiro com a equipa Gerbi."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D8%AD%D9%81_%D8%A7%D9%84%D8%AA%D8%A3%D8%B1%D9%8A%D8%AE_%D8%A7%D9%84%D8%B7%D8%A8%D9%8A%D8%B9%D9%8A_%D9%81%D9%8A_%D8%B4%D9%8A%D8%B1%D8%A7%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Natural_History_and_Technology_Museum_of_Shiraz_University_Darafsh_%2819%29.JPG","page_title":"متحف التأريخ الطبيعي في شيراز","context_page_description":"متحف التاريخ الطبيعي في شيراز: هو متحف للتأريخ الطبيعي في جامعة شيراز والذي تم بناؤه في شهر مارس عام 1974م في مدينة شيراز، ويحتوي هذا المتحف على انواع کثيرة من حيوانات محنّطة، ونباتات وأحافير يُعدّ بعضها من النوادر شبه المنقرضة. وتم جمع وعرض أكثر من 2500 عينة ونموذج من اللافقاريات والفقاريات في قسم علم معرفة الحيوانات في المتحف. كما تم جمع وعرض أكثر من 60 نوعاً من النباتات الطبية في قسم نباتات الزينة والطبية من المتحف إلى جانب عرض أحافير لأسماك تعود إلى قبل 70 مليون سنة والمعادن وأنواع الصخور والأحافير في قسم الحفريات الجيولوجية من المتحف."},{"page_url":"https://no.wikipedia.org/wiki/%C2%ABGorch_Fock%C2%BB_(1958)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Gorch_Fock_an_der_Bl%C3%BCcherbr%C3%BCcke_P8170196.jpg","page_title":"«Gorch Fock» (1958)","context_page_description":"«Gorch Fock» er et barkrigget skoleskip som tilhører den tyske marine. Hun ble bygget i 1958 og er svært lik forløperen «Gorch Fock» som nå er museumsskip. Begge skipene er navngitt etter den tyske forfatteren Gorch Fock.\\nFor å skille de to skipene blir de ofte angitt med byggeår eller med tilleggssifferet 1 eller 2. Disse tilleggene inngår imidlertid ikke i det offisielle skipsnavnet.\\nPer januar 2011 har skipet tilbakelagt tilsammen 741 106 nautiske mil. Underveis har hun hatt 439 havneanløp i 180 forskjellige havner og besøkt mer enn 60 land på alle kontinenter."},{"page_url":"https://cs.wikipedia.org/wiki/Neproporcion%C3%A1ln%C3%AD_p%C3%ADsmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Proportional-vs-monospace-v4.jpg","page_title":"Neproporcionální písmo","context_page_description":"Neproporcionální písmo, také označované jako písmo s pevnou šířkou, je druh fontu, v němž mají všechny znaky stejnou šířku. Protikladem je písmo proporcionální, kde jsou jednotlivá písmena a mezery mezi nimi různě široké. Například písmena „I“ a „E“ nevyžadují stejné množství prostoru, takže v písmech proporcionálních bude první z nich užší než to druhé. V písmu neproporcionálním by však každé z nich zabíralo stejný prostor.\\nNeproporciální písmo je rozšířenější v případě písmen evropských kultur. V případě východoasijských písem grafická pravidla pro čínštinu, japonštinu a korejštinu čistě neproporcionální písma neumožňují – ovšem existují pro ně písma s dvojitou šířkou, respektive písma s plnou a poloviční šířkou, které se neproporcionalitě blíží používáním pouhých dvou šířek, z nichž jedna je dvojnásobkem druhé. U ostatních druhů písem je to s proporcionalitou různé.\\nRučně psané, malované nebo tesané písmo je obvykle proporcionální, jak to odpovídá tvaru jednotlivých znaků. Sazba písma pro knihtisk může užívat proporcionální typy písma, které jsou obecně čitelnější a lépe vypadají. Také mechanické sázecí stroje pracovaly s literami různé šířky, které prostě skládaly k sobě."},{"page_url":"https://en.wikipedia.org/wiki/Andrew_Blayney,_11th_Baron_Blayney","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/AndrewThomasBlayney.jpg","page_title":"Andrew Blayney, 11th Baron Blayney","context_page_description":"Lieutenant General Andrew Thomas Blayney, 11th Baron Blayney was an Anglo-Irish peer. He ruled the Blayney estate at Castleblayney, County Monaghan for fifty years from 1784 to 1834, and was one of the most illustrious soldiers ever to come from Co. Monaghan.\\nAs commanding officer of the 89th Regiment of Foot, 'Blayney's Bloodhounds' as they were called, he fought with distinction in the Napoleonic Wars. He was taken prisoner at the Battle of Fuengirola, when making a raid from Gibraltar into Spain against a small group of Polish soldiers a tenth his number, and was kept prisoner for four years by the French government. His sabre is currently on exhibition in the Czartoryski Museum, in Kraków.\\nHe wrote a two-volume account of his experiences in the Napoleonic Wars - Narrative of a Forced Journey through Spain and France as a Prisoner of War in the Years 1810 to 1814, by Major-General Lord Blayney. He was captured by one of the O'Callaghans of Cullaville, a colonel in the French army and a prominent United Irishman who escaped after 1798. It is said he insisted on Blayney being held to ransom for some of the United Irishmen who were in British prisons."},{"page_url":"https://hu.wikipedia.org/wiki/Gy%C5%91r-Moson-Sopron_megye_turisztikai_l%C3%A1tnival%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Storno-h%C3%A1z_%284787._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29_3.jpg","page_title":"Győr-Moson-Sopron megye turisztikai látnivalóinak listája","context_page_description":"Ez a lista Győr-Moson-Sopron megye ismert turisztikai látnivalóit tartalmazza."},{"page_url":"https://da.wikipedia.org/wiki/Jon_Dahl_Tomasson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Jon_Dahl_Tomasson.jpg","page_title":"Jon Dahl Tomasson","context_page_description":"Jon Dahl Tomasson er en dansk fodboldtræner for Malmö FF og tidligere fodboldspiller, der senest spillede i hollandske Feyenoord. Siden afslutningen på den aktive karriere har han været træner.\\nTomasson er spilleren med tredjeflest kampe på Danmarks fodboldlandshold og – sammen med Poul \\"Tist\\" Nielsen – den mest scorende spiller. Han trak sig tilbage fra landsholdet i august 2010, og i juni 2011 meddelte han at hans aktive karriere som fodboldspiller var forbi.\\nEfter afslutningen af fodboldkarrieren blev Tomasson træner i den hollandske klub Excelsior i den næstbedste hollandske række. I december 2013 fik Tomasson stillingen som cheftræner i Roda JC, men holdet rykkede ved afslutningen af sæsonen ud af Æresdivisionen, hvorefter klubben afbrød samarbejdet med Tomasson."},{"page_url":"https://pt.wikipedia.org/wiki/Areca_catechu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Betel_nuts3.jpg","page_title":"Areca catechu","context_page_description":"Areca catechu é uma espécie de palmeira encontrada em alguns países de clima tropical da Oceania e do leste da África. Sua noz é bastante empregada para uso medicinal. Acredita-se que tenha sua origem na Malaísia ou nas Filipinas. O nome Areca provém de sua denominação na costa de Malabar, na Índia, e catechu é seu nome de origem malaia. Essa palmeira é erroneamente chamada de bétel, já que sua noz costuma ser mascada juntamente com as folhas da Piper betle, planta da família das piperáceas."},{"page_url":"https://en.wikipedia.org/wiki/Clanis_titan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Clanis_titan_MHNT_CUT_2010_0_321_Ban_Kheum_Laos_female_dorsal.jpg","page_title":"Clanis titan","context_page_description":"Clanis titan, the scarce velvet hawkmoth, is a species of moth of the family Sphingidae."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Haddon_(condado_de_Camden,_Nueva_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Westmont_Theater.JPG","page_title":"Municipio de Haddon (condado de Camden, Nueva Jersey)","context_page_description":"El municipio de Haddon es un municipio ubicado en el condado de Camden en el estado estadounidense de Nueva Jersey. En el año 2010 tenía una población de 14.707 habitantes y una densidad poblacional de 2.014,66 personas por km².​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B1%D1%8B%D1%88%D0%BA%D0%B8%D0%BD,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%D0%9A%D1%83%D0%B1%D1%8B%D1%88%D0%BA%D0%B8%D0%BD_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD.jpg","page_title":"Кубышкин, Константин Владимирович","context_page_description":"Кубышкин Константин Владимирович — российский скульптор. Член Московского Союза Художников. Автор монументальных произведений на тему Отечественной истории. Лауреат Государственной премии Республики Крым в номинации «Изобразительное искусство» за памятник Екатерине II."},{"page_url":"https://it.wikipedia.org/wiki/Pinckard","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Pinckard_Alabama_Street.jpg","page_title":"Pinckard","context_page_description":"Pinckard è un comune degli Stati Uniti d'America situato nella contea di Dale dello Stato dell'Alabama."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Wilhelm_Wagner","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Johann_Wilhelm_Wagner.jpg","page_title":"Johann Wilhelm Wagner","context_page_description":"Johann Wilhelm Wagner war ein deutscher Astronom."},{"page_url":"https://pl.wikipedia.org/wiki/Ji%E2%80%99an_(Tajwan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%E6%9C%A8%E7%93%9C%E6%BA%AA%E6%A9%8B_%2810636595074%29.jpg","page_title":"Ji’an (Tajwan)","context_page_description":"Ji’an – gmina wiejska powiatu Hualian, położonego na Tajwanie, wchodzącego w skład prowincji Tajwan Republiki Chińskiej.\\nPopulacja gminy Ji’an w 2016 roku liczyła 83 656 mieszkańców – 41 407 kobiet i 42 249 mężczyzn. Liczba gospodarstw domowych wynosiła 31 766, co oznacza, że w jednym gospodarstwie zamieszkiwało średnio 2,63 osób."},{"page_url":"https://lmo.wikipedia.org/wiki/Dinami","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Dinami_%28V.V.%29_-_Municipio.jpg","page_title":"Dinami","context_page_description":"Dinami l'è 'n cümü italià, de la regiù de la Calabria, en Pruvìncia de Vibo Valentia. El g'ha presapóch 3.542 abitàncc, 'na superfìce de 44 km² e 'na densità de 81 ab./km². El cunfìna coi cümü de Acquaro, Dasà, Gerocarne, Mileto, San Pietro di Caridà, Serrata."},{"page_url":"https://en.wikipedia.org/wiki/Puja_(Hinduism)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Balinese_Hindu_Puja_Offerings%2C_Ubud_Bali_Indonesia_2010.jpg","page_title":"Puja (Hinduism)","context_page_description":"Puja or pooja is a worship ritual performed in the morning by Hindus to offer devotional homage and prayer to one or more deities, to host and honour a guest, or to spiritually celebrate an event. It may honour or celebrate the presence of special guest, or their memories after they die. The word \\"pūjā\\" is Sanskrit, and means reverence, honour, homage, adoration and worship. Puja, the loving offering of light, flowers, and water or food to the divine, is the essential ritual of Hinduism. For the worshipper, the divine is visible in the image, and the divinity sees the worshipper. The interaction between human and deity, between human and guru, is called darshan, seeing.\\nPuja rituals are also held by Buddhists and Jains. In Hindu practice, puja is done on a variety of occasions, frequency and settings. It may include a daily puja done in the home, or occasional temple ceremonies and annual festivals. In other cases, puja is held to mark a few lifetime events such as birth of a baby or a wedding, or to begin a new venture."},{"page_url":"https://en.wikipedia.org/wiki/Pi%C3%A9lagos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Pi%C3%A9lagos_%28Cantabria%29_Mapa.svg","page_title":"Piélagos","context_page_description":"Piélagos is a municipality in Cantabria, Spain."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%A9xico_(bang)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Mexico_SunMoonPyramid.jpg","page_title":"México (bang)","context_page_description":"Bang México là một bang nằm ở trung tâm của đất nước México. Thủ phủ của bang là Toluca. Lãnh thổ của bang xưa kia từng hình thành nên Đế chế Aztec, và là một đơn vị hành chính của Phó vương quốc Tân Tây Ban Nha thời kỳ thuộc địa. Sau khi độc lập, nhiều phần của bang được tách ra để lập nên các bang Hidalgo, Guerrero và Morelos. Sau khi Thành phố México được chọn làm thủ đô của đất nước, thành phố này được tách khỏi bang. Từ đó bang có hình dạng như ngày nay, gồm Thung lũng Toluca ở phía tây của Thành phố México và một dải đất trải dài xung quanh phía bắc và đông của thủ đô.\\nTên chính thức của bang được gọi đơn giản là “México” theo hiến pháp liên bang México, nhưng để phân biệt với thành phố thủ đô và đất nước, bang thường được gọi là “Estado de México”. Thành phố México không thuộc Bang México."},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%A9on_Danchin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Exposition_G%C3%A9n%C3%A9rosit%C3%A9_12.jpg","page_title":"Léon Danchin","context_page_description":"Léon Danchin, né à Lille le 21 juin 1887, et mort à Bergues le 4 août 1938, est un sculpteur, peintre animalier et graveur français."},{"page_url":"https://et.wikipedia.org/wiki/Pariisi_rahukonverents","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Armenia_in_Paris_Peace_Conference_1919.jpg","page_title":"Pariisi rahukonverents","context_page_description":"Pariisi rahukonverents kutsuti kokku pärast esimest maailmasõda ja töötas 18. jaanuarist 1919 kuni 21. jaanuarini 1920, et leppida kokku rahulepingu tingimustes. Selle istungeid peeti Versailles' lossis, seepärast nimetatakse Pariisi rahukonverentsi vahel ka Versailles' rahukonverentsiks.\\nSaksamaa pidi Versailles' rahulepingus nõustuma kõige raskemate tingimustega, kuna ta kuulutati sõjasüüdlaseks.\\nKuigi rahukonverentsil osalesid paljud riigid, võeti arvesse peamiselt vaid Suure Neliku – USA, Suurbritannia, Prantsusmaa ja Itaalia, täpsemalt nende esindajate – vastavalt president Woodrow Wilsonii, peaminister David Lloyd George'i, peaminister Georges Clemenceau ja peaminister Vittorio Emanuele Orlando otsuseid. Kuigi kõik kolm tahtsid rahu, ei olnud nad üksmeelel selle saavutamise osas."},{"page_url":"https://sv.wikipedia.org/wiki/Megafon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/%22Gera%C3%A7%C3%A3o_%C3%A0_Rasca%22_Demonstration.jpg","page_title":"Megafon","context_page_description":"En megafon är en portabel, ofta handhållen, trattformad apparat som är avsedd att förstärka eller rikta en persons röst. Till exempel används megafoner ofta vid sportevenemang, filminspelningar, demonstrationer eller för att styra större folkmassor.\\nDet finns även batteridrivna apparater bestående av en mikrofon, förstärkare och hornhögtalare sammanbyggda. Mikrofonen kan också vara kabelansluten."},{"page_url":"https://sv.wikipedia.org/wiki/Anna_Katarina_Konstantia_Vasa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Spilberg_Anne_Catherine_Constance_Vasa.jpg","page_title":"Anna Katarina Konstantia Vasa","context_page_description":"Anna Katarina Konstantia Vasa, polska: Anna Katarzyna Konstancja Waza, född 7 augusti 1619 i Warszawa, död 8 oktober 1651 i Köln, dotter till kung Sigismund III av Polen och Konstantia av Steiermark. Gift 8 juni 1642 med Filip Wilhelm av Pfalz-Neuburg i hans första äktenskap. Barnlös.\\nAnna Katarina Vasa förlänades 1632 grevskapen Brodnickie, Gołubskie och Tucholskie av det polska parlamentet. Mellan 1639 och 1642 fördes förhandlingar om ett äktenskap med Ferdinand Karl av Österrike, ärkehertig av Tyrolen, men de förverkligades inte på grund av ålderskillnaden och bråk om hemgiften."},{"page_url":"https://pl.wikipedia.org/wiki/Toyota","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Toyota_Verso.jpg","page_title":"Toyota","context_page_description":"Toyota Motor Corporation – japoński koncern motoryzacyjny utworzony w 1937 roku."},{"page_url":"https://uk.wikipedia.org/wiki/AFDN","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/PBB_GE_MLLT4_208512_s_at_fs.png","page_title":"AFDN","context_page_description":"AFDN – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 6-ї хромосоми. Довжина поліпептидного ланцюга білка становить 1 824 амінокислот, а молекулярна маса — 206 804.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як клітинна адгезія, ацетилювання, альтернативний сплайсинг.\\nЛокалізований у клітинних контактах."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%AD%E5%9B%BD%E5%9B%9B%E5%A4%A7%E5%90%8D%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Chengdemountainresortpic2.jpg","page_title":"中国四大名園","context_page_description":"中国四大名園とは、中国にある次の四つの歴史を有する庭園で、いずれも世界遺産に登録されている。\\n北京の頤和園\\n承徳の避暑山荘\\n以上の2つは北方の皇家園林\\n蘇州の拙政園\\n揚州の個園\\n以上の2つは江南私家園林で蘇州古典園林として一括で世界遺産に登録されている。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%86schne_mixte","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/2016.08.19.-06-Anglersee_Huettenfeld-Lampertheim--Herbst-Mosaikjungfer-Paarungsrad.jpg","page_title":"Æschne mixte","context_page_description":"L'æschne mixte est une espèce de libellules du sous-ordre des anisoptères, de la famille des Aeshnidae."},{"page_url":"https://pl.wikipedia.org/wiki/Pontida","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Pontida_vista.jpg","page_title":"Pontida","context_page_description":"Pontida – miejscowość i gmina we Włoszech, w regionie Lombardia, w prowincji Bergamo.\\nWedług danych na styczeń 2004 gminę zamieszkiwało 3240 osób przy gęstości zaludnienia 319,5 os./1 km²."},{"page_url":"https://az.wikipedia.org/wiki/Hask%C3%B6y","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Hask%C3%B6y_Sanayi_Sitesi_Giri%C5%9Fi_-_panoramio.jpg","page_title":"Hasköy","context_page_description":"Hasköy — Muş ilinin bir ilçəsi."},{"page_url":"https://pl.wikipedia.org/wiki/Chomiczak","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Chinese_Hamster.jpg","page_title":"Chomiczak","context_page_description":"Chomiczak – rodzaj gryzonia z rodziny chomikowatych."},{"page_url":"https://af.wikipedia.org/wiki/Monrovia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MonroviaLB14.png","page_title":"Monrovia","context_page_description":"Monrovia is die hoofstad en grootste stad van Liberië, 'n land in Wes-Afrika aan die Atlantiese Oseaan. Die stad het in 2008 'n bevolking van 1 010 970 gehad. Die stad is op 25 April 1822 gestig en na die Amerikaanse president James Monroe genoem."},{"page_url":"https://id.wikipedia.org/wiki/Oberscharf%C3%BChrer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Bundesarchiv_Bild_101III-Bueschel-164-13%2C_Kurt_Sametreiter.jpg","page_title":"Oberscharführer","context_page_description":"Oberscharführer adalah sebuah pangkat paramiliter Partai Nazi yang ada antara 1932 dan 1945. Diterjemahkan sebagai “pemimpin skuat senior”, Oberscharführer pertama kali digunakan sebagai sebuah pangkat dari Sturmabteilung\\nPangkat SS-Oberscharführer adalah junior dari SS-Hauptscharführer."},{"page_url":"https://en.wikipedia.org/wiki/Powelliphanta_lignaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Powelliphanta_lignaria_johnstoni_DOC_2004.jpg","page_title":"Powelliphanta lignaria","context_page_description":"Powelliphanta lignaria, known as one of the amber snails, is a species of large, carnivorous land snail, a terrestrial pulmonate gastropod mollusc in the family Rhytididae. The eggs of P. lignaria are oval and seldom constant in dimensions 10 × 8.25, 9 × 7.75, 9 × 8, 8.75 × 7.75 mm.\\nP. lignaria is endemic to the west coast of the South Island of New Zealand. There are seven subspecies, all of which are listed by the New Zealand Department of Conservation as threatened:\\nPowelliphanta lignaria johnstoni Powell, 1946 – Nationally Endangered\\nPowelliphanta lignaria lignaria Hutton, 1888 – Nationally Vulnerable\\nPowelliphanta lignaria lusca Powell, 1949 – Nationally Vulnerable\\nPowelliphanta lignaria oconnori Powell, 1938 – Nationally Vulnerable\\nPowelliphanta lignaria rotella Powell, 1938 – Nationally Endangered\\nPowelliphanta lignaria ruforadiata Powell, 1949 – Nationally Endangered\\nPowelliphanta lignaria unicolorata Powell, 1930 – Nationally Vulnerable"},{"page_url":"https://war.wikipedia.org/wiki/Ictonyx","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Striped_polecat.jpg","page_title":"Ictonyx","context_page_description":"An Ictonyx in uska genus han Mammalia. An Ictonyx in nahilalakip ha familia nga Mustelidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://es.wikipedia.org/wiki/Electrificaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Pantograaf_lichtrail.jpg","page_title":"Electrificación","context_page_description":"La Real Academia Española define electrificación como «acción y efecto de electrificar», ​ y electrificar como: «1. Hacer que algo funcione por medio de la electricidad. 2. Proveer de electricidad a un lugar.»​\\nAunque se puede hacer que muchos tipos de aparatos o sistemas que originalmente funcionan con una energía distinta de la electricidad pasen a usarla, el término \\"electrificación\\" se ha venido empleando en dos acepciones principales: modernización de líneas ferroviarias donde originalmente solo circulaban locomotoras de vapor o diésel, y extensión de la red eléctrica a zonas donde antes no llegaba.\\nEn su sentido ferroviario, la electrificación es la construcción de un sistema de alimentación de tracción por el cual la energía eléctrica procedente de una línea exterior de alta tensión pasa por una subestación, circula por el elemento conductor instalado a lo largo de la vía, penetra en la locomotora a través del captador de corriente, alimenta los motores y retorna, cerrando el circuito, por los carriles y alimentadores negativos, si los hay, o, en otro caso, por tierra."},{"page_url":"https://sv.wikipedia.org/wiki/Piptadeniastrum_africanum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Piptadenia_sp._nov.2.jpg","page_title":"Piptadeniastrum africanum","context_page_description":"Piptadeniastrum africanum är en ärtväxtart som först beskrevs av Joseph Dalton Hooker, och fick sitt nu gällande namn av John Patrick Micklethwait Brenan. Piptadeniastrum africanum ingår i släktet Piptadeniastrum och familjen ärtväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Schl%C3%B6sser_von_Laxenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Filmarchiv_Austria_Laxenburg_DSC_4727w.jpg","page_title":"Schlösser von Laxenburg","context_page_description":"Die Schlösser von Laxenburg befinden sich in der Gemeinde Laxenburg in Niederösterreich an der Grenze zu Wien. Im großen Schlosspark befinden sich das Alte Schloss, der Blaue Hof sowie die Franzensburg."},{"page_url":"https://fr.wikipedia.org/wiki/Frederic_Augustus_Thesiger","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/On_the_march_in_Zululand.jpg","page_title":"Frederic Augustus Thesiger","context_page_description":"Frederic Augustus Thesiger, 2ᵉ baron Chelmsford, né le 31 mai 1827 et décédé le 9 avril 1905, est un général britannique connu surtout pour avoir déclenché la guerre anglo-zouloue, au cours de laquelle l'armée britannique connut une de ses défaites les plus retentissantes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BD%D0%B4%D0%B0%D1%80%D0%B5%D0%B2,_%D0%A2%D0%B8%D0%BC%D0%BE%D1%84%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/e3/%D0%91%D0%BE%D0%BD%D0%B4%D0%B0%D1%80%D0%B5%D0%B2.JPG","page_title":"Бондарев, Тимофей Михайлович","context_page_description":"Тимофе́й Миха́йлович Бондарёв — российский философ-самоучка, чей трактат «Трудолюбие и тунеядство, или Торжество земледельца» вдохновлял Льва Толстого."},{"page_url":"https://en.wikipedia.org/wiki/Conteville,_Seine-Maritime","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Conteville_mairie.JPG","page_title":"Conteville, Seine-Maritime","context_page_description":"Conteville is a commune in the Seine-Maritime department in the Normandy region in northern France."},{"page_url":"https://en.wikipedia.org/wiki/List_of_painted_churches_in_Cyprus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Kakopetria_Geburt_Jesu.jpg","page_title":"List of painted churches in Cyprus","context_page_description":"There are over sixty churches in Cyprus with Byzantine and post-Byzantine wall paintings. Of these, ten that are situated in the Troodos Mountains have been inscribed jointly on the UNESCO World Heritage List as the Painted Churches in the Troodos Region."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_de_Belgique_de_football","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Marc_Wilmots_%28cropped%29.JPG","page_title":"Équipe de Belgique de football","context_page_description":"L'équipe de Belgique de football est la sélection de joueurs belges représentant le pays lors des compétitions internationales de football masculin, sous l'égide de la Royal Belgian Football Association.\\nLes internationaux belges sont surnommés les « Diables Rouges », en néerlandais Rode Duivels, en référence à la couleur de leur maillot, depuis 1906, bien que ce surnom ne soit devenu officiel que plus tard. Durant le mandat de Raymond Goethals, dans les années 1970, ils sont aussi appelés les « Diables Blancs » ou encore les « Diables Noirs » au début des années 2000, après l'introduction du maillot extérieur entièrement noir.\\nLe premier match officiel de la Belgique est organisé le 1ᵉʳ mai 1904 à Bruxelles contre la France et se solde par un partage. La sélection belge remporte en 1920 la médaille d'or aux Jeux olympiques. La Belgique a depuis participé à treize phases finales de la Coupe du monde. Son meilleur résultat est la troisième place atteinte lors de la Coupe du monde 2018 en Russie. En Championnat d'Europe, son meilleur résultat est une finale en 1980, perdue contre l'Allemagne."},{"page_url":"https://it.wikipedia.org/wiki/Mimetismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/2A_wasp_2007-04-25.jpg","page_title":"Mimetismo","context_page_description":"Con mimetismo fanerico si intende la capacità di un organismo di imitarne un altro, allo scopo di trarne vantaggio. Di norma si concretizza nell'imitazione da parte di una potenziale preda di un organismo aposematico, che può essere tossico, disgustoso o comunque indesiderabile. Lo scopo in questo caso è quello di scoraggiare il predatore affinché rinunci alla preda, confondendola con quella indesiderabile. Nei casi più semplici il mimetismo prevede l'esistenza di un organismo modello e di un organismo mimo che ne imita le caratteristiche.\\nIl mimetismo può avere scopi diversi da quelli di evasione della predazione, come per esempio l'imitazione da parte di alcune orchidee delle forme della vespa femmina allo scopo di attirare gli impollinatori.\\nIl mimetismo può sfruttare somiglianze di forme e colori ma anche di comportamenti.\\nViene talvolta definito come mimetismo criptico il fenomeno del criptismo, nel quale invece l'organismo si confonde con l'ambiente circostante allo scopo di rendersi invisibile al suo predatore o alla sua preda."},{"page_url":"https://ia.wikipedia.org/wiki/Scientia_social","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Wealth_of_Nations_title.jpg","page_title":"Scientia social","context_page_description":"Le scientias social esse le gruppo de scientias que se tracta con aspectos del comportamento e activitates human, studiate in le scientias natural. Le scientias social examina le effectos material e inmaterial de societates.\\nLe principe characteristica que divide le scientias natural e le scientias social esse gratias al facto que le esseres human habe le capabilitate cognitive que crea un conscientia e abstracte representationes mental, representationes que pote influentiar le comportamento e crear regulas social inter individuos. Le scientias natural se tracta con le activitates mental, e le scientias social pone plus emphase al methodo scientific e altere methodologias rigorose de analyse.\\nLe majoritate del scientias social non pote establir leges universal, proque su objectivo esse simplemente observar e interpretar le activitates human, ma hodie il habe plure scientistas qui essaya crear predictiones e leges hypothetic re activitates social basate in observation scientific. Frequentemente, iste predictiones e leges esse pasate in le vistas subjective de personas."},{"page_url":"https://fi.wikipedia.org/wiki/N%C3%A1xoksen_arkeologinen_museo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Geometrische_Vasen_Naxos_01.jpg","page_title":"Náxoksen arkeologinen museo","context_page_description":"Náxoksen arkeologinen museo on arkeologinen museo Náxoksen kaupungissa eli Chórassa Náxoksen saarella Kreikassa. Se esittelee saarelta löytynyttä pääosin antiikin aikaista esineistöä.\\nMuseo on perustettu vuonna 1973. Se toimii Náxoksen kaupungin frankkivallan aikaisessa linnassa eli Kástrossa. Alun perin venetsialainen museorakennus on rakennettu vaiheittain noin vuosina 1600–1800. Se on viisikerroksinen ja rakennettu kiinni linnan muuriin, ja siihen kuuluu kaksi linnan torneista. Alun perin 1600-luvulla rakennuksessa toimi jesuiittojen koulu, ja 1800-luvulla sekä 1900-luvun alussa kauppakoulu.\\nNáxoksella toimii myös kaksi muuta arkeologista museota, Apeíranthoksen arkeologinen museo ja Gýroulaksen arkeologinen museo Sagkríssa."},{"page_url":"https://ro.wikipedia.org/wiki/Andrest","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Map_commune_FR_insee_code_65007.png","page_title":"Andrest","context_page_description":"Andrest este o comună în departamentul Hautes-Pyrénées din sudul Franței. În 2009 avea o populație de 1.376 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Tarrare","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/M%C3%A9moire_sur_la_polyphagie_I.jpg","page_title":"Tarrare","context_page_description":"Tarrare, sometimes spelled Tarare, was a French showman and soldier, noted for his unusual appetite and eating habits. Able to eat vast amounts of meat, he was constantly hungry; his parents could not provide for him, and he was turned out of the family home as a teenager. He travelled France in the company of a band of thieves and prostitutes, before becoming the warm-up act to a travelling charlatan. In this act he would swallow corks, stones, live animals and a whole basketful of apples. He then took this act to Paris where he worked as a street performer.\\nAt the start of the War of the First Coalition, Tarrare joined the French Revolutionary Army, where even quadruple the standard military ration was unable to satisfy his large appetite. He would eat any available food from gutters and refuse heaps but his condition still deteriorated through hunger. He was hospitalised due to exhaustion and became the subject of a series of medical experiments to test his eating capacity, in which, among other things, he ate a meal intended for 15 people in a single sitting, ate live cats, snakes, lizards and puppies, and swallowed eels whole without chewing."},{"page_url":"https://nl.wikipedia.org/wiki/Ouides","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Map_commune_FR_insee_code_43145.png","page_title":"Ouides","context_page_description":"Ouides is een gemeente in het Franse departement Haute-Loire en telt 55 inwoners. De plaats maakt deel uit van het arrondissement Le Puy-en-Velay."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8A%9D%E6%B5%A6%E3%82%A2%E3%82%A4%E3%83%A9%E3%83%B3%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/2018_Shibaura_Island.jpg","page_title":"芝浦アイランド","context_page_description":"芝浦アイランドは、東京都港区芝浦4丁目にある再開発地区の総称・愛称である。再開発地区は四方を運河に囲まれた島状の区域のほぼ全周に及び、複数の事業者による高級大規模マンションや港区による公共施設などから構成されている。"},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Jana_Kili%C5%84skiego_w_Radomiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Radom.Resursa_Rzemie%C5%9Blnicza_02.jpg","page_title":"Ulica Jana Kilińskiego w Radomiu","context_page_description":"Ulica Jana Kilińskiego w Radomiu – ulica w Radomiu w dzielnicy Śródmieście.\\nUlica Kilińskiego biegnie od ul. Witolda do ul. Staszica. Zalicza się do kategorii dróg gminnych. Ma długość około 440 metrów. Przy ul. Kilińskiego 25 znajduje się VI Liceum Ogólnokształcące im. Jana Kochanowskiego."},{"page_url":"https://eu.wikipedia.org/wiki/Kowloon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Hong_Kong_Kowloon.svg","page_title":"Kowloon","context_page_description":"Kowloon, Txinako Herri Errepublikako Hong Kong administrazio bereziko eskualdea osatzen duten guneetako bat da Hong Kong uhartea eta Lurralde Berriekin batera."},{"page_url":"https://it.wikipedia.org/wiki/Contea_di_Salem","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Salem_NJ.jpg","page_title":"Contea di Salem","context_page_description":"La contea di Salem, in inglese Salem County, è una contea del New Jersey sud-occidentale negli Stati Uniti."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AA%E3%82%AF%E3%82%A8%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/5N-MJN_Boeing_737-800_Arik_%286058320247%29_%282%29.jpg","page_title":"アリクエア","context_page_description":"アリクエアはナイジェリアのラゴスに本拠地を置く航空会社である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Jena","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Jena_Am_Teich_3.jpg","page_title":"Liste der Kulturdenkmale in Jena","context_page_description":"Diese Liste enthält alle Kulturdenkmale der thüringischen Stadt Jena und ihrer Ortsteile."},{"page_url":"https://it.wikipedia.org/wiki/Cucina_agrigentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Broad-beans-after-cooking.jpg","page_title":"Cucina agrigentina","context_page_description":"La cucina agrigentina si riferisce alle caratteristiche e abitudini alimentari che traggono origine da questa zona di Sicilia."},{"page_url":"https://lv.wikipedia.org/wiki/Kapteinis_(futbols)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Philipp_Lahm%2C_Germany_national_football_team_%2806%29.jpg","page_title":"Kapteinis (futbols)","context_page_description":"Komandas kapteinis futbolā ir komandas dalībnieks, kurš izvēlēts par līderi laukumā. Bieži vien tas ir viens no vecākajiem un vispieredzējušākajiem komandas dalībniekiem vai spēlētājs, kurš var individuāli ietekmēt spēles gaitu. Kapteinis parasti nēsā rokas apsēju.\\nFutbola noteikumos vienīgie norādītie kapteiņa pienākumi ir piedalīšanās monētas mešanā pirms spēles uzsākšanas un pirms pēcspēles 11 metru sitienu sērijas. Pretēji populāram uzskatam, kapteiņiem saskaņā ar spēles noteikumiem nav īpašu tiesību apstrīdēt tiesneša lēmumu. Tomēr tiesneši reizēm var pārrunāt ar komandas kapteini komandas vispārējo uzvedību. Iegūstot kādu trofeju, apbalvošanā tā vispirms tiek pasniegta komandas kapteinim."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%84%D0%B2%D1%80%D0%BE%D0%BC%D0%B0%D0%B9%D0%B4%D0%B0%D0%BD_%D1%83_%D1%80%D0%B5%D0%B3%D1%96%D0%BE%D0%BD%D0%B0%D1%85_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/EuroMaydan05.jpg","page_title":"Євромайдан у регіонах України","context_page_description":"Євромайдан у регіонах України — акції протестів проти режиму Віктора Януковича в містах та селах України під час Єврореволюції в період з листопада 2013 по лютий 2014 року."},{"page_url":"https://fr.wikipedia.org/wiki/Arbellara","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Arbellara_02.JPG","page_title":"Arbellara","context_page_description":"Arbellara est une commune française située dans la circonscription départementale de la Corse-du-Sud et le territoire de la collectivité de Corse. Le village appartient à la piève de Viggiano."},{"page_url":"https://it.wikipedia.org/wiki/La_ragazza_alla_pari","image_url":"https://upload.wikimedia.org/wikipedia/it/3/3a/La_ragazza_alla_pari.jpg","page_title":"La ragazza alla pari","context_page_description":"La ragazza alla pari è un film del 1976 diretto da Mino Guerrini."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8E%E3%83%89%E3%82%B0%E3%83%AD%E3%82%A2%E3%82%AA%E3%82%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Emberiza_cirlus_MHNT.ZOO.2010.11.216_St_Mor%C3%A9_Yonne.jpg","page_title":"ノドグロアオジ","context_page_description":"ノドグロアオジは、鳥の一種。\\n名前の由来は、アオジに似た種で、喉が黒いことより。\\n日本では観察されていない。"},{"page_url":"https://en.wikipedia.org/wiki/Matthew_Ridley_Corbet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Matthew_Ridley_Corbet_by_John_McLure_Hamilton.jpg","page_title":"Matthew Ridley Corbet","context_page_description":"Matthew Ridley Corbet ARA was a Victorian neoclassical painter."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%87%BA%E6%9D%B1%E8%BD%89%E9%81%8B%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Taitung_Bus_Station06.jpg","page_title":"臺東轉運站","context_page_description":"台东转运站是一座位于台湾台东县台东市的汽车客运转运站，该转运站是台湾铁路管理局台东车站旧站废止后改建而成。于2015年6月19日正式完工启用。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BD%D1%8C%D1%87%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/HK_Causeway_Bay_Buidlings_2007.jpg","page_title":"Ваньчай","context_page_description":"Ваньчай, Ван-Чай — один из 18 округов Гонконга. Расположен в центре северной части острова Гонконг. Включает в свой состав районы Ваньчай, Козуэй-Бей, Хэппи-Вэлли и Тайхан."},{"page_url":"https://de.wikipedia.org/wiki/Champagne_and_Aishihik_First_Nations","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Da_Ku_Our_House.JPG","page_title":"Champagne and Aishihik First Nations","context_page_description":"Die Champagne and Aishihik First Nations bilden zusammen eine der drei kanadischen First Nations im Yukon der Südlichen Tutchone.\\nIhr Name leitet sich von zwei bedeutenden historischen Siedlungen um Champagne Landing 10 am Dezadeash River, einem Nebenfluss des Alsek Rivers und um Aishihik am Nordufer des Aishihik Lake, aus dem der Aishihik River entspringt, ab. Die meisten von ihnen leben jedoch heute im Verwaltungssitz Haines Junction, einige auch um Klukshu; viele Stammesmitglieder wohnen ebenfalls in Whitehorse, der Hauptstadt des Territoriums.\\nIhr traditionelles Gebiet erstrecke sich im Entwässerungsgebiet des Yukon Rivers bis in den Nordwesten von British Columbia, wo allein 12.000 der 41.000 km² ihres Gebietes lagen. Ebenfalls einst von Südlichen Tutchone bewohnte Orte wie Kloo Lake, Klukshu, Canyon, Dalton Post, Hutshi/Hutchi Lakes, Kusawa und Takhini sind heute meist unbewohnt oder werden nur noch saisonal bzw. aus traditionellen / kulturellen Gründen aufgesucht.\\nZu den Champagne and Aishihik First Nations rechnete das Department of Indian Affairs and Northern Development im Jahr 2001 genau 550 Angehörige. Das Aboriginal Portal Canada gibt 729 Stammesangehörige an."},{"page_url":"https://lv.wikipedia.org/wiki/C4P","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/POL_C4P.jpg","page_title":"C4P","context_page_description":"C4P — Polijas armijas artilērijas vilcējs, kurš tika izmantots Otrajā Pasaules karā. Universāls artilērijas vilcējs, kurš spēja pārvietot ne tikai vieglos lielgabalus, bet arī smago artilēriju."},{"page_url":"https://fr.wikipedia.org/wiki/Bercy_(Seine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/D%C3%A9partement_de_la_Seine_-_1860_Bercy.svg","page_title":"Bercy (Seine)","context_page_description":"Bercy est une ancienne commune de l'ancien département de la Seine qui a existé de 1790 à 1859 avant son incorporation au territoire de la ville de Paris."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%94%BC%EA%B7%B8%EB%AF%B8%EC%A3%BC%EB%A8%B8%EB%8B%88%EC%A5%90%EC%86%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Cercartetus_nanus.jpg","page_title":"피그미주머니쥐속","context_page_description":"피그미주머니쥐속은 캥거루목에 속하는 유대류 속으로 아주 작은 주머니쥐로 이루어져 있다. 4종을 포함하고 있으며, 꼬마주머니쥐과에 속한다. 학명 Cercaërtus은 Cercartetus의 오타 또는 이명이다. 그러나 Cercaërtus은 Trichosurus의 이명이지만, Cercartetus은 Trichosurus의 이명이 아니다. 국제보존협회와 인도네시아 과학기술연구원은 2007년 6월, 포자산맥에서 피그미주머니쥐속에 속하는 신종을 발견했을 가능성에 대해 보고했다."},{"page_url":"https://en.wikipedia.org/wiki/Operation_Amarillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Operation_Amarillo_25_August_1966.jpg","page_title":"Operation Amarillo","context_page_description":"Operation Amarillo was an operation conducted by 1st Brigade, 1st Infantry Division in Bình Dương Province, lasting from 23–31 August 1966."},{"page_url":"https://eo.wikipedia.org/wiki/Temes_(historia_departemento)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Temes.png","page_title":"Temes (historia departemento)","context_page_description":"Temes [temeŝ] estis historia reĝa departemento en la suda parto de la Hungara Reĝlando, germane: Komitat Temesch, rumane: Comitatul Timiș.\\nDepartementejo: Temesvár\\nAreo: 7 110 km²\\nLoĝantaro: 500 835 en 1910"},{"page_url":"https://en.wikipedia.org/wiki/Flaoui","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Heavyneolithicsteepscraper.jpg","page_title":"Flaoui","context_page_description":"Flaoui or Fleywe or Flaoueh is a small village located 17 kilometres northwest of Baalbek, Lebanon in Baalbek District, Baalbek-Hermel Governorate, Lebanon. It is located near the north–south road that runs from Bodai to Chlifa.\\nA Heavy Neolithic archaeological site of the Qaraoun culture is located in the area on fielded slopes of a small valley facing the Beqaa valley. It was discovered by Lorraine Copeland and Frank Skeels in 1965 with materials examined by Henri Fleisch. Worked tools were found made from abundant nodules of silicious, grey-yellow limestone. The material suggested to be Heavy Neolithic consisted of massive, rough cores and flakes with another group being found that showed resemblance to an assemblage termed by Fleisch the Micro-Mousterian. The site was under cultivation in 1966."},{"page_url":"https://es.wikipedia.org/wiki/Las_Carboneras","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Fiesta_popular_Las_Carboneras.JPG","page_title":"Las Carboneras","context_page_description":"Las Carboneras es un caserío del macizo de Anaga perteneciente administrativamente al municipio de San Cristóbal de La Laguna, en la isla de Tenerife —Canarias, España—.\\nEs uno de los núcleos que forman la zona conocida como Las Montañas, que aglutina a la mayoría de los caseríos ubicados en el macizo de Anaga pertenecientes a La Laguna.​\\nPosee muestras de arquitectura rural canaria, así como caminos aptos para la práctica del excursionismo."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%AF%D1%80%D0%BE%D1%81%D0%BB%D0%B0%D0%B2_%D0%9F%D0%BB%D0%B0%D1%88%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Jaroslav_Pla%C5%A1il.jpg","page_title":"Ярослав Плашил","context_page_description":"Ярослав Плашил — Чехийн хөлбөмбөгчин бөгөөд Францын «Бордо» болон Чехийн шигшээд хагас хамгаалагч тоглодог."},{"page_url":"https://en.wikipedia.org/wiki/Combat_helmet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Swedish_M1937-65_helmet.jpg","page_title":"Combat helmet","context_page_description":"A combat helmet or battle helmet is a type of helmet, a piece of personal armor designed specifically to protect the head during combat."},{"page_url":"https://en.wikipedia.org/wiki/Strathocles","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Strathocles_imitata_female_Druce_1891.png","page_title":"Strathocles","context_page_description":"Strathocles is a genus of moths of the family Noctuidae."},{"page_url":"https://lt.wikipedia.org/wiki/Sar%C4%97s_apskritis","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Koigi_031.jpg","page_title":"Sarės apskritis","context_page_description":"Sarės apskritis, Sarema yra Vakarų Estijoje. Sudaro Saremos, Muhu, Ruhnu, Abrukos, Vilsandės ir kitos mažesnės aplinkinės salelės. Administracinis centras – Kuresarė."},{"page_url":"https://de.wikipedia.org/wiki/Santa_Venerina","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Chiesa_Maria_Santissima_Immacolata_di_Dagala_del_Re%2C_Santa_Venerina.jpg","page_title":"Santa Venerina","context_page_description":"Santa Venerina ist eine Stadt und Gemeinde der Metropolitanstadt Catania in der Region Sizilien in Italien mit 8549 Einwohnern."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B0%D0%B1%D0%B5%D1%80%D0%B5%D0%B6%D0%BD%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Moscow%2C_Krymskaya_Embankment_2014.JPG","page_title":"Крымская набережная","context_page_description":"Кры́мская на́бережная — пешеходная набережная в Москве, расположенная в районе Якиманка, протянувшаяся по правому берегу Москвы-реки. Набережная ограничена Крымским Валом и 3-м Голутвинским переулком, продолжает Пушкинскую набережную и переходит в Якиманскую набережную."},{"page_url":"https://nl.wikipedia.org/wiki/Canobie_Lake_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Canobie_Lake_Park_Rollercoaster_train.jpg","page_title":"Canobie Lake Park","context_page_description":"Canobie Lake Park is een attractiepark gelegen in Salem, New Hampshire, Verenigde Staten. Het park is geopend op 23 augustus 1902, en is sindsdien elk jaar geopend geweest."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BE%9B%E5%AD%90%E6%98%8E%E5%A4%AA%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Mentaiko_spaghetti_by_kaex0r.jpg","page_title":"辛子明太子","context_page_description":"辛子明太子は、スケトウダラの卵巣を唐辛子などで漬け込んだもの。"},{"page_url":"https://de.wikipedia.org/wiki/Mondbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Moon%27s_orbit_-_Variation_of_eccentricity_de.png","page_title":"Mondbahn","context_page_description":"Als Mondbahn wird die annähernd elliptische Umlaufbahn des Mondes um die Erde bezeichnet.\\nDa der Mond nicht nur der Anziehungskraft der Erde, sondern zugleich auch derjenigen der Sonne und der übrigen Planeten ausgesetzt ist, weicht seine Bahn merklich von einer reinen Keplerellipse ab. Die genaue Bahnberechnung ist eine komplizierte Aufgabe, deren Lösung Gegenstand der Mondtheorie ist. Die Auseinandersetzung mit diesem Problem der Himmelsmechanik gab Anstoß zu vielen bedeutenden physikalischen und mathematischen Entwicklungen."},{"page_url":"https://az.wikipedia.org/wiki/Nar%C4%B1n-Qala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%D0%94%D0%B0%D0%B3-%D0%9A%D0%B0%D0%BF%D1%8B._%D0%94%D0%B5%D1%80%D0%B1%D0%B5%D0%BD%D1%82.jpg","page_title":"Narın-Qala","context_page_description":"Narınqala və ya İçqala — Dərbənd qalasının mərkəzini təşkil edən islamdan əvvəlki dövrə aid qədim qəsrdir. Sasanilər imperiyasının Kaspi qapısını bağlayan qoşa qala divarları vasitəsi ilə Xəzər dənizi ilə əlaqələndirilmişdir. Abidə UNESCO Ümumdünya irsi siyahısına daxil edilmişdir."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B2%D1%87%D1%83%D0%B3_%D0%BA%D0%BE%D0%BB%D1%8E%D1%87%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Ononis_spinosa_002.JPG","page_title":"Вовчуг колючий","context_page_description":"Вовчуг колючий — вид рослин родини бобові, поширений у Європі, західній Азії й Північній Африці."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_p%C3%A1pe%C5%BEov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/159-Blessed_Urban_II.jpg","page_title":"Zoznam pápežov","context_page_description":"Toto je kompletný zoznam osôb s titulom rímsky pápež. Rímsky pápež je hlavou katolíckych cirkví. Jeho súčasný úradný titul pápeža znie „biskup rímsky, nástupca kniežaťa apoštolov, prímas taliansky, arcibiskup a metropolita rímskej cirkevnej provincie, suverén štátu mesta Vatikán“. Od 6. storočia sa využíva aj titul „servus servorum Dei“. Ďalšími titulmi pápežov sú Summus Pontifex a Pontifex Maximus. Do roku 2006 pápežom prislúchal aj titul „patriarcha západu“. Okrem rímskych pápežov používa titul pápež ešte niekoľko kresťanských náboženských vodcov. Súčasným, 266. pápežom Katolíckej cirkvi je pápež František.\\nZoznam pápežov býva často upravovaný. Každý rok je zoznam publikovaný spolu so životopismi jednotlivých pápežov v cirkevnej ročenke Annuario Pontificio. Zmeny sú spôsobované najmä pre nejasnosť platných nástupníctiev v niektorých starších dátumoch. Z prvých päťdesiatych pápežov bolo 48 vyhlásených za svätých, pričom z prvých 31 pápežov 28 zomreli ako mučeníci."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%82%B7%E3%83%A5%E3%82%AC%E3%83%B3%E3%83%93%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Die_Familie_des_Perserk%C3%B6nigs_Darius_nach_der_Schlacht_bei_Issos_im_Zelt_Alexanders_des_Gro%C3%9Fen_%28Le_Brun%29.jpg","page_title":"シシュガンビス","context_page_description":"シシュガンビス、又はシシガンビス、は、アケメネス朝ペルシアの王アルタクセルクセス2世の娘である。王族のアルサメスと結婚し、アケメネス朝ペルシアの最後の王となるダレイオス3世を生んだ。"},{"page_url":"https://ca.wikipedia.org/wiki/Rep%C3%BAblica_de_Maryland","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Cape_Palmas_mission.jpg","page_title":"República de Maryland","context_page_description":"La República de Maryland, també coneguda com a Estat Independent de Maryland, va ser un petit estat africà que va existir des de 1854 fins al 1857 quan es va unir a Libèria. La zona que ocupava va ser habitada per primera vegada el 1834 per esclaus afroamericans alliberats o nascuts en llibertat, procedents primerament de l'estat nord-americà de Maryland, sota els auspicis de la Maryland State Colonization Society. Altres assentaments afroamericans s'havien unit en la Commonwealth de Libèria, la qual va declarar la seva independència el 1847. La colònia de Maryland, a Libèria, es va mantenir apartada en tant que la societat estatal colonitzadora pretenia mantenir el monopoli comercial en aquesta àrea. El 2 de febrer de 1841, Maryland in Àfrica es va convertir en l'estat de Maryland. El país va declarar la seva independència el 29 maig 1854 com a Maryland a Liberia, amb la capital situada a Harper."},{"page_url":"https://fr.wikipedia.org/wiki/Poisson_aveugle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Typhleotris_madgascarensis.jpg","page_title":"Poisson aveugle","context_page_description":"En zoologie, poisson aveugle est un nom ambigu qui désigne plusieurs espèces de poissons sans yeux fonctionnels. Ce sont des espèces cavernicoles ou abyssales dont les yeux, inutiles dans l'obscurité ambiante, se recouvrent d'une couche graisseuse quand ils sont présents chez les jeunes, rendant l'animal complètement aveugle à l'âge adulte."},{"page_url":"https://pt.wikipedia.org/wiki/Roterd%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Rotterdam_4.45392E_51.91454N.jpg","page_title":"Roterdão","context_page_description":"Roterdão ou Roterdã é a segunda maior e mais importante cidade dos Países Baixos, ficando atrás somente da capital, Amsterdã. Sede do maior porto marítimo da Europa, possui cerca de 617 347 habitantes. Está situada às margens do rio Nieuwe Maas na província da Holanda do Sul.\\nO nome \\"Rotterdam\\" é derivado de uma represa em um pequeno rio, o Rotte, que se junta ao Nieuwe Maas no local onde a cidade foi fundada. É uma das cidades holandesas com uma arquitetura mais moderna, apresentando diversas construções famosas como é o caso das casas cúbicas."},{"page_url":"https://en.wikipedia.org/wiki/List_of_birds_of_Thailand","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Fulvous_Breasted_Woodpecker_I3_Picture_123.jpg","page_title":"List of birds of Thailand","context_page_description":"The birds of Thailand included 1076 species as of 2019. Of them, more than 100 are rare or accidental, six have been introduced by humans, and eight have been extirpated. Seventy two of the country's species are globally threatened.\\nThe birds of Thailand are mainly typical of the Indomalayan realm, with affinities to the Indian subcontinent to the west, and, particularly in Southern Thailand, with the Sundaic fauna to the southeast. The northern mountains are outliers of the Tibetan Plateau, with many species of montane birds, and in winter the avifauna is augmented by migrants from the eastern Palearctic and Himalayas. That Thailand's habitats are contiguous with those of neighbouring countries explains the low number of endemic species.\\nIn 1991, it was estimated that 159 resident and 23 migratory species were endangered or vulnerable due to forest clearance, illegal logging, hunting and habitat degradation, especially in the lowlands. The species most affected are large water birds whose wetland habitat has been largely lost to agriculture, and forest species, as deforestation for agriculture and logging have removed and degraded portions of the woodlands."},{"page_url":"https://en.wikipedia.org/wiki/Eastern_Bengal_and_Assam","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Sir_Fuller_arrives_in_Dhaka_1905.jpg","page_title":"Eastern Bengal and Assam","context_page_description":"Eastern Bengal and Assam was an administrative subdivision of the British India between 1905 and 1912. Headquartered in the city of Dacca, it covered territories in what are now Bangladesh, Northeast India and Northern West Bengal."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%B5%CE%BB%CE%B3%CE%B9%CE%BA%CE%AE_%CE%95%CF%80%CE%B1%CE%BD%CE%AC%CF%83%CF%84%CE%B1%CF%83%CE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Wappers_belgian_revolution.jpg","page_title":"Βελγική Επανάσταση","context_page_description":"Η Βελγική Επανάσταση ήταν μια σύγκρουση στο Ηνωμένο Βασίλειο των Κάτω Χωρών που ξεκίνησε με μια ταραχή στις Βρυξέλλες τον Αύγουστο του 1830 και τελικά οδήγησε στην εγκαθίδρυση ενός ανεξάρτητου, Καθολικού και ουδέτερου Βελγίου.\\nΟι Κάτω Χώρες αποτίναξαν την Ναπολεόντεια ηγεσία τους το 1813. Στην Αγγλο-Ολλανδική Συνθήκη του 1814 χρησιμοποιήθηκαν τα ονόματα «Ενωμένες Επαρχίες των Κάτω Χωρών» και «Ενωμένες Κάτω Χώρες». Μετά την ήττα του Ναπολέοντα Α΄ το 1815, το Συνέδριο της Βιέννης δημιούργησε ένα βασίλειο για τον Οίκο της Οράγγης-Νασσάου, ενώνοντας τις Ενωμένες Επαρχίες των Κάτω Χωρών με τις πρώην Αυστριακές Κάτω Χώρες, με σκοπό να δημιουργήσει ένα ισχυρό ουδέτερο κράτος στα βόρεια της Γαλλίας. Η ένωση αποκλήθηκε Ηνωμένο Βασίλειο των Κάτω Χωρών."},{"page_url":"https://pl.wikipedia.org/wiki/Aleksander_(cesarz_bizanty%C5%84ski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Alexandros_mosaic_Hagia_Sophia.JPG","page_title":"Aleksander (cesarz bizantyński)","context_page_description":"Aleksander – cesarz bizantyński w latach 912 - 913.\\nBył synem cesarza Bazylego I i jego drugiej żony Eudokii Ingeriny. Jego starszym bratem był cesarz Leon VI Filozof. W latach 879-912 współrządził ze swym ojcem i bratem. Po śmierci Leona w r. 912 został jego następcą i równocześnie regentem nieletniego bratanka, Konstantyna.\\nJako samodzielny cesarz panował bardzo krótko. Nie miał żadnych predyspozycji do sprawowania władzy, gdyż był lekkoduchem i sprawami państwowymi nie interesował się w najmniejszym stopniu. Po śmierci brata zamknął cesarzową w klasztorze, a doradców Leona pozbawił urzędu. W czasie jego krótkiego panowania Bułgarzy zaczęli przygotowywać potężny atak na cesarstwo. Zmarł podczas przygotowań do wojny w r. 913. Na łożu śmierci wyznaczył na swego następcę małoletniego bratanka, Konstantyna, który panował jako Konstantyn VII."},{"page_url":"https://de.wikipedia.org/wiki/Ry%C5%ABk%C5%8D-ji","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Ryukoji-M8749.jpg","page_title":"Ryūkō-ji","context_page_description":"Der Ryūkō-ji ist ein Tempel der Nichiren-shū in der japanischen Stadt Fujisawa, Präfektur Kanagawa.\\nEr befindet sich auf dem Gelände der ehemaligen Tatsukuchi- Hinrichtungsstätte, an der der Religionsstifter Nichiren beinahe hingerichtet wurde. Somit ist die Höhle, in der Nichiren gefangengehalten wurde, Teil des Tempelgeländes. Vor dem Hondō des Tempels befindet sich zudem eine Statue Nichirens."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%DA%AF%D8%B1%D8%A7%D9%86%D8%AF%DB%8C%D8%B3%D9%88%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Maskownica.jpg","page_title":"آگراندیسور","context_page_description":"آگراندیسور، دستگاهی است برای چاپ عکس در اندازه‌های بزرگتر یا کوچکتر از اندازهٔ اصلی نگاتیو یا اسلاید."},{"page_url":"https://en.wikipedia.org/wiki/Williston,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/OHMap-doton-Williston.png","page_title":"Williston, Ohio","context_page_description":"Williston is an unincorporated community and census-designated place in northern Allen Township, Ottawa County, Ohio, United States, located along State Route 579. It is located in the northwestern part of the state, near Toledo. Its ZIP code is 43468. Its population was 211 people, according to the 2000 Census. The town received regional attention with the arraignment of a local bank robbery suspect from Williston, accused of robbing the Genoa Banking Company's Millbury branch, in federal court.\\nLocal teenagers attend Genoa Area High School."},{"page_url":"https://en.wikipedia.org/wiki/Mecicobothrium_thorelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Boletin_de_la_Academia_Nacional_de_Ciencias_en_C%C3%B3rdoba_%2820394365431%29.jpg","page_title":"Mecicobothrium thorelli","context_page_description":"Mecicobothrium thorelli is a spider in the family Mecicobothriidae, native to Argentina and Uruguay. It was first described in 1882 by Holmberg. The specific name thorelli honours Tamerlan Thorell."},{"page_url":"https://cy.wikipedia.org/wiki/Schwg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Skhug.jpg","page_title":"Schwg","context_page_description":"Saws poeth yw schwg neu sahawiq sy'n dod yn wreiddiol o goginiaeth Iddewig-Iemenaidd ac sy'n boblogaidd yn Israel. Yn ddiweddar mae wedi dod yn boblogaidd yn Ewrop ac yng ngogledd America yn ogystal.\\nMae hefyd yn boblogaidd yng ngorynys Arabia. Yn ardal Gwlff Persia fe'i gelwir hefyd yn daqqus."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AF%D8%A7%D9%81%D9%86_%D8%AF%D9%84%D9%85%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/A%27ali_Burial_Mounds.jpg","page_title":"مدافن دلمون","context_page_description":"مدافن دلمون المعروفة محليا باسم مقبرة عالي، وهي مجموعة من المقابر في الجزء الغربي من الجزيرة الرئيسية في البحرين، ويرجع تاريخها إلى حضارة دلمون وثقافة أم النار والعصور اللاحقة، عرفت منذ العصور القديمة كجزيرة بها عدد كبير جدا من المدافن وفي الأصل تعتبر أكبر مقابر العالم القديم مساحة، وتتركز حيث المناطق الصخرية الصلبة الأعلى قليلا من مناطق التربة الزراعية الصالحة للزراعة في جنوب الجزيرة، وتعود المقابر إلى السكان المحليين على مدى عدة آلاف من السنين، وبلغ عددها نحو 11,774 تلة دفن، ويوجد في الأدب السومري ما يسمى دار المباركة الذي يشير إلى دلمون باعتبارها مقبرة النخبة، والقبور ليست كلها من العصر نفسه أو بنيت بنفس الأساليب ويمكن أن تختلف إلى حد كبير في الحجم، وما تزال البحوث تحت رعاية متحف البحرين الوطني مستمرة لتحديد جدول زمني ثابت لجميع المقابر وكذلك النظر في الآثار المترتبة على المجتمع أو المجتمعات التي بنتها، وقد أدرجت تلال مدافن دلمون ضمن لائحة التراث العالمي لمنظمة اليونسكو عام 2019، لتكون بذلك ثالث موقع أثري في البحرين يُدرج في القائمة."},{"page_url":"https://de.wikipedia.org/wiki/Paul_Wynand","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Lanzenreiter_in_K%C3%B6ln-Deutz_2.jpg","page_title":"Paul Wynand","context_page_description":"Paul Wynand war ein deutscher Bildhauer der heroisch-monumentalen Stilrichtung der NS-Zeit."},{"page_url":"https://da.wikipedia.org/wiki/S%C3%BCd_Autobahn","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/S%C3%BCd_Autobahn.svg","page_title":"Süd Autobahn","context_page_description":"Süd Autobahn er en betegnelse for motorvej A2 i Østrig, der forløber fra Wien over Graz til den italienske grænse ved Arnoldstein, hvor den videreføres som A23 mod Udine. Motorvejen indgår i europavejsnettet med numrene E59 og E66.\\nFørste delstrækning af motorvejen blev åbnet den 26. maj 1962 og den sidste strækning blev åbnet i 1999. Med sin længde på 377,3 kilometer er det Østrigs længste motorvej.\\nMotorvejen går øst om Alperne og har derfor relativt korte tunneller. Længste tunnel er Ehrentalbergtunnel med en længde på 3.345 meter. Endvidere findes Østrigs næststørste bro på Süd Autobahn med Talübergang Lavant, der har en højde på 165 meter og en længde på 1.097 meter."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D1%91%D1%80%D0%BD%D1%8B%D0%B5_%D1%81%D0%B5%D0%BC%D0%B8%D0%BD%D0%BE%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Abraham-black-sem.jpg","page_title":"Чёрные семинолы","context_page_description":"Черными семинолами называются потомки свободных африканцев и беглых рабов и галла, мигрировавших в Испанскую Флориду с плантаций Южной Каролины и Джорджии. В конце 17 века. К началу XIX века они зачастую селились рядом с индейцами племени семинолов.\\nВ результате культурного обмена получился уникальный многонациональный союз с участием представителей двух рас. Современные потомки чёрных семинолов живут в штате Флорида, сельских районах Оклахомы и Техаса, на Багамских островах и северных районах Мексики."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_rellotges_de_sol_del_Barcelon%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/122_Masia_Massana%2C_c._Taulat_17%2C_Poblenou_%28Barcelona%29%2C_rellotge_de_sol.jpg","page_title":"Llista de rellotges de sol del Barcelonès","context_page_description":"Llista de rellotges de sol instal·lats de forma permanent en espais públics de la comarca del Barcelonès."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D9%88%D9%86%D9%B9%D8%A7%D8%B1%DB%8C%D9%88%D8%8C_%DA%A9%DB%8C%D9%84%DB%8C%D9%81%D9%88%D8%B1%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ontario_Convention_Center.jpg","page_title":"اونٹاریو، کیلیفورنیا","context_page_description":"اونٹاریو، کیلیفورنیا ریاستہائے متحدہ امریکا کا ایک سینکڑوں ہزاروں باشندوں کا شہر جو کیلیفورنیا میں واقع ہے۔"},{"page_url":"https://nl.wikipedia.org/wiki/Yoshio_Nishina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Yoshio_Nishina.JPG","page_title":"Yoshio Nishina","context_page_description":"Yoshio Nishina was een Japanse fysicus. Nishina was een vriend van Niels Bohr en medewerker van Albert Einstein. Tijdens de Tweede Wereldoorlog was hij hoofd van het Japanse atoomwapenprogramma. Hij was mede-auteur van de Klein-Nishina formule."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Prix_automobile_du_Br%C3%A9sil_2009","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Start16BRA.png","page_title":"Grand Prix automobile du Brésil 2009","context_page_description":"Le Grand Prix du Brésil 2009, disputé sur le Circuit d'Interlagos le 18 octobre 2009, est la 819ᵉ course du championnat du monde de Formule 1 courue depuis 1950 et la seizième et avant-dernière manche du championnat 2009.\\nLe Grand Prix est remporté par Mark Webber sur Red Bull-Renault tandis que Jenson Button, en terminant cinquième remporte le titre de champion du monde des pilotes. Brawn, grâce à ses pilotes Jenson Button et Rubens Barrichello remporte le titre de champion du monde des constructeurs pour sa première et son unique participation au championnat."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E5%B9%B3%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Kodaira-station-south-gate_20200607.jpg","page_title":"小平站","context_page_description":"小平站是位於日本東京都小平市美園町一丁目，屬於西武鐵道的鐵路車站。車站編號是SS19。\\n此站有新宿線和拜島線停靠。拜島線以此站為起點，拜島線的列車多數直通運行至新宿線西武新宿站方向。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AE%B2%E0%AF%8D%E0%AE%AA%E0%AE%AE%E0%AF%88%E0%AE%9F%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sulfamide_molecule_ball.png","page_title":"சல்பமைடு","context_page_description":"சல்பமைடு என்பது H₂NSO₂NH₂ என்ற மூலக்கூற்று கட்டமைப்பு கொண்ட ஒரு வேதியியல் சேர்மமாகும். ஐயுபிஏசி முறையில் இதை சல்பியூரிக் டையமைடு என்று பெயரிட்டு அழைக்கிறார்கள். சல்பியூரைல் குளோரைடுடன் அமோனியாவைச் சேர்த்து வினைபுரியச் செய்வதால் சல்பமைடு உருவாகிறது. 1838 ஆம் ஆண்டு பிரெஞ்சு வேதியியலாளர் என்றி விக்டர் ரெக்னால்டு முதன்முதலில் சல்பமைடைத் தயாரித்தார்."},{"page_url":"https://de.wikipedia.org/wiki/Laufer_Schlagturm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Laufer_Schlagturm_Ostseite_%28ehemals_Stadtausw%C3%A4rts%29.jpg","page_title":"Laufer Schlagturm","context_page_description":"Der Laufer Schlagturm ist ein Torturm der vorletzten Stadtbefestigung Nürnbergs."},{"page_url":"https://en.wikipedia.org/wiki/John_O._Wehrle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/John_O._Wehrle%2C_artist.jpeg","page_title":"John O. Wehrle","context_page_description":"John Wehrle is an American artist currently living in Richmond, California. Wehrle is best known as a muralist and site-specific installation artist, predominately active in California. Proficient in painting, sculpture and photography, his work is in public and private collections. Several of his exterior mural works, Fall of Icarus, Positively Fourth Street, and Galileo Jupiter Apollo achieved underground iconic status during their existence. Wehrle's interior murals and surviving installations have been internationally collected."},{"page_url":"https://de.wikipedia.org/wiki/St._Nicolai_(Hamburg-Altengamme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Snag_friedhofswettern_2.jpg","page_title":"St. Nicolai (Hamburg-Altengamme)","context_page_description":"St. Nicolai zu Hamburg-Altengamme gehört zu den acht Hamburger Landkirchen und gilt als älteste der Dorfkirchen im Gebiet der Vier- und Marschlande. Sie ist dem heiligen Nikolaus von Myra, dem Schutzheiligen der Kinder, Fischer, Seefahrer und Händler, geweiht. Seit der Reformation, die in Altengamme um 1535 wirksam wurde, ist sie der Mittelpunkt einer evangelisch-lutherischen Gemeinde."},{"page_url":"https://en.wikipedia.org/wiki/HMS_Lizard_(1911)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Battle_Plate.jpg","page_title":"HMS Lizard (1911)","context_page_description":"HMS Lizard was an Acheron-class destroyer of the British Royal Navy. She is named for the Lizard peninsula in the county of Cornwall in England. and was the twelfth ship of the Royal Navy to bear the name."},{"page_url":"https://id.wikipedia.org/wiki/Benedicta_Boccoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Benedicta-boccoli-1998.jpg","page_title":"Benedicta Boccoli","context_page_description":"Benedicta Boccoli adalah seorang pemeran teater dan film berkebangsaan Italia. Namanya dikenal melalui sejumlah film yang dimainkannya antara lain Gli angeli di Borsellino, Valzer, dan Pietralata."},{"page_url":"https://ro.wikipedia.org/wiki/Campagne-l%C3%A8s-Hesdin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Campagne-les-Hesdin_%C3%A9glise4.jpg","page_title":"Campagne-lès-Hesdin","context_page_description":"Campagne-lès-Hesdin este o comună în departamentul Pas-de-Calais, Franța. În 2009 avea o populație de 1781 de locuitori."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B8_(2010)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Latvia_Saeima_composition_02-11-10.svg","page_title":"Парламентские выборы в Латвии (2010)","context_page_description":"Выборы в Десятый Сейм Латвии состоялись 2 октября 2010 года. По данным ЦИК Латвии, явка составила 63,12 %. Пять партий преодолели пятипроцентный барьер и прошли в Сейм. Крупнейшим в парламенте, получив 33 мандата из 100, стал блок «Единство», объединяющий партии «Новое время», «Гражданский союз» и «Общество за другую политику»."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%81%D9%84_%D8%AA%D9%88%D8%B2%D9%8A%D8%B9_%D8%AC%D9%88%D8%A7%D8%A6%D8%B2_%D8%A7%D9%84%D8%A5%D9%8A%D9%85%D9%8A_%D8%A8%D8%B1%D8%A7%D9%8A%D9%85_%D8%AA%D8%A7%D9%8A%D9%85_%D8%A7%D9%84%D8%AA%D8%A7%D8%B3%D8%B9_%D9%88%D8%A7%D9%84%D8%B3%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/NicoleKidmanNov09.jpg","page_title":"حفل توزيع جوائز الإيمي برايم تايم التاسع والستون","context_page_description":"حفل توزيع جوائز الإيمي برايم تايم السنوي التاسع والستون هو حفل كرم فيه أفضل البرامج التلفزيونية في الولايات المتحدة ابتداء من 1 يونيو 2016 حتى 31 مايو 2017، عقد الاحتفال يوم الأحد 17 سبتمبر 2017 في مسرح مايكروسوفت في وسط لوس آنجليس، كاليفورنيا، وتم بثه في الولايات المتحدة من قبل سي بي إس، واستضاف الحفل ستيفن كولبير. تم الإعلان عن الترشيحات من قبل آنا شلومسكي وشيمار مور في 13 يوليو 2017"},{"page_url":"https://ceb.wikipedia.org/wiki/Anthus_cinnamomeus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Graslandpipt.jpg","page_title":"Anthus cinnamomeus","context_page_description":"Espesye sa langgam ang Anthus cinnamomeus. Una ning gihulagway ni Ruppell ni adtong 1840. Ang Anthus cinnamomeus sakop sa kahenera nga Anthus sa kabanay nga Motacillidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Offenbach-Bieber","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Katholische_Pfarrkirche_Offenbach_Bieber.jpg","page_title":"Liste der Kulturdenkmäler in Offenbach-Bieber","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet des Stadtteils Bieber der kreisfreien Stadt Offenbach am Main, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der Hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_San_Carlos_(Tamaulipas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Entrada_de_San_Carlos%2C_Tamaulipas.jpg","page_title":"Municipio de San Carlos (Tamaulipas)","context_page_description":"San Carlos es uno de los 43 municipios que conforman el estado de Tamaulipas, pertenece a la subregión Victoria. La cabecera Municipal se encuentra en la Cd. de San Carlos, a los 24º 31' latitud norte y a una altitud de 432 metros sobre el nivel del mar.\\nColinda al norte con el municipio de Burgos y el municipio de Linares, Nuevo León, al sur con el municipio de Padilla, al este con los de San Nicolás y Jiménez y al oeste con Villagrán e Hidalgo. Su extensión territorial es de 2,912.40 km², que representa el 3.37% del total del Estado."},{"page_url":"https://ru.wikipedia.org/wiki/56-%D1%8F_%D1%86%D0%B5%D1%80%D0%B5%D0%BC%D0%BE%D0%BD%D0%B8%D1%8F_%C2%AB%D0%93%D1%80%D1%8D%D0%BC%D0%BC%D0%B8%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/N.E.R.D_%40_Pori_Jazz_2010_-_Pharrell_Williams_1.jpg","page_title":"56-я церемония «Грэмми»","context_page_description":"56-я ежегодная церемония вручения наград «Грэмми» состоялась 26 января 2014 года. Сдвиг даты награждения с февраля на январь вызван началом проведения Зимних Олимпийских Игр в Сочи. Номинанты были объявлены 6 декабря 2013 года в Лос-Анджелесе. Американская певица и автор Кэрол Кинг удостоена почётной награды Персона года «MusiCares», которая была вручена 24 января, за два дня до официальной церемонии.\\nВ 2014 году Национальная академия искусства и науки звукозаписи провела некоторые изменения в номинациях. Добавлена новая категория Best American Roots Song для авторов лучших песен нескольких стилей. Было изменено название премии «Грэмми за лучшее короткое музыкальное видео» на «Премия «Грэмми» за лучшее музыкальное видео», а похожая номинация за длинное видео была переименована в премию «Грэмми» за лучший музыкальный фильм. Категория Best Hard Rock/Metal Performance была переименована в Best Metal Performance, а жанр Hard Rock Performances отныне включён в категорию Best Rock Performance.\\nЭти изменения увеличили общее число номинаций в 2014 году до 82.\\nБольше всех наград получили французский дуэт Daft Punk и американский продюсер и певец Фаррелл Уильямс."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A6%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A4%BF%E0%A4%A3%E0%A4%BE%E0%A4%B5%E0%A4%B0%E0%A5%8D%E0%A4%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Clockwise_arrow.svg","page_title":"दक्षिणावर्त","context_page_description":"दक्षिणावर्त का अर्थ इस प्रकार घूमना है कि घूमने की दिशा दाहिने हाथ की तरफ हो, अर्थात घड़ी की सुइयों के घूमने की दिशा।\\nविशेषण: [सं. दक्षिण+आवृत्त + अच्, उप.स.] जिसका घुमाव, प्रकृति या मुँह दाहिनी दिशा की ओर को हो। जैसे-दक्षिणावर्त्त शंख।\\nपुं. एक प्रकार का शंख, जिसका घुमाव या मुँह दक्षिण या दाहिने हाथ की ओर होता है।\\nक्लॉकवाइज़ दिशा वह होती है, जो घड़ी की सुइयों की दिशा में होती है।\\n'दक्षिणावर्त' का विलोम वामावर्त है।"},{"page_url":"https://fr.wikipedia.org/wiki/Charnaigre","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Cretan_Hound_at_Athens_International_Dog_Show%2C_October_1997.jpg","page_title":"Charnaigre","context_page_description":"Le charnaigre, charnègre ou charnique était un chien de chasse, aujourd'hui disparu, présent essentiellement en Provence, en Languedoc et en Roussillon."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%88%DA%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%D0%9F%D0%B0%D0%BD%D0%BE%D1%80%D0%B0%D0%BC%D0%B0._%D0%93%D0%BE%D1%80%D0%BE%D0%B4_%D0%A1%D0%9E%D0%A7%D0%98%2C_%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD.jpg","page_title":"سوچی","context_page_description":"سوچی روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و کراسنودار دیارینده یئرلشیب. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا 343334 نفر دیر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%BA%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/SancaiHorseTang7-8thCentury.JPG","page_title":"Санкай","context_page_description":"Санкай — загальна назва різновиду порцеляни, для оздоб якої використовували переважно три кольори фарб."},{"page_url":"https://da.wikipedia.org/wiki/Hans_Johansen_(politiker)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Hans_Johansen_by_I.W._Tegner_%26_Kittendorff.jpg","page_title":"Hans Johansen (politiker)","context_page_description":"Hans Johansen var en dansk gårdejer og politiker.\\nHan var søn af gårdmand Johan Frederik Olsen og hustru, Mette Hansdatter, blev 1835 ved giftermål med sin moster Ane Hansdatter ejer af gården Bogø i Knardrup i Ganløse Sogn, Frederiksborg Amt. Han var sognefoged fra 1840 til sin død, ligeledes fra 1842 med få afbrydelser sogneforstanderskabets formand og 1842-51 samt på ny 1856-59 medlem af amtsrådet. Desuden beklædte han en række andre tillidshverv, blev 1850 formand for afløsningen af husmandshoveriet, 1854 tiende- og 1860 landvæsenskommissær samt 1858 repræsentant i Landbygningernes alm. Brandforsikring. Han var en meget dygtig landmand og var 1843 medstifter af amtets landboforening og senere herredskommissær i dens bestyrelse. I det politiske liv tog han også del, idet han 1848 var medlem af Roskilde Stænderforsamling og 1848-49 af Den Grundlovgivende Rigsforsamling; han hørte her til den mådeholdne side. Han giftede sig 1849 anden gang, med Maren Kirstine Rasmusdatter, og døde 21. februar 1862."},{"page_url":"https://nl.wikipedia.org/wiki/%C3%96stra_Fr%C3%B6lunda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/%C3%96stra_Fr%C3%B6lunda.jpg","page_title":"Östra Frölunda","context_page_description":"Östra Frölunda is een plaats in de gemeente Svenljunga in het landschap Västergötland en de provincie Västra Götalands län in Zweden. De plaats heeft 323 inwoners en een oppervlakte van 49 hectare."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%A0%CF%89%CE%BB_%CE%93%CE%BA%CF%89%CE%B3%CE%BA%CE%AD%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Paul_Gauguin_011.jpg","page_title":"Κατάλογος έργων του Πωλ Γκωγκέν","context_page_description":"Η σελίδα αυτή αποτελεί εικονογραφημένο κατάλογο έργων ζωγραφικής του Πωλ Γκωγκέν, με χρονολογική σειρά και σύμφωνα με τις περιόδους δημιουργίας του καλλιτέχνη. Στην δεύτερη στήλη αναγράφεται ο αριθμός του έργου στους πλήρεις καταλόγους των Wildenstein και Sugana\\n."},{"page_url":"https://fr.wikipedia.org/wiki/De_divina_proportione","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Luca_Pacioli%2C_De_divina_proportione%2C_Letter_L.jpg","page_title":"De divina proportione","context_page_description":"De divina proportione est un livre de mathématiques écrit par Luca Pacioli et illustré par Léonard de Vinci aux alentours de 1498 à Milan et publié pour la première fois en 1509. Son sujet principal est la proportion mathématique et son application en géométrie, dans les arts et en architecture. La clarté du texte et des illustrations ont contribué au succès du livre et à sa diffusion au-delà des cercles mathématiques."},{"page_url":"https://ms.wikipedia.org/wiki/Laluan_Jubilee","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Dollis_Hill_stn_north_entrance.JPG","page_title":"Laluan Jubilee","context_page_description":"Laluan Jubilee merupakan salah satu daripada perkhidmatan London Underground. Perkhidmatan kereta api ini dibina dalam dua segmen — pada awal pembukaannya hingga stesen Charing Cross dalam kawasan London Tengah. Manakala pada tahun 1999, landasan laluan ini dipanjangkan ke Stratford di timur London. Stesen-stesen dalam perkhidmatan yang dibina terkemudian mempunyai ciri-ciri keselamatan, serta lebih lapang dari segi saiz. Ini bertujuan untuk mengelakkan masalah pada masa akan datang melibatkan kesesakan stesen dan kurang kawasan keselamatan. 13 daripada 27 buah stesen laluan ini dibina bawah tanah. Dalam peta London Underground, laluan ini berwarna kelabu."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%81%90%E9%BE%8D%E7%9A%84%E9%AB%94%E5%9E%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Longest_dinosaur_by_clade.svg","page_title":"恐龍的體型","context_page_description":"恐龙的体型将目前已知的不同恐龙生物群中，最大、最重与最小的成员列表出来。\\n备注：这个列表并不包含未公布的化石。恐龙的体重估计值比身长估计值变化范围更大，因为使用已灭绝动物的骨骸来估计它们的身长较为容易。"},{"page_url":"https://en.wikipedia.org/wiki/Wooden_cannon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sendai1868Cannons.JPG","page_title":"Wooden cannon","context_page_description":"Wooden cannons have been manufactured and used in wars in many countries. The wooden parts were invariably strengthened with metal fittings or even rope."},{"page_url":"https://de.wikipedia.org/wiki/Peter_August_B%C3%B6ckstiegel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/PAB_Mutter.jpg","page_title":"Peter August Böckstiegel","context_page_description":"Peter August Böckstiegel war ein deutscher Maler, Grafiker und Bildhauer. Er gilt als Vertreter des Westfälischen Expressionismus."},{"page_url":"https://eu.wikipedia.org/wiki/Knossos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Knossos_Thronsaal.jpg","page_title":"Knossos","context_page_description":"Knossos antzinako hiria zen, Kretako iparraldean zegoena.\\nK.a. 3000. urtea baino lehenagokoa da. Minos errege mitologikoaren jauregia izan zen. K.a. XV. mendean mizenastarrek okupatu zuten, geroago dorioarrek, eta erromatarrek. Minostar zibilizazioaren gune nagusia izan zen. Hain zuzen ere, Knossosko jauregi handiaren ikerketetatik ezagutzen da zibilizazio minoikoa. Jauregi osoa, gotortu gabe zegoena, harriz egina zegoen egurrezko egitura baten gainean, eta erdiko patio baten inguruan biltzen zen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%82%D1%83%D1%80%D0%B8%D0%BD,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/c/cc/Baturin_VP.jpg","page_title":"Батурин, Виктор Павлович","context_page_description":"Виктор Павлович Батурин — русский художник."},{"page_url":"https://pt.wikipedia.org/wiki/Carlos_V_do_Sacro_Imp%C3%A9rio_Romano-Germ%C3%A2nico","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Carlos_I_y_Felipe_II.jpg","page_title":"Carlos V do Sacro Império Romano-Germânico","context_page_description":"Carlos V foi Sacro Imperador Romano e Arquiduque da Áustria a partir de 1519, Rei da Espanha a partir de 1516 e Senhor dos Países Baixos como Duque da Borgonha a partir de 1506. Como chefe da crescente Casa de Habsburgo durante a primeira metade do século XVI, seus domínios na Europa incluíam o Sacro Império Romano, estendendo-se da Alemanha ao norte da Itália, com domínio direto sobre as terras hereditárias austríacas e os Países Baixos da Borgonha, tendo também unificado a Espanha, com seus reinos do sul da Itália de Nápoles, Sicília e Sardenha. Além disso, em seu reinado ocorreu a intensificação e consolidação da Colonização espanhola da América. A união pessoal dos territórios europeu e americano de Carlos V foi a primeira coleção de reinos rotulados como \\"o império sobre o qual o sol nunca se põe\\".\\nNascido na Flandres, foi filho de Filipe, o Belo da Casa Austríaca de Habsburgo e de Joana, a Louca da Casa Espanhola de Trastámara Carlos herdou todos os domínios de sua família ainda jovem, devido à morte prematura de seu pai e à doença mental de sua mãe. Após a morte de Filipe em 1506, ele herdou os países baixos da Borgonha, originalmente mantida por sua avó paterna, Maria."},{"page_url":"https://en.wikipedia.org/wiki/Archibald_Roosevelt","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/USA-P-Rabaul-6.jpg","page_title":"Archibald Roosevelt","context_page_description":"Archibald Bulloch \\"Archie\\" Roosevelt, the fifth child of U.S. President Theodore Roosevelt, was a distinguished U.S. Army officer and commander of U.S. forces in both World War I and II. In both conflicts he was wounded. He earned the Silver Star with three oak leaf clusters, Purple Heart with oak leaf cluster and the French Croix de guerre. After World War II, he became a successful businessman and the founder of a New York City bond brokerage house, as well as a spokesman for conservative political causes."},{"page_url":"https://en.wikipedia.org/wiki/High_Gothic","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Chartres_-_south_portal_-_central_bay_-.jpg","page_title":"High Gothic","context_page_description":"High Gothic is a particularly refined and imposing style of Gothic architecture that appeared in northern France from about 1195 until 1250. Notable examples include Chartres Cathedral, Reims Cathedral, Amiens Cathedral, Beauvais Cathedral, and Bourges Cathedral. It is characterized by great height, harmony, subtle and refined tracery and realistic sculpture, and by large stained glass windows, particularly rose windows and larger windows on the upper levels, which filled the interiors with light. It followed Early Gothic architecture and was succeeded by the Rayonnant style. It is often described as the high point of the Gothic style."},{"page_url":"https://es.wikipedia.org/wiki/Buriolestes_schultzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Foto_do_bloco_com_o_buriolestes_Foto_Flavio_Lopes_%28Ufrgs%29.jpg","page_title":"Buriolestes schultzi","context_page_description":"Buriolestes schultzi es la única especie conocida del género extinto Buriolestes de dinosaurio sauropodomorfo primitivo, que vivió durante el a finales del Triásico hace aproximadamente entre 237 a 228 millones de años en lo que es hoy Sudamérica."},{"page_url":"https://fr.wikipedia.org/wiki/Esquerdes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Esquerdes_l%27Aa_%2862380%29.jpg","page_title":"Esquerdes","context_page_description":"Esquerdes est une commune française située dans le département du Pas-de-Calais en région Hauts-de-France.\\nC'est un petit village du Pas-de-Calais de 939 hectares, situé entre Saint-Omer et Lumbres dans la vallée de l'Aa, son altitude varie entre 27 et 136 m."},{"page_url":"https://zh.wikipedia.org/wiki/1911%E5%B9%B410%E6%9C%8822%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/SE1913Sep30P.png","page_title":"1911年10月22日日食","context_page_description":"1911年10月22日日食是一次日環食，發生於1911年10月22日。新月當天，地球上觀測到月球和太陽的角距離極小，此時月球如果恰好在月球交點附近，穿過太陽和地球之間，與地球、太陽接近一直線，則會出現日食。月球穿過太陽和地球之間，但距地球較遠，本影未能接觸地表，而使偽本影覆蓋的區域內看到月球的角直徑小於太陽，就形成日環食，同時在偽本影兩側數千公里的半影範圍內形成日偏食。此次日環食經過了俄國、中國、法屬印度支那、美屬菲律賓、荷屬東印度、巴布亞領地、英屬西太平洋領地，日偏食則覆蓋了亞洲大部、澳洲及周邊部分地區。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B4%D5%A2%D5%B8%D6%80_(%D6%84%D5%A1%D5%B2%D5%A1%D6%84,_%D5%88%D6%82%D5%AF%D6%80%D5%A1%D5%AB%D5%B6%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sambir_-_coat_of_arms.jpg","page_title":"Սամբոր (քաղաք, Ուկրաինա)","context_page_description":"Սամբոր, քաղաք Ուկրաինայի Լվովի մարզի Սամբորի շրջանում, շրջկենտրոն։\\nՉճշտված տվյալներով Սամբոր քաղաքում բնակվում էր 36 218 մարդ։"},{"page_url":"https://it.wikipedia.org/wiki/Rock_%27n%27_Sock_Connection","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/WWF_RAW_2001-10-15_The_Rock_at_ringside.jpg","page_title":"Rock 'n' Sock Connection","context_page_description":"La Rock 'n' Sock Connection è stato un tag team di wrestling formato da The Rock e Mankind, attiva dal 1999 al 2000 e brevemente nel 2004. È considerata da molti come una delle stable più divertenti mai esistite nella WWF."},{"page_url":"https://nl.wikipedia.org/wiki/Olaf_Dufseth","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Olaf_Dufseth_84904.jpeg","page_title":"Olaf Dufseth","context_page_description":"Olav Dufseth was een Noors skiër, gespecialiseerd in de Noordse combinatie en langlaufen.\\nDufseth werd 8e in de Noordse combinatie op de Olympische Winterspelen van 1948 in Sankt Moritz. In het langlaufen eindigde hij 18e."},{"page_url":"https://de.wikipedia.org/wiki/Clovis_(New_Mexico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Curry_County_NM_Courthouse.jpg","page_title":"Clovis (New Mexico)","context_page_description":"Clovis ist eine Stadt im Osten des US-Bundesstaates New Mexico und Verwaltungssitz des Curry County. Sie hat 39.508 Einwohner und ist somit die achtgrößte Stadt in New Mexico. Die Fläche beträgt 58,3 km². Nach ihr ist die Clovis-Kultur benannt."},{"page_url":"https://pl.wikipedia.org/wiki/Cud_na_34._ulicy_(film_1947)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Miracle_on_34th_Street_%281947_film_poster%29.jpg","page_title":"Cud na 34. ulicy (film 1947)","context_page_description":"Cud na 34. ulicy – film z 1947 roku wyreżyserowany przez George’a Seatona. W rolach głównych wystąpili: Maureen O’Hara, John Payne, Natalie Wood oraz Edmund Gwenn.\\nAkcja toczy się w Nowym Jorku i zaczyna się razem z paradą z okazji Święta Dziękczynienia, organizowaną przez dom handlowy Macy's. Fabuła skupia się wokół Świętego Mikołaja z domu handlowego Macy's, który może być prawdziwy.\\nFilm zdobył cztery Oscary dla najlepszego aktora w roli drugoplanowej, najlepszego opowiadania filmowego i najlepszego scenariusza adaptowanego. Był także nominowany w kategorii najlepszy film, lecz przegrał z Dżentelmeńską umową.\\nCud na 34. ulicy doczekał się remake'ów w postaci trzech filmów telewizyjnych oraz filmu kinowego z 1994 roku."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%DB%8C%D8%AA%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Lite%C5%88_znak.png","page_title":"لیتن","context_page_description":"لیتن چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۸۷۵ نفر ایمیش. گئنیش‏لیگی ۲٫۹۲ کیلومتر موربّع ایدی و مرکزی بوهم اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://cs.wikipedia.org/wiki/Modern%C3%AD_zahrada","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Rasen_vor_dem_Vertikutieren.JPG","page_title":"Moderní zahrada","context_page_description":"Moderní zahrada je označení, které je používáno pro úpravy zahrad, jenž jsou považovány za obecně žádoucí, blížící se ideálu krásy respektované a někdy současně vzbuzující dojem novosti a neobvyklosti. Moderní zahrada a modernistická je současně výraz používaný pro zahrady ve spojitosti s úpravou synergickou s uměleckými a architektonickými styly používaným ve 20. století. Tyto směry byly často založeny na strukturách a liniích a byly označovány souhrnně modernismus či moderní umění a moderní architektura.\\nModerní zahrady jsou poplatné trendům daného období v architektuře, nejsou v kontrastu se stavebním dílem. Ve vrcholném období jsou jednoduché, více či méně praktické nebo smysluplné, někdy nákladné na pořízení a údržbu, jindy zcela levné. Mohou být pravidelné nebo chaotické, vytvořené amatéry nebo odborníky, zde podobnost není.\\nDesign, který je považován za model „moderní zahrady“ se postupem času měnil."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%88%D8%AD%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/2006_Asian_Games_athletes_during_opening_ceremony.jpg","page_title":"دوحه","context_page_description":"دوحه پایتخت کشور قطر است. این شهر در سواحل خلیج فارس قرار دارد. جمعیت آن بر طبق سرشماری سال ۲۰۱۵ میلادی ۹۵۶٬۴۶۰ نفر بوده‌است."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%93%E9%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kbh_Marmorkirche_1.jpg","page_title":"圓頂","context_page_description":"圓頂，是一種常見建築結構，外型類似一個空心球體的上半部。圓頂的橫切面並不一定是完整圓球型，亦可以呈橢圓形。用各種材質製造的圓頂在建築學中有悠久的歷史，可以回溯到史前時期。\\n在古代近東的建築物和墳墓中，已經可以找到疊澀拱的身影。這是一種在兩根支撐柱上以磚石層層收進，直到中線合攏的半圓頂的拱，和圓頂已經相似。而大規模的製造真正圓頂的技術則出現在羅馬建築革命中。羅馬人利用圓頂來增加神廟和其他建築物，如萬神廟的內部空間。這個傳統在羅馬成為天主教中心後仍然有增無減，從拜占庭的宗教或世俗建築中可以看得出來。公元六世紀，隨著採用了革命性新技術三角穹頂的聖索菲亞大教堂的出現，可以說圓頂建築達到了一個高潮。而隨著穆斯林對薩珊王朝和拜占庭帝國的軍事勝利，圓頂建築也開始成為穆斯林建築的特色之一。\\n在俄羅斯的教堂建築中，東正教從拜占庭式建築中汲取了圓頂技術後，則出現了使用多個圓頂的獨特傳統。俄羅斯建築的圓頂常常鍍金或採用明亮的色彩，並呈蔥頭形狀，稱為蔥頭圓頂，和方形攢尖頂一樣是俄羅斯宗教建築的特色。\\n文藝復興時期，西歐再次發現了圓頂建築，圓頂建築在18世紀早期的巴洛克時期到達了第二個高峰。不少19世紀的大型公共建築都採用了圓頂設計，以示對羅馬元老院的追思。民居則少用圓頂，圓頂只見於巴洛克世紀最豪華的宮殿和房屋。\\n許多穹頂上，會再加一個小穹頂。這是中世紀時期的創造，不僅有利採光和通風，也為穹頂的裝飾增添了變化。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%80%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D0%BB%D0%B0%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Patriarchal_resid02.jpg","page_title":"Мироваренная палата","context_page_description":"Мироваренная палата Патриаршего дворца Московского Кремля — один из двух главных залов здания, построенного в 1635—1656 годах. В настоящий момент в ней располагается экспозиция Музеев Московского Кремля.\\nЦентральным объектом помещения является гигантская печь для мироварения, с 1763 по 1917 год — единственное место проведения этого обряда в России.\\nТакже в этой палате проходили заседания Церковных, или Освященных соборов, устраивались пиры в честь царя и иноземных гостей от имени патриарха. С упразднением Патриаршества в 1721 году здесь располагалась Московская контора Священного Синода."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D1%81-%D0%B0%D0%BC-%D0%93%D1%80%D0%BE%D1%81%D0%B3%D0%BB%D0%BE%D0%BA%D0%BA%D0%BD%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Kals_Koednitz.jpg","page_title":"Кальс-ам-Гросглоккнер","context_page_description":"Кальс-ам-Гросглоккнер, Кальс — община в Австрии, в федеральной земле Тироль. Расположена в долине Кальс, у подножия горы Гросглоккнер, которая является самой высокой горой Австрии.\\nВходит в состав округа Лиенц. Население составляет 1294 человека. Занимает площадь 180,54 км². Идентификационный код — 7 07 12."},{"page_url":"https://es.wikipedia.org/wiki/Riva_Ligure","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Map_of_comune_of_Riva_Ligure_%28province_of_Imperia%2C_region_Liguria%2C_Italy%29.svg","page_title":"Riva Ligure","context_page_description":"Riva Ligure es una localidad y comune italiana de la provincia de Imperia, región de Liguria, con 2.922 habitantes."},{"page_url":"https://es.wikipedia.org/wiki/Campeonato_de_F%C3%BAtbol_Playa_de_Conmebol_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/FUTBOL_PLAYA_%2817097331778%29.jpg","page_title":"Campeonato de Fútbol Playa de Conmebol 2015","context_page_description":"El Campeonato de Fútbol Playa de Conmebol 2015, sirvió como clasificación para la Copa Mundial de Fútbol Playa FIFA 2015, se disputó en la ciudad de Manta entre el 19 y el 26 de abril de ese mismo año.​​​ La Confederación Sudamericana de Fútbol contó con tres cupos directos para la Copa Mundial de Fútbol Playa que se disputó en Espinho.​​"},{"page_url":"https://en.wikipedia.org/wiki/The_Stud_(bar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/The_Stud_bar_in_San_Francisco_-_full_view.jpg","page_title":"The Stud (bar)","context_page_description":"The Stud is a queer bar located in South of Market, San Francisco. It was started by associates George Matson and Alexis Muir on May 27, 1966. According to George Matson it was a \\"bar for people, not just pretty bodies\\". Originally the Stud was located at the western end of Folsom Street and in 1987 moved to its current location at Ninth Street and Harrison Street. The Stud is known for their themed parties, drag and burlesque shows, and community events. It was also home of the famous Trannyshack, a weekly drag show that featured all different types of drag and drag stars from 1996 until 2008."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_presidenten_van_Itali%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Alcide_de_Gasperi_2.jpg","page_title":"Lijst van presidenten van Italië","context_page_description":"Hieronder volgt een lijst van presidenten van Italië."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Mikharkhangel.jpg","page_title":"Архангел Михаил","context_page_description":"Михаил је архангел, принц анђела, у јеврејској, хришћанској и исламској традицији. Сматра се заповедником небеске војске. Помиње се у Старом завету. За Јевреје, арханђел Михаило је заштитник Израела и синагоге. Хришћанство га сматра заштитником Саборне цркве и првим од седам арханђела, као и победника Луцифера и Сатане. Због тога се у уметности увек представља у римском оклопу са подигнутим мачем или копљем како прети неком демону или змају. Он се сматра чуварем вере православне и борцем против јереси.\\nУвeк се jaвљaо нa мeстимa нa коjимa сe jaвљaлa и Богородицa, тaко дa прeдстaвљa нeбeску силу и зaштиту нa зeмљи. Арханђел Михаило је представљен како у својој десној руци држи копље којим попире Луцифера, а у левој палмову гранчицу. Архангел Михаило се у српким домовима слави као Аранђеловдан и по броју свечара, друга слава у Србији. У нeким крајевима Србиje сe слaви и кaо зaштитник сточaрa jeр сe верује дa сaмо он можe отeрaти вуковe. Многa су нaроднa вeровaњa ο овом aнђeлу. Кaжу дa он обилaзи свe болeсникe и aко стaнe код ногу - ниje добро, a aко je код глaвe - болeсник ће оздрaвити. Смaтрa се дa долaзи и узимa људскe душe, кaд je комe куцнуо чaс."},{"page_url":"https://sv.wikipedia.org/wiki/Poul_Hartling","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Poul_Hartling.jpg","page_title":"Poul Hartling","context_page_description":"Poul Hartling, född 14 augusti 1914 i Köpenhamn, död 30 april 2000 i Köpenhamn, var en dansk politiker och skolman. Han var Danmarks statsminister 1973-1975."},{"page_url":"https://vi.wikipedia.org/wiki/Fuentesa%C3%BAco","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Iglesia_de_Santa_Mar%C3%ADa_del_Castillo%2C_Fuentesa%C3%BAco_02.jpg","page_title":"Fuentesaúco","context_page_description":"Fuentesaúco là một đô thị trong tỉnh Zamora, Castile và León, Tây Ban Nha. Theo điều tra dân số 2004, đô thị này có dân số là 1.867 người."},{"page_url":"https://eo.wikipedia.org/wiki/Zamoro_(Hispanio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Viriato.JPG","page_title":"Zamoro (Hispanio)","context_page_description":"Zamora estas hispana urbo en la regiono de Kastilio kaj Leono, proksime al Portugalio.\\nĜin trairas la rivero Doŭro.\\nLoĝantoj: ĉ. 65.000 homoj.\\nEstas tre abunda je preĝejoj romanikaj, inter kiuj la Katedralo.\\nLa celebrado de la Pasko altiras multajn vizitantojn.\\nZamoro estas municipo kaj urbo hispana kiu situas inter la centro kaj la nord-okcidento de la ibera duoninsulo, ĉefurbo de la provinco samnoma, en la aŭtonoma komunumo Kastilio kaj Leono, proksime al la landlimo kun Portugalujo kaj je 652 metroj sur la mar-nivelo.\\nLa antikva centro de la urbo estas deklarita histori-artista kompleto en 1973. La plej grava nukleo – tre longe disigita kaj grandparte cirkaŭita per muregoj – staras sur granda roka ebenaĵo de 26 ĝis 32 metrojn altaj, situanta rande de la rivero Doŭro, kiu ĝin cirkaŭas je la sudo. Pro ĉi tiuj karakterizaĵoj oni nomumis ĝin \\"la bone ĉirkaŭbarita\\"\\nEn januaro de 2015 ĝi havis 63.831 loĝantojn. La distancoj al aliaj urboj estas 66 km al Salamanko, 122 km al Leono (Hispanio), 93 al Valjadolido; al la ĉefurbo de Hispanio, Madrido 253 kaj al du proksimaj urboj de la najbara lando 83 km al Bragança kaj 55 km al Miranda do Douro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B2%D0%BE%D1%80%D1%86%D0%BE%D0%B2,_%D0%92%D1%8F%D1%87%D0%B5%D1%81%D0%BB%D0%B0%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87_(%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Vyacheslav_Skvortsov.jpg","page_title":"Скворцов, Вячеслав Николаевич (экономист)","context_page_description":"Вячеслав Николаевич Скворцов — основатель и первый ректор, президент Ленинградского государственного университета им. А. С. Пушкина."},{"page_url":"https://oc.wikipedia.org/wiki/Selon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Reloge.jpg","page_title":"Selon","context_page_description":"Selon es una comuna provençala d’Occitània. Administrativament, es situada dins lo departament dei Bocas de Ròse e la region francesa de Provença Aups e Còsta d'Azur.\\nLo gentilici es selonenc -a."},{"page_url":"https://pt.wikipedia.org/wiki/Terespol","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Terespol-city-office.jpg","page_title":"Terespol","context_page_description":"Terespol é um município da Polônia, na voivodia de Lublin e no condado de Biała Podlaska. Estende-se por uma área de 10,11 km², com 5 594 habitantes, segundo os censos de 2017, com uma densidade de 553,3 hab/km²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Wei%C3%9Fenthurm","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Apotheke_Wei%C3%9Fenthurm.JPG","page_title":"Liste der Kulturdenkmäler in Weißenthurm","context_page_description":"In der Liste der Kulturdenkmäler in Weißenthurm sind alle Kulturdenkmäler der rheinland-pfälzischen Stadt Weißenthurm aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://ro.wikipedia.org/wiki/Joanna_Pacu%C5%82a","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Joanna_Pacu%C5%82a.JPG","page_title":"Joanna Pacuła","context_page_description":"Joanna Pacuła este o actriță și fotomodel de origine poloneză."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%87%D0%B8%D0%B3%D0%B5%D0%BD_(%D0%B5%D0%B7%D0%B5%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Indiana_dunes.jpg","page_title":"Мичиген (езеро)","context_page_description":"Мичиген е едно од петте Големи Езера на Северна Америка, и е единственото од групата кое целосно им припаѓа на САД. Одејќи од југ надесно, тоа се граничи со сојузните држави Индијана, Илиноис, Висконсин и Мичиген. Зборот \\"Мичиген\\" првобитно се користел за да се означи самото езеро и се верува дека доаѓа од поимот mishigami на индијанскиот јазик оџибве, што значи „голема вода\\"“"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%83%D0%BD%D1%82_%D0%A1%D0%BC%D0%B0%D1%80%D1%82_(%D1%81%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Big_Day_Out_2007.jpg","page_title":"Маунт Смарт (стадион)","context_page_description":"Стадион Маунт Смарт — стадион в Окленде, Новая Зеландия. Это домашняя площадка команды Национальной Регбийной Лиги, Нью Зиленд Уорриорз. Построенный внутри заброшенных остатков вулканического конуса Раротонга, он расположен в 10 километрах к югу от центра города, в пригороде Пенроуза."},{"page_url":"https://eu.wikipedia.org/wiki/Jules_Dupuit","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Julesdupuit.jpg","page_title":"Jules Dupuit","context_page_description":"Jules Dupuit frantses ingeniari eta ekonomialari bat izan zen. Ekonomian, ezaguna da marjinalismoaren eskolakoa izateagatik. Eskola horren barruan, utilitate marjinal beherakorraren ideia landu zuen eta horrela, eskari-funtzioa ere beherakorra izan behar zela baieztatu zuen. Liberalismoaren defendatzaile izan zen.\\nDatuak: Q1353362\\nMultimedia: Jules Dupuit"},{"page_url":"https://sh.wikipedia.org/wiki/Lisabon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Rossio_2_-_Jul_2009.jpg","page_title":"Lisabon","context_page_description":"Lisabon je glavni grad Portugala i istoimenog distrikta, najveći grad i najveća luka u zemlji sa 545 254 stanovnika. Grad se smjestio na zapadnoj obali Iberskog poluotoka, nešto prije samog ušća rijeke Tejo u Atlantski ocean.\\nLisabon je administrativni, kulturni i privredni centar Portugala, u kom su smješteni vlada sa većinom ministarstava sa sudstvom. Lisabon je i važan edukacijski centar, sjedište nadbiskupije i značajan vjerski centar sa nizom većih i manjih crkvi, samostana i vjerskih škola."},{"page_url":"https://es.wikipedia.org/wiki/Direcci%C3%B3n_General_de_Aduanas_(Argentina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Direccion_de_Aduanas_Argentina_1.jpg","page_title":"Dirección General de Aduanas (Argentina)","context_page_description":"La Dirección General de Aduanas, es la autoridad competente que regula el despacho aduanero que ingresa y sale de Buenos Aires, aplicando por medio de procedimientos los requerimientos necesarios a que deben sujetarse las aduanas cuando algo ingrese al país. Además es uno de los tres organismos que integran la Administración Federal de Ingresos Públicos, junto con la Dirección General Impositiva y la Dirección General de los Recursos de la Seguridad Social.​\\nEl edificio esta ubicado en el barrio porteño de San Nicolás, en la Ciudad de Buenos Aires fue declarado Monumento Histórico Nacional y forma parte de un hito cultural en la historia de la ciudad."},{"page_url":"https://eu.wikipedia.org/wiki/Walter_Brennan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Walter_Brennan_in_Meet_John_Doe_trailer.jpg","page_title":"Walter Brennan","context_page_description":"Walter Andrew Brennan, ezagunagoa Walter Brennan izenaz, aktore estatubatuarra zen."},{"page_url":"https://it.wikipedia.org/wiki/Val_Venosta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Oberes_Vinschgau.jpg","page_title":"Val Venosta","context_page_description":"La Val Venosta è una valle dell'Alto Adige occidentale."},{"page_url":"https://ro.wikipedia.org/wiki/Franchot_Tone","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Franchot_Tone_Twilight_Zone_1961.jpg","page_title":"Franchot Tone","context_page_description":"Stanislaus Pascal Franchot Tone a fost un actor american de teatru, de film și de televiziune. El a fost nominalizat la Premiul Oscar pentru cel mai bun actor pentru rolul său ca Midshipman Roger Byam în Revolta de pe Bounty."},{"page_url":"https://ca.wikipedia.org/wiki/Auguste_Nicolas_Pomel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Auguste_Pomel.jpg","page_title":"Auguste Nicolas Pomel","context_page_description":"Auguste Nicolas Pomel fou un naturalista, geòleg i paleontòleg francès. Pomel treballà com a enginyer en mines, a Algèria i s'especialitzà en vertebrats fòssils, en el nord africà. Obté el seu títol de doctor en ciències a la Facultat de París l'any 1883 amb dues tesis:\\nClassification méthodique et “genera” des échinidés vivants et fossiles\\nContribution à la classification méthodique des crucifères"},{"page_url":"https://en.wikipedia.org/wiki/Newar_window","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Ga_jhya_dhala.jpg","page_title":"Newar window","context_page_description":"Newār window refers to the elaborately carved wooden window which is the distinguishing feature of traditional Nepalese architecture. The ornate windows have been described as a symbol of Newar culture and artistry. The level of design and carving of the Newar window reached its peak in the mid-18th century. They are found on palaces, private residences and sacred houses across Nepal Mandala.\\nThe lintel, sill and jamb are ornamented with figures of deities, mythical beings, dragons, peacocks, auspicious jars and other elements. The window is surmounted by ritual parasols. Traditional Newar houses are usually of four stories and built of brick. Different types of windows are used on each floor according to their function.\\nNewar windows and bare-brick facade in the traditional style are making a comeback as an architectural trend due to the tourism industry and growing heritage awareness."},{"page_url":"https://en.wikipedia.org/wiki/Lens","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/BiconvexLens.jpg","page_title":"Lens","context_page_description":"A lens is a transmissive optical device that focuses or disperses a light beam by means of refraction. A simple lens consists of a single piece of transparent material, while a compound lens consists of several simple lenses, usually arranged along a common axis. Lenses are made from materials such as glass or plastic, and are ground and polished or molded to a desired shape. A lens can focus light to form an image, unlike a prism, which refracts light without focusing. Devices that similarly focus or disperse waves and radiation other than visible light are also called lenses, such as microwave lenses, electron lenses, acoustic lenses, or explosive lenses."},{"page_url":"https://en.wikipedia.org/wiki/Sphaerius","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Sphaerius.acaroides.Reitter.tafel64.jpg","page_title":"Sphaerius","context_page_description":"Sphaerius is a genus of beetles, comprising 23 species, which are the only members of the family Sphaeriusidae. They are typically found along the edges of streams and rivers, where they feed on algae; they occur on all continents except Antarctica. Three species occur in the United States.\\nThe overall form of the beetle is convex, glossy, dark brown or black with some markings possible. The head is prominent, with relatively large eyes set far apart, and capitate antennae. Total length ranges from 0.5–1.2 mm.\\nThe beetles occur in a variety of damp environments, including mud, under stones, among plant roots and leaf litter, and in mosses in bogs. They store some air underneath their elytra.\\nFemales produce a single large egg at a time.\\nThe family used to be known as \\"Sphaeriidae\\", but the name was preoccupied by a family of freshwater clams. The name was inappropriately replaced with \\"Microsporidae\\", but this act has been superseded by a return to the use of Sphaerius and a reformation of the family name as Sphaeriusidae. The position of the family within Coleoptera has also changed a number of times."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_III_%D0%90%D1%80%D0%B3%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Miliaresion-Romanus_III-sb1822.jpg","page_title":"Роман III Аргир","context_page_description":"Роман III Аргир — византиски цар од Македонската династија кој владеел од 15 ноември 1028 г. сè до неговата смрт на 11 април 1034 г. Познат е како основач на некогашниот Св. Ѓорѓи Скоропостижник во Скопје, урнат од Турците во 1436 г. и на чие место е изградена Султан-муратовата џамија."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_gatunk%C3%B3w_z_rodzaju_Dendrobium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Dendrobium_wentianum_-_Flickr_003.jpg","page_title":"Lista gatunków z rodzaju Dendrobium","context_page_description":"Lista gatunków z rodzaju dendrobium – lista ponad 1,5 tysiąca gatunków należących do rodzaju roślin z rodziny storczykowatych.\\nSynonimy\\nAbaxianthus M.A.Clem. & D.L.Jones\\nAclinia Griff.\\nAmblyanthe Rauschert\\nAmblyanthus Brieger\\nAnisopetala M.A.Clem.\\nAporopsis M.A.Clem. & D.L.Jones\\nAporum Blume\\nAustralorchis Brieger\\nBolbodium Brieger\\nBouletia M.A.Clem. & D.L.Jones\\nCadetia Gaudich.\\nCallista Lour.\\nCannaeorchis M.A.Clem. & D.L.Jones\\nCepobaculum M.A.Clem. & D.L.Jones\\nCeraia Lour.\\nCeratobium M.A.Clem. & D.L.Jones\\nChromatotriccum M.A.Clem. & D.L.Jones\\nCoelandria Fitzg.\\nConostalix Brieger\\nDavejonesia M.A.Clem.\\nDendrobates M.A.Clem. & D.L.Jones\\nDendrocoryne Brieger\\nDesmotrichum Blume\\nDichopus Blume\\nDiplocaulobium Kraenzl.\\nDistichorchis M.A.Clem. & D.L.Jones\\nDitulima Raf.\\nDockrillia Brieger\\nDolichocentrum Brieger\\nDurabaculum M.A.Clem. & D.L.Jones\\nEleutheroglossum M.A.Clem. & D.L.Jones\\nEndeisa Raf.\\nEphemerantha P.F.Hunt & Summerh.\\nEpigeneium Gagnep.\\nEriopexis Brieger\\nEuphlebium Brieger\\nEurycaulis M.A.Clem. & D.L.Jones\\nExochanthus M.A.Clem. & D.L.Jones\\nFlickingeria A.D.Hawkes\\nFroscula Raf.\\nGoldschmidtia Dammer\\nGrastidium Blume\\nHerpetophytum Brieger\\nInobulbon Schltr. & Kraenzl."},{"page_url":"https://eu.wikipedia.org/wiki/Avelgem","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Avelgem_-_Sint-Martinuskerk_2.jpg","page_title":"Avelgem","context_page_description":"Avelgem, Belgikako mendebaldean dagoen hiria da, Mendebaldeko Flandria probintzian dagoena. Udalerriak herri hauek hartzen ditu barnean: Avelgem bera, Bossuit, Kerkhove, Outrijve eta Waarmaarde. 2013ko urtarrilaren 1ean 9.641 biztanle zituen."},{"page_url":"https://sr.wikipedia.org/wiki/Dritan_Abazovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Dritan_Abazovi%C4%87_in_Podgorica%2C_February_2019.jpg","page_title":"Dritan Abazović","context_page_description":"Dr Dritan Abazović je političar u Crnoj Gori albanske nacionalnosti.\\nPredsjednik je Građanskog pokreta URA i tu funkciju obavlja od aprila 2017. godine. Poslanik je 26. saziva Skupštine Crne Gore."},{"page_url":"https://ca.wikipedia.org/wiki/Microlaena","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Microlaena_avenacea_-_University_of_California_Botanical_Garden_-_DSC08899.JPG","page_title":"Microlaena","context_page_description":"Microlaena és un gènere de plantes de la família de les poàcies, ordre poals, subclasse de les commelínides, classe de les liliòpsides, divisió dels magnoliofitins."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%D9%86%D9%84%E2%80%8C%D8%B3%D8%A7%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Z%C3%BCrich_-_Oerlikon_-_Tunnelbohrmaschine_IMG_0002.JPG","page_title":"تونل‌سازی","context_page_description":"تونل‌سازی در جهان امروز یکی از مشاغل مهم است که در شرایط موجود، راه‌های سخت‌گذر را خیلی آسان ساخته‌است. اکنون تونل‌سازان توانسته‌اند در زیر دریاها، میان کوه‌ها و زیر زمین و حتی برای مقاصد راه اتصالی و انتقال سیم برق و تلفن، خط ریل، مخفی‌گاه‌ها، گدامها، انتقال پایپ لاین، پایپ آب و غیره تونل ایجاد کنند. یکی از کارهای مشکل تونل‌سازی حفر یا ایجاد سوراخ تونل است که باید دقیق به محلی که تونل ختم می‌شود سوراخ شود. بدین منظور، کمپانی‌های مجرب وجود دارد. این کمپانی‌ها از وسایل مدرن به‌نام تی‌بی‌ام استفاده می‌کنند. این ماشین‌ها توسط شرکت روبین کانادایی و سایر کمپانی‌ها ساخته می‌شود.\\nماشین TBM می‌تواند ۱۶ متر در روز حفر کند. از این ماشین برای سوراخ کردن سنگ و خاک و ریگ استفاده می‌شود و حتی توانایی سوراخ کردن زمین به‌شکل افقی را نیز دارد. قطر این ماشین‌ها، که برای سوراخ کردن سنگ‌ها به‌کار می‌رود ۱۴٫۳ متر است. برای سوراخ کردن خاک و ریگ نیز شرکتی آلمانی با نام Herrenknecht AG توانسته‌است به قطر ۱۵٫۴۳ متر در پروژهٔ شانگهای چین و در سال ۲۰۰۵ قطر ۱۹ متر را تولید کند. در صنعت طراحی و ساخت تونل‌ها کشورهای آمریکا، آلمان، ژاپن، چین و روسیه این فناوری را دارا هستند."},{"page_url":"https://de.wikipedia.org/wiki/Hawtai_B21","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Hawtai_E70_02_China_2019-03-20.jpg","page_title":"Hawtai B21","context_page_description":"Der Hawtai B21, auch Hawtai E70 oder Hawtai E80, ist eine Limousine der Mittelklasse des chinesischen Automobilherstellers Hawtai, die unter dem B11 positioniert ist."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Bezirk_Lienz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Unterleibnig_-_Kapelle.jpg","page_title":"Liste der Naturdenkmäler im Bezirk Lienz","context_page_description":"Die Liste der Naturdenkmäler im Bezirk Lienz listet alle als Naturdenkmal ausgewiesenen Objekte im Bezirk Lienz im Bundesland Tirol auf. Unter den 44 Naturdenkmälern befindet sich eine hohe Anzahl an Sommer- und Winter-Linden sowie zahlreiche Lärchen und Ahorne. Des Weiteren befinden sich Baumgruppen, ein Park, Gewässerstrecken, Teiche und ein Hochmoor unter den Naturdenkmälern. Die erste Unterschutzstellung erfolgte im Jahr 1931, die letzte im Jahr 2014."},{"page_url":"https://eu.wikipedia.org/wiki/The_Spy_Who_Came_in_from_the_Cold_(filma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Liz_Taylor_en_Richard_Burton_tijdens_persconferentie_op_Schiphol._Regisseur_Mart%2C_Bestanddeelnr_917-6936.jpg","page_title":"The Spy Who Came in from the Cold (filma)","context_page_description":"The Spy Who Came in from the Cold 1965eko Martin Ritt estatubatuar zinema zuzendariaren britainiar film bat da. John le Carré idazlearen The Spy Who Came in from the Cold eleberrian oinarritua dago. Film honetan honako aktoreek antzeztu zuten: Richard Burton, Claire Bloom, Oskar Werner eta George Voskovec.\\n1965eko Gizonezko aktore onenaren Oscar Saria eta Zuzendaritza artistiko onenaren Oscar Sarirako izendapenak jaso zituen."},{"page_url":"https://sv.wikipedia.org/wiki/Hurst,_Berkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Hurst_-_geograph.org.uk_-_3347.jpg","page_title":"Hurst, Berkshire","context_page_description":"Hurst är en by i Wokingham distrikt i Berkshire grevskap i England. Byn är belägen 8,8 km\\nfrån Reading. Orten har 1 366 invånare."},{"page_url":"https://la.wikipedia.org/wiki/Telesphorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Papa_Telesforo.jpg","page_title":"Telesphorus","context_page_description":"Telesphorus, fuit episcopus Romae ac Papa Ecclesiae Catholicae Romanae circiter ab anno 126."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%80%E1%80%94%E1%80%85%E1%80%AD%E1%80%AF%E1%80%B8%E1%80%95%E1%80%84%E1%80%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Baccaurea_ramiflora%2C_Burmese_Grape.jpg","page_title":"ကနစိုးပင်","context_page_description":"ကနစိုးပင် သည် အမြဲစိမ်းပင်မျိုးဖြစ်၍ အထက်နှင့် အောက်မြန်မာပြည် မိုးများသော ဒေသများတွင် ပေါက်သည်။ အရွယ်မှာ အလတ်စားမျိုးဖြစ်သဖြင့် အမြင့်ပေ ၄ဝ မှ ၅ဝ အထိ၊ ပင်စည်လုံး ပတ် ၃ ပေမှ ၅ ပေအထိသာ ရှိကြ သည်။ ကနစိုးသား၏ အရောင်မှာညို၍ အသင့်အတင့် မာ သည်။ တပို့တွဲနှင့်တပေါင်းလများတွင် ပန်းပွင့်၍ တန်ခူးနှင့် ကဆုန်လများတွင် အသီးများမှည့်ကြသည်။ ထိုအချိန်၌ တစ်ပင် လုံး ဝါးဝင်းလုမတတ် လှပစွာ တွဲရရွဲသီးနေသော ကနစိုးသီး တို့မှာ မြင်ရသူများအဖို့ သွားရည်ကျစရာ ဖြစ်တော့၏။ စပျစ် သီးခိုင်ကဲ့သို့ အပြွတ်လိုက်၊ အခိုင်လိုက် သီးသဖြင့် အင်္ဂလိပ် လူမျိုးတို့က မြန်မာစပျစ်သီးပင်ဟူ၍ပင် အမည်ပေးထားကြ သည်။\\nကနစိုးသီးသည် မမှည့်သေးမီအချိန်တွင် အစိမ်းရောင်ရှိ၍ မှည့်လာသောအခါမှ ဝါလာသည်။ အခွံဝါ အတွင်းရှိ နှင်းဆီ ရောင်ဖျော့ဖျော့ အမြွှာသုံးခုကို လူတို့စားသုံးကြသည်။ အမြွှာ များအတွင်း၌ အစေ့တစ်စေ့စီ ပါရှိ၏။ ကနစိုးသီးတွင် အချို့ သို့မဟုတ် ချိုချဉ်မျိုးနှင့် အချဉ်မျိုးဟူ၍ နှစ်မျိုးထင်ရှားရှိသည်။မြန်မာနိုင်ငံ၌ အစေ့များကိုသာ စိုက်ပျိုးကြသည်။ ဒပ်ချ် အရှေ့အိန္ဒိယကျွန်းစုတွင်မူ အကိုင်းဆက် နည်းဖြင့် မျိုးပွားစေ သကဲ့သို့ မြန်မာနိုင်ငံ၌လည်း စမ်းသပ်ကြည့်သင့်ပေသည်။ မိုးဦးကျ ဥတုပြောင်းချိန်တွင် ကလေးသူငယ်များသည်\\nကနစိုးသီးကို အလွန်အကျွံ စားမိရာမှ ဝမ်းကိုက်ခြင်း၊ ဓာတ် လျှောခြင်းများ ဖြစ်ပွားတတ်သဖြင့် လူကြီးမိဘလုပ်သူများ သတိထားဖို့လိုသည်။"},{"page_url":"https://de.wikipedia.org/wiki/Nichols_%26_Shepard_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Ethel_Clayton%2C_Nichols_and_Shepard_US_traction_engine_%28sloping_land%29.jpg","page_title":"Nichols & Shepard Company","context_page_description":"Nichols & Shepard Company war ein US-amerikanischer Hersteller von landwirtschaftlichen Geräten."},{"page_url":"https://nl.wikipedia.org/wiki/Elastantie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/3036810_13239_2010_27_Fig1_HTML.png","page_title":"Elastantie","context_page_description":"Elastantie is een maat voor de stijfheid van een structuur. Het geeft daarmee de neiging van de structuur aan om terug te keren naar zijn oorspronkelijke vorm zodra uitwendige krachten worden opgeheven.\\nDaarbij staat E voor de elastantie, ΔP voor de drukverandering en ΔV voor de volumeverandering.\\nElastantie is de inverse van compliantie. De compliantie geeft aan in welke mate de structuur neigt mee te geven als er uitwendige krachten op worden uitgeoefend.\\nen dus\\nMet C hierin de compliantie.\\nIn sommige gevallen wil men niet de stijfheid van de structuur maar de stijfheid van het materiaal bepalen. Hiervoor wordt de elasticiteitsmodulus gebruikt. In biologisch materiaal is het verband tussen spanning en rek niet lineair en wordt gesproken van de incrementele elasticiteitsmodulus. Het verband tussen de stijfheid van een structuur en de stijfheid van het materiaal van een bloedvat wordt bijvoorbeeld gegeven in de volgende formule:\\nDaarbij zijn EA en CA respectievelijk de elastantie en de compliantie van de oppervlakte van de dwarsdoorsnede, rᵢ de inwendige straal van het bloedvat en h de dikte van de vaatwand."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8E%AB%E4%BA%9A_(%E5%B7%B4%E5%A1%9E%E7%BD%97%E9%82%A3%E7%9C%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Localitzaci%C3%B3_de_Moi%C3%A0.png","page_title":"莫亚 (巴塞罗那省)","context_page_description":"莫亞，是西班牙加泰羅尼亞巴塞隆納省的一個市鎮。總面積76平方公里，總人口5766人，人口密度76人/平方公里。"},{"page_url":"https://zh.wikipedia.org/zh-sg/MIDI","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/NoteNamesFrequenciesAndMidiNumbers.svg","page_title":"MIDI","context_page_description":"音乐数字接口是一个工业标准的电子通信协议，为电子乐器等演奏设备定义各种音符或弹奏码，容许电子乐器、电脑、手机或其它的舞台演出配备彼此连接，调整和同步，得以即时交换演奏数据。\\nMIDI不发送声音，只发送像是音调和音乐强度的数据，音量，颤音和相位等参数的控制信号，还有设置节奏的时钟信号。在不同的电脑上，输出的声音也因音源器不同而有差异。\\nMIDI演出控制协议是为MIDI而设的工业标准，由MIDI产业协会在1991年制定。它允许不同种类的媒体控制设备在相互之间的通信，借助电脑可以现场进行演出控制的功能与娱乐应用。与音乐MIDI相同，MSC并不传输实际显示的媒体－ 它只是简单地传输有关多媒体性能的指令。\\n现在几乎所有的录音工程都将MIDI作为一项关键开放技术来纪录音乐。除此之外，MIDI也用来控制包括录音设备的硬件，如舞台灯、效果器踏板等高性能的设备。近十年，MIDI已经堂堂迈入移动电话领域。MIDI用来播放支持MIDI移动电话的铃声。MIDI还可为某些电子游戏、电脑游戏提供背景音乐。\\nMIDI标准是在1981年由工程师戴夫·史密斯向音频工程协会提出的一篇论文，MIDI 1.0于1983年8月发布。\\nMIDI使得电脑、合成器、声卡以及电子乐器能互相控制、交换消息。现在电脑的声卡都是与MIDI兼容的，并能逼真地模拟乐器的声音。\\n许多音乐的文件格式，都建构于MIDI档之上。这些格式可说就是电子乐器在看的电子乐谱，所以通常一个文件只需几十KB，就能够让电子乐器演奏出一首很完整的音乐。"},{"page_url":"https://lt.wikipedia.org/wiki/Jungajaus_provincija","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Provincia_de_Yungay.png","page_title":"Jungajaus provincija","context_page_description":"Jungajaus provincija yra Peru, Ankašo departamento centrinėje dalyje. Provincija padalinta į 8 apygardas. Sostinė – Jungajas."},{"page_url":"https://ro.wikipedia.org/wiki/Trichinella","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Trichinella_larv1_DPDx.JPG","page_title":"Trichinella","context_page_description":"Trichinella sau trichină, trichinelă [din latina trichina, din adjectivul grec τρίχῐνος = referitor la păr, din θρίξ, τριχ = păr + -ella = sufix latin diminutiv] – gen de viermi nematelminți paraziți care trăiesc în intestinul șobolanilor, al porcilor, al urșilor etc. sau închistați în mușchii acestor animale, putând trece și la om, prin consumarea cărnii de porc sau de urs etc. infestate, provocând trichineloză."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Margherita_(Londra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Saint.margarets.overall.london.arp.jpg","page_title":"Chiesa di Santa Margherita (Londra)","context_page_description":"La chiesa di Santa Margherita, parte storica di Ossulstone nella contea di Middlesex, è un luogo di culto anglicano che si trova nei pressi dell'abbazia di Westminster in Parliament Square, ed è la parrocchia del parlamento britannico a Londra. È dedicata a Santa Margherita di Antiochia."},{"page_url":"https://ca.wikipedia.org/wiki/Original_Dixieland_Jass_Band","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/ODJBcard.JPG","page_title":"Original Dixieland Jass Band","context_page_description":"Original Dixieland Jass Band, abreujat ODJB, va ser una formació pionera en l'origen i evolució del jazz; una banda de jazz dixieland amb origen a Nova Orleans, Estats Units, a la qual se li atribueixen els primers enregistraments de jazz l'any 1917.\\nEs tracta d'un grup de músics de Nova Orleans que es van fer populars mentre tocaven al cafè Schiller a Chicago i el restaurant Reisenweber a Nova York. \\"Livery Stable Blues\\" es va convertir en la primera composició de jazz coneguda, gravada el 26 de febrer de 1917, la qual juntament amb el Dixie Jass Band One-Step ha estat considerat el primer àlbum de jazz publicat. El quintet l'integraven el clarinet Larry Shields, el corneta Dominic James La Rocca, el trombó Edwin Branford Edwards, el pianista Henry Ragas i el bateria Tony Sbarbaro. Tots ells havien actuat anteriorment, ja de forma conjunta, en diverses bandes de Nova York."},{"page_url":"https://vi.wikipedia.org/wiki/Ficus_coronulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Gardenology.org-IMG_0669_rbgs10dec.jpg","page_title":"Ficus coronulata","context_page_description":"Ficus coronulata là một loài thực vật có hoa trong họ Moraceae. Loài này được Miq. mô tả khoa học đầu tiên năm 1861."},{"page_url":"https://fr.wikipedia.org/wiki/Max_Liebermann","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Liebermann_Garten_Wannsee.jpg","page_title":"Max Liebermann","context_page_description":"Max Liebermann est un peintre et graveur allemand né le 20 juillet 1847 à Berlin et mort le 8 février 1935, dans la même ville. Il a été contemporain du mouvement impressionniste, sans s'y associer.\\nAprès une formation à Weimar, et plusieurs séjours à Paris et aux Pays-Bas, il peint tout d'abord des œuvres naturalistes à thème social. L'étude des impressionnistes français lui permettra de trouver, à partir de 1880, la palette claire et le coup de pinceau vigoureux qui caractérisent ses principales toiles.\\nSon œuvre représente symboliquement la transition entre l'art du XIXᵉ siècle, l'art moderne classique de l'époque wilhelminienne, et celui de la République de Weimar. C'est cette mutation qu'il a encouragée en tant que président de la Sécession berlinoise.\\nDe 1920 à 1933, il dirige l'Académie prussienne des arts de Berlin, avant de démissionner en raison de l'influence grandissante du nazisme sur la politique des arts. Il se retire alors à Berlin, sa ville natale, où il passe les deux dernières années de sa vie."},{"page_url":"https://de.wikipedia.org/wiki/Alfred_Keller_(Architekt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/David-Hof_Effingergasse.jpg","page_title":"Alfred Keller (Architekt)","context_page_description":"Alfred Keller war ein österreichischer Architekt, Maler und Grafiker."},{"page_url":"https://sv.wikipedia.org/wiki/Cyperus_gilesii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cyperus_gilesii_habit.jpg","page_title":"Cyperus gilesii","context_page_description":"Cyperus gilesii är en halvgräsart som beskrevs av George Bentham. Cyperus gilesii ingår i släktet papyrusar, och familjen halvgräs. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/HMS_Highflyer_(1898)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/HMS_Gladiator_%281896%29_IWM_Q_021285.jpg","page_title":"HMS Highflyer (1898)","context_page_description":"Der Geschützte Kreuzer HMS Highflyer wird meist als das Typschiff der drei Kreuzer der Highflyer-Klasse der Royal Navy bezeichnet. Ihre erste Verwendung erfolgte als Flaggschiff der East Indies Station vor Somaliland. Die Highflyer bekämpfte im Ersten Weltkrieg am 26. August 1914 den deutschen Hilfskreuzer und Schnelldampfer SMS Kaiser Wilhelm der Große vor Río de Oro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_S%C3%A4chsischen_Landtags_(6._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Frank_Uwe_Hirche_%28Martin_Rulsch%29_2.jpg","page_title":"Liste der Mitglieder des Sächsischen Landtags (6. Wahlperiode)","context_page_description":"Die Liste bietet einen Überblick über alle Mitglieder des 6. Sächsischen Landtags, der in der Landtagswahl vom 31. August 2014 gewählt wurde. Die Konstituierung des Landtags erfolgte am 29. September 2014."},{"page_url":"https://fr.wikipedia.org/wiki/Tr%C3%A9sorier_des_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Michael_Hillegas_signature.png","page_title":"Trésorier des États-Unis","context_page_description":"Le trésorier des États-Unis est un fonctionnaire du département du Trésor des États-Unis."},{"page_url":"https://de.wikipedia.org/wiki/Fegefeuer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Wimpfen-stadtkirche-predell.jpg","page_title":"Fegefeuer","context_page_description":"Fegefeuer, selten Fegfeuer, bezeichnet die Läuterung, die nach einer besonders in der Westkirche entwickelten theologischen Lehre eine Seele nach dem Tod erfährt, sofern sie nicht als heilig unmittelbar in den Himmel aufgenommen wird. Dieser Zwischenzustand wird gleichnisweise als Ort der Läuterung, gewissermaßen als Intermediärzone, oder als zeitlicher Prozess vorgestellt. Nachdem die Kirchen der Reformation die Lehre vom Fegefeuer verworfen haben, wird sie heute fast nur noch von der römisch-katholischen Kirche vertreten; für die Ostkirchen hingegen hat sie nie größere Bedeutung gehabt. Innerhalb der Dogmatik gehört das Thema Fegefeuer zur Eschatologie, welche Die vier letzten Dinge behandelt: Tod, Jüngstes Gericht bzw. Apokalypse, Himmel und Hölle. Eng mit der Lehre vom Purgatorium verbunden ist jene vom Partikulargericht über die Seele des Einzelnen unmittelbar nach dem Tode."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_Khe_Sanh","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Artillery_Walking_barrage_illustration.jpg","page_title":"Bataille de Khe Sanh","context_page_description":"Le siège de Khe Sanh est une bataille de la guerre du Viêt Nam qui opposa l'armée américaine à l'Armée populaire vietnamienne et les troupes du Front national de libération du Sud Viêt Nam. Elle se déroula au début de 1968, durant la fameuse offensive du Tết. Elle commença le 21 janvier, et dura 77 jours. Conclue par une victoire américaine, elle n'eut cependant pas de réelle implication stratégique."},{"page_url":"https://de.wikipedia.org/wiki/Alma_Bridwell_White","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Alma_White_01b.jpg","page_title":"Alma Bridwell White","context_page_description":"Alma Bridwell White – „Mollie“ war die Gründerin der methodistisch-pfingstlerischen Kirche Pillar of Fire International. 1918 wurde sie zur ersten Bischöfin in den Vereinigten Staaten ernannt. Darüber hinaus wurde sie bekannt durch ihre Verbindung mit dem Ku-Klux-Klan, ihren Feminismus, ihren Antisemitismus, ihre ablehnende Haltung gegenüber dem Katholizismus und der Pfingstbewegung, ihren Rassismus und ihre Ablehnung von Einwanderern."},{"page_url":"https://nl.wikipedia.org/wiki/Ch%C3%A2teau-Porcien","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Ch%C3%A2teau-Porcien_%28Ardennes%29_mairie.JPG","page_title":"Château-Porcien","context_page_description":"Château-Porcien is een gemeente in het Franse departement Ardennes in de regio Grand Est en telt 1409 inwoners. De plaats maakt deel uit van het arrondissement Rethel."},{"page_url":"https://en.wikipedia.org/wiki/The_Haven,_Boston","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/GrandSluiceDownstreamBoston.jpg","page_title":"The Haven, Boston","context_page_description":"The Haven is the tidal river of the port of Boston, Lincolnshire in England. It provides access for shipping between Boston Deeps in The Wash and the town, particularly, the dock. It also serves as the outfall into the sea, of the River Witham and of several major land drains of the northern Fens of eastern England, which are known collectively as the Witham Navigable Drains."},{"page_url":"https://de.wikipedia.org/wiki/Bocholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Einwohnerentwicklung_von_Bocholt.svg","page_title":"Bocholt","context_page_description":"Die Stadt Bocholt liegt im Westmünsterland, also im Nordwesten von Nordrhein-Westfalen. Sie ist die einzige Große kreisangehörige Stadt und zugleich die größte Stadt des Kreises Borken im Regierungsbezirk Münster. Bocholt ist nach Aachen die zweitgrößte deutsche Stadt an der deutsch-niederländischen Grenze und die drittgrößte Stadt im Münsterland nach Münster und Rheine."},{"page_url":"https://it.wikipedia.org/wiki/Niklaus_Manuel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Niklaus_Manuel_Deutsch_001.jpg","page_title":"Niklaus Manuel","context_page_description":"Niklaus Manuel pseudonimo di Niklaus Deutsch' è stato un pittore, disegnatore e drammaturgo svizzero."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Hochsauerlandkreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Brilon%2C_NSG_Ammertenb%C3%BChl%2C_HSK-505_%281%29.JPG","page_title":"Liste der Naturschutzgebiete im Hochsauerlandkreis","context_page_description":"Die Liste der Naturschutzgebiete im Hochsauerlandkreis enthält die Naturschutzgebiete des Landkreises Hochsauerlandkreis in Nordrhein-Westfalen."},{"page_url":"https://sco.wikipedia.org/wiki/Yueyang","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Location_of_Yueyang_Prefecture_within_Hunan_%28China%29.png","page_title":"Yueyang","context_page_description":"Yueyang is a prefectur-level ceety at the northeastren corner o Hunan province, Fowkrepublic o Cheenae, on the sootrhen shores o Dongting Loch.\\nYueyang haes an admeenistrative aurie o 14,896 km² an the ceety proper, 304 km². The population wis 5,477,911 at the 2010 census whom 991,465 lived in the biggit-up aurie made up o Yueyanglou Destrict an Yunxi Destrict.\\nThe ceety's maist famous attraction is the Yueyang Touer."},{"page_url":"https://fr.wikipedia.org/wiki/Buhy","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Buhy_%2895%29%2C_vue_sur_l%27ouest_du_village_depuis_la_rue_du_Tr%C3%A9sor.jpg","page_title":"Buhy","context_page_description":"Buhy est une commune française située dans le département du Val-d'Oise, en région Île-de-France.\\nSes habitants sont appelés les Buhyiens."},{"page_url":"https://fr.wikipedia.org/wiki/Paquita_Sauquillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Paquita_Sauquillo_en_un_acto_de_apoyo_a_Trinidad_Jim%C3%A9nez_%28cropped%29.jpg","page_title":"Paquita Sauquillo","context_page_description":"Francisca \\"Paquita\\" Sauquillo Pérez del Arco, née le 31 juillet 1943 à Madrid, est une femme politique espagnole.\\nMembre du Parti socialiste ouvrier espagnol, elle siège à l'Assemblée de Madrid et au Sénat de 1983 à 1994, puis siège au Parlement européen de 1994 à 2004."},{"page_url":"https://de.wikipedia.org/wiki/Lontong","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Sate_ayam_lontong_asongan.JPG","page_title":"Lontong","context_page_description":"Lontong ist in Bananenblätter eingewickelter und kalt gegessener verklumpter Reis. Häufig wird er zu Saté oder Gado-Gado als Beilage serviert. Eine Variante von Lontong sieht vor, zusätzlich zum Snack Fleisch und Gemüse – z. B. Karotten, Bohnen und Kartoffeln – zu verarbeiten und anzubieten.\\nKetupat ist ein in Palmenblättern gekochter Reis."},{"page_url":"https://eo.wikipedia.org/wiki/Listo_de_kultivataj_lignoplantoj_(foliplanto)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Hypericum_patulum1.jpg","page_title":"Listo de kultivataj lignoplantoj (foliplanto)","context_page_description":"Jen listo de la kultivataj lignoplantoj en Eŭropo.\\npor pinaloj vidu: listo de kultivataj pinaloj.\\nPor la rododendroj vidu: Listo de la kultivataj rododendroj\\npor la bambuoj kaj parencaj plantoj el la poacoj vidu: listo de kultivataj lignaj poacoj\\npor larozoj vidu: listo de kultivataj rozoj"},{"page_url":"https://de.wikipedia.org/wiki/U-Boot-Vorf%C3%A4lle_in_Schweden","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Hoheitsgewaesser_Schweden.png","page_title":"U-Boot-Vorfälle in Schweden","context_page_description":"U-Boot-Vorfälle in Schweden behandelt verschiedene, teilweise vermeintliche Verletzungen schwedischer Hoheitsgewässer durch ausländische U-Boote oder andere unidentifizierte Unterwasserfahrzeuge während der Spätphase des Kalten Krieges und in jüngster Zeit.\\nDie Vorfälle lösten in Schweden eine Debatte über eine mögliche Infiltration schwedischer Hoheitsgewässer durch sowjetische U-Boote aus. Die schwedische Marine reagierte mit verstärkten Patrouillen, Minenlegungen und elektronischen Überwachungsmaßnahmen sensibler Passagen. Mehrmals wurden mutmaßliche U-Boote mit Unterwasserbomben verfolgt und angegriffen, dabei kam es weder zu Treffern noch zu Aufbringungen.\\nBerichte über neue Sichtungen und Fernsehaufnahmen von schwedischen Marinehubschraubern, die Unterwasserbomben in küstennahe Gewässer abwarfen, häuften sich in den späten 1980ern. Die Episode wird in Schweden als ikonisch für den Kalten Krieg und die schwedischen Beziehungen zur Sowjetunion wahrgenommen. Berichte über das Eindringen von U-Booten in schwedische Gewässer wurden kontrovers diskutiert. Es entwickelte sich eine Debatte, deren Fronten zwischen den Trennlinien von Links und Rechts verliefen."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Jefferson_County,_Kentucky","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Haldeman_House_northern_side_and_end.jpg","page_title":"National Register of Historic Places listings in Jefferson County, Kentucky","context_page_description":"The table below includes sites listed on the National Register of Historic Places in Jefferson County, Kentucky except those in the following neighborhoods/districts of Louisville: Anchorage, Downtown, The Highlands, Old Louisville, Portland and the West End. Links to tables of listings in these other areas are provided below.\\nThere are 490 properties and districts in the county listed on the National Register, including 8 National Historic Landmarks and 2 National Cemeteries. Latitude and longitude coordinates of the 221 sites listed on this page may be displayed in a map or exported in several formats by clicking on one of the links in the box below the map of Kentucky to the right.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Union_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/USS_Conestoga_h55321.jpg","page_title":"Union Navy","context_page_description":"The Union Navy was the United States Navy during the American Civil War, when it fought the Confederate States Navy. The term is sometimes used carelessly to include vessels of war used on the rivers of the interior while they were under the control of the United States Army, also called the Union Army."},{"page_url":"https://cs.wikipedia.org/wiki/Ineu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/ROU_AR_Ineu_CoA.jpg","page_title":"Ineu","context_page_description":"Ineu je město v Rumunsku v župě Arad. V roce 2009 zde žilo 9 576 obyvatel."},{"page_url":"https://pt.wikipedia.org/wiki/Lu%C3%ADs_Alexandre_de_Bourbon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/1708_-_Louis-Alexandre_de_Bourbon_%28mob._nat%29.jpg","page_title":"Luís Alexandre de Bourbon","context_page_description":"Luís Alexandre de Bourbon foi um filho legitimado do rei Luís XIV de França e de Francisca Atenas, conhecida como Madame de Montespan. Ele foi conde de Toulouse, duque de Penthièvre, de Châteauvillain, Damville, Vendôme, d'Arc, e de Rambouillet."},{"page_url":"https://en.wikipedia.org/wiki/Meronera_venustula","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Meronera_venustula_P1020109b.jpg","page_title":"Meronera venustula","context_page_description":"Meronera venustula is a species of rove beetle in the family Staphylinidae. It is found in North America."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%B8%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Georgi-Danchov-Svobodna-Bulgaria.jpg","page_title":"Литография","context_page_description":"Литография е метод за печатане върху гладка повърхност. Така се нарича и полученият отпечатък.\\nС помощта на този метод може да се отпечата текст или рисунка. При литографията се използват литографски камък, цинков или алуминиев лист."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BB%D1%8B%D1%88%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Caspian_and_Semnani_languages.svg","page_title":"Талышский язык","context_page_description":"Талы́шский язы́к — язык талышей, относится к северо-западной группе иранских языков индоевропейской языковой семьи, распространен на юге Азербайджана и в сопредельных районах Ирана. Является прямым потомком или ближайшим родственником иранского языка азери, распространённого на территории Азербайджана до прихода сельджуков.\\nРаспространён в Талыше. Число говорящих — от 184 100 до 1 300 000 человек.\\nТалышский язык подвёргся значительному влиянию азербайджанского и гилянского языков. Причём талышский также повлиял на гилянский язык. Несмотря на это, он сохраняет все свои исконные черты и является одним из наиболее богатых и архаичных представителей иранской группы языков.\\nСовременный талышский язык состоит из трех основных диалектных массивов: южный, центральный и северный. Наиболее изученным является последний, в котором насчитываются не менее шести говоров — ленкоранский, астаринский, лерикский, масаллинский, шувинский и анбаранский. Из центральных и южных говоров известны масулинский, асалемский, хошабарский, туларудский, визнинский, шандерманский, паресарский и зидинский."},{"page_url":"https://it.wikipedia.org/wiki/Bombardamento_di_Bruxelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Maisons_Grand-Place_BXL_De_Rons_03.jpg","page_title":"Bombardamento di Bruxelles","context_page_description":"Il bombardamento della città di Bruxelles realizzato dalle truppe francesi del re Luigi XIV, nei giorni del 13, 14 e 15 di agosto del 1695, e l'incendio che ne seguì, è stata la maggiore catastrofe che abbia mai colpito la capitale del Belgio nel corso della sua storia.\\nLa ricostruzione del centro della città, realizzata negli anni seguenti, ne ha profondamente modificato l'aspetto lasciando, ancora oggi, numerose tracce."},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%A1rio_Nascimento","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/O_Mosquito.jpg","page_title":"Mário Nascimento","context_page_description":"Mário Júlio Ferreira de Carvalho Nascimento foi jornalista, poeta e pintor-cenógrafo.\\nFilho de Josué do Nascimento, fiscal da Câmara de Setúbal, pessoa bondosa e muito estimada, e de Maria José Ferreira de Carvalho Nascimento, doméstica e mãe de cinco filhos, Mário Nascimento completou o Curso Secundário no Liceu de Bocage. Desses já longínquos anos 20, restou uma fotografia tirada com os seus colegas do Liceu. Mário Nascimento é o 1º em baixo, à direita.\\nEmpregou-se transitoriamente, como ajudante de secretaria na Câmara Municipal; tirou depois o Curso de Contabilista, então chamado Guarda-Livros, após o qual passou a dirigir o escritório da Associação de Instrução e Beneficência Familiar de Setúbal, instituição fundada em 1923 por um comerciante do ramo vinícola, Carlos Augusto Ferreira.\\nComo artista amador, Mário Nascimento pintou a óleo e aguarela alguns pequenos quadros; não tendo estudado música, tocava guitarra portuguesa e piano.\\nPoliticamente e por tradição familiar, era um bom democrata, condenando, por consequência, toda e qualquer opressão social. Em 4 de Julho de 1948, casou com D.ª Elisa de Oliveira Assis, e passou a residir em Palmela."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A3%9F%E8%82%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Celular_006.jpg","page_title":"食肉","context_page_description":"本項目では、食肉のうち、食用にする肉について述べる。主に鳥類を含む動物の肉、畜産動物または野生動物を食肉加工したものについて解説する。"},{"page_url":"https://en.wikipedia.org/wiki/Betsy_DeVos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/EDBfDy0VUAEUi10g.jpg","page_title":"Betsy DeVos","context_page_description":"Elisabeth Dee DeVos is the 11th and current United States Secretary of Education since 2017. DeVos is known for her support for school choice, school voucher programs, and charter schools. She was Republican National Committeewoman for Michigan from 1992 to 1997 and served as chair of the Michigan Republican Party from 1996 to 2000, with reelection to the post in 2003. She has advocated for the Detroit charter school system and she is a former member of the board of the Foundation for Excellence in Education. She has served as chair of the board of the Alliance for School Choice and the Acton Institute and headed the All Children Matter PAC.\\nDeVos is married to former Amway CEO Dick DeVos. Her brother, Erik Prince, a former U.S. Navy SEAL officer, is the founder of Blackwater USA. Their father is Edgar Prince, founder of the Prince Corporation. In 2016, the family was listed by Forbes as the 88th-richest in America, with an estimated net worth of $5.4 billion.\\nOn November 23, 2016, then-President-elect Donald Trump announced that he would nominate DeVos to serve as Secretary of Education in his administration."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BA%D1%81%D0%BE%D1%81_(%D0%B3%D1%80%D0%B0%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Naxos_Portara.JPG","page_title":"Наксос (град)","context_page_description":"Наксос град је у средишњој Грчкој и седиште истоименог округа Наксос, као и највеће насеље истоименог острва Наксос, у периферији Јужни Егеј."},{"page_url":"https://jv.wikipedia.org/wiki/Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Washington_Metro.jpg","page_title":"Washington, D.C.","context_page_description":"Washington, District of Columbia ya iku kutha krajan Amérikah Sarékat. Kutha iki ora kalebu praja ngendi baé, nanging minangka wewengkon fédheral. Minangka pusat pamaréntahan nagara Amérikah Sarékat, Kutha Washington ora banjur uga dadi kutha dagang lan ékonomi. Tata ruangé diutamaaké kanggo kantor-kantor pamaréntah lan kegiyatan para diplomat saka mancanagara.\\nSaliyané iku, sing ndunungi kutha iki nduwé hak pilih ing pemilihan umum, nanging ora duwé wakil ing kongres, parlemené Amérikah Sarékat. Padunung kutha iki udakara 600.000 wong. Komposisi relatif padununge ya iku kurang luwih 65% ras kulit ireng, 30% ras kulit putih, lan 5% sing liyané."},{"page_url":"https://no.wikipedia.org/wiki/Europavei_22","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/E22norr1.jpg","page_title":"Europavei 22","context_page_description":"Europavei 22 går mellom Holyhead i Storbritannia og Isjim i Russland. Veiens lengde er rundt 5320 km.\\nTrasé fastlagt av UNECE: Holyhead – Chester – Warrington – Manchester – Leeds – Doncaster – Immingham ... Amsterdam – Groningen – Bremen – Hamburg – Lübeck – Rostock – Stralsund – Sassnitz ... Trelleborg – Malmö – Kalmar – Norrköping ... Ventspils – Riga – Rezekne – Velikie Luki – Moskva – Vladimir – Nizjnij Novgorod – Jekaterinburg – Isjim.\\nVeien har ingen sjøforbindelse mellom Immingham/Grimsby og Amsterdam, og mellom Norrköping og Ventspils."},{"page_url":"https://la.wikipedia.org/wiki/Gez-ez-Angles","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Map_commune_FR_insee_code_65203.png","page_title":"Gez-ez-Angles","context_page_description":"Gez-ez-Angles est parvum commune Francicum 26 incolarum praefecturae Pyrenaei Superioris in regione australi Meridiano et Pyrenaeis."},{"page_url":"https://sv.wikipedia.org/wiki/Evanescence","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Evanescence_at_The_Wiltern_theatre_in_Los_Angeles%2C_California_08.jpg","page_title":"Evanescence","context_page_description":"Evanescence är ett amerikanskt rockband som bildades 1995 i Little Rock, Arkansas av sångerskan/pianisten Amy Lee och gitarristen Ben Moody. Gruppens genombrott kom i samband med debutalbumet Fallen, som med fler än 17 miljoner sålda exemplar hjälpte dem att vinna två Grammy Awards. Till bandets populäraste låtar hör singlarna \\"Bring Me to Life\\", \\"Going Under\\", \\"My Immortal\\" och \\"Call Me When You're Sober\\".\\nEvanescence tredje album är det självbetitlade Evanescence som släpptes den 4 oktober 2011. Det är deras första album sedan The Open Door från 2006."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jason-jordan-08-09-14.jpg","page_title":"Lijst van personen geboren in 1978","context_page_description":"Dit is een lijst van personen die geboren zijn in 1978.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Cassandra_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Cassandra_Wilson_2.jpg","page_title":"Cassandra Wilson","context_page_description":"Cassandra Wilson ist eine US-amerikanische Jazz-Sängerin.\\nWilsons Repertoire umfasst Jazz und Blues, aber auch Pop- und Rock-Lieder. Ihre Altstimme wird als bluesig und temperamentvoll beschrieben und ihr Musikstil reicht von Swing über Funk bis Bossa Nova. Sie ist zweifache Grammy-Gewinnerin."},{"page_url":"https://ms.wikipedia.org/wiki/Nowra,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/AMudgeeShot0013.jpg","page_title":"Nowra, New South Wales","context_page_description":"Nowra adalah sebuah bandar di wilayah South Coast di New South Wales, Australia. Ia terletak 160 kilometer selatan-barat daya ibu negeri Sydney Dengan kembarnya- bandar Bomaderry, pada bulan Jun 2018, Nowra mempunyai anggaran penduduk 37,420. Ia juga merupakan kerusi dan pusat komersial Bandar Shoalhaven. Secara geologi, bandar ini terletak di bahagian selatan lembangan Sydney.\\nKawasan di sekitar Nowra adalah komuniti petani, yang mengekalkan industri tenusu yang maju dan sejumlah hutan Negara, tetapi juga semakin menjadi kawasan persaraan dan masa lapang untuk Canberra dan Sydney. Stesen udara tentera laut HMAS Albatross terletak kira-kira 10 kilometer barat daya Nowra. Nama Nowra, yang awalnya ditulis oleh orang Eropah sebagai 'nou-woo-ro', adalah kata orang asli untuk ayam bela hitam."},{"page_url":"https://es.wikipedia.org/wiki/Gfi_Inform%C3%A1tica_M%C3%A9xico","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/GfiLogo.png","page_title":"Gfi Informática México","context_page_description":"GFI México es una compañía subsidiaria de la multinacional francesa GFI Informatique, especializada en consultoría, outsourcing e integración de sistemas de tecnologías de la información. Se especializa en el desarrollo de plataformas de integración, desarrollo de software y servicios para la automatización de procesos productivos, utilizando tecnologías como big data, inteligencia artificial, data science y data analytics.\\nLa subsidiaria opera en el mercado mexicano desde 2017, cuando el Grupo GFI global adquirió la empresa de origen español Gesfor. Actualmente cuenta con un equipo que supera los 750 empleados y obtuvo ingresos por 25 millones de euros en 2019. A nivel global, el Grupo Gfi tiene un equipo de más de 27.000 empleados y está presente en 26 países, alcanzando un volumen de negocio de 2,3 mil millones de euros en 2019."},{"page_url":"https://fr.wikipedia.org/wiki/8e_r%C3%A9giment_de_hussards","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Insigne_du_8e_R%C3%A9giment_de_Hussards..jpg","page_title":"8e régiment de hussards","context_page_description":"Le 8ᵉ régiment de hussards est une unité de cavalerie légère de l’armée française, créé sous la Révolution française. Il se distingua notamment lors des guerres de la Révolution et de l’Empire, puis à la Première Guerre mondiale."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AD%D1%80%D1%81%D1%82%D1%84%D0%B5%D0%BB%D1%8C%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Karte_Gemeinde_Erstfeld_2007.png","page_title":"Эрстфельд","context_page_description":"Эрстфельд — Швейцарияның Ури кантонында орналасқан коммуна.\\n2006 жылғы мәліметтер бойынша тұрғындарының саны 3733 адамды құрайды. Алып жатқан жер аумағы 59.20 км² шамасында. Ресми идентификациялық коды — 1206, пошта индексі — 6472."},{"page_url":"https://sh.wikipedia.org/wiki/Tower_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Tower_bridge_works_1892.jpg","page_title":"Tower Bridge","context_page_description":"Tower Bridge je pokretni most preko reke Temze u Londonu. Ime je dobio po obližnjem Zamku Tower. Izgradnja je počela 1886. godine a most je otvoren 1894."},{"page_url":"https://id.wikipedia.org/wiki/Lokomotif","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Dampfspeicherlok_DLM_002-2.jpg","page_title":"Lokomotif","context_page_description":"Lokomotif adalah bagian dari rangkaian kereta api di mana terdapat mesin untuk menggerakkan kereta api. Biasanya lokomotif terletak paling depan dari rangkaian kereta api. Operator dari lokomotif disebut Masinis. Masinis menjalankan kereta api berdasarkan perintah dari pusat pengendali perjalanan kereta api melalui sinyal yang terletak di pinggir jalur rel."},{"page_url":"https://pl.wikipedia.org/wiki/Zilje","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Hi%C5%A1a_v_Gornjih_Ziljah.jpg","page_title":"Zilje","context_page_description":"Zilje – wieś w Słowenii, w gminie Črnomelj. W 2018 roku liczyła 127 mieszkańców."},{"page_url":"https://nl.wikipedia.org/wiki/Sokollu_Pasamoskee","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Sokollu_Mehmet_Pasha_Camii_exterior.jpg","page_title":"Sokollu Pasamoskee","context_page_description":"De Sokollu Pasamoskee is een moskee-complex in de Europese wijk Kadirga in het district Eminönü in Istanboel, Turkije.\\nDe moskee werd gebouwd in 1571-1572 door de beroemde Ottomaanse architect Mimar Sinan voor grootvizier Sokollu Mehmet Paşa, de man van een van de kleindochters van Sultan Süleyman I, Princess Esmahan. De moskee was oorspronkelijk vernoemd naar haar, maar is tegenwoordig beter bekend onder de naam van haar meer beroemde man. De moskee staat bekend om zijn met blauwe tegels ingelegde interieur en om het feit dat hij gebouwd is op een steile helling. De voornaamste bouwmaterialen die voor de moskee zijn gebruikt zijn graniet en marmer."},{"page_url":"https://en.wikipedia.org/wiki/Vietnamese_passport","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Vietnamese_official_passport_%28invalidated%29.jpg","page_title":"Vietnamese passport","context_page_description":"Vietnamese passports are issued to citizens of Vietnam to facilitate international travel."},{"page_url":"https://vi.wikipedia.org/wiki/Prebberede","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Prebberede_palace.jpg","page_title":"Prebberede","context_page_description":"Prebberede là một đô thị thuộc huyện Rostock, bang Mecklenburg-Vorpommern, Đức. Đô thị này có diện tích 42,84 km², dân số thời điểm ngày 31 tháng 12 năm 2006 là 815 người."},{"page_url":"https://fr.wikipedia.org/wiki/La_Tremblade","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Female_Pandion.jpg","page_title":"La Tremblade","context_page_description":"La Tremblade est une commune du Sud-Ouest de la France, située dans le département de la Charente-Maritime en région Nouvelle-Aquitaine. Ses habitants sont appelés les Trembladais et les Trembladaises.\\nOccupant l'extrémité occidentale de la presqu'île d'Arvert, cette petite cité commerçante qui s'approche des 5 000 habitants est établie sur la rive gauche de l'estuaire de la Seudre, face à la ville de Marennes à laquelle elle est reliée par un pont, le viaduc de la Seudre, depuis 1972. Appartenant à la « grande banlieue » de Royan, La Tremblade est un des principaux centres ostréicoles du bassin de Marennes-Oléron, en même temps qu'une station balnéaire et un spot de surf réputé, bénéficiant d'une large façade maritime sur l'océan Atlantique. La partie septentrionale de son territoire peut être divisée en trois pôles aux activités distinctes : le port ostréicole de La Grève, le quartier balnéaire de Ronce-les-Bains et le centre-ville qui fait la jonction entre ces deux entités."},{"page_url":"https://en.wikipedia.org/wiki/Annaba_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/DZ-23_%282019%29.svg","page_title":"Annaba Province","context_page_description":"Annaba is a province in the north-eastern corner of Algeria. Its capital, Annaba, is Algeria's main port for mineral exports."},{"page_url":"https://en.wikipedia.org/wiki/U.S._Route_84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Avenue_Q_in_Lubbock%2C_TX_IMG_0195.JPG","page_title":"U.S. Route 84","context_page_description":"U.S. Route 84 is an east–west U.S. Highway that started as a short Georgia–Alabama route in the original 1926 scheme. Later, in 1941, it had been extended all the way to Colorado. The highway's eastern terminus is a short distance east of Midway, Georgia, at an interchange with Interstate 95. The road continues toward the nearby Atlantic Ocean as a county road. Its western terminus is in Pagosa Springs, Colorado, at an intersection with U.S. 160.\\nThe section from Brunswick, Georgia to Roscoe, Texas has been designated by five state legislatures as part of the El Camino East/West Corridor. The designation was in recognition of its history as a migration route from the Atlantic coast to the present Mexico–United States border, one of the routes that Spanish settlers called El Camino Real. The designation is intended to promote the route for both tourism and NAFTA-facilitated trade with Mexico. States are asking for federal funds to widen the US 84 El Camino East/West Corridor."},{"page_url":"https://la.wikipedia.org/wiki/Titamanninga","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Burg_Tittmoning.jpg","page_title":"Titamanninga","context_page_description":"Titamanninga est Germaniae accurate Bavariae urbs. Ibi ab anno 1929 usque ad annum 1932 puer Iosephus Ratzinger, papa Benedictus XVI, cum familia sua vixit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B0%D0%BB%D0%B5%D0%BD_(%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/RehaSchmannewitz.jpg","page_title":"Дален (Саксонія)","context_page_description":"Дален — місто в Німеччині, розташоване в землі Саксонія. Входить до складу району Північна Саксонія.\\nПлоща — 71,68 км². Населення становить 4270 ос."},{"page_url":"https://uz.wikipedia.org/wiki/Saint-Maurice-en-Cotentin","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Map_commune_FR_insee_code_50522.png","page_title":"Saint-Maurice-en-Cotentin","context_page_description":"Saint-Maurice-en-Cotentin Fransiyaning Quyi Normandiya mintaqasida joylashgan kommunadir. Manche departamenti Cherbourg-Octeville tumani tarkibiga kiradi."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E4%B8%AD%E6%A9%AB%E5%85%AC%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Hairpin_Bend_on_the_Alishan_Highway.jpg","page_title":"新中橫公路","context_page_description":"新中橫公路，又稱新中部橫貫公路，為連接台灣東部與西部的一條橫貫公路，位於台灣島中央地帶，介於中橫公路和南橫公路之間，以玉山為中心，分出：嘉義—玉山、水里—玉山、玉里—玉山，由此三線構成丫字狀路網。雖然是以玉山為中心，實際的交會點卻是於沙里溪頭，歷經數次變更，最後將交會點設於東埔山埡口，如今則被稱塔塔加為新中橫公路最高點，海拔2610公尺。\\n1970年代，正值十大建設的實行之際，中華民國政府計畫新闢三條橫貫公路，並列為十二項建設計畫之一。1980年代，已經開工的新中橫公路，因生態保育的意識逐漸抬頭，以及玉山國家公園劃設於新中橫公路通過之路線，形成公路開發與生態保育之間的轉捩點，政策有六年時間游移不定，一度允許榮工處繼續向西闢建至大分，最後在環境影響評估審查下，由行政院下達放棄興建之行政命令，全線於1991年1月1日通車，形成一條「沒有橫貫」的公路。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%87%D0%B5%D0%BB%D0%BB%D0%BE_%D0%93%D0%B0%D0%BD%D0%B4%D1%96%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/1993_Maserati_Shamal_coupe_%2821175976552%29.jpg","page_title":"Марчелло Гандіні","context_page_description":"Марчелло Гандіні — італійський автомобільний дизайнер."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%80%D1%8D%D0%B7%D1%96%D0%B4%D1%8D%D0%BD%D1%86%D0%BA%D1%96%D1%8F_%D0%B2%D1%8B%D0%B1%D0%B0%D1%80%D1%8B_%D0%B2%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%96%D0%BD%D0%B5_(2019)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/%D0%9B%D1%8F%D1%88%D0%BA%D0%BE%2C_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87_0076_%D0%A7%D1%83%D0%BF%D1%80%D0%B8%D0%BD%D0%B0_%D0%92%D0%B0%D0%B4%D0%B8%D0%BC_%D0%90_%28cropped%29.jpg","page_title":"Прэзідэнцкія выбары ва Украіне (2019)","context_page_description":"Выбары Прэзідэнта Украіны 2019 — чарговыя выбары Прэзідэнта Украіны, першы тур якіх адбыўся 31 сакавіка 2019, згодна з зацвярджаным каляндарным планам выбараў Цэнтральнай выбарчай камісіяй Украіны.\\nУ першым туры найбольшую колькасць галасоў атрымалі Уладзімір Зяленскі і дзеючы Прэзідэнт Пётр Парашэнка, якія выйшлі ў другі тур."},{"page_url":"https://ca.wikipedia.org/wiki/Patinatge_sobre_gel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Saguenay_500m.jpg","page_title":"Patinatge sobre gel","context_page_description":"El patinatge sobre gel consisteix a desplaçar-se sobre el gel mitjançant la utilització d'un patí sobre gel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D0%BA_%D0%BF%D0%BB%D0%B0%D0%BA%D1%83%D1%87%D0%BE%D1%97_%D1%84%D0%BE%D1%80%D0%BC%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/%D0%9F%D0%BB%D0%B0%D0%BA%D1%83%D1%87%D0%B8%D0%B9_%D0%B1%D1%83%D0%BA_%D1%83_%22%D0%91%D0%B5%D1%80%D1%96%D0%B7%D0%BA%D0%B8%22.jpg","page_title":"Бук плакучої форми","context_page_description":"Бук плаку́чої фо́рми — ботанічна пам'ятка природи місцевого значення в Україні. Розташована в межах міста Трускавця Львівської області, на бульварі Ю. Дрогобича.\\nПлоща 0,01 га. Статус надано 1984 року. Перебуває у віданні санаторію «Берізка».\\nСтатус надано з метою збереження рідкісного дерева — бука плакучої форми."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Christian_Dauphin","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Wallduern-Wallfahrtsbasilika-Orgel.jpg","page_title":"Johann Christian Dauphin","context_page_description":"Johann Christian Dauphin war ein deutscher Orgelbauer."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D1%88%D0%B0%D0%B2%D0%BB%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Salvia_holwayi_%28Scott_Zona%29_001.jpg","page_title":"Список видів роду шавлія","context_page_description":"Шавлі́я — рід багаторічних трав'янистих рослин або півкущів родини губоцвітих, висотою 50-70 см. Рід містить від 700 до 1000 видів. Наразі немає узгодженої системи класифікації роду Шавлія."},{"page_url":"https://pl.wikipedia.org/wiki/XXIII_Puchar_Gordona_Bennetta_(balonowy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Medal_pamiatkowy_LOPP.jpg","page_title":"XXIII Puchar Gordona Bennetta (balonowy)","context_page_description":"XXIII Puchar Gordona Bennetta – zawody balonów wolnych o Puchar Gordona Bennetta, które rozpoczęły się 15 września w 1935 roku w Warszawie. Polska została po raz drugi organizatorem zawodów, dzięki zwycięstwu w 1934 roku załogi balonu Kościuszko. Zawody, w których uczestniczyło 13 balonów z 7 państw, poprzedził meeting lotniczy. Zwyciężył polski balon Polonia II pilotowany przez Zbigniewa Burzyńskiego. Dzięki temu zwycięstwu Aeroklub Rzeczypospolitej Polskiej otrzymał puchar na własność. Był to czwarty w historii zawodów puchar, którego fundatorem w 1933 roku została redakcja Chicago Daily News. Nagrody zostały ufundowane przez przedstawicieli władz oraz polskie firmy. Otrzymali je najlepsi zawodnicy, a konkurs na przewidywanie miejsca lądowania wygrał belgijski pilot Ernest Demuyter. Poczta Polska z okazji zawodów umożliwiła wysyłanie przesyłek pocztą balonową. Zostały one ostemplowane odpowiednimi stemplami, a po przewiezieniu balonem Legionowo wysłane z Sokołowa Podlaskiego."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%AD%E7%94%B2%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/%E8%B5%A4%E5%B1%B1%E9%BE%8D%E6%B9%96%E5%B7%96.jpg","page_title":"六甲區","context_page_description":"六甲区位于台湾台南市中央偏北部，北临柳营区、东山区，东邻楠西区，西临下营区，南接官田区、大内区。在位置上属于大新营生活圈范围。本区呈东西宽南北窄的长条形，东半部属阿里山山脉的一部分，地势较为崎岖，西半部则属嘉南平原，地势平坦，气候属热带季风气候。"},{"page_url":"https://pl.wikipedia.org/wiki/Muzeum_Memlinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Memling_Diptych_of_Maarten_Nieuwenhove.jpg","page_title":"Muzeum Memlinga","context_page_description":"Muzeum Memlinga – muzeum ulokowane w średniowiecznym budynku byłego Szpitala św. Jana w Brugii, jednym z najstarszych zachowanych budynków szpitalnych w Europie.\\nZgromadzone eksponaty muzealne dają pogląd na działalność średniowiecznego szpitala. W jego kaplicy eksponowanych jest sześć arcydzieł Hansa Memlinga, w tym relikwiarz św. Urszuli. Cennym zabytkiem jest też zachowana stara apteka oraz ogród zielny."},{"page_url":"https://it.wikipedia.org/wiki/Architetture_religiose_dell%27Abruzzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Interno_chiesa_Madonna_di_Loreto_Torino_di_Sangro.JPG","page_title":"Architetture religiose dell'Abruzzo","context_page_description":"Questa lista di architetture religiose dell'Abruzzo elenca chiese e monasteri dell'Abruzzo.\\nMappa di tutte le coordinate: OpenStreetMap · Bing - Esporta: KML · GeoRSS · microformat · RDF"},{"page_url":"https://pl.wikipedia.org/wiki/Bazylika_kolegiacka_%C5%9Bw._Jerzego_w_K%C4%99trzynie","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Jerzego_w_K%C4%99trzynie_001.jpg","page_title":"Bazylika kolegiacka św. Jerzego w Kętrzynie","context_page_description":"Bazylika kolegiacka św. Jerzego w Kętrzynie – kościół św. Jerzego budowany na miejscu dawnej strażnicy od 1359, rozbudowywany do pierwszych lat XVI wieku.\\nNajlepiej zachowany kościół obronny na Mazurach. Początkowo był to obiekt halowy, jednonawowy, zlokalizowany w południowo-zachodnim narożu miasta. W koronie murów wybudowano ganki obronne i wieżę zwieńczoną blankowaniem. Na początku XV wieku wzniesiono drugą wieżę, a pod koniec stulecia obiekt przebudowano na trójnawową pseudobazylikę. Po pożarze w 1500 r. podczas odbudowy powstało istniejące i charakterystyczne odchylenie osi kościoła. W kościele zasługują na uwagę: sklepienia kryształowe z 1515 r., XVI-wieczna ambona, organy z 1721 r. były przebudowywane – obecne z 1975 r. mają 43 głosy, płyta nagrobna Krzysztofa Schenka von Tautenburg z 1597 r. oraz karcer znajdujący się pod wieżą wysoką.\\nDo II wojny światowej nazywany „kościołem niemieckim”. Po wysiedleniu Niemców w 1945 r. kościół był używany przez kętrzyńską parafię ewangelicką. Już rok później, w 1946, budynek został zarekwirowany przez władze komunistyczne i natychmiast przekazany Kościołowi rzymskokatolickiemu.\\nJako świątynia rzymskokatolicka, kościół św."},{"page_url":"https://sk.wikipedia.org/wiki/Imrich_Z%C3%A1po%C4%BEsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ke%C5%BEmarsk%C3%BD_hrad.jpg","page_title":"Imrich Zápoľský","context_page_description":"Imrich Zápoľský bol uhorský krajinský hodnostár, magnát, vojvodca, dedičný spišský župan, šarišský a oravský župan, hlavný kapitán Horného Uhorska, bán Dalmácie a Chorvátska, vládca Bosny a bán Slavónie."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B8%EC%B2%B4_%EA%B3%A8%EA%B2%A9%EA%B7%BC_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/LowerLimbMuscleinnervationCorrected.gif","page_title":"인체 골격근 목록","context_page_description":"일반적인 인간에게는 대략 640개의 골격근이 있고, 대부분의 근육이 좌우대칭의 양측성 근육이므로 대략 320쌍의 근육을 이 문서에서 보여주고 있다. 그럼에도 불구하고, 정확한 숫자를 정하는 건 어려운데 왜냐하면 특정 근육을 단일 근육의 다른 부분으로 정의할지, 각각의 근육으로 정의할지 등의 문제가 있기 때문이다. 그래서 640개에서 850개로 근육의 숫자를 다르게 셀 수 있다.\\n인체의 근육들은 머리와 목의 근육, 몸통의 근육, 팔의 근육과 다리의 근육을 포함한 많은 분류로 나뉠 수 있다.\\n표의 \\"동작\\"은 해부학적 위치의 각각의 근육의 동작을 의미한다.\\n이 근육들은 해부학 용어를 사용하여 설명된다. 한국어, 한자어, 영어 용어가 섞여서 쓰이는 대한민국 의학계의 현실을 감안하여 한국어, 한자어, 영어 명칭을 모두 표기하였다. 여기에 사용된 한국어 명칭들은 대한해부학회 사이트에서 배포하는 용어집을 따랐다. 또한 아직도 임상의학 의사들이 많이 쓰는 한자어로 된 명칭은 KMLE 의학 검색 엔진과 다국어 위키백과 등을 참고하였다.\\n인체 해부학에서의 골격근의 목록은 아래 표와 같다. 아래 표를 보기 전에 인체 뼈 목록, 위치에 대한 해부학 용어, 운동에 대한 해부학 용어, 근육에 대한 해부학 용어 문서를 읽으면 이해가 좀 더 쉬울 것이다."},{"page_url":"https://et.wikipedia.org/wiki/Tutanhamoni_surimask","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/TUT-Ausstellung_FFM_2012_47_%287117819557%29.jpg","page_title":"Tutanhamoni surimask","context_page_description":"Tutanhamoni surimask on Vana-Egiptuse 18. dünastia vaarao Tutanhamoni surimask. Surimaski avastas Howard Carter aastal 1925 hauast KV62 ja seda hoitakse Kairos asuvas Egiptuse Muuseumis. Mask on üks maailma tuntumaid kunstiteoseid.\\nEgüptoloog Nicholas Reevesi järgi ei ole mask mitte üksnes Tutanhamoni hauakambri kvintessents, vaid \\"ehk tuntuim ese kogu muistsest Egiptusest\\". Aastast 2001 on uurimused vihjanud võimalusele, et algselt võis surimask olla mõeldud kuninganna Neferneferuatenile: kuninganna kuninglik nimi Ankhkheperure leiti surimaski siseküljel olevast osaliselt kustutatud kartušist."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%AC%D5%A1%D6%80%D5%A1_%D4%B7%D5%AC%D5%BD%D5%A5%D5%B6_%D5%8A%D5%A5%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/CEPSig.jpg","page_title":"Կլարա Էլսեն Պեկ","context_page_description":"Կլարա Էլսեն Պեկ, ամերիկացի նկարազարդող և նկարչուհի, որը հայտնի է դարձել 20-րդ դարում կանանց և երեխաներին նկարելու շնորհիվ: Արվեստի ոլորտում կրթությունը ստացել է Մինեապոլիսի արվեստի դպրոցում և 1906-1940 ընկած ժամանակահատվածում աշխատել է ամսագրում որպես նկարազարդող: Պեկի աշխատանքները գրավում են լայն հորիզոն՝ հանրաճանաչ կանացի ամսագրերից և մանկական գրքերից, մինչ առևտրական հաջողությունների համար գեղարվեստական ստեղծագործություններ այնպիսի ապրանքների վրա ինչպիսիք են՝ փղոսկրից պատրաստված օճառները, հետո նաև կոմիքսներ և ջրաներկով կատարած նկարներ՝ իր կարիերայի ավելի ուշ փուլում: Պեկն աշխատել է «Ամերիկյան նկարազարդման ոսկեդարում», այնպիսի հայտնի կին նկարազարդողների հետ ինչպիսիք են՝ Ջեսի Ուիլոք Սմիթը, Էլիզաբեթ Շիփեն Գրինը և Վիոլետ Օաքլին:"},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Coat_of_arms_of_Belorussian_SSR_%281927-1937%29.jpg","page_title":"Герб Беларусі","context_page_description":"Дзяржаўны герб Рэспублікі Беларусь — сімвал Рэспублікі Беларусь як суверэннай дзяржавы.\\nПаводле афіцыйнага апісання, уяўляе сабой размешчаны ў сярэбраным полi зялёны контур Дзяржаўнай гранiцы Рэспублiкi Беларусь, наложаны на залатыя промнi ўзыходзячага над зямным шарам сонца. Наверсе поля знаходзiцца пяцiканцовая чырвоная зорка. Герб абрамлены вянком з залатых каласоў, пераплеценых справа кветкамi канюшыны, злева — кветкамi лёну. Вянок тройчы перавiты з кожнага боку чырвона-зялёнай стужкай, у сярэдняй частцы якой у аснове герба ў два радкi напiсаны золатам словы «Рэспублiка Беларусь».\\nГерб быў уведзены ў 1995 годзе паводле вынікаў усеагульнага рэферэндуму 7 чэрвеня 1995. Ён замяніў герб «Пагоня», які выкарыстоўваўся з 19 верасня 1991 года.\\nЗа аснову новага Дзяржаўнага герба Беларусі быў прыняты Дзяржаўны герб Беларускай ССР.\\nУ 2012 годзе ў Дзяржаўны герб Рэспублікі Беларусь былі ўнесены шэраг змен."},{"page_url":"https://ja.wikipedia.org/wiki/STS-117","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/STS-117_patch_new.png","page_title":"STS-117","context_page_description":"STS-117は、国際宇宙ステーション組立てミッションのために、2007年6月に15日間に渡ってスペースシャトルアトランティスによって行われた有人宇宙飛行である。\\nミッション内容は、ISSのS3/S4トラスの取り付けおよび長期滞在クルーの交代であった。"},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%8A%D9%81_%D8%AA%D8%A7%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Taffe4_%288442841335%29.jpg","page_title":"چيف تاف","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچيف تاف لاعب هوكى الجليد من امريكا."},{"page_url":"https://pl.wikipedia.org/wiki/Fiat_Dino","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Fiat_Dino_BW_2016-07-17_13-19-59.jpg","page_title":"Fiat Dino","context_page_description":"Fiat Dino – samochód sportowy produkowany przez włoską firmę Fiat w latach 1966-1973. Przez cały okres produkcji powstało ok. 4200 sztuk."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D0%9C%D0%B0%D2%B3%D0%B0%D0%BB%D3%A3_%D0%BF%D1%80%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pratt_Regional_Airport_KS_2006_USGS.jpg","page_title":"Фурудгоҳи Маҳалӣ прот","context_page_description":"Фурудгоҳи Маҳалӣ прот — фурудгоҳи ҳамагона баҳра‌бурдори ҳавоӣ бо Коди ИОТОи PTT аст, ки як бонди фуруди бутун дорад, ва тӯли бонди он 1676 метр аст. Ин фурудгоҳ дар кишвари Иёлоти Муттаҳидаи Амрико қарор дорад, ва дар баландии 595 метр аз сатҳи баҳр воқеъ шудааст."},{"page_url":"https://vec.wikipedia.org/wiki/Ebreichsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/AUT_Ebreichsdorf_COA.jpg","page_title":"Ebreichsdorf","context_page_description":"Ebreichsdorf ƚa xé na çità del distreto de Baden che'l fa parte del stato de ƚa Basa Àustria en Austria"},{"page_url":"https://en.wikipedia.org/wiki/Tower_of_Hanoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/UniversumUNAM34.JPG","page_title":"Tower of Hanoi","context_page_description":"The Tower of Hanoi is a mathematical game or puzzle. It consists of three rods and a number of disks of different sizes, which can slide onto any rod. The puzzle starts with the disks in a neat stack in ascending order of size on one rod, the smallest at the top, thus making a conical shape.\\nThe objective of the puzzle is to move the entire stack to another rod, obeying the following simple rules:\\nOnly one disk can be moved at a time.\\nEach move consists of taking the upper disk from one of the stacks and placing it on top of another stack or on an empty rod.\\nNo larger disk may be placed on top of a smaller disk.\\nWith 3 disks, the puzzle can be solved in 7 moves. The minimal number of moves required to solve a Tower of Hanoi puzzle is 2ⁿ − 1, where n is the number of disks."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%85%D0%BB%D0%BE%D0%B2%D0%BA%D0%B0_(%D0%BC%D1%83%D0%B7%D0%B5%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/%D0%A5%D0%BE%D1%85%D0%BB%D0%BE%D0%B2%D0%BA%D0%B0_1985.jpg","page_title":"Хохловка (музей)","context_page_description":"Хо́хловка — архитектурно-этнографический музей в Пермском крае, основанный в 1969 году. Открыт для посетителей 17 сентября 1980 года. Музей расположен на живописном берегу реки Камы в 43 км от Перми, около села Хохловка. Это первый на Урале музей деревянного зодчества под открытым небом. В его составе 23 уникальных памятника конца XVII — первой половины XX в. На территории площадью 35 гектаров находятся различные деревянные здания и сооружения, привезённые сюда из различных мест Пермского края и представляющие собой лучшие образцы народной строительной и художественной культуры региона. Во многих памятниках размещены этнографические интерьеры и выставочные комплексы. АЭМ «Хохловка» является филиалом Пермского краеведческого музея.\\nМузей «Хохловка» является одним из крупнейших центров притяжения туристов в Пермском крае. За последние годы в музее проведено укрепление берегов залива и благоустройство набережной, установлены мачты освещения. Для гостей музея открыта чайная. В то же время, в музее не появляется новых памятников, а многие существующие объекты требуют серьёзной реставрации. Также недостаточно развита туристическая инфраструктура в зоне музея."},{"page_url":"https://cs.wikipedia.org/wiki/Zolt%C3%A1n_Gera","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/ZoltanGera.JPG","page_title":"Zoltán Gera","context_page_description":"Zoltán Gera je maďarský fotbalový záložník a reprezentant, hájící barvy klubu Ferencváros.\\nMimo Maďarsko působil na klubové úrovni v Anglii."},{"page_url":"https://de.wikipedia.org/wiki/Goranen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Krahina_e_Gor%C3%ABs_%28Gora_region%29.png","page_title":"Goranen","context_page_description":"Die Goranen sind Südslawen islamischen Glaubensbekenntnisses, die vornehmlich in der Gebirgsregion des südwestlichen Kosovo an der Grenze zu Nordmazedonien und Albanien beheimatet sind."},{"page_url":"https://eu.wikipedia.org/wiki/Evergreen_(Colorado)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Downtown_Evergreen%2C_Colorado.JPG","page_title":"Evergreen (Colorado)","context_page_description":"Evergreen Ameriketako Estatu Batuetako erroldak esleitutako leku bat da. Jefferson konderrian kokatuta dago, Colorado estatuan. 9.038 biztanle ditu, 30,056471 kilometro koadroko azaleran banatuta."},{"page_url":"https://en.wikipedia.org/wiki/Plaxton_Panorama","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/20190524-Matthews-191MN759_%28cropped%29.jpg","page_title":"Plaxton Panorama","context_page_description":"The Plaxton Panorama is a double decker coach bodywork, produced by Plaxton's Scarborough factory on the newly built Volvo B11RLE chassis.\\nThe Panorama was launched in 2018, and in standard configuration seats 87 with a toilet, or 91 without."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A7%D1%8D%D1%81%D0%BA%D0%B5-%D0%91%D1%83%D0%B4%D0%B7%D0%B5%D1%91%D0%B2%D1%96%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Budvar_UK.JPG","page_title":"Чэске-Будзеёвіцы","context_page_description":"Чэске-Будзеёвіцы — горад на поўдні Чэхіі, адміністрацыйны цэнтр Паўднёвачэшскага края чэшск.: Jihočeský kraj.\\nРазмешчаны ў зліцця рэк Влтава і Малшэ. Насельніцтва — 95245."},{"page_url":"https://cs.wikipedia.org/wiki/Tort","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/A_Treatise_on_the_Law_of_Torts.jpg","page_title":"Tort","context_page_description":"Tort je termín angloamerického práva, který lze přeložit jako spáchané bezpráví nebo křivda, podobně jako termín wrong. Obvykle se však používá v užším významu pro tzv. civilní křivdy, která nevyplývají z porušení smlouvy a nezahrnuje trestné činy.\\nToho, kdo má za čin odpovědnost, tedy škůdce neboli pachatele tortu, lze žalovat v civilním procesu.\\nTorty tvoří jedno ze základních odvětví angloamerického práva, law of torts, které se zabývá převážně nápravou, nahrazením škody způsobené torty.\\nHistoricky se toto odvětví v Anglii zformovalo okolo roku 1860, a to pro případy nepřímého zavinění a nedbalosti, kde chyběl zlý úmysl; dnes do něj patří i některé vymezené případy striktní právní odpovědnosti. V centru tedy stojí koncept zavinění – někdo má povinnost starat se v širokém smyslu slova a jejím porušením způsobí škodu. Soud obvykle rozhoduje na základě toho, co se dalo nebo nedalo rozumně předpokládat.\\nKromě způsobení škody z nedbalosti patří mezi torty i třeba pomluva nebo urážka na cti, rušení pořádku, ale i v záměrné činy jako je napadení, použití násilí a nezákonné uvěznění; důležitá je celá řada opatření na ochranu spotřebitele a zaměstnanců."},{"page_url":"https://pl.wikipedia.org/wiki/San_Borja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Aeropuerto_de_San_Borja_-_SRJ.jpg","page_title":"San Borja","context_page_description":"San Borja – miasto w Boliwii, położone w zachodniej części departamentu Beni."},{"page_url":"https://pl.wikipedia.org/wiki/W%C5%82adcy_Anglii","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Henry_V_of_England_-_Illustration_from_Cassell%27s_History_of_England_-_Century_Edition_-_published_circa_1902.jpg","page_title":"Władcy Anglii","context_page_description":"Od połowy V wieku Anglia zaczęła być podbijana przez plemiona anglosaskie, które z czasem stworzyły system państw, zwany heptarchią, na który składało się siedem głównych królestw:\\nWładcy Anglii Wschodniej\\nWładcy Essexu\\nWładcy Kentu\\nWładcy Mercji\\nWładcy Nortumbrii\\nWładcy Susseksu\\nWładcy Wesseksu\\nTe królestwa rywalizowały między sobą o hegemonię, a władca, któremu udało się uzyskać przewagę, nosił tytuł bretwalda.\\nW IX w. największe znaczenie uzyskał Wessex, a kolejni jego władcy powiększali swoje wpływy i umacniali pozycję wśród państw anglosaskich.\\nNie można jednoznacznie odpowiedzieć na pytanie kto był pierwszym królem Anglii, a w historiografii jako pierwsi najczęściej wymieniani są:\\nEgbert\\nAlfred Wielki\\nAthelstan"},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%98%E1%83%A1%E1%83%A0%E1%83%90%E1%83%94%E1%83%9A%E1%83%98%E1%83%A8_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%96%E1%83%98%E1%83%93%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/ChaimWeizmann1948.jpg","page_title":"ისრაელიშ პრეზიდენტი","context_page_description":"ისრაელიშ პრეზიდენტი — ისრაელიშ სახენწჷფოშ მადუდე, გჷშმეგორუ პარლამენტიშით 5 წანაშ ხანით. პოსტიქ მუშაღალირქ იჸუ ისრაელიშ სახენწჷფოშ გჷმოცხადაფაშენო."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Saint-Hippolyte_(Indre-et-Loire)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Map_commune_FR_insee_code_37221.png","page_title":"Saint-Hippolyte (Indre-et-Loire)","context_page_description":"Saint-Hippolyte sī ūi-tī Hoat-kok Centre-Val de Loire toā-khu Indre-et-Loire séng ê chi̍t ê commune."},{"page_url":"https://bar.wikipedia.org/wiki/Morbegno","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Morbegno%2C_Italy%2C_Church_Maria_Assunta%2C_Fresco%2C_2011.jpg","page_title":"Morbegno","context_page_description":"Morbegno is a Gemeinde vo da italienischn Provinz Sondrio in da Lombardei mid 12.319 Eihwohna. Se liegt im untan Veltlin auf ana Hech vo 262 m s.l.m."},{"page_url":"https://ceb.wikipedia.org/wiki/Corona_del_Mar_State_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Corona_del_Mar_State_Beach_Photo_D_Ramey_Logan.jpg","page_title":"Corona del Mar State Beach","context_page_description":"Parke ang Corona del Mar State Beach sa Tinipong Bansa. Ang Corona del Mar State Beach nahimutang sa kondado sa Orange County ug estado sa California, sa habagatan-kasadpang bahin sa nasod, 3,700 km sa kasadpan sa ulohang dakbayan Washington, D.C. 4 metros ibabaw sa dagat kahaboga ang nahimutangan sa Corona del Mar State Beach.\\nAng yuta palibot sa Corona del Mar State Beach kay patag sa amihang-kasadpan, apan sa sidlakan nga kini mao ang kabungtoran. Sa habagatang-kasadpan, dagat ang pinakaduol sa Corona del Mar State Beach. Kinahabogang dapit sa palibot ang Pelican Hill, 221 ka metros ni kahaboga ibabaw sa dagat, 3.3 km sa sidlakan sa Corona del Mar State Beach. Ang kinadul-ang mas dakong lungsod mao ang Santa Ana, 16.9 km sa amihanan sa Corona del Mar State Beach. Sa rehiyon palibot sa Corona del Mar State Beach, mga lapyahan, mga luuk, mga estretso, mga walog, ug mga kanal talagsaon komon.\\nAng klima uga. Ang kasarangang giiniton 19 °C. Ang kinainitan nga bulan Agosto, sa 24 °C, ug ang kinabugnawan Disyembre, sa 12 °C. Ang kasarangang pag-ulan 211 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 49 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 1 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B5%D1%8F_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%A0%D0%B5%D0%BA%D0%B0_%D0%97%D0%B5%D1%8F_%D0%B2_%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B2%D0%B5%D1%89%D0%B5%D0%BD%D1%81%D0%BA%D0%B5.JPG","page_title":"Зея (река)","context_page_description":"Зе́я — крупнейшая река бассейна Амура. По глубине, ширине и водостоку превосходит Амур в месте слияния рек, но исторически считается его левым притоком. Река целиком протекает по Амурской области России, захватывая 64 % её территории, и в районе Благовещенска впадает в Амур. На Зее расположены города Зея, Свободный и Благовещенск. В верхнем течении находится Зейский природный заповедник площадью более 830 км².\\nДо строительства Зейской ГЭС на реке во время летних паводков происходили катастрофические наводнения. На реке проектируется каскад Нижнезейских ГЭС."},{"page_url":"https://en.wikipedia.org/wiki/Cardiospermum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Starr_060810-8525_Cardiospermum_sp..jpg","page_title":"Cardiospermum","context_page_description":"Cardiospermum is a genus of approximately 14 species in the soapberry family, Sapindaceae, which are native to the American, Indian, and African tropics. The genus name is derived from the Greek words καρδία, meaning \\"heart,\\" and σπέρμα, meaning \\"seed.\\" Common names of the members of this genus include balloon vine, love in a puff, heartseed, and heartseed vine. These plants are classified as invasive species in parts of the Southern United States and South Africa."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%92%D7%93%D7%9C_%D7%A1%D7%A4%D7%90%D7%A1%D7%A7%D7%90%D7%99%D7%94_(%D7%A4%D7%A1%D7%98%D7%99%D7%91%D7%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Spasskaya_Bashnya_%28festival%29_2013_by_shakko_03.jpg","page_title":"מגדל ספאסקאיה (פסטיבל)","context_page_description":"פסטיבל המוזיקה הצבאית הבינלאומי מגדל ספסקאיה הוא אירוע מוזיקה צבאי שנתי שנערך במוסקבה בכיכר האדומה מדי חודש ספטמבר. בפסטיבל משתתפות להקות צבאיות רוסיות וזרות, תזמורות צבאיות עממיות ויחידות משמר כבוד של מדינות זרות. יותר מארבעים מדינות לקחו חלק בפסטיבל מאז 2006. הוא נקרא על שם מגדל ספסקאיה המפורסם שבקרמלין המוסקבאי.\\nהפסטיבל משודר ומופק על ידי ערוץ TV סנטר."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Grazer_Aussichtswarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rudolfswarte_Graz.jpg","page_title":"Liste der Grazer Aussichtswarten","context_page_description":"Die Liste der Grazer Aussichtswarten umfasst sämtliche bestehende und ehemalige Aussichtswarten auf gegenwärtigem Grazer Stadtgebiet."},{"page_url":"https://nl.wikipedia.org/wiki/St._Giles_on_the_Heath","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/St_Giles_on_the_Heath%2C_The_Pint_and_Post_-_geograph.org.uk_-_448027.jpg","page_title":"St. Giles on the Heath","context_page_description":"St. Giles on the Heath is een civil parish in het bestuurlijke gebied Torridge, in het Engelse graafschap Devon. In 2001 telde het dorp 617 inwoners."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%88%8A%E9%95%B7%E5%9E%8B%E5%A4%A7%E5%BB%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/WCH_Estate_BLK05_and_06.jpg","page_title":"舊長型大廈","context_page_description":"旧长型大厦，又称长型大厦，是香港公共屋邨大厦的一种。实际上并不是指单一种类的大厦，而是香港房屋委员会用来泛指早期兴建的各类长形大厦，因此大厦设计、外貌、单位大小及布局均各有不同。"},{"page_url":"https://nl.wikipedia.org/wiki/Wakkerendijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Eemnes_Wakkerendijk_Tol_1.JPG","page_title":"Wakkerendijk","context_page_description":"De Wakkerendijk, vroeger Wackerswech, is een dijk aan de oostzijde van Eemnes in de provincie Utrecht. De 3,5 km lange weg loopt noord-zuid en begint bij de Zandheuvelweg bij Baarn. In het verlengde deel ten noorden van Eemnes loopt de dijk door onder de naam Meentweg richting Blaricum. Aan de oostelijke zijde staat rechts van het losliggende fietspad langs de lager liggende Eemnesserpolder een kilometerslange rij eiken."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A3%D5%A1%D5%BE%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Agave_sebastiana_1.jpg","page_title":"Ագավա","context_page_description":"Ագավա, տեսակը պատկանում է ծնեբեկազգիների ընտանիքին ։."},{"page_url":"https://en.wikipedia.org/wiki/Tasseled_scorpionfish","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tassled_scorpionfish_at_Nusa_Kode.JPG","page_title":"Tasseled scorpionfish","context_page_description":"The tasseled scorpionfish, or small-scaled scorpionfish, Scorpaenopsis oxycephala, is a carnivorous ray-finned fish with venomous spines that lives in the Indian and Pacific Oceans. It can reach a maximum length of 36 cm and can vary considerably in color. Adults are bearded with a number of tassels below the jaw.\\nThey inhabit reef slopes from only 1 to 35 meters. When in shallow waters, swimmers may accidentally tread on them which may cause painful injury from the venomous spines. The Tassled scorpionfish has unique vibrant orange colors and markings that allow it to camouflage itself well in between the rocky reefs. Its well-camouflaged skin enables it to hide and wait for prey to pass by to strick it."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B1%D9%8A%D8%A7%D8%B6%D8%A9_%D9%81%D9%8A_%D8%A7%D9%84%D9%88%D9%84%D8%A7%D9%8A%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D8%AA%D8%AD%D8%AF%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/USA_vs_England_-_Rugby_WC_2007.jpg","page_title":"الرياضة في الولايات المتحدة","context_page_description":"تشكل الرياضة في الولايات المتحدة جزءا مهما من ثقافة الولايات المتحدة. الرياضات الأربعة الأكثر شعبية هي تلك التي تكونت وتطورت في أمريكا الشمالية: مثل كرة القدم الأمريكية والبيسبول وكرة السلة وهوكي الجليد. بطولات الدوريات الكبرى لكل من هذه الرياضات هي دوري كرة القدم الوطنية ودوري البيسبول الأمريكي، والرابطة الوطنية لكرة السلة، ودوري الهوكي الوطني وتتمتع وسائل الاعلام الضخمة بحقوق البث لهذه الدوريات.\\nثلاثة من هذه البطولات فيها مشاركت فريق أو فريقين كنديين لتمثيل المدن الكندية، والأربعة هم من بين الاتحادات الرياضية الأكثر ربحاً في العالم. كرة القدم هي أقل شعبية كرياضة من حيث المتابعة في الولايات المتحدة مما هي عليه في العديد من البلدان الأخرى ولكن شعبية كرة القدم بازدياد ملحوظ بسبب تطور وتفوق الفرق الأمريكية على الصعيد العالمي ويذكر أن منتخبي الولايات المتحدة للسيدات هو بالترتيب الأول في العالم وفريق الرجال الذي يصنف من أول 20 فريق قالمي في الفيفا أيظاً تسجل مشاركة واسعة في مستويات الهواة وشبه المحترفين، لا سيما بين الشباب والمنحدرين من أصل أمريكا اللاتينية، حيث أن الدوري الأمريكي لكرة القدم يجذب شعبية متزايدة ومن أسباب هذا هو جلب نجوم عالميين مثل ديفيد بيكهام الذي وقع مع فريق لوس أنجلوس جلاكسي وتييري هنري الذي إنظم إلى فريق نيويورك ريد بولز وغيرهما الكثير."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%82%BC%E3%83%B3%E3%83%84%E3%82%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Old_town_view.jpg","page_title":"コゼンツァ","context_page_description":"コゼンツァは、イタリア共和国カラブリア州にある都市で、その周辺地域を含む人口約6万7000人の基礎自治体。コゼンツァ県の県都である。\\n古代からの歴史を有する都市で、西ゴート族の王アラリック1世は当地で没した。ナポリ王国のもとで1511年に設立されたアカデミア・コゼンティーナ は、哲学と文学の研究で知られた、ヨーロッパ最古級の大学のひとつであった。現代においても、複数の博物館・美術館、劇場、図書館、カラブリア大学 を擁する文化の中心地である。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%A0%D7%95%D7%A4%D7%98%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Full_Opera_by_night.jpg","page_title":"סנופטה","context_page_description":"סנופטה היא חברת אדריכלות נורווגית העוסקת באדריכלות נוף, אדריכלות פנים ואדריכלות בניין. החברה מעסיקה כ-150 עובדים והיא בעלת סניפים באוסלו, בניו יורק, בסן פרנסיסקו, בסטוקהולם ובאינסברוק. סנופטה נוסדה על ידי האדריכלים הנורווגים אדווארד קריג וקיטיל טרדאל. המשרד הוקם בשנת 1989.\\nבשנת 1989 הם ניגשו לתחרות אדריכלות עבור בניית ביבליותיקה אלכסנדרינה, שנעשתה בשיתוף פעולה עם האדריכל האוסטרי כריסטופר קפלר.\\nמבניהם המפורסמים הם בית האופרה באוסלו, עליו קיבלו פרס אדריכלות עולמי, וביבליותיקה אלכסנדרינה, אשר קיבל בנוסף גם פרס פריצקר לאדריכלות ופרס מיס ון דה רוהה לאדריכלות בשנת 2010.\\nמבנה האופרה באוסלו שאוב מהטבע הנורווגי, ובעל דמיון לקרחון מחליק. גם לביבליותיקה אלכסנדרינה עקרונות השאובים מעולם הטבע. בנוסף, הם ערכו את השיפוץ החדש לכיכר טיימס בניו יורק אשר חסמה מעבר כלי רכב בחלקה, וכן את מוזיאון 11 בספטמבר בניו יורק."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%BE%D9%84%D8%A7%D9%88%DB%8C%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Reykjanesbaer_map.png","page_title":"کپلاویک","context_page_description":"کپلاویک یک شهر در ایسلند است که در South Constituency واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Autostrada_A1_(Italien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/A1_motorway_-_Florence.jpg","page_title":"Autostrada A1 (Italien)","context_page_description":"Die Autostrada A1 ist eine Autobahn in Nord- und Mittelitalien, die von Mailand über Rom nach Neapel führt. Sie ist zwischen Mailand und Rom Bestandteil der Europastraße 35 und zwischen Modena und Bologna sowie Orte und Neapel der Europastraße 45.\\nDie A1 ist mit einer Länge von 754 Kilometern die längste Autobahn Italiens und vollständig mautpflichtig."},{"page_url":"https://uk.wikipedia.org/wiki/Rhinolophus_trifoliatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Rhinolophus_trifoliatus.jpg","page_title":"Rhinolophus trifoliatus","context_page_description":"Rhinolophus trifoliatus — вид рукокрилих родини Підковикові."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%88%E0%B8%99_%E0%B9%81%E0%B8%84%E0%B8%A1%E0%B9%80%E0%B8%9B%E0%B8%B5%E0%B8%A2%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Jane_Campion_Cannes_2014_2.jpg","page_title":"เจน แคมเปียน","context_page_description":"เอลิซาเบธ เจน แคมเปียน หรือที่รู้จักกันในชื่อ เจน แคมเปียน เป็นนักเขียนบท ผู้อำนวยการสร้าง และผู้กำกับภาพยนตร์ชาวนิวซีแลนด์ แคมเปียนผู้กำกับหญิงคนที่ 2 ในจำนวน 5 คนที่เคยได้รับการเสนอชื่อเข้าชิงรางวัลออสการ์ สาขาผู้กำกับยอดเยี่ยม และเป็นผู้สร้างภาพยนตร์หญิงคนแรกในประวัติศาสตร์ที่ได้รับรางวัล Palme d'Or จากการกำกับภาพยนตร์ The Piano ซึ่งเธอก็ได้รับรางวัลออสการ์ สาขาบทภาพยนตร์ยอดเยี่ยม อีกด้วย"},{"page_url":"https://la.wikipedia.org/wiki/Corren%C3%A7on-en-Vercors","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Corren%C3%A7on.JPG","page_title":"Corrençon-en-Vercors","context_page_description":"Corrençon-en-Vercors est commune Francicum 358 incolarum praefecturae Isarae in regione orientali Rhodano et Alpibus."},{"page_url":"https://sl.wikipedia.org/wiki/Loratadin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Loratadine_-_3d%2C_portrait_orientation.png","page_title":"Loratadin","context_page_description":"Loratadin je zaviralec histaminskega receptorja H₁ druge generacije s šibkim antiholinergičnim učinkom, ki se uporablja za zdravljenje alergij. Glede na kemijsko zgradbo je soroden tricikličnim antidepresivom, vsebuje pa tudi strukturne elemente, sorodne atipičnemu antipsihotiku kvetiapinu.\\nNa tržišču je poleg originatorskega zdravila Claritine tudi več generičnih zdravil.\\nV Sloveniji je na tržišču na primer pod imeni Claritine, Claritine S, Flonidan, Rinolan ..."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kiinan_maakunnallisista_moottoriteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/S15-CN_%28AH%29_no_name.png","page_title":"Luettelo Kiinan maakunnallisista moottoriteistä","context_page_description":"Tämä luettelo kertoo Kiinan maakunnallisista moottoriteistä."},{"page_url":"https://pl.wikipedia.org/wiki/B%C5%82otnia_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Bolotnia%2C_Peremyshliany_Raion_%2803%29.jpg","page_title":"Błotnia (Ukraina)","context_page_description":"Błotnia – wieś na Ukrainie w rejonie przemyślańskim należącym do obwodu lwowskiego."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Williams_(pioneer)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Fort_Detroit_1763.png","page_title":"Thomas Williams (pioneer)","context_page_description":"Thomas Williams, originally from Albany, New York, settled in Detroit, Michigan in 1765. He married Cecile Chapeau from a prominent French-Canadian family that had settled in Michigan in 1710. Williams was a merchant, landowner, and was active in civic and political affairs. Goods were transported to Detroit from Albany via canoe, which could take a number of months for a round-trip. He petitioned for equitable opportunities to engage in trade at Fort Niagara and Detroit. In his role as justice of the peace, he was charged to uphold the law and punish those who were deemed to have broken the law. As notary, he executed legal documents for the settlement. He was also town crier and took the 1782 census. He married Cecile Campeau from a prominent family of French heritage who had come to Michigan about 1710. Cecile's brother, Joseph, was the state's first millionaire. Their son, John R. Williams, was the first mayor of Detroit."},{"page_url":"https://it.wikipedia.org/wiki/Gornau","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Kirche_Gornau.JPG","page_title":"Gornau","context_page_description":"Gornau/Erzgeb. è un comune di 3.970 abitanti della Sassonia, in Germania.\\nAppartiene al circondario dei Monti Metalliferi ed è parte della comunità amministrativa di Zschopau."},{"page_url":"https://it.wikipedia.org/wiki/Sursum_corda_(Elgar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Worcester_Cathedral_Nave%2C_Worcestershire%2C_UK_-_Diliff.jpg","page_title":"Sursum corda (Elgar)","context_page_description":"Sursum corda, Op. 11 è un'opera musicale del compositore inglese Edward Elgar per archi, ottoni, timpani e organo, composta nel 1894."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E5%85%8B%C2%B7%E6%9D%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/10.000_moving_cities.jpg","page_title":"马克·李","context_page_description":"馬克・李、中譯為馬克・李、瑞士新媒體藝術家。他的作品採用不同的媒體，包括視頻，置身其境式的虛擬現實、網絡、無線技術、表演、大型城市藝術裝置和互動展覽。"},{"page_url":"https://tr.wikipedia.org/wiki/Andriy_Blizni%C3%A7enko","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Andrii_Bliznichenko.jpg","page_title":"Andriy Blizniçenko","context_page_description":"Andriy Blizniçenko, Sheriff Tiraspol takımında orta saha pozisyonunda görev yapan Ukraynalı futbolcudur.\\nKarabükspor 1. Lig'e düştükten sonra sadece bir maçta forma giydikten sonra serbest kaldı ve Ocak 2019 için Sheriff Tiraspol ile anlaştı."},{"page_url":"https://sv.wikipedia.org/wiki/CSS_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/USS_Merrimack%3Bh58880.jpg","page_title":"CSS Virginia","context_page_description":"CSS Virginia var det första ångdrivna pansarklädda krigsfartyget i Konfederationens flotta och byggdes under det första året av det amerikanska inbördeskriget. Hon var konstruerad som ett kasemattfartyg på skrovet av det bärgade sänkta fartyget USS Merrimack. Virginia var ett av fartygen som deltog i slaget vid Hampton Roads mot Unionsflottan. Striden är främst betydande inom marinhistorien som den första striden mellan bepansrade fartyg, då Virginia engagerades i en duell med Unionens USS Monitor."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_hydropl%C3%A1n%C5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Saro_Princess_G-ALUN_Farnborough_1953.jpg","page_title":"Seznam hydroplánů","context_page_description":"Toto je seznam hydroplánů. Hydroplán je letoun uzpůsobený k přistávání a startování na vodní hladině. Je-li opatřen plováky, jde o plovákový letoun, pokud je trup postaven jako člun, jde o létající člun. Plovákový letoun nebo létající člun může být navíc vybaven podvozkem, pak se jedná o obojživelný letoun. Seznam neobsahuje všechny vodní letouny, které byly vyrobeny, ale jen ty nejdůležitější nebo nejznámější.\\nLetouny v tomto seznamu jsou řazeny podle zemí a poté podle výrobce. Země jsou řazeny abecedně a jednotliví výrobci také."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8F%AD%E8%B6%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Statue_commemorating_Ban_Chao%2C_Kashgar.jpg","page_title":"班超","context_page_description":"班超，字仲升，右扶風平陵縣人，是東漢著名將領、外交家。是開拓和維持漢代與西域關係的重要人物。\\n班超出生在文仕家庭，他是史學家班彪之子、《漢書》的編撰者班固之弟，三人合稱「三班」，「三班」其中一班有時還不認為是指班超，而是被認為是指身為歷史學家的其妹班昭。但他的成名並不是因為文學成就：班超選擇投筆從戎，投身於為漢朝穩固邊疆的事業中，成為東漢名將。"},{"page_url":"https://pl.wikipedia.org/wiki/Sam_Querrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Sam_Querrey_US_Open_2012_%282%29.jpg","page_title":"Sam Querrey","context_page_description":"Sam Austin Querrey – amerykański tenisista, reprezentant w Pucharze Davisa, olimpijczyk z Pekinu.\\nW 2006 roku Querrey oficjalnie rozpoczął karierę tenisową, jednak już w październiku 2004 roku po raz pierwszy wystąpił w turnieju zawodowym, podczas turnieju rangi ITF Futures w amerykańskim Laguna Niguel. Pojedynek z Michaelem Yanim Querrey przegrał 6:7, 3:6.\\nPierwszy turniej rangi ATP Tour Querrey wygrał w marcu 2008 roku w Las Vegas, a ostatni w marcu 2017 roku w Acapulco. Łącznie Amerykanin triumfował w 10 turniejach kategorii ATP Tour z 19 rozegranych finałów. W 2009 roku Querrey został zwycięzcą cyklu US Open Series, wyprzedzając w klasyfikacji końcowej drugiego Andy’ego Murraya oraz trzeciego Juana Martína del Potro. Najwyżej w rankingu singlowym był na 11. miejscu w lutym 2018 roku.\\nW grze podwójnej Amerykanin wywalczył 5 deblowych tytułów, w tym mistrzostwo rozgrywek ATP Tour Masters 1000 w Rzymie z maja 2011 roku w parze z Johnem Isnerem. Ponadto Querrey przegrał 8 finałów gry podwójnej turniejów ATP Tour. W zestawieniu gry podwójnej Amerykanin najwyższą pozycję osiągnął w maju 2010 roku, nr 23."},{"page_url":"https://nl.wikipedia.org/wiki/De_Fontein_(Oudemirdum)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Interieur%2C_overzicht_naar_het_orgel_met_links_de_preekstoel_-_Oudemirdum_-_20371958_-_RCE.jpg","page_title":"De Fontein (Oudemirdum)","context_page_description":"De Fontein is een kerkgebouw in Oudemirdum in de Nederlandse provincie Friesland."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%B2%E0%AF%8D%E0%AE%86_%E0%AE%85%E0%AE%B2%E0%AF%8D-%E0%AE%AA%E0%AE%95%E0%AF%81%E0%AE%B1%E0%AF%88%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bahrain_Fort_March_2015.JPG","page_title":"கல்ஆ அல்-பகுறைன்","context_page_description":"கல்ஆ அல்-பகுறைன், அல்லது பகுறைன் கோட்டை மற்றும் முன்னதாகப் போர்த்துக்கல் கோட்டை என்றழைக்கப்படும் இத்தொல்லியல் இடம் அராபியத் தீபகற்பத்தில் பகுறைன் நாட்டில் அமைந்துள்ளது. 1954 ஆம் ஆண்டு முதல் இங்கு நடத்தப்பட்ட தொல்லியல் அகழ்வாய்வுகளில் 12 m உயரத்திற்குச் செயற்கையாக அமைக்கப்பட்ட மண்மேட்டில் பல தொல்பொருட்கள் கண்டெடுக்கப்பட்டன. இந்த மண்மேடு கி.மு. 2300 இலிருந்து 18 ஆம் நூற்றாண்டிலிருந்து பல்வேறு ஆட்சியாளர்களால் பல அடுக்குகளில் வலிதாக்கப்பட்டுள்ளது. காசைட்டுக்கள், போர்த்துக்கேயர் மற்றும் ஈரானியர்கள் இதில் பங்கெடுத்துள்ளனர். ஒரு காலத்தில் தில்முன் நாகரிகத்தின் தலைநகராகவும் இருந்துள்ளது. ஐக்கிய நாடுகள் கல்வி, அறிவியல், பண்பாட்டு நிறுவனம் இந்த இடத்தை 2005 இல் உலக மரபிடமாக அறிவித்துள்ளது."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%B8%D1%81%D0%B0%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Map_commune_FR_insee_code_34042.png","page_title":"Брисак","context_page_description":"Брисак је насеље и општина у јужној Француској у региону Лангдок-Русијон, у департману Еро која припада префектури Монпелије.\\nПо подацима из 2011. године у општини је живело 619 становника, а густина насељености је износила 14,03 становника/km². Општина се простире на површини од 44,13 km². Налази се на средњој надморској висини од 145 метара."},{"page_url":"https://ca.wikipedia.org/wiki/Daniel_Thomas_Egerton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Zacatecas1838Mayer.jpg","page_title":"Daniel Thomas Egerton","context_page_description":"Daniel Thomas Egerton va ser un paisatgista britànic i un dels membres originals de la Societat d'Artistes britànics, on va exhibir les seves obres durant els anys 1824 a 1829, i de 1838 a 1840.\\nVa passar la part final de la seva vida a Mèxic, i va publicar Egerton's Views in Mexico, una carpeta de litografies descrites en el subtítol com a \\"Sèrie de dotze plats colorits executats per si mateix dels seus dibuixos originals, acompanyats amb una curta descripció\\".\\nDesprés d'abandonar a la seva família a Anglaterra, Egerton va tornar a Mèxic el 1841 amb Alice Edwards, la filla adolescent d'un altre pintor britànic. El 1842, ell i la seva esposa embarassada van ser assassinats al poble de Tacubaya, on llogaven una casa. Egerton solia portar grans quantitats de diners i tots dos portaven joies; l'assassinat va ser atribuït a un robatori. La diplomàcia britànica va pressionar per solucionar el delicte i es va arrestar a tres lladres; dos d'ells van ser penjats i un va escapar de la presó. Hi ha hagut especulacions que Egerton estava involucrat en vendes fraudulentes a Texas, que tenia vincles amb ordres masònes o que un amant desconegut d'Alicia va estar darrere de l'assassinat."},{"page_url":"https://it.wikipedia.org/wiki/Grumman_F8F_Bearcat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/F8F-1_NASA.jpg","page_title":"Grumman F8F Bearcat","context_page_description":"Il Grumman F8F Bearcat era un monomotore da caccia imbarcato prodotto dall'azienda statunitense Grumman Aircraft Engineering Corporation a partire dal 1944, ma entrato in servizio troppo tardi per partecipare alle operazioni della seconda guerra mondiale.\\nDotato di un motore radiale Double Wasp da 2 100 CV, fu tra gli ultimi e più potenti aerei militari con motore a pistoni del mondo. Dal 1989 un esemplare modificato di F8F-2 detiene il record di velocità per aerei con motore alternativo, con 850,083 km/h."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Norfolk_County_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Lansing_Millis_Memorial.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Norfolk County (Massachusetts)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Norfolk County in Massachusetts führt alle Bauwerke, National Historic Landmarks und Historic Districts im Norfolk County auf, die in das National Register of Historic Places aufgenommen wurden.\\nAufgrund der Vielzahl der Einträge gibt es für die Stadtgebiete von Brookline, Milton und Quincy eigene Listen:\\nListe der Einträge im National Register of Historic Places in Brookline, 98 Einträge\\nListe der Einträge im National Register of Historic Places in Milton, 29 Einträge\\nListe der Einträge im National Register of Historic Places in Quincy, 109 Einträge"},{"page_url":"https://vi.wikipedia.org/wiki/Cyclura_rileyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Cyclura_rileyi_rileyi_Green_Cay_c_W_K_Hayes_2004.JPG","page_title":"Cyclura rileyi","context_page_description":"Cyclura rileyi là một loài thằn lằn trong họ Iguanidae. Loài này được Stejneger mô tả khoa học đầu tiên năm 1903."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0_%D0%92%D0%BE%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Sarah_Vaughan_-_William_P._Gottlieb_-_No._1.jpg","page_title":"Сара Воан","context_page_description":"Сара Во́ан, Воэн, транскрыпцыйнае чытаньне — [vɔːn], Воон — афраамэрыканская джазавая сьпявачка, адна з найбольш выбітных у XX ст. Прэмія «Грэмі» ў намінацыі «Найлепшая джазавая вакалістка»."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeinden_in_Guadeloupe","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Guadeloupe_Arrondissement_2018.png","page_title":"Liste der Gemeinden in Guadeloupe","context_page_description":"Das französische Überseedépartement Guadeloupe untergliedert sich in zwei Arrondissements mit 21 Kantonen und 32 Gemeinden.\\nSiehe auch: Liste der Kantone in Guadeloupe\\nDie nachfolgende Tabelle führt alle 32 derzeitigen Gemeinden des Départements Guadeloupe in alphabetischer Anordnung auf.\\nEhemalige Gemeinden, die am 22. Februar 2007 von Guadeloupe abgespaltet wurden und jeweils den Status einer überseeischen Gebietskörperschaft verliehen bekommen haben:"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%86%D9%8A%D9%86_(%D9%81%D9%8A%D8%B2%D9%8A%D8%A7%D8%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Resonance.PNG","page_title":"رنين (فيزياء)","context_page_description":"الرنين في الفيزياء ظاهرة من خلالها يميل النظام الفيزيائي إلى الاهتزاز بأقصى شدة، وذلك عند تعرض النظام لترددات معينة تسمّى ترددات الرنين. وعند تلك الترددات تحدث اهتزازات عالية الشدة حتى عند أقل قدر من قوى الدفع الترددية، حيث أن النظام الفيزيائي يقوم بتخزين طاقة الاهتزازات. وعندما يقل «امتصاص» الاهتزازات، فإن تردد الرنين يقترب من التردد الطبيعي للنظام، الذي هو تردد الاهتزازات الحرة فمثلا إذا ما وافق تردد ما تردد الجسم الطبيعي جعله يهتز بحالة رنين معه إذ ان سعة الاهتزاز ستكون أكبر ما يمكن لان التداخل الحاصل بين الموجات هو تداخل بناء بالكامل وهنا تكمن خطورة الرنين إذ تصل السعة إلى حد لا يمكن للجسم تحمله مما يؤدي إلى انهيار الجسم في الغالب كما يحدث في ظاهرة الكأس الزجاجي حيث تسلط على الزجاج موجة صوتية مساوية لتردده الطبيعي مما يؤدي إلى تكسر الكأس.\\nوتحدث ظاهرة الرنين لكافة أنواع الاهتزازات والموجات. وهناك رنين ميكانيكي ورنين صوتي شوكة رنانة ورنين عمود الهواء في آلة الناي أو الأرغول الموسيقية. أو رنين كهرومغناطيسي في دائرة رنين، وكذلك رنين للموجات الكمومية. ويمكن استخدام أنظمة الرنين لتوليد اهتزازات عند تردد محدد، أو التقاط ترددات محددة من وسط حزمة اهتزازات تضم العديد من الترددات.\\nوكان الرنين من اكتشاف جاليليو جاليلي أثناء أبحاثه عن الرقاص بدءا من 1602."},{"page_url":"https://nl.wikipedia.org/wiki/Schleinikon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Karte_Gemeinde_Schleinikon.png","page_title":"Schleinikon","context_page_description":"Schleinikon is een gemeente en plaats in het Zwitserse kanton Zürich, en maakt deel uit van het district Dielsdorf. Schleinikon telt 703 inwoners."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E9%9B%B7%E6%89%98%E5%88%A9%E4%BA%9A%E5%96%B7%E6%B3%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Palermo_piazza_pretoria.jpg","page_title":"普雷托利亚喷泉","context_page_description":"普雷托利亚喷泉于1554年由Francesco Camilliani创建于佛罗伦萨，在1581年移至巴勒莫的普雷托利亚广场。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B1%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Andriy_Shevchenko-ua2011.jpeg","page_title":"Сборная Украины по футболу","context_page_description":"Сборная Украины по футболу — национальная команда, представляющая Украину на международных соревнованиях по футболу. Управляющая организация — Украинская ассоциация футбола. Наивысшим достижением сборной является 1/4 финала на чемпионате мира 2006, к этому достижению её привёл украинский тренер Олег Блохин.\\nПо состоянию на 19 декабря 2019 года сборная в рейтинге ФИФА занимает 24 место, и 15-е среди европейских команд."},{"page_url":"https://es.wikipedia.org/wiki/Giorgio_Bianchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Bianchi-giorgio_1929.jpg","page_title":"Giorgio Bianchi","context_page_description":"Giorgio Bianchi fue un actor, director y guionista cinematográfico de nacionalidad italiana."},{"page_url":"https://fi.wikipedia.org/wiki/H%C3%A4meenlinnan_H%C3%A4rm%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Kaurialan_kentta.jpg","page_title":"Hämeenlinnan Härmä","context_page_description":"Hämeenlinnan Härmä on vuonna 1967 perustettu hämeenlinnalainen jalkapalloseura. Härmän lajivalikoimaan kuuluu jalkapallo ja salibandy. Jalkapallossa seuralla on joukkueet naisten Kakkosessa ja miesten Vitosessa. Junioritoiminnan pyörittämistä varten vuonna 2015 perustettiin Härmä jr. Sillä ei ole ollut toimintaa kauden 2019 jälkeen.\\nHämeenlinnan Härmän miesten edustusjoukkue oli pakotettu pelaajapulan vuoksi vetäytymään Kolmosesta kaudella 2018. Näin ollen Vitosessa pelaava joukkue jatkaa Härmän edustamista miesten osalta."},{"page_url":"https://ro.wikipedia.org/wiki/Vielitzsee_(comun%C4%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Vielitzsee_in_OPR.png","page_title":"Vielitzsee (comună)","context_page_description":"Vielitzsee este o comună din landul Brandenburg, Germania."},{"page_url":"https://no.wikipedia.org/wiki/Lee_Bo-ra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Team_Korea_Ladies%27_500m_Injury.jpg","page_title":"Lee Bo-ra","context_page_description":"Lee Bo-ra er en sørkoreansk skøyteløper som deltok i hurtigløp under Vinter-OL 2010 i Vancouver i Canada i øvelsen 1000 meter damer, der hun endte på 26.-plass.\\nLee har konkurrert internasjonalt siden 2002 og deltok i hurtigløp i Vinter-OL 2006 i Torino, Italia, og endte på 25.-plass på 500m og 34.-plass på 1000m."},{"page_url":"https://lb.wikipedia.org/wiki/The_Golden_Voyage_of_Sinbad","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Charles_Schneer_and_Caroline_Munro_1974.jpg","page_title":"The Golden Voyage of Sinbad","context_page_description":"The Golden Voyage of Sinbad ass en US-amerikanesch-brittesche Film vum Gordon Hessler aus dem Joer 1973."},{"page_url":"https://lt.wikipedia.org/wiki/Patrik_Ou%C5%99edn%C3%ADk","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Patrik_Ou%C5%99edn%C3%ADk.jpg","page_title":"Patrik Ouředník","context_page_description":"Patrikas Ouržednikas – čekų ir prancūzų rašytojas, daugiau nei dvidešimties knygų autorius, vertėjas.\\nPatrikas Ouržednikas į čekų kalbą išvertė Rablė, Žari, Keno, Beketo, Mišo, Simono ir Viano kūrybą. 2001 m. išleido romaną Europeana. Trumpa dvidešimto amžiaus istorija, išverstą į trisdešimt tris kalbas."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Monuments_of_National_Importance_in_Gujarat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Ancient_excavated_site_at_Kayavarohan.jpg","page_title":"List of Monuments of National Importance in Gujarat","context_page_description":"This is a list of Monuments of National Importance as officially recognized by and available through the website of the Archaeological Survey of India in the Indian state Gujarat. The monument identifier is a combination of the abbreviation of the subdivision of the list and the numbering as published on the website of the ASI. 203 Monuments of National Importance have been recognized by the ASI in Gujarat."},{"page_url":"https://pt.wikipedia.org/wiki/Chokeslam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Big_Show_about_to_chokeslam_JBL_during_a_WWE_house_show_in_2005.jpg","page_title":"Chokeslam","context_page_description":"Chokeslam é o nome usado para o golpe em que o atacante enforca o oponente com uma de suas mãos, levanta-o, e derruba o oponente de costas no chão. O golpe é chamado em japonês de Nodowa Otoshi e é um golpe bastante usado no wrestling profissional, por ser simples e relativamente seguro de se executar. Assim como vários outros movimentos, o Chokeslam possui várias variações. O chokeslam pode ser incluído na categoria Slam de golpes.\\nAlguns usuários notáveis deste golpe são Kane, The Undertaker, The Big Show, Kevin Nash, e Abyss."},{"page_url":"https://jv.wikipedia.org/wiki/Dhaptar_Mentri_Jaban_Rangkah_Am%C3%A9rika_Sar%C3%A9kat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/William_L._Marcy_-_Brady-Handy.jpg","page_title":"Dhaptar Mentri Jaban Rangkah Amérika Sarékat","context_page_description":"Mantri Jaban Rangkah Améika Sarékat iku pimpinan saka Departemen Jaban Rangkah Améika Sarékat, sing magepokan karo urusan jabang rangkah. Mantri iki minangka anggota saka Kabinèt Présidhèn Améika Sarékat. Mantri Jaban Rangkah Amérikah Sarékat wujud kalungguhan paling dhuwur sajeroning kabinèt, ya iku urutan angka 4 yèn Présidhèn Amérikah Sarékat ana alangan utawa tilar donya.\\nMantri Jaban Rangkah Amérikah Sarékat wektu iki ya iku Hillary Clinton kanggo mangsa kalungguhan 2009-2013."},{"page_url":"https://cs.wikipedia.org/wiki/Plan%C3%A1_u_Mari%C3%A1nsk%C3%BDch_L%C3%A1zn%C3%AD_(n%C3%A1dra%C5%BE%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Zst_plana.jpg","page_title":"Planá u Mariánských Lázní (nádraží)","context_page_description":"Planá u Mariánských Lázní je železniční stanice v jihozápadní části města Planá v okrese Tachov v Plzeňském kraji nedaleko Hamerského potoka. Leží na jednokolejných tratích 178 a 184. Stanice je elektrifikovaná."},{"page_url":"https://en.wikipedia.org/wiki/2017_World_RX_of_Hockenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Mattias_Ekstr%C3%B6m_%28Audi_S1_EKS_RX_quattro_-1%29_%2834507078305%29.jpg","page_title":"2017 World RX of Hockenheim","context_page_description":"The 2017 World RX of Hockenheim was the third round of the fourth season of the FIA World Rallycross Championship. The event was held at the Hockenheimring in Hockenheim, Baden-Württemberg, alongside the Deutsche Tourenwagen Masters."},{"page_url":"https://ru.wikipedia.org/wiki/MLS_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Galaxy_at_Earthquakes_2010-08-21_98.JPG","page_title":"MLS 2013","context_page_description":"Чемпионат MLS 2013 — сто первый сезон по футболу, санкционированный ФИФА в США и Канаде, тридцать пятый сезон с национальной лигой первого дивизиона и восемнадцатый сезон MLS, высшей лиги США и Канады по футболу. В чемпионате принимали участие 19 клубов.\\nРегулярный чемпионат начался 2 марта и закончился 27 октября. Турнир плей-офф начался 30 октября и завершился матчем за Кубок MLS 7 декабря."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_du_Saint-Esprit_de_Providence","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/FederalHillProvChurch.jpg","page_title":"Église du Saint-Esprit de Providence","context_page_description":"L'église du Saint-Esprit est une église catholique de Providence en Nouvelle-Angleterre. Dédiée au Saint-Esprit, elle dépend du diocèse de Providence."},{"page_url":"https://en.wikipedia.org/wiki/Mihran_Mesrobian","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Mesrobian_prisoner_of_war.jpg","page_title":"Mihran Mesrobian","context_page_description":"Mihran Mesrobian was an Armenian-American architect whose career spanned over fifty years and in several countries. Having received an education in the Academy of Fine Arts in Constantinople, Mesrobian began his career as an architect in Smyrna and in Constantinople. While in Constantinople, Mesrobian served as the palace architect to the last Ottoman Sultan, Mehmed V.\\nDuring World War I, Mesrobian was drafted into the Ottoman army and became a decorated soldier. He participated in the Gallipoli Campaign and served in the Eastern front against the Russians during the Caucasus Campaign and the Arabs during the Arab Revolt. During this time, the Armenian Genocide began, and his family in his native Afyonkarahisar were deported and never to be heard of again. Mesrobian lost fifteen members of his family as a result of the genocide. He was held captive under the Arabs but was ultimately freed with the help of T. E. Lawrence.\\nMesrobian immigrated to the United States in 1921 and became a prominent architect in the Washington, D.C. area. He became the primary in-house architect for Washington developer Harry Wardman."},{"page_url":"https://gl.wikipedia.org/wiki/Bugatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Bugatti_veyron_in_Tokyo.jpg","page_title":"Bugatti","context_page_description":"Bugatti é unha marca de automóbiles superdeportivos e de luxo, fundada en 1909 na entón cidade alemá de Molsheim, Alsacia polo italiano Ettore Bugatti. Hoxe en día pertence ao grupo alemán Volkswagen.\\nNa súa primeira etapa, os coches Bugatti eran coñecidos pola beleza do seu deseño e polas súas moitas vitorias. A morte de Ettore Bugatti en 1947 resultou ser o final da marca, e a morte do seu fillo Jean Bugatti en 1939 asegurou que non había un sucesor para dirixir a fábrica. Non se fixeron máis de 8.000 coches. A compañía loitou financieiramente, e lanzou un último modelo na década de 1950, antes de ser finalmente adquirida polo seu negocio de pezas de avión na década de 1960.\\nDende os anos 1980 a marca foi xestionada pola empresa Bugatti Automobili SpA, que adquiriu tamén Lotus, ata que despois de ser comprada en 1998 polo Grupo Volkswagen, constituiuse en empresa de capital francés no ano 2000 coa denominación de Bugatti Automobiles SAS, con base en Molsheim."},{"page_url":"https://az.wikipedia.org/wiki/Flakstadyoya","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Norway_-_Flakstadoy.PNG","page_title":"Flakstadyoya","context_page_description":"Flakstadyoya — Loyofen adaları qrupuna daxil olan, Norveç dənizində yerləşən ada. İnziibati cəhətdən Flakstad kommunasına daxildir. Sahəsi 110 km²-dir. Əhalisi 1195 nəfər təşkil edir. Moskenesyoy adası ilə Kokern körpüsü, Vestvoqyoy Nappstraum tuneli ilə birləşir. Kommunanın inzibati mərkəzi olan Panberq adada yerləşir. Bundan başqa adada Fledvanq, Nyusford, Sunn, Vikten və Napp kəndləri vardır."},{"page_url":"https://pl.wikipedia.org/wiki/Park_Krajobrazowy_Doliny_Bobru","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Polecat_in_denmark.jpg","page_title":"Park Krajobrazowy Doliny Bobru","context_page_description":"Park Krajobrazowy Doliny Bobru – park krajobrazowy w województwie dolnośląskim położony na terenie gmin Jelenia Góra, Jeżów Sudecki, Lubomierz, Lwówek Śląski, Stara Kamienica, Świerzawa i Wleń.\\nZajmuje powierzchnię 10 943 ha, w tym powierzchnia leśna liczy 4215 ha. Otulina Parku zajmuje 12 552 ha.\\nNajwyższe wzniesienie: Siedlęcinka\\na w obrębie otuliny: Wapienka"},{"page_url":"https://cy.wikipedia.org/wiki/Siambr_gladdu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/BrynCelliDdu3.jpg","page_title":"Siambr gladdu","context_page_description":"Siambr, neu ogof wneud, lle rhoddir corff dynol marw i'w orffwys ydy siambr gladdu a honno wedi'i gorchuddio gyda phridd. Fel arfer cysylltir y gair gyda defodau claddu Oes Newydd y Cerrig, Oes yr Efydd a chyn hynny. Arferid gosod strwythur o gerrig enfawr yn gyntaf i ddal y bryncyn a roddid ar ei ben ac weithiau gellir gweld y cromlechi"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E6%97%A5%E8%80%B3%E6%9B%BC%E5%A4%A7%E9%81%93","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Floregermainbenoit.jpg","page_title":"圣日耳曼大道","context_page_description":"圣日耳曼大道是法国巴黎的一条主要街道，位于塞纳河左岸。该路呈弧形，东起圣路易岛边缘的Sully桥，西到通向协和广场的协和桥，穿越巴黎第五区、巴黎第六区和巴黎第七区。在圣日耳曼大道的中段，与南北走向的圣米歇尔大道交汇。 圣日耳曼大道最著名的是穿越圣日耳曼德佩区的那一段，也是它得名的那一段。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%B5%D1%80_%D0%9C%D0%B0%D1%80%D0%BB%D0%BE%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Christopher_Marlowe.jpg","page_title":"Кристофер Марлоу","context_page_description":"Кристофер Марлоу, исто така познат како Кит Марлоу, бил англиски драматург, поет и преведувач во Елизабетинската ера. Марлоу бил најсилниот Елизабетански писател на трагедии во неговиот ден. Тој во голема мера му влијаел на Вилијам Шекспир, кој бил роден во истата година како и Марлоу, и кој станал познат по раната и мистериозна смрт на Марлоу. Драмите на Марлоу се препознатливи според примената на белиот стих и по големиот број на ликови.\\nНа 18 мај 1593 беше издадена наредба за апсењето на Марлоу. Немаше конкретна причина, иако некои мислеле дека е поврзано со наводите на хула—ракопис за кој се верува дека бил напишани од страна на Марлоу и содржел \\"непријатни еретички концепти\\". На 20 мај, тој наводно бил изведен пред суд за да го испрашуваат. Не постојат докази дека навистина излегол пред суд, но сепак, му било наредено да доаѓа секој ден на испрашување се додека не му било дозволено спротивното. Десет дена подоцна, тој бил избоден до смрт од страна на Инграм Фрејзер. До ден денес не се знае дали неговата смрт има врска со неговото апсење."},{"page_url":"https://es.wikipedia.org/wiki/Owon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Owon-Unrim.sedongdo.jpg","page_title":"Owon","context_page_description":"Jang Seung-eop, fue un pintor de finales de la Dinastía Joseon en Corea. Su vida figura en 2002 en el aclamado filme Ebrio de mujeres y pintura dirigida por Im Kwon-taek. Fue uno de los pocos pintores que tuvo una posición de relevancia en la corte Joseon.\\nCriado como huérfano, Owon aprendió el oficio de la pintura durante la estancia en el hogar de otra familia. En un principio tuvo la oportunidad de pintar cuando con 20 años de edad se traslada a la residencia del aristócrata Yi Ung-heon. Más tarde, su talento se vuelve ampliamente conocido, y pinta en abundancia en todos los géneros de la época, incluyendo paisajes, pinturas florales, y pinturas de la vida diaria.\\nJunto con los pintores Danwon y Hyewon, Owon es hoy recordados como uno de los \\"Tres Wons\\" de la pintura del periodo Joseon."},{"page_url":"https://ca.wikipedia.org/wiki/David_Maxwell_Fyfe","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/David_Maxwell_Fyfe%2C_Nuremberg%2C_1946_%28Art._IWM_ART_LD_5863%29.jpg","page_title":"David Maxwell Fyfe","context_page_description":"David Patrick Maxwell Fyfe, 1r comte de Kilmuir, conegut com a Sir David Maxwell Fyfe de 1942 a 1954 i com a vescomte Kilmuir de 1954 a 1962, va ser un polític, advocat i jutge conservador britànic que va combinar una carrera jurídica treballadora i precoç amb ambicions polítiques, que el va portar a les oficines de procurador general, fiscal general, secretari d’interior i Lord Canceller de Gran Bretanya.\\nUn dels fiscals dels judicis de Nuremberg, va ser fonamental per redactar la Convenció Europea de Drets Humans. Va ser un controvertit Home Secretary quan va perseguir a les persones homosexuals i va negar la seva clemència per commutar la sentència de mort altament controvertida de Derek Bentley. Les seves ambicions polítiques van ser aturades en última instància per la remodelació de juliol de 1962 del gabinet de Harold Macmillan."},{"page_url":"https://en.wikipedia.org/wiki/OS_T1000","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Nydalen_T-banestasjon_med_T1300.jpg","page_title":"OS T1000","context_page_description":"T1000 and T1300 were two rapid transit train classes used on Oslo Metro in Oslo, Norway. The 197 cars were built by Strømmens Verksted, Norsk Elektrisk & Brown Boveri and AEG between 1960 and 1981. They were the first metro trains used in Oslo, and had remained in active use until being replaced by OS MX3000 trains in 2007. Each car is equipped with a driver's cab at one or both ends and four motors, each with 98 kilowatts. The cars are 17 meters long, 3.2 meters wide and 3.65 meters tall. The trains use 750 V current, and are capable of 70 kilometres per hour. Signaling is provided through automatic train protection.\\nIn 1960, two less powerful T single-car units were built, designed to be prototypes used on the Oslo Tramway. After a one-year trial, they were put into scheduled traffic to the Kolsås Line, where they remained in regular service until 1983. The production series is somewhat different in design and performance. T1000 is both used to refer to the class as a whole, or the first 162 cars, that are only equipped with third-rail shoes. They have four slight variations, which have been given the designations T1–T4."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%95%D7%A9_(%D7%9E%D7%9E%D7%AA%D7%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Licorice.jpg","page_title":"שוש (ממתק)","context_page_description":"שׁוּשׁ, הקרוי גם שׂוּשׂ, במבליק, לקריץ, ליקריש, ליקריץ', ליקוריש או רגליס, הוא ממתק שמכינים מתמצית שורשי הצמח שׁוּשׁ קירח, ובדרך כלל גם משמן או תמצית אניס. מקורו של הממתק במנהג ללעוס את השורש המתוק של הצמח."},{"page_url":"https://en.wikipedia.org/wiki/Fran%C3%A7ois_Beaulieu_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Route_of_the_Expedition_from_Isle_a_la_Crosse_to_Fort_Providence_in_1819_%26_20_%281823%29.jpg","page_title":"François Beaulieu II","context_page_description":"François Beaulieu II was a chief of the Yellowknife tribe. He was an Arctic guide and interpreter who played an important role in exploration of the Northwest Territories of Canada."},{"page_url":"https://de.wikipedia.org/wiki/Dave_Weldon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/David_Weldon.jpg","page_title":"Dave Weldon","context_page_description":"David Joseph „Dave“ Weldon ist ein US-amerikanischer Politiker. Zwischen 1995 und 2009 vertrat er den Bundesstaat Florida im US-Repräsentantenhaus."},{"page_url":"https://en.wikipedia.org/wiki/Triple_Crown_(professional_wrestling)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/KurtAngleSs05.jpg","page_title":"Triple Crown (professional wrestling)","context_page_description":"The Triple Crown is an accomplishment recognized by various professional wrestling promotions. It is a distinction made to a professional wrestler who has won three of a single promotion's championships; specifically, a world championship, another singles championship, and a tag team championship. Promotions to officially recognize Triple Crown winners include WWE, Impact Wrestling, and Ring of Honor as well as the defunct promotions World Championship Wrestling, Extreme Championship Wrestling, and Lucha Underground."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%BB%E3%83%99%E3%83%AA%E8%88%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Vikingshipkils.jpg","page_title":"オーセベリ船","context_page_description":"オーセベリ船は、ノルウェーヴェストフォル県トンスベルグ近郊のオーセベリ農場にある大きな墳丘墓から発見されたヴァイキング船である 。\\n現在、同時に発掘された多くの副葬品と共にオスロ市ビグドイ地区にあるヴァイキング船博物館に展示されている。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%88%D8%B4%D9%89_%D8%AF%D9%8A%D9%86%D9%88%D9%84%D9%8A%D8%B3%D9%83%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Pu%C8%99i_Dinulescu_portret_2006.jpg","page_title":"پوشى دينوليسكو","context_page_description":"پوشى دينوليسكو كان مخرج افلام من رومانيا."},{"page_url":"https://fr.wikipedia.org/wiki/Finale_de_la_Coupe_du_monde_de_football_1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Weltmeisterzug_1954.JPG","page_title":"Finale de la Coupe du monde de football 1954","context_page_description":"La finale de la Coupe du monde de football 1954, connue sous le surnom de « Miracle de Berne », est le match de football concluant la cinquième édition de la Coupe du monde, organisée en Suisse. Elle a lieu le 4 juillet 1954 au Stade du Wankdorf, à Berne. L'Allemagne de l'Ouest s'impose face à la Hongrie par trois buts à deux, déjouant alors tous les pronostics.\\nL'équipe de Hongrie, invaincue depuis 31 matchs, est la favorite indiscutable de la rencontre. Elle commence à son avantage avec deux buts inscrits dans les dix premières minutes, mais un retour inattendu de l'équipe d'Allemagne porte rapidement le score à 2-2. Dans les ultimes minutes du match, « verrouillé », un but « miraculeux » de Helmut Rahn donne l'avantage aux Allemands, sacrés champions du monde de football pour la première fois.\\nCette victoire, considérée « injuste » par une grande partie de l'opinion en dehors d'Allemagne, a un fort retentissement symbolique car elle incarne le renouveau politique, économique et identitaire de l'Allemagne de l'Ouest, toujours profondément meurtrie par la Seconde Guerre mondiale."},{"page_url":"https://de.wikipedia.org/wiki/American-Airlines-Flug_625","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Cyril_E._King_Airport.jpg","page_title":"American-Airlines-Flug 625","context_page_description":"American-Airlines-Flug 625 war ein Passagierflug der US-amerikanischen Fluggesellschaft American Airlines, der von Providence, Rhode Island nach Saint Thomas auf den Amerikanischen Jungferninseln führte. Am 27. April 1976 kam es bei der Landung auf dem Harry S Truman Airport von Saint Thomas zu einem Unglück, als das Flugzeug über die mit 1.400 Metern Länge sehr kurze Landebahn hinausschoss und dabei zerstört wurde. Das Unglück kostete 37 Menschen das Leben. An Bord wurden 39 Personen verletzt, eine weitere am Boden."},{"page_url":"https://pt.wikipedia.org/wiki/Good_girl_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Imagination_Oct_1954_cover.gif","page_title":"Good girl art","context_page_description":"Good girl art é um estilo de ilustração, aonde o artista retrata mulheres atraentes para capas de revistas pulp ou para capa de revistas em quadrinhos, sendo ambas direcionadas ao público adulto."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Australian_ministries","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Menzies1951Ministry.jpg","page_title":"List of Australian ministries","context_page_description":"This is a list of ministries of the Government of Australia since Federation in 1901."},{"page_url":"https://fr.wikipedia.org/wiki/Lac_Abraham","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/LakeAbrahamPan1.jpg","page_title":"Lac Abraham","context_page_description":"Le lac Abraham, en anglais : Abraham Lake, est un lac artificiel sur la rivière Saskatchewan Nord à l'ouest de l'Alberta au Canada. Le lac Abraham a une superficie de 53,7 km² et une longueur de 32 km."},{"page_url":"https://de.wikipedia.org/wiki/Niederl%C3%A4ndische_Besitzungen_in_S%C3%BCdasien","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/SpilbergenVimala.jpg","page_title":"Niederländische Besitzungen in Südasien","context_page_description":"Dieser Artikel behandelt niederländische Kolonien in Indien und Ceylon. Zu Indonesien als niederländischer Kolonie siehe Niederländisch-Indien\\nDie Niederländischen Kolonialbesitzungen in Südasien umfassten von der Mitte des 17. bis Anfang des 19. Jahrhunderts Niederlassungen und Handelsstützpunkte auf Ceylon sowie einige Stützpunkte auf dem indischen Festland. Ceylon als weltweit einziger Zimtlieferant und das indische Festland mit seinen Baumwollvorkommen waren von den Handelsgesellschaften des europäischen Kontinents begehrte Regionen. Diese Gebiete wurden nicht direkt von den Generalstaaten der Niederlande, sondern von der Vereinigten Ostindien-Kompanie verwaltet und in den europäisch-asiatischen Handel eingebunden. 1824 gingen die letzten niederländischen Besitzungen in diesen Gebieten auf England über."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D1%81%D0%BA%D0%B8_%D0%B4%D1%8A%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%B8_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B8%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/46_221.8-R%D0%91%D0%92_8612_%D0%A1%D0%BB%D1%8A%D0%BD%D1%87%D0%B5%D0%B2_%D0%91%D1%80%D1%8F%D0%B3-05.08.2017-%D0%A7%D0%BF.jpg","page_title":"Български държавни железници","context_page_description":"„Български държавни железници“ ЕАД е държавно предприятие в България, най-големият железопътен оператор в страната."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B3%A1%E7%AE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Liquid_hydrogen_bubblechamber.jpg","page_title":"泡箱","context_page_description":"泡箱は、荷電粒子を観測するための装置の一つ。1952年にアメリカの物理学者ドナルド・グレーザーによって発明された。グレーザーはこの功績により、1960年度のノーベル物理学賞を受賞している。\\n原理は霧箱に似ており、過熱状態の透明な液体を満たした空間を粒子が通過することにより、粒子が通過した部分の水素が気化し、泡として観測される。"},{"page_url":"https://es.wikipedia.org/wiki/Comuna_de_Castro","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Escudo_de_Castro_%28Chile%29.svg","page_title":"Comuna de Castro","context_page_description":"Castro es una comuna chilena ubicada en el archipiélago de Chiloé, Región de Los Lagos, a 1214 km al sur de Santiago. En su jurisdicción esta ubicada la ciudad de Castro, la tercera más antigua de Chile con existencia continuada, siendo fundada en febrero de 1567, por el mariscal Martín Ruiz de Gamboa. La superficie comunal es de 473 km² y la población total, según el censo de 2017, es de 43 807 habitantes, de los cuales el 77,7 % vive en la ciudad de Castro.​"},{"page_url":"https://id.wikipedia.org/wiki/Universitas_Nalanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Nalanda_Univercity.JPG","page_title":"Universitas Nalanda","context_page_description":"Universitas Nalanda adalah Universitas Sentral di Rajgir, dekat Nalanda, Bihar, India. Universitas kuno ini memulai tahun akademiknya pada tanggal 1 September 2014 setelah selama 800 tahun tutup. Ada sekitar 1.000 calon mahasiswa yang mendaftar. Awalnya memutuskan untuk hanya menerima 40 siswa - masing-masing 20 di setiap jurusan- tapi setelah pemeriksaan dan wawancara hanya 15 yang akhirnya terpilih. Universitas ini dimaksudkan untuk membangun kembali dari peradaban Universitas Nalanda yang lebih tua, yang merupakan salah satu lembaga belajar kuno tertua dan berjaya di masanya serta merupakan salah satu tujuan favorit para pemikir dunia untuk melanjutkan studi dan berbagi ilmunya. Di antaranya datang dari Tibet, Tiongkok, Yunani, and Iran. Awalnya universitas ini didirikan pada abad ke-5 Masehi oleh raja-raja dari dinasti kerajaan Buddha Gupta."},{"page_url":"https://pt.wikipedia.org/wiki/Guido_van_Rossum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Guido_van_Rossum_OSCON_2006.jpg","page_title":"Guido van Rossum","context_page_description":"Guido van Rossum é um matemático e programador de computadores holandês, mais conhecido por ser o autor da linguagem de programação Python.\\nNa comunidade Python, ele é conhecido como Benevolent Dictator for Life, o que significa que ele continua a supervisionar o processo de desenvolvimento do Python, tomando decisões quando necessário. Entretanto, em julho de 2018, ele anunciou que estaria se afastando deste função devido à desentendimentos com a equipe de desenvolvimento da linguagem Python. A discussão se deu pela atualização PEP572, que chegará em 2019 com a versão 3.8 da linguagem e estreará novas funções. A equipe alega que \\"a sintaxe não ficará tão boa para os padrões de Python\\". Van Rossum discorda. De acordo com equipe do Python no Brasil, Guido van Rossum se afasta somente desta função mas continua à frente do projeto."},{"page_url":"https://de.wikipedia.org/wiki/Blechspielzeug","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Deutsche-lufthansa-152.jpg","page_title":"Blechspielzeug","context_page_description":"Blechspielzeug ist ein Sammelbegriff für Spielzeug, das aus Weißblech hergestellt wird. Dazu gehören Modelleisenbahnen und -autos, aber auch diverse mechanische Spielzeuge. Modernes Spielzeug besteht jedoch aus Kostengründen meist aus Kunststoff, teilweise auch aus Holz. Das Blechspielzeug ist daher selten und ein Sammelobjekt geworden; für alte Stücke werden mitunter sehr hohe Preise bezahlt. Zu den nach wie vor verkauften Klassikern gehört der Brummkreisel."},{"page_url":"https://it.wikipedia.org/wiki/Peligni","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/06_-_Piceni_et_Vestinorum%2C_Pelignorum%2C_Marrucinorum%3B_ac_Frentanorum_agri_descriptio%2C_1624_-_Philip_Cl%C3%BCver.jpg","page_title":"Peligni","context_page_description":"I Peligni erano un piccolo popolo italico di lingua osco-umbra, storicamente stanziato nel I millennio a.C. nella Valle Peligna, parte dell'odierno Abruzzo. Entrati in conflitto con la Repubblica romana alla fine del IV secolo a.C., presto furono indotti dall'evidente supremazia dell'esercito romano a unirsi in alleanza con Roma, accettando una condizione di chiara subordinazione. Conservarono a lungo un certo margine di autonomia interna fino a quando, nel I secolo a.C., l'estensione a tutti gli Italici della cittadinanza romana, decisa in seguito alla Guerra sociale alla quale avevano preso parte anche i Peligni, accelerò il processo di romanizzazione del popolo, che fu rapidamente inquadrato nelle strutture politico-culturali di Roma."},{"page_url":"https://ceb.wikipedia.org/wiki/Fowler_Mountain_(bukid_sa_Tinipong_Bansa,_Connecticut)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Fowler_mountain.jpg","page_title":"Fowler Mountain (bukid sa Tinipong Bansa, Connecticut)","context_page_description":"Bukid ang Fowler Mountain sa Tinipong Bansa. Nahimutang ni sa kondado sa Middlesex County ug estado sa Connecticut, sa sidlakang bahin sa nasod, 500 km sa amihanan-sidlakan sa Washington, D.C. 225 metros ibabaw sa dagat kahaboga ang nahimutangan sa Fowler Mountain, o 83 ka metros sa ibabaw sa naglibot nga tereyn. Mga 1.6 ka kilometro ang gilapdon sa tiilan niini. Fowler Mountain nga nahimutang sa mga lanaw sa Pistapaug Pond, ug William J Ulbrich Reservoir ang ulohan sa nasod.\\nAng yuta palibot sa Fowler Mountain kay kasagaran patag. Kinahabogang dapit sa palibot ang West Peak, 301 ka metros ni kahaboga ibabaw sa dagat, 15.8 km sa amihanan-kasadpan sa Fowler Mountain. Dunay mga 166 ka tawo kada kilometro kwadrado sa palibot sa Fowler Mountain medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Meriden, 11.9 km sa amihanan-kasadpan sa Fowler Mountain. Hapit nalukop sa lasang nga tigkapulak ang palibot sa Fowler Mountain. Sa rehiyon palibot sa Fowler Mountain, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Agosto, sa 21 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://nl.wikipedia.org/wiki/Roissard","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Mairie_de_Roissard.JPG","page_title":"Roissard","context_page_description":"Roissard is een gemeente in het Franse departement Isère en telt 222 inwoners. De plaats maakt deel uit van het arrondissement Grenoble."},{"page_url":"https://es.wikipedia.org/wiki/Dougie_Payne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Travis_2007_V.jpg","page_title":"Dougie Payne","context_page_description":"Douglas 'Dougie' Payne es el bajista de la banda británica Travis."},{"page_url":"https://en.wikipedia.org/wiki/Rasty_Wright_(outfielder)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Rasty_Wright.jpg","page_title":"Rasty Wright (outfielder)","context_page_description":"William Smith \\"Rasty\\" Wright was a professional baseball player. An outfielder, he played just one season in Major League Baseball, 1890, which he split between two teams. He began the season with the American Association's Syracuse Stars, but was released in August. He then moved on to the Cleveland Spiders to finish the season.\\nWright also had an extensive minor league baseball career, spanning sixteen seasons. He began his professional career with Muskegon in the Northwestern League in 1884, and played until 1899, which he spent with the Paterson Giants and Buffalo Bisons. He also managed the Grand Rapids Gold Bugs in 1894-95 and the Paterson Giants in 1899. He is \\"probably first player to collect 2,000 hits in minor leagues.\\""},{"page_url":"https://nl.wikipedia.org/wiki/Indische_modderkruiper","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Loaches-2.jpg","page_title":"Indische modderkruiper","context_page_description":"De Indische modderkruiper is een tropische zoetwatervis die veel gehouden wordt in aquaria. Het dier heeft het uiterlijk van een slangetje, de vinnen zeer klein, soms zelfs nauwelijks zichtbaar. Alleen de borstvinnen en de staartvin zijn duidelijk te zien, maar ook klein in vergelijking met veel andere vissen. Het diertje is meestal niet langer dan 10 tot 12 centimeter, de kleur is geel/bruin of geel/zwart verticaal gestreept. Ook bestaan er varianten die geheel bruin zijn. De eitjes zijn lichtgroen en de jongen zijn zeer donker. Ze zijn volwassen als ze ongeveer 7 centimeter zijn en kunnen meer dan 10 jaar oud worden.\\nDe vis is een echte bodembewoner, en is bijna altijd te zien terwijl hij tussen de plantenwortels op zoek is naar zijn voedsel, dat bestaat uit kleine kreeftachtigen, plantenresten en ander organisch afval. Afkomstig uit Zuidoost-Azië ligt de ideale watertemperatuur voor de modderkruiper rond de 25 graden Celsius."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D1%82-%D0%90%D0%BC%D0%B0%D0%BD-%D0%A1%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Tour_Eglise.JPG","page_title":"Сент-Аман-Су","context_page_description":"Сент-Ама́н-Су — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Тарн. Населення — 1666 осіб.\\nМуніципалітет розташований на відстані близько 600 км на південь від Парижа, 90 км на схід від Тулузи, 60 км на південний схід від Альбі."},{"page_url":"https://vi.wikipedia.org/wiki/Newgrange","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Bru_na_Boinne_-_Newgrange.jpg","page_title":"Newgrange","context_page_description":"Di chỉ khảo cổ Newgrange là một di chỉ khảo cổ nằm ở thung lũng Boyne, Ireland. Năm 1993, UNESCO đã công nhận Di chỉ khảo cổ Newgrange là di sản thế giới. Đồi nghĩa trang Newgrange là một trong những đài tưởng niệm thời tiền sử ấn tượng nhất ở Châu Âu, có thể sánh ngang hàng với Stonehenge và đền Ggantija. Nó từng là nơi chôn cất của các vì vua dòng Tara, nó đã được xây dựng rất lâu khoảng 3200 trước công nguyên. Những nhà khảo cổ hiện đại cho rằng chắc hẳn nó được sử dụng như đài quan sát mặt trời, nếu vậy nó sẽ là đài quan sát thiên văn xưa nhất thế giới."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9C%D0%BD%D0%B5%D0%BC%D0%BE%D1%81%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Mnemosyne_%28color%29_Rossetti.jpg","page_title":"Мнемосина","context_page_description":"Мнемоси́на, Мнемозина — борынгы грек мифологиясендә хәтер төшенчәсен гәүдәләндерүче алиһә, Уран белән Гея кызы, титанида. Бу шулай ук аскы дөньядагы елга исеме дә.\\nЗевстан туган Музыаларның анасы. Зевс аны көтүче кыяфәтенә кереп дәртләндергән. Зевс аның белән бергә ятакта тугыз төн үткәргән, Музаларны ул Пиерия шәһәрендә тапкан. Аны \\"Элевфера биеклекләре патшабикәсе\\" дип тә атыйлар.\\nБорынгы грек язучысы һәм географы Павсаний мәгълүматы буенча, Лейбадеядагы Трофония мәгарәсе янында ике чишмә булган: Лета и Мнемосина.\\nХәтерне гәүдәләндерүче Мнемосина — Кронос белән Океаносның сеңелесе. Ул тәгаен белү сәләтенә ия: Һесиод буенча, ул \\"элек һәм хәзер булганның, киләчәктә ни булачагын барысын да белә. Шагыйрь музалар тарафыннан илһамландырылганда мәгълүматны Мнемосинаның хәтер чыганагыннан ала; димәк, ул бөтен башлангычларны танып белү сәләтенә ия була.\\nУл фикер йөртү ысулларфын ачкан һәм бар нәрсәгә исем-атама бирү тәртибен урнаштырган. LXXVII орфик һимн аңа багышланган.\\n1859 елда ачылган Мнемозина астероиды Мнемосина хөрмәтенә аталган."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeinden_im_Landkreis_Lichtenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Marktplatz_Lichtenfels.jpg","page_title":"Liste der Gemeinden im Landkreis Lichtenfels","context_page_description":"Die Liste der Gemeinden im Landkreis Lichtenfels gibt einen Überblick über die 11 kleinsten Verwaltungseinheiten des Landkreises. Vier der Gemeinden sind Städte, drei Märkte. Lichtenfels ist eine Mittelstadt, die anderen drei, Bad Staffelstein, Burgkunstadt und Weismain sind Kleinstädte. Mit nur elf Gemeinden ist der Landkreis Lichtenfels der Landkreis in Bayern mit den wenigsten Gemeinden.\\nIn seiner heutigen Form entstand der Landkreis Lichtenfels im Zuge der im Jahr 1972 durchgeführten bayerischen Gebietsreform. Der Landkreis wurde aus dem Landkreis Lichtenfels und dem Großteil des Landkreises Staffelstein gebildet. Die heutige Gemeindegliederung war im Jahr 1979 abgeschlossen. Bei den Gemeinden ist vermerkt, zu welchem Landkreis der Hauptort der Gemeinde vor der Gebietsreform gehörte. Bei den Teilorten der Gemeinden ist das Jahr vermerkt, in dem diese der Gemeinde beitraten. Bei den Teilorten, die vor der Gebietsreform zu einem anderen Landkreis gehörten als der Hauptort der heutigen Gemeinde, ist auch dieses vermerkt."},{"page_url":"https://fr.wikipedia.org/wiki/Dorzano","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Dorzano_panorama_da_sud.jpg","page_title":"Dorzano","context_page_description":"Dorzano est une commune italienne de la province de Biella dans la région Piémont en Italie."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D9%85%D9%88%D9%84%D8%AF%D8%B1_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%AF%D9%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Jan_Mulder_%282017%29.jpg","page_title":"جان مولدر (لاعب كرة قدم)","context_page_description":"جان مولدر ‏ هو صحفي ومذيع وكاتب ولاعب كرة قدم هولندي في مركز الهجوم. شارك مع منتخب هولندا لكرة القدم. أما مع النوادي، فقد لعب مع أياكس أمستردام ونادي رويال أندرلخت."},{"page_url":"https://de.wikipedia.org/wiki/Harper_County_(Kansas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/USA_Harper_County%2C_Kansas_age_pyramid.svg","page_title":"Harper County (Kansas)","context_page_description":"Harper County ist ein County im Bundesstaat Kansas der Vereinigten Staaten. Der Verwaltungssitz ist Anthony. Das County gehört zu den Dry Countys, was bedeutet, dass der Verkauf von Alkohol eingeschränkt oder verboten ist."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Schlesien","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Szczerba.JPG","page_title":"Liste von Burgen und Schlössern in Schlesien","context_page_description":"Die Liste von Burgen und Schlössern in Schlesien enthält Schlösser, Burgen und Ruinen in der historischen Region Schlesien.\\nErläuterung:\\nWoiwodschaft NS = Niederschlesien, OP = Oppeln, OS = Oberschlesien, LB = Lebus"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D5%A3%D5%AB%D5%BA%D5%BF%D5%A1%D5%B4%D5%B8%D5%AC%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Sevres_Egyptian_Service.JPG","page_title":"Եգիպտամոլություն","context_page_description":"Եգիպտամոլություն, հրապուրվածությունը հին եգիպտական պարագաներով: Մարդկության պատմության զարգացման վերջին շրջանում նորաձևության դրսևորում է: Եգիպտամոլությունը հաճախ դիտարկվում է դեպի անցյալ, դեպի մարդկային քաղաքակրթության ակունքներ վերադառնալու գաղափարով: Արվեստում դրսևորվում է եգիպտականացման ոճով:"},{"page_url":"https://fr.wikipedia.org/wiki/Lady,_Play_Your_Mandolin!","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Lady%2C_Play_Your_Mandolin%21.jpg","page_title":"Lady, Play Your Mandolin!","context_page_description":"Lady, Play Your Mandolin! est un film américain d'animation réalisé par Rudolf Ising, sorti en 1931\\nIl s'agit du premier dessin animé de la série Merrie Melodies des studios de dessins animés Warner Bros."},{"page_url":"https://bs.wikipedia.org/wiki/Anja_P%C3%A4rson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Anja_P%C3%A4rson_Semmering_2008.jpg","page_title":"Anja Pärson","context_page_description":"Anja Sofia Tess Pärson bivša je švedska alpska skijašica koja je pobijedila na 7 svjetskih prvenstava, a osvojila je i 2 Svjetska kupa. Ona je također trenutni olimpijski prvak u slalomu, nakon što je pobijedila na Zimskoj Olimpijadi u Torinu.\\nPärson u profesionalno skijanje uveo njen otac Anders. Osvojila je bronzanu medalju u ženskom slalomu i srebrenu medalju u veleslalomu na Zimskoj Olimpijadi 2002. Pärsonov matični klub je Fjällvinden u Tärnabyju, isti onaj u kome su bili Ingemar Stenmark i Stig Strand.\\nPärson je osvojio Svjetski kup u alpskom skijanju godine 2004. i 2005. Posljednja pobjeda je bila obilježena rekordno malenom razlikom od samo 3 boda ispred njene poznate suparnice Janice Kostelić. Njen prvi rezultat na podiju je bio na utrci za veleslaom u Crans-Montani. U decembru iste godine ostvarila je prvu pobjedu u slalomu na Mammoth Mountainu: nakon toga je slijedilo ukupno još 17 pobjeda u svjetskom kupu. Ispočetka je bila specijalist samo za tehničke discipline, ali je osvojila svoj prvi superveleslalom u martu 2005. i prvi spust u januaru 2006. Pärson je pobijedila u 34 utrke u Svjetskom kupu u alpskom skijanju."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cultural_heritage_sites_in_Khyber_Pakhtunkhwa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/SirsukhWall.JPG","page_title":"List of cultural heritage sites in Khyber Pakhtunkhwa","context_page_description":"Following is the list of monuments and archaeological sites in Khyber Pakhtunkhwa, Pakistan. A total 85 sites in the province were under the protection of the Federal Government. The list includes the only completely inscribed UNESCO World Heritage Site in Khyber Pakhtunkhwa, the Buddhist Ruins of Takht-i-Bahi and Neighbouring City Remains at Sahr-i-Bahlol as well as sites which are part of the World Heritage Sites at Taxila."},{"page_url":"https://qu.wikipedia.org/wiki/Kutupaksi_marka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cotopaxi_and_ruminahui.jpg","page_title":"Kutupaksi marka","context_page_description":"Kutupaksi marka nisqaqa Ikwadur mama llaqtapi huk markam. Uma llaqtanqa Latakunka llaqtam."},{"page_url":"https://de.wikipedia.org/wiki/Collegium_Carolinum_(Kassel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Wendelin_Moosbrugger%2C_Samuel_Thomas_Soemmerring%2C_1813_aus_A.jpg","page_title":"Collegium Carolinum (Kassel)","context_page_description":"Das Collegium Carolinum in Kassel wurde 1709 von Landgraf Karl von Hessen-Kassel gegründet. Das Carolinum bildete eine „neue Form von Hochschule“ und hatte zur Aufgabe, die Studenten vor dem Beginn des Studiums an einer theologischen, juristischen oder medizinischen Fakultät in Mathematik, Physik und Anatomie auszubilden."},{"page_url":"https://en.wikipedia.org/wiki/Black","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Anneke_Gr%C3%B6nloh_1964_Eurovision_dress.jpg","page_title":"Black","context_page_description":"Black is the darkest color, the result of the absence or complete absorption of visible light. It is an achromatic color, a color without hue, like white and gray. It is often used symbolically or figuratively to represent darkness, while white represents light. Black and white have often been used to describe opposites such as good and evil, the Dark Ages versus Age of Enlightenment, and night versus day. Since the Middle Ages, black has been the symbolic color of solemnity and authority, and for this reason is still commonly worn by judges and magistrates.\\nBlack was one of the first colors used by artists in neolithic cave paintings. It was used in ancient Egypt and Greece as the color of the underworld. In the Roman Empire, it became the color of mourning, and over the centuries it was frequently associated with death, evil, witches and magic. In the 14th century, it was worn by royalty, clergy, judges and government officials in much of Europe. Black was the color of the industrial revolution, largely fueled by coal, and later by oil. It became the color worn by English romantic poets, businessmen and statesmen in the 19th century, and a high fashion color in the 20th century."},{"page_url":"https://en.wikipedia.org/wiki/Air_marshal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/UK-Air-OF8-Flag.svg","page_title":"Air marshal","context_page_description":"Air marshal is a three-star air-officer rank which originated and it is used by the Royal Air Force. The rank is also used by the air forces of many countries which have historical British influence, including the Commonwealth, and it is sometimes used as the English translation of an equivalent rank in countries which have a non-English air force-specific rank structure.\\nAir marshal is a three-star rank and has a NATO ranking code of OF-8, equivalent to a vice-admiral in the Royal Navy or a lieutenant-general in the British Army or the Royal Marines. In other NATO forces, such as the United States Armed Forces and the Canadian Armed Forces, the equivalent three-star rank is lieutenant general.\\nThe rank of air marshal is immediately senior to the rank of air vice-marshal and immediately subordinate to the rank of air chief marshal.\\nOfficers in the rank of air marshal typically hold very senior appointments such as commander-in-chief of an air force or a large air force formation. Officers in the ranks of air chief marshal and air vice-marshal are also referred to generically as air marshals. Occasionally, air force officers of marshal rank are considered to be air marshals."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D1%82%D1%91%D0%BB_%D0%92%D1%81%D0%B5%D1%85_%D0%A1%D0%B2%D1%8F%D1%82%D1%8B%D1%85_(%D0%9B%D1%83%D0%BE%D0%BA%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Luok%C4%97s_Vis%C5%B3_%C5%A0vent%C5%B3j%C5%B3_ba%C5%BEny%C4%8Dios_statini%C5%B3_kompleksas.jpg","page_title":"Костёл Всех Святых (Луоке)","context_page_description":"Костёл Всех Святых в Луоке Luokės Visų Šventųjų bažnyčia — римско-католический приходской храм Тельшяйского деканата в местечке Луоке Тельшяйского самоуправления.\\nАнсамбль, включающий здания костёла, колокольни и ограда прилегающей территории с воротами, является охраняемым государством объектом культурного наследия; код в Регистре культурных ценностей Литовской Республики 26963; код самого храма — 1678 (включённого в Регистр ещё в 1992 году), колокольни — 26964. Располагается на холме. Официальный адрес: Луоке, ул. Тельшю 5 (Telšių g. 5)."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Germain-d%27Auxerre_de_Noisy-sur-Oise","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Noisy-sur-Oise_%2895%29%2C_%C3%A9glise_Saint-Germain%2C_chapelle_sud%2C_vue_vers_le_sud-est.JPG","page_title":"Église Saint-Germain-d'Auxerre de Noisy-sur-Oise","context_page_description":"L'église Saint-Germain-d'Auxerre est une église catholique paroissiale située à Noisy-sur-Oise, en France. C'est une petite église à double vaisseau, ce qui fait son principal intérêt, car son architecture est plutôt rustique, et ne comporte aucun élément remarquable. Au sud, la chapelle des fonts baptismaux, le clocher en bâtière, la chapelle de la Saint-Joseph et la sacristie sont accolées à ce double vaisseau, ce qui confère à l'édifice une silhouette pittoresque. Les trois premières parties datent du XIIIᵉ siècle, voire de la fin du XIIᵉ siècle en ce qui concerne la base du clocher, mais l'on y cherchera en vain des éléments de sculpture ou de modénature de cette époque. Dans le double vaisseau, l'on distingue une nef carrée, dont le chapiteau de crochets du pilier central atteste seul ses origines au XIIIᵉ siècle, et un chœur également carrée, qui est partagé entre le sanctuaire et la chapelle de la Vierge Marie, au nord. Ce chœur de style gothique flamboyant est voûté d'ogives, et présente une architecture plus soignée. La chapelle Saint-Joseph a été revoûtée dans le même style, mais elle est plus simple."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Northeast_Quadrant,_Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Boundary_Stone_%28District_of_Columbia%29_NE_3.jpg","page_title":"National Register of Historic Places listings in Northeast Quadrant, Washington, D.C.","context_page_description":"This is a list of properties and districts in the Northeast quadrant of Washington, D.C. that are listed on the National Register of Historic Places.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Jos%C3%A9_G%C3%BCemes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Fabra%2C_Aguirre%2C_G%C3%BCemes_PP_G%C3%A9nova_23._IMG_1681_%283607287758%29_%28cropped%29.jpg","page_title":"Juan José Güemes","context_page_description":"Juan José Güemes Barrios es el presidente del Centro de Emprendimiento e Innovación de IE Business School desde marzo de 2010. Desde enero de 2012 también es el vicepresidente de Asuntos Económicos de esta institución académica. Además, es economista de formación y fue político español del Partido Popular, tiempo en el que ocupó el cargo de consejero de Sanidad y de Empleo y Mujer de la Comunidad de Madrid."},{"page_url":"https://cs.wikipedia.org/wiki/Gymn%C3%A1zium_Kada%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Gymn%C3%A1zium_Kada%C5%88.jpg","page_title":"Gymnázium Kadaň","context_page_description":"Gymnázium Kadaň je čtyřleté a osmileté gymnázium s možností specializace na přírodovědný nebo humanitní směr po 2. ročníku studia. Sídlí v Kadani v ulici 5. května. Heslem školy je Consultum bene iuventae est. Pod stejným názvem je veden i Školní vzdělávací program."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B2%B3%E5%8C%97%E7%94%BA%E7%AB%8B%E6%B2%B3%E5%8C%97%E4%B8%AD%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kahokuchu.JPG","page_title":"河北町立河北中学校","context_page_description":"山形県西村山郡河北町にある公立中学校。"},{"page_url":"https://en.wikipedia.org/wiki/1976","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Davenport_2013_%28cropped%29.jpg","page_title":"1976","context_page_description":"1976 was a leap year starting on Thursday of the Gregorian calendar, the 1976th year of the Common Era and Anno Domini designations, the 976th year of the 2nd millennium, the 76th year of the 20th century, and the 7th year of the 1970s decade."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AF%81%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AE%95%E0%AF%8B%E0%AE%A3%E0%AE%AE%E0%AF%8D_%E0%AE%AE%E0%AF%81%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF_%E0%AE%AA%E0%AE%BE%E0%AE%A4%E0%AE%BE%E0%AE%B3%E0%AE%95%E0%AE%BE%E0%AE%B3%E0%AE%BF%E0%AE%AF%E0%AE%AE%E0%AF%8D%E0%AE%AE%E0%AE%A9%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Mucchandi_badalakaliamman_temple.JPG","page_title":"கும்பகோணம் முச்சந்தி பாதாளகாளியம்மன் கோயில்","context_page_description":"கும்பகோணத்தில் உள்ள காளியம்மன் கோயில்களில் இதுவும் ஒன்றாகும்."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1960","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/2008_05_29_New_York_-_Anonymous_protest_Jason_Beghe_01.jpg","page_title":"Lijst van personen geboren in 1960","context_page_description":"Dit is een lijst van personen die geboren zijn in 1960.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Progressive_Conservative_Association_of_Alberta_leadership_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Alberta_2011_PC_Leadership_2.png","page_title":"Progressive Conservative Association of Alberta leadership elections","context_page_description":"This page lists the results of leadership elections held by the Progressive Conservative Association of Alberta or as it was known before 1958, the Conservatives."},{"page_url":"https://de.wikipedia.org/wiki/Politisches_System_Italiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Presidente_Leone.jpg","page_title":"Politisches System Italiens","context_page_description":"Das politische System des seit 1861 bestehenden italienischen Staates war ursprünglich in der Form einer konstitutionellen Monarchie organisiert und ist seit 1946 als parlamentarische Republik strukturiert."},{"page_url":"https://en.wikipedia.org/wiki/N%C3%BCmbrecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ballon-2.jpg","page_title":"Nümbrecht","context_page_description":"Nümbrecht is a municipality in the Oberbergischer Kreis, in North Rhine-Westphalia, Germany. It is a health resort, known for its good climate."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D1%83_(%D0%BC%D0%B8%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Kailash_north.JPG","page_title":"Меру (митология)","context_page_description":"Връх Меру, наричан също Шумеру на санскрит, на пали Шунеру или Кайлаш, а „Меру“ с представката „-шу“ се превежда като „Съвършеният Меру“ или „Махамеру“ т.е. „Великият Меру“. Той е еднакво свещен както за индуистите и джайнистите така и за будистката космология като център на всички физически, метафизически и духовни светове.\\nМеру е считан за митичната ос на света в индуистката митология. Според Бхагавата пурана той е висок 84 000 йоджани или 1.082 милиона км. Връх Меру е центърът на земята в Джамбудвипа, един от континентите в индуистката митология. Той се счита за домът на боговете. Над него е небето, под него са долните светове, а навсякъде около него е целият видим свят. Около него се върти слънцето.\\nВръх Меру отговаря, може би на една планина на десния бряг на езерото Манасаровар, която ден се нарича връх Кайлаш.\\nАрхитектурата на покривите на индуистки храмове и на бирманските пиата символизират тази свещена планина.\\nМного известни индуистки, джайнистки както и будистки храмове са построени изобразяващи лика на планината. Например в Бирма най-горния край на кралските пагоди са покрити с многопластов покрив в бирмски стил, изобразяващ планината Меру."},{"page_url":"https://no.wikipedia.org/wiki/Schwelm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Herbergstra%C3%9Fe_12.jpg","page_title":"Schwelm","context_page_description":"Schwelm er en kretsby og administrativt sete i Ennepe-Ruhr-Kreis i Regierungsbezirk Arnsberg i den tyske delstaten Nordrhein-Westfalen. Byen har et areal på 20.50 km² og en befolkning på 28 614 innbyggere."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BD%D0%BC%D0%B0%D0%BD,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Daviddenman.jpg","page_title":"Денман, Дэвид","context_page_description":"Дэвид Денман — американский актёр кино и телевидения, наиболее известный по роли Роя Андерссона в сериале «Офис», за которую был отмечен Премией Гильдии киноактёров США за лучший актёрский состав."},{"page_url":"https://es.wikipedia.org/wiki/Arteria_car%C3%B3tida_externa","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Mra1.jpg","page_title":"Arteria carótida externa","context_page_description":"En anatomía humana, la arteria carótida externa es una de las principales arterias de la cabeza y el cuello. Se origina en la arteria carótida común, ​ cuando ésta se bifurca en carótida externa e interna. En el niño, es algo más pequeña que la carótida interna, pero, en el adulto, los dos vasos son de aproximadamente el mismo tamaño.\\nEn esta arteria es posible tomar el pulso sanguíneo presionando ligeramente con los dedos índice y medio en la parte lateral superior del cuello, bajo el ángulo de la mandíbula."},{"page_url":"https://sv.wikipedia.org/wiki/No-teater","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Noh3.jpg","page_title":"No-teater","context_page_description":"No eller noh är en klassisk japansk teaterstil som har framförts sedan 1300-talet. No kännetecknas av strikt kodifierade rörelsemönster, vanligen långsamma och spartanska. Dialogen framförs i en högt stiliserad intonation, i det närmaste ett mässande och No-skådespelarna använder sig av masker."},{"page_url":"https://hr.wikipedia.org/wiki/Interpolacija","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Interpolation_example_linear.svg","page_title":"Interpolacija","context_page_description":"Interpolacija u matematičkom polju numeričke matematike označava metodu konstrukcije novih točaka podataka unutar raspona diskretnog skupa poznatih točaka podataka.\\nU inženjerstvu i znanosti interpolacija često ima mnogo točaka podataka prikupljenih uzorkovanjem ili eksperimentiranjem, te se njome pokušava konstruirati funkcija koja približno odgovara tim točkama podataka. To se naziva prilagodba krivulje ili regresijska analiza. Interpolacija je specifični slučaj prilagodbe krivulje u kojem funkcija mora točno prolaziti točkama podataka.\\nDrugi problem koji je blisko povezan s interpolacijom je aproksimacija složene funkcije jednostavnom funkcijom. Ako pretpostavimo da znamo funkciju koja je previše složena za učinkovitu procjenu, onda bismo mogli izabrati nekoliko poznatih točaka podataka iz složene funkcije, zatim izraditi preglednu tablicu i pokušati interpolirati te točke podataka radi konstrukcije jednostavnije funkcije."},{"page_url":"https://tt.wikipedia.org/wiki/Rusi%C3%A4g%C3%A4_qar%C5%9F%C4%B1_s%C3%A4wd%C3%A4_%C3%A7aralar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Flesh_mob_Boycott.jpg","page_title":"Rusiägä qarşı säwdä çaraları","context_page_description":"Rusiägä qarşı säwdä çaraları yäki \\"Rusiäneken satıp alma\\" şiğäre astında uza torğan çaralar - Evromäydan häm Könçığış Ukrainada qorallı nizağ näticäsendä Ukrainada Rusiägä qarşı başlanğan säwdä boykot çaraları. Boykotka \\"Vidsiç\\" digän ictimaği xäräkät çaqırdı, çaqırular Päräwez sotsial' çeltärlärendä taratıla.\\nĞomumi oçraqta bu çaralar Rusiä häm Ukraina arasında başlanğan säwdä suğışınıñ ber öleşe, çönki 2013 yıldan Rusiä tamğaxanä xezmäte Ukraina tawarları importın çikli başlıy.\\nÇaralar uzğanda Ukraina kibetlärendä satıla torğan Rusiädä citeşterelgän tawarlarda maxsus bilge - \\"Usal matröşka\\" berketep kürsätelä. Ütkärelgän tikşerenülär buyınça ukrainalılar 39 % ı çaranı yaqlıy.\\n\\"Vidsiç\\" digän säyäsi oyışma oyıştırğan Kievtağı çaralar:"},{"page_url":"https://de.wikipedia.org/wiki/Bristol_406","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Arnolt_Bristol_%27Bolide%27_engine%2C_1954.JPG","page_title":"Bristol 406","context_page_description":"Der Bristol 406 ist ein Oberklassefahrzeug des britischen Automobilherstellers Bristol Cars, das von 1958 bis 1961 in geringer Stückzahl produziert wurde. Er löste die viertürige Limousine 405 ab und begründete eine ganze Familie ähnlicher Modelle, die bis zum 411 Mk. 5 von 1975 reichte. Neben dem Serienmodell entstanden einige Sonderversionen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B0%D1%80%D1%88%D1%80%D1%83%D1%82_E36","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/BAB_13_Berstetal_%2802%29_2006-09-17.JPG","page_title":"Европейский маршрут E36","context_page_description":"Европейский маршрут Е36 — европейский автомобильный маршрут категории А, соединяющий города Берлин и Легница. Длина маршрута — 283 км."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BA%D0%BA%D1%83%D0%B0%D0%BF%D0%B5%D0%BD%D0%B4%D0%B5%D0%BD%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Acquapendente.jpg","page_title":"Аккуапенденте","context_page_description":"Аккуапенденте — муніципалітет в Італії, у регіоні Лаціо, провінція Вітербо.\\nАккуапенденте розташоване на відстані близько 110 км на північний захід від Рима, 45 км на північний захід від Вітербо.\\nНаселення — 5544 особи.\\nЩорічний фестиваль відбувається 28 серпня. Покровитель — Sant'Ermete."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D1%96%D0%B3%D0%BC%D0%B5_%D0%92%D0%B0%D0%BD%D0%B3%D1%87%D1%83%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Bhutan-Jigme-Wangchuck.jpg","page_title":"Джігме Вангчук","context_page_description":"Джігме Вангчук — другий король Бутану. 21 серпня 1926 року він зійшов на трон після свого батька, першого короля Уг'єн Вангчука."},{"page_url":"https://en.wikipedia.org/wiki/Tiger_Hill,_Darjeeling","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Tiger_Hill_Darjeeling_West_Bengal_India_%283%29.JPG","page_title":"Tiger Hill, Darjeeling","context_page_description":"Tiger Hill is located in Darjeeling, in the Indian State of West Bengal. It has a panoramic view of Mount Everest and Mount Kanchenjunga together."},{"page_url":"https://cs.wikipedia.org/wiki/Kabinet_m%C3%BAz","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Brno%2C_Sukova_4%2C_Kabinet_m%C3%BAz_%286892%29.jpg","page_title":"Kabinet múz","context_page_description":"Kabinet múz je brněnský kulturní prostor na ulici Sukova, v němž se konají divadelní představení, výstavy, koncerty a byla provozována i kavárna.\\nVznikl v roce 1991, až do roku 2003 zde sídlilo HaDivadlo, které se poté přesunulo do pasáže Alfa a v Kabinetu múz začalo fungovat Divadlo v 7 a půl. Kvůli dluhu na nájemném ale o tři roky později dostalo výpověď a prostor začala pro neveřejné zkoušky svých studentů využívat Divadelní fakulta Janáčkovy akademie múzických umění. Ta je ale v roce 2009 musela opustit opět kvůli výši nájemného. Až v roce 2012 se nový tým rozhodl provoz Kabinetu múz obnovit. Od září 2012 zde trvale působí Divadlo Feste. Od dubna roku 2016 zde působí pravidelný cyklus filmových projekcí pod názvem „Kabinet Filmúz“, který vedou Jan Churý a Jaromír Franta."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%BB%95%E7%8E%8B%E9%96%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%E5%8D%97%E6%98%8C%E8%85%BE%E7%8E%8B%E9%98%81.JPG","page_title":"滕王閣","context_page_description":"滕王閣は、中華人民共和国江西省南昌市にある楼閣。岳陽の岳陽楼、武漢の黄鶴楼と並んで、江南の三大名楼とされる。"},{"page_url":"https://da.wikipedia.org/wiki/Bratislava","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Apollo_bombing_damage.jpg","page_title":"Bratislava","context_page_description":"Bratislava er hovedstad og største by i Slovakiet med 429.564 indbyggere. Byen ligger i den sydvestlige del af Slovakiet på begge bredder af Donau. Byen grænser op til både Østrig og Ungarn og er dermed den eneste hovedstad, der grænser op til to andre lande.\\nBratislava er det politiske, kulturelle og økonomiske centrum i Slovakiet. Den er sæde for den slovakiske præsident, parlamentet og regeringen. Byen er ligeledes hjemsted for flere universiteter, museer, teatre, gallerier og andre vigtige økonomiske, kulturelle og uddannelsesmæssige institutioner. Hovedkvartererne for mange af Slovakiets store virksomheder og finansielle institutioner ligger ligeledes i Bratislava.\\nByens historie, i lang tid kendt under det tyske navn Pressburg, er blevet kraftigt påvirket af forskellige folkeslag, inklusiv østrigere, tjekker, tyskere, ungarere, jøder og slovakker. Byen var hovedstad i Kongeriget Ungarn under det Habsburgske monarki fra 1536 til 1783. Bratislava var hjemsted for den slovakiske nationale bevægelse i det 19. århundrede og mange vigtige historiske personer af slovakisk, ungarsk og tysk afstamning."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BF%AE%E9%81%93%E9%99%A2%E3%81%AE%E5%BA%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Mount_Grace_Priory_View_of_the_reconstructed_monk%27s_cell_from_its_associated_garden.JPG","page_title":"修道院の庭","context_page_description":"修道院の庭は多くの人々によってそして多くの目的のために使われました。多くの点で、 園芸は家庭に食料を提供するのが主な目的でしたが、果樹園、墓地、遊園、さらには薬用園および文化的用途も含みました。このガーデニングは植物のハーブ、果物、花、または野菜の意図的な栽培です。\\nさらに、修道院ではガーデニングが特に重要であり、修道士によって広く使用され、生活様式を作り出し、彼らの全体的な生計を支えています 。通常、栽培された果物、野菜、ハーブの多くは、果樹園で栽培された桃が出血性創傷の閉鎖治癒に使用されるなど、庭のさまざまな部分でさまざまな方法で利用されていました 。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%A8%D9%84%D9%82_%D8%AC%D8%A8%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Mountain_Wheatear.png","page_title":"أبلق جبلي","context_page_description":"أبلق جبلي ‏ هو نوع من الطيور يتبع جنس الأبلق من فصيلة صائدات الذباب."},{"page_url":"https://eo.wikipedia.org/wiki/D%C3%A9ville-l%C3%A8s-Rouen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/07_-_Le_Cailly_%C3%A0_D%C3%A9ville-les-Rouen.JPG","page_title":"Déville-lès-Rouen","context_page_description":"Déville-lès-Rouen estas franca komunumo situanta en departemento Seine-Maritime, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Dévillois."},{"page_url":"https://es.wikipedia.org/wiki/John_Swartzwelder","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/John_Swartzwelder_Brighter_Sharper.jpg","page_title":"John Swartzwelder","context_page_description":"John Swartzwelder es un guionista estadounidense, principalmente reconocido por su trabajo en la serie animada Los Simpson, y por su gran número de novelas escritas. Es el guionista de Los Simpson que más episodios ha escrito.​ Swartzwelder comenzó a formar parte de la serie por un anuncio publicado en la revista de George Meyer, Army Man."},{"page_url":"https://nl.wikipedia.org/wiki/Beulaville","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Map_of_USA_NC.svg","page_title":"Beulaville","context_page_description":"Beulaville is een plaats in de Amerikaanse staat North Carolina, en valt bestuurlijk gezien onder Duplin County."},{"page_url":"https://es.wikipedia.org/wiki/Centro_Deportivo_Mora%C4%8Da","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Mora%C4%8Da_Sports_Center.jpg","page_title":"Centro Deportivo Morača","context_page_description":"El Centro Deportivo Morača​ es un complejo deportivo situado en Podgorica, Montenegro. El lugar se encuentra en la parte nueva de Podgorica, en la margen derecha del río Moraca, del cual obtuvo su nombre. La construcción de este complejo deportivo se inició en 1978, y varias instalaciones deportivas se encuentran dispersas en un área de cinco hectáreas. La Instalaciones interiores consisten en: un Gran Salón ​ sala de formación, Pabellón de deportes de combate, piscina, sauna, Sala de ping-pong, servicios de negocios, tres piscinas al aire, canchas de tenis, de baloncesto, voleibol y balonmano."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Paul_de_Li%C3%A8ge","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Cath%C3%A9drale_Li%C3%A8ge_240809_16.jpg","page_title":"Cathédrale Saint-Paul de Liège","context_page_description":"La cathédrale Saint-Paul de Liège fait partie du patrimoine religieux de Liège. Fondée au Xᵉ siècle, elle est reconstruite du XIIIᵉ au XVᵉ siècle et restaurée au milieu du XIXᵉ siècle. Elle devient cathédrale au XIXᵉ siècle en raison de la destruction de la cathédrale Saint-Lambert en 1795. Une nouvelle restauration est entamée durant les années 2010."},{"page_url":"https://fr.wikipedia.org/wiki/All%C3%A9gories_des_cinq_sens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Jan_Brueghel_I_%26_Peter_Paul_Rubens_-_Taste_%28Museo_del_Prado%29.jpg","page_title":"Allégories des cinq sens","context_page_description":"Les Allégories des cinq sens sont une série de cinq tableaux mettant en scène les personnifications féminines des sens, peints par Jan Brueghel l'Ancien et Pierre Paul Rubens en 1617 et 1618 à Anvers.\\nIl s’agit de l’un des exemples les plus célèbres et les plus réussis de la collaboration de Brueghel avec Rubens, par ailleurs unis par une étroite amitié.\\nBien que la représentation des cinq sens sous les traits de personnages féminins remonte au XVIᵉ siècle, c'est Brueghel qui, le premier, prendra prétexte du thème pour mettre en scène des amoncellements d’œuvres d'art, d'instruments de musique, d'outils scientifiques et d'équipements militaires, accompagnés des fleurs de la terre et du produit de la chasse et de la pêche. Cette manière de traiter ce thème sera largement reprise dans la peinture flamande.\\nCette série de peintures est aujourd’hui exposée au musée du Prado, à Madrid, en Espagne."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%94%E1%83%9C%E1%83%98%E1%83%A1%E1%83%94%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Beldir.jpg","page_title":"ენისეი","context_page_description":"ენისეი — მსოფლიოს ერთ-ერთი უდიდესი მდინარე, მიედინება აღმოსავლეთ აზიაში. სათავეს იღებს მონღოლეთში, შემდეგ კვეთს რუსეთის ტერიტორიას და ჩაედინება ენისეის ყურეში.\\nმდინარის ზემოწელი საკმაოდ ჩქარია და მიედინება მეჩხერად დასახლებულ ტერიტორიებზე. შუაწელზე, რუსეთის ტერიტორიაზე, აშენებულია ჰიდროელექტროსადგურების მთელი კასკადი. მნიშვნელოვანი შენაკადებია: ანგარა, ქვემო ტუნგუსკა.\\nენისეის სიგრძეა 5,539 კმ, საშუალო სიღრმეა 14 მ. მაქსიმალური სიღრმე 24 მ. აუზის ფართობი 2,580,000 კმ²."},{"page_url":"https://en.wikipedia.org/wiki/Enrique_Amorim","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Enrique_Amorim.JPG","page_title":"Enrique Amorim","context_page_description":"Enrique Amorim was a Uruguayan novelist and writer, best known for his story Las quitanderas whose plot centres on rural prostitution; also known for his left-wing politics."},{"page_url":"https://pl.wikipedia.org/wiki/Jezus_chodzi_po_jeziorze","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Mainzer_Evangeliar.jpg","page_title":"Jezus chodzi po jeziorze","context_page_description":"Jezus chodzi po jeziorze − jeden z 37 cudów Jezusa opisanych w Ewangeliach kanonicznych. Opisy tego cudu znajdują się w ewangeliach: Marka, Mateusza i Jana."},{"page_url":"https://fr.wikipedia.org/wiki/Kiautschou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bundesarchiv_Bild_116-424-050%2C_China%2C_Tsingtau.jpg","page_title":"Kiautschou","context_page_description":"La concession de Kiautschou est un comptoir de l'empire colonial allemand loué à l'empereur de Chine. Il est situé dans le sud de la péninsule du Shandong, au nord-est de l'actuelle Chine. Sa ville principale était Qingdao."},{"page_url":"https://en.wikipedia.org/wiki/Hydra_(island)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hydra_%284694775050%29.jpg","page_title":"Hydra (island)","context_page_description":"Hydra is one of the Saronic Islands of Greece, located in the Aegean Sea between the Myrtoan Sea and the Argolic Gulf. It is separated from the Peloponnese by a narrow strip of water. In ancient times, the island was known as Hydrea, a reference to the natural springs on the island.\\nThe municipality of Hydra consists of the islands Hydra, Dokos, and a few uninhabited islets, total area 64.443 km². The province of Hydra was one of the provinces of the Argolis and Corinthia prefecture from 1833 to 1942, Attica prefecture from 1942 to 1964, Piraeus prefecture from 1964 to 1972 and then back to Attica as part of the newly establishment Piraeus prefecture of Attica prefecture. Its territory corresponded with that of the current municipality. It was abolished in 2006. Today the municipality of Hydra is part of Islands regional unit of Attica region.\\nThere is one main town, known simply as \\"Hydra port\\". It consists of a crescent-shaped harbor, around which is centered a strand of restaurants, shops, markets, and galleries that cater to tourists and locals. Steep stone streets lead up and outward from the harbor area."},{"page_url":"https://es.wikipedia.org/wiki/Chambray","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Map_commune_FR_insee_code_27140.png","page_title":"Chambray","context_page_description":"Chambray es una localidad y comuna francesa situada en la región de Alta Normandía, departamento de Eure, en el distrito de Évreux y cantón de Vernon-Nord."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%8C%EB%A6%AC_%EB%A7%A5%EC%BD%94%EB%B9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Willie_McCovey_2012.jpg","page_title":"윌리 맥코비","context_page_description":"윌리 리 맥코비는 전 메이저 리그 베이스볼 1루수이다. 19시즌 동안 샌프란시스코 자이언츠에서, 나머지 세 시즌 동안 샌디에이고 파드리스와 오클랜드 애슬레틱스에서 뛰었다. 좌투좌타였으며, 1986년에 미국 야구 명예의 전당에 입성했다.\\n2018년 10월 31일, 캘리포니아주의 스탠포드 병원에서 80세를 일기로 숨졌다."},{"page_url":"https://hu.wikipedia.org/wiki/Rekumbens","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Drei_Liegeradtypen_im_Vergleich-hu.png","page_title":"Rekumbens","context_page_description":"A rekumbens emberi erővel hajtott, kerekeken gördülő jármű, hátra döntött ülő- vagy fekvőpozícióval. A hagyományos kerékpárhoz képest nyereg helyett szövet vagy merev üléssel rendelkezik. A középcsapágy és a pedálok elöl helyezkednek el. A legtöbb rekumbenst nem nehezebb hajtani, mint a hagyományos kerékpárt, és a rekumbens típusától, valamint a kormányzási módtól függően gyorsan hozzá lehet szokni.\\nA Nemzetközi Kerékpáros-szövetség szabályzata, amely szerint a versenyeken csak gyémánt alakú vázzal rendelkező kerékpárok használata engedélyezett, kizárja a rekumbenseket a legtöbb versenyről."},{"page_url":"https://en.wikipedia.org/wiki/Zakaria_Diallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/CINvMTL_2019-05-11_-_Zakaria_Diallo_%2847962407541%29_%28cropped%29.jpg","page_title":"Zakaria Diallo","context_page_description":"Zakaria Diallo is a French-Senegalese professional footballer who plays as a defender for Lens in Ligue 2."},{"page_url":"https://es.wikipedia.org/wiki/Iridaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Schloss_vor_Husum-Krokusbluete.jpg","page_title":"Iridaceae","context_page_description":"Las iridáceas son una familia de plantas perennes, herbáceas y bulbosas pertenecientes al orden Asparagales dentro de las monocotiledóneas. La familia, cuyo nombre deriva del género Iris, cuenta con más de 2000 especies que se distribuyen por casi todo el mundo, siendo una de las familias más importantes en horticultura. Géneros tales como Crocus e Iris son componentes preponderantes de las floras de varias regiones de Eurasia e Iris se halla muy bien representado en Norte América. Gladiolus y Moraea son géneros muy amplios y componentes principales de la flora subsahariana y sudafricana. Sisyrinchium, con más de 140 especies, es el género de iridáceas más diversificado en América, donde también se encuentran varios otros miembros de la familia, muchos de los cuales son importantes en la floricultura tropical.​\\nActualmente se reconocen 66 géneros que se distribuyen entre siete subfamilias y ocupan una gran variedad de hábitats. La mayoría de las especies se adapta a climas estacionales que tienen un período de pronunciada sequía o frío desfavorables para el crecimiento vegetal y durante el cual las plantas permanecen latentes."},{"page_url":"https://fr.wikipedia.org/wiki/Val%C3%A9ria_Novodvorska%C3%AFa","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Valeriya_Novodvorskaya3.jpg","page_title":"Valéria Novodvorskaïa","context_page_description":"Valéria Ilinitchna Novodvorskaïa est une femme politique libérale russe, dissidente soviétique, fondatrice et présidente du parti Union démocratique, et membre du comité de rédaction de The New Times."},{"page_url":"https://en.wikipedia.org/wiki/R%C3%B8nne","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Bornholm_municipality_numbered.svg","page_title":"Rønne","context_page_description":"Rønne is the largest town on the Danish island of Bornholm in the Baltic Sea. It has a population of 13,772. Once a municipality in its own right from 1970 until 2002, when Bornholm was a county with an area of 29.11 square kilometres, it is now the administrative centre of the Bornholm municipality. As of 2018 11,539 inhabitants live in Rønne Parish, which is a narrow piece of land on the westernmost of the island and stretching north and southward comprising around a third of the area of the former municipality. Knudsker Parish made up the rest of the former municipality. Not all inhabitants of either Rønne or Knudsker parishes live in the city of Rønne.\\nOwing to its natural harbour and its strategic position in the Baltic Sea, Rønne has an interesting history coming under German and Swedish influence during its development as a herring fishing port. Today, with its cobbled streets, half-timbered houses and interesting museums, it attracts visitors mainly from Denmark, Germany, Sweden and Poland."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D9%86%D8%A7%D9%84%D8%AF_%D8%A8%D9%8A%D8%AA%D8%B1%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Ronald_Pettersson_SOK.jpg","page_title":"رونالد بيترسون","context_page_description":"رونالد بيترسون ‏ هو لاعب كرة قدم سويدي، شارك في الألعاب الأولمبية الشتوية 1964."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BA%D1%80%D0%B5%D1%82%D0%B8_%D0%BE%D1%82%D0%BF%D0%BE%D1%80%D0%B0_%D1%83_%D0%94%D1%80%D1%83%D0%B3%D0%BE%D0%BC_%D1%81%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%BC_%D1%80%D0%B0%D1%82%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Members_of_the_Maquis_in_La_Tresorerie.jpg","page_title":"Покрети отпора у Другом светском рату","context_page_description":"Покрети отпора у Другом светском рату јавили су се скоро у свакој окупираној земљи, у различитим видовима, од одбијања сарадње и противокупаторске пропаганде, преко скривања савезничких пилота, до отворених борби и ослобађања градова.\\nНајпознатији покрети отпора у Другом светском рату били су југословенски партизани, пољска Армија Крајова, совјетски партизани, француски покрет отпора, италијански ЦНЛ, норвешки покрет отпора, грчки отпор и холандски отпор."},{"page_url":"https://simple.wikipedia.org/wiki/Empire_of_Japan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Japanese_Empire_%28orthographic_projection%29.svg","page_title":"Empire of Japan","context_page_description":"The Empire of Japan was a government of the areas ruled by Japan during the period from the Meiji Restoration to the Japanese defeat in World War II. The Emperors during this time, were Emperor Meiji, Emperor Taishō and Emperor Shōwa. It is considered to go from the year 1868 to 1945.\\nIn those years, Japan changed very much. It became one of the most powerful countries in the world. Japan built a powerful army and navy, and changed from an agricultural to an industrial economy. The Japanese began to invade and occupy other near countries like Korea, Taiwan, and part of China to get resources.\\nThe Empire of Japan surrendered to the Allies on September 2, 1945 after the atomic bombings of Hiroshima and Nagasaki, after a long war against the Allied nations of World War II. The Allies occupied the country and led many changes, including a new constitution. Allied occupation and reconstruction of the country continued well into the 1950s."},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%A9vigny-la-For%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/S%C3%A9vigny-la-For%C3%AAt_%28Ardennes%29_%C3%A9glise_fa%C3%A7ade.JPG","page_title":"Sévigny-la-Forêt","context_page_description":"Sévigny-la-Forêt é uma comuna francesa na região administrativa de Grande Leste, no departamento das Ardenas. Estende-se por uma área de 26,13 km². Em 2010 a comuna tinha 259 habitantes."},{"page_url":"https://ms.wikipedia.org/wiki/Harrods","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/112407-Harrods-DiannaDodiMemorial2.jpg","page_title":"Harrods","context_page_description":"Harrods adalah sebuah gedung serbaneka terletak di Brompton Road di Knightsbridge, London, England. Jenama Harrods kuga digunakan pada usahawan lain diambil oleh kumpulan Harrods dari syarikat termasuk Harrods Bank, Harrods Estates, Harrods Aviation dan Air Harrods.\\nGedung ini menduduki sebuah tapak 4.5-ekar dan mempunyai melebihi satu juta kaki persegi dari ruang jualan di melebihi 330 jabatan. Ini membuat Harrods salah satu dari gedung serbaneka terbesar di dunia tetapi secara lebih kecil daripada Busan Mall yang luasnya 293,905 m² di Korea Selatan, secara rasmi gedung serbaneka terbesar di dunia. Kedai kedua terbesar di UK, Selfridges di Oxford Street, adalah sedikit melebihi setengah saiz dengan 540,000-kaki-persegi of selling space.\\nCogan kata Harrods adalah Omnia Omnibus Ubique — All Things for All People, Everywhere. Beberapa jabatannya, termasuk jabatan Krismas bermusim dan Food Hall, adalah masyhur dunia."},{"page_url":"https://en.wikipedia.org/wiki/Neve_Michael","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Pistacia_atlantica%2C_Elah_Valley%2C_June_2015.jpg","page_title":"Neve Michael","context_page_description":"Neve Michael also known as Roglit, is a moshav in central Israel. Located in the Adullam region and built upon an eminence in the far south-east end of the Elah Valley, close to where the historic fight between David and Goliath took place, it falls under the jurisdiction of Mateh Yehuda Regional Council. In 2019 it had a population of 849."},{"page_url":"https://tr.wikipedia.org/wiki/K%C4%B1z%C4%B1l_havaliman%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vladimir_Putin_in_Tuva_2007-1.jpg","page_title":"Kızıl havalimanı","context_page_description":"Kızıl Havalimanı Rusya'nın Kızıl kentindedir. İlk havayolu uçuşları 1946 yılında gerçekleşti. 2012 yılında havaalanı toplam yolcusu 13.200 kişidir."},{"page_url":"https://en.wikipedia.org/wiki/Incarvillea","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Incarvillea_delavayi_1.jpg","page_title":"Incarvillea","context_page_description":"Incarvillea is a genus of about 16 species of flowering plants in the family Bignoniaceae, native to central and eastern Asia, with most of the species growing at high altitudes in the Himalaya and Tibet. The most familiar species is Incarvillea delavayi, a garden plant commonly known as hardy gloxinia or Chinese trumpet flower. Unlike most other members of Bignoniaceae, which are mainly tropical woody plants, species of Incarvillea are herbs from temperate regions.\\nGenetic analysis supports the division of the genus into five clades: the subgenus Niedzwedzkia, the subgenus Amphicome, the subgenus Incarvillea, the subgenus Pteroscleris, and the species I. olgae, which does not fit into a subgenus. It may be given a subgenus of its own in a future study.\\nIncarvillea is named after the French Jesuit missionary and botanist Pierre Nicholas Le Chéron d'Incarville.\\nSpecies include:\\nIncarvillea altissima\\nIncarvillea arguta\\nIncarvillea beresowskii\\nIncarvillea compacta\\nIncarvillea delavayi\\nIncarvillea dissectifoliola\\nIncarvillea emodi Chatterjee\\nIncarvillea forrestii\\nIncarvillea lutea\\nIncarvillea mairei\\nIncarvillea olgae\\nIncarvillea potaninii\\nIncarvillea sinensis"},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_n%C3%A9o-classique_en_Belgique","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%C3%89curies_royales_de_Bruxelles_1.JPG","page_title":"Architecture néo-classique en Belgique","context_page_description":"L'architecture néo-classique apparaît en Belgique à l'époque des Pays-Bas autrichiens avec les œuvres des architectes Laurent-Benoît Dewez, Jean Faulte, Claude Fisco, Jean-Benoît-Vincent Barré, Barnabé Guimard, Charles De Wailly, Louis Montoyer...\\nElle connaîtra en Belgique une longévité exceptionnelle, se perpétuant à travers la période française, le Royaume-Uni des Pays-Bas, le règne de Léopold Iᵉʳ, le règne de Léopold II et même le XXᵉ siècle."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_Garc%C3%ADa_Marquina","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Francisco_Garc%C3%ADa_Marquina_03-05-2012.JPG","page_title":"Francisco García Marquina","context_page_description":"Francisco García Marquina es un escritor, biólogo y periodista español.​​"},{"page_url":"https://en.wikipedia.org/wiki/Diocesan_Museum_(Naples)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Decollazione_di_s_Gennaro_%28copia%29_diocesano_di_Napoli.jpg","page_title":"Diocesan Museum (Naples)","context_page_description":"The Diocesan Museum is the museum of the Roman Catholic Diocese of Naples, displaying paintings, reliquaries and bronzes previously housed in the Archepiscopal Palace, closed and suppressed churches in the Diocese or churches where it is too risky to display artworks. The paintings are mainly from the Neapolitan School, including works by Luca Giordano, Francesco Solimena, Massimo Stanzione, Aniello Falcone and Andrea Vaccaro.\\nIt was originally housed in the Archepiscopal Palace but due to an iniative by cardinal-archbishop Crescenzio Sepe it re-opened in the rooms behind the chancel of Santa Donna Regina Nuova and on a new mezzanine floor above the side chapels of its nave on 23 October 2007. The rooms above the side chapels are organised thematically, with a room each for the Passion of Christ, the Seven Sacraments, Martyrdom, the Life of Priests, Monks and Mendicants and the Seven Works of Pity. Other rooms house objets-d'art, such as two bronzes of St Candida of Naples and St Maximus by Giovan Domenico Vinaccia from Naples Cathedral, reliquaries, vestments and sculptures in wood and stone."},{"page_url":"https://vi.wikipedia.org/wiki/Ph%C3%B3_T%E1%BB%95ng_Th%C6%B0_k%C3%BD_Li%C3%AAn_Hi%E1%BB%87p_Qu%E1%BB%91c","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Jan_Eliasson_at_T%C3%A4llberg_Forum_2009_cropped.jpg","page_title":"Phó Tổng Thư ký Liên Hiệp Quốc","context_page_description":"Phó Tổng Thư ký Liên Hiệp Quốc là chức vụ cấp phó của Tổng Thư ký Liên Hiệp Quốc. Chức vụ được thành lập để giải quyết nhiều nhiệm vụ hành chính của Tổng Thư ký, hỗ trợ quản lý hoạt động của Ban Thư ký, và đảm bảo sự gắn kết các hành động và chương trình. Chức vụ được thành lập bởi Đại Hội đồng Liên Hiệp Quốc năm 1997.\\nAmina J. Mohammed từ Nigeria được bổ nhiệm làm Phó Tổng Thư ký bởi Tổng Thư ký António Guterres. Mohammed giữ chức vụ đồng thời cùng Guterres và bắt đầu nhiệm kỳ từ ngày 1/1/2017."},{"page_url":"https://hu.wikipedia.org/wiki/Ausztr%C3%A1lia_(orsz%C3%A1g)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Sydney_-from_a_ferry-1Aug2009.jpg","page_title":"Ausztrália (ország)","context_page_description":"Ausztrália, hivatalos nevén az Ausztrál Államszövetség független királyság, mely az ausztrál kontinenst, Tasmania szigetét és számos kisebb szigetet foglal magába. Területe alapján a világ hatodik legnagyobb országa. Északról Pápua Új-Guinea, Indonézia és Kelet-Timor; északkelet felől a Salamon-szigetek és Vanuatu; délkelet felől pedig Új-Zéland határolja tengeren. Fővárosa Canberra, és legnagyobb városa Sydney. Az ország a hatodik legnagyobb területű ország a Földön; az egyetlen olyan, amely egy egész kontinensre kiterjed, emellett Ausztrália és Óceánia legnagyobb országa. Az Egyenlítőtől délre, a 10. és a 40. szélességi kör között található.\\nA kontinens 1606-os holland hajósok által történt felfedezését követően 1770-ben keleti felét az angolok követelték és elkezdték betelepíteni ide az elítélteket, hogy velük kolonizálják Új-Dél-Wales területét 1788 január 26-át követően. Népessége fokozatosan emelkedett évtizedeken keresztül és az 1850-es évekre a kontinens nagy részét felfedezték és további öt önkormányzattal rendelkező királyi külbirtokot hoztak létre. 1901. január elsején a gyarmatok szövetségre léptek egymással és megalakították az Ausztrál Államközösséget."},{"page_url":"https://en.wikipedia.org/wiki/Bronze_Age","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/TimnaChalcolithicMine.JPG","page_title":"Bronze Age","context_page_description":"The Bronze Age is a historical period that was characterized by the use of bronze, in some areas proto-writing, and other early features of urban civilization. The Bronze Age is the second principal period of the three-age Stone-Bronze-Iron system, as proposed in modern times by Christian Jürgensen Thomsen, for classifying and studying ancient societies.\\nAn ancient civilization is defined to be in the Bronze Age either by producing bronze by smelting its own copper and alloying with tin, arsenic, or other metals, or by trading for bronze from production areas elsewhere. Bronze itself is harder and more durable than other metals available at the time, allowing Bronze Age civilizations to gain a technological advantage.\\nWhile terrestrial iron is naturally abundant, its high melting point of 1,538 °C placed it out of reach of common use until the end of the second millennium BC. Tin's low melting point of 231.9 °C and copper's relatively moderate melting point of 1,085 °C placed them within the capabilities of the Neolithic pottery kilns, which date back to 6000 BC and were able to produce temperatures greater than 900 °C."},{"page_url":"https://hu.wikipedia.org/wiki/L%C3%B3rif%C3%A9l%C3%A9k","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/LoryTongueLyd4.png","page_title":"Lórifélék","context_page_description":"A lórifélék a madarak osztályának papagájalakúak rendjébe tartozó család. Tizenkét nem és ötvennégy faj tartozik hozzá.\\nTöbb rendszerben a papagájfélék családjához sorolják alcsaládként."},{"page_url":"https://fr.wikipedia.org/wiki/Napol%C3%A9on_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Herzog_von_Reichstadt_auf_dem_Totenbett.jpg","page_title":"Napoléon II","context_page_description":"Napoléon François Joseph Charles Bonaparte, né le 20 mars 1811 au palais des Tuileries, à Paris, et mort le 22 juillet 1832 au palais de Schönbrunn, à Vienne, est le fils et l'héritier de Napoléon Iᵉʳ, empereur des Français, et de sa seconde épouse, Marie-Louise d'Autriche.\\nPrince impérial, il est titré roi de Rome à sa naissance.\\nEn 1814, il est évincé par le Sénat à la suite de la prise de Paris par les armées coalisées et de la première abdication de son père. En 1815, à la fin des Cent-Jours, il est proclamé successeur par son père, lors de la seconde abdication de ce dernier, sous le nom de Napoléon II. L'Assemblée, comme la commission censée régner en son nom, s'abstiennent cependant de proclamer officiellement comme empereur l'héritier impérial qui, âgé de 4 ans, se trouve alors en Autriche. Le « règne » de Napoléon II s'achève au bout de deux semaines lorsque Louis XVIII, soutenu par les armées coalisées, entre dans Paris.\\nIl porte ensuite le titre de prince de Parme, et enfin celui de duc de Reichstadt qui lui est donné par son grand-père l'empereur d'Autriche."},{"page_url":"https://nl.wikipedia.org/wiki/Drielandentrein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Passagiersinformatiesysteem.jpg","page_title":"Drielandentrein","context_page_description":"De Drielandentrein of LIMAX of Regional-Express is een treindienst uitgevoerd met Arriva FLIRT door Arriva in Duitsland, Nederland en gepland ook in België. Treinen vertrekken van het station Aachen Hauptbahnhof in de Duitse stad Aken via Heerlen naar Maastricht.\\nDe treindienst is voorbereid op verlenging naar station Luik-Guillemins in Luik. De totstandkoming van de treindienst is het gevolg van het programma EurekaRail waarin men goede grensoverschrijdende openbaarvervoerverbindingen tracht te realiseren. De Drielandentrein is onderdeel van het TEN-T netwerk.\\nDe naam LIMAX verwijst naar de drie grootste steden op het traject.\\nDe Drielandentrein rijdt één keer per uur tussen Maastricht en Aken en bovendien één keer per uur tussen Maastricht en Heerlen. De reistijd van het centraal station van Aken naar het station van Maastricht is 55 minuten.\\nLandelijke Nederlandse treinabonnementen zijn in de Drielandentrein niet alleen geldig binnen Nederland, maar ook voor een reis tussen Nederland en Duitsland."},{"page_url":"https://ceb.wikipedia.org/wiki/Mutinus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Mut.can.jpg","page_title":"Mutinus","context_page_description":"Henero sa mga uhong ang Mutinus. Ang Mutinus sakop sa kabanay nga Phallaceae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_im_Okres_Bratislava_I/G%E2%80%93J","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Hviezdoslavovo_12.jpg","page_title":"Liste der denkmalgeschützten Objekte im Okres Bratislava I/G–J","context_page_description":"Die Liste der denkmalgeschützten Objekte im Okres Bratislava I/G–J enthält die nach slowakischen Denkmalschutzvorschriften geschützten Objekte im Stadtbezirk Okres Bratislava I, der den Stadtteil Staré Mesto umfasst, in den Straßen beginnend mit den Buchstaben G bis J."},{"page_url":"https://es.wikipedia.org/wiki/Asociaci%C3%B3n_Deportiva_Barrio_M%C3%A9xico","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Municipal_San_Jos%C3%A9_1985.png","page_title":"Asociación Deportiva Barrio México","context_page_description":"La Asociación Barrio México es un equipo de fútbol costarricense de la ciudad de San José. Fue fundado en 1948 y refundado en el año 2018. Milita en la Segunda División de Costa Rica."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9F%E0%A7%87%E0%A6%A1%E0%A6%BF_%E0%A6%AC%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Making_of_a_teddy_bear_4_assembling.jpg","page_title":"টেডি বিয়ার","context_page_description":"টেডি বিয়ার হলো একরকম মমি-করা খেলনা ভালুকের পুতুল বা সফট টয়। বিশ শতকের প্রথম দশকে যুক্তরাষ্ট্রে মরিস মিচটম এবং জার্মানিতে রিচার্ড স্টিফ পৃথক পৃথকভাবে একইসময়ে এটি উদ্ভাবন করেন। মার্কিন প্রেসিডেন্ট থিওডোর \\"টেডি\\" রুজভেল্টের নামানুসারে নাম-রাখা এই টেডি বিয়ার ক্রমেই শিশুদের খেলনার প্রতীক হয়ে ওঠে এবং ছোটদের গল্প, গান আর ছবিতেও স্থান করে নেয়। প্রথমদিকে টেডিগুলো বাস্তব ভালুকছানাদের মতো করে বানানোর চেষ্টা ছিল, পরে ধীরে ধীরে তার রূপ, সজ্জা, রঙ এবং উপাদানে অনেক বৈচিত্র্য এসেছে। অ্যান্টিক সংগ্রাহকেরা খুব পুরনো বা দুর্লভ টেডিগুলো বহুমূল্যে সংগ্রহ করে থাকেন; কখনোবা সেসব নিলামেও ওঠে। এখনো ছোটোদের জন্য সবচেয়ে জনপ্রিয় উপহারগুলোর মধ্যে টেডি বিয়ার অন্যতম; আর বড়রাও ভালোবাসা প্রকাশে বা অভিনন্দন জানাতে একে অপরকে টেডি উপহার দিয়ে থাকেন।"},{"page_url":"https://fr.wikipedia.org/wiki/United_States_Marine_Band","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Marine_Band_playing_in_White_House_Cross_Hall_1988.jpg","page_title":"United States Marine Band","context_page_description":"L'United States Marine Band, couramment appelé \\"The President's Own\\", est une unité de musique du Corps des Marines des États-Unis. Il a été créé par un acte du Congrès le 11 juillet 1798 et est la plus ancienne organisation musicale professionnelle américaine. L'US Marine Band est la seule unité musicale à porter le titre de \\"The President’s Own\\" et sa mission est de jouer pour le Président des États-Unis et le Commandant du Corps des Marines. Aujourd'hui, le \\"The President's Own\\" comprend également un orchestre de chambre et des ensembles de chambre. Le band est distinct d'une unité sœur, le Drum and Bugle Corps, couramment appelée \\"The Commandant's Own\\".\\nIl y a douze bands actifs dans le corps des Marines, tous composé de Marines qui ont suivi le camp d'entrainement des recrues, puis la \\"A\\" school de l'École de musique de la marine à Norfolk.\\nThe Président's Own est une unité militaire. Ses membres sont des soldats d'active servant pour un contrat de quatre ans chez les Marines, cependant ils ne suivent par l'entrainement de recrutement des Marines.\\nL'U.S."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B4%D1%8F%D0%BD%D0%B5_(%D0%97%D0%BC%D1%96%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/St._Boris_and_Gleb_Nunnery_Vodianoe.JPG","page_title":"Водяне (Зміївський район)","context_page_description":"Водяне́ — село в Україні, Зміївському районі Харківської області. Населення становить 304 осіб. Орган місцевого самоврядування — Борівська сільська рада."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8A%E6%9C%AC%C2%B7%E7%9B%96%E6%AF%94%E9%B2%81%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ibn_Gabirol.JPG","page_title":"伊本·盖比鲁勒","context_page_description":"所羅門·伊本·蓋比魯勒，阿拉伯語稱艾布·阿尤布·蘇萊曼·伊本·葉海亞·伊本·蓋比魯勒，拉丁文稱阿維斯布隆，11世紀安達盧斯猶太學者。他代表了當時希伯來宗教詩和世俗詩的頂峰，同時還是一位重要的新柏拉圖主義哲學家，被譽為西班牙第一位哲學家。\\n出生於馬拉加，曾在薩拉戈薩接受高等教育。16歲時即以希伯來文寫宗教讚美詩，贏得聲譽。他的詩作極其豐富，但其詩集已失傳，殘存的世俗詩約有200餘首，題材極其廣泛。他不顧保護人的勸阻，熱衷於研究新柏拉圖主義。其哲學代表作《生命泉》是以拉丁文化名阿維斯布隆署名的。該作品對猶太教神秘主義喀巴拉派和基督教的經院哲學產生較大影響。"},{"page_url":"https://de.wikipedia.org/wiki/Abteikirche_Mozac","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/F08.Mozac.0192.JPG","page_title":"Abteikirche Mozac","context_page_description":"Die ehemalige Abteikirche Saint-Pierre und Saint-Caprais liegt inmitten der Ortschaft Mozac, einem unmittelbaren Vorort westlich von Riom in der Region Auvergne-Rhône-Alpes im Département Puy-de-Dôme, etwa zwanzig Kilometer nördlich von Clermont-Ferrand."},{"page_url":"https://it.wikipedia.org/wiki/Cristianesimo_negli_Stati_Uniti_d%27America","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Bethesda_Temple_Ap_Church_Dayton_OH.jpg","page_title":"Cristianesimo negli Stati Uniti d'America","context_page_description":"Il cristianesimo è la religione negli Stati Uniti d'America con il maggior numero di seguaci. Il 75% degli adulti americani intervistati nel 2015 si sono detti cristiani. Tuttavia questa percentuale è in calo rispetto all'85% del 1990, inferiore all'81,6% del 2001 e leggermente inferiore al 78% del 2012. Circa il 62% degli intervistati afferma di essere membro di una congregazione di chiese. Gli Stati Uniti d'America hanno la più grande popolazione cristiana al mondo, con quasi 240 milioni di cristiani, sebbene altri paesi abbiano percentuali più alte di cristiani rispetto alla popolazione.\\nTutte le denominazioni protestanti rappresentano il 46,5%. La Chiesa cattolica da sola rappresenta il 20,8% e ciò la rende la confessione individuale con il maggior numero di seguaci. Uno studio del Pew Research Center del 2014 identifica i protestanti evangelici bianchi, il 25,4% della popolazione, come la più grande corte religiosa del paese; un altro studio del 2004 stima i protestanti evangelici di tutte le razze tra il 30 e il 35%. La seconda chiesa più grande della nazione e la singola confessione protestante più grande è la Southern Baptist Convention."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Rheinfelden_(Baden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Rheinfelden_%28Baden%29_-_Bahnhofsgeb%C3%A4ude2.jpg","page_title":"Bahnhof Rheinfelden (Baden)","context_page_description":"Der Bahnhof Rheinfelden (Baden) ist der wichtigere der beiden Bahnhöfe der südbadischen Stadt Rheinfelden, in der Nähe der Grenze zwischen Deutschland und der Schweiz. Er liegt an der von Basel über Waldshut und Schaffhausen nach Konstanz führenden Hochrheinbahn. Der Bahnhof hatte ursprünglich die Aufgabe, das schweizerische Rheinfelden zu bedienen, da es das badische Rheinfelden beim Bau der Hochrheinbahn und des Bahnhofs noch nicht gab."},{"page_url":"https://en.wikipedia.org/wiki/Suriyothai","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Queen_Suriyothai_elephant_combat.jpg","page_title":"Suriyothai","context_page_description":"Suriyothai or Mahathewi was a royal queen consort during the 16th century Ayutthaya period of Siam. She is famous for having given up her life in the defense of her husband, King Maha Chakkraphat, in a battle during the Burmese–Siamese War.\\nSomdet Phra and Sri, pronounced and often transcribed Si, are her honorifics. Her given name Suriyothai สุริโยทัย means \\"dawn\\". It is a compound of Suriya, from Sanskrit surya सूर्य \\"sun\\"; plus Uthai from udaya उदय \\"rising\\", a cognate of Aurora and Ushas."},{"page_url":"https://de.wikipedia.org/wiki/Gerbillini","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Mongolische_Wuestenrennmaus.jpg","page_title":"Gerbillini","context_page_description":"Die Gerbillini umfassen hier im Rang einer Tribus die als „typisch“ bezeichneten Rennmäuse und gliedern sich in die „niederen Rennmäuse“, die „höheren Rennmäuse“ und die Buschschwanz-Rennmaus. Je nach Systematik wird für die „typischen Rennmäuse“ eine andere Rangstufe verwendet oder es werden ihnen weitere Rennmausarten zugeordnet.\\nIhr Verbreitungsgebiet sind das nördliche und das östliche Afrika sowie Asien östlich bis zur Mongolei, zur Mandschurei und bis Indien. In Asien sind sie aus dem Oberen Miozän, möglicherweise aus dem Unteren Pliozän und vom Oberen Pliozän bis zum Holozän bekannt, in Afrika vom Oberen Pliozän bis zum Holozän und im östlichen Europa aus dem Holozän.\\nMit etwa drei Vierteln der Arten machen sie den Großteil der Rennmäuse aus und sie sind sehr vielgestaltig. Hinsichtlich einiger wesentlicher Merkmale des Schädels und der Backenzähne umfassen sie sowohl die generalisiertesten als auch die spezialisiertesten Vertreter der Rennmäuse."},{"page_url":"https://en.wikipedia.org/wiki/Kankhal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Front_facade_of_Naya_Udasin_Akhara%2C_Kankhal.JPG","page_title":"Kankhal","context_page_description":"Kankhal is a small colony in Haridwar in the Haridwar district of Uttarakhand state in India.\\nMentioned in the Vayu Purana and the Mahabharata as Kanakhala, Kankhal is one of 'Panch Tirth' within Haridwar, with other spots being Gangadwara, Kushwart, Bilwa Teerth and Neel Parvat.\\nIt is most known for the Daksheswara Mahadev Temple, Maa Anandamoyi Ashram and numerous other ashrams and old houses with exquisite wall paintings built by Hindu pilgrims in the 19th century."},{"page_url":"https://en.wikipedia.org/wiki/Mouna_Esmaeilzadeh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Mouna_Esmaeilzadeh.jpg","page_title":"Mouna Esmaeilzadeh","context_page_description":"Mouna Esmaeilzadeh is a medical doctor, neuroscientist, entrepreneur and TV personality. She has a Ph.D. in neuroscience from Stockholm Brain Institute at Karolinska Institutet in Stockholm. She oftne appears on Swedish TV covering science and technology."},{"page_url":"https://de.wikipedia.org/wiki/Kotohira_(Kagawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Zozusan_01.JPG","page_title":"Kotohira (Kagawa)","context_page_description":"Kotohira ist eine Stadt im Landkreis Nakatado der Präfektur Kagawa in Japan. Bürgermeister ist Masato Ono. Die Stadt wurde nach einem alten Meeresgott, Kotohiragu, benannt."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%91%D7%9C_%D7%A9%D7%A4%D7%95%D7%A0%D7%92%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Chelsea_Vs_Maccabi_Tel-Aviv_%2821306117739%29.jpg","page_title":"יובל שפונגין","context_page_description":"יובל שפונגין הוא כדורגלן ישראלי המשחק בעמדת המגן הימני בהפועל כפר שלם מליגה א' דרום."},{"page_url":"https://sv.wikipedia.org/wiki/G%C3%B6ta_tr%C3%A4ngregementes_kompani_i_Nora","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Minnessten_G%C3%B6ta_tr%C3%A4ngregementes_kompani_i_Nora_augusti_2019_%2801%29.jpg","page_title":"Göta trängregementes kompani i Nora","context_page_description":"Göta trängregementes kompani i Nora var ett trängförband inom svenska armén som verkade i olika former åren 1945–1952. Förbandsledningen var förlagd i Nora."},{"page_url":"https://es.wikipedia.org/wiki/Budweiser_(Anheuser-Busch)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Budweiser_beer.jpg","page_title":"Budweiser (Anheuser-Busch)","context_page_description":"Budweiser (Anheuser-Busch) es una cerveza de origen checo, patentada en los Estados Unidos y una de las más populares en dicho país. Budweiser se hace con una proporción de arroz​ de hasta un 30%, además de lúpulo y malta de cebada. Budweiser se produce en varias fábricas. Es una cerveza filtrada disponible en forma de barril y envasado. En los Estados Unidos tiene un 5% de alcohol en volumen y 145 calorías por cada 12 oz, excepto en Utah, Minnesota, Kansas y Oklahoma, donde tiene un 3,2% de alcohol en peso debido a las leyes estatales.​ Minnesota y Colorado exigen 5,2% de alcohol en la cerveza de venta en los eventos públicos, así como en los supermercados y gasolineras."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_voos_espaciais_tripulados","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Apollo_14_crew.jpg","page_title":"Lista de voos espaciais tripulados","context_page_description":"Esta lista contém todos os voos espaciais tripulados organizados por data de lançamento, que tem ocorrido nos últimos 59 anos, 4 meses e 17 dias desde o lançamento de Yuri Gagarin na Vostok 1. Esse artigo usa como base a listagem do Spacefacts, a lista inicial só foca nos voos acima dos 100 km, linha de Kármán, seguindo por voos futuros, suborbitais, com a área de programas usando como base as datas das listas iniciais.."},{"page_url":"https://cs.wikipedia.org/wiki/Klemens_Wenzel_von_Metternich","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Mauzoleum_Metternicha.jpg","page_title":"Klemens Wenzel von Metternich","context_page_description":"Klemens Wenzel Nepomuk Lothar kníže z Metternich-Winneburgu, vévoda z Portelly, hrabě z Kynžvartu, od roku 1814 kníže byl rakouský šlechtic, politik a diplomat."},{"page_url":"https://pl.wikipedia.org/wiki/Johann_Georg_Thomschansky","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Portret_Johanna_Kretschmera.jpg","page_title":"Johann Georg Thomschansky","context_page_description":"Johann Georg Thomschansky – wrocławski malarz niemiecki.\\nBył głównie portrecistą ale malował również obrazy religijne: Święty Paweł i Święty Franciszek oraz historyczne: cykl sześciu malowideł Historia Aleksandra Macedońskiego wykonanych na podstawie rycin Charles'a le Bruna dla jednego ze śląskich pałaców oraz Apoteoza cesarza Leopolda I wykonany dla Sali Rady w ratuszu wrocławskim."},{"page_url":"https://sk.wikipedia.org/wiki/Burgauberg-Neudauberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/AUT_Burgauberg-Neudauberg_COA.jpg","page_title":"Burgauberg-Neudauberg","context_page_description":"Burgauberg-Neudauberg je obec v Rakúsku v spolkovej krajine Burgenland v okrese Güssing.\\nŽije tu 1 360 obyvateľov."},{"page_url":"https://en.wikipedia.org/wiki/List_of_marine_aquarium_fish_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Dascyllus_trimaculatus.JPG","page_title":"List of marine aquarium fish species","context_page_description":"The following list of marine aquarium fish species commonly available in the aquarium trade is not a completely comprehensive list; certain rare specimens may available commercially yet not be listed here. A brief section on each, with a link to the page about the particular species is provided along with references for further information."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A4%BE%E4%BC%9A%E7%9A%84%E5%AD%A6%E7%BF%92%E7%90%86%E8%AB%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Bobo_Doll_Deneyi.jpg","page_title":"社会的学習理論","context_page_description":"社会的学習理論は、学習過程と社会的行動における理論であり、人は他者を観察し模倣することによっても新しい行動を獲得できるとするもの。行動は強化によってのみ決定されるとする伝統的な行動理論を拡張し、学習者における様々な内的過程の役割に重点を置いた理論となる。メディアの暴力シーンが人々の暴力行動へと及ぼす影響の研究において、広く適用されてきた。"},{"page_url":"https://da.wikipedia.org/wiki/Bistrup_Kirke_(Rudersdal_Kommune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bistrup_Kirke_2007.jpg","page_title":"Bistrup Kirke (Rudersdal Kommune)","context_page_description":"Bistrup Kirke er kirke for Bistrup Sogn i Birkerød-bydelen Bistrup.\\nPå grund af befolkningstilvækst i Birkerød-området i 1950'erne tog sognepræsten i Birkerød, Johan C. Schwarz-Nielsen, initiativ til, at der skulle bygges en kirke i Bistrup-området.\\nDen er en såkaldt \\"selvbyggerkirke\\" bygget 1962–67 og var den første danske selvbyggerkirke i 800 år. Selvbyggeriet var en konsekvens af Regeringen Jens Otto Krag I's byggestop, der blev indført i november 1962 og betød et midlertidigt stop for offentlige byggerier. Med pastor Schwarz-Nielsen i spidsen foreslog en gruppe borgere at opføre kirken uden brug af håndværkere. Kirkeministeriet gav accept til initiativet og en række byggehold arbejdede nu i fem år hver aften fra 19 til 22. Der var i alt ca. 120 mennesker på de seks byggehold, og de kom til at arbejde en aften om ugen.\\nKirkens menighed indsamlede selv en meget stor del af de midler, der var nødvendige for byggeriet. Det skete bl.a. ved husindsamlinger og årlige sommerfester. Det frivillige menighedsarbejde tog senere initiativ til opførelse af en vuggestue og en børnehave."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%81%D9%8A%D9%86%D8%A9_%D8%A5%D9%8A_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/E-Ship_1_achtern.JPG","page_title":"سفينة إي 1","context_page_description":"سفينة إي 1 هي سفينة شحن من سفن الدحرجة قامت بأول رحلة لنقل البضائع في أغسطس 2010. السفينة مملوكة لثالث أكبر شركة مصنعة لتوربينات الرياح، إنركون الألمانية. يتم استخدامها لنقل مكونات توربينات الرياح. السفينة إي 1 هي سفينة دوارة: يتم تدوير أربعة دوارات كبيرة من على سطحها عبر وصلة ميكانيكية إلى مراوح السفينة. تساعد الأشرعة أو دوارات على دفع السفينة عن طريق تأثير ماغنوس - القوة العمودية التي تمارس على جسم دوار يتحرك عبر مجرى مائع."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%BD%D1%88%D1%82%D0%B5%D1%82_(%D0%94%D0%BE%D1%9A%D0%B0_%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Barnstedter_Bach.JPG","page_title":"Барнштет (Доња Саксонија)","context_page_description":"Барнштет град је у њемачкој савезној држави Доња Саксонија. Једно је од 43 општинска средишта округа Линебург. Према процјени из 2010. у граду је живјело 769 становника. Посједује регионалну шифру 3355006."},{"page_url":"https://fr.wikipedia.org/wiki/Manchester","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/City_of_Manchester_Stadium_2.jpg","page_title":"Manchester","context_page_description":"Manchester [manʃɛstœʁ] est une ville du Royaume-Uni située dans le comté métropolitain du Grand Manchester. Elle a le statut de cité depuis 1853 et compte 545 500 habitants en 2017, avec une population urbaine de 3,2 millions. Elle est parfois considérée comme la « deuxième ville d’Angleterre » grâce à son importance économique, culturelle et sportive, bien que sa superficie et sa population ne lui permettent pas de détrôner Birmingham. Manchester est catégorisée comme une ville « bêta » par Le GaWC. Ses habitants s'appellent les Mancuniens. La ville est au cœur d'une grande agglomération de plus de deux millions et demi d'habitants dont les villes principales sont : Bury, Bolton, Rochdale, Oldham, Ashton-under-Lyne, Stockport, Salford, Altrincham, Wigan. Le nom de « Manchester » est utilisé aussi bien pour désigner l'agglomération que la ville en tant que telle.\\nManchester est située à 260 km au nord-ouest de Londres, sur la rive est de la rivière Irwell. La ville est bordée au Sud par la plaine du Cheshire et au nord et à l'est par la chaîne montagneuse des Pennines."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Oberfranken","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Kirchplatz_6_-_8_%28Gr%C3%A4fenberg%29.JPG","page_title":"Liste von Burgen und Schlössern in Oberfranken","context_page_description":"Die Liste von Burgen und Schlössern in Oberfranken ist ein Verzeichnis von historischen Orten, wie Burgen, Schlössern, Herrensitzen, Festungen, Motten, Burgställen und Wehrkirchen auf dem Territorium des heutigen Regierungsbezirks Oberfranken, aufgeteilt in kreisfreie Städte und Landkreise. Es gibt weitere Listen für die Regierungsbezirke Oberbayern, Niederbayern, Oberpfalz, Mittelfranken, Unterfranken und Schwaben. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Untertauern","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Expositurhaus_Bergheim.jpg","page_title":"Liste der denkmalgeschützten Objekte in Untertauern","context_page_description":"Die Liste der denkmalgeschützten Objekte in Untertauern enthält die 11 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Untertauern. Mit 2010 traten in Untertauern neue Hausnummern in Kraft, die hier verwendet werden, obwohl sie vom BDA noch nicht in die Denkmallisten aufgenommen wurden."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_2009_des_Indians_de_Cleveland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kerry_Wood_2008.jpg","page_title":"Saison 2009 des Indians de Cleveland","context_page_description":"La saison 2009 des Indians de Cleveland est la 109ᵉ saison en ligue majeure pour cette franchise qui reste sur une saison 2008 en demi-teinte.\\nL'inter-saison est marquée par le retour des Indians en Cactus League après avoir passé 14 saisons en Grapefruit League.\\nAfin d'honorer la mémoire d'Herb Score, ancien joueur des Indians de 1955 à 1959 puis commentateur des matchs de la franchise de 1964 à 1997, les joueurs arborent un patch comprenant son numéro de joueur, un micro et le nom « HERB ».\\nIl s'agit de la dernière saison d'Eric Wedge comme manager des Indians. Il est remercié à l'issue d'une saison très décevante au niveau sportif. Les Indians enregistrent 1 766 241 spectateurs payants pour 79 matches à Progressive Field, soit une moyenne par rencontre de 22 357. C'est une baisse d'environ 17 % par rapport à la saison précédente."},{"page_url":"https://sv.wikipedia.org/wiki/Carl_Fridolf_Carlson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Carl_Fridolf_Carlson.png","page_title":"Carl Fridolf Carlson","context_page_description":"Carl Fridolf Carlson, född 1870 och död 1925, var en svensk-tysk skeppsbyggare.\\nCarlson studerade vid Chalmers tekniska läroanstalt i Göteborg och flyttade 1894 till Tyskland. Där var Carlson 1895-98 anställd vid Germaniavarvet i Kiel och kom 1898 till Schichauvarvet i Elbing. 1902 blev han delägare i firman och övertog 1917 hela ledningen efter sin då avlidne svärfar, Carl H. Zeise. Carlssons insats i tyskt skeppsbyggeri har varit betydande, trots att han under senare år hade stora svårighet under förhållandena efter första världskriget."},{"page_url":"https://et.wikipedia.org/wiki/Annas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Annas_mui%C5%BEas_saimniec%C4%ABbas_%C4%93ka_2002-05-04.jpg","page_title":"Annas","context_page_description":"Annas on küla Lätis Amata piirkonnas Zaube vallas. Annas asub valla põhjaosas merepinnast 213 meetri kõrgusel Nelabaise järve põhja- ja idakaldal. Küla jääb valla keskusest Zaubest 10, piirkonna keskusest Ausmasest 39 ja Riiast 94 kilomeetri kaugusele.\\nAnnas on tekkinud endise Anna mõisa keskuse juurde. Aastal 1793 asus sinna elama Garlieb Merkel, kes töötas Transehede juures koduõpetajana. Seal valmis ka tema teos Die Letten, vorzüglich in Liefland, am Ende des philosophischen Jahrhunderts.\\nKülas asuvad Anna mõisa muinaskalmed ehk Kirikumägi on arheoloogiamälestisena kohaliku kaitse all.\\nAastal 2019 oli külas 13 elanikku."},{"page_url":"https://fi.wikipedia.org/wiki/Espanjan_p%C3%A4%C3%A4ministeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jose_Zapatero_by_Monika_Flueckiger.jpg","page_title":"Espanjan pääministeri","context_page_description":"Espanjan pääministeri on Espanjan hallituksen puheenjohtaja. Nykyinen virka muodostettiin vuoden 1978 perustuslaissa, ja sitä on 1. kesäkuuta 2018 lähtien pitänyt hallussaan Pedro Sánchez. Pääministerin virka-asuntona toimii Moncloan palatsi Madridissa."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_byggnadsminnen_i_J%C3%A4mtlands_l%C3%A4n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/%C3%85re%2C_L%C3%A4karvillan.jpg","page_title":"Lista över byggnadsminnen i Jämtlands län","context_page_description":"Förteckning över byggnadsminnen i Jämtlands län."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Schr%C3%B6der_I","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Otto_Schily_MUC-20050910-02.jpg","page_title":"Kabinett Schröder I","context_page_description":"„Kabinett Schröder I“ ist eine gängige Bezeichnung für die erste rot-grüne Bundesregierung der Bundesrepublik Deutschland, die vom 27. Oktober 1998 bis zum 22. Oktober 2002 im Amt war. Sie wurde nach der Wahl zum 14. Deutschen Bundestag am 27. September 1998 gebildet und löste das Kabinett Kohl V ab.\\nAus der Bundestagswahl gingen die SPD und Bündnis 90/Die Grünen als Sieger hervor. Sie bildeten gemeinsam eine Regierung und beendeten die „Ära Kohl“; das von Bundeskanzler Helmut Kohl geführte Bündnis der Unionsparteien mit der FDP musste nach 16 Jahren in der Regierungsverantwortung den Gang in die Opposition antreten.\\nAm 27. Oktober 1998 wurde Gerhard Schröder gemäß Art. 63 Abs. 1 des Grundgesetzes auf Vorschlag von Bundespräsident Roman Herzog vom Bundestag zum siebten Bundeskanzler der Bundesrepublik Deutschland gewählt. Anschließend ernannte der Bundespräsident auf Vorschlag des Bundeskanzlers die Bundesminister der neuen Regierung.\\nDie Amtszeit der Regierung endete formell mit dem Zusammentritt des 15. Deutschen Bundestages am 17. Oktober 2002. Der Bundeskanzler und die Bundesminister blieben geschäftsführend im Amt, bis am 22."},{"page_url":"https://gl.wikipedia.org/wiki/O_reino_de_Galicia_e_a_historiograf%C3%ADa_tradicional_espa%C3%B1ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Fernando_II_de_Galicia_e_Leon_no_tombo_A.jpg","page_title":"O reino de Galicia e a historiografía tradicional española","context_page_description":"A primeira referencia historiográfica explícita sobre a existencia do reino de Galicia áchase nun texto do século VI. Naquel tempo o bispo francés Gregorio de Tours, na súa obra Historia Francorum, denominou galliciensim regnum ao estado creado polo pobo xermánico dos suevos na provincia romana da Gallaecia. Este reino galego altomedieval perviviu, con dimensións e significados cambiantes, desde a época sueva até o século XIX, momento no que nunha reforma administrativa, a tradicional organización en reinos da monarquía hispana foi substituída por unha estrutura provincial centralizada.\\nMalia a este dilatado lapso temporal, e á existencia de abondosas alusións documentais, os historiadores españois dos séculos XIX e XX substituíron as referencias ao reino galego medieval polas denominacións de reino de Asturias e reino de León, sendo o territorio da Galicia actual presentado como un espazo subsidiario de escasa importancia. A contradición entre esta visión historiográfica e a realidade presentada polos documentos históricos foi denunciada por unha parte dos estudosos galegos e non deixou de ser recoñecida, dun ou outro xeito, polos propios historiadores que a propagaron."},{"page_url":"https://es.wikipedia.org/wiki/Takuro_Fujii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Takuro_Fujii_2016.jpg","page_title":"Takuro Fujii","context_page_description":"Takuro Fujii es un nadador japonés especializado en pruebas de corta distancia estilo libre y estilo mariposa, donde consiguió ser subcampeón olímpico en 2012 en los .​"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Zion_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Grotto_Campground_S_comfort_sta_NPS.jpg","page_title":"National Register of Historic Places listings in Zion National Park","context_page_description":"This is a list of the National Register of Historic Places listings in Zion National Park.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Zion National Park, Utah, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a Google map.\\nThere are 29 properties and districts listed on the National Register in the park, 25 located within Washington County and three within Kane County. The latter three are structures at the East Entrance to the park. A small portion of the park extends north into Iron County but includes no National Register-listed places. The town closest by any practical route to all of these is Springdale, Utah.\\nThis list is sorted alphabetically. Discussion of most of these, organized by type of property instead, is also provided in the following article: Historical buildings and structures of Zion National Park.\\nThis National Park Service list is complete through NPS recent listings posted August 14, 2020."},{"page_url":"https://cs.wikipedia.org/wiki/Genco_Gulan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Twin_Project.JPG","page_title":"Genco Gulan","context_page_description":"Genco Gulan je turecký sochař, malíř, fotograf a spisovatel."},{"page_url":"https://ja.wikipedia.org/wiki/P2102V","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/P2102V_display.jpg","page_title":"P2102V","context_page_description":"FOMA P2102Vは、パナソニック モバイルコミュニケーションズによって開発された、NTTドコモの第三世代携帯電話「FOMA」端末である。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9D%92%E5%B2%9B%E5%B8%82%E5%8E%86%E5%8F%B2%E4%BC%98%E7%A7%80%E5%BB%BA%E7%AD%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%E9%9D%92%E5%B2%9B%E5%B1%B1%E7%82%AE%E5%8F%B0%E8%A3%85%E7%94%B2%E7%9E%AD%E6%9C%9B%E5%8F%B0_2020-01-01.jpg","page_title":"青岛市历史优秀建筑","context_page_description":"青島市歷史優秀建築為青島市境內經青島市人民政府許可對外公布，受《山東省歷史文化名城保護條例》、《青島市城市風貌保護條例》、《青島市歷史建築保護管理辦法》等法律法規保護的一部分歷史建築，至今已公布兩批，共313處，其中包括部分各級文物保護單位。"},{"page_url":"https://nl.wikipedia.org/wiki/Sultanaat_Langkat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/COLLECTIE_TROPENMUSEUM_Laan_bij_het_paleis_van_de_Sultan_van_Langkat_Tandjoengpoera_TMnr_60021734.jpg","page_title":"Sultanaat Langkat","context_page_description":"Langkat is een sultanaat ten oosten van Medan op Sumatra. Het is zeer rijk geworden dankzij de olie-concessies aan de voorloper van Shell, namelijk de Bataafse Petroleum Maatschappij.\\nHet sultanaat dateert van voor de invoering van de islam op Sumatra. De eerste geschreven bronnen over dit sultanaat dateren echter uit de 17e eeuw. Het was oorspronkelijk een ondersultanaat van Atjeh, later van Siak toen de macht van Atjeh afnam door de strijd tegen de Nederlanders. In 1869 voelde de sultan zich dermate zelfstandig dat hij met het Nederlandse koloniale bestuur een contract afsloot; vervolgens erkenden de Nederlanders de sultan als heerser over dit gebied in 1887. Het contract had mede ten doel dat er plantages konden worden aangelegd en dat de sultan de pachtgelden hiervoor ontving. Kort daarop werd er echter ook olie gevonden, die zeer veel inkomsten bracht voor de sultan.\\nOverigens gebruikt men naast de titel sultan ook raja of sri en noemt men zich het Koninklijk Huis van Langkat. Vele familieleden van de sultan zijn vermoord tijdens de Indonesische onafhankelijkheidsstrijd ofschoon zij zich neutraal opstelden."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B9%D0%BD-%D0%9A%D0%BE%D1%83%D0%B2_(%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Lane_Cove_NP_2016_%2804%29.jpg","page_title":"Лейн-Коув (національний парк)","context_page_description":"Лейн-Коув — національний парк у межах Сіднейської агломерації. Національний парк площею 372 гектари розташований приблизно за 10 кілометрів на північний захід від центрального ділового району Сіднею та включає в себе території, які є частиною міських районів Ку-ринг-гай, Райд і Хорнсбі, а також невеликі ділянки в районах Віллоубі, Лейн-Коув і Хантерс-Хілл.\\nПарк містить різні типи рослинності, тут є склерофітний ліс, пустища, мангрові дерева та ватти. Парк простягнувся вздовж берегів річки Лейн-Коув, яка тече, як правило, на південний схід, та впадає в затоку Порт-Джексон."},{"page_url":"https://id.wikipedia.org/wiki/Pola_geometri_Islam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Samarkand_Bibi_Khanum_Mosque_Minaret_Detail.JPG","page_title":"Pola geometri Islam","context_page_description":"Dekorasi Islam, yang cenderung menghindari gambar-gambar figuratif, menyebabkan seringnya penggunaan pola geometri yang telah berkembang selama berabad-abad.\\nDesain geometri dalam seni Islam kerapkali di bentuk dari perpaduan pengulangan bentuk persegi dan lingkaran, yang saling menjalin dan meliputi, sebagaimana arabasque, menjadi bentuk pola yang rumit dan kompleks, termasuk sebuah luasnya ragam mosaik. Ini dapat di angkat menjadi dekorasi sepenuhnya, berawal dari bentuk kerangka pembubuhan pola floral atau kaligrafi, atau dapat di tempatkan di latar menjadi latar belakang mengelilingi motif lainnya. Kerumitan dan keragaman pola yang digunakan berubah secara perlahan dari bentuk bintang sederhana dan belah ketupat di abad ke sembilan, hingga banyak pola sudut bintang beragam dari 6 hingga 13 diciptakan di abad ke tiga belas, dan akhirnya termasuk juga bintang dengan banyak sudut 14 dan 16 di abad ke enam belas.\\nPola geometri terdapat dalam beragam bentuk di seni Islam dan ilmu arsitektur termasuk karpet kilim, ubin girih Persia dan zellige Maroko, kubah dekoratif muqarnas, lapis batu jali tembus pandang, keramik, kulit, kaca warna, kayu, dan hasil besi."},{"page_url":"https://en.wikipedia.org/wiki/Deutsche_Bank","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Deutsche_Bank_Taunusanlage.jpg","page_title":"Deutsche Bank","context_page_description":"Deutsche Bank AG is a multinational investment bank and financial services company headquartered in Frankfurt, Germany, and dual-listed in New York Stock Exchange and Frankfurt Stock Exchange.\\nThe bank's network spans 58 countries with a large presence in Europe, the Americas and Asia. As of 2017–2018, Deutsche Bank was the 17th largest bank in the world by total assets. As the largest German banking institution, it is a component of the DAX stock market index.\\nThe company is a universal bank with three major divisions: the Private & Commercial Bank, the Corporate & Investment Bank, and Asset Management. Its investment banking operations often command substantial deal flow."},{"page_url":"https://hsb.wikipedia.org/wiki/Hruba_dornica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Felo_001_shp.jpg","page_title":"Hruba dornica","context_page_description":"Hruba dornica je rostlina ze swójby słódkich trawow."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B6%D0%BD%D1%8F_%D0%90%D0%B2%D1%81%D1%82%D1%80%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/WrNeustadtHauptplatz051027a.jpg","page_title":"Нижня Австрія","context_page_description":"Нижня Австрія — федеральна земля на північному сході Австрії. Є найбільшою провінцією Австрії. Столиця і найбільше місто — Санкт-Пельтен."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%B1%D8%AA%D8%B1%D8%A7%D9%86%D8%AF%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bertrandite-38545.jpg","page_title":"بيرترانديت","context_page_description":"البيرترانديت هو معدن هيدروكسيدي من معادن السيليكات للبيريليوم، له التركيب Be₄Si₂O₇(OH)₂."},{"page_url":"https://en.wikipedia.org/wiki/Morphometrics","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/BirdMorphometrics.jpg","page_title":"Morphometrics","context_page_description":"Morphometrics or morphometry refers to the quantitative analysis of form, a concept that encompasses size and shape. Morphometric analyses are commonly performed on organisms, and are useful in analyzing their fossil record, the impact of mutations on shape, developmental changes in form, covariances between ecological factors and shape, as well for estimating quantitative-genetic parameters of shape. Morphometrics can be used to quantify a trait of evolutionary significance, and by detecting changes in the shape, deduce something of their ontogeny, function or evolutionary relationships. A major objective of morphometrics is to statistically test hypotheses about the factors that affect shape.\\n\\"Morphometrics\\", in the broader sense, is also used to precisely locate certain areas of organs such as the brain, and in describing the shapes of other things."},{"page_url":"https://fr.wikipedia.org/wiki/Pyr%C3%A9n%C3%A9es","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ca%C3%B1on_de_A%C3%B1isclo.jpg","page_title":"Pyrénées","context_page_description":"Les Pyrénées sont une chaîne montagneuse du sud-ouest de l'Europe. Elles s'étendent en longueur selon une direction est-ouest sur une distance approximative de 430 kilomètres depuis la mer Méditerranée jusqu'au golfe de Gascogne. Culminant à 3 404 mètres d'altitude au pic d'Aneto, les Pyrénées forment une barrière géographique séparant la péninsule Ibérique au sud du reste de l'Europe continentale au nord. Elles constituent une frontière naturelle entre l'Espagne et la France et abritent aussi la principauté d’Andorre.\\nLa chaîne des Pyrénées traverse deux régions et six départements français : d’est en ouest les régions Occitanie et Nouvelle-Aquitaine. Côté espagnol, elle traverse quatre communautés autonomes et sept provinces d'Espagne : d’est en ouest la Catalogne, l'Aragon, la Navarre et la Communauté autonome basque.\\nTrois sentiers de grande randonnée traversent les Pyrénées d'ouest en est : le GR 10 côté français, le GR 11 côté espagnol et la Haute randonnée pyrénéenne."},{"page_url":"https://ca.wikipedia.org/wiki/Auriac_(Pirineus_Atl%C3%A0ntics)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Mairie_et_monument_aux_morts_d%27Auriac_%28Pyr%C3%A9n%C3%A9es-Atlantiques%29.JPG","page_title":"Auriac (Pirineus Atlàntics)","context_page_description":"Auriac és un municipi francès, situat al departament dels Pirineus Atlàntics i a la regió de la Nova Aquitània."},{"page_url":"https://hu.wikipedia.org/wiki/Turbidimetria","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Airborne-particulate-size-chart.svg","page_title":"Turbidimetria","context_page_description":"A turbidimetria a folyadékok és gázok minőségének fotometriai módszerrel való mérése, amely a zavarosság meghatározásán alapszik. Ilyen méréseket végeznek az ivóvizek tisztaságának, a természetes vizek szennyezettségének, a környezeti levegő tisztaságának ellenőrzésére. A meteorológiában a levegő tulajdonságainak megadására, a repülésben a tiszta látástávolság meghatározásában van szerepe."},{"page_url":"https://fr.wikipedia.org/wiki/Massif_central","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Paysage_en_Creuse.JPG","page_title":"Massif central","context_page_description":"Le Massif central est un massif montagneux essentiellement hercynien qui occupe le centre de la moitié sud de la France métropolitaine. D'une surface de 85 000 km², soit 15 % environ du territoire métropolitain, c'est le massif le plus vaste du pays. Le massif est d'altitude moyenne et ses reliefs sont souvent arrondis par l'érosion. Il culmine à 1 885 mètres au sommet volcanique du puy de Sancy. Dans l'ensemble, il s'est formé il y a 500 millions d'années, bien que les causses et surtout les reliefs volcaniques soient plus récents, ces derniers étant consécutifs à la formation des Alpes et des Pyrénées. Le Massif central abrite en effet l'essentiel des volcans français de métropole.\\nLes trois grandes agglomérations du Massif central, situées dans sa moitié nord, sont Clermont-Ferrand, Limoges et Saint-Étienne. Cette dernière est la plus grande unité urbaine du massif. Les autres villes importantes du massif sont Aurillac, Brive-la-Gaillarde, Cahors, Guéret, Mende, Millau, Montluçon, Moulins, Le Puy-en-Velay, Roanne, Rodez, Thiers, Tulle et Vichy."},{"page_url":"https://it.wikipedia.org/wiki/Bmibaby","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/DoningtonHallCastleDonington.jpg","page_title":"Bmibaby","context_page_description":"bmibaby era una compagnia aerea a basso costo britannica, posseduta dalla più grande British Midland Airways Ltd. Effettuava voli low cost in Europa dalle sue basi principali di East Midlands/Nottingham e Birmingham. Negli anni prima della chiusura la compagnia ebbe basi anche a Manchester, Cardiff e Durham Tees Valley.\\nBmibaby possedeva una licenza dell'autorità britannica per l'aviazione civile di tipo A, che le permetteva di trasportare passeggeri, cargo e posta su aeromobili con venti o più posti a sedere."},{"page_url":"https://ca.wikipedia.org/wiki/Microlita","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Microlite-244260.jpg","page_title":"Microlita","context_page_description":"La microlita és un mineral de la classe dels òxids que rep el seu nom del grec mikros i lithos."},{"page_url":"https://simple.wikipedia.org/wiki/Lock_picking","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Skeletonkey.png","page_title":"Lock picking","context_page_description":"Lock picking is the art of opening a lock without the key and without damaging or destroying the lock or its door. It is usually used by locksmiths to let people back in who have lost their keys or locked them inside a car or house. Lock picking is very rarely used by criminals, because picking a lock is difficult and other ways of entering such as breaking a window are much easier. Some people pick their own locks as a hobby. In most places picking locks that you own is legal, but it is illegal to pick locks that you do not own or do not have permission to pick.\\nHistory of keys and locks goes back for about 4,000 years. Ancient people also wanted to protect their possessions and keep them in places where other people cannot get access to them. The first locks and keys were made of wood and other easily accessible materials and they provided the small safeguard against theft or break-in. However, such locks at least let the owners know if someone tried to tamper with the lock.\\nThe earliest known key and lock was discovered in the Nineveh ruins, which was the capital of ancient Assyria. They were dated to 704 BC."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%8A%D9%83%D9%88_%D8%B3%D8%A7%D9%86%D8%AA%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Nico_Santos.jpg","page_title":"نيكو سانتوس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nنيكو سانتوس ملحن مزيكا من اسبانيا."},{"page_url":"https://de.wikipedia.org/wiki/Clugnat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Fetes_communal.JPG","page_title":"Clugnat","context_page_description":"Clugnat ist eine Gemeinde im Zentralmassiv in Frankreich. Sie gehört zur Region Nouvelle-Aquitaine, zum Département Creuse, zum Arrondissement Aubusson und zum Kanton Boussac."},{"page_url":"https://es.wikipedia.org/wiki/Acequia_Real_de_la_Ciudad_de_M%C3%A9xico","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Edificio_de_la_Alh%C3%B3ndiga.JPG","page_title":"Acequia Real de la Ciudad de México","context_page_description":"La Acequia Real de la Ciudad de México fue un canal de agua que subsistió desde la época mexica hasta la novohispana como un canal abierto y en algunos tramos navegable. Iba desde la zona de La Merced, pasando por la Calle Corregidora, la Alhóndiga de la ciudad y hasta la extinta Plaza del Volador, hoy sede de la Suprema Corte de Justicia de la Nación. Por ella arribaban hasta el centro de la urbe las canoas cargadas de víveres provenientes de Xochimilco y Chalco a través del Canal de La Viga."},{"page_url":"https://cs.wikipedia.org/wiki/Thatcherismus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Margaret_Thatcher_1984.jpg","page_title":"Thatcherismus","context_page_description":"Thatcherismus je označení pro ekonomické, sociální a politické přesvědčení členky britské konzervativní strany, Margaret Thatcherové, která vedla tuto stranu 1975 až 1990. Tento termín se také používá k popisu zásad britské vlády po dobu působení Thatcherové v čele této vlády od roku 1979 do 1990 a dále vlád Johna Majora, Tonyho Blaira a Davida Camerona. Zastánci thatcherismu jsou nazýváni thatcherité. Thatcherismus reprezentoval systematické, rozhodné odmítnutí poválečného konsenzu, kde se většina politických stran shodla na základních tématech keynesiánství, sociálního státu, zestátnění průmyslu a přísné regulace britské ekonomiky. Existuje jedna významná výjimka – NHS – Národní zdravotní systém, který byl velice populární. V roce 1982 slíbila britskému lidu, že NHS je v jejich rukou v bezpečí.\\nThatcherismus byl také popsán tehdejším kancléřem státní pokladny, Nigelem Lawsonem jako politická platforma zdůrazňující volný trh s omezenými vládními výdaji a snížením daní. Toto bylo spojeno s britským nacionalismem na domácí půdě i v zahraničí."},{"page_url":"https://en.wikipedia.org/wiki/NGC_7600","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/NGC7600_-_SDSS_DR14.jpg","page_title":"NGC 7600","context_page_description":"NGC 7600 is an elliptical galaxy about 160 million light-years in the constellation Aquarius classified as a lenticular galaxy, or, more formally, an S0 galaxy."},{"page_url":"https://nl.wikipedia.org/wiki/Saarbahn","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Saarbahn_johanniskirche.jpg","page_title":"Saarbahn","context_page_description":"De Saarbahn verzorgt het regionaal personenvervoer van Riegelsberg via Saarbrücken naar het Franse Sarreguemines met tramtrein voertuigen.\\nDe successen van de tramtrein in Karlsruhe hebben Saarbrücken geïnspireerd om ook een dergelijke lightrailverbinding te realiseren. Op 24 oktober 1997 werd de Saarbahn tussen Sarreguemines en Saarbrücken geopend na 2,5 jaar bouwtijd. Tussen Sarreguemines en Brebach rijden de voertuigen als trein op een openbare spoorweg die met 15.000 volt wisselspanning is geëlektrificeerd. Vanaf Brebach schakelt het voertuig over op 750 volt gelijkspanning en rijdt het als tram de binnenstad van Saarbrücken in.\\nIn september 2001 werd de tramlijn vanaf Saarbrücken naar Riegelsberg Süd verlengd, waardoor de lijn 25,5 kilometer lang werd. Vanaf 2007 werd de lijn doorgetrokken van Riegelsberg via Etzenhofen naar Lebach. Tussen Etzenhofen en Lebach maakt de tram gebruik van het tracé van de voormalige Köllertalbahn. In Lebach rijdt de tram het bestaande spoor op om door te rijden naar station Lebach-Jabach. De Saarbahn is thans ongeveer 45 kilometer lang.\\nDe Saarbahn vervoert dagelijks 40.000 reizigers."},{"page_url":"https://hr.wikipedia.org/wiki/Obrazovanje_u_Bosni_i_Hercegovini","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/University_of_Mostar_Rectorate_Building_1.jpg","page_title":"Obrazovanje u Bosni i Hercegovini","context_page_description":"Obrazovanje u Bosni i Hercegovini ima dugu tradiciju, a prva visokoškolska ustanova koja je uspostavljena bila je škola sufizma Gazi Husrev-bega koja je osnovana 1531. godine, nakon čega je s vremenom došlo do otvaranja drugih vjerskih škola.\\nGodine 1887., za vrijeme de facto Austro-Ugarske kontrole, osnovana je Pravna šerijatska škola koja je započela s petogodišnjim planom obrazovanja. 1940.-ih Sveučilište u Sarajevu postalo je prvi sekularni institut visokog obrazovanja u gradu. Tijekom 1950.-ih dostupno je postalo post-diplomsko obrazovanje. Teško oštećeno tijekom rata, nedavno je obnovljeno u suradnji s više od 40 drugih sveučilišta.\\nPostoje i mnoge druge institucije visokog obrazovanja, uključujući: Sveučilište u Banjoj Luci, Sveučilište u Mostaru, Sveučilište u Tuzli, Sveučilište u Zenici, Sveučilište u Istočnom Sarajevu, Sveučilište \\"Džemal Bijedić\\" Mostar, Sveučilište u Bihaću, Američko Sveučilište u Bosni i Hercegovini i Akademija znanosti i umjetnosti Bosne i Hercegovine, koja je vrlo cijenjena kao jedna od najprestižnijih akademija kreativne umjetnosti u ovom dijelu Europe."},{"page_url":"https://sk.wikipedia.org/wiki/Sini%C5%A1a_Mihajlovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Sini%C5%A1a_Mihajlovi%C4%87.JPG","page_title":"Siniša Mihajlović","context_page_description":"Siniša Mihajlović je bývalý srbský futbalista a tréner. Narodil sa v Vukovari, vyrastal v Borovo Naselje.\\nNa klubovej úrovni hral za NK Borovo, Vojvodina Novi Sad, Crvenu zvezdu Belehrad, AS Rím, Sampdoriu a Lazio. V roku 2004 prestúpil spolu s priateľom Robertom Mancinim do Interu Miláno.\\nJeho najväčším úspechom je výhra Európskeho pohára s Crvenou zvezdou Belehrad v roku 1991. Vo finále klub porazil Olympique de Marseille na penalty, pričom Mihajlović bol jedným zo strelcov. V semifinále proti Bayernu Mníchov strelil dôležitý gól z priameho kopu v odvetnom zápase na belehradskej \\"Marakane\\". Mihajlović bol tiež súčasťou tímu Crvenej zvezdy pri výhre Interkontinentálneho poháru, keď \\"crveno-beli\\" zdolali Colo Colo 3-0.\\nMihajlović odohral za reprezentáciu Srbska a Čiernej Hory 63 zápasov v ktorých strelil 9 gólov. Hral aj na Eure 2000 a na Majstrovstvách sveta v roku 1998. Svoju aktívnu kariéru ukončil v roku 2006, naďalej pôsobil v klube Inter Miláno ako asistent trénera."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Liesborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Liesborn_Klosterkirche_Grundriss.jpg","page_title":"Kloster Liesborn","context_page_description":"Kloster Liesborn in Liesborn, Kreis Warendorf, wurde um 815 als Damenstift gegründet. Im Jahr 1131 wurde dieses aufgehoben und an seine Stelle trat eine Benediktiner-Abtei, die 1803 säkularisiert wurde."},{"page_url":"https://en.wikipedia.org/wiki/Scord%27s_Wood_and_Brockhoult_Mount","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Bridleway_in_Scords_Wood_-_geograph.org.uk_-_1536434.jpg","page_title":"Scord's Wood and Brockhoult Mount","context_page_description":"Scord's Wood and Brockhoult Mount is a 252.3-hectare biological Site of Special Scientific Interest west of Sevenoaks in Kent. Scord's Wood is a Nature Conservation Review site, Grade I.\\nThis sloping site has the best sessile oak stands in the county. Grasslands on acidic soils are mainly common bent, heath bedstraw and sheep’s sorrel, together with some heather and bracken.\\nThis site is composed of a number of scattered blocks, and public footpaths and bridleways go through some areas."},{"page_url":"https://is.wikipedia.org/wiki/Heimsmeistaram%C3%B3t_landsli%C3%B0a_%C3%AD_knattspyrnu_karla_1958","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Tunavallen_2011.jpg","page_title":"Heimsmeistaramót landsliða í knattspyrnu karla 1958","context_page_description":"Heimsmeistaramót landsliða í knattspyrnu karla 1958 eða HM 1958 var haldið í Svíþjóð dagana 8. júní til 29. júní. Þetta var sjötta heimsmeistarakeppnin og urðu Brasilíumenn meistarar í fyrsta sinn eftir sigur á heimamönnum í úrslitum. Táningurinn Pelé varð stjarna keppninnar og Frakkinn Just Fontaine setti markamet sem enn stendur."},{"page_url":"https://fi.wikipedia.org/wiki/Tyyppi_2_Ka-Mi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Amph_tank_%28AWM_099057%29.jpg","page_title":"Tyyppi 2 Ka-Mi","context_page_description":"Tyyppi 2 Ka-Mi on japanilainen amfibiopanssarivaunu. Tätä vaunutyyppiä käytti Keisarillisen Japanin armeija. Esikuvana tällä tyypillä oli Tyyppi 95 Ha-Go/Kyu-Go. Vaunutyypin tuotanto alkoi vuonna 1942.\\nAluksi muutostöiden piti olla yksinkertaiset, Tyyppi 95 -vaunuun olisi vain lisätty kelluntasäiliöt. Amfibiovaunuksi prosessointi ei kuitenkaan ollut niin helppoa. Epäonnisten kokeiluvaiheiden jälkeen suunnittelijat päätyivät lisäämään panssarivaunuun erilliset vaunun ulkopuoliset ponttoonit muuttamatta itse vaunutyypin konstruktiota.\\nUudessa tyypissä oli sentään joitakin etuja, kuten sisäiset vaunupuhelimet ja radiointi. Miehistön lukumäärä oli viisi henkeä, johon kuului myös vaunumekaanikko. Amfibiovaununa Tyyppi 2 Ka-Mi oli kaikkein yleisin Japanin armeijassa.\\nTätä erikoistyyppiä valmistettiin Japanissa suhteellisen vähän. Sen panssarivaunuaseeksi pienehköksi katsottava 37 mm tykki ei ollut vaunutyypin tehokkaan käytön kannalta kovin vakava ongelma. Sen sijaan tämän tyypin käyttö linnakkeena eli puolustusasemana oli, sillä tykin kaliiperi oli tuohon tarkoitukseen riittämättömän pieni. Tämä sotilastaktiikka esti sinänsä toimivan vaunutyypin käyttöä."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A1%E0%A6%BE%E0%A6%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Masoor_dal.JPG","page_title":"ডাল","context_page_description":"ডাল শিম গোত্রের অন্তর্গত খাদ্যশস্য। ডাল প্রধানত বিউলি, মুগ, মসুর, ছোলা, মটর, অড়হর, মাষকলাই, খেসারি প্রভৃতি শুঁটিজাতীয় মৌসুমি ফসলের শুকনো বীজ। সব রকমের ডাল মানুষের জন্য অন্ত্যন্ত প্রয়োজনীয় ও উপকারী। ডাল প্রোটিন প্রধান খাদ্য। এতে প্রোটিনের পরিমাণ শতকরা ২০ থেকে ২৫ ভাগ এবং অত্যধিক লাইসিন থাকায় ও দামে সস্তা হওয়ায় ডালকে প্রায়শই গরিবের আমিষ বলা হয়। প্রোটিন ছাড়াও ডালে পর্যাপ্ত শর্করা, চর্বি ও খনিজ লবণ থাকে। এতে গমের তুলনায় প্রায় দ্বিগুণ ও চালের তুলনায় প্রায় তিন গুণ প্রোটিন আছে।"},{"page_url":"https://pl.wikipedia.org/wiki/Copa_Airlines_Colombia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Embraer_190_2.jpg","page_title":"Copa Airlines Colombia","context_page_description":"Copa Airlines Colombia – kolumbijska linia lotnicza z siedzibą w Bogocie zarządzana przez firmę Aero República. Głównym węzłem jest port lotniczy Bogota-El Dorado."},{"page_url":"https://en.wikipedia.org/wiki/Satsang_(Deoghar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Satsang_Vihar_Bihar_Sharif%2C_Nalanda.jpg","page_title":"Satsang (Deoghar)","context_page_description":"Satsang is a philanthropic organization founded by Thakur Anukulchandra. It is one of the major spiritual and cultural movements in India started in the early 20th century. Satsang was originally registered in Pabna in 1925 as a public charitable institution. However, after the Independence and partition of India, it was again registered in 1951 in the Indian Union under the Societies Registration act of 1860.\\nIts headquarters was established as Satsang Ashram at Deoghar, Jharkhand after Thakur Anukulchandra moved to Deoghar from his birthplace in the Pabna District of East Bengal on September 2, 1946. At present Satsang has more than two thousand branches located in India, Bangladesh, Burma, Europe, Middle East, Africa and America."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Objekte_der_II._Wiener_Hochquellenleitung","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Kanalbr%C3%BCcke_Sch%C3%B6llgraben.jpg","page_title":"Liste der Objekte der II. Wiener Hochquellenleitung","context_page_description":"Die Liste der Objekte der II. Wiener Hochquellenleitung enthält die oberirdisch sichtbaren Einzelbauwerke der II. Wiener Hochquellenleitung in ihrem Verlauf von den Quellen bis zu den Wasserbehältern in Wien. Ein Großteil der Bauwerke steht unter Denkmalschutz, die Objekte finden sich daher auch in den Denkmallisten der Gemeinden entlang der Hochquellenleitung wieder. Im Gegensatz zu den Denkmallisten, die der Ojektdefinition des Bundesdenkmalamts folgend oftmals Abschnitte der Wasserleitung auf der Ebene einer Katastralgemeinde als jeweils nur ein denkmalgeschütztes Objekt beschreiben und dabei mehrere Einzelbauwerke zusammenfassen, und Einzelbauwerke über Gemeinde- und Katastralgemeindegrenzen doppelt beschreiben, werden in dieser Liste die Einzelbauwerk getrennt aufgeführt und die grenzüberschreitenden Bauwerke als jeweils ein Bauwerk betrachtet.\\nDie II. Wiener Hochquellenwasserleitung ist eine 183 Kilometer lange Trinkwasser-Versorgungsleitung für die Stadt Wien. Sie wurde auf Betreiben von Karl Lueger errichtet und nach zehnjähriger Bauzeit am 2. Dezember 1910 als II. Kaiser-Franz-Josef-Hochquellenleitung eröffnet. Sie wurde zur Verstärkung der I."},{"page_url":"https://sh.wikipedia.org/wiki/Bajgora","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bajgor_1851.JPG","page_title":"Bajgora","context_page_description":"Bajgora je naselje u opštini Kosovska Mitrovica, Kosovo i Metohija, Republika Srbija."},{"page_url":"https://ro.wikipedia.org/wiki/Pruni%C8%99,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Josephinische_Landaufnahme_pg095.jpg","page_title":"Pruniș, Cluj","context_page_description":"Pruniș este un sat în comuna Ciurila din județul Cluj, Transilvania, România."},{"page_url":"https://ca.wikipedia.org/wiki/Cant%C3%B3_de_Roura","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Canton_de_Roura.png","page_title":"Cantó de Roura","context_page_description":"El cantó de Roura és una antiga divisió administrativa francesa situat a la regió d'ultramar de la Guaiana Francesa. Va desaparèixer el 2015."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%96%D0%BA%D0%B0_%D0%9D%D1%96%D0%BA%D1%83%D0%BB%D0%B5%D1%81%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/N%C3%BCrnberger_Versicherungscup_2014_-_1.Runde_-_Monica_Niculescu_07_cropped_02.jpg","page_title":"Моніка Нікулеску","context_page_description":"Моніка Нікулеску — румунська тенісистка.\\nМоніка народилася в Слатіні й переїхала до Бухареста, коли їй було 4 роки. У професійному турі вона почала виступати з 2002 року. Станом на версень 2014 здобула дві перемоги в турнірах WTA: виграла Brasil Tennis Cup 2013 та Guangzhou International Women's Open 2014.\\nСтарша сестра Моніки Габріела Нікулеску — теж професійна тенісистка."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D1%89%D0%B8%D1%82%D0%B0_%D0%B4%D0%B5%D0%BD%D0%B5%D0%B3_%D0%BE%D1%82_%D0%BF%D0%BE%D0%B4%D0%B4%D0%B5%D0%BB%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Obverse_of_the_series_2009_%24100_Federal_Reserve_Note_Motion.jpg","page_title":"Защита денег от подделки","context_page_description":"Защита денег от подделки представляет собой определённые элементы защиты банкнот, наделённые свойствами, позволяющими без каких-либо сомнений отличать подлинные купюры от подделок. Введение большого количества таких защитных элементов делает подделку значительно более трудоёмкой или даже невозможной. Защитные элементы создаются при производстве подложки, а также посредством защищённой полиграфии в основном в специализированных компаниях.\\nВ мире существует более 100 различных элементов защиты банкнот. Они подразделяются на распознаваемые людьми и машиночитаемые, которые появились в 1970-х годах одновременно с внедрением машинной обработки банкнот. Публично известна лишь часть всех защитных элементов, поскольку центральные или национальные банки-эмитенты хранят информацию о наиболее ценных защитных элементах в секрете и оставляют их для себя, чтобы им было трудно подражать. По причинам экономического характера, а также из экономии места, каждая банкнота оснащается только несколькими защитными элементами, при этом для банкноты с более высоким номиналом используют специальные элементы защиты с более высокой стоимостью и дополнительными характеристиками."},{"page_url":"https://en.wikipedia.org/wiki/Trikini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/ValerieSilverman._519.jpg","page_title":"Trikini","context_page_description":"A trikini is a three-piece garment used as a beachwear. The three pieces are sold together, such as a bikini with a tank top. A bikini with a one-piece suit is also sometimes called a trikini. Its name is formed from bikini, replacing \\"bi-\\", as if to mean \\"two\\", with \\"tri-\\", meaning \\"three\\". In response to the impact of the COVID-19 pandemic on fashion, a new variety of trikini was designed – including a matching face mask."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%BF%E3%83%AA%E3%82%A2%E3%81%AE%E3%83%A9%E3%83%A0%E3%82%B5%E3%83%BC%E3%83%AB%E6%9D%A1%E7%B4%84%E7%99%BB%E9%8C%B2%E5%9C%B0%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Padule_di_Bolgheri_-_Monumento_Naturale_-.jpg","page_title":"イタリアのラムサール条約登録地一覧","context_page_description":"本項では、イタリアのラムサール条約登録地の一覧を示す。\\nイタリアは、1977年4月14日にラムサール条約に加入した。2016年11月現在、イタリアにおけるラムサール条約登録地は52か所、面積は 60,223 ha である。\\n1980年の第1回ラムサール条約締約国会議は、イタリア・サルデーニャ州のカリャリで開催されている。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%81%DB%8C%D9%88%D9%BE%DA%AF%D9%86_%D8%AC%D8%A7%D9%BE%D9%86%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ophiopogon_japonicus_%28fruits%29.jpg","page_title":"افیوپگن جاپنیکا","context_page_description":"افیوپگن جاپنیکا نام یک گونه از تیره مارچوبگان است."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AE%E0%B1%83%E0%B0%A6%E0%B1%81%E0%B0%AB%E0%B0%B2%E0%B0%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/True.berries.jpg","page_title":"మృదుఫలం","context_page_description":"వృక్ష శాస్త్ర వివరణ ప్రకారం బెర్రీ కండగలిగిన పండును ఒక పుష్పాండం నుండి ఉత్పత్తి చేయబడుతుంది. దీనిని మృదుఫలం అంటారు. ఉదాహరణకు ద్రాక్ష.\\nఈ బెర్రి పండు కండగలిగి పండు లోపలి అధిక భాగం సాధారణంగా తినగలిగినదై ఉంటుంది.\\nఅవి ఒకటి లేదా మరిన్ని ఫలదళాలు కలిగి కండగలిగిన లోపలి భాగాలను సన్నగా పలుచని పొరతో కప్పి ఉంచుతాయి."},{"page_url":"https://sv.wikipedia.org/wiki/Pirs_Airlock","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Soyuz_TMA-5_Patch.png","page_title":"Pirs Airlock","context_page_description":"Pirs Airlock är en rysk trycksatt modul på den internationella rymdstationen, ISS.\\nModulen används som dockningsstation för de ryska farkosterna Sojuz och/eller Progress. Modulen används även som luftsluss vid rymdpromenader i ryska rymddräkter.\\nPirs kan även leda bränsle från dockade farkoster till Zvezda eller Zarja eller tvärtom vara tankstation från rymdstationen till dockade farkoster.\\nPå utsidan av modulen är två Strelakranar monterade. Dessa används vid rymdpromenader på den ryska delen av rymdstationen.\\nI framtiden kommer Pirs tas bort från rymdstationen för att ge plats åt den ryska Naukamodulen."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%DA%A9%DB%8C%D9%86%D8%AC%DB%8C_%D9%88%D8%A7%D9%86_%D8%B9%DB%86%D8%B5%DB%8C%D8%A7%D9%86%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Nogales_with_Kurdish_guard.jpg","page_title":"ایکینجی وان عۆصیانی","context_page_description":"ایکینجی وان عۆصیانی وان و عثمانلی ایمپیراتورلوغو یئرینده اوز وئرمیش‌دیر بۇ وۇروشون سوْنو عثمانلی ایمپیراتورلوغو غلبه‌سیله بیتمیش‌دیر"},{"page_url":"https://sv.wikipedia.org/wiki/Oda_Nielsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Oda_Nielsen_by_Juncker-Jensen.jpg","page_title":"Oda Nielsen","context_page_description":"Oda Laurenze Helmine Nielsen, född Oda Larssen den 7 augusti 1852 på briggen Molodezi i Libaus hamn i Lettland, död den 11 september 1936 i Vedbæk i Danmark, var en dansk skådespelerska, från 1884 gift med regissören Martinius Nielsen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Eslohe_(Sauerland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Maria_Heimsuchung_B%C3%BCenfeld_fd.jpg","page_title":"Liste der Baudenkmäler in Eslohe (Sauerland)","context_page_description":"Die Liste der Baudenkmäler in Eslohe (Sauerland) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Gemeinde Eslohe im Hochsauerlandkreis in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Gemeinde Eslohe eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://hu.wikipedia.org/wiki/Mercedes-Benz_C_oszt%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Mercedes_Benz_C_180_CGi_2013_%2811410856014%29.jpg","page_title":"Mercedes-Benz C osztály","context_page_description":"A Mercedes-Benz C osztály egy középkategóriás luxusautó, amelyet a Daimler AG konszern Mercedes-Benz divíziója gyárt. 1993-ban mutatkozott be, a 190-es modell utódjaként, a C osztályos Mercedest. Ez volt a márka legkisebb modellje, az A osztály bemutatkozása előtt, 1997-ig. A C osztályos Mercedeseket a németországi Sindelfingenben és Brémában, valamint Brazíliában, Dél-Afrikában és Egyiptomban gyártják. A legelső, W202-es generációjú modellt 1993 június 1-jén gyártották, a második generációs W203-as 2000 július 18-án gördült le a gyártószalagról, és a harmadik generációs, W204-es modell 2007-ben jelent meg. Ezt a verziót 2014-ben váltja le a W205 kódnevű negyedik generáció."},{"page_url":"https://az.wikipedia.org/wiki/Eucalyptus_rudis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Eucalyptus_rudis.jpg","page_title":"Eucalyptus rudis","context_page_description":"Eucalyptus rudis — mərsinkimilər fəsiləsinin evkalipt cinsinə aid bitki növü."},{"page_url":"https://en.wikipedia.org/wiki/The_Graduate_School_of_Political_Management","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Juan_Guaid%C3%B3_%2833346170378%29_%28cropped%29.jpg","page_title":"The Graduate School of Political Management","context_page_description":"The Graduate School of Political Management at the George Washington University is a school of political management and applied politics, strategic communications and civic engagement. Its graduates hold a variety of professional titles including campaign managers, pollsters, speechwriters, communications professionals, legislative aides and directors, candidates, lobbyists, and new media experts.\\nIt is the only school of applied politics in Washington, D.C. The faculty trains students of all political persuasions in how to win campaigns, advance legislative goals and impact public opinion ethically."},{"page_url":"https://fr.wikipedia.org/wiki/Javanaise_(race_de_poule)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Coq_Javanaise_dor%C3%A9.jpg","page_title":"Javanaise (race de poule)","context_page_description":"La javanaise est une race de poule naine française."},{"page_url":"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_tranh_Nga%E2%80%93Nh%E1%BA%ADt","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/JBMikasa.jpg","page_title":"Chiến tranh Nga–Nhật","context_page_description":"Chiến tranh Nga–Nhật hay Nhật-Nga chiến tranh là một cuộc xung đột quân sự từ ngày 10 tháng 2 năm 1904 đến 5 tháng 9 năm 1905 giữa hai đế quốc đầy tham vọng: Đế quốc Nga và Đế quốc Nhật Bản, để giành quyền kiểm soát Mãn Châu và Triều Tiên. Đây thường được xem là \\"cuộc đại chiến đầu tiên của thế kỷ 20\\". Chiến địa là Nam Mãn Châu thuộc Trung Quốc, tập trung vào khu vực bán đảo Liêu Đông, lưu vực sông Liêu, và vùng biển quanh Triều Tiên cùng Nhật Bản như Hoàng Hải và eo biển Đối Mã. Tuy chiến sự trên bộ diễn ra phần lớn trên lãnh thổ Trung Hoa, triều đình Bắc Kinh tuyên bố trung lập phần vì không không đủ lực lượng kiểm soát vùng đất tranh chấp, phần vì e ngại làm phật ý hai đế quốc hùng mạnh đang phân chia cương vực để độc quyền khai thác tài nguyên ở đông bắc Trung Hoa. Các nước Tây phương cũng khuyến cáo Bắc Kinh không nên ủng hộ bên nào vì thiên vị của nhà Thanh sẽ gây cớ cho nước khác nhảy vào cuộc chiến, làm tình hình thêm rắc rối."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%BB%D1%8F%D0%BA%D1%81%D0%B5%D0%B9_%D0%A2%D1%80%D1%83%D0%B1%D1%8F%D1%86%D0%BA%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Massacre_of_Mstislav_by_Russian_forces_in_1654.PNG","page_title":"Аляксей Трубяцкой","context_page_description":"Аляксей Мікітавіч Трубяцкі гербу Пагоня Літоўская — апошні князь Трубяцкога княства ў межах Рэчы Паспалітай і пасьля ў граніцах Расеі. Хросны бацька цара Пятра Першага. Брат Вігунда Гераніма Трубяцкога.\\nУ 1646—1662 ачольваў прыказы — Сыбірскі, Казанскага палацу ды Палкавых справаў. У сакавіку 1654 браў удзел у перамовах з гетманскім урадам пра ўмовы заключэньня ўкраінська-маскоўскага вайськова-палітычнага хаўрусу.\\nУ 1654 годзе пад час вайны Расеі з РП камандаваў паўднёвай часткай царскага войска. Хутка захапіў землі між Дняпром і Бярэзіною. Войска Трубяцкога жорстка паводзіла сябе на акупаных землях. Выпальваліся вёскі, выводзіліся ў Расею сяляне. 22 ліпеня 1654 у Амсьціславе адбылася празваная пасьля разьня Трубяцкога. 24 жніўня 1654 перамог у бітве пад Шапялевічамі значна меншае літоўскае войска начале зь Янушам Радзівілам. Пасьля ваяваў пад Луцкам. У 1656 браў удзел здабыцьці Дорпту падчас маскоўска-швэдзкае вайны.\\nУ 1659 начале 150 000 войска Трубяцкой уварваўся ва Ўкраіну. У бітве пад Канатопам страціў каля 20 000 чалавек. У тым самым годзе разам з палкоўнікам казакаў Іванам Сіркай браў удзел у вайсковых дзеях супраць Крымскага Хансктва."},{"page_url":"https://en.wikipedia.org/wiki/Shanxi_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/%E5%B1%B1%E8%A5%BF%E5%A4%A7%E5%AD%A6%E7%BE%8E%E6%9C%AF%E5%AD%A6%E9%99%A2%E6%A5%BC.jpg","page_title":"Shanxi University","context_page_description":"Shanxi University is a public university located in the city of Taiyuan, Shanxi province, China. Its historic names include Shansi Imperial University, and Shansi University. It is the oldest and largest university in Shanxi province. Its nationwide academic ranking is about 85th among more than 1000 Chinese universities.\\nShanxi University is one of the fourteen national key universities in China. A national base of Chinese Language and Culture Education was designated by the State Council for Shanxi University. There are about 11000 undergraduates and 2200 postgraduates registered. The school has three campuses: Wucheng, Dongguan, Dongshan, covering a total area of nearly 2600 acres, with the construction area of 120 square meters. The library of Shanxi University has a collection of 3 million 617 thousand volumes, 4300 electronic books, teaching and research equipment worth nearly a billion yuan. From its founding day around the Wenying lake at the foot of Twin Towers, Shanxi University continuously strives for progress in arts and sciences, and the integration of Chinese and Western cultures."},{"page_url":"https://ca.wikipedia.org/wiki/Mat%C3%ADas_Bize","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Bizevisitamoneda.jpg","page_title":"Matías Bize","context_page_description":"Matías Javier Bize García és un director de cinema, productor i guionista xilè. Ha aconseguit importants reconeixements internacionals en la categoria de cinema independent: la seva pel·lícula En la cama va aconseguir la Espiga d'Or de la Seminci de Valladolid en 2005 i La vida de los peces, el Premi Goya el 2011."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%90%E3%83%8D%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Habanero_chile_-_flower_with_fruit_%28aka%29.jpg","page_title":"ハバネロ","context_page_description":"ハバネロはトウガラシ属の植物の一種で、シネンセ種の品種の一つ。実の大きさは2 - 6センチメートル。名称はハバナにちなみ、スペイン語では\\"H\\"を発音しないためチレ・アバネロとなる。\\nハバネロの熟す前の実は緑色だが、熟すると様々な色に変わる。最も一般的なのはオレンジ色だが、白、ブラウン、ピンクなどもみられる。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%88%D1%91%D1%82%D0%BA%D0%B0_%D0%9F%D0%B5%D0%BD%D0%BD%D0%B5%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Dihybrid_Cross_Tree_Method.png","page_title":"Решётка Пеннета","context_page_description":"Решётка Пеннета, или решётка Паннета, — 2D-таблица, предложенная английским генетиком Реджинальдом Паннетом в качестве инструмента, представляющего собой графическую запись для определения сочетаемости аллелей из родительских генотипов. Вдоль одной стороны квадрата расположены женские гаметы, вдоль другой — мужские. Это позволяет легче и нагляднее представить генотипы, получаемые при скрещивании родительских гамет."},{"page_url":"https://fr.wikipedia.org/wiki/Pueu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Famille_de_Pueu_vers_1895.jpg","page_title":"Pueu","context_page_description":"Pueu est située au sud-est de l'île de Tahiti, en Polynésie française. Elle fait partie de la commune de Taiarapu-Est, qui regroupe Faaone, Afaahiti-Taravao et Tautira. C'est ici notamment que réside Michel Gauthier, ami et pilote de Jacques Brel en Polynésie française."},{"page_url":"https://da.wikipedia.org/wiki/S%C3%A3o_Tom%C3%A9_og_Pr%C3%ADncipe","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Sao_Tome_Explorer_Statues_1_%2816247112731%29.jpg","page_title":"São Tomé og Príncipe","context_page_description":"São Tomé og Príncipe, officielt den Demokratiske Republik São Tomé og Príncipe, er en østat i Atlanterhavet ud for Gabon. Østaten var portugisisk koloni fra 1522-1975.\\nØerne er af vulkansk oprindelse og har tropisk klima med forholdsvis mange endemiske plante- og dyrearter. I dag præges øerne af en blanding af den oprindelige skovbevoksning og den tidligere plantagedrift.\\nØerne var oprindelig ubeboede. Indvandring skete først, da de blev en portugisisk koloni. Øerne fik en sammensat befolkning, og kreolisering blev et udpræget træk. Øerne spillede en vis rolle i slavehandelen, først lokalt og senere som inspiration for plantageøkonomien i Latinamerika. Mange slaver blev senere plantageejere. Øerne fik selvstændighed i 1975. Politisk har styret vekslet mellem en præsidentiel republik med udtalt autonomi for Príncipe og perioder med militærstyre.\\nSão Tomé og Príncipe er et fattigt land med en stor udlandsgæld. Landet er afhængigt af import af de fleste forbrugsvarer, brændstoffer og fødevarer. Eksporten gælder især kaffe, kopra og palmeolie. De fleste arbejder inden for jordbruget."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B7%E0%B4%BF%E0%B5%BC%E0%B4%B5%E0%B4%BE%E0%B5%BB%E0%B4%B7%E0%B4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/David_IV_map_de.png","page_title":"ഷിർവാൻഷാ","context_page_description":"ഷിർവാൻഷാ ഒൻപതാം നൂറ്റാണ്ടിന്റെ മധ്യം മുതൽ പതിനാറാം നൂറ്റാണ്ടിന്റെ പ്രാരംഭം വരെ ആധുനിക അസർബൈജാനിലെ ഷിർവാൻ മേഖല കേന്ദ്രമാക്കി ഭരണം നടത്തിയിരുന്ന ഭരണാധികാരികൾ വഹിച്ചിരുന്ന സ്ഥാനപ്പേരായിരുന്നു. യഥാർത്ഥത്തിൽ അറബി വംശത്തിൽനിന്ന് ഉരുത്തിരിഞ്ഞവരും എന്നാൽ അതിവേഗത്തിൽ പേർഷ്യൻ വംശത്തിലേയ്ക്കു പരിവർ‌ത്തനം ചെയ്യപ്പെട്ട രാജവംശവുമായ യാസിദിദ്സ് എന്ന ഒരൊറ്റ കുടുംബത്തിൽ ഈ സ്ഥാനപ്പേര് തന്നെ തുടർന്നുവെങ്കിലും പിൽക്കാലത്തെ ഷിർവാൻഷാ രാജാക്കന്മാർ കസ്രാനിഡുകൾ അല്ലെങ്കിൽ കഖ്വാനിഡുകൾ എന്നും അറിയപ്പെട്ടു. ആധുനിക അസർബൈജാൻ റിപ്പബ്ലിക്കിലെ ഷിർവാൻ മേഖലയിൽ അവർ ഒരു പ്രാദേശിക രാജ്യം സ്ഥാപിച്ചിരുന്നു.\\n861 മുതൽ 1538 വരെയുള്ള വിവിധ കാലഘട്ടങ്ങളിൽ സ്വതന്ത്രമായ അല്ലെങ്കിൽ ഒരു ആശ്രിത രാജ്യമായി നിലനിന്നിരുന്ന ഷിർവാൻഷാ രാജപരമ്പര, ഇസ്ലാമിക ലോകത്തിലെ മറ്റേതൊരു രാജവംശത്തേക്കാളും കൂടുതൽ കാലം തനതു സംസ്കാരത്തെ പിന്തുണച്ചതിലൂടെ അറിയപ്പെടുന്നു. സ്വതന്ത്രവും ശക്തവുമായ ഷിർവാൻ രാജവംശത്തിനു രണ്ട് കാലഘട്ടങ്ങളുണ്ടായിരുന്നുവെന്നു പറയാം. ഒന്നാമത്തേത്, പന്ത്രണ്ടാം നൂറ്റാണ്ടിൽ രാജാക്കന്മാരായ മനുചെഹ്രിന്റേയും ബാകുവിൽ ഒരു ശക്തികേന്ദ്രം നിർമ്മിച്ച അദ്ദേഹത്തിന്റെ പുത്രൻ അഖ്‌സിറ്റാൻ ഒന്നാമന്റേയും കീഴിൽ നിലനിന്നിരുന്നതും രണ്ടാമത്തേത് 15-ആം നൂറ്റാണ്ടിൽ ഡെർബെൻഡിഡ് രാജവംശത്തിന്റെ കീഴിൽ നിലനിന്നിരുന്ന ഭരണകൂടങ്ങളായിരുന്നു ഇവ."},{"page_url":"https://gl.wikipedia.org/wiki/61%C2%AA_edici%C3%B3n_dos_%C3%93scar","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Carly_Simon_-_1978.jpg","page_title":"61ª edición dos Óscar","context_page_description":"A 61.ª entrega dos premios Óscar tivo lugar o día 29 de marzo de 1989 no Shrine Auditorium dos Ánxeles. Nesta edición non houbo mestre de cerimonias."},{"page_url":"https://no.wikipedia.org/wiki/Audrys_Juozas_Ba%C4%8Dkis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Vilniaus_arkivyskupas_metropolitas_Audrys_Juozas_Ba%C4%8Dkis.jpg","page_title":"Audrys Juozas Bačkis","context_page_description":"Audrys Juozas Bačkis er kardinal og erkebiskop av Vilnius, Litauens hovedstad."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Gnadendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Eichenbrunn-Kulturhaus.jpg","page_title":"Liste der denkmalgeschützten Objekte in Gnadendorf","context_page_description":"Die Liste der denkmalgeschützten Objekte in Gnadendorf enthält die 16 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Gemeinde Gnadendorf im Bezirk Mistelbach."},{"page_url":"https://sk.wikipedia.org/wiki/Jabreilles-les-Bordes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/JabreillesVG.JPG","page_title":"Jabreilles-les-Bordes","context_page_description":"Jabreilles-les-Bordes je francúzska obec, ktorá sa nachádza v departemente Haute-Vienne, v regióne Limuzínsko."},{"page_url":"https://ca.wikipedia.org/wiki/Black_Francis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Pixies-Frank_Black.jpg","page_title":"Black Francis","context_page_description":"Black Francis, també conegut com a \\"Frank Black\\", és un músic estatunidenc.\\nÉs conegut sobretot per ser el líder del grup de rock alternatiu, Pixies, considerat un dels grups musicals més influents de finals dels anys 80 i inicis dels 90. Entre els músics que han elogiat els Pixies hi ha Kurt Cobain de Nirvana, Thom Yorke de Radiohead, PJ Harvey o David Bowie. Amb els Pixies Black Francis cantava i tocava la guitarra, a més de ser l'autor de gairebé la totalitat de les cançons, entre les quals cal destacar \\"Monkey Gone to Heaven\\", \\"Debaser\\", \\"Gouge Away\\", \\"Where is My Mind\\", \\"Hey\\" o \\"Wave of Mutilation\\".\\nDesprés de la separació dels Pixies, el 1993, Black Francis va iniciar una carrera en solitari amb el nom de \\"Frank Black\\", sovint acompanyat d'una banda amb la qual formava Frank Black and the Catholics. En solitari no ha aconseguit mai la repercussió assolida amb els Pixies, per això, tal com va confessar en diverses entrevistes de l'època, els quatre membres originals dels Pixies es van reunir el 2004 per fer una gira arreu del món tocant els grans èxits del grup.\\nDes d'aleshores Black Francis compagina els concerts dels Pixies amb l'edició de discos en solitari."},{"page_url":"https://ru.wikipedia.org/wiki/Eupelmidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Eupelmus_urozonus_g1.jpg","page_title":"Eupelmidae","context_page_description":"Эвпельмиды — семейство паразитических наездников надсемейства Chalcidoidea подотряда Стебельчатобрюхие отряда Перепончатокрылые насекомые. Размеры мелкие. Крылья с сильно редуцированным жилкованием."},{"page_url":"https://pt.wikipedia.org/wiki/Lago_Crater","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Crater_lake_wizard_island.jpg","page_title":"Lago Crater","context_page_description":"O Lago Crater fica no sudoeste do estado norte-americano do Oregon, próximo de Klamath Falls. Com quase 600 m de profundidade, este lago situa-se na caldeira de um vulcão já extinto. Seu nome tem origem numa pequena cratera situada numa ilha deste lago, a ilha Wizard. Desde 1902 este lago faz parte do Parque Nacional do Lago Crater, uma atracção turística dos Estados Unidos da América.\\nSuas águas estão entre as mais límpidas dos Estados Unidos. Tem aproximadamente 8 por 9,6 quilômetros de largura, e uma profundidade média de 350 m e máxima de 597 m, o que o converte no lago mais profundo dos Estados Unidos e o segundo mais profundo da América do Norte e o sétimo do mundo."},{"page_url":"https://no.wikipedia.org/wiki/Vidkun_Quislings_andre_regjering","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Albert_Viljam_Hagelin.jpg","page_title":"Vidkun Quislings andre regjering","context_page_description":"Vidkun Quislings andre regjering ble utnevnt etter Statsakten på Akershus festning i Oslo 1. februar 1942, da Norge under andre verdenskrig var okkupert av det nazistiske Tyskland. Regjeringen var i stor grad en videreføring av Josef Terbovens kommissariske statsråder. Vidkun Quislings regjering satt inntil frigjøringen 8. mai 1945. I landssvikoppgjøret ble fire av ministrene dømt til døden for landsforræderi mens resten stort sett ble idømt lange fengselsstraffer."},{"page_url":"https://it.wikipedia.org/wiki/Telmesso","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Ancient_Cities_of_Lycia.png","page_title":"Telmesso","context_page_description":"Telmesso più tardi chiamata Anastasiopoli era una città dell'antica Licia posta a occidente della penisola ai confini con la Caria."},{"page_url":"https://fi.wikipedia.org/wiki/STS-6","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Sts-6-patch.png","page_title":"STS-6","context_page_description":"STS-6 oli Nasan avaruussukkulaohjelman kuudes ja Challenger-sukkulan ensimmäinen lento. Lähtö viivästyi kaikkiaan kahdella kuukaudella. Sukkulan moottoreita jouduttiin irrottamaan ja korjaamaan polttoainevuodon takia, ja sukkulan rahtiruuma sekä sinne asennettava satelliitti oli huollettava voimakkaan myrskyn aiheuttaman kontaminaation seurauksena. Laukaisu tapahtui lopulta 4. huhtikuuta 1983 kello 18:30 UTC Kennedyn avaruuskeskuksesta. Lento päättyi laskeutumiseen 9. huhtikuuta kello 18:53 Edwardsin lentotukikohtaan.\\nChallengerin komentaja lennolla oli Skylab-astronautti Paul J. Weitz. Ensimmäistä kertaa avaruuslennolla olivat lentäjä Karol J. Bobko sekä tehtäväspesialistit Donald H. Peterson ja Story Musgrave. Lennolla oli ensimmäistä kertaa käytössä kevennetyt kiinteän ajoaineen SRB-moottorit ja polttoainesäiliö. Hyötykuormana lennolla oli ensimmäinen avaruuslentojen tiedonsiirtoon tarkoitettu TDRS-satelliitti. Satelliitin irrotus onnistui, mutta sen geostationaariselle radalle viemiseksi tarkoitettu IUS-moottori ei toiminut, ja satelliitti jäi liian matalalle radalle."},{"page_url":"https://en.wikipedia.org/wiki/S%C3%B3c_Tr%C4%83ng_Airfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Operation_Shufly%2C_circa_1962_%286921645944%29.jpg","page_title":"Sóc Trăng Airfield","context_page_description":"Sóc Trăng Airfield was a French colonial, Imperial Japanese Army, United States Marine Corps, United States Army and Army of the Republic of Vietnam and Republic of Vietnam Air Force base located in Sóc Trăng in southern Vietnam."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BD%97%E4%BC%AF%E7%89%B9%C2%B7%E6%96%AF%E7%A7%91%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Men_hauling_supplies_-_Terra_Nova_Expedition.jpg","page_title":"罗伯特·斯科特","context_page_description":"羅伯特·法爾肯·史考特，CVO是一位英國海軍軍官和極地探險家，他曾帶領兩支探險隊前往南極地區，它們分別是1901-1904年的發現探險隊和1910-1913年命運不佳的特拉諾瓦探險隊。在第一次探險中，他創下了南緯82度的新記錄，並發現了南極高原，而南極點就位於南極高原。在第二次探險中，史考特帶領一個五人小組於1912年1月17日到達南極點，這距離阿蒙森南極探險隊到達還不到五個星期。\\n儘管史考特給出了書面指示，但原計劃與基地營地的輔助犬隊的會面還是失敗了。史考特和他的同伴在距離營地162英里和距離下一個倉庫約12.5英里的哈特角半島死亡。當史考特和他的團隊的屍體被發現時，人們發現他們找到了歷史上第一塊在南極發現的化石。這些化石被確定來自舌羊齒屬的植物，證明了南極洲曾經是一片森林，並與其他大陸相連。\\n在史考特被任命為發現探險隊的隊長之前，他曾在英國皇家海軍中擔任海軍軍官。1899年，他偶然遇到了皇家地理學會的主席克萊門茨·馬卡姆爵士，由此得知了計劃中的南極探險，他很快自願領導了這次探險。邁出這一步後，他的名字就與南極密不可分，在他生命的最後12年裡，他一直致力於這一領域的工作。\\n在史考特去世的消息傳出後，他成為了一個著名的英雄，這一地位反映在英國各地樹立的紀念碑上。然而，在20世紀的最後幾十年，人們對他的能力和性格提出了質疑。但是當人們意識到他的體溫在1912年3月降至零下−40 °C以下，並且重新發現史考特在1911年10月的書面命令，其中他指示狗隊在返回途中集合併協助他時，人們對他的評價才開始變得正面起來。"},{"page_url":"https://sv.wikipedia.org/wiki/Trachymyrmex","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Trachymyrmex_nogalensis_casent0000364_profile_1.jpg","page_title":"Trachymyrmex","context_page_description":"Trachymyrmex är ett släkte av myror. Trachymyrmex ingår i familjen myror."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0p_atma_cevizi","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Heaving_line_knot_step3.jpg","page_title":"İp atma cevizi","context_page_description":"İp atma cevizi ipin ucuna ip ağırlığı toplayıp ipi daha kolayca atabilmek için kullanılan bir düğüm çeşididir.\\nİp atma cevizi kendiliğinden çözülebilir.\\nİki yerine üç kat ip üzerine sarılanı daha ağır olur ve uç ip bedeni tarafındaki dirsek gözünden geçerek biter.\\nEğer uç bir dirsekten geçtikten sonra dolanıp diğer dirsekten de geçerek dirsekler boyu sarmallara dik yeni sarmallar oluşturursa bu El incesi cevizi olur; Daha ağır, daha zor çözülür bir ip atma cevizidir."},{"page_url":"https://pt.wikipedia.org/wiki/Bolo_(Galiza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/O_bolo.JPG","page_title":"Bolo (Galiza)","context_page_description":"O Bolo é um município da Espanha na província de Ourense, comunidade autónoma da Galiza. Tem 91,17 km² de área e em 2016 tinha 963 habitantes."},{"page_url":"https://pt.wikipedia.org/wiki/Margraviato_da_Mor%C3%A1via","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/PecetKonradaIIOty.jpg","page_title":"Margraviato da Morávia","context_page_description":"O Margraviato da Morávia ou Marca da Morávia foi uma marca de fronteira existente de 1182 a 1918 e uma das Terras da Coroa da Boêmia. Ele foi oficialmente administrado por um margrave em cooperação com uma dieta provincial. Ele foi diversamente um estado independente, de facto, e também sujeito ao Ducado, mais tarde, Reino da Boêmia. Ele compreende a região chamada de Morávia, dentro da atual República Checa."},{"page_url":"https://ceb.wikipedia.org/wiki/Lucernariidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Haliclystus_antarcticus_1.PNG","page_title":"Lucernariidae","context_page_description":"Pamilya sa mga mananap ang Lucernariidae. Ang Lucernariidae sakop sa kahanay nga Stauromedusae, klase nga Staurozoa, ka-ulo nga nidariya, ug kaginharian nga mananap. Ang kabanay nga Lucernariidae pagsakop 22 espesye, segun Catalogue of Life.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Mobilier_de_la_chambre_de_Mme_Guimard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Hector_Guimard%2C_Coupe_de_jardin%2C_vers_1905%2C_Fonderies_de_Saint-Dizier_%28Haute-Marne%29.jpg","page_title":"Mobilier de la chambre de Mme Guimard","context_page_description":"Le mobilier de la chambre de Mᵐᵉ Guimard est un ensemble de meuble de style Art nouveau réalisé à partir de 1909 par l'architecte lyonnais Hector Guimard, et aujourd'hui conservé au musée des Beaux-Arts de Lyon."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%B3_%D8%B3%D9%88%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Kikkoman_soysauce.jpg","page_title":"سس سویا","context_page_description":"سس سویا یا به زبان ژاپنی شویو نوعی سس تیره‌رنگ است که از دانه‌های گیاه سویا تهیه می‌شود. این سس شورمزه بوده و در آشپزی کشورهای خاور دور همچون چین و ژاپن کاربرد فراوانی دارد و از آن برای مزه‌دار کردن سوپ‌ها، مارینیدها، انواع گوشت، ماهی، سبزیجات و دیگر سس‌ها استفاده می‌شود."},{"page_url":"https://en.wikipedia.org/wiki/Stingray_phone_tracker","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Stingray.png","page_title":"Stingray phone tracker","context_page_description":"The StingRay is an IMSI-catcher, a controversial cellular phone surveillance device, manufactured by Harris Corporation. Initially developed for the military and intelligence community, the StingRay and similar Harris devices are in widespread use by local and state law enforcement agencies across Canada, the United States, and in the United Kingdom. Stingray has also become a generic name to describe these kinds of devices."},{"page_url":"https://hu.wikipedia.org/wiki/Jargeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Jargeau_depuis_la_rive_droite_de_la_Loire.JPG","page_title":"Jargeau","context_page_description":"Jargeau település Franciaországban, Loiret megyében. Lakosainak száma 4499 fő. Jargeau Darvoy, Bou, Mardié, Sandillon, Saint-Denis-de-l'Hôtel, Férolles és Ouvrouer-les-Champs községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Iapygia_quadrangle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Saheki_Crater_closeup_of_layers.JPG","page_title":"Iapygia quadrangle","context_page_description":"The Iapygia quadrangle is one of a series of 30 quadrangle maps of Mars used by the United States Geological Survey Astrogeology Research Program. The Iapygia quadrangle is also referred to as MC-21.\\nThe Iapygia quadrangle covers the area from 270° to 315° west longitude and from 0° to 30° south latitude on Mars. Parts of the regions Tyrrhena Terra and Terra Sabaea are found in this quadrangle. The largest crater in this quadrangle is Huygens. Some interesting features in this quadrangle are dikes. the many layers found in Terby crater, and the presence of carbonates on the rim of Huygens crater."},{"page_url":"https://en.wikipedia.org/wiki/Brampton_Arts_Walk_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Flower_City_Parade_2011_Bipasha_Basu_and_RDB_2.jpg","page_title":"Brampton Arts Walk of Fame","context_page_description":"The Brampton Arts Walk of Fame is an honours system located at the Rose Theatre Brampton, in Ontario, Canada. It previously was known as the Brampton Walk of Fame, or Art Walk of Fame. The first currently recognized inductions took place in 2014, and include past and present residents of Brampton.\\nA previous incarnation, launched in summer 2011 in promotion of the International Indian Film Academy Awards, included an actress who was making her first visit to Brampton. None of these inductions have been followed through on, beyond their initial events."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_der_Hamburgischen_B%C3%BCrgerschaft_(11._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/IngeKazamel.jpg","page_title":"Liste der Mitglieder der Hamburgischen Bürgerschaft (11. Wahlperiode)","context_page_description":"Diese Liste nennt die Mitglieder der Hamburgischen Bürgerschaft während der 11. Wahlperiode."},{"page_url":"https://ca.wikipedia.org/wiki/Can_Crosas_(Tavertet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/118_Can_Crosses%2C_c._de_Baix_7_%28Tavertet%29.jpg","page_title":"Can Crosas (Tavertet)","context_page_description":"Can Crosas és una casa de colònies de Tavertet. L'edifici és una obra inclosa a l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://lv.wikipedia.org/wiki/Baltijas_valstu_nacion%C4%81lo_parku_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Lithuania_Plateliai_lake.jpg","page_title":"Baltijas valstu nacionālo parku uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti nacionālie parki, kas atrodas Baltijas valstīs: Igaunijā, Latvijā un Lietuvā. Kopumā Baltijas valstīs ir 14 nacionālie parki. Vilsandi nacionālais parks ir vecākais nacionālais parks Baltijas reģionā, jaunākais — Rāznas nacionālais parks. Lielākais nacionālais parks Baltijas valstu reģionā ir Gaujas nacionālais parks, savukārt mazākais — Traķu vēsturiskais nacionālais parks."},{"page_url":"https://en.wikipedia.org/wiki/Ros_Beiaard_Dendermonde","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Ros_beiaard_90.jpg","page_title":"Ros Beiaard Dendermonde","context_page_description":"Ros Beiaard of Dendermonde is a large folkloristic horse. It differs from the other Ros-Beiaard horses because it is used only once every ten years and because the horse is carried by people. The Ros Beiaard is on UNESCO's list of Masterpieces of the Oral and Intangible Heritage of Humanity, under the \\"Processional giants and dragons in Belgium and France\\"."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9F%E0%B1%8A%E0%B0%B0%E0%B0%82%E0%B0%9F%E0%B1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Toronto_Landsat.jpg","page_title":"టొరంటో","context_page_description":"టొరంటొ పట్టణం కెనడా దేశంలోని పెద్ద ప్రధాన మయిన భిన్న జాతులు సంస్కృ తులు కలసి నివసించే అందమయిన పట్టణం.\\nటొరంటో కెనడాలో అతి పెద్ద నగరం. టొరంటో దక్షిణ ఒంటారియో వాయవ్య దిశలో ఉంది. 18వ శతాబ్దంలో మిసిసాగా వద్ద భూములను ఒప్పందం ద్వారా కొనుగోలు చేయడంతో టొరంటో\\nచరిత్ర మొదలైంది. తరువాత బ్రిటిష్ ప్రభుత్వం టౌన్ ఆఫ్ యోర్క్ పేరుతో ఒక పట్టణాన్ని స్థాపించింది. తరువాత లెఫ్టినెంట్ గవర్నర్ జాన్ గ్రేవ్స్ సింకో టౌన్ ఆఫ్ యోర్క్ ను ఎగువ కెనడా రాజధానిగా రూపుదిద్దాడు. 1812 లో బాటిల్ ఆఫ్ యోర్క్ యుద్ధంలో ఈ నగరం దోపిడీకి గురైంది. 1834 లో యోర్క్‌కు నగర అతస్థు ఇచ్చి టొరంటో అని పేరును పేరుమార్పిడి చేసారు.ఈ నగరం 1849, 1904 లలో రెండు మార్లు అగ్నిప్రమాదానికి గురైంది. టొరంటో పలుమార్లు పొరుగున ఉన్న పురపాలకాలను కలుపుకుంటూ తన సరిహద్దులను విస్తరించింది. సరికొత్తగా 1998లో టొరంటో సరిహద్దులను విస్తరించింది.\\n2011 గణాంకాలను అనుసరించి టొరంటో నగరంలో 2.6 మిలియన్ల నివాసులు ఉన్నారు. టొరంటో ఉత్తర అమెరికాలో జనసంఖ్యపరంగా ఐదవ స్థానలో ఉంది. 2011 గణాంకాలను అనుసరించి ది సెంసస్ మెట్రోపాలిటన్ ఏరియా జనసంఖ్య 55,83,064 ఉండగా, టొరంటో మహానగర జనసంఖ్య 60,54,191 ఉంది. టొరంటో మహానగరం హృదయస్థానంలో టొరంటో\\nనగరం ఉంది. అలాగే గోల్డెన్ హార్స్‌షూ అనబడే దక్షిణ ఒంటారియోలో టొరంటో అత్యంత జనసాంద్రత కలిగిన ప్రాంతం అని అంచనా."},{"page_url":"https://ca.wikipedia.org/wiki/Eleccions_presidencials_dels_Estats_Units_de_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Duncan_Hunter%2C_official_photo_portrait%2C_color.jpg","page_title":"Eleccions presidencials dels Estats Units de 2008","context_page_description":"Les eleccions presidencials dels Estats Units de 2008 es van celebrar el dia 4 de novembre de 2008. Enfrontaren Barack Obama del Partit Demòcrata i John McCain del Partit Republicà. Les eleccions determinaren els electors del Col·legi Electoral dels Estats Units, i el candidat presidencial que va rebre una majoria de vots per part del Col·legi Electoral, Obama, va convertir-se en el 44è President dels Estats Units, mentre que el candidat vicepresidencial Joe Biden va convertir-se en el 47è Vicepresident dels Estats Units.\\nTal com va ocórrer en les eleccions presidencials de 2004, l'assignació dels vots electorals a cada estat es basà parcialment amb el cens dels Estats Units corresponent a l'any 2000. El president i el vicepresident electes prengueren possessió dels càrrecs el dimarts, 20 de gener de 2009."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D1%80%D0%BD%D0%B0_%D0%93%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Lynx_lynx_poing.jpg","page_title":"Црна Гора","context_page_description":"Црна Гора је суверена држава у југоисточној Европи. Она обухвата обалу Јадранског мора на југозападу и граничи се са Хрватском на западу, Босном и Херцеговином на сјеверозападу, Србијом на сјевероистоку и истоку и Албанијом на југоистоку. На југозападу је Јадранско море дијели од Италије. Њен главни и највећи град је Подгорица, док Цетиње има статус пријестонице.\\nУ 9. вијеку, три средњовијековне српске кнежевине су биле смјештене на територији данашње Црне Горе: Дукља, приближно одговара јужној половини државе; Травунија, на западу и Рашка, на сјеверу. Године 1042, архонт Стефан Војислав je водио побуну која је резултирала независношћу Дукље од Византијског царства и успостављање династије Војислављевића. Послије контроле неколико регионалних сила и Османског царства у наредним вијековима, постала је дио Краљевине Југославије 1918. године, коју је 1945. године наслиједила Социјалистичка Федеративна Република Југославија."},{"page_url":"https://it.wikipedia.org/wiki/Bobby_Simmons","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bobby_Simmons.jpg","page_title":"Bobby Simmons","context_page_description":"Bobby Dean Simmons è un ex cestista statunitense, professionista nella NBA."},{"page_url":"https://sk.wikipedia.org/wiki/Jean-Fran%C3%A7ois_Lyotard","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Jean-Francois_Lyotard.jpg","page_title":"Jean-François Lyotard","context_page_description":"Jean-François Lyotard bol francúzsky filozof a literárny teoretik.\\nAko filozof bol hlavný predstaviteľ filozofického postmodernizmu alebo postmodernej filozofie. Pod titulom postmoderna formuluje ako základný problém súčasnosti neriešiteľnosť sporu heterogénnych typov diskurzov, spôsobov vedenia a životných foriem, a snaží sa v „relektúre“ moderných filozofov ako Kant a Wittgenstein vyvinúť filozofiu, ktorá by dokázala čeliť oným rozporom.\\nPodľa Lyotarda je postmoderná situácia daná zlyhaním moderného projektu emancipácie ľudstva, pričom predpoklady adekvátnej reakcie na túto situáciu tkvejú v avantgardách. Lyotard podáva vehementnú obhajobu predvojnových avantgárd."},{"page_url":"https://en.wikipedia.org/wiki/Penguin","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Penguins_on_Gourdin_Island.jpg","page_title":"Penguin","context_page_description":"Penguins are a group of aquatic flightless birds. They live almost exclusively in the Southern Hemisphere, with only one species, the Galápagos penguin, found north of the equator. Highly adapted for life in the water, penguins have countershaded dark and white plumage and flippers for swimming. Most penguins feed on krill, fish, squid and other forms of sea life which they catch while swimming underwater. They spend roughly half of their lives on land and the other half in the sea.\\nAlthough almost all penguin species are native to the Southern Hemisphere, they are not found only in cold climates, such as Antarctica. In fact, only a few species of penguin live so far south. Several species are found in the temperate zone, but one species, the Galápagos penguin, lives near the equator.\\nThe largest living species is the emperor penguin: on average, adults are about 1.1 m tall and weigh 35 kg. The smallest penguin species is the little blue penguin, also known as the fairy penguin, which stands around 33 cm tall and weighs 1 kg. Among extant penguins, larger penguins inhabit colder regions, while smaller penguins are generally found in temperate or even tropical climates."},{"page_url":"https://de.wikipedia.org/wiki/Denkm%C3%A4ler_der_Volksrepublik_China_(Peking)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%E7%9A%87%E5%8F%B2%E5%AE%AC.jpg","page_title":"Denkmäler der Volksrepublik China (Peking)","context_page_description":"Die folgende Tabelle bietet eine Übersicht zu sämtlichen Denkmälern in der regierungsunmittelbaren Stadt Peking, die auf der Denkmalliste der Volksrepublik China stehen:"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BD%BD%E8%84%82%E8%9B%8B%E7%99%BDA1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/PBB_GE_APOA1_217073_x_at_tn.png","page_title":"载脂蛋白A1","context_page_description":"载脂蛋白A1为附着于高密度脂蛋白及乳靡小球上的载脂蛋白，基因编码为“APOA1”。载脂蛋白A1可以活化卵磷脂-胆固醇酰基转移酶；当高密度脂蛋白运送组织中多余的胆固醇回到肝脏细胞中时，载脂蛋白A1同时也可作为高密度脂蛋白的配体，在脂质代谢中扮演重要角色。研究指出，APOA1的mRNA是由反义RNA转译出的内源性蛋白质所调控。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BD%97%E5%AF%86%E6%AC%A7%C2%B7%E8%BE%BE%E8%8E%B1%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Romeo_Dallaire_signing.jpg","page_title":"罗密欧·达莱尔","context_page_description":"羅密歐·安東尼厄斯·達萊爾 OC， CMM， GOQ， MSC， CD，加拿大國會上議院議員、人道主義者、作家、退休將軍，是1994年盧安達大屠殺期間聯合國駐盧安達維和部隊的司令官，曾率領一支不足300人的多國部隊成功挽救了將近兩萬多平民的性命。"},{"page_url":"https://ca.wikipedia.org/wiki/L%C3%BCderitz","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Luderitz%2C_Leuchtturm_auf_der_Haifischinsel.jpg","page_title":"Lüderitz","context_page_description":"Lüderitz és una ciutat portuària de Namíbia, situada a la regió Karas, la regió més al sud del país. Té una població de 13.700 habitants i una superfície de 48225 km², a la badia Lüderitzer Bucht entre l'Oceà Atlàntic i el desert del Namib. La ciutat més propera Aus es troba a 125 km a través del desert vers el llevant.\\nDes de l'inici al segle XIX, el port comercial va ser important. La creació del ferrocarril cap a Keetmanshoop el 1905 va desenclavar-lo. En l'actualitat serveix principalment pel transport de mercaderies. Pel seu ric patrimoni arquitectònic, es troba a la ruta europea del modernisme."},{"page_url":"https://fr.wikipedia.org/wiki/Normande","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Jersey_cattle_in_Jersey.jpg","page_title":"Normande","context_page_description":"La normande est une race bovine française originaire de Normandie. C'est une vache de taille moyenne, qui a une robe caractéristique, blanche avec plus ou moins de taches brunes ou bringées. Elle a la réputation d'être une race mixte, qui produit une viande de qualité et dont le lait est particulièrement bien adapté à la transformation fromagère, du fait de ses forts taux butyreux et protéiques, et de la nature des caséines qu'il contient.\\nPour certains la normande trouverait ses origines chez des bovins amenés dans la région par les Vikings. Même si cette hypothèse a peut-être une part de vérité, la normande telle qu'on la connaît actuellement est proche d'autres races anglo-normandes comme la jersiaise, et est issue de la fusion de diverses races locales dont notamment la cotentine et l'augeronne. La race a été ensuite influencée par l'infusion de sang durham au XIXᵉ siècle, et a vu ses conditions d'élevage et donc son format s'améliorer avec les progrès de l'agriculture. Le herd-book de la race est créé en 1883, et la sélection de la race s'organise petit à petit."},{"page_url":"https://la.wikipedia.org/wiki/Genus_florale","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Gustav_Klimt_046.jpg","page_title":"Genus florale","context_page_description":"Genus florale vel genus Libertyanum fuit genus et inclinatio artificum sat multis in terris orbis dispersorum ad novas artes creandas."},{"page_url":"https://fr.wikipedia.org/wiki/Aktion_T4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Alkoven_Schloss_Hartheim_2005-08-18_3589.jpg","page_title":"Aktion T4","context_page_description":"Aktion T4 est le nom donné, après la Seconde Guerre mondiale, à la campagne d'extermination d'adultes handicapés physiques et mentaux par le régime nazi, de 1939 à août 1941, et qui fait de 70 000 à 80 000 victimes.\\nFondée sur un terreau idéologique fertile prônant une politique eugéniste active, antérieure au nazisme mais exacerbée par celui-ci, favorisée par une intense campagne de propagande en faveur de la stérilisation et de l'euthanasie des handicapés, elle est le fruit d'une décision personnelle d'Adolf Hitler ; celui-ci en confie l'exécution à la chancellerie du Führer, dirigée par Philipp Bouhler. Mise en œuvre par des médecins nazis convaincus par les thèses du régime, et du personnel issu de la SS, elle se traduit par des mises à mort à grande échelle au moyen de chambres à gaz spécialement construites à cet effet dans six centres dédiés à ces opérations. Bien que des efforts soient déployés pour garder l'opération secrète, celle-ci devient de plus en plus connue au fil des mois, ce qui suscite des protestations qui contribuent à son arrêt officiel, l'objectif exterminateur que les nazis s'étaient fixé ayant de toute manière été atteint."},{"page_url":"https://pt.wikipedia.org/wiki/Miss_Jap%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Riyo_Mori_headshot.png","page_title":"Miss Japão","context_page_description":"Miss Japão é um tradicional concurso de beleza feminino realizado anualmente no país asiático e que tem como objetivo levar, a melhor e mais capacitada candidata em busca do título de Miss Universo. O país já acumula duas coroas universais, a primeira em 1959 com Akiko Kojima e a segunda em 2007 com a bailarina Riyo Mori. Atualmente a organização do concurso está sobre a posse da IBG Japan, que é a franquia responsável local do Miss Universe Organization. Antes de trocar de mãos, o certame era realizado pela competente francesa Inès Ligron, que foi responsável por levar o nome do país novamente entre os mais cotados do concurso internacional."},{"page_url":"https://ro.wikipedia.org/wiki/Rezerva%C8%9Bia_peisagistic%C4%83_Trebujeni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Valea_Rautului_Trebujeni-Furceni_Orhei_%2811%29.jpg","page_title":"Rezervația peisagistică Trebujeni","context_page_description":"Rezervația peisagistică Trebujeni este o arie protejată, situată între satele Trebujeni și Furceni din raionul Orhei, Republica Moldova. Are o suprafață de 500 ha și este administrată de două instituții: Gospodăria Silvică de Stat Orhei și Primăria satului Tribujeni."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%93%D7%A8%D7%99%D7%9B%D7%9C%D7%95%D7%AA_%D7%92%D7%95%D7%AA%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/West_facade_of_the_Laon_cathedral-5639.jpg","page_title":"אדריכלות גותית","context_page_description":"אַדְרִיכָלוּת גּוֹתִית היא סגנון אדריכלות שהתפתח באירופה בימי הביניים, שבא לידי ביטוי בעיקר בקתדרלות, בכנסיות ובמנזרים שנבנו בתקופה זו. האדריכלות הגותית החלה להתפתח באמצע המאה ה-12 בצרפת ובאנגליה, והיא נחשבת לאחד הפרקים המיוחדים והמרשימים בהיסטוריה של אדריכלות המערב."},{"page_url":"https://fr.wikipedia.org/wiki/Bible_de_Wenceslas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/StvoreniEvy.jpg","page_title":"Bible de Wenceslas","context_page_description":"La Bible de Wenceslas est un manuscrit enluminé composé entre 1390 et 1400 à Prague et conservé à la Bibliothèque nationale autrichienne à Vienne sous la cote Codex Vindobonensis 2759-2764. Cette Bible illustrée écrite en allemand a été commandée pour le roi Wenceslas IV de Bohême."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%BD%D5%BA%D5%A1%D5%B6%D5%AB%D5%A1%D5%B5%D5%AB_%D5%BF%D5%B6%D5%BF%D5%A5%D5%BD%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Airbus_Military_CASA_C-295AEW.jpg","page_title":"Իսպանիայի տնտեսություն","context_page_description":"Իսպանիայի տնտեսությունը հանդիսանում է Եվրոպական Միության մեծությամբ 5-րդը և աշխարհում 12-րդը: Իսպանիան հանդիսանում է արդյունաբերական երկիր և բացի այդ, այն հանդիսանում է Արևմտյան Եվրոպայի խոշորագույն արտադրողներից մեկը: Ունենալով աշխարհի ամենամեծ տնտեսությունն ունեցող երկրներից մեկը՝ Իսպանիան ունի լրջագույն համակարգային դժվարություններ, որոնք կապված են պետական պարտքի, գործազրկության չափազանց բարձր մակարդակի, տարածաշրջանային շոշափելի անհամաչափության և դրանից բխող ակտիվ անջատողականության հետ:"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%AF_%D8%AA%D8%B1%D8%A7%D9%85%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Judd_Trump_May_2015.jpg","page_title":"جود ترامب","context_page_description":"جود ترامب ‏ هو لاعب سنوكر بريطاني، ولد في 20 أغسطس 1989 في Whitchurch في المملكة المتحدة."},{"page_url":"https://fr.wikipedia.org/wiki/Colin_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Colin_Jackson_Eupean_Cup_2007.jpg","page_title":"Colin Jackson","context_page_description":"Colin Ray Jackson est un athlète britannique spécialiste du 110 mètres haies.\\nS'il n'a jamais obtenu la consécration olympique, il est l'un des meilleurs coureurs de haies hautes de l'histoire, ayant remporté 25 médailles internationales dont trois titres mondiaux, huit titres européens et deux titres aux Jeux du Commonwealth.\\nIl est resté détenteur du record du monde du 110 mètres haies pendant près de treize ans avec un temps établi en 12 s 91 le 20 août 1993 lors des Mondiaux de Stuttgart, amélioré successivement par le Chinois Liu Xiang, le Cubain Dayron Robles et l'Américain Aries Merritt. Il est encore détenteur du record du monde du 60 mètres haies en salle avec le temps de 7 s 30. Classé parmi les dix meilleurs athlètes de la discipline de 1987 à 2000, le Gallois a établi à quatre reprises la meilleure performance mondiale de l'année, en 1990 et de 1992 à 1994, et est descendu cinq fois sous la barrière des treize secondes.\\nAprès avoir pris sa retraite sportive au début de l'année 2003, Colin Jackson est devenu entraîneur d'athlétisme et exerce en parallèle le métier de présentateur et commentateur sportif pour la BBC. Il a fait son coming-out en 2017."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9B%E0%B4%BE%E0%B4%AF%E0%B4%BE%E0%B4%97%E0%B5%8D%E0%B4%B0%E0%B4%BE%E0%B4%B9%E0%B4%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Electro_35_camera.JPG","page_title":"ഛായാഗ്രാഹി","context_page_description":"ചിത്രങ്ങൾ പകർത്താനുപയോഗിക്കുന്ന യന്ത്രത്തെയാണ് ക്യാമറ അഥവാ ഛായാഗ്രാഹി എന്നു പറയുന്നത്. രംഗത്തിന്റെ ഒരു യഥാർത്ഥചിത്രം ക്യാമറയിലെ ലെൻസ് അതിനു പുറകിലുള്ള ഒരു പ്രകാശസംവേദനശേഷിയുള്ള പദാർത്ഥത്തിൽ പതിപ്പിക്കുന്നു. അങ്ങനെ ഈ ചിത്രം ആ പദാർത്ഥത്തിൽ ശേഖരിക്കപ്പെടുന്നു.\\nഫിലിം ഉപയോഗിക്കുന്ന തരം നിശ്ചലഛായാഗ്രാഹിയിൽ ഈ പ്രകാശസംവേദനപദാർത്ഥം ഒരു ഛായാഗ്രഹണഫിലിം ആയിരിക്കും. ഒരു ചലച്ചിത്രഛായാഗ്രാഹിയിൽ ചലിച്ചുകൊണ്ടിരിക്കുന്ന ഛായാഗ്രഹണഫിലിം നാടയായിരിക്കും ഈ സ്ഥാനത്തുണ്ടായിരിക്കുക. ഈ നാടയിൽ ഒരു ചെറിയ ഇടവേളയിൽത്തന്നെ ചിത്രങ്ങൾ ഒന്നിനു പുറകേ ഒന്നായി തുടർച്ചയായി ആലേഖനം ചെയ്യപ്പെടുന്നു.\\nഎന്നാൽ ഒരു ടെലിവിഷൻ ക്യാമറ അഥവാ വീഡിയോ ക്യാമറയിൽ പ്രകാശസംവേദനക്ഷമതയുള്ള വൈദ്യുതോപകരണത്തിലാണ് ലെൻസിൽ നിന്നുള്ള ചിത്രം പതിക്കുന്നത്. ഈ ഉപകരണം ചിത്രത്തെ വൈദ്യുതതരംഗങ്ങളാക്കി മാറ്റുന്നു. ഡിജിറ്റൽ ഛായാഗ്രാഹിയിലും ഇത്തരം സെൻസറുകളാണ് ഫിലിമിന് പകരമായി ഉപയോഗിക്കുന്നത്."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_ora%C8%99elor_din_Rom%C3%A2nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Cetate_medievala%2CRasnov-Brasov.JPG","page_title":"Lista orașelor din România","context_page_description":"Aceasta este lista orașelor din România ordonată după populație, conform recensământului din 2011. Tabelul de mai jos cuprinde numai cele 265 orașe existente în România la data recensământului din 2002.\\nUlterior, au mai fost declarate oficial încă 54 orașe. În prezent în România există 319 orașe. Ele sunt enumerate mai jos, în lista alfabetică. Orașele îngroșate sunt reședințe de județ."},{"page_url":"https://pl.wikipedia.org/wiki/Osiedle_Tadeusza_Kotarbi%C5%84skiego_(Koszalin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Koszalin%2C_ko%C5%9Bci%C3%B3%C5%82_na_ul._St._Stasica_-_001.JPG","page_title":"Osiedle Tadeusza Kotarbińskiego (Koszalin)","context_page_description":"Osiedle im. Tadeusza Kotarbińskiego – osiedle w północnej części Koszalina.\\nOsiedle powstało w technice wielkopłytowej po 1970 jako kolejny etap budowanego Osiedla Północ. Obecną nazwę nadano po 1990, pochodzi ona od biegnącej środkiem osiedla ulicy Tadeusza Kotarbińskiego. Granice osiedla im. Tadeusza Kotarbińskiego wyznaczają ulice Stanisława Staszica, Jana Pawła II i Władysława IV. Od północy granicą jest linia kolejowa Koszalin-Gdańsk, a od północnego wschodu Zespół przyrodniczo-krajobrazowy „Wąwozy grabowe”.\\nPrzed istniejącym w południowej części osiedla kościołem pw. Ducha Świętego bł. Jan Paweł II odprawił w dniu 1 czerwca 1991 mszę świętą. Na terenie Osiedla im. Tadeusza Kotarbińskiego znajduje się Galeria Emka.\\nNa terenie osiedla znajdują się ulice:\\nul. Jana Pawła II;\\nul. Stanisława Staszica;\\nul. Tadeusza Kotarbińskiego;\\nul. Władysława IV;\\nul. Władysława Tatarkiewicza;\\nul. Zenona Klemensiewicza;\\nul. Wacława Sierpińskiego;\\nul. Adama Próchnika;\\nul. Witolda Doroszewskiego;\\nul. Kazimierza Wyki;\\nul. Ignacego Chrzanowskiego\\nul. Juliana Krzyżanowskiego\\nul. Akademicka;\\nul. Wąwozowa"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AC%D8%B1%D8%A9_%D9%85%D8%A7%D9%81%D9%8A_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Heart_and_Soul_nebulae.jpg","page_title":"مجرة مافي 2","context_page_description":"مجرة مافي 2 هي مجرة حلزونية متوسطة تبعد 10 مليون سنة ضوئية وتقع بعيدا في كوكبة ذات الكرسي.\\nوقد تم اكتشاف مجرتي مافي 1 ومافي 2 بواسطة العالم الفلكي باولو مافي في عام 1968 بواسطة انبعاث الاشعة تحت الحمراء. وتقع المجرة في منطقة التفادي وهي محجوبة بنسبة 99.5% بواسطة سحب الغبار من مجرة درب التبانة. ولذلك فالبكاد يمكن كشفها بواسطة الانبعاثات الضوئية. بعد اكتشافها حدث جدال حول ما اذا كانت أحد مجرات المجموعة المحلية. ولكنها الان عضو في مجموعة مجرية قريبة يطلق عليها مجموعة IC 342 / مافاي وهي اقرب المجموعات المجرية للمجموعة المحلية."},{"page_url":"https://tr.wikipedia.org/wiki/Santa_Barbara,_Kaliforniya","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/View_of_Santa_Barbara_Courthouse_to_Mission.JPG","page_title":"Santa Barbara, Kaliforniya","context_page_description":"Santa Barbara, ABD'nin batısında Büyük Okyanusu sahilinde, denize dikçe inen \\"Santa Knez Sıradağları\\" eteklerinde Kaliforniya eyaletinde bir tatil şehridir. \\"Santa Barbara Kontluğu\\"nun merkez şehridir.\\nLos Angeles'ın merkezinin kuzeybatısındadır. Ilıman iklimi, uzun kumlu sahilleri ve eski tip kırmızı kiremitlerle kaplı çatıları bulunan ve bazıları Amerika'ya göre gayet eskiden yapılmış binaları ile \\"Birleşik Amerika Rivierası\\" takma adını almıştır. Santa Barbara şehri Birleşik Amerika'da, New York şehrinin Manhattan beldesi, Seattle ve Miami'den sonra en yüksek gelirli kişilerini konsantre olup ikamet ettikleri şehirsel yerleşkedir. Nüfusu şehir sınırları içinde 1 Nisan 2010 tarihli nüfus sayımına göre 88,410 kişi ve 2014 son nüfus tahminine göre 91,196 kisidir. Şehre bağlı olan varoşlar \\"Goleta\\", \\"Montecito\\" ve \\"Carpinteria\\" olup şehirde ve bu varoşlarla birlikte toplam yaklaşık 400,000 kişi yaşamaktadır."},{"page_url":"https://pl.wikipedia.org/wiki/Bela_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Nte-kir-4bela.jpg","page_title":"Bela IV","context_page_description":"Bela IV, węg. IV. Béla – król Węgier i Chorwacji w latach 1235–1270 z dynastii Arpadów."},{"page_url":"https://nl.wikipedia.org/wiki/De_Ster_(Rotterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/De_Ster_en_De_Lelie_-_Kralingse_Plas.jpg","page_title":"De Ster (Rotterdam)","context_page_description":"De Ster is een 8-kante stellingmolen uit 1866 gelegen aan de Kralingse Plas in Rotterdam, naast molen De Lelie. In deze twee windmolens worden nog altijd snuiftabak en specerijen gemalen.\\nDe Ster is gebouwd op de fundering van een eerdere korenmolen met dezelfde naam, die in 1865 afbrandde. Bij de bouw werden onderdelen gebruikt van een andere snuifmolen, De Stier, die in Rijswijk heeft gestaan.\\nDe molen brandde op 13 juli 1962 af en werd in 1969 herbouwd.\\nDe Ster heeft een kollergang voor het malen van specerijen, vijf stampkuipen voor het hakken van snuiftabak en twee koppels maalstenen voor het malen van specerijen."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%89szak-Amerika_dinoszauruszainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Coelurus_BW.jpg","page_title":"Észak-Amerika dinoszauruszainak listája","context_page_description":"Az alábbi dinoszaurusz lista olyan nemeket tartalmaz, amelyek Észak-Amerika területéről kerültek elő. Észak-Amerikában sokféle dinoszaurusz nagy mennyiségű fosszíliáját fedezték fel. Ez nem feltétlenül jelenti azt, hogy többféle vagy nagyobb számú dinoszaurusz élt ezen a területen; lehet hogy egyszerűen csak kedvezőbbek voltak a feltételek a fosszilis rekord számára.\\nA triász időszakban olyan dinoszauruszok éltek a kontinensen, mint a Coelophysis, a Chindesaurus, a Gojirasaurus és a Tawa. A Tawa fosszíliáit Dél-Amerikában is megtalálták, ami fontos ősföldrajzi utalás. A kora jura kor során Észak-Amerikában olyan dinoszauruszok éltek, mint a Dilophosaurus, az Anchisaurus, az Ammosaurus, a Syntarsus, valamint a korai thyreophora, a Scutellosaurus. Ezek közül az utóbbit az összes stegosaurus és ankylosaurus ősének tartják. Észak-Amerikában a középső jura kor maradványai csak hiányosan találhatók meg, Mexikóban azonban több lelőhely is ismert. Lábnyomok, tojáshéjak, fogak és csonttöredékek prezentálják a theropodákat, a sauropodákat és az ornithopodákat, de egyikük sem elég diagnosztikus a nemek meghatározásához.\\nAzonban a késő jura kori Észak-Amerika éppen a középső jura ellentéte."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%BE-%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%8C%D0%BA%D1%96_%D0%B2%D1%96%D0%B4%D0%BD%D0%BE%D1%81%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Stanis%C5%82aw_Leszczy%C5%84ski.PNG","page_title":"Польсько-французькі відносини","context_page_description":"Польсько-французькі відносини сягають кількох століть, хоча вони справді стали актуальними лише за часів Французької революції та правління Наполеона I. Поляки були союзниками Наполеона; велика польська громада оселилася у Франції у 19 столітті, а поляки та французи також були союзниками у міжвоєнний період. Хоча ніколи в історії польська армія не воювала проти своїх французьких колег, дві країни не мали добрих стосунків у минулому, через небажання Франції допомагати Польщі у Другій світовій війні та пізніше, західній зраді, в якій звинувачували Францію за продаж Польщі Радянському Союзу. Офіційні відносини, охололи під час « холодної війни», покращилися після падіння комунізму. В даний час обидві країни входять до складу Європейського Союзу та НАТО. Польща також є спостерігачем у міжнародній організації де франкофонії."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_de_Clamart","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Cimeti%C3%A8res_de_Clamart_et_de_Sainte-Catherine_%C3%A0_Paris.jpg","page_title":"Cimetière de Clamart","context_page_description":"Le cimetière de Clamart est un ancien cimetière qui était bordé par la rue des Fossés-Saint-Marcel et la rue du Fer-à-Moulin dans le 5ᵉ arrondissement de Paris\\nIl ne faut pas le confondre avec les deux cimetières actuels de Clamart ville des Hauts-de-Seine :\\nle cimetière intercommunal de Clamart, également appelé Cimetière du Parc, créé en 1957 ;\\nle cimetière du Bois-Tardieu\\nni avec l'ancien cimetière de la ville de Clamart, établi dans cette commune de 1793 à 1868 place Hunebelle, alors place Saint-Pierre."},{"page_url":"https://pt.wikipedia.org/wiki/Copa_do_Mundo_de_Futebol_Feminino_de_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Waldstadionold2.jpg","page_title":"Copa do Mundo de Futebol Feminino de 2011","context_page_description":"A Copa do Mundo de Futebol Feminino de 2011 aconteceu na Alemanha entre 26 de junho e 17 de julho de 2011. O país foi confirmado em eleição realizada em Zurique, em 30 de outubro de 2007.\\nSeis países demonstraram interesse de receber o torneio, no entanto, apenas dois mantiveram-se na disputa: Alemanha e o Canadá. A Federação Internacional de Futebol estudou a possibilidade de aumentar o número de participantes, de 16 para 24, como fez com os torneios de juniores, para reflectir o crescimento da popularidade do esporte no mundo todo, mas acabou por manter o número nos 16 atuais.\\nAs bicampeãs mundiais alemãs qualificaram-se automaticamente como nação anfitriã. As restantes equipas nacionais obtiveram qualificação, através das suas confederações continentais, entre 2009 e 2010.\\nNa final, a seleção japonesa conquistou pela 1ª vez o título ao derrotar as estadunidenses nos pênaltis, após empate em 2–2 no tempo normal e na prorrogação."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Sundern_(Sauerland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/A_1026_Allendorf.jpg","page_title":"Liste der Baudenkmäler in Sundern (Sauerland)","context_page_description":"In der Liste der Baudenkmäler in Sundern (Sauerland) sind alle Baudenkmäler der Stadt Sundern im Hochsauerlandkreis in Nordrhein-Westfalen aufgeführt. Grundlage ist die Denkmalliste der Stadt Sundern, die – einschließlich der Bodendenkmäler – 188 Einträge umfasst. Denkmäler sind in allen Ortsteilen außer Meinkenbracht und Stemel ausgewiesen.\\nDie Liste ist nach Ortsteilen sortiert."},{"page_url":"https://en.wikipedia.org/wiki/Optare_MetroRider","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Vale_Travel_N149_BOF.JPG","page_title":"Optare MetroRider","context_page_description":"The Optare MetroRider is a midibus that was built by Optare between 1989 and 2000. Optare based the original design on the MCW Metrorider after Optare bought the rights following a decision by MCW to end bus production. This model also replaced the less successful StarRider and the replacement of this model is the low-floor Optare Solo.\\nThe MetroRider is an integral bus, which means the chassis and body are constructed as a single structure. It had many options, and was available in three lengths and two widths. In addition, Optare offered the option of a protruding, more substantial, destination display, as opposed to the flat on the body destination display.\\nIn later years, the MetroRider could be ordered with a one-piece rather than a standard two-piece windscreen which, in turn, became standard. Among the most popular versions was the basic model, with short length, standard 1 door and no blind-box."},{"page_url":"https://ja.wikipedia.org/wiki/An-2_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/CCCP-01880_Antonov_An.2_Aeroflot_%287723969868%29.jpg","page_title":"An-2 (航空機)","context_page_description":"An-2は、第二次世界大戦後の1947年にソ連のアントーノフ設計局で開発された複葉機である。\\nロシア語の愛称は「ククルーズニク」であった。アメリカ国防総省が割り当てたコードネームはType 22。北大西洋条約機構の付与したNATOコードネームは「コルト」。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B7%D0%BD%D0%B0%D0%BD%D0%B8%D0%B5_%D0%BF%D0%B8%D0%BB%D0%BE%D1%82%D0%B0_%D0%9F%D0%B8%D1%80%D0%BA%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Skylab_%28SL-4%29.jpg","page_title":"Дознание пилота Пиркса","context_page_description":"«Дознание пилота Пиркса» — советско-польский кинофильм 1978 года режиссёра Марека Пестрака по повести Станислава Лема «Дознание» из цикла «Рассказы о пилоте Пирксе».\\nСюжет картины исследует проблему: «Человек или машина?». Съёмки проходили по всему СССР, включая 2—3 месяца в павильоне. Картина характерна для фильмов 70-х годов, акцент в которых делался на страхе перед роботами.\\nДля спецэффектов за основу брали уже существующие образцы техники с целью более реалистичного изображения будущего."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B7%83%E0%B6%B8%E0%B7%8F%E0%B6%A2_%E0%B6%AF%E0%B7%94%E0%B6%BB%E0%B7%83%E0%B7%8A%E0%B6%AE_%E0%B6%9A%E0%B6%BB%E0%B6%AB%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Covid-19-curves-graphic2-stopthespread-v3.gif","page_title":"සමාජ දුරස්ථ කරණය","context_page_description":"සමාජ දුරස්ථ කරණය යනු බෝවන රෝග පාලනයට යොදාගන්නා infection control ක්‍රියාමාර්ග සමූහයකි. මෙහිදී වෛරසයක් වැනි රෝග කාරකයක් පැතිරීම පාලනය කල හැක. සමාජය තුල බෝවෙන රෝග පැතිරීම ගාතීය ස්‍රිතයකට සිදු වන නිසා ආසාදිත එක් පුද්ගලයෙක් නිසා තවත් පුද්ගලයින් දස දහස් ගණනකට මෙය ව්‍යාප්ත වේ.. එම නිසා රටක සෞඛ්‍ය පද්ධතියේ ධාරිතාවයට යටත්ව ආසාදිත රෝගීන් මට්ටම තබා ගැනීමෙන් මරණ අනුපාතය අඩු කරගත හැකි නිසා මෙය වෛරසයක් වැනි වසංගත තත්වයක දී රටක පුරවැසියක් වශයෙන් අනුගමනය කල යුතුම ක්‍රමවේදයකි."},{"page_url":"https://ceb.wikipedia.org/wiki/Mystacides_niger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Mystacides_niger.jpg","page_title":"Mystacides niger","context_page_description":"Espesye sa insekto nga una nga gihulagway ni Linnaeus ni adtong 1758 ang Mystacides niger. Ang Mystacides niger sakop sa kahenera nga Mystacides sa kabanay nga Leptoceridae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://lv.wikipedia.org/wiki/%C4%8Cornaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Dukstigala_Sv._Jaunavas_Marijas_Romas_kato%C4%BCu_bazn%C4%ABca_%281947%29.jpg","page_title":"Čornaja","context_page_description":"Čornaja ir ciems Rēzeknes novada Čornajas pagastā, pagasta centrs. Izvietojies Rāznas ezera ziemeļu krastā pie Dukstigala līča blakus autoceļam P55 16 km no novada domes Rēzeknē un 257 km no Rīgas.\\nApdzīvotā vieta izaugusi padomju gados kā padomju saimniecības «Dzimtene» ciemats. Kopš 1995. gada pagasta centrs. Čornajā atrodas pagasta pārvalde, bērnudārzs, Rāznas bibliotēka, Dukstigala pasta nodaļa, veikals. Dukstigala katoļu baznīca ir vietējas nozīmes kultūrvēstures piemineklis."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%82%E3%81%BF%E3%82%84%E3%81%8D%E4%BA%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Minoji-Yakitori-Shimomachi-Nishio.jpg","page_title":"あみやき亭","context_page_description":"株式会社あみやき亭は、愛知県春日井市に本社を置く焼肉レストランチェーン店。"},{"page_url":"https://ca.wikipedia.org/wiki/Patrimoni_de_la_Humanitat_a_It%C3%A0lia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Volterra101.jpg","page_title":"Patrimoni de la Humanitat a Itàlia","context_page_description":"Itàlia és el país amb major nombre de llocs declarats com a Patrimoni de la Humanitat per la Unesco del món, per davant de la Xina i Espanya. Només les regions de la Vall d'Aosta, Abruços, Calàbria i Molise no tenen cap lloc inscrit en aquesta llista. En total són 51 llocs dels quals dos són compartits amb Suïssa i un altre amb la Ciutat del Vaticà. L'art rupestre de Valcamonica va ser el primer bé cultural declarat a Itàlia el 1979, mentre que el seu primer bé natural varen ser les Illes Eòlies l'any 2000. De tots els llocs declarats:\\n47 són béns culturals.\\n4 són béns naturals.\\n4 béns són compartits amb d'altres països, un amb la Ciutat del Vaticà, dos amb Suïssa i un altre és compartit conjuntament entre Itàlia, Alemanya, Àustria, França, Suïssa i Eslovènia.\\nA més, Itàlia també té declarats 7 béns immaterials entre els quals es troben la dieta mediterrània que és compartit amb Espanya, Portugal, França Croàcia, Grècia, Xipre i el Marroc, i la falconeria amb d'altres 17 països."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_ciutats_de_Bulg%C3%A0ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Haskovo-theater-Ivan-Dimov.JPG","page_title":"Llista de ciutats de Bulgària","context_page_description":"Aquesta és una llista completa de totes les ciutats i pobles de Bulgària ordenats per població. Les capitals de província es mostren en negreta. Les fonts primàries són l'Institut Nacional d'Estadística i l'Acadèmia Búlgara de Ciències."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%BChen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wappen_Ruehen.png","page_title":"Rühen","context_page_description":"Rühen este o comună din landul Saxonia Inferioară, Germania."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%A6%D7%95%D7%A8_%D7%A2%D7%9C_%D7%99%D7%A8%D7%95%D7%A9%D7%9C%D7%99%D7%9D_(70)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/%D7%99%D7%A8%D7%95%D7%A9%D7%9C%D7%99%D7%9D_70_-_%D7%AA%D7%95%D7%9B%D7%A0%D7%99%D7%AA%D7%95_%D7%A9%D7%9C_%D7%98%D7%99%D7%98%D7%95%D7%A1.jpg","page_title":"המצור על ירושלים (70)","context_page_description":"הַמָצוֹר עַל יְרוּשָׁלַיִם שהתרחש בשנת 70 לספירה, היה השלב הסופי בהכנעת המרד הגדול נגד השלטון הרומאי, שהתרחש בארץ ישראל בשנים 70-66 לספירה. המצור הסתיים בכיבושה של העיר בידי כוחות האימפריה הרומית תחת פיקודו של טיטוס. במהלך כיבוש ירושלים שרף הצבא הרומאי את בית המקדש, ערך טבח באוכלוסייתה, והחריב את העיר. מספר ההרוגים שמתו בחרב או ברעב הסתכם במאות אלפים. ההרס והטבח שבאו בעקבות כיבוש ירושלים, גרמו לשקיעתהּ של העיר לאחר מאות שנים של שגשוג ופריחה.\\nההתקוממות בירושלים נגד השלטון הרומי, היוותה את השלב הראשון ואת המאיץ לפרוץ מרד כללי של האוכלוסייה היהודית בארץ ישראל נגד האימפריה הרומית. המרד פרץ בהדרגה לאחר תסיסה ארוכה בת שנים רבות שהונעה מסיבות שונות ומגוונות, אך בעלות אופי אחיד ומשותף. המרד כלל את כל חלקי ארץ ישראל ואף מחוצה לה, אך המערכה המרכזית התרחשה בירושלים. המורדים היהודים, שהיו מלכתחילה מפולגים למספר סיעות, ניהלו מלחמת אחים קשה בתוך העיר, במקביל למערכה נגד האויב הרומי. הם השכילו להתאחד רק לאחר שהצבא הרומאי הטיל מצור על העיר ותקף אותה, אך בשלב זה של המרד, זה כבר היה מאוחר מדיּ.\\nההשלכות של החורבן על העם היהודי היו קשות והשפעתן הייתה במגוון תחומים ולטווח ארוך, עד לימינו אנו."},{"page_url":"https://ceb.wikipedia.org/wiki/Idiodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Idiodes_siculoides.jpg","page_title":"Idiodes","context_page_description":"Henero sa mga alibangbang ang Idiodes. Ang Idiodes sakop sa kabanay nga Geometridae."},{"page_url":"https://cy.wikipedia.org/wiki/Tanagr_eurglust","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Golden-eared_Tanager_-_Manu_NP_-_Per%C3%B9_7900_%2822954456080%29.jpg","page_title":"Tanagr eurglust","context_page_description":"Aderyn a rhywogaeth o adar yw Tanagr eurglust a adnabyddir hefyd gyda'i enw gwyddonol Tangara chrysotis; yr enw Saesneg arno yw Golden-eared tanager. Mae'n perthyn i deulu'r Breision sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn T. chrysotis, sef enw'r rhywogaeth."},{"page_url":"https://bs.wikipedia.org/wiki/Cvjetnice_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Cyperus_eragrostis_goldengatepark.jpg","page_title":"Cvjetnice Bosne i Hercegovine","context_page_description":"Ovaj spisak cvjetnica Bosne i Hercegovine, skupa sa unesenim vrstama i bosanskohercegovačkim endemima, nepotpuni je pregled angiospermnih biljnih vrsta koje se navode u raspoloživoj literaturi na bosanskom hrvatskom, srpskom i srpskohrvatskom jeziku. Nisu uključene kulturne i povremeno unošene.\\nNapomena\\nZbog višekratnih promjena u biološkoj klasifikaciji i/ili taksonomskih rangova i naziva obuhvaćenih taksona, neki od njih se u priloženom spisku pojavljuju i po dva puta. To se posebno odnosi na one nazive binomne nomenklature koji su i danas u širokoj upotrebi.\\nNajčešće je promijenjeno ime roda i porodice, a ponekad i pripadajućih vrsta."},{"page_url":"https://en.wikipedia.org/wiki/B%C3%BClent_Ecevit","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Carter_ecevit.jpg","page_title":"Bülent Ecevit","context_page_description":"Mustafa Bülent Ecevit was a Turkish politician, poet, writer, scholar, and journalist, who served as the Prime Minister of Turkey four times between 1974 and 2002. He served as prime minister of Turkey in 1974, 1977, 1978–79, and 1999–2002. He was the leader of the Republican People's Party between 1972 and 1980, and in 1989 he became the leader of the Democratic Left Party."},{"page_url":"https://en.wikipedia.org/wiki/2019_Tshwane_mayoral_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Stevens_Mokgalapa_MP_%28Cropped%29.jpg","page_title":"2019 Tshwane mayoral election","context_page_description":"An Indirect mayoral election occurred on 12 February 2019 in the Tshwane City Council to determine the successor of Solly Msimanga as Mayor of Tshwane. Msimanga announced in January 2019 that he would resign as mayor, therefore creating a vacancy in the position.\\nNo party holds an absolute majority in the city council. The Democratic Alliance and other smaller parties in the city council, with the support of the Economic Freedom Fighters, formed a coalition to govern the municipality after the 2016 municipal elections.\\nThe Economic Freedom Fighters and opposition African National Congress abstained from the vote, therefore allowing Mokgalapa to be elected as mayor unopposed on 12 February 2019. Mokgalapa was voted out as mayor on 5 December 2019, but his removal was later suspended. He resigned on 26 February 2020."},{"page_url":"https://zh-yue.wikipedia.org/wiki/1993%E5%B9%B4%E4%BF%84%E7%BE%85%E6%96%AF%E6%86%B2%E6%94%BF%E5%8D%B1%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Vympel_special_forces.png","page_title":"1993年俄羅斯憲政危機","context_page_description":"1993年俄羅斯憲政危機係1993年9月21號喺俄羅斯發生嘅一場政治事件。嗰陣時嘅俄羅斯總統鮑里斯·葉利欽解散咗反對佢推動新自由主義改革嘅俄羅斯聯邦國家立法機關──俄羅斯人民代表大會同埋俄羅斯最高蘇維埃，葉利欽咁做係違反當時嘅《俄羅斯聯邦憲法》。當時嘅最高蘇維埃唔肯解散，打算投票彈劾葉利欽，要求當時嘅副總統亞歷山大·弗拉基米羅維奇·魯茨科伊按照憲法宣誓做總統。由9月28號開始，反葉利欽政府嘅群眾喺街上遊行，發生咗流血事件。當時嘅葉利欽仲掌控噉軍隊，決定咗危機嘅結局。之後嗰一個禮拜反葉利欽嘅抗議升級，喺10月2號去到最高潮，而且搞到俄羅斯差啲內戰。喺關鍵時刻，安全部門同埋部隊嘅領導人支持葉利欽，軍隊包圍咗白宮，用埋坦克同大炮去炸白宮，搞到佢差啲冧，不過好成功咁趕走嗮啲議會成員。去到1993年10月5號，對付葉利欽嘅武裝對抗已經潰散。呢十日係自從1917年十月革命以嚟俄羅斯死傷最慘重嘅街頭鬥爭，根據政府嘅估計，有187人死，437人受傷。"},{"page_url":"https://hu.wikipedia.org/wiki/Rhynchocinetes_durbanensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Rhynchocinetes_durbanensis_Prague_2011_1.jpg","page_title":"Rhynchocinetes durbanensis","context_page_description":"A Rhynchocinetes durbanensis a felsőbbrendű rákok osztályának tízlábú rákok rendjébe, ezen belül a Rhynchocinetidae családjába tartozó faj."},{"page_url":"https://en.wikipedia.org/wiki/Ueckerm%C3%BCnde","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Uede_berggasse.jpg","page_title":"Ueckermünde","context_page_description":"Ueckermünde is a seaport town in northeast Germany, located in the district of Vorpommern-Greifswald, Western Pomerania, near Germany's border with Poland's Police County.\\nUeckermünde has a long and varied history, going back to its founding by Slavs, the Ukrani, mentioned in 934 by Widukind of Corvey. The name Ucramund appears in documents from 1178. Since May 1, 2013 Ueckermünde has been an officially recognized seaside resort."},{"page_url":"https://it.wikipedia.org/wiki/Aeroporto_di_Faro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Vorplatz_Flughafen_Faro.jpg","page_title":"Aeroporto di Faro","context_page_description":"L'Aeroporto di Faro è un aeroporto portoghese situato nei pressi dell'abitato di Montenegro, a circa 7,5 km ad ovest della città di Faro, raggiungibile lungo la Estrada Nacional N 125 che attraversa la costa meridionale della regione Algarve. La struttura, categorizzata ICAO CAT 4E, è dotata di una pista in asfalto lunga 2 490 m e larga 45 m, situata all'altitudine di 8 metri sul livello del mare, con orientamento dell'unica pista RWY 10/28. La frequenza radio 120.750 MHz per la torre, 118.575 MHz al suolo, circuito normale.\\nL'aeroporto, gestito da ANA-Aeroportos de Portugal, SA, è aperto al traffico commerciale e risulta essere il secondo aeroporto più trafficato in Portogallo dopo l'Aeroporto di Lisbona-Portela ed il sesto più grande nella penisola iberica dopo l'Aeroporto di Madrid-Barajas, l'Aeroporto Internazionale di Barcellona, l'Aeroporto di Lisbona-Portela, l'Aeroporto di Malaga e l'Aeroporto di Alicante."},{"page_url":"https://fr.wikipedia.org/wiki/Voiron","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/St_Peters_church_Droitwich_-_geograph.org.uk_-_189593.jpg","page_title":"Voiron","context_page_description":"Voiron est une commune française située dans la neuvième circonscription du département de l'Isère en région Auvergne-Rhône-Alpes et, autrefois, rattachée à l'ancienne province du Dauphiné.\\nVoiron est la ville siège du Pays voironnais, regroupé en une communauté d’agglomération de trente-quatre communes et de plus de 90 000 habitants. La ville de Voiron seule compte environ 20 000 habitants. La cité ainsi que son agglomération appartient également à l'unité urbaine de Grenoble depuis 2010.\\nHistoriquement, la ville fut le siège du comté de Sermorens, domaine situé au débouché de la cluse de l'Isère, au pied du massif de la Chartreuse et à l'extrémité du diocèse de Vienne. Cette région frontière entre le Dauphiné et Savoie sera un peu plus tard l'objet de nombreux conflits, de 1150 à 1350, entre les différents comtes de Savoie et Dauphins, celle-ci finissant par échoir à ce dernier. Le Voironnais, rattaché au Dauphiné en 1355 deviendra alors définitivement français."},{"page_url":"https://sl.wikipedia.org/wiki/Timur_Lenk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Letter_of_Tamerlane_to_Charles_VI_1402.jpg","page_title":"Timur Lenk","context_page_description":"Timur, zgodovinsko znan kot Tamerlan, znan tudi kot Temur, Tajmur, Timurlenk, Timur i Leng, Tamburlajn ali Tajmur-e-Lang, je bil turško-mongolski osvajalec in ustanovitelj Timuridskega cesarstva v Perziji in Srednji Aziji. Bil je prvi vladar iz Timuridske dinastije, * 9. april 1336, Keš, zdaj Šahrisabz, Uzbekistan, † 18. februar 1405, Čimkent, zdaj Kazahstan.\\nIme Timur v staroturškem jeziku pomeni železo. Imeni Timur in Demir sta v Turčiji še vedno zelo priljubljeni.\\nRojen je bil v nomadski Barlaški konfederaciji v Transoksaniji in leta 1370 zavladal zahodnemu Čagatajskemu kanatu. Iz kanata se je odpravljal na vojne pohode proti zahodu, jugu, Srednji Aziji, Kavkazu in južni Rusiji in po porazu mamelukov iz Egipta in Sirije, Osmanskega cesarstva in propadajočega Delhijskega sultanata postal najmočnejši vladar muslimanskega sveta. Na osvojenih ozemljih je ustanovil Timuridski cesarstvo, ki je kmalu po njegovi smrti razpadlo.\\nTimurja se šteje za zadnjega velikega nomadskega osvajalca evrazijskih step, njegovo cesarstvo pa za osnovo za vzpon bolj strukturiranih in trajnih cesarstev v 16. in 17. stoletju: Osmanskega, Safavidskega in Mogulskega."},{"page_url":"https://ro.wikipedia.org/wiki/Arter%C4%83_occipital%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Gray790.png","page_title":"Arteră occipitală","context_page_description":"Artera occipitală provine din artera carotidă exterioară opusă arterei faciale. Calea sa este sub porțiunea posterioară a mușchiului digastric spre regiunea occipitală. Această arteră furnizează sânge în partea din spate a scalpului și mușchilor sternocleidomastoidieni și mușchilor profunzi ai spatelui și gâtului."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_King%27s_Lynn_and_West_Norfolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Medieval_gate%2C_The_Walks%2C_Kings_Lynn_-_geograph.org.uk_-_1447502.jpg","page_title":"Grade II* listed buildings in King's Lynn and West Norfolk","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of King's Lynn and West Norfolk in Norfolk."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_gares_d%27Eure-et-Loir","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Auneau-FR-28-gare-02.jpg","page_title":"Liste des gares d'Eure-et-Loir","context_page_description":"Cette liste de gares d'Eure-et-Loir a pour objectif de recenser l'ensemble des gares ferroviaires, existantes ou ayant existé, situées dans le département d'Eure-et-Loir. Cette liste est classée par lignes ferroviaires, qu'elles soient uniquement départementales ou qu'elles traversent le département ; un classement alphabétique est également proposé dans la liste de gares en France."},{"page_url":"https://tr.wikipedia.org/wiki/Galer%C3%ADa_de_Arte_Nacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Miranda_en_la_Carraca_by_Arturo_Michelena.jpg","page_title":"Galería de Arte Nacional","context_page_description":"Galería de Arte Nacional, kısaltmasıyla GAN, Venezuela'nın başkenti Caracas'taki Plaza Morelos bölgesinde bulunan sanat galerisidir. Açılışı 1976 yılının mayıs ayında yapıldı. 2009 yılında Carlos Gómez de Llerena'nın tasarladığı, Venezuela'nın en büyük müze binası olan yeni binasına taşındı."},{"page_url":"https://en.wikipedia.org/wiki/Loving_Lies","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Loving_Lies_poster.jpg","page_title":"Loving Lies","context_page_description":"Loving Lies is a 1924 silent American drama film directed by W. S. Van Dyke and starring Evelyn Brent. The film is considered to be lost."},{"page_url":"https://fr.wikipedia.org/wiki/Chirashi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Chirashizushi_in_San_Diego_by_lookslikeamy.jpg","page_title":"Chirashi","context_page_description":"Le chirashizushi ou chirashi sushi ou chirashi est une recette de cuisine traditionnelle et un art culinaire de la cuisine japonaise à base de « sushis éparpillés dans un grand bol japonais ». Contrairement aux sushis, ce n'est pas un plat assemblé, mais un simple bol de riz à sushi sur lequel sont déposées les garnitures froides »."},{"page_url":"https://eu.wikipedia.org/wiki/Kadov_(%C5%BD%C4%8F%C3%A1r_nad_S%C3%A1zavouko_barrutia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Kadov.png","page_title":"Kadov (Žďár nad Sázavouko barrutia)","context_page_description":"Kadov Txekiar Errepublikako udalerri bat da. 149 biztanle ditu eta 5,37 kilometro koadroko azalera. Žďár nad Sázavouko barrutian dago."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_Nicol%C3%B2_Lomellini","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Piazza_dell%27Annunziata%2C_Genova.jpg","page_title":"Palazzo Nicolò Lomellini","context_page_description":"Il palazzo Nicolò Lomellini, noto anche come Palazzo Lauro, è un edificio sito in piazza della Nunziata al civico 5 nel centro storico di Genova. L'edificio fu inserito nella lista dei palazzi iscritti ai Rolli di Genova."},{"page_url":"https://de.wikipedia.org/wiki/Larceveau-Arros-Cibits","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Hilarrien_interpretazio_zentroa_II_Larzabale_%28Naf_B%2C_EH%29.jpg","page_title":"Larceveau-Arros-Cibits","context_page_description":"Larceveau-Arros-Cibits ist eine französische Gemeinde mit 403 Einwohnern im Département Pyrénées-Atlantiques in der Region Nouvelle-Aquitaine. Die Gemeinde gehört zum Arrondissement Bayonne und zum Kanton Pays de Bidache, Amikuze et Ostibarre.\\nDer Name der Gemeinde lautet in der baskischen Sprache Larzabale-Arroze-Zibitze. Die Bewohner werden entsprechend Larzabaldar, Arroztar oder Zibiztar genannt."},{"page_url":"https://de.wikipedia.org/wiki/Hasegawa_Toshiyuki","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hasegawa_Aimitsu.jpg","page_title":"Hasegawa Toshiyuki","context_page_description":"Hasegawa Toshiyuki war ein japanischer Dichter und Maler der Taishō- und Shōwa-Zeit."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B6%D0%B6%D0%B5%D0%B2%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA_%D0%BE%D0%B1%D1%8B%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Juniperus_communis_cones.jpg","page_title":"Можжевельник обыкновенный","context_page_description":"Можжеве́льник обыкнове́нный, или Ве́рес — вечнозелёные хвойные деревья, вид рода Можжевельник семейства Кипарисовые."},{"page_url":"https://de.wikipedia.org/wiki/Sevran","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Sevran_Eglise_Sainte_Elisabeth.jpg","page_title":"Sevran","context_page_description":"Sevran ist eine französische Gemeinde mit 51.016 Einwohnern im Département Seine-Saint-Denis in der Region Île-de-France. Die Einwohner werden Sevranais genannt."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_5792","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/N5792s.jpg","page_title":"NGC 5792","context_page_description":"NGC 5792 هي مجرة تتبع كوكبة الميزان. اكتشفها ويليام هيرشل في 11 أبريل 1787."},{"page_url":"https://fr.wikipedia.org/wiki/Turriers","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_04222.png","page_title":"Turriers","context_page_description":"Turriers est une commune française située dans le département des Alpes-de-Haute-Provence, en région Provence-Alpes-Côte d'Azur.\\nLe nom des habitants de Turriers est Turriérois.\\nTurriers est une commune de l'Unesco Geoparc de Haute-Provence."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A7%E7%90%89%E7%92%83%E6%93%AC%E5%AE%88%E7%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Resting_%2818352613883%29.jpg","page_title":"大琉璃擬守瓜","context_page_description":"大琉璃擬守瓜為金花蟲科琉璃擬守瓜屬下的一個種。為台灣特有種，分布於全島山區。"},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/KinderdijkMolens01.jpg","page_title":"Нидерланд","context_page_description":"Нидерланд нь Нидерланд болон Карибын тэнгист орших Нидерландын Антилын арлууд, Арубагаас бүрдэх Нидерландын Вант Улсын Европт орших хэсэг нь юм. Нидерланд нь Баруун Европын, парламентийн ардчилсан үндсэн хуульт хаант засагтай улс болно. Тус улс хойд болон баруун талаараа Хойд тэнгисээр хүрээлэгдсэн ба өмнө зүгт Бельги, зүүн зүгт Германтай тус тус хиллэдэг.\\nНидерландыг Голланд гэж дууддаг нь буруу юм. Учир нь Хойд Голланд болон Өмнөд Голланд нь Нидерландын 12 мужийн хоёр нь л төдий юм.\\nНидерланд нь олон улсын тавцанд идэвхтэй үүрэг гүйцэтгэдэг. Тус улс нь Европын Холбоо, НАТО, ЭЗХАХБ-ыг үндэслэн байгуулагч гишүүдийн нэг юм. Түүнчлэн Киотогийн протоколд гарын үсэг зурсан. Нидерланд нь Бельги, Люксембургийн хамтаар Бенилюкс хэмээх эдийн засгийн холбоог бүрдүүлдэг. Тус улсад олон улсын таван шүүх байрладаг. Тухайлбал: Арбитрын байнгын шүүх, Олон улсын шүүх, Хуучин Югославын асуудлаархи олон улсын эрүүгийн шүүх, Олон улсын эрүүгийн шүүх, Ливаны асуудлаархи тусгай шүүх байрладаг. Эхний дөрвөн шүүх нь ЕХ-ны эрүүгийн цагдаагийн агентлаг болох Европолын хамт Гаагад байрладаг. Тийм учраас тус хотыг \\"дэлхийн хууль зүйн нийслэл\\" гэж нэрлэдэг ажээ.\\""},{"page_url":"https://eu.wikipedia.org/wiki/Areatza_(Arraia-Maeztu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/E3d_txikia.png","page_title":"Areatza (Arraia-Maeztu)","context_page_description":"Areatza Arabako ekialdean dagoen herria da, Mendialdeako eskualdean eta Arraia-Maeztuko udalerriaren barruan kokaturik. 1958 arte Laminoria udalerriaren zati izan zen.\\nHerriko jaiak Agustin Deunarekin ospatzen ditu, abuztuaren 28an.\\n2007ko urtarrilaren 1eko erroldaren arabera, auzoak 8 biztanle ditu."},{"page_url":"https://sk.wikipedia.org/wiki/Cendrieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Cendrieux_mairie.JPG","page_title":"Cendrieux","context_page_description":"Cendrieux je francúzska obec, ktorá sa nachádza v departemente Dordogne, v regióne Akvitánsko."},{"page_url":"https://ru.wikipedia.org/wiki/75-%D0%BC%D0%BC_%D0%B3%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D0%BF%D1%83%D1%88%D0%BA%D0%B0_%D0%9C15","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/15-31M_75_mm-es_Skoda_hegyi%C3%A1gy%C3%BA_kezel%C5%91ivel_%C3%B6sszeszerel%C3%A9skor._Fortepan_10403.jpg","page_title":"75-мм горная пушка М15","context_page_description":"75-мм горная пушка Шкода М15 — горная пушка, использовавшейся армией Австро-Венгрии в Первую мировую войну. На немецкой службе она была известна как 7,5 см GebK 15. На службе у итальянцев они назывались Obice da 75/13. В вермахте эти орудия, захваченные после выхода Италии из войны в 1943 году, обозначили как 7,5 см GebK 259."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_Real_de_Pedralbes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Escalera_interior_del_Palacio_de_Pedralbes%2C_Barcelona.JPG","page_title":"Palacio Real de Pedralbes","context_page_description":"El Palacio Real de Pedralbes es un edificio situado en medio de una amplia zona de jardines, en el distrito de Les Corts, en Barcelona. Entre 1924 y 1931 fue la residencia de la Familia Real Española en sus visitas a la ciudad.\\nActualmente, el palacio permanece cerrado al público, siendo su único inquilino el secretariado de la Unión para el Mediterráneo.​ Con anterioridad, el edificio albergó el Museo de Cerámica, el Museo de las Artes Decorativas y el Museo Textil y de la Indumentaria, hasta que fueron trasladados al nuevo Museo del Diseño en 2014.​​"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%83%D9%8A%D9%87%D8%A7%D8%B1%D8%AF_%D9%88%D9%8A%D8%B3%D9%88%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Ekkehard_Wysocki.JPG","page_title":"اكيهارد ويسوكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاكيهارد ويسوكى سياسى من المانيا."},{"page_url":"https://et.wikipedia.org/wiki/Quaoar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Quaoar_PRC2002-17e.jpg","page_title":"Quaoar","context_page_description":"50000 Quaoar on Neptuuni-tagune, Kuiperi vöös liikuv taevakeha, arvatavasti kääbusplaneet. See sai nime California tongva indiaanlaste loomisjumala järgi. Tongvad elasid tänapäeva Los Angelese maakonna alal, kus taevakeha avastati.\\nQuaoari avastasid 4. juunil 2002 Michael E. Brown ja Chad Trujillo, kes töötasid vastavalt Caltechis ja Gemini observatooriumis. Avastamise ajal oli see suurim Päikesesüsteemis avastatud taevakeha pärast Pluutot. Hiljem avastati veel Eris, Sedna, Haumea ja Makemake.\\nQuaoari läbimõõt on umbes 1110 km.\\nQuaoari orbiit on ringikujuline. Ta teeb tiiru ümber päikese 288 Maa aastaga.\\n2007. aastal teatati Quaoari kaaslase avastamisest, millele pandi nimeks Weywot."},{"page_url":"https://en.wikipedia.org/wiki/Trump_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/City_Tavern%2C_City%2C_EC2_%284103256760%29.jpg","page_title":"Trump Street","context_page_description":"Trump Street is a street in the City of London that was originally known as Trumpadere Street, probably after the trumpet or horn makers who once worked there or in the adjacent Trump Alley. It was built after the Great Fire of London but completely destroyed by bombing during the Second World War and has since been entirely rebuilt."},{"page_url":"https://cs.wikipedia.org/wiki/%C3%9Ast%C3%AD_nad_Labem-centrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Masarykova%2C_Severo%C4%8Desk%C3%A9_divadlo_opery_a_baletu.jpg","page_title":"Ústí nad Labem-centrum","context_page_description":"Ústí nad Labem-centrum je část statutárního města Ústí nad Labem, spadající do městského obvodu Ústí nad Labem-město. V roce 2009 zde bylo evidováno 3945 adres. V roce 2001 zde trvale žilo 13993 obyvatel.\\nÚstí nad Labem-centrum leží v katastrálních územích Ústí nad Labem o výměře 11,37 km² a Klíše o výměře 2,77 km²."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%B8%D1%81%D1%83%D1%81_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Christ_the_Pantocrator_by_Jovan_Zograf_%281384%29.jpg","page_title":"Иисус Христос","context_page_description":"Иисус Христос, наричан още Иисус от Назарет, е основоположник и централна историческа личност в християнството, както и една от най-влиятелните фигури в човешката история.\\nХристос е считан от повечето християнски изповедания за въплъщение на второто от лицата на Светата Троица – Бог Син. Те приемат, че Бог Отец е Отец на Иисус Христос. Християните вярват също, че Иисус Христос е Месията, предсказан в Стария завет и дошъл да изкупи греховете на човечеството. Християнството изповядва още, че Иисус е бил роден от девица, бил е осъден, разпънат на кръст и сложен в гробница, но на третия ден от смъртта си е възкръснал и се е възнесъл в рая, където седи отдясно на Отца до деня на Второто пришествие. Наред с това се вярва, че е извършил редица чудеса, изпълнявайки библейските пророчества. В исляма Иисус е познат като Иса и е един от най-обичаните и важни пророци, носител на божествените писания и Месия. Макар да приемат непорочното зачатие мюсюлманите не вярват в разпъването и божествения произход на Иисус Христос. Според исляма Иса е възнесен жив на небето."},{"page_url":"https://fr.wikipedia.org/wiki/Ulrike_Lunacek","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Ulrike-Lunacek-2010.JPG","page_title":"Ulrike Lunacek","context_page_description":"Ulrike Lunacek, née le 26 mai 1957 à Krems an der Donau, est une personnalité politique autrichienne, membre des Verts - L'alternative verte.\\nElle est vice-présidente du Parlement européen de juillet 2014 jusqu'à sa démission de son mandat européen en novembre 2017."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B6_%D5%84%D5%A1%D6%80%D5%AB%D5%B6%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Location_San_Marino_Europe.png","page_title":"Սան Մարինո","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Սան Մարինո\\nՍան Մարինո, պետություն Եվրոպայում, որը ամբողջովին շրջապատված է Իտալիայով։\\nՍան Մարինոն հայտնի է որպես խաղաղ հանրապետություն։ Այս փոքր պետությունը ամբողջապես շրջապատված է Իտալիայով, գտնվում է իտալական թերակղզու հյուսիսարևելյան մասում Ապենինյան լեռներում։ Տարածքը կազմում է 61 կմ², բնակչությունը կազմում է ավելի քան 30000 մարդ։ Մայրաքաղաքը Սան Մարինոն է, երկրի ամենամեծ քաղաքը Դոգանան է, որն ունի մոտավորապես 7000 բնակչություն։ Սան Մարինոն Եվրախորհրդի երկրների անդամների մեջ բնակչության թվով ամենափոքրն է։\\nՍան Մարինոն պնդում է որ ամենահին գոյատևող ինքնիշխան պետությունն ու սահմանադրական հանրապետությունն է, որի տարածքում 301 թվականի սեպտեմբերի 3-ին հիմնադրվել է վանական համայնք Մարինոյի կողմից։\\nԵրկրի տնտեսությունը հենվում է ֆինանսական, արդյունաբերության ծառայությունների և զբոսաշրջության վրա։ Սան Մարինոն ամենահարուստ երկրներից է աշխարհում ՀՆԱ առումով։ Երկիրն ունի ամենացածր գործազրկության տեմպերը Եվրոպայում:"},{"page_url":"https://fr.wikipedia.org/wiki/Victor_Martin_de_Moussy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Martin_de_Moussy.jpg","page_title":"Victor Martin de Moussy","context_page_description":"Jean Antoine Victor Martin de Moussy est un explorateur, médecin et géographe français."},{"page_url":"https://en.wikipedia.org/wiki/Faculty_of_Arts,_Chulalongkorn_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/MahaChulalongkorn_Building.jpg","page_title":"Faculty of Arts, Chulalongkorn University","context_page_description":"The Faculty of Arts, Chulalongkorn University, was established in 1917. It was one of the first four faculties of the university. Its former name was \\"Faculty of Arts and Science\\". At the time of its establishment, the first two missions of the faculty were to teach the students humanities and sciences and to produce secondary school teachers. In 1934, the faculty started to offer a bachelor's degree of arts. Today, there are undergraduate and graduate programs.\\nAccording to QS world university ranking by subject, Faculty of Arts, Chulalongkorn University is ranked as No. 1 in Thailand in modern languages, linguistics, English language and literature, history and philosophy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%83%D1%82%D0%B5%D1%80%D0%BD%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Mauterndorf_-_St_Gertrauden.JPG","page_title":"Маутерндорф","context_page_description":"Маутерндорф — ярмаркова громада у Австрії, у федеральної землі Зальцбург. Входить до складу округи Тамсвег.\\nНаселення становить 1752 чоловік. Займає площю 32,71 км ².\\nУряд громади складається з 17 членів."},{"page_url":"https://pt.wikipedia.org/wiki/Lago_Gua%C3%ADba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Por_do_Sol_no_Lago_Gua%C3%ADba.jpg","page_title":"Lago Guaíba","context_page_description":"O Lago Guaíba localiza-se na região metropolitana de Porto Alegre, banhando as cidades de Porto Alegre, Eldorado do Sul, Guaíba, Barra do Ribeiro e Viamão.\\nO rio possui importância ambiental, econômica e histórico cultural para a região. Atualmente as águas do lago tem múltiplos usos, como abastecimento hídrico, diluição de águas residuais, recreação, pesca e navegação, além de fazer parte da identidade visual da região. O rio é gerido pelo Comitê de Bacia do Rio Guaíba."},{"page_url":"https://es.wikipedia.org/wiki/%C3%93nfale","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Hercules_and_Omphale%2C_1754.jpg","page_title":"Ónfale","context_page_description":"En la mitología griega, Ónfale, Ónfala u Onfalia era hija de Iardano o Yardano y esposa de Tmolo, rey de Lidia.\\nÓnfale heredó el trono a la muerte de su marido. Durante su reinado tuvo como esclavo a Heracles. A este semidiós, que había enfermado después de haber asesinado a Ífito, se le había dado el oráculo de que debía servir como criado durante tres años y pagar una indemnización para librarse de su enfermedad, así que Hermes lo puso en venta como esclavo y Ónfale lo compró.\\nMientras estuvo como esclavo de Ónfale, Heracles encadenó a los Cércopes y mató a Sileo y a su hija Jenódoce.​\\nLa alegoría de Heracles junto a la rueca de Ónfale ha sido utilizada frecuentemente en el arte. En las obras en que se desarrolla este tema se presenta al héroe vestido de mujer y sujetando una cesta mientras las doncellas de la reina hilan, al tiempo que ella viste la piel del León de Nemea y porta la maza de olivo de Heracles.\\nPosteriormente, Ónfale y Heracles se casaron. Un hijo de ellos, llamado Lamo en unas fuentes, y, en otras, Agelao, fue antepasado de Creso.​"},{"page_url":"https://cs.wikipedia.org/wiki/Yellow_Submarine","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/The_Beatles%2C_Yellow_Submarine_%28Logo%29.png","page_title":"Yellow Submarine","context_page_description":"Yellow Submarine je studiové album skupiny Beatles. Obsahuje soundtrack ze stejnojmenného filmu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_Christchurch","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/61TennysonStChCh_gobeirne.jpg","page_title":"List of historic places in Christchurch","context_page_description":"This list of Heritage New Zealand-listed places in Christchurch contains those buildings and structures that are listed, or were listed in early 2011, with Heritage New Zealand in Christchurch, New Zealand. The list is confined to the boundaries of Christchurch prior to amalgamation with the Banks Peninsula District in March 2006."},{"page_url":"https://pt.wikipedia.org/wiki/Xangai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Shanghai_Government_Building.jpg","page_title":"Xangai","context_page_description":"Xangai, por vezes também designada pela forma inglesa Shanghai, é a maior cidade da República Popular da China e uma das maiores áreas metropolitanas do mundo, com mais de 24 milhões de habitantes. Localizada na costa central da China oriental, na foz do rio Yangtze, a cidade é administrada como um município chinês, com estatuto de nível de uma província.\\nOriginalmente uma vila cuja economia era baseada na pesca e no setor têxtil, Xangai ganhou importância no século XIX devido a localização favorável do seu porto e por ser uma das cidades abertas ao comércio exterior pelo Tratado de Nanquim, em 1842. A cidade floresceu como um centro comercial entre o Oriente e o Ocidente e tornou-se um polo financeiro internacional na década de 1930. No entanto, quando o Partido Comunista da China chegou ao poder em 1949, a influência internacional da cidade declinou. Em 1990, as reformas econômicas introduzidas por Deng Xiaoping levaram a um intenso desenvolvimento da cidade e, em 2005, Xangai tornou-se o maior porto de cargas do mundo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%91%D1%82%D1%80_I_%D0%B4%D0%BE%D0%BF%D1%80%D0%B0%D1%88%D0%B8%D0%B2%D0%B0%D0%B5%D1%82_%D1%86%D0%B0%D1%80%D0%B5%D0%B2%D0%B8%D1%87%D0%B0_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D1%8F_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87%D0%B0_%D0%B2_%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Nikolay_Ge_064.jpg","page_title":"Пётр I допрашивает царевича Алексея Петровича в Петергофе","context_page_description":"«Пётр I допрашивает царевича Алексея Петровича в Петергофе» — картина русского художника Николая Ге, написанная в 1871 году. Она является частью собрания Государственной Третьяковской галереи. Размер картины — 135,7 × 173 см.\\nКартина была написана Ге к 1-й выставке Товарищества передвижных художественных выставок, открытие которой состоялось в Петербурге в ноябре 1871 года. В частности, актуальность выбранной художником темы была связана с приближавшимся в то время 200-летним юбилеем Петра I. Ещё до выставки картина была куплена у автора Павлом Третьяковым.\\nНиколай Ге написал несколько авторских повторений картины, одно из которых было приобретено Александром II — в настоящее время оно принадлежит коллекции Государственного Русского музея."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%93%E3%83%A3%E3%83%A9_(%E3%83%B4%E3%82%A1%E3%83%AB%E3%83%8A%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Byala2.jpg","page_title":"ビャラ (ヴァルナ州)","context_page_description":"ビャラはブルガリア北東部の町、およびそれを中心とした基礎自治体。ヴァルナ州に属する。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D1%80%D0%B8%D0%BD_%D0%9C%D0%B0%D0%BA%D0%B0%D1%80%D1%82%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Meganmcarthurv2.jpg","page_title":"Катрин Макартър","context_page_description":"Катрин Меган Макартър e американска астронавтка, летяла в космоса веднъж, мисия STS-125."},{"page_url":"https://de.wikipedia.org/wiki/Schola_Cantorum_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/124_SK7_7726.JPG","page_title":"Schola Cantorum Leipzig","context_page_description":"Die Schola Cantorum Leipzig ist eine durch die Stadt Leipzig getragene musikpädagogische Einrichtung, die verschiedene Kinder- und Jugendchöre unter einem Dach vereint. Die Ensembles zählen aufgrund ihres musikalischen Anspruchs, zahlreicher Konzertreisen ins Ausland und Platzierungen bei Wettbewerben sowie konsequenter Nachwuchsförderung zu den führenden Kinder- und Jugendchören Deutschlands mit internationalem Renommee. Die Schola Cantorum Leipzig gehört dem Verband Deutscher Konzertchöre an."},{"page_url":"https://es.wikipedia.org/wiki/Podabrus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Podabrus_rugosulus_mating.jpg","page_title":"Podabrus","context_page_description":"Podabrus es un género de escarabajos de la familia Cantharidae con más de 110 especies. En 1838 Westwood describió el género.​ Muchas especies de Podabrus imitan a las luciérnagas."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B9%CE%AC%CE%BD%CE%B1_%CE%93%CE%B9%CE%B1%CE%B6%CF%8C%CE%B2%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/BASA_100K-1-600-1_Yana_Yazova.jpg","page_title":"Γιάνα Γιαζόβα","context_page_description":"Η Γιάνα Γιαζόβα ήταν Βουλγάρα διανοούμενη και συγγραφέας.\\nΓεννήθηκε στο Λομ το 1912. Σπούδασε Σλαβική Φιλολογία στο Πανεπιστήμιο της Σόφιας από όπου αποφοίτησε το 1935. Ήδη είχε εκδώσει την πρώτη της ποιητική συλλογή το 1931. Ως διανοούμενη έσπασε αρκετά ταμπού σχετικά με το ρόλο της γυναίκας διανοούμενης στην προπολεμική Βουλγαρία, ταξιδεύοντας σε αρκετές χώρες όπως στην Τουρκία, την Ελλάδα, τη Γιουγκοσλαβία, τη Συρία, την Αίγυπτο, τη Γερμανία και αλλού, με τη χρηματική υποστήριξη γυναικείων οργανώσεων ή της Διεθνούς Ένωσης Συγγραφέων. Μαζί με το μέντορα και εραστή της Αλεξάντερ Μπαλαμπάνοφ, διάσημο κλασικιστή και εκδότη εξέδωσαν το παιδικό περιοδικό Μπλοκ τα έτη 1942-3. Το 1943 παντρεύτηκε με άλλον άντρα χωρίς όμως να διακόψει τη σχέση της με τον Μπαλαμπάνοφ. Μετά την επικράτηση του κομμουνιστικού καθεστώτος στη Βουλγαρία, η Γιαζόβα πιέστηκε να αποκηρύξει τα προηγούμενα γραπτά της και να ακολουθήσει την επίσημη κρατική κατεύθυνση για την τέχνη. Η Γιαζόβα όμως δεν μπορούσε να συμβιβαστεί με αυτήν την πίεση και από το 1952 αποτραβήχτηκε από την κοινωνία, γράφοντας έργα που εκδόθηκαν μετά το θάνατό της."},{"page_url":"https://ro.wikipedia.org/wiki/Boletaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Unidentified_Fungus_5621.jpg","page_title":"Boletaceae","context_page_description":"Boletaceae este o mare familie de ciuperci cu global aproximativ peste 800 de specii și variații, apărând pe teritoriul european în peste 20 de genuri și făcând parte din divizia Basidiomycota în Regnul Fungi și ordinul Boletales. Acest gen include nu numai specii comestibile de mare popularitate ca hribii, ci de asemenea soiuri otrăvitoare, ca de exemplu buretele dracului, sau ciuperci fără mare valoare pentru om, ca genul Chalciporus.\\nÎn România, Basarabia și Bucovina de Nord se dezvoltă în păduri de conifere și/sau de foioase, începând în mai până toamna târziu, în noiembrie, înainte de primul ger."},{"page_url":"https://en.wikipedia.org/wiki/Pa%C3%A7o_de_S%C3%A3o_Crist%C3%B3v%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Museu_Nacional_-_collaborative_upload_67.jpg","page_title":"Paço de São Cristóvão","context_page_description":"Paço de São Cristóvão was an imperial palace located in the Quinta da Boa Vista park in the Imperial Neighbourhood of São Cristóvão, Rio de Janeiro, Brazil. It served as residence to the Portuguese Royal Family and later to the Brazilian Imperial Family until 1889, when the country became a republic through a coup d'état deposing Emperor Pedro II. The palace briefly served as a public building by the provisional government for the constituent assembly of the first republican constitution. It housed the major part of the collections of the National Museum of Brazil, which, together with the building, were largely destroyed by a fire on 2 September 2018."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D8%B7%D8%A9_%D9%82%D8%B7%D8%A7%D8%B1_%D8%A7%D9%84%D8%AC%D8%B2%D8%A7%D8%A6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Chemin_de_fer_en_alg%C3%A9rie.PNG","page_title":"محطة قطار الجزائر","context_page_description":"محطة الجزائر هي محطة قطارات ببلدية القصبة في ولاية الجزائر تقع قرب قصبة الجزائر وميناء الجزائر، وتنطلق منها أنواع عديدة من القطارات على اختلاف درجاتها إلى جميع نواحي الجزائر ·."},{"page_url":"https://et.wikipedia.org/wiki/Kaevik","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Kaevikuliin_Mustoja_MKA-l.JPG","page_title":"Kaevik","context_page_description":"Kaevik on pealt lahtine kaitserajatis tulistamiseks ning isikkoosseisu ja sõjatehnika kaitsmiseks vastase hävitusvahendite eest.\\nEsimeses maailmasõjas peeti kaevikutes mitmeid lahinguid."},{"page_url":"https://fr.wikipedia.org/wiki/Takashi_Nagatsuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Takashinagatsuka44.jpg","page_title":"Takashi Nagatsuka","context_page_description":"Takashi Nagatsuka, est un romancier et poète japonais."},{"page_url":"https://es.wikipedia.org/wiki/Pyraustinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Saucrobotys_futilalis_pupa.jpg","page_title":"Pyraustinae","context_page_description":"Pyraustinae es una numerosa subfamilia de lepidópteros de la familia Crambidae. Incluye 1.400 especies. La mayoría son tropicales con unas en regiones templadas de Norte América y Europa.\\nOriginalmente incluían a Spilomelinae como una tribu Spilomelini; la más numerosa dentro de Pyraustina. La taxonomía de Pyraustinae aun no está perfectamente clara. Pero es posible que el número de especies siga creciendo a pesar de la pérdida de su grupo más numeroso, Spilomelinae.\\nLas opiniones de los taxónomos varían. Originalmente Pyraustinae estaba ubicada dentro de Pyralidae, pero ahora se la considera una subfamilia de Crambidae.\\nSe caracterizan por espínulas atrofiadas y una vénula en el órgano timpánico; un surco longitudinal con escamas androconiales en las tibias de las patas mesotorácicas del macho.\\nMuchas especies tienen larvas que barrenan los tallos y frutas de plantas. Algunos son plagas graves, especialmente los del género Ostrinia."},{"page_url":"https://cs.wikipedia.org/wiki/Prthiv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Prithu_-_Crop.jpg","page_title":"Prthiví","context_page_description":"Prthiví je védská bohyně země, nejčastěji zmiňovaná společně s Djausem, bohem nebes, jako Djáváprthiví „Nebe a Země“. Jejím synbolem je kráva, v jejíž podobě je někdy také zobrazována.\\nPrthiví se také objevuje v buddhistických textech a ikonografii. Chrání Gautamu Buddhu a je svědkem jeho osvícení, podle Pálijského kánonu mu pomohla odolat pokušení Máry. Pod jménem Ibu Pertiw je také národním symbolem Indonésie."},{"page_url":"https://ca.wikipedia.org/wiki/Les_formigues","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/039_Les_formigues%2C_cal%C2%B7ligrama_de_Salvat-Papasseit%2C_pg._del_Born.jpg","page_title":"Les formigues","context_page_description":"Les formigues és un mural fet per Jose Manuel Pinillo basat en el cal·ligrama homònim de Joan Salvat-Papasseit. L'obra es va inaugurar l'1 de juny de 2004 pel tinent d'alcalde Jordi Portabella en el marc del projecte Mapapoètic, un homenatge a la poesia inclòs en els actes del Fòrum de les Cultures 2004. L'obra pertany a l'Ajuntament de Barcelona.\\nLes formigues està situat al passeig del Born, entre els carrers Rec Comtal i de Flassaders.\\nL'obra original, que duu el mateix nom, és un cal·ligrama de Joan Salvat-Papasseit publicat en el llibre L’irradiador del port i les gavines i al mateix any en el primer exemplar de la revista Proa. Utilitza l'estil conegut com a haiku, una forma de poesia tradicional japonesa que consisteix en composicions de tres versos curts. Els versos vistos des de lluny recorden una fila de formigues. En diagonal, es llegeix:\\nEl poema està il·lustrat també amb una flor i una estrella de mar."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A8%BD%E8%A6%8B%E3%81%AE%E5%A4%A7%E3%82%B6%E3%82%AF%E3%83%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/DSC_0933oozakura3.jpg","page_title":"樽見の大ザクラ","context_page_description":"樽見の大ザクラとは、兵庫県養父市大屋町樽見にあるエドヒガンの一本桜。「仙人の桜」の意味で別名「仙桜」とも呼ばれ、国の天然記念物に指定されている。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_immobilier_exceptionnel_de_la_Wallonie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bastogne_Eglise_Saint-Pierre_R01.jpg","page_title":"Liste du patrimoine immobilier exceptionnel de la Wallonie","context_page_description":"La liste du patrimoine immobilier exceptionnel de la Wallonie est établie par arrêté du Gouvernement wallon. Au 7 février 2013, elle comprenait les biens suivants. Une nouvelle liste révisée est parue au Moniteur belge du 26 octobre 2016. Elle reprend les 218 biens inscrits par le Gouvernement wallon sur la liste du Patrimoine exceptionnel de la Wallonie. La liste 2016 comprend quatre nouveaux biens"},{"page_url":"https://pt.wikipedia.org/wiki/Brooklyn_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/CiCi%27s_Brooklyn.JPG","page_title":"Brooklyn (Ohio)","context_page_description":"Brooklyn é uma cidade localizada no estado norte-americano do Ohio, no Condado de Cuyahoga."},{"page_url":"https://en.wikipedia.org/wiki/List_of_bridges_in_Vietnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/C%E1%BA%A7u_Ong_Lon.jpg","page_title":"List of bridges in Vietnam","context_page_description":"Notes\\n\\"Dự án Cầu - Đường bộ Việt Nam\\". tracuuxaydung.com. Archived from the original on February 2010.\\nNicolas Janberg. \\"International Database for Civil and Structural Engineering\\". Structurae.com.\\nOthers references"},{"page_url":"https://en.wikipedia.org/wiki/Pediasia_desertellus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Pediasia_desertellus.JPG","page_title":"Pediasia desertellus","context_page_description":"Pediasia desertellus is a species of moth in the family Crambidae described by Julius Lederer in 1855. It is found in Portugal and on Sicily, as well as in Mauritania, Algeria, Israel, Jordan, Asia Minor, Lebanon, Syria, Iraq and Iran."},{"page_url":"https://da.wikipedia.org/wiki/A-bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Movia_bus_line_7A_on_Sj%C3%A6l%C3%B8r_Boulevard.jpg","page_title":"A-bus","context_page_description":"A-busser er en type bybusser i København, der kører ofte og er let tilgængelige i kraft af mange stoppesteder. De blev indført af det daværende HUR Trafik den 20. oktober 2002 i forbindelse med åbningen af den første etape af Københavns Metro. A-busserne drives i dag af trafikselskabet Movia, der har udliciteret driften til forskellige entreprenører. A-busserne er gule og kan kendes på deres røde hjørner.\\nSiden den 13. oktober 2019 findes der seks A-buslinjer, mens yderligere tre er blevet nedlagt og én er blevet omdannet til Cityline. I myldretiden køres der uden fast køreplan men blot med angivelse af et forventet interval mellem busserne, der kan være helt ned til 3-4 minutter. I aftentimerne er der ca. 10 minutter mellem hver A-bus, mens der om natten køres hvert 20. eller 30. minut. På nogle yderstrækninger er det dog kun hver anden bus, der kører helt igennem. I 2019 havde de syv, senere seks A-buslinjer 52,9 mio. passagerer tilsammen, svarende til 26,7 % af alle Movias passagerer.\\nKonceptet med A-busser findes også i Køge, Roskilde, Ringsted, Holbæk og Helsingør, hvor Movia oprettede en eller to linjer i hver i 2009-11. De er beskrevet i særskilte artikler."},{"page_url":"https://de.wikipedia.org/wiki/Malayische_Mokassinotter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Calloselasma_rhodostoma.jpg","page_title":"Malayische Mokassinotter","context_page_description":"Die Malayische Mokassinotter, auch Malaiische Mokassin-Grubenotter, ist die einzige Art der damit monotypischen Gattung Calloselasma innerhalb der Grubenottern. Sie ist in weiten Teilen Südostasiens verbreitet."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%A8re_(restaurateur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Bizolon004.jpg","page_title":"Mère (restaurateur)","context_page_description":"Mère is an honorary title given to talented female professional cooks, many of whom had no formal training, in France during the 18th, 19th, and 20th centuries. Between 1759 and the end of the 20th century multiple women have been called Mère. Their work turned Lyon into the gastronomic center of France and the world, and the most famous of them, Mère Brazier, is regarded as \\"the mother of modern French cooking\\"."},{"page_url":"https://it.wikipedia.org/wiki/Chassepot","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Chassepot_cartridge.JPG","page_title":"Chassepot","context_page_description":"Lo Chassepot, o fusil modèle 1866, è un'arma individuale in dotazione all'esercito francese nella seconda metà del XIX secolo. È uno dei primi fucili a retrocarica con percussione ad ago utilizzati in operazioni di larga scala."},{"page_url":"https://sv.wikipedia.org/wiki/Kristinestad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Kristinestad_town_hall.jpg","page_title":"Kristinestad","context_page_description":"Kristinestad är en stad i Svenska Österbotten i landskapet Österbotten i Finland vid Bottenhavets östra kust. Kristinestad är en småstad som har en yta på 1 678,98 km², varav 995,95 km² är vatten.\\nKristinestad är en tvåspråkig kommun med svenska som majoritetsspråk och finska som minoritetsspråk. 54,4 procent av befolkningen har svenska som modersmål och 41,3 procent har finska som modersmål, medan 4,2 procent talar andra språk.\\nNuvarande Kristinestads kommun bildades den 1 januari 1973, då kommunerna Lappfjärd, Sideby och Tjöck slogs samman med Kristinestads stad.\\nKristinestads stadskärna med sina låga trähus och smala gränder är unik i hela Norden, och därför kallas Kristinestad ofta Bottenhavets pärla. Staden har under sin drygt 350-åriga existens aldrig drabbats av några större eldsvådor och kan i dag därför visa upp en nästan oförstörd rutstadsplan som omfattar 220 huvudbyggnader och 69 ekonomibyggnader.\\nKristinestad är sedan 2011 med i det internationella Cittaslow-nätverket."},{"page_url":"https://en.wikipedia.org/wiki/Isognathus_swainsonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Lagarta_da_Mariposa-swainsonii_%28Isognathus_swainsonii%29_-_Moth_swainsonii.jpg","page_title":"Isognathus swainsonii","context_page_description":"Isognathus swainsonii is a moth of the family Sphingidae."},{"page_url":"https://en.wikipedia.org/wiki/Yamaha_YZR500","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Wayne_Rainey_at_Hockenheim_%281989%29.jpg","page_title":"Yamaha YZR500","context_page_description":"The YZR500 was the Yamaha Motor Corporation's entry for 500cc Grand Prix motorcycle racing between the years of 1973 and 2002."},{"page_url":"https://de.wikipedia.org/wiki/Hauptmann_von_K%C3%B6penick","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Wilhelm_Voigt_als_Kind.jpg","page_title":"Hauptmann von Köpenick","context_page_description":"Friedrich Wilhelm Voigt war ein aus Ostpreußen stammender Schuhmacher. Er wurde als Hochstapler unter dem Namen Hauptmann von Köpenick bekannt durch seine spektakuläre Besetzung des Rathauses der Stadt Cöpenick bei Berlin, in das er am 16. Oktober 1906 als Hauptmann verkleidet mit einem Trupp gutgläubiger Soldaten eindrang, den Bürgermeister verhaftete und die Stadtkasse raubte.\\nDieses Ereignis, das auf großes öffentliches Interesse stieß und als die Köpenickiade sprichwörtlich in die deutsche Sprache einging, wurde häufig künstlerisch verarbeitet. Besonders bekannt ist Carl Zuckmayers Theaterstück Der Hauptmann von Köpenick."},{"page_url":"https://pt.wikipedia.org/wiki/Barcin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Barcin_market_square5.jpg","page_title":"Barcin","context_page_description":"Barcin é um município da Polônia, na voivodia da Cujávia-Pomerânia e no condado de Żnin. Estende-se por uma área de 3,70 km², com 7 468 habitantes, segundo os censos de 2019, com uma densidade de 2018 hab/km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%8D%E5%BA%86%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/B-30E3%40PEK_%2820200108100410%29.jpg","page_title":"重庆航空","context_page_description":"重庆航空责任公司于2007年6月16日在重庆成立。重庆航空公司注册资本总额为12亿元人民币，由中国南方航空股份公司和重庆市开发投资公司按6：4比例出资组建，其中南方航空以3架空中客车A320系列飞机及部分航空材料出资，折合价值约7.2亿元，重庆市开发投资公司以4.8亿元现金出资。双方资本金分两期到位，首期到位6亿元，第二期资金在公司运营两年内，即2008年到位，2009年重庆航空机队扩充至7架，2012年9月扩充至9架飞机。截止2013年12月31日机队规模11架。至2015年11月机队规模13架。至2018年11月机队规模23架。至2019年7月机队规模28架。"},{"page_url":"https://de.wikipedia.org/wiki/Perth_Immigration_Detention_Centre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Perth_Immigration_Detention_Centre_%287506014976%29.jpg","page_title":"Perth Immigration Detention Centre","context_page_description":"Das Perth Immigration Detention Centre liegt unmittelbarer Nähe zum Flughafen Perth im Stadtteil Redcliffe in Perth, der Hauptstadt des Bundesstaates Western Australia. Es handelt sich um das kleinste Internierungslager Australiens für Asylsuchende, die in Einwanderungshaft in Australien gehalten werden. Gegründet wurde es ursprünglich im Jahr 1981 um illegale Fischer, vor allem aus Indonesien, kurzzeitig festzusetzen. Inzwischen werden dort vor allem Boatpeople inhaftiert.\\nDes Weiteren gibt unweit des Internierungslagers die Perth Immigration Residential Housing Facility, in der asylsuchende Familien mit Kindern untergebracht werden können."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AF%B6%E6%9E%97%E5%85%AC%E5%85%B1%E9%81%8B%E8%BC%B8%E4%BA%A4%E5%8C%AF%E8%99%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/HK_PoLamBusTerminal.JPG","page_title":"寶林公共運輸交匯處","context_page_description":"寶林公共運輸交匯處是一個位於香港西貢區將軍澳寶林的公共運輸交匯處，上蓋為新都城二期，於1999年6月27日啟用。所有以舊寶林總站作總站的小巴和巴士路線於該站啟用時均即時搬入交匯處，以便進行興建港鐵寶琳站工程。\\n寶林巴士總站是寶林公共運輸交匯處的其中一部份。"},{"page_url":"https://en.wikipedia.org/wiki/Optical_spectrometer","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Simple_grating_spectrometer_inside.jpg","page_title":"Optical spectrometer","context_page_description":"An optical spectrometer is an instrument used to measure properties of light over a specific portion of the electromagnetic spectrum, typically used in spectroscopic analysis to identify materials. The variable measured is most often the light's intensity but could also, for instance, be the polarization state. The independent variable is usually the wavelength of the light or a unit directly proportional to the photon energy, such as reciprocal centimeters or electron volts, which has a reciprocal relationship to wavelength.\\nA spectrometer is used in spectroscopy for producing spectral lines and measuring their wavelengths and intensities. Spectrometers may also operate over a wide range of non-optical wavelengths, from gamma rays and X-rays into the far infrared. If the instrument is designed to measure the spectrum in absolute units rather than relative units, then it is typically called a spectrophotometer. The majority of spectrophotometers are used in spectral regions near the visible spectrum.\\nIn general, any particular instrument will operate over a small portion of this total range because of the different techniques used to measure different portions of the spectrum."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%95%E0%A5%81%E0%A4%B6%E0%A4%BE%E0%A4%A8_%E0%A4%B8%E0%A4%BE%E0%A4%AE%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%9C%E0%A5%8D%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Heraios_profile.jpg","page_title":"कुशान साम्राज्य","context_page_description":"कुशान साम्राज्य ऐतिहासिक बक्त्रिया/ ब्याक्ट्रिया क्षेत्रमा रहेका प्राचिन युझी/ रुझी जातिहरूको साम्राज्य हो । कुशानहरूद्वारा शासित ठूला भूभाग अफगानिस्तान, पाकिस्तान र भारतमा रहेको थियो ।"},{"page_url":"https://es.wikipedia.org/wiki/Claudia_Camposano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Tc_logo.png","page_title":"Claudia Camposano","context_page_description":"Claudia Camposano ​ es una actriz ecuatoriana, que ha trabajado para varias producciones nacionales como La Panadería, ¡Así pasa! y Cuatro Cuartos."},{"page_url":"https://fr.wikipedia.org/wiki/Laiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Monument_morts_Laiz_2.jpg","page_title":"Laiz","context_page_description":"Laiz est une commune française, située dans le département de l'Ain en région Auvergne-Rhône-Alpes. Commune de 1212 habitants en 2017 appartenant au canton de Vonnas, Laiz appartient à l'unité urbaine de Pont-de-Veyle, ce qui lui permet de connaître une croissance démographique depuis quelques années.\\nLes habitants sont appelés les Laiziens et les Laiziennes."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_la_Espriella_en_Villahormes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Palacio_de_Espriella04.jpg","page_title":"Palacio de la Espriella en Villahormes","context_page_description":"El palacio de la Espriella es un palacio rural español situado en el barrio de Villahormes, en la parroquia de Hontoria, en el concejo asturiano de Llanes.\\nSe trata de un palacio del siglo XVII iniciado en 1616 para el noble Llanes de Espriella que se encontraba en Palermo en esa época.\\nEn el palacio se efectúan dos remodelaciones, la primera en el siglo XVIII y la segunda y definitiva en el siglo XIX.\\nEste palacio rural tiene una distribución rectangular con patio central. Edificado en piedra lucida con cal destaca el escudo nobiliar situado en la puerta principal. El edificio consta de dos plantas, la baja destinada a la actividad cotidiana de la casa con las cuadras, bodegas y llagar y la planta superior destinada a la familia propietaria. En esta planta están situados las salas, dormitorios principales y el despacho. En una prolongación, que le da su forma rectangular, está situada la cocina, los hornos y el comedor. En un ala de la parte superior se encuentran las habitaciones dedicadas a los criados.\\nEn el palacio, nació el Marqués consorte de Argüelles, Federico Bernaldo de Quirós y Mier, casado con María Josefa Argüelles Díaz."},{"page_url":"https://fi.wikipedia.org/wiki/Josep_Antoni_Coderch","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Casa_de_la_Marina.jpg","page_title":"Josep Antoni Coderch","context_page_description":"Josep Antoni Coderch i de Sentmenat oli katalonialainen arkkitehti. Hän oli kahdeksanlapsisen perheen esikoinen. Hänen isänsä oli Barcelonan sataman suunnittelua johtava insinööri."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Biologinen_museo%2C_Turku_2.JPG","page_title":"Турку","context_page_description":"Ту́рку — город и порт, расположенный на юго-западе Финляндии у впадения реки Аурайоки в Архипелаговое море. Административный центр провинции Варсинайс-Суоми.\\nЧисло жителей на 31 декабря 2017 года — 189 669 человек — это шестой по населению город в Финляндии, а с учётом пригородов — третья городская агломерация в стране после Хельсинки и Тампере.\\nГород официально двуязычный: финский язык в качестве основного используют 87,7 % населения; шведский язык является родным для 5,3 %. Турку считается воротами на Запад, а европейская магистраль E18 связывает его как с Санкт-Петербургом, так и со Стокгольмом. В городе находится крупный порт, осуществляющий грузовое и пассажирское сообщение с Аландскими островами и Швецией. Аэропорт Турку является пятым по величине и вторым по грузоперевозкам в Финляндии.\\nТурку известен как научный и культурный центр: с XIII века здесь действовали две школы, а в 1640 году основан первый университет — Королевская академия Або и первая в Финляндии типография. В 1772 году в городе стала издаваться первая в Финляндии газета. В 2011 году Турку совместно с Таллином был избран культурной столицей Европы."},{"page_url":"https://en.wikipedia.org/wiki/Munger_Place_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Munger_Place_Historic_District1.JPG","page_title":"Munger Place Historic District","context_page_description":"The Munger Place Historic District is a neighborhood and historic district in Old East Dallas, Texas, generally lying between North Fitzhugh Avenue on the southwest, Gaston Avenue on the northwest, Henderson Avenue on the northeast, and Columbia Avenue on the southeast. Detailed boundaries are defined in the Munger Place Ordinance. It is a Dallas Landmark District and listed on the National Register of Historic Places."},{"page_url":"https://es.wikipedia.org/wiki/Judith_con_la_cabeza_de_Holofernes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Judith_of_Bethulia_%281914%29_-_Sweet_%26_Walthall.jpg","page_title":"Judith con la cabeza de Holofernes","context_page_description":"Judith con la cabeza de Holofernes o decapitando a Holofernes es un episodio bíblico y un tema relativamente frecuente en el arte cristiano.\\nAparece en el Libro de Judith, uno de los deuterocanónicos;​ y ha sido representado en más de 114 pinturas y esculturas.​\\nJudith, una bella viuda judía de la que está prendado Holofernes, el general asirio que está a punto de destruir la ciudad de Betulia, entra con él en su tienda y, aprovechándose de que ha quedado inconsciente por haber bebido en exceso, le decapita con su propia espada y huye llevándose la cabeza en una cesta, bolsa o alforja. En las representaciones artísticas suele aparecer la figura de una vieja criada ayudando a Judith.\\nLos artistas han escogido entre dos posibles escenas: la de la decapitación, con Holofernes yaciendo en una cama, o la de la heroína llevándose la cabeza. Una vidriera de comienzos del siglo XVI narra la historia de forma secuencial, representando dos escenas: en la primera y mayor Judith y Holofernes festejan en un banquete;​ en la segunda y menor Judith y la criada llevan la cabeza de Holofernes en un saco, dejando el cuerpo decapitado atrás."},{"page_url":"https://de.wikipedia.org/wiki/Der_Sturm_(Zeitschrift)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Macke_-_Der_Sturm.jpg","page_title":"Der Sturm (Zeitschrift)","context_page_description":"Der Sturm war eine erst wöchentliche, dann halbmonatliche, seit 1915 meist monatliche Zeitschrift des Expressionismus, die in Berlin von Herwarth Walden herausgegeben wurde. Im März 1912 eröffnete Walden die Sturm-Galerie in einer Abrissvilla in der Berliner Tiergartenstraße mit einer Wanderausstellung des Blauen Reiter. Später war sie in der Potsdamer Straße 134 A angesiedelt, wo sich auch die Redaktion der Zeitschrift Der Sturm befand."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BD_%D0%BD%D0%B0%D1%8F%D0%B2%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/DayDream_Rossetti2.jpg","page_title":"Сон наяву","context_page_description":"«Сон наяву» — картина английского художника-прерафаэлита Данте Габриэля Россетти, созданная в 1880 году. На картине изображена Джейн Моррис, сидящая на ветке платана и держащая в руке ветку жимолости — викторианского символа любви, что могло быть отсылкой к тайному роману, возникшему между художником и натурщицей. Работа находится в собрании Музея Виктории и Альберта."},{"page_url":"https://en.wikipedia.org/wiki/Bastion_Peak_(Canada)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Ramparts_in_Tonquin_Valley%2C_Jasper_National_Park.jpg","page_title":"Bastion Peak (Canada)","context_page_description":"Bastion Peak is a 2,994 meter mountain summit located on the shared border of Jasper National Park in Alberta, and Mount Robson Provincial Park in British Columbia, Canada. It is situated in the Tonquin Valley in the Canadian Rockies. It was named in 1916 by Édouard-Gaston Deville because it has an appearance similar to that of a bastion on a castle. Its nearest higher peak is Turret Mountain, 1.6 km to the west, and its greater parent is Mount Geikie 3 km to the west."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D1%80%D1%83%D1%82%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Myriophyllum_spicatum_seeds_mysp2_004_php.jpg","page_title":"Уруть","context_page_description":"Уру́ть, или Перистоли́стник или Водоперица — род травянистых растений семейства Сланоягодниковые."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B7%E0%B8%AD%E0%B9%80%E0%B8%97%E0%B8%B4%E0%B8%A3%E0%B9%8C%E0%B8%AA%E0%B9%82%E0%B8%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Proedous_52270062.jpg","page_title":"กือเทิร์สโล","context_page_description":"กือเทิร์สโล เป็นเมืองในรัฐนอร์ทไรน์-เว็สท์ฟาเลิน ประเทศเยอรมนี ในบริเวณเว็สท์ฟาเลิน และเป็นศูนย์กลางการปกครองของเขตในชื่อเดียวกัน เมืองมีประชากร 96,320 คน มีอุตสาหกรรมผลิตอาหารสำเร็จรูป สิ่งทอ เครื่องเรือน"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B9%E0%B3%81%E0%B2%B0%E0%B3%81%E0%B2%B3%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Horse_Gram_BNC.jpg","page_title":"ಹುರುಳಿ","context_page_description":"ಹುರುಳಿ ಸಸ್ಯವು ಡೆಲಿಖೊಸ್‍ ಬೈಫ್ಲೊರಸ್ ಎಂಬ ಪ್ರಭೇದದಿಂದ ಕರೆಯಲ್ಪಡುತ್ತದೆ. ಈ ಸಸ್ಯ ಲೆಗ್ಯುಮಿನೆಸೀ ಅಥವಾ ಫ್ಯಾಬೇಸೀ ಕುಟುಂಬದ ಪ್ಯಾಪಿಲ್ಯೊನಿಯೆಸಿಯೇ ಉಪಕುಟುಂಬಕ್ಕೆ ಸೇರುತ್ತದೆ. ಇಂಗ್ಲಿಷಿನಲ್ಲಿ ಹಾರ್ಸ್‍ಗ್ರಾಮ್, ಹಿಂದಿಯಲ್ಲಿ ಕುಲ್‍ತಿ ಮತ್ತು ಕನ್ನಡದಲ್ಲಿ ಹುರುಳಿ ಎಂದು ಕರೆಯುತ್ತಾರೆ. ಇದು ತೆವಳಿಕೊಂಡು ಹಬ್ಬುವ ಒಂದು ಬಳ್ಳಿ. ಇದನ್ನು ಹೆಚ್ಚಾಗಿ ಆಂಧ್ರಪ್ರದೇಶ, ಕರ್ನಾಟಕ ಮತ್ತು ತಮಿಳುನಾಡು ರಾಜ್ಯಗಳಲ್ಲಿ ಬೆಳೆಯುತ್ತಾರೆ. ಬೀಜಗಳನ್ನು ಬೇಯಿಸಿ ಅಥವಾ ಹುರಿದು ತಿನ್ನಲಾಗುತ್ತದೆ. ಇದರ ಹಸುರು ಸೊಪ್ಪನ್ನು ಪ್ರಾಣಿಗಳಿಗೆ ಆಹಾರವಾಗಿ ಕೊಡಲಾಗುತ್ತದೆ; ಅಥವಾ ಹಸಿರು ಗೊಬ್ಬರವಾಗಿ ಉಪಯುಕ್ತವಾಗುತ್ತದೆ. ಹಳ್ಳಿಮುಕ್ಕನಿಗೆ ಹಳ್ಳಿಕಜ್ಜಾಯ ಎಂಬ ಗಾದೆಮಾತು ಕನ್ನಡದಲ್ಲಿದ್ದು ಈ ಧಾನ್ಯದಿಂದ ಕಜ್ಜಾಯ ತಯಾರಿಸುತ್ತಿದ್ದರೆಂದು ತಿಳಿದುಬರುತ್ತದೆ."},{"page_url":"https://ceb.wikipedia.org/wiki/Macrozamia_occidua","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Macrozamia_occidua_Dist_Map17.png","page_title":"Macrozamia occidua","context_page_description":"Espesye sa tanom sakop sa ka-ulo nga Tracheophyta, ug nga gihulagway ni David Lloyd Jones ug Paul Irwin Forster ang Macrozamia occidua. Ang Macrozamia occidua sakop sa kahenera nga Macrozamia sa kabanay nga Zamiaceae. Giklaseklase sa IUCN ang espesye sa madutlan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Mass_Rapid_Transitin_asemista","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Ne1_harbourfront.jpg","page_title":"Luettelo Mass Rapid Transitin asemista","context_page_description":"Tämä on luettelo Singaporen Mass Rapid Transitin asemista. Asemia on käytössä 117."},{"page_url":"https://eo.wikipedia.org/wiki/Weilheim_(Supra_Bavario)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Weilheim2.jpg","page_title":"Weilheim (Supra Bavario)","context_page_description":"Weilheim en Supra Bavario aŭ plennome Weilheim in Oberbayern estas urba komunumo en Germanio. Ĝi troviĝas en la distrikto Weilheim-Schongau kaj en la distriktaro Supra Bavario de la federacia lando Bavario, kaj estas la adminisra centro de la distrikto. Fine de decembro 2015 la komunumo havis 22 184 loĝantojn."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_districte_de_Tolosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Ch%C3%A2teau_de_Saint-Geni%C3%A8s-Bellevue.jpg","page_title":"Llista de monuments del districte de Tolosa","context_page_description":"Llista de monuments del districte de Tolosa registrats com a monuments històrics, bé catalogats d'interès nacional o bé inventariats d'interès regional.\\nPer al municipi de Tolosa de Llenguadoc vegeu la llista de monuments de Tolosa de Llenguadoc."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%AF%E3%83%A9%E3%83%B3%E3%83%89_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%82%B8%E3%83%BC%E3%83%A9%E3%83%B3%E3%83%89)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Aucklandqueenmary2.jpg","page_title":"オークランド (ニュージーランド)","context_page_description":"オークランドは、ニュージーランド北島北部に位置するニュージーランド最大の都市。オセアニア有数の世界都市でありポリネシア地域最大の都市でもある。都会でありながら周辺に変化に富む自然環境を持っている。"},{"page_url":"https://de.wikipedia.org/wiki/Armenia_(Quind%C3%ADo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/The_church_on_the_main_square_of_the_city_Armenia_in_Columbia.jpg","page_title":"Armenia (Quindío)","context_page_description":"Armenia ist eine kolumbianische Gemeinde und die Hauptstadt vom Departamento Quindío in der Kaffeeanbauregion."},{"page_url":"https://ru.wikipedia.org/wiki/Neotermitosocius_bolivianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Neotermitosocius_bolivianus.png","page_title":"Neotermitosocius bolivianus","context_page_description":"Neotermitosocius bolivianus — вид термитофильных коротконадкрылых жуков из подсемейства Aleocharinae, единственный в составе монотипического рода Neotermitosocius. Южная Америка: Боливия. Длина около 2 мм. Тело оранжево-коричневого цвета. Усики 11-члениковые. Крылья развиты. Пронотум поперечный, плотно покрытый щетинками, с двумя длинными макросетами на переднебоковых углах. Надкрылья слегка длиннее своей ширины. Передние и средние лапки 4-члениковые, а задние состоят из 5 члеников. Нижнечелюстные щупики 4-члениковые, а нижнегубные состоят из 3 сегментов.\\nБиология неизвестна. Предположительно термитофилы, как и другие представители трибы Termitohospitini, к которой относится этот таксон. Вместе с родами Blapticoxenus Mann, 1923, Paratermitosocius Seevers, 1941, Termitohospes Seevers, 1941, Termitosodails Seevers, 1941, и Termitosocius Seevers, 1941 образует подтрибу Termitohospitina."},{"page_url":"https://en.wikipedia.org/wiki/Climax,_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Pyrite-Tetrahedrite-200660.jpg","page_title":"Climax, Colorado","context_page_description":"Climax was an unincorporated mining village and a former U.S. Post Office located in Lake County, Colorado, United States. Climax is known for its large molybdenum ore deposit. Climax is located along the Continental Divide at an elevation of about 11,360 feet. It was the highest human settlement in the United States, and it holds the record for having had the country's second highest Post Office and the highest railroad station. The residential houses were all transported to the West Park subdivision of Leadville, Colorado, before 1965, leaving only the mining buildings standing.\\nAfter a 17-year shutdown, the Climax mine has reopened and resumed shipment of molybdenum on May 10, 2012."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%80%D0%B0%D0%B7%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Miejska_Szkola_Podstawowa_nr_13_Piekary_Slaskie_090608_01.jpg","page_title":"Образование в Польше","context_page_description":"Обязательное образование в Польше начинается в возрасте пяти или шести лет, согласно Реформам 1999 года, начиная с «0» класса детского сада и с возраста шести-семи лет 1-го класса начальной школы. Обязательное образование длится 9 лет. После первых 6 лет начального образования учащиеся поступают в гимназию на 3 года, а в конце сдают ещё один обязательный экзамен.\\nМинистерство национального образования Польши доказало, что при короле Станиславе Августе Понятовском в 1773 году в Польше существовало первое министерство образования в мире, и эти традиции продолжаются до сих пор. Международная программа по оценке образовательных достижений учащихся в 2012 году оценила достижения, сделанные польским образованием в области математики, техники и грамотности; число наивысших показателей увеличилось с 2003 года, в то время как количество низких показателей снова понизилось. Согласно рейтингу компании Economist Intelligence Unit для Pearson в 2014 году, польское образование оценено как 4-е лучшее в Европе и 10-е лучшее в мире.\\nВ дальнейшем для высшего среднего образования есть несколько альтернатив, наиболее распространенными из них является три года в лицее и четыре года в техникуме."},{"page_url":"https://pl.wikipedia.org/wiki/Quinta_de_Tilcoco","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Plaza_de_Guacarhue.jpg","page_title":"Quinta de Tilcoco","context_page_description":"Quinta de Tilcoco – miasto w Chile, w regionie O’Higgins, Libertador, w prowincji Cachapoal."},{"page_url":"https://en.wikipedia.org/wiki/Opel_Olympia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Opel-Olympia.jpg","page_title":"Opel Olympia","context_page_description":"The Opel Olympia is a compact car produced by the German automaker Opel from 1935 to 1940, from 1947 to 1953 and again from 1967 to 1970.\\nThe 1935 Olympia was Germany's first mass-produced car with an all-steel unitized body. This revolutionary technology reduced the weight of the car by 180 kilograms compared to its predecessor. Production of the unibody design required new production methods and materials. Spot welding, advanced types of steel, and a new production line layout were among the many advances introduced by the Olympia.\\nThe car was first presented in February at the 1935 Berlin Motor Show; production got under way later during that year. The Olympia was named in anticipation of the 1936 Berlin Olympic Games. The pre-war Olympia was made in two versions: From 1935 to 1937 the Olympia had a 1.3-litre engine; for the OL38 version made from 1937 to 1940 this was replaced by a 1.5-litre overhead valve unit.\\nBetween 1935 and 1940, over 168,000 units were built. The car was also Opel's first post-war automobile when it re-entered production in 1947. This time it was built until 1953."},{"page_url":"https://sq.wikipedia.org/wiki/Xhamia_e_Pejgamberit","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Masjid_Nabawi_The_Prophet%27s_Mosque%2C_Madina.jpg","page_title":"Xhamia e Pejgamberit","context_page_description":"Mesxhid en-Nebeui është një xhami e themeluar dhe e ndërtuar fillimisht nga Profeti Muhammed, e cila gjendet në qytetin e Medinës në rajonin e Hixhazit të Arabisë Saudite. Ishte xhamia e tretë e ndërtuar në historinë e Islamit, dhe tani është një nga xhamitë më të mëdha në botë. Është vendi i dytë më i shenjtë në Islam, pas Xhamisë së Madhe në Mekë. Është gjithmonë e hapur, pavarësisht nga data ose koha.\\nVendndodhja e xhamisë ishte fillimisht pranë shtëpisë së Muhammedit; ai u vendos atje pas emigrimit të tij nga Meka në Medinë në vitin 622. Ai mori pjesë në punën e rëndë të ndërtimit. Xhamia origjinale ishte një ndërtesë e hapur. Ajo shërbeu si një qendër e bashkësise islame, një gjykatë dhe një shkollë fetare. Kishte një vend të ngritur që njerëzit të mësonin Kur'anin. Udhëheqësit pasues muslimanë e zgjeruan dhe e dekoruan xhaminë. Në vitin 1909, ajo u bë vendi i parë në Gadishullin Arabik që do u pajis me drita elektrike. Xhamia është nën kontrollin e Mbrojtësit të dy Xhamive të Shenjta. Xhamia gjendet në atë që tradicionalisht ishte qendra e Medinës së vjetër, me shumë hotele dhe tregje të vjetra afër. Është një vend i rëndësishëm pelegrinazhi."},{"page_url":"https://sk.wikipedia.org/wiki/Volica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Volica.jpg","page_title":"Volica","context_page_description":"Volica je prevažne rusnácka – rusínska – obec na severovýchodnom Slovensku v okrese Medzilaborce na hlavnej ceste Humenné – Medzilaborce. Volica sa nachádza v Papínskej brázde Laboreckej vrchoviny v údolí rieky Laborec. Chotár obce je charakterizovaný mierne členitým až svahovitým terénom. Nad obcou je tiahly hrebeň s najvyšším bodom 461 m n. m., ktorým vedú „Petrove stežky“. Pod hrebeňom je prameň kvalitnej pitnej vody aj prameň „vajcovky“. Obec z druhej strany uzatvára hrebeň Grúňa, ktorý ju oddeľuje od obce Zbudská Belá. Samotná obec leží v nadmorskej výške 254 m n. m."},{"page_url":"https://it.wikipedia.org/wiki/Citt%C3%A0_d%27Ombria","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Citt%C3%A0_d%27Ombria_1864_%28muro_di_cinta_%28lato_interno_1%29%29.jpg","page_title":"Città d'Ombria","context_page_description":"Città d'Ombria, nota anche come Castelliere d'Ombria e Città d'Umbrìa, è un sito archeologico fondato probabilmente tra il III e il II secolo a.C. dai Liguri o dagli Umbri, fortificato nel VI o VII secolo dai Bizantini, che si trova a 977 m s.l.m. alle pendici del monte Barigazzo nei pressi delle frazione di Tosca, all'interno del comune di Varsi, in provincia di Parma."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%B0%D1%85%D0%B0%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/FrontOaxacaMainCathedral.jpg","page_title":"Оахака","context_page_description":"Оахака, или пуним именом Оахака де Хуарез, је град у Мексику у савезној држави Оахака. Налази се на југу Мексика на надморској висини од 1555 метара. Према процени из 2005. у граду је живело 258.008 становника.\\nГрад Оахака је основан 1532. Имену града је 1872. додато „Де Хуарез“ у част мексичког председника Бенита Хуареза који се овде почео своју политичку каријеру."},{"page_url":"https://et.wikipedia.org/wiki/Mati_Karelson","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Mati_Karelson_2.jpg","page_title":"Mati Karelson","context_page_description":"Mati Karelson on eesti keemik, Eesti Teaduste Akadeemia liige."},{"page_url":"https://af.wikipedia.org/wiki/Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bread_and_puppet_puppets_glover_vermont.jpg","page_title":"Vermont","context_page_description":"Vermont is 'n deelstaat in die noordooste van die Verenigde State van Amerika met 'n oppervlakte van 24 923 km² en 'n bevolking van 625 741. Vermont is ten opsigte van sy bevolking die tweede kleinste VSA-deelstaat na Wyoming. Sy hoofstad is Montpelier, die grootste stad is Burlington.\\nVermont word begrens deur Massachusetts in die suide, New Hampshire in die ooste, New York in die weste en die Kanadese provinsie Quebec in die noorde. Dit is 'n oorwegend landelike deelstaat, maar is nogtans strategies geleë tussen die metropolitaanse gebiede van Montreal, Boston en New York.\\nVermont is die tweede grootste, maar ook enigste landgebonde deelstaat in Nieu-Engeland, met 'n verskeidenheid landskapsvorme en ekostelsels wat onder meer die Green Mountains-bergreeks in die weste en die Champlainmeer in die noordweste insluit. Die Franse verkenner Samuel de Champlain het in 1609 met Vermont 'n gepaste naam vir die groen en vrugbare streek gekies. Vier eeue later is groot dele van Vermont nog steeds 'n enklawe van ongerepte wildernis, met dig beboste golwende heuwels en valleie. Die staat is bekend vir die kleure wat sy bosgebiede in die nasomer vertoon en sy eersterangse ski-oorde."},{"page_url":"https://es.wikipedia.org/wiki/Gastronom%C3%ADa_del_Per%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Choritos_a_la_chalaca.JPG","page_title":"Gastronomía del Perú","context_page_description":"La gastronomía del Perú es una de las más variadas y exquisitas del mundo, tanto que en el libro 357 listas para entender cómo somos los peruanos llega a contar hasta 491 platos típicos.​\\nLa cocina peruana es el resultado de la fusión inicial de la tradición culinaria del antiguo Perú —con sus propias técnicas y potajes— con la cocina española en su variante más fuertemente influenciada por 762 años de presencia morisca en la península ibérica y con importante aporte de las costumbres culinarias traídas de la costa atlántica del África subsahariana por los esclavos.\\nPosteriormente, este mestizaje se vio influenciado por los usos y costumbres culinarios de los chefs franceses que huyeron de la revolución en su país para radicarse, en buen número, en la capital del virreinato del Perú. Igualmente trascendental fue la influencia de las inmigraciones del siglo XIX, que incluyó chinos-cantoneses, japoneses e italianos, ​ entre otros orígenes principalmente europeos.​​\\nComo particularidad exclusiva de la gastronomía del Perú, existen comidas y sabores de cuatro continentes en un solo país y, esto, desde la segunda mitad del siglo XIX."},{"page_url":"https://da.wikipedia.org/wiki/Tzolk%27in","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/MAYA-g-log-cal-D18-Etznab.png","page_title":"Tzolk'in","context_page_description":"Tzolk'in er det navn, som forskere har givet til den 260-dages kalender, som stammer fra den præcolumbianske mayakultur i Mellemamerika. Tzolk'in bruges stadig af visse mayastammer i højlandet i Guatemala.\\nTzolk'in-kalenderen bruger en tyvedages cyklus af navngivne dage, som kombineres med en anden cyklus på tretten, hvilket giver 260 unikke dage. Der er tyve individuelt navngivne dage som vist i tabellen herunder."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%A2%E4%BD%9C%E7%A5%9E%E7%A4%BE_(%E5%B2%A1%E5%B4%8E%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Yahagi-Jinja-1.jpg","page_title":"矢作神社 (岡崎市)","context_page_description":"矢作神社は、愛知県岡崎市矢作町にある神社。比較的小さな神社ではあるものの、歴史は古い。秋の大祭では山車の引き回しが行われる。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A5%9E%E7%94%B0%E7%A5%9E%E4%BF%9D%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Sanseido-Bookstore-Building-01.jpg","page_title":"神田神保町","context_page_description":"神田神保町は、東京都千代田区の地名。住居表示未実施。現行行政地名は神田神保町一丁目から神田神保町三丁目。郵便番号は101-0051。書店街として知られる。幕臣・神保長治の屋敷があったことに由来する地名。"},{"page_url":"https://sv.wikipedia.org/wiki/Kronuddens_batteri","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Kronuddens_batteri_2011a.jpg","page_title":"Kronuddens batteri","context_page_description":"Kronuddens batteri var ett kanonbatteri i Vaxholmslinjen som låg på Kronudden på Vaxöns östra sida mittemot Vaxholms kastell. Kronuddens batteri kallas även Portugisiska batteriet eftersom den tidvis var bestyckat med kanoner från Portugal. 1916 togs anläggningen ur krigsorganisationen."},{"page_url":"https://it.wikipedia.org/wiki/Giarmata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Turnul_pompierilor_Giarmata.JPG","page_title":"Giarmata","context_page_description":"Giarmata è un comune della Romania di 5.869 abitanti, ubicato nel distretto di Timiș, nella regione storica del Banato.\\nIl comune è formato dall'unione di 2 villaggi: Cerneteaz e Giarmata."},{"page_url":"https://en.wikipedia.org/wiki/Steyr_HS_.50","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Velayat_94_Military_exercise_03_by_Mbazri.jpg","page_title":"Steyr HS .50","context_page_description":"The Steyr HS .50 is a .50 BMG single-shot anti-materiel sniper rifle manufactured by Steyr Mannlicher. The rifle has been widely exported; in addition, Iran produces an unlicensed copy under the name AM-50 Sayyad, while Syria reportedly began producing a second unlicensed copy, dubbed the Golan S-01, in 2019."},{"page_url":"https://fr.wikipedia.org/wiki/Syst%C3%A8me_%C3%A9ducatif_en_Finlande","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Oulun_Suomalaisen_Yhteiskoulun_lukio_20100109.JPG","page_title":"Système éducatif en Finlande","context_page_description":"En 2012, le système éducatif en Finlande figure en 12ᵉ place dans les tests PISA. En 2009, la Finlande était troisième, ce qui lui avait valu l'attention du monde entier. Une réforme radicale était annoncée en avril 2015, pour enseigner par thème, avec une approche holistique, plutôt que par l'approche traditionnelle de sujets restreints comme les mathématiques, l'histoire, la géographie, etc.\\nCette réforme est une étape du système éducatif, afin de mieux s'adapter pour les défis d'avenir. Le système éducatif se divise en deux grands types de formations : les formations théoriques, dispensées par les écoles secondaires et supérieures et les universités, et les formations professionnelles dispensées par les écoles professionnelles."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Kirchenkreis_Zossen-Fl%C3%A4ming","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kirche_Bochow_Niederg%C3%B6rsdorf.jpg","page_title":"Liste der Kirchen im Kirchenkreis Zossen-Fläming","context_page_description":"Die Liste der Kirchen im Kirchenkreis Teltow-Fläming ist eine vollständige Auflistung aller Kirchengebäude des Kirchenkreises Zossen-Fläming der Evangelischen Kirche Berlin-Brandenburg-schlesische Oberlausitz.\\nFolgende Landkreise und kreisfreie Städte sind teilweise oder insgesamt Bestandteil des Kirchenkreises und werden in der Liste mit Abkürzungen gekennzeichnet:\\nTF Landkreis Teltow-Fläming\\nLDS Landkreis Dahme-Spreewald"},{"page_url":"https://no.wikipedia.org/wiki/Chen_Gexin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Chen_Gexin.jpg","page_title":"Chen Gexin","context_page_description":"Chen Gexin var en kinesisk sangkomponist."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Boston_Latin_School_alumni","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Edward_Charles_Pickering_06050r.jpg","page_title":"List of Boston Latin School alumni","context_page_description":"Boston Latin School is a public exam school located in Boston, Massachusetts, that was founded in 1635. It is the first public school and the oldest existing school in the United States.\\nThe school's first class included nine students; the school now has 2,400 pupils drawn from all parts of Boston. Its graduates have included four Harvard presidents, eight Massachusetts state governors, and five signers of the United States Declaration of Independence, as well as several preeminent architects, a leading art historian, a notable naturalist and the conductors of the New York Philharmonic and Boston Pops orchestras. There are also several notable non-graduate alumni, including Louis Farrakhan, a leader of the Nation of Islam. Boston Latin admitted only male students at its founding in 1635. The school's first female student was admitted in the nineteenth century. In 1972, Boston Latin admitted its first co-educational class.\\nAdmission is determined by a combination of a student's score on the independent school Entrance Examination and recent grades, and is limited to residents of the city of Boston."},{"page_url":"https://sco.wikipedia.org/wiki/John_Dramani_Mahama","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/John_Dramani_Mahama_at_Chatham_House.jpg","page_title":"John Dramani Mahama","context_page_description":"John Dramani Mahama is a Ghanaian politeecian who wis been Preses o Ghana frae Julie 2012 until Januar 2017."},{"page_url":"https://eu.wikipedia.org/wiki/Hixam_ibn_Abd_al-Malik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Siria_%28damasco%29%2C_califfo_hisham%2C_dirhem_omayyade%2C_724-743.JPG","page_title":"Hixam ibn Abd al-Malik","context_page_description":"Hixam ibn Abd al-Malik omeiatar kalifa izan zen. Bere agintaldian arteak babestu zituen baina, ikuspegi militar baten aldetik, ez zuen zorte ona izan."},{"page_url":"https://pl.wikipedia.org/wiki/Harcerka_Rzeczypospolitej","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Krzyz_Harcerski_HR.png","page_title":"Harcerka Rzeczypospolitej","context_page_description":"Harcerka Rzeczypospolitej – w ZHP i ZHR najwyższy żeński stopień harcerski. Przeznaczony dla harcerek powyżej 17-18 roku życia. W ZHR oznaczany złotą lilijką, kręgiem i wieńcem na krzyżu harcerskim. W ZHP – dwiema gwiazdkami na pagonie munduru harcerskiego, dodatkowo można oznaczać go też nabitymi na krzyżu harcerskim złotą lilijką, kręgiem i wieńcem."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1953","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/David_Ervine.png","page_title":"Lijst van personen geboren in 1953","context_page_description":"Dit is een lijst van personen die geboren zijn in 1953.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://lt.wikipedia.org/wiki/Stornov%C4%97jus","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Panorama_of_Stornoway.jpg","page_title":"Stornovėjus","context_page_description":"Stornovėjus – miestas šiaurės vakarų Škotijoje. Miestas yra Liojo saloje."},{"page_url":"https://ms.wikipedia.org/wiki/Rentjong_Atjeh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Rentjong_Atjeh_poster.jpg","page_title":"Rentjong Atjeh","context_page_description":"Rentjong Atjeh adalah filem aksi 1940 dari Hindia Belanda yang diarahkan oleh The Teng Chun. Menceritakan kumpulan yang membalas dendam terhadap lanun di Selat Melaka, ia dibintangi oleh Ferry Kock, Dewi Mada, Bissoe, Mohamad Mochtar, dan Hadidjah. Ia telah difilemkan berhampiran dengan pantai dari Batavia dan rakaman semula dari karya Tan sebelum ini Alang-Alang. Rentjong Atjeh, yang diilhamkan sebahagiannya oleh filem Tarzan, merupakan satu kejayaan komersil, walaupun ia kini boleh hilang."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D8%A8%D9%8A%D8%B1%D8%AA_%D8%A7%D9%81._%D8%A8%D8%B1%D8%A7%D8%AF%D9%81%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Robert_F._Bradford.jpg","page_title":"روبيرت اف. برادفورد","context_page_description":"روبيرت اف. برادفورد كان محامى من امريكا."},{"page_url":"https://hu.wikipedia.org/wiki/Alstom_Citadis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Montpellier_fg07.jpg","page_title":"Alstom Citadis","context_page_description":"Az Alstom Citadis a francia Alstom alacsony padlós villamos családja. Összesen 1140 villamos készült el, melyek 28 városban közlekednek."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Utrecht_(stad)/Van_Asch_van_Wijckskade","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Van_Asch_van_Wijckskade_7.jpg","page_title":"Lijst van rijksmonumenten in Utrecht (stad)/Van Asch van Wijckskade","context_page_description":"De stad Utrecht telt in totaal 1402 inschrijvingen in het rijksmonumentenregister. De Van Asch van Wijckskade in het centrum telt 19 rijksmonumenten. Hieronder een overzicht."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%87%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Zea_mays_%27Ottofile_giallo_Tortonese%27_MHNT.BOT.2015.34.1.jpg","page_title":"Пченка","context_page_description":"Пченката е значајна житна култура од родот Пченка семејство Треви потекнува од Америка, односно новиот свет, од каде се проширила во Европа и низ целиот свет."},{"page_url":"https://fr.wikipedia.org/wiki/Ukraino-Canadiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/EgliseUkraineCathoMtl.JPG","page_title":"Ukraino-Canadiens","context_page_description":"Les Ukraino-Canadiens sont des citoyens du Canada qui ont des origines ukrainiennes. En 2001, on recensait 1 071 060 Canadiens d'origine ukrainienne, faisant des Ukraino-Canadiens le neuvième plus grand groupe ethnique du Canada."},{"page_url":"https://de.wikipedia.org/wiki/W%C3%BCrttembergische_Uhrenfabrik_B%C3%BCrk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Bundesarchiv_B_145_Bild-F038809-0007%2C_Wolfsburg%2C_VW_Autowerk%2C_Werksausgang.jpg","page_title":"Württembergische Uhrenfabrik Bürk","context_page_description":"Die Württembergische Uhrenfabrik Bürk war eines der bedeutendsten deutschen Unternehmen in der Uhrenindustrie mit Sitz in Schwenningen am Neckar. Johannes Bürk gründete das Unternehmen im Jahr 1855; es prägte über ein Jahrhundert lang die Geschichte der Stadt, die wegen der Zahl und Bedeutung ihrer Uhrenindustriebetriebe für Jahrzehnte zur „größten Uhrenstadt der Welt“ aufstieg. In dieser Phase hatten Unternehmen und Stadt internationale Bedeutung."},{"page_url":"https://ca.wikipedia.org/wiki/Mailly-le-Ch%C3%A2teau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_89238.png","page_title":"Mailly-le-Château","context_page_description":"Mailly-le-Château és un municipi francès, situat al departament del Yonne i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 589 habitants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B2%D0%B8%D0%BD%D1%8C%D0%B8-%D0%BB%D0%B5-%D0%91%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Ch%C3%A2teau-Savigny-l%C3%A8s-Beaune_01.jpg","page_title":"Савиньи-ле-Бон","context_page_description":"Савиньи́-ле-Бон — коммуна во Франции, находится в регионе Бургундия. Департамент коммуны — Кот-д’Ор. Входит в состав кантона Бон-Север. Округ коммуны — Бон. Расположена в Бургундии, в окрестностях Бона, на юго-западе от Дижона. Находится в центре старинных виноградников, которые расположены с двух сторон от деревни и заканчиваются у леса в долине Роны. В деревне стоят, преимущественно, старинные домики, а также находится красивый замок 14 века. Замок первоначально был построен в 1340 году, им владел герцог Одо Жан Фролуа, маршал Бургундии. Был разрушен в 1478 году после вторжения в Бургундию Людовика XI и восстановлен Этьеном Буйе в начале 17 века. В 1689 году замок становится владением генерала, графа Лойера и его потомков, несколько раз меняет владельцев, пока в начале 1980 годов не становится собственностью Мишеля Понта.\\nКод INSEE коммуны — 21590."},{"page_url":"https://de.wikipedia.org/wiki/Kanonenboot","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Mutine.jpg","page_title":"Kanonenboot","context_page_description":"Kanonenboote sind eine Klasse von kleineren Kriegsschiffen. Sie sind zum Einsatz im küstennahen Bereich, auf Flüssen und anderen Binnengewässern konzipiert worden und wurden zur Artillerieunterstützung der Landstreitkräfte, zum Wach-, Geleit- und Kolonialdienst eingesetzt. Der Begriff Kanonenbootpolitik rührt von ihnen her."},{"page_url":"https://de.wikipedia.org/wiki/Otto_Fr%C3%B6licher","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Froelicher_landschaft.jpg","page_title":"Otto Frölicher","context_page_description":"Otto Viktor Frölicher, auch Otto Fröhlicher oder Otto Froelicher war ein Schweizer Landschaftsmaler und wichtigster Deutschschweizer Vertreter des Paysage intime."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_las_Vistillas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/1866%2C_Cr%C3%B3nica_general_de_Espa%C3%B1a%2C_Madrid%2C_Palacio_del_Duque_de_Osuna.jpg","page_title":"Palacio de las Vistillas","context_page_description":"El palacio de las Vistillas fue un inmueble de la ciudad española de Madrid, desaparecido a finales del siglo XIX."},{"page_url":"https://en.wikipedia.org/wiki/Interstate_40_in_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Start_of_Interstate_40.jpg","page_title":"Interstate 40 in California","context_page_description":"Interstate 40 is a major east–west Interstate Highway in the United States, stretching from Barstow, California, to Wilmington, North Carolina. The segment of I-40 in California is sometimes called the Needles Freeway. It goes east from its western terminus at Interstate 15 in Barstow across the Mojave Desert in San Bernardino County past the Clipper Mountains to Needles, before it crosses over the Colorado River into Arizona east of Needles. All 155 miles of I-40 in California are in San Bernardino County."},{"page_url":"https://fr.wikipedia.org/wiki/Citro%C3%ABn_Nemo_-_Fiat_Qubo_et_Fiorino_III_-_Peugeot_Bipper","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Fiat_Qubo_front_-_PSM_2009.jpg","page_title":"Citroën Nemo - Fiat Qubo et Fiorino III - Peugeot Bipper","context_page_description":"Les Fiat Fiorino III, Fiat Qubo, Citroën Nemo et Peugeot Bipper étaient des petits véhicules utilitaires développés par la filiale turque de Fiat, Tofaş, en collaboration avec Fiat Professional et PSA à la suite de l'accord de coopération signé le 31 mars 2005. C'est Tofaş qui détient la totalité des droits d'ingénierie sur ce modèle, aussi appelé MiniCargo. Développé sur la plate-forme de la Fiat Grande Punto avec des moteurs italiens, il est commercialisé depuis le début de l'hiver 2007 par Fiat Professional et février 2008 par les deux constructeurs français Peugeot et Citroën, dans leurs réseaux respectifs.\\nSergio Marchionne, administrateur délégué de Fiat Group, Christian Streiff, président de PSA et Mustafa V. Koç, président de Fiat-Tofaş, ont inauguré le 3 octobre 2007 dans l’usine Fiat-Tofas de Bursa en Turquie, la ligne de production destinée à un nouveau type d’utilitaire d’entrée de gamme. Tofaş, le plus important constructeur automobile en Turquie, est détenu à parité par les groupes Fiat Group et Koç Holding.\\nCes modèles furent vendus jusqu'au début 2020."},{"page_url":"https://cs.wikipedia.org/wiki/Kongur_Jiubie","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Karakul-kongur-d11.jpg","page_title":"Kongur Jiubie","context_page_description":"Kongur Jiubie je hora v Kašgarském hřbetu pohoří Pamír v autonomní oblasti Sin-ťiang v Čínské lidové republice. Její vrchol je vysoký 7 530 nebo 7595 m n. m. a jedná se o 47. nejvyšší horu na světě. Kongur Jiubie leží 10,52 km západně od Konguru, se kterým je vrchol spojený hřebenem."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%B0%D1%85%D0%B8%D1%80%D0%B8_%D0%9C%D0%B0%D1%85%D0%B0%D1%81%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Signature-Transparent-Lahiri-Mahasaya.png","page_title":"Лахири Махасая","context_page_description":"Шияма Чаран Лахири, познат като Лахири Махасая, е индийски Йогин, ученик на Махаватар Бабаджи. Махасая в превод от санскрит означава велика душа."},{"page_url":"https://ceb.wikipedia.org/wiki/Tetragonula_carbonaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sugarbag_bee.jpg","page_title":"Tetragonula carbonaria","context_page_description":"Espesye sa buyog nga una nga gihulagway ni Smith ni adtong 1854 ang Tetragonula carbonaria. Ang Tetragonula carbonaria sakop sa kahenera nga Tetragonula sa kabanay nga Apidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://pl.wikipedia.org/wiki/Synagoga_Cmentarna_w_Warszawie","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Fundamenty_synagogi_cmentarnej_3.JPG","page_title":"Synagoga Cmentarna w Warszawie","context_page_description":"Synagoga Cmentarna w Warszawie – nieistniejąca synagoga w Warszawie, znajdująca się przy ulicy Okopowej 49/51 na cmentarzu żydowskim.\\nSynagoga została zbudowana w 1877 roku, według projektu architekta Adolfa Schimmelpfenniga. Do synagogi dobudowane były dwa parterowe domy przedpogrzebowe, lewy dla zmarłych mężczyzn, a prawy dla kobiet. Na piętrze mieszkał rabin z rodziną. Podczas II wojny światowej, 15 maja 1943 roku, hitlerowcy doszczętnie zniszczyli synagogę. Po zakończeniu wojny budynku synagogi nie odbudowano.\\nMurowany, otynkowany budynek synagogi wzniesiono na planie prostokąta, w stylu późnego klasycyzmu. W centralnej części mieściła się bożnica, a w dwóch dobudówkach domy przedpogrzebowe. Na piętrze obok mieszkania rabina znajdował się babiniec. Fronton synagogi zdobił kolisty witraż wraz z umieszczoną na szczycie tablicami Dekalogu.\\nObecnie Gmina Starozakonnych w RP stara się o odbudowanie synagogi, lecz warszawska gmina żydowska nie wyraziła na to zgody. Jak dotąd odkopano tylko fundamenty bożnicy oraz przedmioty tam znalezione, które są eksponowane na specjalnie do tego przeznaczonej wystawie w budynku przy ulicy Gibalskiego 21 oraz bezpośrednio na cmentarzu."},{"page_url":"https://fr.wikipedia.org/wiki/Tamanoir","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Anteater_mask_and_scratcher_used_by_boys_in_the_Koko_ceremony%2C_Kayapo_culture%2C_Brazil%2C_c._1970_-_Royal_Ontario_Museum_-_DSC09551.JPG","page_title":"Tamanoir","context_page_description":"Le tamanoir, également nommé fourmilier géant ou grand fourmilier, est une espèce de mammifères de la famille des Myrmecophagidae. C'est la seule espèce du genre Myrmecophaga. C'est un grand mammifère insectivore natif de l'Amérique centrale et du Sud. Il est l'une des quatre espèces vivantes de fourmiliers et classé, avec les paresseux, dans l'ordre Pilosa. Le tamanoir est surtout terrestre, contrairement à d'autres fourmiliers ou paresseux, qui sont arboricoles ou semi-arboricoles. L'espèce est la plus grande de sa famille avec une taille moyenne comprise entre 182 cm et 217 cm et un poids allant de 33 kg à 41 kg pour les mâles, de 27 à 39 kg pour les femelles. Le tamanoir est reconnaissable à son museau allongé, sa queue touffue, ses griffes avant longues et son pelage de couleur distincte.\\nLe fourmilier géant se rencontre dans de multiples habitats, notamment les prairies et la forêt tropicale. Il vit généralement à cheval sur plusieurs biotopes vitaux. Le tamanoir se nourrit dans les zones ouvertes, pour se reposer dans les zones plus boisées."},{"page_url":"https://de.wikipedia.org/wiki/Botanischer_Garten_(Frankfurt_(Oder))","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Botanischer_Garten_Frankfurt_%28Oder%29_08.jpg","page_title":"Botanischer Garten (Frankfurt (Oder))","context_page_description":"Der Botanische Garten an der Lienaustraße in Frankfurt (Oder) wurde ab 1969 geplant und am 26. Juni 1976 als Pflanzenschaugarten eröffnet.\\nDer Lienauteich im Mittelpunkt des Parks entstand infolge des Abbaus von Ton für die Ziegelherstellung seit dem 19. Jahrhundert.\\nDie Grünanlagengestaltung übernahm R. Zeletzki. Um den Teich herum befinden sich auf den treppenartig gebauten Bereichen Bäume wie Kolorado-Tannen, Kuchenbäume, Blauglockenbäume, Gleditschien, mehrere Weidenarten, Rhododendren, Stauden wie Taglilie, Funkien, Mädchenauge und Gräser wie Lampenputzergras und Chinaschilf.\\nDer Linauteich ist 6 ha groß. und ca. 9 Meter tief. Sein Name erinnert an den Frankfurter Stadtrat\\nM. Lienau. Gepflegt werden die Anlagen von der Stadt Frankfurt (Oder).\\nNach Norden hin wird er durch das Klingefließ begrenzt, nach Westen durch das Nuhnenfließ.\\nBis heute stehen 14 Skulpturen, unter anderem von Werner Stötzer, Jürgen Karnopp, Heinz Mamat und Jürgen von Woyski als Kunstwerke im öffentlichen Raum."},{"page_url":"https://hr.wikipedia.org/wiki/Franc_Ksaver_Me%C5%A1ko","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Franc_Ksaver_Me%C5%A1ko.jpg","page_title":"Franc Ksaver Meško","context_page_description":"Franc Ksaver Meško, slovenski rimokatolički svećenik, pjesnik i pisac, rođen 28. listopada 1874. godine, Gornji Ključarovci kod Ormoža, za vrijeme austro-ugarske, a umro je 11. siječnja 1964. godine u Slovenj Gradec, Slovenija, SFR Jugoslavija.\\nKsaver Meško je studirao bogosloviju te bio kapelan i župnik u različitim mjestima u Koruškoj. Veći dio svog života je proživio kao župnik u Selama kod Slovenj Gradeca.\\nMeško je pisao pjesme, priče, romane, novele, crtice, drame i omladinske pripovijesti. Pored lirike i dramatike pisao je i prozu. Svoje mjesto u slovenskoj književnosti je pridobio prije svega i najviše radi proze.\\nU njegovu radu prevladava katolički pogled na svijet sa jakim narodnostnim naglascima. Slogovno je na njega utjecao Ivan Cankar."},{"page_url":"https://en.wikipedia.org/wiki/Gloucester_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Gloucester_Cathedral_Bishop_John_Yates.jpg","page_title":"Gloucester Cathedral","context_page_description":"Gloucester Cathedral, formally the Cathedral Church of St Peter and the Holy and Indivisible Trinity, in Gloucester, England, stands in the north of the city near the River Severn. It originated in 678 or 679 with the foundation of an abbey dedicated to Saint Peter."},{"page_url":"https://ro.wikipedia.org/wiki/Ciuperci_comestibile","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Lentinellus_cochleatus_BS_6.1.JPG","page_title":"Ciuperci comestibile","context_page_description":"Ciuperci comestibile din regnul Fungi de tip Ascomycota precum Basidiomycota care au pălărie și picior, există în număr mare. Aici sunt enumerate doar câteva exemplare. Și în România sunt cunoscute peste 2.500 de soiuri de ciuperci basidiomicete din care mai mult de 500 sunt comestibile, fiind mai mult sau mai puțin gustoase."},{"page_url":"https://cs.wikipedia.org/wiki/Hlavinka_horsk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Traunsteinera_globosa_T69.1.jpg","page_title":"Hlavinka horská","context_page_description":"Hlavinka horská je pozemní, hlíznatá orchidej, jediný druh rodu hlavinka, který se v evropské přírodě vyskytuje. Tato bylina s neobvyklým narůžovělým květenstvím připomínajícím spíše česnek roste v přírodě Česka jen ojediněle a je přísně chráněna. Lze ji s jinou rostlinou nesnadno zaměnit, neboť další druh téhož rodu, Traunsteinera sphaerica, má květy nažloutlé a roste až v jihozápadní Asii."},{"page_url":"https://nl.wikipedia.org/wiki/Rein_Welschen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Samenwerkingsverband_Regio_Eindhoven.png","page_title":"Rein Welschen","context_page_description":"Reinier Wilhelmus Welschen was een Nederlands politicus en bestuurder. Hij was bioloog en promoveerde in de geneeskunde. Welschen was van 1978 tot 2004 werkzaam in het openbaar bestuur, onder meer van 1992 tot 2003 als burgemeester van Eindhoven; hij was lid van de PvdA. Nadat eind 2005 een hersentumor was geconstateerd, overleed de oud-burgemeester op 17 september 2013."},{"page_url":"https://en.wikipedia.org/wiki/Parasailing","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/2017_Sarasota_Crescent_Beach_Airplane_Ad_Banner_4_FRD_9257_%28cropped%29.jpg","page_title":"Parasailing","context_page_description":"Parasailing, also known as parascending or parakiting, is a recreational kiting activity where a person is towed behind a vehicle while attached to a specially designed canopy wing that resembles a parachute, known as a parasail wing. The manned kite's moving anchor may be a car, truck, or boat. The harness attaches the pilot to the parasail, which is connected to the boat, or land vehicle, by the tow rope. The vehicle then drives off, carrying the parascender and person into the air. If the boat is powerful enough, two or three people can parasail behind it at the same time. The parascender has little or no control over the parachute. The activity is primarily a fun ride, not to be confused with the sport of paragliding.\\nThere are commercial parasailing operations all over the world. Land-based parasailing has also been transformed into a competition sport in Europe. In land-based competition parasailing, the parasail is towed to maximum height behind a 4-wheel-drive vehicle. The driver then releases the tow line; the parasailer flies down to a target area in an accuracy competition.\\nThe sport was developed in the early 1980s and has been very popular ever since."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D5%BA%D5%B8%D5%AC%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Oppeln_by_night.jpg","page_title":"Օպոլե","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Օպոլե\\nՕպոլե, քաղաք է Լեհաստանի հարավային հատվածում։ Ըստ 2009 թվականի մարդահամարի երկրի բնակչությունը 125,992 մարդ է։ Քաղաքի պաշտոնական լեզուն համարվում է լեհերենը։ Բնակչությունը բազմազան է։ Այստեղ ապրում են մեծ քանակությամբ լեհեր և գերմանացիներ"},{"page_url":"https://fr.wikipedia.org/wiki/Canton_de_N%C3%AEmes-6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Cantons_de_N%C3%AEmes6.png","page_title":"Canton de Nîmes-6","context_page_description":"Le canton de Nîmes-6 est une ancienne division administrative du département du Gard, dans l’arrondissement de Nîmes."},{"page_url":"https://sv.wikipedia.org/wiki/Libo%C4%8Dany","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Libocany_LN_CZ.png","page_title":"Libočany","context_page_description":"Libočany är en ort i Tjeckien. Den ligger i länet Ústí nad Labem, i den nordvästra delen av landet, 70 km väster om huvudstaden Prag. Libočany ligger 215 meter över havet och antalet invånare är 510.\\nTerrängen runt Libočany är huvudsakligen platt. Libočany ligger nere i en dal. Den högsta punkten i närheten är 264 meter över havet, 1,0 km söder om Libočany. Runt Libočany är det ganska glesbefolkat, med 34 invånare per kvadratkilometer. Närmaste större samhälle är Žatec, 2,4 km öster om Libočany. Trakten runt Libočany består till största delen av jordbruksmark.\\nTrakten ingår i den boreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är december, med -6 °C."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%82%A8%E3%83%B3%E3%83%93%E3%82%A8%E3%83%B3%E3%83%95%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Dien_Bien_Phu%2C_statue_1.jpg","page_title":"ディエンビエンフー","context_page_description":"ディエンビエンフーは、ベトナム北西部のラオス国境に近い、ディエンビエン省の省都。盆地の町である。"},{"page_url":"https://hu.wikipedia.org/wiki/Ardeszt%C3%A1n_megye","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Isfahan_counties.svg","page_title":"Ardesztán megye","context_page_description":"Ardesztán megye Irán Iszfahán tartományának egyik északi megyéje az ország középső részén. Északon Szemnán tartománnyal határos, keleten Nájin, délen Iszfahán, délnyugaton Borhár, nyugatról Natanz és Aran va Bidgol megyék határolják. Székhelye Ardesztán városa. Második legnagyobb városa Zavareh. A megye lakossága 43 585 fő, területe 11 591 km². A megye két további kerületre oszlik: Központi kerület és Zavareh kerület."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D0%BC%D0%BE%D0%BD%D0%B4%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Maun_Airport.jpg","page_title":"Фурудгоҳи мондн","context_page_description":"Фурудгоҳи мондн — фурудгоҳи ҳамагона бо Коди ИОТОи MUB аст, ки як бонди фуруди асфалт ва бутун дорад, ва тӯли бонди он 2000 метр аст. Ин фурудгоҳ дар кишвари Ботсвана қарор дорад, ва дар баландии 943 метр аз сатҳи баҳр воқеъ шудааст."},{"page_url":"https://pl.wikipedia.org/wiki/Aleksandria_(powiat_%C5%BCyrardowski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/NOWY_DWOREK_01A.jpg","page_title":"Aleksandria (powiat żyrardowski)","context_page_description":"Aleksandria – wieś w Polsce położona w województwie mazowieckim, w powiecie żyrardowskim, w gminie Puszcza Mariańska.\\nW latach 1975–1998 miejscowość należała administracyjnie do województwa skierniewickiego."},{"page_url":"https://en.wikipedia.org/wiki/East_Azerbaijan_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/East_Azerbaijan.svg","page_title":"East Azerbaijan Province","context_page_description":"East Azerbaijan Province is one of the 31 provinces of Iran. It is located in Iranian Azerbaijan, bordering with Armenia, Republic of Azerbaijan, Ardabil Province, West Azerbaijan Province, and Zanjan Province. The capital of East Azerbaijan is Tabriz. East Azerbaijan Province is in Regions 3 of Iran, with its secretariat located in its capital city, Tabriz."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E5%B1%B1%E7%BB%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%E8%A5%BF%E5%B1%B1%E7%BB%8F_%E4%B3%8B%E6%B8%A0.jpg","page_title":"西山经","context_page_description":"《西山經》，為《山海經》山部的第二部，其中描述書中西山部的各種山脈、流水、鳥獸、礦物與神祇。\\n此卷包括《西山首經》、《西山二經》、《西山三經》、《西山四經》，分別講述華山山系、鈐山山系、崇吾山系、陰山山系等，一共七十七座山，七千五百一十七里。此外，作為一部充滿神話色彩的地理和禮儀古籍，此卷中描述的一些神祇包括西王母、英招、帝江等，都深深地影響到此後數千年的東亞文化圈中國家的禮儀和文化。"},{"page_url":"https://sv.wikipedia.org/wiki/Mauritia_flexuosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Mauritia.jpg","page_title":"Mauritia flexuosa","context_page_description":"Mauritia flexuosa är en enhjärtbladig växtart som beskrevs av Carl von Linné d.y.. Mauritia flexuosa ingår i släktet Mauritia och familjen Arecaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Fremantle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Fremantle_Notre_Dame_Tannock_Hall.jpg","page_title":"Fremantle","context_page_description":"Fremantle is a port city in Western Australia, located at the mouth of the Swan River in the metropolitan area of Perth, the state capital. Fremantle Harbour serves as the port of Perth. In 2016, Fremantle had a population of approximately 29,000. The Western Australian vernacular diminutive for Fremantle is Freo.\\nPrior to British settlement, the indigenous Noongar people inhabited the area for millennia, and knew it by the name of Walyalup. Visited by Dutch explorers in the 1600s, Fremantle was the first area settled by the Swan River colonists in 1829, and is named after Captain Charles Fremantle, an English naval officer who claimed the west coast of New Holland as British territory. The settlement struggled in its first decades, and in 1850, with the advent of penal transportation to the colony, Fremantle became Australia's primary destination for convicts. The convict-built Fremantle Prison operated long after transportation ended in 1868, and is now a World Heritage Site."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D6%80%D5%B4%D5%B5%D5%A1%D5%B6%D5%BD%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Armyansk_COA.png","page_title":"Արմյանսկ","context_page_description":"Արմյանսկ ՝ քաղաք է Ղրիմի հյուսիսային մասում։ Գտնվում է կարևոր ստրատեգիական տեղում, որը կապում է Ղրիմը ցամաքի հետ։ Հիմնադրված է եղել հայերի կողմից 1730-ականներին, ըստ որոշ աղբյուրների՝ 1736 թվականին։\\n2012 թվականի տվյալներով Արմյանսկ քաղաքում բնակվում էր 22 468 մարդ։"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Northampton_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Isaac_Stout_House_01.JPG","page_title":"National Register of Historic Places listings in Northampton County, Pennsylvania","context_page_description":"This is a list of the National Register of Historic Places listings in Northampton County, Pennsylvania.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Northampton County, Pennsylvania, United States.\\nThere are 59 properties and districts listed on the National Register in the county, including 4 sites designated as National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D0%BA%D0%B5,_%D0%A4%D1%80%D0%B0%D0%BD%D1%82%D0%B8%D1%88%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Naske_Franti%C5%A1ek_Xaver.jpg","page_title":"Наске, Франтишек","context_page_description":"Франтишек Ксавье Наске — чешский художник, дизайнер и иллюстратор."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BF%D0%BE%D1%81%D1%82%D0%BE%D0%BB%D0%B8,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%90%D0%BF%D0%BE%D1%81%D1%82%D0%BE%D0%BB%D0%B8.jpg","page_title":"Апостоли, Борис Николаевич","context_page_description":"Борис Николаевич Апостоли — капитан 1-го ранга, начальник Черноморского высшего военно-морского училища в Севастополе, командир 76-й морской стрелковой бригады, начальник Бакинского военно-морского подготовительного училища ВМФ."},{"page_url":"https://no.wikipedia.org/wiki/Bergen_(Landkreis_Celle)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Bergen_Rathaus_2.jpg","page_title":"Bergen (Landkreis Celle)","context_page_description":"Bergen er en by på Lüneburger Heide i Landkreis Celle i den nordlige delen av den tyske delstaten Niedersachsen."},{"page_url":"https://id.wikipedia.org/wiki/Pemimpin_Partai_Buruh_Korea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Flag_of_the_Workers%27_Party_of_Korea.svg","page_title":"Pemimpin Partai Buruh Korea","context_page_description":"Pemimpin Partai Buruh Korea, atau secara resmi disebut sebagai Ketua Partai Buruh Korea, adalah Ketua Komisi Militer Pusat menurut hak jabatan dan Pemimpin Tertinggi Korea Utara. Sepanjang pendiriannya, PBK memiliki lima posisi pemimpin; Ketua Komite Pusat, Sekretaris Jenderal Komite Pusat, Sekretaris Jenderal Partai Buruh Korea, Sekretaris Pertama Partai Buruh Korea dan Ketua Partai Buruh Korea.\\nJabatan Ketua Komite Pusat didirikan di Kongres ke-1, dan memilih Kim Tu-bong untuk jabatan tersebut. Jabatan tersebut berganti nama pada Konferensi ke-2 Oktober 1966 dengan nama Sekretaris Komite Pusat; melalui jabatan tersebut, Kim Il-sung menjadi kepala Sekretariat resmi partai tersebut. Setelah Kim Il-sung meninggal pada 1994, jabatan tersebut lowong selama tiga tahun. Pada 8 Oktober 1997, Kim Jong-il diangkat pada jabatan baru Sekretaris Jenderal Partai Buruh Korea dalam sebuah pengumuman bersama oleh Komite Pusat dan Komisi Militer Pusat Partai Buruh Korea: \\"[KP dan KMP] mengangkat rekan Kim Jong-il sebagai sekjen partai, berdasarkan pada harapan seluruh Angkatan Darat Rakyat, rakyat, dan para anggota partai.\\""},{"page_url":"https://eu.wikipedia.org/wiki/Ekuador","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ecuador_Blue_Marble.png","page_title":"Ekuador","context_page_description":"Ekuador, ofizialki Ekuadorko Errepublika, Hego Amerika ipar-mendebaldeko estatua da, Ozeano Barearen ertzean dagoena. Iparraldean Kolonbiarekin du muga, ekialde eta hegoaldean Perurekin eta mendebaldean Ozeano Barearekin. 283.561 km²-ko azalera du eta 14.306.876 biztanle 2010eko erroldaren arabera. Izena gaztelaniazko ecuador hitzetik datorkio, Lurraren ekuatorean baitago. Hiriburua Quito da. Sukrea da bertako txanpona.\\nIparraldeko Andeek iparraldetik hegoaldera zeharkatzen dute herrialdea. Sumendizko mendilerroa da: 70 sumendi daude, handienak Chimborazo eta Cotopaxi. Andeen mendebaldean Guayaquilgo golkoa eta itsabazterreko zabaldia daude eta ekialdean Amazonia. Horrez gainera, Pazifikoan, kontinentetik 1.000 kmra dauden Galapagos uharteak ere Ekuadorkoak dira.\\nEkuador errepublika presidentzialista da. 1830ean lortu zuen independentzia, Espainiar Inperioaren eta Colombia Handiaren parte izan ondoren. Giza Garapen Indizea 0,695 da eta biztanleriaren %33,1 txirotasun mailaren azpitik bizi da."},{"page_url":"https://nl.wikipedia.org/wiki/Zaporizja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/%D0%94%D0%BD%D1%96%D0%BF%D1%80%D0%BE%D0%B3%D0%B5%D1%81_%D0%B7_%D0%B2%D0%B8%D1%81%D0%BE%D1%82%D0%B8.jpg","page_title":"Zaporizja","context_page_description":"Zaporizja is een stad in het zuidoosten van Oekraïne en de hoofdstad van de oblast Zaporizja. Zaporizja is met ongeveer 790.000 inwoners de zesde stad van Oekraïne. Het ligt op ongeveer 70 kilometer van Dnipro aan de oevers van de rivier de Dnjepr."},{"page_url":"https://en.wikipedia.org/wiki/Rock_Island_Depot_(Lincoln,_Nebraska)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Rock_Island_depot_%28Lincoln%2C_Nebraska%29_4.JPG","page_title":"Rock Island Depot (Lincoln, Nebraska)","context_page_description":"The Rock Island Depot in Lincoln, Nebraska is a historic railroad station which served passenger trains of the Chicago, Rock Island and Pacific Railroad from 1893 to 1968. It was listed on the National Register of Historic Places on September 3, 1971. The buildings is now occupied by a branch of Union Bank and Trust. Most of the former Rock Island Line trackage in Lincoln has been converted to rail trails."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B7%D9%8A%D9%88%D8%B1_%D8%A7%D9%84%D8%A8%D8%B1%D8%A7%D8%B2%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Lesser_Nighthawk.jpg","page_title":"قائمة طيور البرازيل","context_page_description":"قائمة طيور البرازيل"},{"page_url":"https://pl.wikipedia.org/wiki/Bezmiechowa_G%C3%B3rna","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Bezmiechowa_G%C3%B3rna%2C_cerkiew_Narodzenia_Bogarodzicy_%28HB1%29.jpg","page_title":"Bezmiechowa Górna","context_page_description":"Bezmiechowa Górna dawniej też Bezmichowa Górna – wieś w Polsce położona w województwie podkarpackim, w powiecie leskim, w gminie Lesko.\\nMiejscowość jest siedzibą rzymskokatolickiej parafii Narodzenia Najświętszej Maryi Panny."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_del_Delta_del_R%C3%ADo_Mekong","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Mekong_Delta_in_Vietnam.svg","page_title":"Región del Delta del Río Mekong","context_page_description":"La Región de Đồng Bằng Sông Cửu Long es una de las ocho regiones que conforman un grupo secundario en la Organización territorial de la República Socialista de Vietnam."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%88%EC%8B%9C%EC%B9%B4%EC%99%80_%EB%8B%A4%EC%B9%B4%EB%85%B8%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/T.M._Revolution_%40_Kinokuniya_Bookstore_NYC_-_2008_-_10_%28cropped%29.jpg","page_title":"니시카와 다카노리","context_page_description":"니시카와 다카노리는 일본의 가수이자 배우이다. 1989년 비주얼계 밴드 Luis-Mary의 보컬로 데뷔했으나 1993년에 밴드가 해체되었다. 1995년에 프로듀서 아사쿠라 다이스케를 만나 솔로 가수로 다시 데뷔했으며 1996년 솔로 프로젝트 T.M.Revolution으로 활동하기 시작했다. 2005년에는 락 밴드 abingdon boys school의 보컬로 활동하기 시작했다."},{"page_url":"https://pl.wikipedia.org/wiki/USS_New_Jersey_(BB-62)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/USS_New_Jersey.jpg","page_title":"USS New Jersey (BB-62)","context_page_description":"New Jersey (BB-62) – amerykański pancernik typu Iowa, nazywany także „Big J” lub „Black Dragon”; drugi okręt US Navy nazwany na cześć stanu New Jersey. Okręt ten uzyskał najwięcej gwiazd bojowych za udział w misjach bojowych spośród jednostek typu Iowa i jako jedyny pancernik wspierał ogniem artyleryjskim wojska amerykańskie podczas wojny wietnamskiej.\\nPodczas drugiej wojny światowej „New Jersey” ostrzeliwał cele na Guamie i Okinawie, a także zapewniał osłonę lotniskowcom podczas walk w archipelagu Wysp Marshalla. W czasie wojny koreańskiej „New Jersey” pełnił służbę patrolową u wybrzeży Korei Północnej, a po powrocie do Stanów Zjednoczonych został wycofany do rezerwy i przesunięty do Floty Rezerwowej Stanów Zjednoczonych, bardziej znanej pod nazwą mothball fleet. Wkrótce jednak, już w roku 1968, został na krótko przywrócony do służby i wysłany do Wietnamu z zadaniem wspierania ogniem artyleryjskim piechoty amerykańskiej. W 1969 roku ponownie wycofany do rezerwy. Po raz kolejny przywrócono go do służby w latach 80. w ramach planu marynarki 600 okrętów, kiedy to okręt zmodernizowano i przystosowano do przenoszenia pocisków rakietowych."},{"page_url":"https://jv.wikipedia.org/wiki/Rhine-Main-Danube_Canal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Verbindung_main_donau.png","page_title":"Rhine-Main-Danube Canal","context_page_description":"Rhine–Main–Danube Canal, dumunung ing Bavaria, Jerman, ngubungaké kali Main lan Danube mili saka Bamberg liwat Nuremberg menyang Kelheim. Kanal iki ngubungaké Segara Lor lan Samudra Atlantik karo Segara Ireng."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E6%98%93%E9%BB%91%E4%BD%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/%E4%B8%AD%E6%98%93%E9%BB%91%E4%BD%93%E6%A0%B7%E6%9C%AC.png","page_title":"中易黑体","context_page_description":"中易黑体，是由北京中易中标电子信息技术有限公司制作并持有著作权的一种TrueType字体，使用黑体作为其字体风格。中易黑体是随着简体中文版Microsoft Windows和Microsoft Office一起分发的字体，文件名SimHei.ttf，当前版本为5.03。\\n由于Windows操作系统的高使用度，中易黑体通常也被熟知和直呼为“黑体”，该词实为其字体风格的总称。\\n此字形同中易宋体的字形设计被指太琐碎，西文部分采用等宽字体，使得美感颇为降低。\\n在涵盖的字库上，此字体在私人造字区中加入了已被Unicode催促放入正确区域的字符，目前共有22021个字符。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Promilhanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/B%C3%A2timent_agricole_avec_deux_caselles.jpg","page_title":"Promilhanes","context_page_description":"Promilhanes sī ūi-tī Hoat-kok Midi-Pyrénées toā-khu Lot séng ê chi̍t ê commune."},{"page_url":"https://es.wikipedia.org/wiki/Dubailand","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Dubailand2006.jpg","page_title":"Dubailand","context_page_description":"Dubailand o Dubai Land es un complejo de entretenimiento actualmente en construcción. Se localiza en Dubái. La construcción de Dubailand se ha dividido en 4 fases. Cuando se anunció su construcción en el 2003 que era uno de los más ambiciosos desarrollos de ocio del mundo, costando $64,3 millones de dólares, pero el desarrollo se ha visto gravemente afectado por la recesión mundial y la crisis financiera de Dubai. El desarrollo fue suspendido en 2008, pero se reanudaron a mediados de 2013. Algunas de las facilidades de Dubailand, como el Autódromo de Dubái o La Aldea Global, ya están en funcionamiento. Dubailand tendrá muchas montañas rusas con las tecnologías más avanzadas."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_ve_Vy%C5%A1kov%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/M%C4%9Bstsk%C3%BD_d%C5%AFm_%28Vy%C5%A1kov%29%2C_Masarykovo_n%C3%A1m._82.jpg","page_title":"Seznam kulturních památek ve Vyškově","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Vyškov v okrese Vyškov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://sv.wikipedia.org/wiki/Jinchang","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Jinchang_mcp.png","page_title":"Jinchang","context_page_description":"Jinchang är en stad på prefekturnivå centrala Gansuprovinsen i nordvästra Kina. Den ligger omkring 310 kilometer nordväst om provinshuvudstaden Lanzhou. Staden är belägen till väst om Gula floden, på gränsen till Qinghaiprovinsen.\\nJinchang som kommun har ett totalt antal invånare på 464.050, varav ca. hälften bor i själva staden."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%AF%E5%8F%B0%E6%99%AE%E6%96%AF%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/StaplesCenterE32004.jpg","page_title":"斯台普斯中心","context_page_description":"斯台普斯中心是位于美国加利福尼亚州洛杉矶市中心的一座多功能体育馆。毗邻L.A. Live开发区，坐落于菲格罗亚街上的洛杉矶会议中心建筑物群旁。1998年3月31日开始动工修建，1999年10月17日正式落成开放，是大洛杉矶地区主要的体育设施之一。\\n斯台普斯中心由洛杉矶体育馆公司与安舒茨娱乐集团营运。这座体育馆目前是美国国家篮球协会洛杉矶湖人与洛杉矶快船、国家冰球联盟洛杉矶国王，以及国家女子篮球联盟洛杉矶火花的主场。而室内美式足球联盟的洛杉矶复仇者及NBA发展联盟的洛杉矶防御者在特许权被终止前，也曾以此为主场；防御者在2011－2012年球季转往至湖人位于加利福尼亚州埃尔塞贡多丰田体育中心的训练场馆。斯台普斯中心也在每年举办超过250场的活动，拥有近400万人次的游客。它是NBA唯一被两支队伍同时共用的球馆，也是北美洲唯一一座同时有两支NBA、一支NHL及一支WNBA球队作为主场的球馆。"},{"page_url":"https://pl.wikipedia.org/wiki/Lista_najwy%C5%BCszych_budynk%C3%B3w_w_Madrycie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Madrid_-_Ciudad_BBVA%2C_Edificio_%27La_Vela%27_03.jpg","page_title":"Lista najwyższych budynków w Madrycie","context_page_description":"Madryt jest największym miastem Hiszpanii, a także miejscem, w którym stoją 4 spośród 20 najwyższych wieżowców w Europie.\\nOgólnie w całym mieście ponad 150 metrów wysokości ma obecnie 5 budynków, ponad 100 metrów wyrasta około 14 budowli.\\nWiększość wieżowców znajduje się w dzielnicach biznesowych AZCA i CTBA."},{"page_url":"https://de.wikipedia.org/wiki/Atlantik_(Schiffstyp)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bundesarchiv_Bild_183-F0518-0007-001%2C_Stralsund%2C_Volkswerft_Stralsund%2C_Ausr%C3%BCstungskai%2C_%22Atlantik%22.jpg","page_title":"Atlantik (Schiffstyp)","context_page_description":"Die Fang- und Gefriertrawler vom Typ Atlantik waren eine von der Volkswerft in Stralsund entwickelte Bauserie von Trawlern mit Anlagen zur Verarbeitung des Fangs."},{"page_url":"https://ca.wikipedia.org/wiki/James_Tarkowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/James_Tarkowski_%28Oct_2017%29.jpg","page_title":"James Tarkowski","context_page_description":"James Alan Tarkowski és un futbolista professional anglés que juga de defensa central per el Burnley i per l'equip nacional anglés."},{"page_url":"https://uk.wikipedia.org/wiki/Adidas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Naftali_Temu_Mexico_City_1968.jpg","page_title":"Adidas","context_page_description":"Адідас — німецька компанія, один зі світових лідерів виробництва спортивних товарів. Заснована в 1924 році братами Дасслерами як «Dassler».\\nСучасна назва з'явилася 1948 року, після того, як брати Дасслер розірвали відносини і утворили власні компанії. Adidas походить від перших трьох літер прізвиська молодшого брата Адольфа «Adi» і трьох перших літер прізвища засновника фірми Адольфа Дасслера. Старший брат Рудольф Дасслер за таким самим принципом назвав свою фірму Руда, а потім переіменував її в Puma.\\nВираз «All Day I Dream About Sport», який колись вважався справжнім походженням назви, з'явився пізніше."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BA%A6%E8%B4%A4%E5%BE%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/1966-04_1966%E5%B9%B4%E8%B4%BA%E9%BE%99%E5%8F%B6%E5%89%91%E8%8B%B1%E7%9C%8B%E6%9C%9B%E9%BA%A6%E8%B4%A4%E5%BE%97.jpg","page_title":"麦贤得","context_page_description":"麦贤得广东省饶平县人，中国人民解放军海军战斗英雄。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D0%B4%D0%B7%D0%B5%D0%BD%D1%81%D0%BA%D1%96_%D0%B4%D0%B7%D1%8F%D1%80%D0%B6%D0%B0%D1%9E%D0%BD%D1%8B_%D0%B3%D1%96%D1%81%D1%82%D0%BE%D1%80%D1%8B%D0%BA%D0%B0-%D0%B0%D1%80%D1%85%D0%B5%D0%B0%D0%BB%D0%B0%D0%B3%D1%96%D1%87%D0%BD%D1%8B_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%9D%D0%BE%D0%B2%D1%8B_%D0%B7%D0%B0%D0%BC%D0%B0%D0%BA._%D0%9C%D1%83%D0%B7%D1%8D%D0%B9..JPG","page_title":"Гродзенскі дзяржаўны гісторыка-археалагічны музей","context_page_description":"Гродзенскі дзяржаўны гісторыка-археалагічны музей — адзін з самых старэйшых і самых вялікіх музеяў у Гродзенскай вобласці."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%81%D0%BF%D0%B8_(%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D0%B2%D0%B0%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Map_of_Espy%2C_Columbia_County%2C_Pennsylvania_Highlighted.png","page_title":"Еспи (Пенсилванија)","context_page_description":"Еспи насељено је место без административног статуса у америчкој савезној држави Пенсилванија."},{"page_url":"https://cs.wikipedia.org/wiki/Agluon%C4%97nai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Agluon%C4%97naiDv%C5%AFr.jpg","page_title":"Agluonėnai","context_page_description":"Agluonėnai je ves v západní části Litvy, v Klajpedském kraji, 6 km na severovýchod od Priekulė."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%82%D9%84%D9%8A%D9%85_%D8%A8%D9%88%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Photo_-_Floating_Islands_%28Puno%2C_Peru%29.JPG","page_title":"إقليم بونو","context_page_description":"بونو هو إقليم يقع جنوب شرق بيرو، تحده بوليفيا من الشرق و إقليم مادري دي ديوس من الشمال و إقليم قوسقو و إقليم أريكويبا من الغرب وإقليم موكويغا من الجنوب الغربي و إقليم تاكنا من الجنوب، عاصمة هي مدينة بونو الواقعة على ضفاف بحيرة تيتيكاكا في المنطقة الجغرافية المعروفة بالألتيبلانو أو سييرا العليا.\\nكانت بونو مستعمرة للتياهواناكوس في الفترة من، وقد كانوا أكثر شعوب آيمارا تحضّراً التي تمركزت في مناطق بيرو وبوليفيا اليوم. استولى الإنكا على هذه المناطق في القرن الخامس عشر، ثم احتلها الإسبان منجذبين للمناجم وصناعة التعدين المتقدمة هناك، وتركوا إرثاً استعمارياُ في أنحاء المنطقة بأكملها."},{"page_url":"https://fr.wikipedia.org/wiki/Administration_de_la_dynastie_Ming","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ming_coinage_14th_17th_century.jpg","page_title":"Administration de la dynastie Ming","context_page_description":"L'administration de la dynastie Ming combina l'héritage des institutions de la dynastie mongole des Yuan qu'elle avait remplacé et celui des institutions des dynasties antérieures d'origine chinoise, en premier lieu les Song. Les fortes tendances autoritaires du fondateur de la dynastie, Hongwu, se traduisirent cependant par le rabaissement des bureaux centraux traditionnels. Et comme pour d'autres dynasties, la montée sur le trône d'empereurs à la personnalité plus effacée, au rôle avant tout symbolique, favorisa avec le temps la montée en puissance des eunuques dont certains eurent entre leurs mains les destinées de l'empire pendant quelques années, engendrant des conflits avec l'élite lettrée de l'empire, qui entendait fournir les principaux ministres devant diriger l’État."},{"page_url":"https://es.wikipedia.org/wiki/Turdus_eremita","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Tristan_Thrush_on_Nightingale_island.jpg","page_title":"Turdus eremita","context_page_description":"El zorzal de Tristán da Cunha ​ es una especie de ave paseriforme de la familia Turdidae endémica del archipiélago de Tristán de Acuña, al sur del océano Atlántico.​"},{"page_url":"https://en.wikipedia.org/wiki/Aymar_Embury_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/JAMES_BOYD_HOUSE%2C_SOUTHERN_PINES%2C_MOORE_COUNTY.jpg","page_title":"Aymar Embury II","context_page_description":"Aymar Embury II was an American architect. He is best known for commissions from the City of New York from the 1930s through to the 1950s. In this period, Embury frequently worked with Robert Moses in the latter's various city and state capacities, especially, early on, in Moses’ capacity as New York City Parks Commissioner. Many surviving examples of Embury's work are zoos, swimming pools, playgrounds, and other recreational structures in New York City parks."},{"page_url":"https://de.wikipedia.org/wiki/Ocean%E2%80%99s_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Helena_Bonham_Carter_%28Berlin_Film_Festival_2011%29_3_cropped_%28cropped%29.jpg","page_title":"Ocean’s 8","context_page_description":"Ocean’s 8 ist eine US-amerikanische Heist-Filmkomödie. Der Film ist ein Ableger mit weiblicher Besetzung und die Fortsetzung der Filme Ocean’s Eleven, Ocean’s 12 und Ocean’s 13. Gary Ross hat die Regie übernommen und zusammen mit Olivia Milch das Drehbuch geschrieben. Der Film wurde am 8. Juni 2018 von Warner Bros. in den USA veröffentlicht. Der deutsche Kinostart war am 21. Juni 2018."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%86%E0%B2%97%E0%B3%8D%E0%B2%B0%E0%B2%BE%E0%B2%B0%E0%B3%8D_%E0%B2%9A%E0%B2%B0%E0%B3%8D%E0%B2%9A%E0%B3%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Frescos_and_Paintings_on_the_sanctuary_of_the_church_painted_by_Bro._Antonio_Moscheni_in_the_year_1902.png","page_title":"ಆಗ್ರಾರ್ ಚರ್ಚ್","context_page_description":"ಪವಿತ್ರ ಸಂರಕ್ಷಕ ಚರ್ಚು ಎಂಬುದು ಅಗ್ರಾರ್ ಚರ್ಚು ರೋಮನ್ ಕಥೋಲಿಕ ಚರ್ಚು ಎಂಬ ಹೆಸರಿನಲ್ಲಿ ಪ್ರಚಲಿತದಲ್ಲಿದ್ದು, ಐತಿಹಾಸಿಕ ಪ್ರದೇಶವಾದ ಬಂಟ್ವಾಳ ದಲ್ಲಿದೆ. ಇದರ ಚರ್ಚ್ ನಿರ್ಮಾಣ ೧೭೦೨ರಲ್ಲಿ ಆಗಿದ್ದು, ಇದಕ್ಕೂ ಮೊದಲೇ ಇಲ್ಲಿ ಚರ್ಚ್ ನಿರ್ಮಾಣವಾಗಿತ್ತು ಎಂದು ನಂಬಿಕೆ ಇದೆ. ಇದು ದಕ್ಷಿಣ ಕನ್ನಡದಲ್ಲಿರುವ ಅತ್ಯಂತ ಹಳೇಯ ಚರ್ಚುಗಳಲ್ಲಿ ಒಂದಾಗಿದೆ. ಈ ಚರ್ಚು ಮಂಗಳೂರು ರೋಮನ್ ಕಥೋಲಿಕ ಧರ್ಮಪ್ರಾಂತ್ಯದ ಅಧಿನಕ್ಕೊಳಪಟ್ಟಿದೆ. ಪ್ರಸ್ತುತ ವಂ. ಬೆಂಜಮಿನ್ ಪಿಂಟೊ ಅವರು ಚರ್ಚ್ ಧರ್ಮಗುರುಗಳಾಗಿ ಸೇವೆ ಸಲ್ಲಿಸುತ್ತಿದ್ದಾರೆ."},{"page_url":"https://da.wikipedia.org/wiki/Karl_4._af_Spanien","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Carlos_IV_de_rojo.jpg","page_title":"Karl 4. af Spanien","context_page_description":"Karl 4. var konge af Spanien fra 1788 til 1808."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Aubin-sur-Mer_(Calvados)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Map_commune_FR_insee_code_14562.png","page_title":"Saint-Aubin-sur-Mer (Calvados)","context_page_description":"Saint-Aubin-sur-Mer je francúzska obec, ktorá sa nachádza v departemente Calvados, v regióne Dolná Normandia."},{"page_url":"https://sco.wikipedia.org/wiki/Airn_Age","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Dun_Carloway.jpg","page_title":"Airn Age","context_page_description":"In airchaeology, the Airn Age wis the stage in the oncome o ony fowk that's tuils an wappens main ingredient wis airn wis foremaist. The adoption o this material coincided wi ither chynges in some past societies aften includin differin aigricultural pratticks, religious beliefs an airtistic styles, awtho this wisna aye the case.\\nThe Airn Age is the last principal period in the three-age seestem for tae clessifee pre-historic societies, comin afore the Bronze Age an efter the Stane Age. Its date an context varies dependin on the kintra or geographical region."},{"page_url":"https://nn.wikipedia.org/wiki/Marseillaisen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Pils_-_Rouget_de_Lisle_chantant_la_Marseillaise.jpg","page_title":"Marseillaisen","context_page_description":"Marseillaisen er nasjonalsongen til Frankrike. Han blei erklært som nasjonalsong den 14. juli 1795.\\nSongen blei dikta og komponert i Strasbourg natta mellom 24. og 25. april 1792 av den franske ingeniøren og offiseren Claude Joseph Rouget de Lisle som ein reaksjon på den austerrikske krigserklæringa mot Frankrike. Teksten er sterkt inspirert av fleire andre kjelder: Samtidige plakatar med slagord, salmar og tidlegare kampsongar.\\nMarseillaisen var opphavleg meint som ein kampsong for dei franske soldatane som marsjerte mot prøyssar-hæren som stod ved Rhinen. Songen blei raskt arrangert for militærorkester og spelt nokre dagar seinare ved eit festleg høve. Han fekk gjennombrotet sitt ved ein bankett i Marseille i juni same året, blei trykt og spreidde seg deretter over heile Frankrike. Han fekk namnet sitt då republikanske soldatar frå Marseille song han under innmarsjen i Paris den 30. juli 1792."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%A7%D8%B3_%D8%A8%D9%8A%D8%B1%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Wallace_Beery-publicity.JPG","page_title":"والاس بيري","context_page_description":"والاس بيري ‏ هو ممثل أمريكي بدأ مسيرته الفنية عام 1913. كما أنه فاز بجائزة الأوسكار لأفضل ممثل عن دوره في فيلم البطل."},{"page_url":"https://nl.wikipedia.org/wiki/Roeslan_Malinovski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%D0%A0%D1%83%D1%81%D0%BB%D0%B0%D0%BD_%D0%9C%D0%B0%D0%BB%D1%96%D0%BD%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9.jpg","page_title":"Roeslan Malinovski","context_page_description":"Roeslan Volodimirovitsj Malinovski is een Oekraïens voetballer die doorgaans als middenvelder speelt. Hij verruilde KRC Genk in juli 2019 voor Atalanta Bergamo. Malinovski debuteerde in 2015 in het Oekraïens voetbalelftal."},{"page_url":"https://et.wikipedia.org/wiki/Vars","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Dentaria_bulbifera_a2.jpg","page_title":"Vars","context_page_description":"Vars on taime harunemisvõimeline peamiselt maapealne organ, mis ühendab lehti, õisi ja vilju juurega. Varte hulka kuuluvad ka risoomid."},{"page_url":"https://nl.wikipedia.org/wiki/Novochochlovskaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/MCC_20NOVO_6886_PLAT.jpg","page_title":"Novochochlovskaja","context_page_description":"Novochochlovskaja is een station aan de kleine ringspoorlijn in de Russische hoofdstad Moskou. Het station ligt op het punt waar de kleine ringspoorlijn de spoorlijn van Station Moskva Koerskaja naar Koersk kruist. Het station is niet een van de oorspronkelijke stations van de kleine ringspoorlijn, maar gebouwd in het kader van de heropening van de kleine ringspoorlijn voor personenvervoer. De kleine ringspoorlijn is als Moskouse centrale ringlijn onder lijnnummer 14 op 10 september 2016 geopend. Voor het stadsgewestelijk net van Moskou is ook aan de spoorlijn naar Koersk een perron gebouwd. Sinds 6 september 2018 kunnen forensen overstappen tussen voorstadstrein en lijn 14. Sinds de opening van het stadsgewestelijk net eind 2019 wordt dat perron bediend door lijn D2."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%84_%D9%85%D9%88%D9%84%D8%B1_(%D8%A8%D8%A7%D8%B2%DB%8C%DA%AF%D8%B1)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Paul_Muller_1953.jpg","page_title":"پل مولر (بازیگر)","context_page_description":"پل مولر هنرپیشه اهل سوئیس است.\\nاز فیلم‌هایی که وی در آن نقش داشته است، می‌توان به سفر به ایتالیا، انتقام دزدان دریایی، زندان زنان، باکره‌ای میان مردگان زنده، او با شور و هیجان کشت و باراباس اشاره کرد."},{"page_url":"https://la.wikipedia.org/wiki/Conradus_I_(rex_Hierosolymitanus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Conrad-Picot.jpg","page_title":"Conradus I (rex Hierosolymitanus)","context_page_description":"Conradus fuit nobilis Italianus, filius Guillelmi V marchionis Montisferrati. Conradus anno 1187 pro imperatore Isaacio II Alexium Branam debellavit; in matrimonium duxit eodem anno Theodoram Angelinam, imperatoris sororem, tituloque \\"Caesar\\" dignatus est, sed mox uxorem abiecit et ad Tyrum properavit. Ibi die 24 Novembris 1190 Isabellam, filiam regis Amalrici, uxorem duxit et ex ea filiam genuit Mariam. Anno 1191, patre mortuo, Conradus marchio Montisferrati factus est; anno 1192, nuper rex Hierosolymitanus electus, statim ab Assassinis necatus est."},{"page_url":"https://vi.wikipedia.org/wiki/V%C3%B9ng_%C4%90%C3%B4ng_B%E1%BA%AFc_(Vi%E1%BB%87t_Nam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/C%E1%BB%95ng_tr%C6%B0%E1%BB%9Dng_trung_h%E1%BB%8Dc_ph%E1%BB%95_th%C3%B4ng_Chuy%C3%AAn_H%C3%B9ng_V%C6%B0%C6%A1ng.jpg","page_title":"Vùng Đông Bắc (Việt Nam)","context_page_description":"Đông Bắc bộ là vùng lãnh thổ ở phía đông bắc miền Bắc Việt Nam và ở hướng bắc vùng đồng bằng sông Hồng, Việt Nam. Gọi là đông bắc để phân biệt với vùng tây bắc, còn thực chất nó ở vào phía bắc và đông bắc của Hà Nội, rộng hơn vùng Việt Bắc. Vùng đông bắc là một trong 3 tiểu vùng địa lý tự nhiên của Bắc Bộ Việt Nam."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_590","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/NGC_0590_SDSS.jpg","page_title":"NGC 590","context_page_description":"NGC 590 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة المرأة المسلسلة. اكتشفت في 22 سبتمبر 1865 بواسطة هاينريش لويس دريست."},{"page_url":"https://es.wikipedia.org/wiki/L%C3%ADnea_de_alta_velocidad_N%C3%BAremberg-Ingolstadt-M%C3%BAnich","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/SFS_Nuernberg-Muenchen.png","page_title":"Línea de alta velocidad Núremberg-Ingolstadt-Múnich","context_page_description":"La línea de alta velocidad Núremberg - Ingolstadt - Múnich es una línea ferroviaria de 171 km de longitud en Alemania que conecta las ciudades de Colonia y de Fráncfort del Meno. Su trayectoria sigue la autopista Bundesautobahn 9 en su mayor parte. Las pendientes máximas de hasta 4% requieren trenes con un alto cociente de energía-peso, lo que solo consiguen actualmente los trenes de InterCityExpress."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%BD%D0%B8%D1%85_%D0%BC%D1%96%D1%81%D1%96%D0%B9_%D0%B2_%D0%9B%D0%B8%D1%82%D0%B2%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Greek_embassy_in_Vilnius.JPG","page_title":"Список дипломатичних місій в Литві","context_page_description":"Нижче представлено список дипломатичних місій в Литві. Наразі в столиці Литви Вільнюсі діють 35 посольств та 1 відділ посольства. Багато інших держав мають акредитованих послів в столицях інших держав, в основному у Варшаві. Окрім того, багато держав які не мають посольства у Вільнюсі, мають там консульство. Консульства також є в Клайпеді, Каунасі та декількох інших містах."},{"page_url":"https://en.wikipedia.org/wiki/Vasco_Chennai_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Vasco_Chennai_Express_-_AC_3_tier_coach.jpg","page_title":"Vasco Chennai Express","context_page_description":"The Vasco da Gama Chennai Express is an express train belonging to Indian Railways that runs between Vasco da Gama and Chennai Central in India.\\nIt operates as train number 17312 from Vasco da Gama to Chennai Central and as train number 17311 in the reverse direction."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CF%81%CE%AC%CF%83%CE%B9%CE%BC%CE%BF_(%CE%BC%CE%B1%CE%B3%CE%B5%CE%B9%CF%81%CE%B9%CE%BA%CE%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Flickr_-_cyclonebill_-_Pasta_%281%29.jpg","page_title":"Βράσιμο (μαγειρική)","context_page_description":"Το Βράσιμο είναι τρόπος μαγειρέματος των τροφίμων σε κατσαρόλα με νερό που βράζει.\\nΗ θερμοκρασία βρασμού του νερού είναι 100 °C, στο υψομετρικό επίπεδο της θάλασσας..\\nΗ προσθήκη υδατοδιαλυτών ουσιών, όπως το αλάτι ή η ζάχαρη, στο νερό ανεβάζουν την θερμοκρασία βρασμού. Για μικρές ποσότητες η επίδραση είναι αμελητέα, και γίνεται αισθητή στην παρασκευή σιροπιού ζάχαρης.\\nΣτα φαγητά που βράζονται περιλαμβάνονται τα λαχανικά, τα αμυλούχα τρόφιμα όπως ρύζι, ζυμαρικά και πατάτες, αυγά, κρέατα, σάλτσες, ζωμοί, και σούπες. Τα μεγαλύτερα, σκληρότερα, φθηνότερα κομμάτια κρέατος και πουλερικών γίνονται πιο εύπεπτα με βράσιμο. Και προκύπτει θρεπτικός, αρωματικός ζωμός.\\nΩστόσο, υπάρχει απώλεια των υδατοδιαλυτών βιταμινών και θρεπτικών συστατικών που διαφεύγουν από τις τροφές προς το νερό του βρασίματος, το οποίο τελικά απορρίπτεται."},{"page_url":"https://en.wikipedia.org/wiki/Danny_Sullivan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/1994Brickyard400DannySullivan.jpg","page_title":"Danny Sullivan","context_page_description":"Daniel John Sullivan III, better known as Danny Sullivan, is an American former racing driver. He earned 17 wins in the CART Indy Car World Series, including the 1985 Indianapolis 500. Sullivan won the 1988 CART Championship, and placed third in points in 1986. Sullivan also scored a victory in IROC."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%B5%D5%AC%D5%AB_%D5%BF%D6%80%D5%A1%D5%B6%D5%BD%D5%AF%D6%80%D5%AB%D5%BA%D6%81%D5%AB%D5%B8%D5%B6_%D5%B0%D5%A1%D5%B4%D5%A1%D5%AF%D5%A1%D6%80%D5%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%E0%BD%A2.PNG","page_title":"Վայլի տրանսկրիպցիոն համակարգ","context_page_description":"Վայլի տրանսկրիպցիոն համակարգ, ճիշտ է նաև Ուայլի անգլ.՝ Wylie, տիբեթյան այբուբենի տրանսկրիպցիոն համակարգ՝ լատինական այբուբենի սիմվոլների կիրառմամբ:\\nՇատ նման է ժամանակակից չինական պինյին ստանդարտ համակարգին, որն օգտագործվում է համակարգչի ստեղնաշարից օգտվելու համար: Չինական պինյին ստանդարտի հիման վրա ստեղծվել է Տիբեթյան պինյին ստանդարտը: Համակարգի անունը կապված է Վաշինգտոնի համալսարանի պրոֆեսոր, տիբեթագետ Տարել Վայլիի անվան հետ, ով 1959 թվականին կարողացել է համակարգը բերել ամբողջական տեսքի և ստանդարտացրել:\\nԴրանից հետո ԱՄՆ-ում այն օգտագործվում է որպես տիբեթերեն լեզվի ուսումնասիրման ստանդարտ: Վայլիի կոդը կազմված է հնչյունի համաձայն կարդացվող սիմվոլներից: Բացառություն է կազմում միայն Gya համակցությունը.\\nGya-tibet.PNG, արտասանվում է գյա\\nG.ya-tibet.PNG, արտասանվում է յա"},{"page_url":"https://eo.wikipedia.org/wiki/Fran%C3%A7ois_Sulpice_Beudant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Cobaltite-mun05-71a.jpg","page_title":"François Sulpice Beudant","context_page_description":"François Sulpice BEUDANT estis franca mineralogo kaj geologo, kiu priskribis plurajn mineralojn, profesoro pri matematiko en la Liceo de Avinjono, profesoro pri fiziko en la Liceo de Marsejlo, kaj aŭtoro de sennombraj verkoj pri mineralogio. La mineralo \\"beŭdantito\\" ricevis tian nomon liaomaĝe.\\nLa nomo de la mineralo nomita dekomence aluminilito fare de Jean-Claude Delamétherie en 1797, estis mallongigita fare de François Beudant en 1824 al alunito.\\nOkaze de la morto de René Just Haüy, li fariĝis profesoro pri mineralogio kaj geologio en la Fakultato de Sciencoj de Parizo."},{"page_url":"https://eu.wikipedia.org/wiki/NFLren_Ospearen_Aretoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Hall_Fame_Air.JPG","page_title":"NFLren Ospearen Aretoa","context_page_description":"NFLren Ospearen Aretoak bere ateak 1963ko irailak 7an ireki zituen, Ohioko Canton herrian, AEBetan, 17 jokalari sartu zituztelarik. 2007 arte, Ospearen Aretoan sartu diren jokalari guztiek, euren kirol karrera osoa edo zati bat behintzat, NFLan eman zuten, bere karrera osoa, antzinako Amerikar Futboleko Estatubatuar Ligan eman zuena, 1970ean egungo NFLa sortua izan aurretik, AFL eta NFLa elkartu ondoren. Ospearen Aretoan jokalari gehien dituen taldea, Chicago Bears taldea da, 26 jokalarirekin.\\nCanton, areto honentzako egoitza bezala, honako hiru arrazoi hauengatik aukeratua izan zen: Lehenik eta behin, NFLa, aurretik Amerikar Futbolaren Elkarte Profesionala deitua, Canton herrian sortu zen, 1920an. Bigarrenik, jada existitzen ez den Canton Bulldogs taldea, ligaren lehen urteetan arrakasta handia izan zuen taldea izan zen. Eta hirugarren eta azken arrazoia, Cantongo elkarteak, arrakasta handiz, NFLa, honen ospearen aretoa herrian bertan eraikia izateko konbentzitu zuela da."},{"page_url":"https://vi.wikipedia.org/wiki/Andrena_nida","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Andrena_nida%2C_F%2C_side%2C_Upper_Marlboro%2C_md_2014-04-21-18.00.26_ZS_PMax_%2814026815515%29.jpg","page_title":"Andrena nida","context_page_description":"Andrena nida là một loài Hymenoptera trong họ Andrenidae. Loài này được Mitchell mô tả khoa học năm 1960."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%9E%D7%98%D7%A0%D7%99_%D7%96%D7%9B%D7%95%D7%9B%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Diploglossus_lessonae_2.jpg","page_title":"קמטני זכוכית","context_page_description":"קמטני זכוכית, היא משפחה של לטאות מסדרת הקשקשאים. משפחה זו קרובה למיני הקמטניים ובעבר נחשבה לתת-משפחה שלהם.\\nמינים אלה חיים במקסיקו, מרכז אמריקה, קולומביה ועד לחוף האטלנטי וריו דה לה פלטה. הם בעלי גוף קטן באורך 6-28 ס\\"מ. הם בעלי רגליים קטנות ולסתות קטנות עם שיניים מאחורי הלסת. הזנב ארוך ומעניק להם שיווי משקל.\\nרוב המינים חיים ביערות ואחרים חיים בסוואנה או באזורים מדבריים. הם פעילים בעיקר בלילה וחיים על הקרקע. הם ניזונים מחסרי חוליות קטנים.\\nמספר מינים במשפחה מתרבים באמצעות השרצה."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Polish_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Andrzej_Golota_2014.jpg","page_title":"List of Polish people","context_page_description":"This is a partial list of notable Polish or Polish-speaking or -writing people. People of partial Polish heritage have their respective ancestries credited."},{"page_url":"https://en.wikipedia.org/wiki/Chandler_%26_Price","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Cp1015.jpg","page_title":"Chandler & Price","context_page_description":"Chandler & Price was founded in 1881 in Cleveland, Ohio, by Harrison T. Chandler and William H. Price. They manufactured machinery for printers including a series of hand-fed platen jobbing presses, as well as an automatic feeder for these presses, paper cutters, book presses, and assorted equipment. Despite dominating the industry in the 1930s, by the 1950s the offset printing industry had eclipsed the world of movable type printing, and only Chandler & Price and Brandtjen and Kluge continued to make open platen presses. Chandler & Price ceased production of presses in 1964.\\nThere are three main generations of the Chandler & Price press, all distinguished by the style of the flywheel: Old Style, New Style, or Craftsman. The New Style made by Chandler & Price was such a popular press that The Practice Of Printing: Letterpress and Offset by Ralph Polk, the standard textbook for thousands of high school printing programs in the middle of the 20th century, used the press as its example when teaching students the basics of press operation."},{"page_url":"https://nl.wikipedia.org/wiki/US_Open_1986_(tennis,_vrouwen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Martina_Navratilova_%287490736068%29.jpg","page_title":"US Open 1986 (tennis, vrouwen)","context_page_description":"Het tennistoernooi US Open werd in 1986 bij de vrouwen voor de 100e keer gehouden. De als eerste geplaatste Amerikaanse Martina Navrátilová won het toernooi voor de derde keer door in de finale de Tsjecho-Slowaakse Helena Suková met 6-3 en 6-2 te verslaan."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A3%D5%B8%D6%80%D5%B8%D5%B6%D5%A3%D5%B8%D6%80%D5%B8_(%D5%AD%D5%A1%D5%BC%D5%B6%D5%A1%D6%80%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ngorongoro_Crater.jpg","page_title":"Նգորոնգորո (խառնարան)","context_page_description":"Նգորոնգորո, հրաբխային խառնարան, որը գտնվում է հյուսիսային Տանզանիայի գեղատեսիլ վայրում: Այն աշխարհի ամենամեծ, ամբողջական տեսքով պահպանված հրաբխային խառնարանն է: Տեղանքում հանգրվանում են ավելի քան 25000 կենդանիներ՝ ներառյալ զեբրեր, գնուներ, սև ռնգեղջյուրներ, առյուծներ և փղեր, որոնք խառնարանը դարձնում են նմանը չունեցող որսատեղի:"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D8%AC%D9%8A%D8%B1_%D9%84%D8%A7%D9%86%D8%AC%D8%B1%D9%8A%D8%AF%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Roger_Langridge_auf_der_COMICIADE_2014_in_Aachen.jpg","page_title":"روجير لانجريدج","context_page_description":"روجير لانجريدج فنان من نيوزيلاندا."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_4848","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/NGC4848_-_SDSS_DR14.jpg","page_title":"NGC 4848","context_page_description":"NGC 4848 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%99%D7%91%D7%AA_%D7%94%D7%99%D7%9C%D7%95%D7%9B%D7%99%D7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Pivgetriebe.png","page_title":"תיבת הילוכים","context_page_description":"תיבת הילוכים היא מערכת תמסורת מכנית המתאמת בין \\"התקן מניע\\" לבין \\"התקן מונע\\" כלשהו ומאפשרת לשנות את היחס בין מהירויותיהם ובין עוצמת המומנט שהם מפעילים זה על זה, בניגוד לתמסורת קבועה. מהירות הסיבוב עומדת ביחס הפוך למומנט המופעל, ולכן שילוב תיבת ההילוכים להילוך נמוך מגביר את מומנט ההתקן המניע, ומאפשר לו להתגבר ביתר קלות על ההתנגדות שההתקן המונע מפעיל נגדו.\\nתיבות ההילוכים נפוצות בכלי תחבורה: ניתן להבחין בהשפעת המעבר בין ההילוכים השונים בעת האצת הרכב, על ידי התבוננות במחוג מד סיבובי המנוע העולה ויורד לסירוגין, בעוד המהירות הנמדדת על ידי מד המהירות עולה בהדרגתיות. דבר זה נובע משינוי יחס הגדלים של גלגלי השיניים המשולבים בתיבת ההילוכים, המאפשר למנוע להניע את כלי הרכב במהירות רצויה, תוך הורדת סיבובי המנוע לרמה נמוכה יותר ככל שפוחתת ההתנגדות שמפעיל נגדו כלי הרכב.\\nסוגי תיבות הילוכים:\\nתיבת הילוכים ידנית, שבה החלפת הילוך נעשית על ידי הנהג באמצעות מוט ההילוכים ודוושת המצמד.\\nתיבת הילוכים רובוטית, שבה, החלפת ההילוך נעשית על ידי המכונית, אך היא בנויה כמו תיבה ידנית לכל דבר.\\nתיבת הילוכים חצי־אוטומטית, בה החלפת הילוך נעשית על ידי הנהג אך הפעלת המצמד נעשית על ידי הרכב.\\nתיבת הילוכים אוטומטית, היא תיבה הכוללת מנגנון המאפשר לרכב להחליף הילוך באופן עצמאי, ללא צורך בהתערבות מצד הנהג."},{"page_url":"https://en.wikipedia.org/wiki/Neopleurotomoides_rufoapicata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Neopleurotomoides_rufoapicata_001.jpg","page_title":"Neopleurotomoides rufoapicata","context_page_description":"Neopleurotomoides rufoapicata is a species of sea snail, a marine gastropod mollusk in the family Raphitomidae."},{"page_url":"https://id.wikipedia.org/wiki/Dinkelscherben","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Dinkelscherben.png","page_title":"Dinkelscherben","context_page_description":"Dinkelscherben adalah kota yang terletak di distrik Augsburg di Bayern, Jerman.\\nKota Dinkelscherben memiliki luas sebesar 67.70 km².\\nDinkelscherben pada tahun 2006, memiliki penduduk sebanyak 6.618 jiwa."},{"page_url":"https://es.wikipedia.org/wiki/Petaca","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Piersi%C3%B3wka_ubt.jpeg","page_title":"Petaca","context_page_description":"Petaca es un recipiente extraplano para bebidas destiladas, cuyo tamaño y forma se adaptan a un bolsillo del pantalón.​ La Real Academia Española asienta otros significados que pueden dar orientación sobre el origen del término y sus usos diversos. Así, por ejemplo, la petaca como \\"arca\\" o maleta de cuero, madera o mimbre\\", el \\"estuche de cuero o metal\\" para contener tabaco, o el maletín, significado muy arraigado en México y otras zonas de Hispanoamérica.​"},{"page_url":"https://en.wikipedia.org/wiki/Northern_Mannerism","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Bartholom%C3%A4us_Spranger_007.jpg","page_title":"Northern Mannerism","context_page_description":"Northern Mannerism is the form of Mannerism found in the visual arts north of the Alps in the 16th and early 17th centuries. Styles largely derived from Italian Mannerism were found in the Netherlands and elsewhere from around the mid-century, especially Mannerist ornament in architecture; this article concentrates on those times and places where Northern Mannerism generated its most original and distinctive work.\\nThe three main centres of the style were in France, especially in the period 1530–1550, in Prague from 1576, and in the Netherlands from the 1580s—the first two phases very much led by royal patronage. In the last 15 years of the century, the style, by then becoming outdated in Italy, was widespread across northern Europe, spread in large part through prints. In painting, it tended to recede rapidly in the new century, under the new influence of Caravaggio and the early Baroque, but in architecture and the decorative arts, its influence was more sustained."},{"page_url":"https://bar.wikipedia.org/wiki/Metallica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Metallica_at_The_O2_Arena_London_2008.jpg","page_title":"Metallica","context_page_description":"Metallica is a US-amerikanische Metal-Band, de 1981 in Los Angeles gründet worn is. Metallica ghört seid da 1986a Joar zu de international eafoigreichstn Rockgruppn übahaupt. Im November 2016 homs as neie Oibum Hardwired... to Self-Destruct aussabrocht."},{"page_url":"https://ca.wikipedia.org/wiki/Tempo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Seiko_DM-20_20060910.jpg","page_title":"Tempo","context_page_description":"El tempo, en música, és la velocitat a la qual cal interpretar o a la que veritablement s'interpreta una composició musical. És una paraula italiana que literalment significa 'temps'. Es mesura en pulsacions per minut, abreviat actualment més sovint com a bpm. En funció del tempo, una mateixa obra musical té una durada més o menys llarga; semblantment, cada figura musical no té una durada especifica i fixa en segons, sinó que depèn del tempo."},{"page_url":"https://it.wikipedia.org/wiki/Syringammina_fragilissima","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Syringammina_Fragilissima.jpg","page_title":"Syringammina fragilissima","context_page_description":"Syringammina fragilissima Brady, 1883 è una xenophyophore trovata nelle coste scozzesi vicino Rockall."},{"page_url":"https://he.wikipedia.org/wiki/1981","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Moshe_Dayan.jpg","page_title":"1981","context_page_description":"שנת 1981 היא השנה ה-81 במאה ה-20. זוהי שנה רגילה, שאורכה 365 ימים. 1 בינואר 1981 לפי הלוח הגרגוריאני מקדים את 1 בינואר לפי הלוח היוליאני ב-13 ימים.\\nכל התאריכים שלהלן הם לפי הלוח הגרגוריאני."},{"page_url":"https://cs.wikipedia.org/wiki/Rudolf_%C5%A0v%C3%A1bsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Grabplatte_Rudolf_von_Rheinfelden_Detail.JPG","page_title":"Rudolf Švábský","context_page_description":"Rudolf z Rheinfelden byl v letech 1057–1079 vévodou švábským a v letech 1077–1080 římským protikrálem."},{"page_url":"https://an.wikipedia.org/wiki/Gave_d%27Aulor%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Oloron_gave_Oloron_001.JPG","page_title":"Gave d'Aulorón","context_page_description":"A Gave d'Aulorón, en francés gave d'Oloron, ye un río occitán, situato en o Biarn, en o sudueste de Francia.\\nO termin gave s'emplega ta clamar a un curso d'augua en a zona d'os Pireneus occidentals. Ye una palabra d'orichen precelta que se fa servir muit asobén en ista zona, habendo perdito o suyo nombre orichinal muitos ríos ta decir-se actualment a gave de....\\nO naixedero d'o río ye en o forcallo d'a Gave d'Aspa y a Gave d'Osal, drenando una compleganza d'una superficie de 2.456 km², con un cabal meyano de 102 m³/s en Escòs.\\nEn o suyo curso, d'una longaria de 143,1 km, trescruza dos departamentos franceses, Pireneus Atlanticos y Landas dica plegar a la suya desembocadura en a Gave de Pau."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D1%80%D1%80%D0%BE%D0%BA-%D1%81%D1%8E%D1%80-%D0%BB%27%D0%9E%D1%81%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Larroque-sur-Losse_-_Tour_de_Luzan_-1.JPG","page_title":"Ларрок-сюр-л'Осс","context_page_description":"Ларро́к-сюр-л'Осс — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Жер. Населення — 228 осіб.\\nМуніципалітет розташований на відстані близько 570 км на південь від Парижа, 105 км на північний захід від Тулузи, 45 км на північний захід від Оша."},{"page_url":"https://gl.wikipedia.org/wiki/Ram%C3%B3n_Mar%C3%ADa_Narv%C3%A1ez","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ramon_Maria_Narvaez.jpg","page_title":"Ramón María Narváez","context_page_description":"Ramón María Narváez y Campos, nado en Loja o 5 de agosto de 1800 e falecido en Madrid o 23 de abril de 1868, foi un político e militar español. Coñecéuselle co nome de El Espadón de Loja."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%A0o_H%E1%BB%93ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Cao_Hong_Qing_illustration.jpg","page_title":"Tào Hồng","context_page_description":"Tào Hồng, biểu tự Tử Liêm, là công thần khai quốc nước Tào Ngụy thời Tam Quốc trong lịch sử Trung Quốc."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%98%EA%B8%B0%EC%8A%A4_(%EA%B8%B0%EC%A0%80%EA%B7%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Huggies_Disposable_Diapers_at_Kroger.jpg","page_title":"하기스 (기저귀)","context_page_description":"하기스은 미국의 킴벌리-클라크가 소유하는 기저귀 브랜드이다."},{"page_url":"https://it.wikipedia.org/wiki/Marija_Aleksandrovna_Spiridonova","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/SpiridonovaShkol%27nikBicenkoIzmajlovichFialkaEzerskajaEnSiberia.jpg","page_title":"Marija Aleksandrovna Spiridonova","context_page_description":"Marija Aleksandrovna Spiridonova è stata una rivoluzionaria russa di ispirazione socialista-populista.\\nEntrata giovanissima in una squadra di combattimento del Partito dei socialisti rivoluzionari, nel 1906 ferì mortalmente, in un attentato, il responsabile della sicurezza di un distretto della provincia di Tambov, Gavriil Nikolaevič Luženovskij, il quale aveva represso nel sangue gli scioperi agrari dell'anno precedente. Arrestata, subì gravi sevizie da parte delle forze dell'ordine, divenendo una sorta di eroina agli occhi del movimento rivoluzionario, e non solo.\\nCondannata a morte con sentenza poi commutata nei lavori forzati a vita in Siberia, fu liberata nel 1917 in seguito all'amnistia decretata dopo la rivoluzione di febbraio, e divenne ben presto uno dei capi dei socialisti rivoluzionari di sinistra, l'ala scissionista del partito che si alleò brevemente con i bolscevichi dopo la realizzazione della rivoluzione d'ottobre."},{"page_url":"https://ca.wikipedia.org/wiki/Camp_magn%C3%A8tic_estel%C2%B7lar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Suaur.jpg","page_title":"Camp magnètic estel·lar","context_page_description":"Un camp magnètic estel·lar és un camp magnètic generat pel moviment del plasma conductiu dins d'una estrella de la seqüència principal, que és una forma de transport d'energia que involucra al moviment físic de material. El camp magnètic exerceix una força sobre el plasma, augmentant efectivament la pressió sense un guany comparable en la densitat. Com a resultat, la regió magnetitzada s'eleva relativament pel que fa a la resta del plasma, fins que arriba a la fotosfera de l'estrella. Això crea les taques solars i els bucles en la corona solar."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%BE_(%D0%B1%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Kamo_03.jpg","page_title":"Камо (большевик)","context_page_description":"Симо́н Арша́кович Тер-Петрося́н, известный под партийным псевдонимом Камо́ — российский профессиональный революционер, один из организаторов подпольных типографий, транспорта оружия и литературы, денежных экспроприаций. Неоднократно сбегал и организовывал побеги из мест лишения свободы. Попав в Берлин и спасая свою жизнь, искусно симулировал сумасшествие и нечувствительность к боли, чем озадачил лучших врачей Европы того времени и вызвал огромную поддержку со стороны многих социалистических газет, прозвавших его «героем революции», а также лично Карла Либкнехта. Четыре раза приговаривался к смертной казни, заменённой согласно амнистии по случаю трёхсотлетия дома Романовых двадцатилетним заключением. Освобождён Февральской революцией. В 1918—1920 годах — организатор большевистского подполья на Кавказе и юге России."},{"page_url":"https://en.wikipedia.org/wiki/Bunker_Hill_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Bunker_Hill_School_Boston_MA_04.jpg","page_title":"Bunker Hill School","context_page_description":"The Bunker Hill School is a historic school at 68 Baldwin Street in the Charlestown neighborhood of Boston, Massachusetts. Built in 1866, it is a prominent local example of Second Empire architecture, and a surviving example of the city's school planning in the post-Civil War period. Now housing residential condominiums, it was listed on the National Register of Historic Places in 1987."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%A9%E3%83%9F%E3%83%BC%E3%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Leipzig_NGT10_Innen_02.jpg","page_title":"トラミーノ","context_page_description":"トラミーノはポーランド・ポズナンの車両メーカーであるソラリスが開発した路面電車ブランド。2019年現在ポーランドやドイツの5都市の路面電車に導入されている。それまでバスの製造を行っていたソラリスが初めて製造した鉄道車両であったが、2017年4月1日に設立されたシュタッドラー・レールとの合弁会社であるソラリス・トラムを経て、2018年11月20日以降はシュタッドラーの子会社のシュタッドラー・ポルスカによって展開が行われている。"},{"page_url":"https://eu.wikipedia.org/wiki/Grisale%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Mapa_municipal_Grisale%C3%B1a.png","page_title":"Grisaleña","context_page_description":"Grisaleña Burgosko udalerria da, Burebako eskualdean dagoena.\\n2007ko urtarrilaren 1eko erroldaren arabera, herriak 44 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Lamothe-Landerron","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Lamothe-Landerron_%C3%89glise_St_Albert_01.JPG","page_title":"Lamothe-Landerron","context_page_description":"Lamothe-Landerron ist eine französische Gemeinde mit 1.204 Einwohnern im Département Gironde in der Region Nouvelle-Aquitaine. Sie gehört zum Kanton Le Réolais et Les Bastides im Arrondissement Langon. Die Einwohner werden Lamothais genannt."},{"page_url":"https://de.wikipedia.org/wiki/Aufschie%C3%9Fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Nahezu-Aufschie%C3%9Fer_%28Segeln%29.svg","page_title":"Aufschießer","context_page_description":"Ein Aufschießer ist ein Segelmanöver, bei dem ein in Fahrt befindliches Boot in den Wind gesteuert wird, um es zum Stillstand zu bringen. Dieses Manöver eignet sich daher zum Aufnehmen einer Person im Rahmen eines Mann-über-Bord-Manövers oder zum Anlegen an einem Pier. Es ist die einzige Möglichkeit, ein Segelboot rasch zu stoppen."},{"page_url":"https://en.wikipedia.org/wiki/Iraq","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Islamic_State_Militant_Activity_In_Iraq_Syria_and_Lebanon_VOA.png","page_title":"Iraq","context_page_description":"Iraq, officially the Republic of Iraq, is a country in Western Asia, bordered by Turkey to the north, Iran to the east, Kuwait to the southeast, Saudi Arabia to the south, Jordan to the southwest and Syria to the west. The capital, and largest city, is Baghdad. Iraq is home to diverse ethnic groups including Arabs, Kurds, Assyrians, Turkmen, Shabakis, Yazidis, Armenians, Mandaeans, Circassians, Sabians and Kawliya. Around 99% of the country's 38 million citizens are Muslims, with tiny minorities of Christians, Yarsans, Yezidis and Mandeans also present. The official languages of Iraq are Arabic and Kurdish.\\nIraq has a coastline measuring 58 km on the northern Persian Gulf and encompasses the Mesopotamian Alluvial Plain, the northwestern end of the Zagros mountain range and the eastern part of the Syrian Desert. Two major rivers, the Tigris and Euphrates, run south through Iraq and into the Shatt al-Arab near the Persian Gulf. These rivers provide Iraq with significant amounts of fertile land. The region between the Tigris and Euphrates rivers, historically known as Mesopotamia, is often referred to as the cradle of civilisation."},{"page_url":"https://en.wikipedia.org/wiki/Columbia,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tiger_hotel.jpg","page_title":"Columbia, Missouri","context_page_description":"Columbia is a city in the U.S. state of Missouri. It is the county seat of Boone County and home to the University of Missouri. Founded in 1821, it is the principal city of the five-county Columbia metropolitan area. It is Missouri's fourth most-populous and fastest growing city, with an estimated 123,195 residents in 2019.\\nAs a Midwestern college town, Columbia has a reputation for progressive politics, persuasive journalism, and public art. The tripartite establishment of Stephens College, the University of Missouri, and Columbia College, which surround the city's Downtown to the east, south, and north, has made the city a center of learning. At its center is 8th Street, also known as the Avenue of the Columns, which connects Francis Quadrangle and Jesse Hall to the Boone County Courthouse and the City Hall. Originally an agricultural town, the cultivation of the mind is Columbia's chief economic concern today. The city also depends on healthcare, insurance, and technology businesses, but has never been a major center of manufacturing. Companies such as Shelter Insurance, Carfax, Veterans United Home Loans, and Slackers CDs and Games, were founded in the city."},{"page_url":"https://de.wikipedia.org/wiki/Ladoga_(Schiffstyp)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/LADOGA_4_%28Ship_1973%29_Cuxhaven_2006_by-RaBoe.jpg","page_title":"Ladoga (Schiffstyp)","context_page_description":"Die Fluss-Seeschiffe der Ladoga-Serien sind fluss- und kanalgängige Küstenmotorschiffe."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B6%D5%A4%D6%80%D5%A5%D5%B5_%D4%BF%D5%B8%D5%BD%D5%BF%D6%80%D5%AB%D5%B9%D5%AF%D5%AB%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Honoured_Artist_of_RSFSR_medal.jpg","page_title":"Անդրեյ Կոստրիչկին","context_page_description":"Անդրեյ Անդրեևիչ Կոստրիչկին, խորհրդային կինոյի և թատրոնի դերասան։ ՌԽՖՍՀ վաստակավոր արտիստ ։"},{"page_url":"https://en.wikipedia.org/wiki/Botel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Bellis_Botel_at_Pickwick_Landing%2C_Hardin_County%2C_Tennessee.jpg","page_title":"Botel","context_page_description":"A botel or boatel is a boat that serves as a hotel or hostel. The word is a portmanteau of boat and hotel.\\nBotels may range from small or larger purpose-built or converted boats or other watercraft, to converted ships. They may be permanently moored or grounded, or spend part of the year taking guests on tours.\\nAlexander von Humboldt was built in the early 1900s, and after century of sailing the seas was converted to botel floating in Bremen. Another converted sailing ship is the Viking, floated in Sweden"},{"page_url":"https://en.wikipedia.org/wiki/Marguerite_S._Chang","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/IsabellaKarleJohnWarnerMargueriteChang.jpg","page_title":"Marguerite S. Chang","context_page_description":"Marguerite Shue-wen Chang was a Chinese-born American research chemist and inventor, awarded the Federal Woman's Award in 1973 for her work in the United States Naval Ordnance Laboratory, based in Maryland."},{"page_url":"https://it.wikipedia.org/wiki/The_Squaw_Man_(film_1914)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Squawman1914.jpg","page_title":"The Squaw Man (film 1914)","context_page_description":"The Squaw Man è un film muto del 1914 sceneggiato, diretto e prodotto da Cecil B. DeMille. Né Apfel né DeMille vengono indicati come registi nei titoli di testa.\\nSi tratta dell'esordio nella regia di Cecil B. DeMille che vi appare anche, non accreditato, in una piccola parte. La storia è tratta dall'omonimo lavoro teatrale del 1905 di Edwin Milton Royle e verrà ripresa dal regista per altre due volte: nel 1918 con The Squaw Man e nel 1931 con Naturich la moglie indiana."},{"page_url":"https://sl.wikipedia.org/wiki/Teratogenost","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lupinus_bicolor.jpg","page_title":"Teratogenost","context_page_description":"Teratogénost je lastnost neke snovi oziroma drugega dejavnika, da povzroča strukturne, funkcijske, presnovne in vedenjske nepravilnosti pri zarodku oziroma plodu, če je nosečnica izpostavljena takemu dejavniku. Pojem se uporablja tudi za nepravilnosti v razvoju živali in rastlin.\\nČloveški zarodki in plodi so občutljivi na delovanje teratogenih dejavnikov zlasti med 3. in 8. tednom po oploditvi.\\nV glavnem delimo teratogene dejavnike na genetske dejavnike ter dejavnike iz okolja, ki so lahko kemične snovi, virusi in ionizirajoča sevanja. Teratogeni obeh skupin lahko delujejo vsak zase ali pa v medsebojni interakciji."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%98%D7%90%D7%99%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Hetaera_by_Franciszek_%C5%BBmurko_%281%29.jpg","page_title":"הטאירה","context_page_description":"הטאירה היה המעמד הגבוה ביותר של זונות ביוון העתיקה - בדומה לקורטיזנות של אירופה בתקופת הרנסאנס או לגיישות ביפן. ההטאירי שימשו מלוות מתוחכמות שבילו עם לקוחות קבועים יותר מאשר מעניקות שירותי מין.\\nביוון העתיקה ההטאירי היו למעשה נשים חופשיות בעלות השפעה. הן נדרשו ללבוש בגדים מיוחדים ולשלם מיסים, והורשו לאגור רכוש. מרביתן היו שפחות משוחררות או נשים זרות ולא נשים יווניות חופשיות. ההטאירי היו ידועות בכישוריהן בתחום הריקוד והמוזיקה, ובניגוד לנשים היווניות היו משכילות והיו מסוגלות לדבר על פילוסופיה ותרבות - הן היו הנשים היחידות שיכלו להשתתף בסימפוזיונים ולהביע דעתן - וגברים הקשיבו להן.\\nחשיבותן של ההטאירה באה לידי ביטוי בנאומו של אפולודורוס מאכרנאי \\"נגד נאיירה\\", שבו אמר:\\n\\"יש לנו הטאירה להנאה, פאלאקאה לספק את צורכי הגוף, ונשים להוליד יורשים חוקיים ועל מנת לשמור באופן נאמן על תכולת הבית\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A9%9F%E5%8B%95%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Fuso-oogatayusou.jpg","page_title":"機動隊","context_page_description":"機動隊は、日本の警察において、集団的警備力及び機動力を有し、警備実施の中核部隊として治安警備及び災害警備等に当たる警備警察の部隊である。各警察本部の警備部に設置されており、基幹となる機動隊は約8,000人体制、これを補完する増援部隊として広域運用される管区機動隊は約4,000人体制として整備されている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%81%8A%E8%BC%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/RMS_Queen_Elizabeth_2_in_Trondheim_2008.jpg","page_title":"遊輪","context_page_description":"遊輪，又稱郵輪，是一種用於娛樂航海的客輪，航程及沿途的目的地與船上的設施，都是提供旅遊及娛樂的一部份。在航空交通已普及的時代，運輸已不是郵輪的主要用途，雖然有的航線是單程的，但是遊輪通常會將乘客送回啟航的地點。兼具交通工具與住宿、餐廳的性質。"},{"page_url":"https://en.wikipedia.org/wiki/Winter_Sports_Palace","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Studentski-Grad-Zimnia-Dvorets.jpg","page_title":"Winter Sports Palace","context_page_description":"The Winter Sports Palace is an ice hockey arena in Sofia, Bulgaria. Opened in 1982, it has a capacity of 4,600 spectators."},{"page_url":"https://eo.wikipedia.org/wiki/Vi%C5%A1%C5%88ov%C3%A9_(distrikto_%C5%BDilina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Visnove.jpg","page_title":"Višňové (distrikto Žilina)","context_page_description":"Višňové estas vilaĝo, banloko kaj municipo en Slovakio."},{"page_url":"https://fr.wikipedia.org/wiki/Manuela_Grochowiak-Schmieding","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/2442ri_Gr%C3%BCne%2C_Manuela_Grochowiak-Schmieding.jpg","page_title":"Manuela Grochowiak-Schmieding","context_page_description":"Manuela Grochowiak-Schmieding est une femme politique allemande."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A7%DB%8C%DA%A9%D9%B9%DB%8C%D9%86%D8%A7%D8%A6%DB%8C%DA%88_%D8%A8%D9%88%DA%AF%D9%86%D9%88%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/ActenoidesBougainvilleiKeulemans.jpg","page_title":"ایکٹینائیڈ بوگنولی","context_page_description":"ایکٹینائیڈ بوگنولی رکھ مچھی مار دے ٹبر دا اک مچھی مار اے۔"},{"page_url":"https://vec.wikipedia.org/wiki/Autor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Dante-alighieri.jpg","page_title":"Autor","context_page_description":"On autor el xè na persona che crea na òpera. El łaoro el pol esere artistego, scentifego o łiterario. Sto conseto de creasion el permete anca on canbiamento a na òpera fata prima. In tel tenpo el conseto de autor el xè canbià; ła presente concesion ła vien dal rinasimento ła xè asocià pa sti conseti: orixenałità, utorità, proprietà morałe, intełetuałe e economega."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8A%E4%B8%87%C2%B7%E5%9F%B9%E5%88%A9%E8%80%B6%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Iwan_Pyriew_-_Film_nr_31-32_-_1947-12-24.JPG","page_title":"伊万·培利耶夫","context_page_description":"伊萬·亞歷山德羅維奇·培利耶夫，前蘇聯電影導演和編劇。他製作的音樂劇和戲劇在國際上都很著名。在他電影製作生涯的後期，他的戲劇片很受歡迎，其中很多都是由費奧多爾·陀思妥耶夫斯基的小說改編的。"},{"page_url":"https://de.wikipedia.org/wiki/Martin_O%E2%80%99Neill,_Baron_O%E2%80%99Neill_of_Clackmannan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Official_portrait_of_Lord_O%27Neill_of_Clackmannan.jpg","page_title":"Martin O’Neill, Baron O’Neill of Clackmannan","context_page_description":"Martin John O’Neill, Baron O’Neill of Clackmannan ist ein britischer Politiker der Labour Party, der 26 Jahre lang Abgeordneter des House of Commons war und seit 2005 als Life Peer Mitglied des House of Lords ist."},{"page_url":"https://fi.wikipedia.org/wiki/Juice_Leskinen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Juice_Leskinen_nuorena.jpg","page_title":"Juice Leskinen","context_page_description":"Juhani Juice Leskinen oli suomalainen laulaja-lauluntekijä, sanoittaja, runoilija ja kansantaiteilija. Tämän ohella hän toimi muun muassa kääntäjänä ja kolumnistina. Häntä on kutsuttu ”suomalaisen pop-musiikin kulmakiveksi” ja ”suomalaisen rock-musiikin isähahmoksi”.\\nLeskisen tunnetuimpia kappaleita ovat muun muassa ”Marilyn”, ”Jyrki boy”, ”Syksyn sävel”, ”Se oli jautaa”, ”Viidestoista yö”, ”Ei elämästä selviä hengissä”, ”Musta aurinko nousee”, ”Kaksoiselämää” ja ”Norjalainen villapaita”. Leskisen levyjä oli myyty vuoteen 2006 mennessä yhteensä yli puoli miljoonaa kappaletta.\\nLeskisen kirjallinen tuotanto käsittää runoja, lastenkirjallisuutta, henkilöhistoriaa, suomennoksia ja moninaisia kirjoituksia eri lehdissä ja antologioissa. Yhteensä hän julkaisi kaksitoista runokokoelmaa, neljä lastenkirjaa ja neljä muuta teosta. Vuonna 1994 julkaistu Äeti oli ensimmäinen kriitikoitakin miellyttänyt runoteos, ja myös postuumisti julkaistu Kosket sai hyvän vastaanoton."},{"page_url":"https://es.wikipedia.org/wiki/Rondon%C3%B3polis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Brasao_de_Rondonopolis.png","page_title":"Rondonópolis","context_page_description":"Rondonópolis es un municipio brasileño del estado de Mato Grosso. Se localiza a una latitud de 16º28'15\\" sur y a una longitud de 54º38'08\\" oeste, estando a una altura de 227 metros sobre el nivel del mar. Su población estimada en el año 2016 era de 239.135 habitantes, en una superficie de 4.165 km².\\nLa ciudad es bañada por los ríos Vermelho, Tadarima, Arareau, Ponte de Pedra y Jurique.\\nLa región tiene vegetación típica de sierras, el clima es tropical caliente y semihúmedo, con lluvias concentradas en el verano y la primavera. El clima de Rondonópolis puede ser clasificado como clima tropical de sabana, de acuerdo con la clasificación climática de Köppen.\\nSe encuentra localizada en una posición privilegiada, en el cruce de las carreteras BR-163 y BR-364, y pronto lo será, a través del Ferronorte, que la comunicará por medio de vías férreas a los principales puertos del Brasil.\\nLa economía está basada en el agronegocio, el comercio y la prestación de servicios. También existen plantaciones de algodón, soja y cría de ganado.\\nDatos: Q983714\\nMultimedia: Rondonópolis"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%88%D8%BA_%D8%A8%D9%8A%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Douglas_Berry.jpg","page_title":"دوغ بيري","context_page_description":"دوغ بيري ‏ هو جزار وسياسي أسترالي، ولد في 3 مايو 1907 في أستراليا، وتوفي في 17 أبريل 1957. حزبياً، نشط في الحزب الليبرالي الأسترالي. وقد انتخب عضو مجلس النواب الأسترالي عن دائرة غريفيث."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A6%99%E5%A0%87%E9%85%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Beta-ionone-label.png","page_title":"香堇酮","context_page_description":"香堇酮，是一種萜類物質，根據雙鍵位置不同有三種異構體。 香堇酮的詞源是希臘語Ίον，意思是香堇菜。香堇酮也譯作紫羅蘭酮，但目前沒有關於紫羅蘭含有香堇酮的報導。\\n香堇酮屬於玫瑰酮，存在於包括玫瑰精油的多種花精油中。β-香堇酮是玫瑰香氣的主要貢獻物，雖然其在精油中含量相對較低。香堇酮是一個重要的香料化學品，用於香水，香料和調味料。香堇酮在生物中來源於類胡蘿蔔素的降解。\\n胡蘿蔔素包括α-胡蘿蔔素，β-胡蘿蔔素，γ-胡蘿蔔素，葉黃素和β-隱黃質，都含有β-香堇酮結構，具有維生素A的活性，它們在動物體內可轉化成視黃醇。無β-香堇酮結構的類胡蘿蔔素則不能被轉換為視黃醇，沒有維生素A活性。"},{"page_url":"https://en.wikipedia.org/wiki/NATO_Ouvrage_%22G%22","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Thomas_Bresson_-_totes_%28by%29.JPG","page_title":"NATO Ouvrage \\"G\\"","context_page_description":"From 1949 to March 10, 1967, France's military operated within the NATO command structure, integrating its air defense system with that of NATO through the indirect use of American aid funds. Between 1953 and 1958, the D.A.T. built a radar station in an old troops shelter near the fort, called Ouvrage \\"G\\". Called \\"Station Maître Radar 60/921\\", it was used beginning in 1959, covering an area on the surface of three times the area of the troops shelter.\\nOuvrage \\"G\\" complemented Ouvrage F, another D.A.T. station located at the old Fort François de Guise at Metz, while Ouvrage H was established as Base aérienne 901 Drachenbronn/Station Maître Radar 50/921 in the former Maginot Ouvrage Hochwald. Ouvrage \\"G\\" was equipped with seven radar antennas installed on top of the fort. The principal radars are presently located on the Ballon de Servance.\\nThe Ouvrage « G » is composed, at this creation, to 3 elements:\\nthe fort du Salbert\\nbaraques Fillod\\nundergrounds buildings\\nThe military vacated the Fort de Salbert in 1972 and removed the antennas from the fort. The city of Belfort took possession of the site. The foundations of the radars and the fort's heating oil tanks remain."},{"page_url":"https://ca.wikipedia.org/wiki/Verson","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Map_commune_FR_insee_code_14738.png","page_title":"Verson","context_page_description":"Verson és un municipi francès, situat al departament de Calvados i a la regió de Normandia. L'any 2007 tenia 3.651 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_the_2006_Atlantic_hurricane_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Alberto_2006-06-12_1830Z.jpg","page_title":"Timeline of the 2006 Atlantic hurricane season","context_page_description":"The 2006 Atlantic hurricane season was an event in the annual tropical cyclone season in the north Atlantic Ocean. Following the intense activity in the 2005 season, forecasts had initially predicted that the 2006 Atlantic hurricane season would be only slightly less active. However, activity was slowed by a rapidly forming El Niño event in 2006, the presence of the Saharan Air Layer over the tropical Atlantic, and the steady presence of a robust secondary high-pressure area to the Azores high centered on Bermuda.\\nThe season officially began on June 1, 2006, and lasted until November 30, 2006, dates that conventionally delimit the period of each year when most tropical cyclones develop in the Atlantic basin. The first storm in the calendar year was Tropical Storm Zeta, which arose in December 2005 and persisted until early January 2006, only the second event on record that a storm spanned two calendar years in the Atlantic. The first in-season storm to form was Tropical Storm Alberto on June 10; the last, Hurricane Isaac became a tropical storm on September 28, and dissipated on October 2."},{"page_url":"https://pt.wikipedia.org/wiki/Contracultura_da_d%C3%A9cada_de_1960","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/WEC-69F-C.jpg","page_title":"Contracultura da década de 1960","context_page_description":"A contracultura da década de 1960 refere-se a um fenômeno cultural anti-establishment que se desenvolveu primeiro nos Estados Unidos e no Reino Unido, e depois se espalhou por grande parte do mundo ocidental, entre o início dos anos 1960 e meados dos anos 1970, em Londres, Nova York e mais tarde San Francisco sendo o foco das atividades da contracultura. O movimento ganhou impulso agregado conforme o movimento dos direitos civis afro-americano continuou a crescer, e se tornou revolucionário com a expansão da intervenção militar do governo dos EUA ao Vietnã.\\nEnquanto a década de 1960 avançava, as tensões sociais generalizadas também se desenvolveram relativas a outros assuntos, e tendiam a fluir ao longo das linhas geracionais em relação à sexualidade humana, os direitos das mulheres, os modos tradicionais das autoridades, a experimentação com drogas psicoativas, e interpretações divergentes do sonho americano.\\nCom os desdobramentos da era, novas formas culturais e uma subcultura dinâmica que celebrava a experimentação, encarnações modernas da boêmia, e a ascensão hippie e outros estilos de vida alternativos, surgiram."},{"page_url":"https://ca.wikipedia.org/wiki/Pol%C3%ADtica_a_Segart","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Segart_votos_2003.png","page_title":"Política a Segart","context_page_description":"En l'actualitat l'Ajuntament de Segart està governat per Junts per Segart, que a les últimes eleccions municipals de 2019 va obtenir 4 regidors, enfront al Partit Socialista del País Valencià que en va obtenir 1.\\nPaco Garriga García, serà reelegit alcalde del municipi, però aquesta vegada sota les sigles de Junts per Segart."},{"page_url":"https://en.wikipedia.org/wiki/List_of_FIFA_World_Cup_stadiums","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Cottonbowldallas_crop.png","page_title":"List of FIFA World Cup stadiums","context_page_description":null},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC-%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%9D%D0%B0%D1%80%D0%B8%D0%BC%D0%B0%D0%BD%D0%B0_%D0%9D%D0%B0%D1%80%D0%B8%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0_(%D0%91%D0%B0%D0%BA%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/ru/a/aa/%D0%9C%D0%B0%D0%BA%D0%B5%D1%82_%D0%B4%D0%BE%D0%BC%D0%B0%2C_%D0%B2_%D0%BA%D0%BE%D1%82%D0%BE%D1%80%D0%BE%D0%BC_%D1%80%D0%BE%D0%B4%D0%B8%D0%BB%D1%81%D1%8F_%D0%9D%D0%B0%D1%80%D0%B8%D0%BC%D0%B0%D0%BD_%D0%9D%D0%B0%D1%80%D0%B8%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2.jpg","page_title":"Дом-музей Наримана Нариманова (Баку)","context_page_description":"Дом-музей Наримана Нариманова — учреждение культуры Баку, мемориальный музей, посвящённый азербайджанскому писателю, врачу, председателю СНК Азербайджанской ССР Нариману Нариманову. Расположен в доме, где Нариманов жил с 1913 по 1918 год, современный адрес — улица Истиглалият, 35. Открытие музея состоялось в 1977 году. В музее выставлены личные вещи Наримана Нариманова, документы и фотографии, портреты и пр."},{"page_url":"https://uz.wikipedia.org/wiki/Gana_milliy_futbol_terma_jamoasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/GFA.png","page_title":"Gana milliy futbol terma jamoasi","context_page_description":"Gana milliy futbol terma jamoasi ommabop laqabi Qora yulduzlar, 1950-yildan beri xalqaro futbol musobaqalarida Gana davlati sharafini himoya qilib keladi. Qora yulduzlar Gana Futbol Assotsiatsiyasi tomonidan boshqariladi, hamda ushbu assotsiatsiya Afrika qitʼasidagi ilk futbol sporti tashkiloti. 1957-yildan oldin, terma jamoa Oltin qirgʻoq davlati nomi bilan maydon tushgan.\\nShuningdek, Gana terma jamoasi FIFA Jahon chempionati musobaqalarida 2006-yilga qadar ishtirok etmagan, yozgi olimpiada oʻyinlari futbol musobaqalarida 5 marta ishtirok etishgan. Jamoa 4 marta CAF Afrika millatlar kubogi gʻolibi boʻlgan va yana 4 marta kumush medal sohibiga aylanganlar. Janubiy Afrikada boʻlib oʻtgan FIFA Jahon chempionati 2010 musobaqasida, Gana jamoasi chorak finalgacha borib uchinchi Afrika davlatiga aylangan edi.\\n2005-yilgi muvaqqiyatli odimlardan keyin, terma jamoa FIFA tomonidan yilning eng tez rivojlangan terma jamoasi sovrinini qoʻlga kiritdi va keyin ular 2006-yilgi jahon chempionatining 2-roundiga chiqishdi."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kuopion_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/fi/d/d7/Minna_Canthin_muistolaatta_-_1977_-_Minna_Canthin_katu_22_-_Kuopio.jpg","page_title":"Luettelo Kuopion julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Kuopion julkisista taideteoksista ja muistomerkeistä on luettelo Kuopion kaupungin alueella sijaitsevista julkisilla paikoilla olevista pysyvistä taideteoksista, muistomerkeistä, muistolaatoista ja ympäristötaideteoksista. Kuopioon on liitetty seuraavat kunnat: Kuopion mlk, Riistavesi, Vehmersalmi, Karttula, Nilsiä, Maaninka ja Juankoski. Lisäksi Juankoskeen oli aiemmin liitetty Muuruvesi ja Säyneinen."},{"page_url":"https://vi.wikipedia.org/wiki/Lasson,_Calvados","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Lasson-chateau-aile-ouest.jpg","page_title":"Lasson, Calvados","context_page_description":"Lasson là một xã ở tỉnh Calvados, thuộc vùng Normandie ở tây bắc nước Pháp."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Plantier_de_Costebelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Avis_de_d%C3%A9c%C3%A9s_Ctesse_de_Guichen_1910.JPG","page_title":"Le Plantier de Costebelle","context_page_description":"Le Plantier de Costebelle est une maison d’architecture néo-palladienne construite à partir de 1857 par la baronne Hortense Pauline Husson de Prailly. Située dans la commune de Hyères-les-Palmiers, dans le département du Var, sur le versant est du mont des Oiseaux et des collines de Costebelle, la propriété surplombe la rade d'Hyères, la presqu'île de Giens et les îles de Porquerolles et de Port-Cros. Lieu de villégiature dans la deuxième moitié du XIXᵉ siècle pour d’éminents ecclésiastiques, la « Villa des Palmiers » accueille également l’écrivain légitimiste Armand de Pontmartin. Mais la plus illustre visite à ce jour reste le passage à la Villa des Palmiers, de la reine Victoria accompagnée de la princesse Henri de Battenberg, en 1892.\\nEn 1896, le romancier et académicien français Paul Bourget, auteur du Disciple, achète la propriété qui prend alors son nom actuel, « Le Plantier de Costebelle », et y reçoit de nombreuses personnalités du monde littéraire, tels qu’André Gide, Henry James, Edith Wharton, de la sphère politique ou même militaire et ce, jusqu’à sa mort, en 1935. Le domaine est, à cette date, transmis à l'héritier du romancier, le général Marius Daille."},{"page_url":"https://nl.wikipedia.org/wiki/Leden_van_het_Huis_van_Afgevaardigden_(Verenigde_Staten)_op_3_januari_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Kim_Schrier_Official_Portrait_116th_Congress.jpg","page_title":"Leden van het Huis van Afgevaardigden (Verenigde Staten) op 3 januari 2019","context_page_description":"Deze lijst bevat het bestuur en alle huidige afgevaardigden in het Amerikaanse Huis van Afgevaardigden, per 3 januari 2019. Dit bestaat uit 435 stemgerechtigde afgevaardigden uit de districten van de staten. Elk stemgerechtigd lid wordt gekozen in een congresdistrict dat vastgesteld wordt op basis van de gegevens van de volkstelling. Aan de hand van de tienjaarlijkse volkstelling wordt bepaald hoeveel vertegenwoordigers iedere staat krijgt toebedeeld in het Huis van Afgevaardigden. Elke staat krijgt minstens één zetel. Iedere tien jaar herzien de staten het aantal congresdistricten en de bijbehorende grenzen om die in overeenstemming te bereiken met het aantal afgevaardigden dat ze naar het Huis van Afgevaardigden mogen sturen. Een lid zit een termijn van twee jaar. Verder heeft het Huis nog zes leden zonder stemrecht, uit Guam, Amerikaans-Samoa, de Noordelijke Marianen, de Amerikaanse Maagdeneilanden, Puerto Rico en het District of Columbia."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_fotballdommere_som_har_d%C3%B8mt_VM-finalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/John_Langenus_The_football_arbitrator_a_judging_first_final_of_the_World_championships_1930_year.jpg","page_title":"Liste over fotballdommere som har dømt VM-finalen","context_page_description":"Dette er ei liste over fotballdommere som har dømt VM-finalen.\\nJohn Langenus fra Belgia dømte den første VM-finalen i 1930. Den hittil siste er Nicola Rizzoli fra Italia i 2014.\\nDen første ikke-europeiske dommeren som dømte finalen var brasilianske Arnaldo Coelho i 1982.\\nNasjonen med flest dommere som har dømt VM-finalen er England med fire; George Reader i 1950, William Ling i 1954, Jack Taylor i 1974 og Howard Webb i 2010.\\nNicola Rizzoli fra Italia har gitt flest gule kort i en VM-finale med 13 i 2014, mens dommeren med flest røde kort i en finale er Edgardo Codesal med to i 1990.\\nIngen dommere fra Asia har dømt VM-finalen."},{"page_url":"https://ru.wikipedia.org/wiki/RBS_70","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/16th_Air_Defence_Regiment_soldiers_with_RBS-70_July_2011.jpg","page_title":"RBS 70","context_page_description":"RBS 70 — шведский универсальный переносной зенитно-ракетный комплекс, предназначенный для поражения низколетящих воздушных целей противника. Разработан в Швеции компанией Bofors Defence."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AC%E0%A9%81%E0%A8%B2%E0%A8%97%E0%A8%BE%E0%A8%B0%E0%A9%80%E0%A8%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Flag_of_Bulgaria.svg","page_title":"ਬੁਲਗਾਰੀਆ","context_page_description":"ਬੁਲਗਾਰੀਆ ਦੱਖਣ-ਪੂਰਬੀ ਯੂਰਪ ਵਿੱਚ ਸਥਿੱਤ ਇੱਕ ਦੇਸ਼ ਹੈ, ਜਿਹਦੀ ਰਾਜਧਾਨੀ ਸੋਫ਼ੀਆ ਹੈ। ਇਸ ਦੇਸ਼ ਦੀਆਂ ਹੱਦਾਂ ਉੱਤਰ ਵੱਲ ਰੋਮਾਨੀਆ, ਪੱਛਮ ਵੱਲ ਸਰਬੀਆ ਅਤੇ ਮਕਦੂਨੀਆ, ਦੱਖਣ ਵੱਲ ਯੂਨਾਨ ਅਤੇ ਤੁਰਕੀ ਨਾਲ਼ ਲੱਗਦੀਆਂ ਹਨ। ਪੂਰਬ ਵੱਲ ਦੇਸ਼ ਦੀਆਂ ਹੱਦਾਂ ਕਾਲੇ ਸਾਗਰ ਨਾਲ਼ ਲੱਗਦੀਆਂ ਹਨ। ਕਲਾ ਅਤੇ ਤਕਨੀਕ ਤੋਂ ਛੁੱਟ ਸਿਆਸੀ ਨਜ਼ਰੀਏ ਤੋਂ ਵੀ ਬੁਲਗਾਰੀਆ ਦੀ ਹੋਂਦ ਪੰਜਵੀਂ ਸਦੀ ਤੋਂ ਨਜ਼ਰ ਆਉਣ ਲੱਗਦੀ ਹੈ। ਪਹਿਲਾਂ ਬੁਲਗਾਰੀਆਈ ਸਾਮਰਾਜ ਨੇ ਸਿਰਫ਼ ਬਾਲਕਨ ਖੇਤਰ ਦੀ ਨਹੀਂ ਸਗੋਂ ਪੂਰੇ ਪੂਰਬੀ ਯੂਰਪ ਨੂੰ ਅਨੇਕਾਂ ਪ੍ਰਕਾਰ ਨਾਲ਼ ਪ੍ਰਭਾਵਿਤ ਕੀਤਾ। ਬੁਲਗਾਰੀਆਈ ਸਾਮਰਾਜ ਦੇ ਗਿਰਾਅ ਮਗਰੋਂ ਇਹਨੂੰ ਓਟੋਮਨ ਸ਼ਾਸਨ ਦੇ ਅਧੀਨ ਕਰ ਦਿੱਤਾ ਗਿਆ। 1877-78 ਵਿੱਚ ਹੋਏ ਰੂਸ-ਤੁਰਕੀ ਯੁੱਧ ਨੇ ਬੁਲਗਾਰੀਆ ਰਾਜ ਨੂੰ ਮੁੜ-ਸਥਾਪਤ ਕਰਨ ਵਿੱਚ ਮਦਦ ਕੀਤੀ। ਦੂਜੇ ਵਿਸ਼ਵ ਯੁੱਧ ਮਗਰੋਂ ਬੁਲਗਾਰੀਆ ਸਾਮਵਾਦੀ ਰਾਜ ਅਤੇ ਪੂਰਬੀ ਬਲਾਕ ਦਾ ਹਿੱਸਾ ਬਣ ਗਿਆ। 1989 ਦੇ ਇਨਕਲਾਬ ਤੋਂ ਬਾਅਦ 1990 ਵਿੱਚ ਸਾਮਵਾਦੀਆਂ ਦੀ ਸੱਤਾ ਦਾ ਅਧਿਕਾਰ ਖ਼ਤਮ ਹੋ ਗਿਆ ਅਤੇ ਦੇਸ਼ ਸੰਸਦੀ ਲੋਕ-ਰਾਜ ਦੇ ਰੂਪ ਵਿੱਚ ਅੱਗੇ ਵਧਣ ਲੱਗਾ। ਇਹ ਦੇਸ਼ 2004 ਤੋਂ ਨਾਟੋ ਦਾ ਅਤੇ 2007 ਤੋਂ ਯੂਰਪੀ ਸੰਘ ਦਾ ਮੈਂਬਰ ਹੈ।"},{"page_url":"https://en.wikipedia.org/wiki/Peretna","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/RiverPeretnaNearItsSource.JPG","page_title":"Peretna","context_page_description":"The Peretna is a river in Okulovsky District of Novgorod Oblast, Russia. It is left tributary of the Msta. It is 39 kilometres long, and the area of its basin 905 square kilometres. The town of Okulovka and the work settlement of Kulotino are located on the banks of the Peretna.\\nThe source of the Peretna is in Lake Zaozyorye, west of the town of Okulovka. The river flows northeast and has its mouth in the village of Toporok. It crosses the railway line connecting Moscow and Saint Petersburg between the source and Okulovka."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%AF%DB%86%D9%86%D8%A7%DA%B5%D8%AF_%D8%AA%D8%B1%D8%A7%D9%85%D9%BE_%D8%AC%D9%88%D9%88%D9%86%DB%8C%DB%86%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Donald_Trump%2C_Jr._%2830309613870%29.jpg","page_title":"دۆناڵد ترامپ جوونیۆر","context_page_description":"دۆناڵد جۆن \\"دۆن\\" ترامپ جونیۆر، لەدایکبووی ٣١ی دیسەمبەری ١٩٧٧، لە شاری نیویۆرک، نیویۆرک. بازرگانێکی ئەمریکییە کوڕە گەورەی ٤٥مین سەرۆک کۆماری ویلایەتە یەکگرتووەکان دۆناڵد ترامپ و ئیڤانا زاڵنیچکۆڤایە."},{"page_url":"https://cs.wikipedia.org/wiki/Superbike","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ducati_999R_Xerox.jpg","page_title":"Superbike","context_page_description":"Superbike je kategorie závodních motocyklů, které jsou velmi podobné sériovým, proti kterým jsou částečně upravené. V kontrastu motocykly závodící v třídě MotoGP jsou speciály postavené pouze za účelem závodu MotoGP. Mistrovství světa Superbike je oficiální série mistrovství světa, ačkoli národní šampionáty Superbike se konají v mnoha zemích, včetně Spojeného království, Spojených států amerických, Japonska, Austrálie a Kanady. Závody Superbike jsou obecně populární u výrobců, protože podporují propagaci jejich produktů, jak zachycuje slogan Win on Sunday; Sell on Monday."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D9%85%D9%8A%D9%84%D9%8A%D8%AA%D8%A7_%D8%BA%D9%8A%D8%B1%D8%A7%D8%BA%D8%AA%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Carmelita_Geraghty_Stars_of_the_Photoplay.jpg","page_title":"كارميليتا غيراغتي","context_page_description":"كارميليتا غيراغتي ‏ هي رسامة وممثلة أمريكية، ولدت في 21 مارس 1901 في روشفيل في الولايات المتحدة، وتوفيت في 7 يوليو 1966 في مانهاتن في الولايات المتحدة بسبب نوبة قلبية."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E4%B8%89%E8%8F%B1Fuso_Rosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Mitsubishi_Fuso_ROSA_TURBO_DELUXE_%28B210%29_rear.jpg","page_title":"三菱Fuso Rosa","context_page_description":"三菱Fuso Rosa，有時就咁叫三菱Rosa，係日本三菱Fuso出嘅一款小巴。\\n三菱Rosa喺1960年面世，當時由新三菱重工業（前中日本重工業，由三菱重工業拆出嚟）出，叫三菱Rosa（三菱ローザ）。喺1964年三間由三菱重工業拆出嚟嘅公司合番埋做三菱重工業，三菱Rosa正式成為三菱Fuso旗下產品，並喺1966年取代同廠MB720小巴嘅地位。\\nRosa喺1973、1986同埋1997年加埋改過三次款。除咗後輪驅動嘅Rosa之外，三菱亦自1990年推出四驅版Rosa小巴。\\nRosa小巴除咗喺日本本土賣之外，亦有出口去亞洲、非洲同埋中南美洲多個地區。"},{"page_url":"https://pt.wikipedia.org/wiki/Americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/As_Armas.jpg","page_title":"Americana","context_page_description":"Americana é um município da Microrregião de Campinas, na Mesorregião de Campinas, no estado de São Paulo, no Brasil. Localiza-se a noroeste da capital do estado, distando desta cerca de 126 quilômetros. Ocupa uma área de 133,630 quilômetros quadrados, sendo que 50,750 quilômetros quadrados estão em perímetro urbano e os 82,88 quilômetros quadrados restantes constituem a zona rural. Em 2017, sua população foi estimada pelo Instituto Brasileiro de Geografia e Estatística em 233 868 habitantes, sendo que, em 2010, era o 34º município mais populoso do estado de São Paulo e o quarto mais populoso da Região Metropolitana de Campinas.\\nA sede tem uma temperatura média anual de 21,8 graus Celsius. Na vegetação original do município, predomina a mata atlântica. Com uma taxa de urbanização da ordem de 98%, o município contava, em 2009, com 80 estabelecimentos de saúde. O seu Índice de Desenvolvimento Humano é de 0,840, considerando-se assim como elevado em relação ao resto do país, sendo o 19° maior índice de desenvolvimento humano do estado."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%85%CE%BD%CE%B1%CF%83%CF%80%CE%B9%CF%83%CE%BC%CF%8C%CF%82_%CF%84%CE%B7%CF%82_%CE%91%CF%81%CE%B9%CF%83%CF%84%CE%B5%CF%81%CE%AC%CF%82,_%CF%84%CF%89%CE%BD_%CE%9A%CE%B9%CE%BD%CE%B7%CE%BC%CE%AC%CF%84%CF%89%CE%BD_%CE%BA%CE%B1%CE%B9_%CF%84%CE%B7%CF%82_%CE%9F%CE%B9%CE%BA%CE%BF%CE%BB%CE%BF%CE%B3%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Alekos_Alavanos_cropped.jpg","page_title":"Συνασπισμός της Αριστεράς, των Κινημάτων και της Οικολογίας","context_page_description":"Ο Συνασπισμός της Αριστεράς των Κινημάτων και της Οικολογίας ήταν ελληνικό πολιτικό κόμμα της Αριστεράς. Ιδρύθηκε το 1989 ως εκλογική συμμαχία του Κομμουνιστικού Κόμματος Ελλάδας, της Ελληνικής Αριστεράς και άλλων κομμάτων του κεντροαριστερού χώρου.\\nΤο 1991, μετά την αποχώρηση του Κ.Κ.Ε., μετεξελίχθηκε σε ενιαίο κόμμα, ενώ το 2004 πρωτοστάτησε στο σχηματισμό του Συνασπισμού Ριζοσπαστικής Αριστεράς, του οποίου απετέλεσε τη μεγαλύτερη συνιστώσα. Το 2013, ο Συνασπισμός αυτοδιαλύθηκε, ενόψει της μετατροπής του ΣΥ.ΡΙΖ.Α. σε ενιαίο κόμμα.\\nΟ Συνασπισμός ήταν μέλος του Κόμματος της Ευρωπαϊκής Αριστεράς."},{"page_url":"https://en.wikipedia.org/wiki/Optical_telegraph","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Sudika_Nadur_Ta%27_Kenuna.jpg","page_title":"Optical telegraph","context_page_description":"An optical telegraph is a line of stations, typically towers, for the purpose of conveying textual information by means of visual signals. There are two main types of such systems; the semaphore telegraph which uses pivoted indicator arms and conveys information according to the direction the indicators point, and the shutter telegraph which uses panels that can be rotated to block or pass the light from the sky behind to convey information.\\nThe most widely used system was invented in 1792 in France by Claude Chappe, and was popular in the late eighteenth to early nineteenth centuries. This system is often referred to as semaphore without qualification. Lines of relay towers with a semaphore rig at the top were built within line of sight of each other, at separations of 5–20 miles. Operators at each tower would watch the neighboring tower through a telescope, and when the semaphore arms began to move spelling out a message, they would pass the message on to the next tower. This system was much faster than post riders for conveying a message over long distances, and also had cheaper long-term operating costs, once constructed."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B3%D1%96%D0%B4%D1%80%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/71-220-5046_Martynivka_SAM_3277.jpg","page_title":"Мартинівський гідрологічний заказник","context_page_description":"Мартинівський — гідрологічний заказник місцевого значення у Канівському районі Черкаської області."},{"page_url":"https://az.wikipedia.org/wiki/Topqap%C4%B1_saray%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Istanbul.Topkapi020.jpg","page_title":"Topqapı sarayı","context_page_description":"Topqapı sarayı — Türkiyənin İstanbul şəhərində yerləşən və 400 il Osmanlı sultanlarının iqamətgahı olmuş saray kompleksi.\\nHökmdar iqamətgahı kimi saray təntənəli qəbullar və əyləncə məclislərinin keçirildiyi məkan olmuşdur. Hazırda muzey kimi fəaliyyət göstərən saray İstanbulun əsas turist məkanlarından biridir. Sarayda Məhəmməd peyğəmbərin əbası və qılıncı kimi müsəlmanlar üçün çox dəyərli olan müqəddəs relikviyalar qorunur. 1985-ci ildən “İstanbulun tarixi ərazisi”nin tərkibində UNESCO Ümumdünya irsi siyahısına daxil olan saray iv kriteriyası ilə “Osmanlı dövrü [...] saraylarının ən yaxşı nümunələrindən biri” kimi təsvir edilir.\\nSaray kompleksi dörd həyət və çoxlu kiçik binalardan ibarətdir. Ən aktiv məskunlaşma dövründə 4.000 insanın yaşadığı saray uzun sahilboyu ərazini əhatə edirdi. Kompleksə məscidlər, xəstəxana, çörəkxanalar və başqa binalar da daxildir. Sarayın inşasına 1459-cu ildə Konstantinopolu işğal etmiş Sultan II Mehmedin əmri ilə başlanmışdır. Sultanların əvvəlki iqamətgahından fərqləndirilməsi üçün saray “Yeni Saray” adlandırılmışdır."},{"page_url":"https://vi.wikipedia.org/wiki/Englerophytum_natalense","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Englerophytum_natalense%2C_loof%2C_Krantzkloof_NR.jpg","page_title":"Englerophytum natalense","context_page_description":"Englerophytum natalense là một loài thực vật có hoa trong họ Hồng xiêm. Loài này được T.D.Penn. mô tả khoa học đầu tiên năm 1991."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%92_%D7%94%D7%A9%D7%99%D7%9C%D7%95%D7%A9_%D7%94%D7%A7%D7%93%D7%95%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Trinidad_El_Greco2.jpg","page_title":"חג השילוש הקדוש","context_page_description":"חג השילוש הקדוש או יום ראשון של השילוש הקדוש הוא חג נייד בנצרות המערבית והחל ביום ראשון הראשון שלאחר הפנטקוסט. החג מוקדש כפי ששמו מעיד עליו לדוקטרינה הנוצרית של השילוש הקדוש, לפיה האל האחד מופיע בשלוש ישויות נפרדות, לרוב - האב, הבן ורוח הקודש.\\nיום ראשון של השילוש הקדוש הוא יום ראשון הראשון שלאחר עונת הפסחא ובו מתחילה העונה הרגילה השנייה של לוח השנה הנוצרי, הנמשכת עד עונת הציפייה שלפני חג המולד. החג נחוג על ידי כל הכנסיות המערביות, ובמזרח פנטקוסט עצמו הוא גם חג השילוש הקדוש.\\nהחג הונהג על ידי האפיפיור יוחנן העשרים ושניים ב-1334. בעבר נהגו הן הכנסייה הקתולית והן הכנסייה האוונגליסטית לספור את ימי הראשון שלאחר חג זה בהתייחס אליו, אך כיום שוב אין שיטת ספירה זו נוהגת בכנסייה הקתולית."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%8C%D1%8F%D1%86%D1%86%D0%B0-%D0%B4%D0%B5%D0%BB%D1%8C-%D0%94%D1%83%D0%BE%D0%BC%D0%BE_(%D0%A1%D0%B0%D0%BD-%D0%94%D0%B6%D0%B8%D0%BC%D0%B8%D0%BD%D1%8C%D1%8F%D0%BD%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Piazza_del_Duomo_-_San_Gimignano.jpg","page_title":"Пьяцца-дель-Дуомо (Сан-Джиминьяно)","context_page_description":"Пьяцца-дель-Дуомо или Соборная площадь — одно из исторических мест города Сан-Джиминьяно в провинции Сиена, Италия, в средние века бывшее центром религиозной и политической жизни города. Площадь находится возле площади Чистерна на пересечении Дороги франков и древнего маршрута Пиза-Сиена."},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Saint-Maixent-l%27%C3%89cole-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Map_canton_code_79_26.svg","page_title":"Kanton Saint-Maixent-l'École-2","context_page_description":"Kanton Saint-Maixent-l'École-2 je francouzský kanton v departementu Deux-Sèvres v regionu Poitou-Charentes. Skládá se ze sedmi obcí."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D9%84%D9%89_%D8%AF%D9%8A%D9%84%D8%A7%D9%86%D8%B3_%D9%81%D9%8A%D9%88%D8%B1%D8%AC%D8%A7%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Breslau_Feurgard.jpg","page_title":"چولى ديلانس فيورجارد","context_page_description":"چولى ديلانس فيورجارد كانت رسامه من فرنسا."},{"page_url":"https://nl.wikipedia.org/wiki/Ellen_Andr%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Ellen-andre-par-nadar.jpg","page_title":"Ellen Andrée","context_page_description":"Ellen Andrée, eigenlijk Hélène André was een Frans actrice. Tegenwoordig staat ze echter vooral nog bekend als model voor vooraanstaande impressionistische kunstschilders als Édouard Manet, Edgar Degas en Pierre-Auguste Renoir. De expositie van Gervex' Rolla in de Parijse salon van 1878, waarvoor ze erotiserend naakt had geposeerd, veroorzaakte een schandaal."},{"page_url":"https://en.wikipedia.org/wiki/University_of_the_Philippines_Visayas_Tacloban_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/UPVTC.JPG","page_title":"University of the Philippines Visayas Tacloban College","context_page_description":"The University of the Philippines Visayas Tacloban College is a satellite college that is part of the University of the Philippines Visayas. It was established on May 23, 1973 at the city of Tacloban, Philippines."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Farleigh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Harrow_Inn%2C_Farleigh%2C_Surrey_-_geograph.org.uk_-_1271432.jpg","page_title":"Farleigh","context_page_description":"Farleigh sī Liân-ha̍p Ông-kok Eng-lân Tang-lâm Eng-lân Tōa-khu Surrey Kūn ê chi̍t ê bîn-chèng kàu-khu.\\nPang-bô͘:Surrey ê bîn-chèng kàu-khu"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D0%B6%D1%8B%D0%B7%D0%B0%D1%86%D0%BA%D1%96_%D0%B2%D1%96%D0%BB%D0%B0%D1%8F%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Jizzax_districts_numbered_uk.png","page_title":"Джызацкі вілаят","context_page_description":"Джызацкі вілая́т ці Джызацкая во́бласьць — адміністрацыйная адзінка у Рэспубліцы Ўзбэкістан, разьмешчаная ў цэнтры краіны паміж дзьвюма рэкамі. Адміністрацыйны цэнтар ды найбуйнейшы населены пункт вілаяту — горад Джызак."},{"page_url":"https://tt.wikipedia.org/wiki/37-%D0%BD%D1%87%D0%B5_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F_(%D0%A1%D0%A1%D0%A0%D0%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Kiur_map_kravchenko.png","page_title":"37-нче армия (ССРБ)","context_page_description":"37-нче армия – Бөек Ватан сугышы вакытында ССРБ Кораллы көчләре эчендәге оператив хәрби берләшмә.\\nХәрәкәттәге армия"},{"page_url":"https://ca.wikipedia.org/wiki/Corba_transcendent","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Archimedean_spiral.svg","page_title":"Corba transcendent","context_page_description":"A matemàtica, una corba transcendental és aquella corba que no és algebraica. Definim aquí com corba C al conjunt de punts característics de C, no una parametrització donada. Per exemple, el cercle unitari és una corba algebraica, la parametrització habitual mitjançant funcions trigonomètriques pot implicar aquestes funcions transcendentals, però certament el cercle unitari es defineix mitjançant una equació polinòmica. S'aplica el mateix a les corbes i funcions el·líptiques, i de fet a les corbes de gènere > 1 i als automorfismes.\\nLes propietats de les corbes algebraiques, com ara el teorema de Bézout, donen peu a criteris per mostrar corbes que són realment transcendentals. Per exemple, una corba algebraica C, bé es troba amb una línia donada L en un nombre finit de punts, o possiblement conté L completament. Per tant una corba que intersecta una línia en un nombre infinit de punts, però que no la conté, ha de ser transcendental. Això s'aplica no només a les corbes sinusoïdals, per tant, sinó a grans classes de corbes que mostren oscil·lació.\\nAltres exemples de corbes transcendentals són les gràfiques de les cicloide i les funcions exponencials i logarítmiques."},{"page_url":"https://es.wikipedia.org/wiki/Juramaia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Juramaia_NT.jpg","page_title":"Juramaia","context_page_description":"Juramaia es un género extinto de mamíferos euterios muy basales, encontrados en depósitos de finales del Jurásico medio al oeste de Liaoning, China.\\nJuramaia se conoce por el holotipo BMNH PM1343, un esqueleto articulado y casi completo que incluye un cráneo incompleto con la dentadura completa. Se encontró en el yacimiento Daxigou, Jianchang, de la Formación Tiaojishan, que data de hace 160 millones de años. La especie tipo es Juramaia sinensis.​\\nEste animal pesaba solo unos 15 gramos, probablemente era insectívoro y de acuerdo a la parte recuperada de su esqueleto, probablemente trepaba por los árboles introduciendo su aguzado hocico en las hendiduras en busca de alimento.​\\nEl descubrimiento de Juramaia aporta un nuevo hito en la evolución de los mamíferos placentados retrasando su aparición unos 35 millones de años.​ Además, ayudará a calibrar el reloj biológico basado en el ADN.​​"},{"page_url":"https://en.wikipedia.org/wiki/Neritina_juttingae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Neritina_juttingae_shell_2.png","page_title":"Neritina juttingae","context_page_description":"Neritina juttingae is a species of a freshwater snail, an aquatic gastropod mollusk in the family Neritidae."},{"page_url":"https://ca.wikipedia.org/wiki/Manuel_Reyes_L%C3%B3pez","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Manuel_Reyes_Casteldefels.jpg","page_title":"Manuel Reyes López","context_page_description":"Manuel Reyes López és un advocat, economista i polític català, alcalde de Castelldefels entre 2011 i 2015."},{"page_url":"https://it.wikipedia.org/wiki/Baccio_del_Bianco","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Baccio_%28Bartolommeo%29_del_Bianco_Humorous_Allegory_of_Medicine.jpg","page_title":"Baccio del Bianco","context_page_description":"Luigi Baccio del Bianco è stato un pittore, architetto, scenografo e incisore italiano."},{"page_url":"https://nl.wikipedia.org/wiki/Luchthaven_Paphos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Paphos_International_Airport_Check-in_Hall.jpg","page_title":"Luchthaven Paphos","context_page_description":"Luchthaven Paphos ligt op 6,5 km ten zuidoosten van de stad Paphos. Het is de tweede luchthaven van Cyprus. De luchthaven wordt veel gebruikt door toeristen die op vakantie gaan in het westen van Cyprus, de luchthaven ligt vlak bij Coral Bay, Limassol en Paphos zelf.\\nIn november 2008 werd op de luchthaven een nieuwe terminal geopend. Deze heeft een capaciteit van 2,7 miljoen passagiers per jaar.\\nVolgens de luchthavenexploitant verwerkte Paphos International 1.744.011 passagiers in 2007. De luchthaven heeft 28 check-in balies, 6 boarding gates, een bank, restaurants, cafetaria's, bars, een taxfree shop en een cadeauwinkel. Andere faciliteiten zijn een toeristische helpdesk, autoverhuur, eerste hulp, een baby / ouder-ruimte en gehandicaptenfaciliteiten."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BC%D0%B5%D1%82%D0%B8%D0%BD%D0%BE_%D0%9F%D0%BE%D1%99%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Maljen_-_zapadna_Srbija_-_mesto_Div%C4%8Dibare_-_Crni_vrh_-_Poled_sa_vrha_prema_jugoistoku_na_mesto_Tometino_polje_3.jpg","page_title":"Тометино Поље","context_page_description":"Тометино Поље је насеље у Србији у општини Пожега у Златиборском округу. Према попису из 2011. било је 294 становника."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D8%B1%D9%86%DA%A9%D9%84%DB%8C%D9%86_%D9%BE%D8%A7%D8%B1%DA%A9%D8%8C_%D8%A7%DB%8C%D9%84%DB%8C%D9%86%D9%88%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/FPtrainhouse.JPG","page_title":"فرنکلین پارک، ایلینوی","context_page_description":"فرنکلین پارک، ایلینوی آمریکا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۸۳۳۳ نفر ایمیش و ۱۲٫۳۵ کیلومتر موربّع ساحه‌سی وار و ایلینوی ایالتینده یئرلشیب."},{"page_url":"https://pl.wikipedia.org/wiki/Julian_Nowak","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/UlicaCzysta18-TablicaUpami%C4%99tniaj%C4%85caJulianaNowaka-POL%2C_Krak%C3%B3w.jpg","page_title":"Julian Nowak","context_page_description":"Julian Ignacy Nowak – polski polityk, premier, lekarz i lekarz weterynarii, mikrobiolog, założyciel Unii Narodowo-Państwowej w 1922 roku, zastępca członka Wydziału Stronnictwa Prawicy Narodowej w 1910 roku."},{"page_url":"https://gl.wikipedia.org/wiki/Balor_mucilaxinoso","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Slime_mold_stemonitis_fusca.jpg","page_title":"Balor mucilaxinoso","context_page_description":"Non confundir con bacteria mucilaxinosa, mofo, ou balor.\\nBalor mucilaxinoso é un termo de significado amplo que se usa para designar a certos grupos de organismos protistas que utilizan esporas para reproducirse, pero que non ten significado taxonómico. Os balores mucilaxinosos foron inicialmente clasificados como fungos, xa que se parecían a eles, pero xa non son considerados parte do reino dos fungos, polo que non hai que confundilos cos verdadeiros balores ou mofos, que si o son. O termo inclúe a grupos diversos, que non están relacionados entre si, pero aínda se usa moito por conveniencia para agrupar a certo tipo de protistas.\\nHai máis de 900 especies de balores mucilaxinosos ou mofos mucosos, cunha grande variedade de cores, distribuídos por todo o mundo. O seu nome común débese a que durante parte do seu ciclo de vida estes organismos forman unha mucilaxe xelatinosa na que están incluídas moitas células. Esta fase do ciclo vese principalmente nos Myxogastria, que son mofos mucosos macroscópicos grandes."},{"page_url":"https://en.wikipedia.org/wiki/Common_marmoset","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Common_marmoset_%28Callithrix_jacchus%29.jpg","page_title":"Common marmoset","context_page_description":"The common marmoset is a New World monkey. It originally lived on the northeastern coast of Brazil, in the states of Piaui, Paraiba, Ceará, Rio Grande do Norte, Pernambuco, Alagoas and Bahia. Through release of captive individuals, it has expanded its range since the 1920s to Southeast Brazil, where it became an invasive species, raising concerns about genetic pollution of similar species, such as the buffy-tufted marmoset, and predation upon bird nestlings and eggs.\\nThe whole-genome sequence of a female common marmoset was published on 20 July 2014. It became the first New World Monkey to have its genome sequenced."},{"page_url":"https://en.wikipedia.org/wiki/Anti-collision_light","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/AERO_Friedrichshafen_2018%2C_Friedrichshafen_%281X7A4856%29.jpg","page_title":"Anti-collision light","context_page_description":"Anti-collision lights, also known as Beacon lights or Strobe lights are a set of lights required on every aircraft to improve visibility to others. Historically they have used incandescent bulbs, but recently Light-emitting diodes have been used."},{"page_url":"https://de.wikipedia.org/wiki/Paulding-Klasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Henley_DD39_43-1273M.jpg","page_title":"Paulding-Klasse","context_page_description":"Die Paulding-Klasse war eine aus 21 Einheiten bestehende Zerstörer-Klasse der United States Navy und eine Weiterentwicklung der Smith-Klasse. Sie wurden 1909 in Dienst gestellt. 1919 erfolgte die Außerdienststellung. 14 Schiffe wurden anschließend an die United States Coast Guard übergeben.\\nDrei Jahre nach Indienststellung der ersten Zerstörer der Bainbridge-Klasse und der Truxtun-Klasse wurde eine Kommission unter Leitung von Rear Admiral George A. Converse gegründet, die sich mit den zukünftigen Anforderungen an die Zerstörer der US Navy befasste. Ein Ergebnis der Kommission war die Nutzung von Dampfturbinen statt der bislang verwendeten Dreifach-Expansionsmaschinen.\\nDie ersten Einheiten, die von der Arbeit der Kommission beeinflusst wurden, waren die auch Flivvers genannten 740 ts-Zerstörer der Paulding-Klasse und der vorher gebauten Smith-Klasse. Neben der Änderung des Antriebs wurde die Anzahl der 3\\"-Geschütze von drei auf fünf erhöht und die 18\\"-Torpedos in Einzelrohren wurden durch drei Zwillingsrohre ersetzt. Ein im Vergleich zu den ersten Zerstörerklassen erhöhtes Vorschiff und der längere Rumpf verbesserten die Seeeigenschaften der Zerstörer."},{"page_url":"https://sv.wikipedia.org/wiki/Catherine_Booth-Clibborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Fr%C3%A4lsningsarm%C3%A9n_av_Gustaf_Cederstr%C3%B6m.jpg","page_title":"Catherine Booth-Clibborn","context_page_description":"Catherine Booth-Clibborn, född 1858, död 1955.\\nWilliam och Catherine Booths äldsta dotter, även kallad \\"Marskalken\\". Hon utnämndes 1881 av sin far till \\"marskalk av Frankrike\\" och sändes dit för att \\"öppna eld\\". Även Schweiz ingick i hennes verksamhetsområde. Hon gifte sig 1887 med sin chefssekreterare Arthur S Clibborn. Efter femton år förflyttades hon till Nederländerna. 1902 gick hon tillsammans med sin man ur frälsningsarmén och ägande sig därefter åt fri evangelisk verksamhet.\\nHon finns avbildad på en tavla av Gustaf Cederström."},{"page_url":"https://ceb.wikipedia.org/wiki/Maxillaria_longissima","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Maxillaria_longissima_%2816077237429%29.jpg","page_title":"Maxillaria longissima","context_page_description":"Espesye sa orkidya ang Maxillaria longissima. Una ning gihulagway ni John Lindley. Ang Maxillaria longissima sakop sa kahenera nga Maxillaria sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://it.wikipedia.org/wiki/Giovanni_Battista_Forzat%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Vescovi_di_Padova_-_Giovanni_Forzat%C3%A8_e_Princivalle_Conti.jpg","page_title":"Giovanni Battista Forzatè","context_page_description":"Giovanni Battista Forzatè è stato un vescovo cattolico italiano."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%82%B5%E3%83%BC%E3%82%AC%E3%83%A0_(%E6%BD%9C%E6%B0%B4%E8%89%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Midget_sub_135.jpg","page_title":"リサーガム (潜水艦)","context_page_description":"リサーガムは、ジョージ・ギャレットが設計した19世紀のイギリスの潜水艦。艦艇の周囲に張り巡らされた防雷網を突破するために作製された。"},{"page_url":"https://hu.wikipedia.org/wiki/Wikinger_Museum_Haithabu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Hedeby_Museum%2C_Large_Sigtrygg_Stone.jpg","page_title":"Wikinger Museum Haithabu","context_page_description":"A Wikinger Museum Haithabu a kora középkori viking kereskedőváros emlékeit bemutató múzeum Németország Schleswig-Holstein tartományában, Schleswig városa mellett."},{"page_url":"https://hu.wikipedia.org/wiki/Pe%C3%B1arroya-Pueblonuevo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Pe%C3%B1arroya_miner%C3%ADa.JPG","page_title":"Peñarroya-Pueblonuevo","context_page_description":"Peñarroya-Pueblonuevo település Spanyolországban, Córdoba tartományban. Lakosainak száma 11 600 fő."},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Monreale","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Christ_heals_tne_man_with_paralysed_hand.jpg","page_title":"Duomo di Monreale","context_page_description":"La cattedrale di Santa Maria Nuova è il principale luogo di culto cattolico di Monreale, nella città metropolitana di Palermo, sede arcivescovile dell'arcidiocesi omonima.\\nCostruita a partire dal 1174 per volere di Guglielmo II d'Altavilla, re di Sicilia dal 1166 al 1189, è famosa per i ricchi mosaici bizantini che ne decorano l'interno. Nell'agosto del 1926 papa Pio XI l'ha elevata alla dignità di basilica minore. Dal 3 luglio 2015 fa parte del Patrimonio dell'umanità nell'ambito dell'Itinerario arabo-normanno di Palermo, Cefalù e Monreale."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bcio%C5%82y_Wysp_Owczych","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kvivik_the_church_and_village_July_2012.JPG","page_title":"Kościoły Wysp Owczych","context_page_description":"Na Wyspach Owczych istnieje ponad 65 świątyń różnych wyznań. Przeważają świątynie narodowego Kościoła luterańskiego archipelagu – Fólkakirkjan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%B8_%D0%B1%D0%BB%D0%B0%D0%B6%D0%B5%D0%BD%D1%81%D1%82%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/IkonaZapovediBlazhenGIM.jpg","page_title":"Заповеди блаженства","context_page_description":"За́поведи блаже́нства — согласно христианскому вероучению, это часть заповедей Иисуса Христа, произнесённая им во время Нагорной проповеди и дополняющая десять заповедей Моисея. Заповеди блаженства вошли в Евангелие и впоследствии в богослужебное употребление.\\nСвоё название заповеди блаженства получили из предположения о том, что следование им при земной жизни ведёт к вечному блаженству в последующей вечной жизни."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Passau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Berggasse_3_Passau.JPG","page_title":"Liste der Baudenkmäler in Passau","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen kreisfreien Stadt Passau zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://es.wikipedia.org/wiki/Clarks_Hill_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Clarks_Hill_storefronts.png","page_title":"Clarks Hill (Indiana)","context_page_description":"Clarks Hill es un pueblo ubicado en el condado de Tippecanoe en el estado estadounidense de Indiana. En el Censo de 2010 tenía una población de 611 habitantes y una densidad poblacional de 867,31 personas por km².​"},{"page_url":"https://hu.wikipedia.org/wiki/A_Dal_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/A_Dal_2018_Odett_2018-01-28.jpg","page_title":"A Dal (2018)","context_page_description":"A Dal 2018 egy többrészes show-műsor, melynek keretén belül a nézők és a szakmai zsűri kiválasztotta, hogy ki képviselje Magyarországot a 2018-as Eurovíziós Dalfesztiválon, Portugália fővárosában, Lisszabonban. Az MTVA és a Duna Média 2017. október 9-én reggel tette közzé a pályázati feltételeket és a hivatalos versenyszabályzatot. A dalok leadásának meghosszabbított határideje 2017. november 20-a volt. Újítás, hogy ezúttal innentől már csak online volt lehetősége az előadóknak benyújtani a pályázati anyagot. Az élő showműsorba beválogatott dalok végleges verzióit 2017. december 20-ig küldhették el a résztvevők az MTVA részére.\\nA verseny győztese az AWS lett, akik a Viszlát nyár című dalukkal képviselték Magyarországot a 2018-as Eurovíziós Dalfesztiválon.\\nAz AWS az Eurovíziós Dalfesztivál döntőjében 93 ponttal a huszonegyedik helyet érte el. Az együttes a dalát először a második elődöntőben adta elő, ahonnan a tizennyolc résztvevő közül a tizedik helyen kvalifikálta magát a döntőbe.\\nA nemzetközi dalfesztivál győztese az Izraelt képviselő Netta lett, aki 529 pontot összegyűjtve nyerte meg a döntőt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1956","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Ann_Dowd_2016_%28cropped%29.jpg","page_title":"Lijst van personen geboren in 1956","context_page_description":"Dit is een lijst van personen die geboren zijn in 1956.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://war.wikipedia.org/wiki/Hoplandrothrips","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Hoplandrothrips_%28squashed%29.jpg","page_title":"Hoplandrothrips","context_page_description":"An Hoplandrothrips in uska genus han Insecta. An Hoplandrothrips in nahilalakip ha familia nga Phlaeothripidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%A3%E3%83%95%E3%82%A1%E3%83%8B%E3%83%BC%E3%83%BB%E3%83%86%E3%82%A3%E3%83%BC%E3%82%BB%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Tiffani_Thiessen.jpg","page_title":"ティファニー・ティーセン","context_page_description":"ティファニー・ティーセンは、アメリカ合衆国の女優。ティファニー・ティッセン、ティファニー＝アンバー・ティーセン、ティファニー＝アンバー・ティッセン とも表記される。\\nカリフォルニア州ロングビーチ出身。父親はドイツ系、母親はギリシャ系、トルコ系、ウェールズ系の血を引く。\\nテレビドラマ『ビバリーヒルズ青春白書』でトラブルメーカー的なバレリー・マローン役を演じた事で知られる。共演したデビッド役のブライアン・オースティン・グリーンと婚約していたが、破局した。また、劇中で犬猿の仲であるケリー役のジェニー・ガースとは、実生活では大親友であったが、後に絶縁状態となった。グラマラスな容姿とビバヒルブームが相まって、日本でも人気が高かった。彼女が痩せているのは下着姿からも明らかであるが、骨格レベルでモデル体型のジェニーと比較すると、テレビで自分だけ太く見えてしまう事を雑誌のインタビューで気にしていた。\\n2005年に俳優のブレイディ・スミスと結婚、2010年に娘が生まれた。2015年に第2子となる男児を出産。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%8A%B1%E5%9C%92%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Fa_Yuen_Street_near_Mong_Kok_Road.JPG","page_title":"花園街","context_page_description":"花园街是香港油尖旺区的一条富有特色的街道，位于九龙旺角东部，北至界限街，南至登打士街，与通菜街及洗衣街等街道平行。\\n现时这条街道是香港著名的购物区之一。位于亚皆老街以南的一段花园街，也就是“波鞋街”，整条街约150米长，有50多间售卖运动鞋和运动用品的店铺。旺角道至太子道西一段则为排档区，售卖成衣、蔬菜和水果等。花园街一共分成三段。\\n明清时代，花园街是芒角村栽种花卉的地方。此外，根据历史专家郑宝鸿的考证：花园街曾是1910年代东方殷琴拿烟厂的花园。"},{"page_url":"https://id.wikipedia.org/wiki/The_Amazing_Race_en_Discovery_Channel_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Arco_de_C%C3%B3rdoba_2007-11-16.jpg","page_title":"The Amazing Race en Discovery Channel 2","context_page_description":"The Amazing Race en Discovery Channel 2 adalah musim kedua dari edisi Amerika Latin dari serial TV A.S. The Amazing Race. Musim kedua ini menghadirkan sebelas tim beranggotakan dua orang yang memiliki hubungan selanjutnya, berlomba untuk memenangkan US$250,000.\\nMusim kedua ini tayang pertama kali pada Minggu, 26 September 2010 pukul 23:00.\\nIni merupakan musim terakhir yang ditayangkan oleh Discovery Channel Amerika Latin.\\nSaudara laki-laki asal Meksiko, Mauricio dan Carlos Coarasa, adalah pemenang perlombaan ini."},{"page_url":"https://nl.wikipedia.org/wiki/Halklar%C4%B1n_Demokratik_Partisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Turkish_general_election%2C_November_2015_map.png","page_title":"Halkların Demokratik Partisi","context_page_description":"De Democratische Partij van de Volkeren is een linkse politieke partij in Turkije. De partij werkt samen met de Koerdische Democratische Regio Partij. Ze staat bij het Turkse publiek vooral bekend om haar steun aan rechten voor minderheden, zoals Koerdische lgbt-organisaties, die op hun beurt steun gaven aan de HDP en toenmalig co-voorzitter Selahattin Demirtaş. De partij ziet zich als een Koerdische partij, die een federale staat nastreeft waarin Zuidoost-Anatolië en Oost-Anatolië als Noord-Koerdistan wordt aangemerkt. Ze eisen een stop op bombardementen van Turkse strijdkrachten op PKK'ers en eisen een terugkeer naar het hervormingsproces onder aanvoering van de internationale gemeenschap. Bij monde van Figen Yüksekdağ, een ander voormalig co-voorzitter, sprak de partij zich uit zich gesteund te zien worden door de YPG, YPJ en de PYD."},{"page_url":"https://ht.wikipedia.org/wiki/Hollister,_Kalif%C3%B2ni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Hollistor_City_Hall.jpg","page_title":"Hollister, Kalifòni","context_page_description":"Hollister, Kalifòni se yon vil Etazini. Li sitye nan leta Kalifòni.\\nChèf-lye li se San Benito."},{"page_url":"https://hu.wikipedia.org/wiki/EF_Education_First","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/EF_Education_First_Logo.png","page_title":"EF Education First","context_page_description":"Az EF Education First a világ legnagyobb magánkézben lévő oktatással foglalkozó vállalata. Tizenöt leányvállalat és non-profit egyesület segít a nyelvtanulásban, tanulmányi utazásokban, akadémiai és kulturális csereprogramokban."},{"page_url":"https://gl.wikipedia.org/wiki/Imperio_Alem%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Wappen_Deutsches_Reich_-_Reichsadler.png","page_title":"Imperio Alemán","context_page_description":"O Imperio Alemán, foi a forma de Estado que existiu en Alemaña desde a súa unificación e a proclamación de Guillerme I como emperador, o 18 de xaneiro de 1871, ata 1918, cando se converteu nunha república logo da derrota na Primeira Guerra Mundial e a abdicación de Guillerme II. O termo de Deutsches Reich mantívose como nome oficial de Alemaña durante a República de Weimar e a maior parte do período nazi ata 1943, cando foi cambiado a Großdeutsches Reich.\\nDurante os seus 47 anos de existencia, o Imperio alemán xurdiu como unha das economías industriais máis poderosas da Terra e unha gran potencia, ata que se derrubou logo da súa derrota militar na Primeira Guerra Mundial e a Revolución de Novembro. Os Estados fronteirizos máis importantes foron o Imperio ruso no leste, Francia no oeste e o Imperio austrohúngaro situado no sur."},{"page_url":"https://nl.wikipedia.org/wiki/V%C3%A5rd%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/B%C3%A5thus_V%C3%A4stra_Simsk%C3%A4la.jpg","page_title":"Vårdö","context_page_description":"Vårdö is een archipel en gelijknamige gemeente die deel uitmaakt van de autonome eilandengroep Åland, gelegen in de Oostzee. De naam van Vårdö, dat ook de naam is van het grootste eiland van deze gemeente, betekent wachterseiland.\\nVårdö wordt aan de westzijde door een korte veerverbinding begrensd door de gemeente Sund op het hoofdeiland van Åland, aan de oostzijde door Kumlinge, aan de zuidoostkant door Sottunga en het zuiden door Föglö. De eilandengroep bestaat uit enkele honderden kleine, onbewoonde eilandjes en scheren, en een dozijn bewoonde eilanden, waaronder Simskäla, ten noorden van het hoofdeiland en Bergö, ten zuidoosten van het hoofdeiland.\\nHet oppervlak van de gemeente is 573 km², waarvan 102 km² land; de overige 471 km² is zee. De bevolkingsdichtheid is 4,43 inwoners per km²."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9troit_de_Le_Maire","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Le_Maire_Strait.jpg","page_title":"Détroit de Le Maire","context_page_description":"Le détroit de Le Maire est un bras de mer de 16 milles marins de large qui sépare l'île des États de la pointe orientale de la Terre de Feu argentine, la péninsule Mitre.\\nIl est signalé au sud par le phare Buen Suceso situé sur la péninsule et par le phare Le Maire sur le cap Crossley de l'Île des États. Au nord, le phare San Diego n'est plus en fonctionnement. Les militaires de la petite caserne de la Marine argentine située dans la baie Buen Suceso assurent la surveillance et la sécurité du trafic maritime du détroit."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Themar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/ThemarStolpersteinMarkt8SchlossRosa.jpg","page_title":"Liste der Stolpersteine in Themar","context_page_description":"Die Liste der Stolpersteine in Themar enthält die Stolpersteine, die im Rahmen des gleichnamigen Kunstprojekts von Gunter Demnig in Themar verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Themar lebten und wirkten."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%96%E0%B0%9C%E0%B1%81%E0%B0%B0%E0%B0%B9%E0%B1%8B_%E0%B0%B5%E0%B0%A6%E0%B1%8D%E0%B0%A6_%E0%B0%A8%E0%B0%BF%E0%B0%B0%E0%B1%8D%E0%B0%AE%E0%B0%BE%E0%B0%A3_%E0%B0%B8%E0%B0%AE%E0%B1%82%E0%B0%B9%E0%B0%BE%E0%B0%B2%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Kandariya_mahadeva_temple.jpg","page_title":"ఖజురహో వద్ద నిర్మాణ సమూహాలు","context_page_description":"ఖజురహో మధ్యప్రదేశ్ రాష్ట్రం, ఛత్తర్ పూర్ జిల్లాలోని ఒక గ్రామం. ఢిల్లీకు 620 కి.మీ. దూరంలో గల ప్రాంతం.\\nఇక్కడి నిర్మాణ సమూహాలు యునెస్కో వారిచే ప్రపంచ వారసత్వ ప్రదేశంగా గుర్తింపబడ్డాయి.\\nఈ దేవాలయాలు, హిందూ, జైన దేవాలయాల సమూహం. దీనికి ఆ పేరు సంస్కృతం భాషనుండి మూలంగా వచ్చింది. సంస్కృతంలో ఖజూర్ అనగా ఖర్జూరము.\\nఇండియాలో ఆగ్రా తర్వాత ఎక్కువ మంది సందర్శించే క్షేత్రం ఖజురాహో .’’ఇండో ఆర్యన్ కళకు’’ అద్దం పట్టే శిల్ప వైభవం ఇక్కడే చూస్తాం .దేవాలయ శిల్పకళకు అపూర్వ శిల్పాలకు ప్రపంచం లోనే గొప్ప ప్రదేశం ఖజురహో .తొమ్మిదో శతాబ్దం నుండి పదకొండవ శతాబ్ది లోపు నిర్మితమైన దేవాలయ సముదాయం ఇది .చండేలా రాజ వంశీకుల అద్వితీయ కళా తృష్ణ కు శిల్పుల కళా సృష్టికి దర్పణం .85దేవాలయాలలో ఇప్పుడు మిగిలింది కేవలం 25మాత్రమె .ఖజురహో సాగర్ ఒడ్డున ఖజురహో గ్రామం ఎనిమిది వేల జనాభా తో ఉంది .మధ్యప్రదేశ్ లో చట్టర్పూర్ జిల్లాలో ఖజురహో ఉంది .నర్మదా, చంబల్ నదుల పరివాహక ప్రాంతం .ఉత్తర దక్షిణ భారత దేశాలను వేరు చేసే వింధ్య పర్వత శ్రేణులలో ఉన్న ఈ ప్రదేశం శిల్ప కళ కు కాణాచి గా వెలసిల్లింది .సాత్నా రైల్వే స్టేషన్ దీనికి దగ్గర గా ఉంటుంది .వాతావరణం ఉష్ణ మండల శీతోష్ణ స్తితి .పూర్వకాలం లో వర్షపు నీటిని నిలవ చేయటానికి 60తటాకాలున్దేవి .ఇప్పుడు మూడు తటాకాలు మాత్రమె ఉన్నాయి .అవే ఖజురహో సాగర్, శివ సాగర్, ప్రేమ సాగర్ లు ."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B1_%CE%9A%CE%BB%CE%BF%CE%B6%CE%B5%CF%81%CE%AF_%CE%BD%CF%84%CE%B5_%CE%9B%CE%B9%CE%BB%CE%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Clos_des_Lilas.JPG","page_title":"Λα Κλοζερί ντε Λιλά","context_page_description":"Το Καφέ Κλοζερί ντε Λιλά είναι ένα από τα πιο ιστορικά και παραδοσιακά καφενεία και μπρασερί στο Παρίσι και από τα πιο γνωστά σημεία συνάντησης συγγραφέων και καλλιτεχνών. Βρίσκεται στη Λεωφόρο Μονπαρνάς στην Αριστερή Όχθη του Σηκουάνα, πολύ κοντά και σε άλλα διάσημα «φιλολογικά» καφέ της γαλλικής πρωτεύουσας: Λα Κουπόλ, Λε Σελέκτ, Λε Ντομ και Λα Ροτόντ. Πήρε το όνομά του από τις πασχαλιές που φύτρωναν κάποτε γύρω από το καφέ – Λα Κλοζερί ντε Λιλά σημαίνει στα γαλλικά «Ο Κήπος με τις Πασχαλιές»."},{"page_url":"https://nl.wikipedia.org/wiki/Technische_Universiteit_van_Lausanne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Vue_a%C3%A9rienne_EPFL_07-2009.jpg","page_title":"Technische Universiteit van Lausanne","context_page_description":"De Technische Universiteit van Lausanne is een federale technische universiteit gevestigd Lausanne, Zwitserland.\\nVolgens de QS World University Rankings® 2014/15 heeft deze universiteit een gedeelde 17e plaats.\\nDe zusterinstelling in de Duitstalige deel van Zwitserland is de Eidgenössische Technische Hochschule Zürich."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A1%D7%98%D7%95%D7%9F_%D7%9E%D7%A8%D7%98%D7%99%D7%9F_DB5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Aston_Martin_DB5_Shooting_Brake.jpg","page_title":"אסטון מרטין DB5","context_page_description":"אסטון מרטין DB5 היא מכונית ספורט, 2 דלתות, אשר יוצרה על ידי חברת אסטון מרטין הבריטית בין השנים 1963–1965.\\nסך הכול יוצרו 1,059 יחידות.\\nהדגם מסדרת \\"DB\\" אשר הייתה קרויה על שמו של David Brown, אשר רכש את חברת אסטון מרטין בסוף שנות ה-40 של המאה ה-20.\\nאסטון מרטין DB5 מאיצה מ-0-97 קמ\\"ש ב-8.0 שניות."},{"page_url":"https://en.wikipedia.org/wiki/List_of_displayed_Lockheed_T-33_Shooting_Stars","image_url":"https://upload.wikimedia.org/wikipedia/en/8/8c/T-33_36021_JBER.jpg","page_title":"List of displayed Lockheed T-33 Shooting Stars","context_page_description":"Numerous T-33s have been preserved as museum and commemorative displays including:"},{"page_url":"https://en.wikipedia.org/wiki/Federalist_No._73","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Alexander_Hamilton_portrait_by_John_Trumbull_1806.jpg","page_title":"Federalist No. 73","context_page_description":"Federalist No. 73 is an essay by the 18th-century American statesman Alexander Hamilton. It is the seventy-third of The Federalist Papers, a collection of articles written to promote the ratification of the United States Constitution. It was published on March 21, 1788 under the pseudonym Publius, the name under which all The Federalist papers were published. Its title is \\"The Provision For The Support of the Executive, and the Veto Power\\", and it is the seventh in a series of 11 essays discussing the powers and limitations of the Executive branch of the United States government.\\nThis paper discusses and justifies the executive branch's powers over the Legislature, namely, the Legislature's lack of power to increase or decrease the salary of the President during his/her term, and the Executive Veto.\\nHamilton discusses the benefits of the executive veto. He argues that it \\"shields\\" the executive from legislative control and it acts as a \\"check upon the legislative body\\" which prevents Congress from enacting laws subject to special interests and factional impulses."},{"page_url":"https://ca.wikipedia.org/wiki/Fulenbach","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Fulenbach_poshtejo_kaj_preghejo_195.JPG","page_title":"Fulenbach","context_page_description":"Fulenbach és un municipi del cantó de Solothurn, situat al districte d'Olten."},{"page_url":"https://de.wikipedia.org/wiki/Gro%C3%9Fglockner-Hochalpenstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Grossglockner_road_1997a.jpg","page_title":"Großglockner-Hochalpenstraße","context_page_description":"Die Großglockner Hochalpenstraße verbindet als hochalpine Gebirgsstraße die beiden österreichischen Bundesländer Salzburg und Kärnten. Sie führt von Bruck an der Großglocknerstraße über die beiden Gebirgspässe Fuscher Törl und Hochtor nach Heiligenblut am Großglockner und hat Abzweigungen zur Edelweißspitze und zur Kaiser-Franz-Josefs-Höhe. Sie ist die höchstgelegene befestigte Passstraße in Österreich.\\nDie Großglockner Hochalpenstraße ist als Erlebnisstraße vorrangig von touristischer Bedeutung; das Befahren ist für Kraftfahrzeuge mautpflichtig."},{"page_url":"https://de.wikipedia.org/wiki/Anouk_Dekker","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Anouk-dekker-1376520048.jpg","page_title":"Anouk Dekker","context_page_description":"Manieke Anouk Dekker ist eine niederländische Fußballnationalspielerin. Sie spielt seit 2016 beim HSC Montpellier in der Division 1 Féminine."},{"page_url":"https://it.wikipedia.org/wiki/Willy_Kernen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Willy_Kernen_%281955%29.jpg","page_title":"Willy Kernen","context_page_description":"Willy Kernen è stato un calciatore svizzero, di ruolo difensore."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A7%D9%8A%D8%AA_%D8%A2%D8%B1-975_%D9%88%D9%8A%D8%B1%D9%84_%D9%88%D9%8A%D9%86%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Tavelair_A-6000A_Herrick_13.06.06R.jpg","page_title":"رايت آر-975 ويرل ويند","context_page_description":"صنعت شركة محركات كونتينينتال محرك أر-975 بموجب ترخيص للاستخدام في دبابات الحلفاء و العربات المدرعة خلال الحرب العالمية الثانية. صُنعت عشرات الآلاف من المحركات لهذا الغرض، مما أدى إلى تقليص استخدامها في الطائرات.\\nاستمرت كونتينينتال في إنتاج طرازاتها الخاصة من محرك أر-975 بعد الحرب في خمسينيات القرن العشرين. أُنتجت بعض هذه المحركات بقدرة بلغت 550 حصاناً.\\nاكتسب محرك أر-975 شهرة كبيرة لاستخدامه كمحرك لقانصة الدبابات إم 18 هيلكات، التي كانت أسرع وأفضل قانصة دبابات أمريكية في الحرب العالمية الثانية. ظلت إم 18 المشغلة بمحرك أر-975 أسرع مركبة مدرعة في العالم حتى ظهور إم 1 أبرامز المشغلة بواسطة تربينة في الثمانينيات من القرن العشرين."},{"page_url":"https://pt.wikipedia.org/wiki/Fedora_Linux","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Fedora_19_Desktop_KED.png","page_title":"Fedora Linux","context_page_description":"Fedora é um sistema operacional ou sistema operativo Linux. O sistema operacional Fedora Linux é software livre e de código aberto, e os programas disponíveis dentro de seu repositório de programas também são programas livres que aderem a uma licença livre.\\nO Fedora Linux existe desde 2003, e seu desenvolvimento e suporte é oferecido pela comunidade do Projeto Fedora. Após ter descontinuado o sistema operacional Red Hat Linux, a Red Hat patrocina o desenvolvimento do sistema operacional Fedora, se envolvendo no desenvolvimento de vários programas disponíveis para o Fedora, que são eventualmente adicionados para o repositório do Red Hat Enterprise Linux, que é a distribuição Linux atual da empresa.\\nDesde a versão Fedora 21, há três edições disponíveis: Fedora Workstation, focado para computadores pessoais, Fedora Server para servidores, e o Fedora Cloud para servidores com foco em computação em nuvem. Também existem outras edições, chamadas de \\"spins\\", com ambientes gráficos diferentes do ambiente gráfico GNOME que acompanha o sistema operacional. Ambientes gráficos como o KDE, Xfce, LXDE, entre outros, estão disponíveis."},{"page_url":"https://da.wikipedia.org/wiki/Albertslund_Kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Albertslund_Kommune_coa.svg","page_title":"Albertslund Kommune","context_page_description":"Albertslund Kommune er en københavnsk forstadskommune under Region Hovedstaden.\\nAlbertslund Kommune blev dannet ved kommunalreformen i 1970 af sognene:\\nHerstedvester Sogn\\nHerstedøster Sogn\\nOpstandelseskirkens Sogn\\nDengang hed kommunen Herstedernes Kommune, men blev i 1973 omdøbt til Albertslund fordi Indenrigsministeriet ikke ville anerkende et stednavn i flertalsform.\\nAlbertslund er en grøn kommune bl.a. pga. Vestskoven og Vejleådalen, hvor 60 pct. af byens areal er udlagt til naturområder.\\nKommunen er hovedsageligt bygget som industrialiseret tæt lav elementbyggeri i 1960'erne, hvor byens indbyggertal voksede fra cirka 3.000 til knap 30.000 på cirka 10 år. Byen har bl.a. et totalt opdelt trafiksystem af veje og stier for henholdvis hårde og bløde trafikanter. Albertslund har i vid udstrækning udnyttet at regnvand afledes via rekreative elementer i form af søer og kanaler midt i bebyggelserne. Albertslund Kommune er i dag anerkendt som en frontløberkommune indenfor miljø- og klimaområdet.\\nAlbertslund Kommune har ifølge dem selv tre mærkesager:\\nBørn og unge\\nKultur\\nMiljø"},{"page_url":"https://pl.wikipedia.org/wiki/Edmond_Wilhelm_Brillant","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/EdmondRoalNavyPOfficer.jpg","page_title":"Edmond Wilhelm Brillant","context_page_description":"Edmond Wilhelm Brillant − członek Hagany, ojciec założyciel Izraelskiego Korpusu Morskiego. Poświęcił się rozbudowie Marynarki Wojennej."},{"page_url":"https://ro.wikipedia.org/wiki/Cucumis_metuliferus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Kiwano.jpg","page_title":"Cucumis metuliferus","context_page_description":"Cucumis metuliferus, cunoscut și sub numele de pepenele cu coarne, castravete african cu coarne, pepenele jeleu, melano, pikano sau kiwano, este o specie anuală din specia castravetelui și a pepenului. Fructul acestei plante se poate mânca, dar este cel mai des folosit ca decorație pentru alte mâncăruri. Este o specie nativă în Africa, originară din zona deșertului Kalahari, dar este cultivat și în Maroc, Portugalia, California, Chile, Australia și Noua Zeelandă.\\nÎn Zimbabwe, acest castravete este numit 'gaka' sau 'gakachika' și este folosit ca un fruct sau în salate și doar rar ca decorație. Este mancat verde, proaspăt copt sau bine copt. Crește natural în campuri și în zone împădurite. Gustul său este o combinație între castravete și zucchini sau, când este copt, între banană, castravete și lămâie. Coaja sa este comestibilă și în anumite zone se mănâncă. Există o specie care nu are coarne, dar are gust similar. Semințele sunt acoperite într-o substanță gelatinoasă. Pielea fructului este bogată în vitamina C și în fibre. Înainte de consum se poate adăuga sare sau zahăr pentru a accentua gustul."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D9%8A%D9%8A%D8%AA%D9%88%D8%B1_%D8%A7%D9%84%D8%AD%D8%AF%D9%8A%D9%82%D8%A9_%D8%A7%D9%84%D9%88%D8%B7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kaieteur_Falls_Guyana_%282%29_2007.jpg","page_title":"كاييتور الحديقة الوطنية","context_page_description":"كاييتور الحديقة الوطنية هي حديقة وطنية تقع في منطقة بوتارو - سيباروني في دولة غيانا في أمريكا الجنوبية.\\nفي عام 1999 تم زيادة مساحة الحديقة من 10 كيلومتر مربع إلى 630 كيلومتر مربع بأمر رئاسي."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%82%D1%83%D1%98%D1%81%D0%BA%D0%BE_%D0%95%D0%B7%D0%B5%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ptuj_s_ptujskim_jezerom.jpg","page_title":"Птујско Езеро","context_page_description":"Птујското езеро е најголемо вештачко езеро во Словенија.\\nПовршината на езерото изнесува 346 хектари. Птујското езерот се наоѓа на реката Драва во околината на градот Птуј. Настанало со\\nПовршина језера износи 346 хектара. Птујско језеро се налази на реци Драви у околини Птуја. Настанало со изградбата на браната на реката Драве кај Птуј. Езерото служи како акумулација за хидроцентралата Формин, но исто така како и рекреациона површина за веслање, едрење на даска и риболов. Браната која ја преградува реката е висока 19 метри а нејзината должина изнесува 120 метри."},{"page_url":"https://bs.wikipedia.org/wiki/Deimos_(satelit)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Deimos-viking1.jpg","page_title":"Deimos (satelit)","context_page_description":"Deimos manji je i dalji od dva Marsova prirodna satelita. Ime je dobio po Deimosu, figuri koja je predstavljala užas u grčkoj mitologiji. Pretpostavlja se da su po svom postanku asteroidi nastali u vanjskim dijelovima sunčeva sistema i zarobljeni Marsovim gravitacionim poljem. Fobos i Deimos mogli su se formirati kao Mjesec, rastvaranjem materijala rastrganog s Marsa udarom patuljastog planeta prema numeričkim simulacijama.\\nDeimos ima srednji poluprečnik od 6,2 km i potrebno mu je oko 30,3 sata da kruži oko Marsa. Deimos je udaljen 23,460 km od Marsa, što je daleko od Marsovog drugog mjeseca, Fobosa.\\nSlabo je vidljiv sa Zemlje, ako ne kao svijetla točka, bio je predmet pomnih promatranja tijekom svemirskog istraživanja Crvene planete. Njegova površina, fotografirana gotovo u cijelosti, prekrivena je debelim slojem regolita crvenkaste boje i ima svjetlije pruge koji se fokusiraju na grebene malih visoravni i reljefi. Iako je vrlo krateriran, Deimos zapravo izgleda vrlo glatko, vjerovatno je prošao proces seizmičke degradacije."},{"page_url":"https://af.wikipedia.org/wiki/Shelley_Hull","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Shelley_Hull.jpg","page_title":"Shelley Hull","context_page_description":"Shelley Hull was 'n Amerikaanse akteur. Hy was bekend vir sy rol in die rolprent Sapho."},{"page_url":"https://en.wikipedia.org/wiki/Castile_and_Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Vinos_DO_de_Castilla_y_Le%C3%B3n.svg","page_title":"Castile and León","context_page_description":"Castile and León is an autonomous community in north-western Spain.\\nIt was created in 1983. Formed by the provinces of Ávila, Burgos, León, Palencia, Salamanca, Segovia, Soria, Valladolid and Zamora, it is the largest autonomous community in Spain in terms of area, covering 94,222 km². It is however sparsely populated, with a population density below 30/km². While a capital has not been explicitly declared, the seats of the executive and legislative powers are set in Valladolid by law and for all purposes that city serves as de facto regional capital.\\nCastile and León is a landlocked region, bordered by Portugal as well as by the Spanish autonomous communities of Galicia, Asturias, Cantabria, the Basque Country, La Rioja, Aragon, Castilla–La Mancha, the Community of Madrid and Extremadura. Chiefly comprising the northern half of the Inner Plateau, it is surrounded by mountain barriers and it is drained by the Douro River, flowing west toward the Atlantic Ocean.\\nThe region contains eight World Heritage Sites. UNESCO recognizes the Cortes of León of 1188 as the cradle of worldwide parliamentarism."},{"page_url":"https://de.wikipedia.org/wiki/Palmengew%C3%A4chse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Iguanura_wallichiana_var._major_1zz.jpg","page_title":"Palmengewächse","context_page_description":"Die Palmengewächse oder Palmen sind eine Familie der Ordnung der Palmenartigen innerhalb der Monokotyledonen. Verwandte Arten waren schon vor etwa 70 Millionen Jahren in der Kreidezeit weit verbreitet. Die Familie enthält 183 Gattungen mit etwa 2600 rezenten Arten.\\nIn der Familie der Palmengewächse findet sich das längste Blatt, der größte Samen, und der längste Blütenstand des Pflanzenreichs mit einer Länge von etwa 7,5 Metern und geschätzten 10 Millionen Blüten pro Blütenstand."},{"page_url":"https://fr.wikipedia.org/wiki/Cuisine_laotienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Rotting_fish.jpg","page_title":"Cuisine laotienne","context_page_description":"L'alimentation laotienne est à base de riz, agrémenté de viandes, volailles et poissons. Les légumes sont très nombreux et variés. C'est une cuisine ordinairement très pimentée."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A5%E6%9C%AC%E6%A0%B8%E8%83%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Kashiwazaki_Kariwa-April_2011.jpg","page_title":"日本核能","context_page_description":"在2011年東北地震和海嘯之前，日本已經從核反應爐產生了30％的電力，並計劃將這一比例提高到40％。核能在日本是國家戰略重點。截至2019年2月，日本有42座可運行的反應爐。其中，5個發電廠中的9個反應爐正在運行。\\n儘管日本的所有核反應爐成功抵禦了2011年東北地震的震動，但隨後發生的海嘯造成的洪水導致福島第一核電站冷卻系統於2011年3月11日失效。日本首次發生核緊急事件，其中居住在20公里的工廠的14萬居民被疏散。 國際專家對2013年福島第一核電站災害相關的健康風險進行了全面評估，對於日本國內外的一般人群，預測的風險很低，預計癌症發生率不會高於基線發生率的可觀察到的增加。日本的所有核電站都已關閉，或其運營暫停，以進行安全檢查。日本50個反應爐中的最後一個於2012年5月5日下線維修，自1970年以來首次完全沒有核電生產。\\n穩定福島第一核電站三重反應爐熔化的問題使人們對核電的態度更加強硬。 2011年6月，超過80％的日本人表示他們是關於輻射的反核和不信任的政府信息 。到2011年10月，電力短缺，但日本在夏季倖存下來，沒有一些人預測的大規模停電。 日本內閣於2011年10月批准的能源白皮書指出，福島核災難使「公眾對核電安全的信心受到嚴重破壞」，並呼籲減少國家對核電的依賴。\\n儘管有抗議活動，2012年7月1日，大飯發電廠3號機組重新啟動 。 2013年9月，3台和4台機組下線，使日本再次完全沒有核電生產 。 2015年8月11日，川內核電廠於2016年1月29日重新上線，隨後又有兩個單元的高濱核電站 。然而，在滋賀縣地區法院發布禁止停止高濱核電站運營的禁令之後，由於內部故障和2016年3月的第3單元，第4單元在重啟後三天被關閉。儘管日本在2011年之前的共有54家工廠中有43家仍處於閒置狀態，但經濟產業省在20​​17年表示，如果該國要履行巴黎氣候協議規定的義務，那麼核能需要彌補全國20％-22％的投資組合。 26個重啟應用現在正在等待，預計到2025年將有12個單元重新投入使用，到2030年將重新投入使用18個。"},{"page_url":"https://zh.wikipedia.org/zh-hk/%E8%91%89%E9%8C%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sang_P%27y%C5%8Fng_T%27ong_Bo_%28%E5%B8%B8%E5%B9%B3%E9%80%9A%E5%AF%B6%29_Treasury_Department_Mint_%28%E6%88%B6%29_-_Cropped.png","page_title":"葉錢","context_page_description":"葉錢是常平通寶小平錢的一個別稱。\\n之所以有這個別稱是因為鑄造常平通寶的錢範仿佛樹葉的形狀。"},{"page_url":"https://sk.wikipedia.org/wiki/IFA_H6_B","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/IFA-H6B-L.jpg","page_title":"IFA H6 B","context_page_description":"IFA H6 B je typ univerzálneho autobusu vyrábaného v bývalej NDR, ktorý konštrukčne vychádzal z nákladného vozidla IFA H6. Vývoj nákladného motorového vozidla typu H6 začal už počas II. svetovej vojny spoločnosťou VOMAG zo saského mesta Plavno."},{"page_url":"https://fi.wikipedia.org/wiki/QuakeNet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/QuakeNetLogo.PNG","page_title":"QuakeNet","context_page_description":"QuakeNet on maailman neljänneksi suurin IRC-verkko. Uusin ennätyslukema tuli 8. helmikuuta 2005, jolloin verkossa oli 243 394 yhtäaikaista yhteyttä. QuakeNet oli alun perin Quaken pelaajien verkko, jonka takia siellä on nykyäänkin paljon klaanitoimintaa, mutta myös kaikenlaista muuta toimintaa. QuakeNet ei salli piratismia, pornoa eikä mitään muutakaan laitonta tai käyttäjiä häiritsevää toimintaa."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%8A%D8%A7%D8%A8_%D8%A8%D9%84%D9%88%D9%86%D8%AF%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Eupen-rupel_boom_7.jpg","page_title":"سياب بلوندل","context_page_description":"سياب بلوندل هو لاعب كرة قدم بلجيكي في مركز الوسط. شارك مع منتخب بلجيكا تحت 17 سنة لكرة القدم ومنتخب بلجيكا تحت 19 سنة لكرة القدم ومنتخب بلجيكا تحت 21 سنة لكرة القدم. أما مع النوادي، فقد لعب مع روت فايس آهلن وفاسلاند بيفيرين وفي في في فينلو وفيتيسه آرنهم ونادي مونز ونادي يوبين وF.C.V. Dender E.H."},{"page_url":"https://en.wikipedia.org/wiki/Olivia_Gr%C3%A9goire","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Olivia_Gr%C3%A9goire_4.jpg","page_title":"Olivia Grégoire","context_page_description":"Olivia Grégoire is a French politician serving as the member of the National Assembly for the twelfth constituency of Paris since 2017. A member of La République En Marche!, she defeated incumbent Philippe Goujon by 56.4% to 43.6%."},{"page_url":"https://lt.wikipedia.org/wiki/Niukaslas_(Australija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Newcastle%2C_Australia_aerial.jpg","page_title":"Niukaslas (Australija)","context_page_description":"Niukaslas – septintasis pagal dydį ir antras pagal senumą Australijos miestas, Naujajame Pietų Velse. 498,0 tūkst. gyventojų. Nuo Sidnio nutolęs 160 km. Stovi ant Hunterio upės, tai vienas iš svarbesnių Australijos miestų. Didžiausias anglies eksporto uostas pasaulyje 2006 metais, vien anglies eksportas įvertintas 6 milijardais Australijos dolerių. Vietovėje yra arti 20 paplūdimių, išnaudojamų turizmui.\\nJau nuo 1823 metų miestas žinomas, labiau kaip miestas, o ne kalėjimas. Iki tol Niukaslas buvo vadinamas pragaru, dėl pačių pavojingiausių Anglijos kalinių."},{"page_url":"https://en.wikipedia.org/wiki/Antonio_Ambu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Antonio_Ambu.JPG","page_title":"Antonio Ambu","context_page_description":"Antonio Ambu is an Italian former long-distance runner who competed in the 1964 Summer Olympics and in the 1968 Summer Olympics."},{"page_url":"https://pl.wikipedia.org/wiki/Robert_Pattinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Robert_Pattinson_Comic-Con_2012.jpg","page_title":"Robert Pattinson","context_page_description":"Robert Douglas Thomas Pattinson – brytyjski aktor filmowy i teatralny oraz muzyk i kompozytor."},{"page_url":"https://en.wikipedia.org/wiki/Traditional_Vietnamese_musical_instruments","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/T%E1%BB%B3_b%C3%A0.jpg","page_title":"Traditional Vietnamese musical instruments","context_page_description":"Traditional Vietnamese musical instruments are the musical instruments used in the traditional and classical musics of Vietnam. They comprise a wide range of string, wind, and percussion instruments, used by both the Viet majority as well as the nation's ethnic minorities."},{"page_url":"https://en.wikipedia.org/wiki/Albrecht_Knaus_Verlag","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Hundstage_%28Walter_Kempowski%2C_1988%29.jpg","page_title":"Albrecht Knaus Verlag","context_page_description":"The Albrecht Knaus Verlag is a German publisher of fiction and nonfiction based in Munich. It was founded in 1978 and is now part of the Random House publishing group. The publisher became known mainly through the works of Walter Kempowski."},{"page_url":"https://hu.wikipedia.org/wiki/Jean-Paul_de_Lascaris-Castellar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Sudika_Wied_iz-Zurrieq_Tower_2.jpg","page_title":"Jean-Paul de Lascaris-Castellar","context_page_description":"Jean-Paul de Lascaris-Castellar francia johannita lovag, Manosque lovagja, a Jeruzsálemi Szent János Ispotályos Lovagrend 57. nagymestere volt. Különböző forrásokban Jean, Jean Baptiste és Juan keresztnévvel is feltűnik."},{"page_url":"https://pl.wikipedia.org/wiki/The_X_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Christina_Aguilera_The_X_Tour_03.jpg","page_title":"The X Tour","context_page_description":"The X Tour − europejsko-amerykańska trasa koncertowa amerykańskiej wokalistki Christiny Aguilery, przypadająca na okres od lipca do grudnia 2019 roku. Stanowi kontynuację tournée amerykańskiego − The Liberation Tour.\\nPoprzednio Aguilera koncertowała po Europie trzynaście lat wcześniej, w ramach Back to Basics Tour. The X Tour przeplatała się ponadto z rezydenturą wokalistki The Xperience, organizowaną w Las Vegas na przestrzeni czerwca, września i października 2019. Trasa składała się z osiemnastu występów, podzielonych na dwie serie. Objęła między innymi Wielką Brytanię, Niemcy, Francję, Irlandię oraz Meksyk."},{"page_url":"https://de.wikipedia.org/wiki/Gilbert_Brul%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Gilbert_Brule.jpg","page_title":"Gilbert Brulé","context_page_description":"Gilbert Jean Marco Brulé ist ein kanadischer Eishockeyspieler, der seit Mai 2019 erneut bei Kunlun Red Star in der Kontinentalen Hockey Liga unter Vertrag steht."},{"page_url":"https://no.wikipedia.org/wiki/Northeastern_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/NEU_Ell_Hall.jpg","page_title":"Northeastern University","context_page_description":"Northeastern University er et privat, forskningsbasert og ikke-kommersielt universitet i Fenway i Boston i delstaten Massachusetts, USA. Det ble grunnlagt i 1898 av YMCA, som «Evening Institute for Younger Men». Knytningen til YMCA ble opprettholdt til 1948.\\nVed Northeastern var det 20 605 studenter og 1 273 vitenskapelig ansatte i 2006. Samme år var skolepengene US$ 30 309 for alle studenter, også de fra delstaten. Studiene gis opp til doktorgradsnivå. På en rekke rangeringer er universitetets fagtilbud og campus rangert meget høyt, ikke minst gjelder dette arkitektur- og farmasistudiene.\\nDet såkalte Torch Scholars Program er et eget spesialprogram for ekstremt talentfulle studenter som velges ut etter flere runder med kvalifisering og seleksjon. I tillegg er det også et mer «ordinært» Honors Program som ved andre kvalitetsuniversiteter.\\nSkoler og colleges omfatter:\\nBouvé College of Health Sciences\\nCollege of Arts and Sciences\\nCollege of Business Administration\\nCollege of Computer and Information Science\\nCollege of Criminal Justice\\nCollege of Engineering\\nSchool of General Studies\\nSchool of Law\\nSchool of Professional and Continuing Studies"},{"page_url":"https://hu.wikipedia.org/wiki/E.ON","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Eon-Ruhrgas.jpg","page_title":"E.ON","context_page_description":"Az E.ON AG egy düsseldorfi székhelyű holding, a világ egyik legnagyobb nem állami tulajdonú áram- és gáztársasága. A cégcsoport elsősorban a földgáz- és a villamosenergia iparágakban tevékenykedik."},{"page_url":"https://de.wikipedia.org/wiki/Isdes","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/F-45620-La_mairie_et_l%27%C3%A9glise.JPG","page_title":"Isdes","context_page_description":"Isdes ist eine französische Gemeinde mit 549 Einwohnern im Département Loiret in der Region Centre-Val de Loire. Die Gemeinde gehört zum Arrondissement Orléans und ist Teil des Kantons Sully-sur-Loire. Die Einwohner werden Isdois genannt."},{"page_url":"https://en.wikipedia.org/wiki/Sugababes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Sugababes_GWR_Bristol.jpg","page_title":"Sugababes","context_page_description":"The Sugababes are a British girl group, composed of founding members Keisha Buchanan, Mutya Buena and Siobhán Donaghy. Formed in 1998 by All Saints manager Ron Tom, they released their debut album One Touch through London Records in November 2000, which achieved moderate success and spawned the top ten single \\"Overload\\". In 2001, Donaghy departed the group and was replaced by Heidi Range. With Range's introduction, the group began to experience a higher level of commercial success, going on to release three multi-platinum selling albums: Angels with Dirty Faces, Three and Taller in More Ways. In 2005, Buena announced her departure, leading to Amelle Berrabah being brought in to replace her. Following the release of their first greatest hits album, the new line-up released two further studio albums: Change and Catfights and Spotlights.\\nIn September 2009, after 11 years in the Sugababes, Buchanan, the final original member, was replaced by former UK Eurovision entry Jade Ewen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_high_schools_in_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Lowell_High_School_%28Lowell%2C_Oregon%29.jpg","page_title":"List of high schools in Oregon","context_page_description":"This is a list of high schools in the U.S. state of Oregon. Schools are listed in alphabetical order by city, then in alphabetical order by school name. Schools that have closed are listed separately."},{"page_url":"https://en.wikipedia.org/wiki/Obsolete_denominations_of_United_States_currency","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/1855_cent_obv.jpg","page_title":"Obsolete denominations of United States currency","context_page_description":"The United States has produced several coins and banknotes of its dollar which no longer circulate or have been disused. Many of these were removed for specific reasons such as inflation reducing their value, a lack of demand, or being too similar to another denomination."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_%D0%91%D1%8E%D1%80%D0%BA%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Roman_B%C3%BCrki_%28August_2014%29.jpg","page_title":"Роман Бюрки","context_page_description":"Роман Бюрки — Швейцарын хөлбөмбөгчин, Германы «Боруссиа Дортмунд» болон Швейцарын шигшээн хаалгач.\\n«Фрайбург» Бюркийг 2014 оны тавдугаар сарын 24-нд элсүүлжээ. Хоёрдугаар хаалгачаар байсхийж байгаад Оливер Бауманныг «Хоффенхаймд» одоход үндсэн болж дэвшсэн юм.\\n2015 оны зургадугаар сарын 14-нд On 14 «Боруссиа Дортмундтай» гэрээлсэн.\\n2014 оны арваннэгдүгээр сарын 19-нд Польш, Швейцари нөхөрсөг тоглоход Бюрки 90 минутаар анхны гараагаа хийж байв."},{"page_url":"https://ca.wikipedia.org/wiki/Conca_d%27Arcaishon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Arcachon1Copier.JPG","page_title":"Conca d'Arcaishon","context_page_description":"La Conca d'Arcaishon és una badia de la costa occidental de França, oberta a l'oceà Atlàntic en el golf de Biscaia, en un tram de la Costa d'Argent entre les ciutats de la Tèsta de Buc al sud, i Lèja e lo Horet, al nord. Administrativament, està situada a la regió d'Aquitània dins el departament de la Gironda.\\nConforma un veritable petit mar interior de 155 km² en marea alta i 40 km² en marea baixa, amb més de 80 km de bancs de sorra, platges i dunes."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9C%E0%A5%82%E0%A4%B9%E0%A5%80_%E0%A4%AA%E0%A4%B0%E0%A4%AE%E0%A4%BE%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Juhi_parmar_at_vikas%27s_wedding.jpg","page_title":"जूही परमार","context_page_description":"जूही परमार एक भारतीय फ़िल्म अभिनेत्री हैं, जिन्हें टेलिविजन की दुनिया में कुमकुम के नाम से भी जाना जाता है। जुही एक बहुमुखी कलाकार के रूप में जानी जातीं हैं। वे मशहूर धारावाहिक बिग बॉस की विजेता भी रह चुकीं हैं।"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%8A%D9%86%D8%A7_%D8%A7%D9%83%D9%8A%D8%AA%D9%88%D9%81%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tina_Acketoft.jpg","page_title":"تينا اكيتوفت","context_page_description":"تينا اكيتوفت سياسيه من السويد."},{"page_url":"https://es.wikipedia.org/wiki/Notaci%C3%B3n_cient%C3%ADfica","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Hex182.gif","page_title":"Notación científica","context_page_description":"La notación científica, también denominada patrón o notación en forma exponencial, es una forma de escribir los números que acomoda valores demasiado grandes o pequeños como puede ser el siguiente ​para ser escrito de manera convencional.​​ El uso de esta notación se basa en potencias de 10​. El módulo del exponente en el caso anterior es la cantidad de ceros que lleva el número delante, en caso de ser negativo, o detrás, en caso de tratarse de un exponente positivo.\\nSiempre el exponente es igual al número de cifras decimales que deben correrse para convertir un número escrito en notación científica en el mismo escrito en notación decimal. Se desplazará a la derecha si el exponente es positivo y hacia la izquierda si es negativo. Cuando se trata de convertir un número a notación científica el proceso es a la inversa. ​\\nComo ejemplo, en la química, al referirse a la cantidad de entidades elementales, hay una cantidad llamada cantidad de materia.​\\nUn número escrito en notación científica sigue el siguiente patrón:\\nEl número m se denomina «mantisa» y e el «orden de magnitud».​"},{"page_url":"https://es.wikipedia.org/wiki/Cozzano","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Map_commune_FR_insee_code_2A099.png","page_title":"Cozzano","context_page_description":"Cozzano es una comuna francesa del departamento de Córcega del Sur, en la colectividad territorial de Córcega."},{"page_url":"https://hu.wikipedia.org/wiki/Beaufort_(Haute-Garonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Beaufort_entree.jpg","page_title":"Beaufort (Haute-Garonne)","context_page_description":"Beaufort település Franciaországban, Haute-Garonne megyében. Beaufort Sainte-Foy-de-Peyrolières, Montgras, Rieumes és Sabonnères községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Bill_Logan_(basketball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Bill_Logan_Iowa.jpg","page_title":"Bill Logan (basketball)","context_page_description":"William Logan was an American basketball player. He is best known for his college career at the University of Iowa.\\nLogan came to the Iowa Hawkeyes from Keokuk High School in Keokuk, Iowa, where he was an All-State player. As a Hawkeye, Logan was a part of what would become one of the school's top recruiting classes, the “Fabulous Five”. The group started for three seasons, taking the school to its first two Final Fours in 1955 and 1956.\\nLogan was named first-team All-Big Ten Conference as a junior and senior, And in his senior season set an Iowa career scoring mark with 1,188 points.\\nFollowing his college career, Logan was drafted by the Boston Celtics of the National Basketball Association. He chose to enter business, playing one season for the Denver-Chicago Truckers in the Amateur Athletic Union before returning to the state of Iowa to enter banking. He died on January 25, 2018 at the age of 83."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%82%D0%B8%D1%87%D1%98%D0%B5_%D0%B3%D0%BD%D0%B5%D0%B7%D0%B4%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Jungstoerche_2010_Hedeper_Germany.JPG","page_title":"Птичје гнездо","context_page_description":"Птичје гнездо — местото каде птицата ги несе и квачи јајцата и каде ги одгледува младенчињата. Иако терминот популарно се однесува на структури изградени од птиците, обично на дрво или на стреите од куќите, или како висечки формации, сепак, под птичје гнездо се подразбира секое место каде птиците ги несат своите јајца. Зашто, за некои видови гнездо е проста дупка во песокта, за други дупка во дрво, за трети огромен куп вегетација на земјата итн.\\nНајмали птичји гнезда се оние на колибрите, кои се како малечки шољички со димензии 2 см широки и 2-3 см длабоки. Другиот екстрем е гнездото на птица од редот на кокошковидните Megapodius freycinet чие гнездо во дијаметар има 11 метри, а е високо 5 метри.\\nВо повеќето случаи гнездото го градат женките, а материјалот за градење го носат мажјаците. Гнездото е понекогаш многу примитивна, а понекогаш многу сложена архитектонска творба, која следи однапред утврдени, но сè уште недоволно истражени законитости.\\nЕден вид ластовичји гнезда од подрачјето на Азија е познат како многу скап специјалитет во Кина. Го градат ластовиците Aerodramus fuciphagus и Aerodramus maximus на тешко достапни, карпести терени."},{"page_url":"https://simple.wikipedia.org/wiki/La_Trinit%C3%A9,_Alpes-Maritimes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Blason_ville_fr_La_Trinit%C3%A9_%28Alpes-Maritimes%29.svg","page_title":"La Trinité, Alpes-Maritimes","context_page_description":"La Trinité, Alpes-Maritimes is a commune. It is found in the region Provence-Alpes-Côte d'Azur in the Alpes-Maritimes department in the south of France."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D1%8C-%D0%9C%D1%83%D1%82%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Champagne-Mouton_-_%C3%A9glise_Saint_Michel.jpg","page_title":"Шампань-Мутон","context_page_description":"Шампа́нь-Муто́н — коммуна во Франции, находится в регионе Пуату — Шаранта. Департамент — Шаранта. Главный город кантона Шампань-Мутон. Округ коммуны — Конфолан.\\nКод INSEE коммуны — 16076.\\nКоммуна расположена приблизительно в 350 км к юго-западу от Парижа, в 70 км южнее Пуатье, в 45 км к северо-востоку от Ангулема."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_Luksemburga","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/MamerThermen01.jpg","page_title":"Historia Luksemburga","context_page_description":"Historia Luksemburga – niewielkiego państwa, położonego pomiędzy Francją, Niemcami i Belgią – sięga X w. Kolejni jego władcy, zaczynając od niewielkiego skrawka ziemi wokół skały luksemburskiej, stopniowo poszerzali granice hrabstwa, położonego w zachodniej części Świętego Cesarstwa Rzymskiego. Sukces osiągnął Henryk VII Luksemburski, który na początku XIV w. został królem niemieckim i świętym cesarzem rzymskim. Dzięki temu jego następcy sięgnęli po trony Czech i Węgier, stopniowo jednak zaniedbali niewielkie hrabstwo, z którego się wywodzili, choć podnieśli je do rangi księstwa w 1354. Było ono zastawiane, a po wygaśnięciu rodu Luksemburgów przechodziło z rąk do rąk. Ostatecznie trafiło pod koniec XV w. w ręce Habsburgów, w których pozostało kolejne trzy stulecia, od 1556 należąc do hiszpańskiej linii rodu, a od 1714 do 1795 do austriackiej. Luksemburg stał się wówczas strategicznym punktem na granicy wpływów Habsburgów i królów Francji, a jego stolica została zmieniona w potężną twierdzę. Znalazł się on w granicach Francji w epoce wielkiej rewolucji francuskiej i rządów Napoleona Bonaparte."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Eringerfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Schloss_Eringerfeld_an_der_Steinhauser_Stra%C3%9Fe_im_Stadtteil_Eringerfeld_der_Stadt_Geseke_im_Kreis_Soest_in_Nordrhein-Westfalen_B.JPG","page_title":"Schloss Eringerfeld","context_page_description":"Das Schloss Eringerfeld liegt im gleichnamigen Ort Eringerfeld in Ostwestfalen. Es wurde im Jahr 1676 als Barockschloss erbaut und diente dem westfälischen Adelsgeschlecht von Hörde als Wohnsitz."},{"page_url":"https://da.wikipedia.org/wiki/Fyrresl%C3%A6gten","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Pino_Monserrato.JPG","page_title":"Fyrreslægten","context_page_description":"Fyrreslægten er en stor slægt med ca. 100 arter af nåletræer. Alle arter er stedsegrønne og slægten er udbredt fra trægrænsen i Nordnorge til sandområder i den tropiske zone. Slægten kendes på, at nålene sidder i bundter på dværgskud. Der kan være 2, 5 eller 3 nåle i hvert bundt. De hårde kogler er enten tøndeformede eller meget slanke og bananformede."},{"page_url":"https://en.wikipedia.org/wiki/Latvian_National_Guard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Latvian_Army_Volvo_C303.jpg","page_title":"Latvian National Guard","context_page_description":"The Latvian National Guard or NG is a part of the Latvian National Armed Forces. The National Guard is a basic land component, consisting of volunteers who perform traditional national guard duties such as crisis response and support for military operations. It consists of the Staff Headquarters and 4 brigades, which are divided into 18 battalions. The National Guard continued its development also after Latvia joined NATO."},{"page_url":"https://it.wikipedia.org/wiki/Ghiacciaio_Argosy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/C83165s1_Ant.Map_Mount_Rabot.jpg","page_title":"Ghiacciaio Argosy","context_page_description":"Il ghiacciaio Argosy è un ghiacciaio tributario lungo circa 30 km situato nella regione meridionale della Terra di Oates, nell'Antartide orientale. Il ghiacciaio, il cui punto più alto si trova a circa 2200 m slm, si trova in particolare nelle montagne di Miller, nell'entroterra della costa di Shackleton, dove ha origine direttamente dall'Altopiano Antartico e fluisce verso est-nord-est, dividendo in due la catena montuosa e costeggiando il versante meridionale delle cime Aurora, fino a unire il proprio flusso, a cui lungo il percorso si è unito quello del ghiacciaio Ascent, a quello del ghiacciaio Marsh, a nord della mesa di Kreiling."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%89%BE%E5%A1%9E%E5%85%8B%E6%96%AF%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/University_of_essex_library_2005_05_25.jpg","page_title":"艾塞克斯大學","context_page_description":"艾塞克斯大學是位於英國艾塞克斯郡高車士打和威文霍鎮的一所綜合性大學。"},{"page_url":"https://fr.wikipedia.org/wiki/Waterberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Heteropyxis_natalensis01.jpg","page_title":"Waterberg","context_page_description":"Le Waterberg est un massif situé au nord-est de l'Afrique du Sud dans la province du Limpopo. Depuis 2001, le Waterberg comprend une réserve de biosphère au sens de l'UNESCO, de 6 540 km². Son altitude moyenne est de 600 m ; quelques sommets dépassent 1 400 m. Cette vaste formation rocheuse a été façonnée par des centaines de millions d'années d'érosion fluviale qui ont créé divers reliefs escarpés ou en forme de buttes. L'écosystème est celui d'une forêt caduque sèche. Le Waterberg a livré des traces archéologiques datant de l'âge de pierre et, à proximité, ont été faites des découvertes relatives aux premiers instants de l'histoire de l'évolution humaine.\\nLa ville de Vaalwater est située dans le nord du massif."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%8A%E3%82%BF%E3%83%8F%E3%83%B3%E3%81%AE%E5%A5%B3%E7%8E%8B%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Small_boat_approaches_Anatahan_in_June_1950.jpg","page_title":"アナタハンの女王事件","context_page_description":"アナタハンの女王事件とは1945年から1950年にかけて太平洋マリアナ諸島に位置する孤島アナタハン島で発生し、多くの謎を残した複数の男性の怪死事件。別名「アナタハン事件」「アナタハン島事件」。"},{"page_url":"https://tr.wikipedia.org/wiki/Karboksilat","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Carboxylate-resonance-hybrid.png","page_title":"Karboksilat","context_page_description":"Karboksilat karboksilik asitin bir tuzu veya esteri. Karboksilat tuzlar, M'in bir metal ve n 'in 1, 2, .... gibi sayıları ifade ettiği, Mₙ genel formülü ile ifade edilir. Karboksilat esterler RCOOR′ genel formülüne sahiptir. R ve R′ organik gruplardır; R′ ≠ H.\\nKarboksilat iyonu karboksilik asitin konjuge bazıdır. Negatif yüklü bir iyondur."},{"page_url":"https://sk.wikipedia.org/wiki/S%C3%BAkromn%C3%A1_stredn%C3%A1_odborn%C3%A1_%C5%A1kola_DSA_Trebi%C5%A1ov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Symbol_spolo%C4%8Dnosti_DSA.png","page_title":"Súkromná stredná odborná škola DSA Trebišov","context_page_description":"Súkromná stredná odborná škola DSA Trebišov je súčasťou školskej siete slovenskej vzdelávacej spoločnosti Deutsch-Slowakische Akademien od roku 2015, kedy došlo k zmene zriaďovateľa školy z VÚC na spoločnosť DSA. DSA patrí do portfólia nemeckej firmy Europäisches Bildungswerk für Beruf und Gesellschaft, ktorá v Nemecku prevádzkuje 36 škôl a vzdelávacích centier. Vďaka silnému nemeckému partnerovi s dlhoročnými skúsenosťami v oblasti vzdelávania, bol nový zriaďovateľ schopný od prebratia školy implementovať mnoho inovatívnych postupov v oblasti vzdelávania a zároveň došlo k zlepšeniu situácie aj v iných oblastiach ako obnova majetku školy, modernizácia technického vybavenia či diverzifikácia a optimalizácia ponúkaných študijných odborov.\\nRiaditeľom školy je Mgr. Miroslav Tóth."},{"page_url":"https://en.wikipedia.org/wiki/2015_Singapore_Grand_Prix","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Vettel_Singapore_2015_hand.jpg","page_title":"2015 Singapore Grand Prix","context_page_description":"The 2015 Singapore Grand Prix was a Formula One motor race held on 20 September 2015 at the Marina Bay Street Circuit in Marina Bay, Singapore. The race was the thirteenth round of the 2015 season. It was the eighth time the race was run as a round of the Formula One World Championship.\\nDefending race winner Lewis Hamilton of Mercedes entered as the leader in the World Drivers' Championship with 252 points, 53 points ahead of teammate Nico Rosberg and 74 points ahead of Ferrari's Sebastian Vettel. Mercedes came into the race leading the Constructors' Championship by 181 points ahead of Ferrari, with Williams a further 82 points back in third place.\\nVettel won the race from pole position, ahead of Red Bull's Daniel Ricciardo in second and Vettel's Ferrari teammate Kimi Räikkönen in third. The Mercedes team struggled at Singapore; Lewis Hamilton recorded his first retirement of the season, while Nico Rosberg managed only fourth place, closing the gap in the championship to 41 points.\\nIt was the only occasion in 2015 where neither of the Mercedes cars started on the front row for a race, and was the only time that a team other than Mercedes secured pole position."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%87%E0%B8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Snakes_Diversity.jpg","page_title":"งู","context_page_description":"งู เป็นสัตว์เลื้อยคลานอันดับหนึ่ง ไม่มีขา ไม่มีเปลือกตา มีเกล็ดปกคลุมผิวหนังทั่วทั้งลำตัว ลักษณะลำตัวยาวซึ่งโดยขนาดของความยาวนั้น จะขึ้นอยู่กับชนิดของงู ปราดเปรียวและว่องไวในการเคลื่อนที่ มีลิ้นสองแฉกเพื่อใช้สำหรับรับความรู้สึกทางกลิ่น จัดอยู่ในชั้น Reptilia, ตระกูล Squamata, ตระกูลย่อย Serpentes โดยทั่วไปแล้วงูจะกลัวและไม่กัด นอกเสียจากถูกรบกวนหรือบุกรุก จะเลื้อยหลบหนีเมื่อมีสิ่งใดเข้ามาใกล้บริเวณที่อยู่ ออกล่าเหยื่อเมื่อรู้สึกหิว โดยกินสัตว์เลี้ยงลูกด้วยนมขนาดเล็กเป็นอาหาร ยกเว้นงูบางชนิดที่กินงูด้วยกันเอง เช่น งูจงอาง สามารถมองเห็นได้ดีในที่มืดและในเวลากลางคืน\\nโดยทั่วไปจะออกลูกเป็นไข่ ยกเว้นแต่งูที่มีพิษซึ่งมีผลโดยตรงทางด้านโลหิต ซึ่งจะออกลูกเป็นตัว เช่น งูแมวเซา ธรรมชาติโดยทั่วไป งูจะลอกคราบเมื่อมันเริ่มโตขึ้น ทำให้ผิวหนังของงูเริ่มแข็งและคับขึ้น ซึ่งงูจะลอกคราบบ่อยครั้งเมื่องูยังมีอายุไม่มากนัก ซึ่งภายหลังจากการลอกคราบของงู จะทำให้ผิวหนังเก่าหลุดออก แต่เซลล์สีที่ทำให้งูมีสีสันยังคงอยู่ในตัวงู ทำให้เกล็ดที่ปกคลุมผิวหนัง มีสีสันสดใสรวมทั้งทำให้เคลื่อนไหวร่างกายได้อย่างรวดเร็ว"},{"page_url":"https://nl.wikipedia.org/wiki/Joop_Falke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Hanger%2C_in_zilver%2C_met_schelp.jpg","page_title":"Joop Falke","context_page_description":"Joop Falke was een Nederlandse beeldend kunstenaar en edelsmid."},{"page_url":"https://en.wikipedia.org/wiki/Warrington_Bank_Quay_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Cafe_shop%2C_Warrington_Bank_Quay_railway_station_%28geograph_4020016%29.jpg","page_title":"Warrington Bank Quay railway station","context_page_description":"Warrington Bank Quay railway station is one of two railway stations serving the town centre of Warrington in Cheshire, England. Warrington Bank Quay is a north-south oriented mainline station on one side of the main shopping area, with the west-east oriented Warrington Central on the other side to the north west operating a more frequent service to the neighbouring cities of Liverpool and Manchester. Cheshire Cat Buses are operated from the station into Warrington Bus Interchange and in the opposite direction to the Centre Park business park, Stockton Heath and further south into Cheshire. The station is directly on the West Coast Main Line."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%88%90%E7%8F%A0%E6%A8%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Sing_Chu_Bang_Ka.JPG","page_title":"成珠樓","context_page_description":"成珠樓喺廣州河南漱珠橋畔漱珠東市5號（海珠區南華中路180、209號），係清乾隆十一年（1746年）開張嘅一間茶樓，亦係雞仔餅嘅發源地。招牌嘢食有成珠小鳳餅、奇味金豬手同創新伍仁月。\\n1985年10月9號，成珠樓火燭燒通頂；第年重建，改名成珠酒家。2002年，東江集團買落，改名鴻星海鮮酒家。2006年3月1號停業無耐拆咗。由民國後期到佢拆之前，都重係廣州尚存嘅最耐歷史嘅茶樓。"},{"page_url":"https://hu.wikipedia.org/wiki/Szinpetri","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/BAZ1.Szinpetri.jpg","page_title":"Szinpetri","context_page_description":"Szinpetri község Borsod-Abaúj-Zemplén megyében, az Edelényi járásban. Egykor Torna vármegyéhez tartozott."},{"page_url":"https://en.wikipedia.org/wiki/Augusta_D%C3%A9jerine-Klumpke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Augusta_and_Jacqueline_Dejerine-Klumpke.jpg","page_title":"Augusta Déjerine-Klumpke","context_page_description":"Augusta Déjerine-Klumpke was an American-born French medical doctor known for her work in neuroanatomy. She was the first female intern to work in a hospital in Paris.\\nFrom a young age, Klumpke's family was supportive of her medical ambitions, going as far as to move to Paris so she and her sisters Anna Elizabeth Klumpke, Julia Klumpke, and Dorothea Klumpke could follow their pursuits. Despite facing scorn for being a woman in the medical field, she continued working on her medical studies both inside and outside the classroom, going as far as to work at laboratories at the Muséum d'Histoire Naturelle. She eventually went on to gain a reputation for her skills in the medical field and linguistically being able to speak both English and German. This led to her, along with Blanche Edwards-Pillet, being the first women externs in Paris Hospitals.\\nDuring this time period, she explained what is today called Klumpke paralysis, or an injury to the nerves controlling arm movement. She worked under Alfred Vulpian, the dean at her former medical school who had opposed her attending medical school since she was both a woman and quite young at the time."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BB_%D1%81%D0%B8%D1%80_%D0%9D%D0%B8%D1%98%D0%B5%D0%B2%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%C3%89glise_de_La_Celle-sur-Ni%C3%A8vre.JPG","page_title":"Сел сир Нијевр","context_page_description":"Сел сир Нијевр је насеље и општина у источном делу централне Француске у региону Бургоња, у департману Нијевр која припада префектури Кон Кур сир Лоар.\\nПо подацима из 2011. године у општини је живело 167 становника, а густина насељености је износила 12,9 становника/km². Општина се простире на површини од 12,95 km². Налази се на средњој надморској висини од 220 метара."},{"page_url":"https://es.wikipedia.org/wiki/Tratado_de_Perpi%C3%B1%C3%A1n_(1473)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Forteresse_de_Salses_cour_interieure.jpg","page_title":"Tratado de Perpiñán (1473)","context_page_description":"El tratado de Perpiñán de 1473 fue un tratado de paz firmado en Perpiñán el 17 de septiembre de ese año entre los representantes de Luis XI de Francia y de Juan II de Aragón que puso momentáneamente fin al conflicto por la posesión de los condados de Rosellón y de Cerdaña volviendo en gran medida a lo establecido en el Tratado de Bayona de 1462 ―se reconocía la soberanía de Juan II sobre los condados pero este no podría ejercer su autoridad sobre ellos hasta que no satisficiera el pago a Luis XI de 300.000 escudos por la ayuda militar que le había prestado en los inicios de la guerra civil catalana, especialmente en la liberación del asedio de la Força Vella de Gerona―."},{"page_url":"https://fr.wikipedia.org/wiki/Verde_Canyon_Railroad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Verde_Canyon_Railroad_engines.jpg","page_title":"Verde Canyon Railroad","context_page_description":"Le Verde Canyon Railroad est un chemin de fer reliant en 4 heures Clarkdale à Perkinsville dans l'Arizona en parcourant la Verde et en passant par les forêts nationales de Prescott et de Coconino. Il transporte environ 100 000 passagers par an."},{"page_url":"https://hu.wikipedia.org/wiki/Nagyhajm%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Nagyhajm%C3%A1s-ev.JPG","page_title":"Nagyhajmás","context_page_description":"Nagyhajmás község Baranya megyében, a Hegyháti járásban."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%B1%DB%8C%DA%AF_%D9%BE%D8%A7%D8%B1%DA%A9%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Craig_Parker.jpg","page_title":"کریگ پارکر","context_page_description":"کریگ پارکر یک هنرپیشه نیوزلندی می‌باشد.\\nوی که از سال ۱۹۸۷ تا هم‌اکنون در این صنعت فعال بوده، در ۶ فیلم سینمایی بازی کرده‌است.\\nاو بیشتر به خاطر ایفا کردن نقش‌های هالدیر در ارباب حلقه‌ها: یاران حلقه و ارباب حلقه‌ها: دو برج، راهل سیاه در افسانه‌ی جستجوگر و گایوس کلادیوس گالبر در اسپارتاکوس مشهور است."},{"page_url":"https://it.wikipedia.org/wiki/Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Slccapitol.jpg","page_title":"Utah","context_page_description":"Lo Utah è uno stato federato degli Stati Uniti. Viene tradizionalmente collocato nella regione del sudovest e talvolta in quella delle montagne rocciose degli Stati Uniti d'America. Lo Utah è il 13° più ampio, il 30° più popoloso e il 10° meno densamente popolato dei 50 Stati degli Stati Uniti. Lo Stato ha una popolazione di 3.205.958 abitanti, circa l'80% dei quali vivono lungo il Fronte Wasatch, incentrato su Salt Lake City, lasciando vaste aree dello Stato quasi disabitate. Lo Utah confina con il Colorado a est, il Wyoming a nord-est, l'Idaho a nord, l'Arizona a sud, e il Nevada a ovest. Tocca anche un angolo del Nuovo Messico a sud-est. È diventato il 45º stato ammesso all'Unione il 4 gennaio 1896.\\nLo Utah è lo Stato religiosamente più omogeneo dell'Unione. Circa il 62% degli abitanti dello Utah è stato riportato essere membro della Chiesa di Gesù Cristo dei Santi degli Ultimi Giorni corrente maggioritaria dei Mormoni, che influenza notevolmente la cultura dello Utah e la vita quotidiana. La sede mondiale della Chiesa si trova nella capitale dello Stato, Salt Lake City."},{"page_url":"https://lt.wikipedia.org/wiki/G4S_Lietuva","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Verslo_trikampis.jpg","page_title":"G4S Lietuva","context_page_description":"G4S Lietuva – didžiausia apsaugos kompanija Lietuvoje, priklausanti Didžiojoje Britanijoje įsikūrusiam koncernui G4S plc. Bendrovė teikia paslaugas 24 Lietuvos miestuose: Vilniuje, Kaune, Klaipėdoje, Šiauliuose, Panevėžyje, Alytuje, Marijampolėje, Mažeikiuose, Visagine, Ignalinoje, Elektrėnuose, Tauragėje, Kėdainiuose, Jonavoje, Kaišiadoryse, Birštone, Prienuose, Druskininkuose, Vilkaviškyje, Kybartuose, Gargžduose, Kretingoje, Palangoje, Šventojoje."},{"page_url":"https://simple.wikipedia.org/wiki/Abhurite","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Abhurite_-_Shipwreck_Hydra%2C_South_coast_of_Norway.jpg","page_title":"Abhurite","context_page_description":"Abhurite is a colorless crystalline mineral that forms on ship-wrecked tin ingots. It is named for where it is found. It is found in a cove in the Red Sea. It is not radioactive."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%82%B0%E3%82%B8%E3%83%A5%E3%82%A2%E3%83%AA%E3%83%BC%E3%82%AB%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Chrysler_300c_dub_custom.jpg","page_title":"ラグジュアリーカー","context_page_description":"ラグジュアリーカーとは、もともとは豪華さを備えた、いわゆる高級車のことである。しかしそこから転じて、主として高級車とされる車両に独自のセンスでさらに高級感を演出しようとするカスタム手法を施した改造車のことも指す。\\n本稿では、改造車としてのラグジュアリーカーについて述べる。"},{"page_url":"https://fi.wikipedia.org/wiki/Nhacra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Oio_sectors.png","page_title":"Nhacra","context_page_description":"Nhacra on kaupunki sekä osa-alue eli sektori Oion alueella Guinea-Bissaussa. Se sijaitsee Geba- ja Mansoajokien välisellä kannaksella 80 kilometriä Farimista lounaaseen. Kaupungissa on 1 669 ja osa-alueella 20 639 asukasta.\\nNhacran osa-alueen pinta-ala on 265,3 neliökilometriä. Kaupunkiväestön osuus on 8,1 %."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Kremitzaue","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Gutshaus_Polzen_Kremnitzaue.jpg","page_title":"Liste der Baudenkmale in Kremitzaue","context_page_description":"In der Liste der Baudenkmale in Kremitzaue sind alle Baudenkmale der brandenburgischen Gemeinde Kremitzaue und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019."},{"page_url":"https://de.wikipedia.org/wiki/Heinz_Anger","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Leonie_Rysanek%2C_H_Anger_1962.jpg","page_title":"Heinz Anger","context_page_description":"Heinz Anger ist ein österreichischer Maler."},{"page_url":"https://en.wikipedia.org/wiki/1995_Plymouth_City_Council_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Keyham_ward_in_Plymouth_1979.svg","page_title":"1995 Plymouth City Council election","context_page_description":"The 1995 Plymouth City Council election took place on 4 May 1995 to elect members of Plymouth City Council in Devon, England. This was on the same day as other local elections. The Labour Party retained control of the council, which it had gained from the Conservative Party at the previous election in 1991."},{"page_url":"https://eu.wikipedia.org/wiki/Angkor_Wat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/West_wall_of_the_outer_enclosure_Angkor_Wat0636.jpg","page_title":"Angkor Wat","context_page_description":"Angkor Wat Kanbodian dagoen XII. mendeko tenplu hinduista eta ondoren budista da, antzinako Angkor hiriburuan eraikia eta munduko monumentu erlijiosorik handientzat jotzen dena. Tenplua Suryavarman II.a Khmer erregeak eraiki zuen Yasodharapuran, Khmer inperioaren hiruburuan, estatuko tenplu garrantzitsuena izateko helburuarekin eta, ondoren, bere mausoleoa. Aurreko agintariak Shivaistak ziren, baina Angkor Waten pertsonaia garrantzitsuena Vishnu da. Angkor gunean dauden tenpluetatik egoera onena duena da, eta horregatik denboran zehar aktibitate erlijioso garrantzitsua izan du, lehenengo hinduentzat eta, ondoren, budismoarentzat. Tenpluak khmer arkitekturaren garairik loriatsuenaren adibide gorena da. Kanbodiako ikur bilakatu da, Kanbodiako banderan agertzeraino, eta herrialdeko atrakzio turistiko nagusia da.\\nAngkor Watek khmer arkitekturako bi oinarrizko planoak ditu bere baitan: galeriadun tenplua eta mendi-tenplua, dravidiar arkitekturan oinarritua, Jagati bezalako elementu garrantzitsuekin. Meru mendiaren errepresentazioa litzateke, mitologia hinduan deven etxea: kanpoko babes erreten batez inguratuta lehenengo harresiak ditu, guztira 3,6 kilometroko perimetroarekin."},{"page_url":"https://es.wikipedia.org/wiki/Annette_Hess","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Drehbuchautorin_Annette_Hess.jpg","page_title":"Annette Hess","context_page_description":"Annette Hess es una escritora y guionista alemana. Estudió pintura en la escuela de Artes Visuales y posteriormente se licenció en Escritura Escénica en la Universidad de las Artes de Berlín.​ Ha trabajado como periodista, asistente de dirección y guionista. Desde 1998 escribe fundamentalmente para cine y televisión.​\\nComo creadora, está especializada en el pasado reciente de Alemania.​ Su serie de televisión Weissensee, enmarcada en la antigua RDA, fue la primera serie alemana que causó sensación fuera de su país. Repitió éxito con dos miniseries ambientadas unos años después de la Segunda Guerra Mundial, Ku’damm 56 y Ku’damm 59.​\\nSu labor ha merecido numerosos galardones nacionales e internacionales, entre otros el Grimme-Preis, el más prestigioso premio alemán para profesionales de la televisión. En la actualidad vive en el estado de Baja Sajonia.\\nComo escritora debutó con La casa alemana ​​​, convertida en un fenómeno internacional ya antes de su publicación al cederse los derechos para su traducción en Estados Unidos, Francia, Italia o Suecia entre otros, y copando las listas de los libros más vendidos en países como España, Chile o Colombia."},{"page_url":"https://eu.wikipedia.org/wiki/Yon_Etxaide","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Yon_etxaide.jpg","page_title":"Yon Etxaide","context_page_description":"Yon Etxaide Itharte euskal idazle oparoa izan zen, hainbat alor jorratu zituena. \\"Karranka\\", \\"Uarrain\\", \\"Etxaithar\\", \\"Aldapeko\\", \\"Zelai\\", \\"Igeldo\\" ezizenak erabili zituen."},{"page_url":"https://es.wikipedia.org/wiki/Labeo_ansorgii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Labeo_ansorgii_2.png","page_title":"Labeo ansorgii","context_page_description":"Labeo ansorgii es una especie de peces de la familia de los Cyprinidae en el orden de los Cypriniformes."},{"page_url":"https://ro.wikipedia.org/wiki/Cristina_V%C4%83rzaru","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Christina_V%C3%A1rzaru_25.04.2009.jpg","page_title":"Cristina Vărzaru","context_page_description":"Cristina Georgiana Vărzaru este o fostă jucătoare de handbal și fost căpitan al echipei naționale de handbal feminin a României. Ultima echipă la care a jucat a fost CSM București.\\nAnterior, handbalista a jucat la campioana Danemarcei Viborg HK, cu care avea contract inclusiv în sezonul 2012-2013. Totuși, Vărzaru a semnat, în decembrie 2011, un precontract cu echipa românească din Divizia A Terom-Z Iași. Condiția transferului ei la clubul ieșean ar fi fost promovarea în Liga Națională, însă, în februarie 2012, Cristina Vărzaru a declarat că această precondiție nu mai există, anunțându-și clubul danez că renunță la ultimul an de contract.\\nPreședintele Terom Z Iași, Florin Zamfir, a declarat că: „Începând cu 1 august 2012, Cristina Vărzaru va fi jucătoarea noastră. Avem deja precontract cu căpitanul echipei naționale a României, iar contractul va fi semnat pe o perioadă de un an, cu opțiune de prelungire pe încă unul”. La echipa ieșeană Cristina ar fi fost coechipieră cu prietena și fosta ei colegă Carmen Amariei."},{"page_url":"https://es.wikipedia.org/wiki/Modelado_de_desempe%C3%B1o_de_pavimento","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Raised_pavement_marker.jpg","page_title":"Modelado de desempeño de pavimento","context_page_description":"El modelado del rendimiento del pavimento es el estudio del deterioro del pavimento a lo largo de su ciclo de vida.​​ La salud del pavimento se evalúa utilizando diferentes indicadores de desempeño. Algunos de los indicadores de rendimiento más conocidos son el índice de condición del pavimento, el índice de rugosidad internacional y el índice de capacidad de servicio actual. Entre los métodos más utilizados para modelar el rendimiento del pavimento se encuentran los modelos mecanicistas, mecanicista-empíricos, ​ curvas de supervivencia y modelos de Markov. Recientemente, los algoritmos de aprendizaje automático también se han utilizado para este propósito.​​"},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_Tyszkiewicz%C3%B3w_w_Po%C5%82%C4%85dze","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Palanga_Palac_Tyszkiewiczow.JPG","page_title":"Pałac Tyszkiewiczów w Połądze","context_page_description":"Pałac Tyszkiewiczów w Połądze – pałac wzniesiony pod koniec XIX wieku w stylu neorenesansowym dla rodziny Tyszkiewiczów, od 1963 mieści Muzeum Bursztynu w Połądze.\\nRezydencja została zbudowana w stylu neorenesansu z elementami klasycyzmu i baroku w latach 1893-97 przez Franza Heinricha Schwechtena na zlecenie hrabiego Feliksa Tyszkiewicza - zastąpiła drewniany pałacyk położony nad brzegiem rzeki Rąžė.\\nW 1900 roku obok pałacu postawiono figurę Jezusa Chrystusa, która do dziś jest charakterystycznym elementem pałacowego krajobrazu, mimo że w czasach Związku Radzieckiego została zburzona. Na początku XX wieku obok pałacu powstała mała kapliczka, również zaprojektowana przez Schwechtena.\\nPałacowe ogrody rozplanował francuski architekt Édouard André wraz z synem - część starych drzew wycięto, by zasadzić nowe, często zupełnie egzotyczne plantacje. Nie obyło się bez kontrowersji, bo na Żmudzi stare drzewostany uważane były za świętość.\\nPlanom rozbudowy założenia pałacowego stanął na drodze wybuch I wojny światowej - w wyniku niemieckiego nalotu bombowego zostało zniszczone główne skrzydło budynku."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AB%D9%8A%D8%B1%D9%89_%D9%85%D8%A7%D8%B1%D9%8A%D8%A7%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Thierry.Mariani.jpg","page_title":"ثيرى ماريانى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nثيرى ماريانى سياسى من فرنسا."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%8D%E0%A6%AB%E0%A6%BF%E0%A6%82%E0%A6%95%E0%A7%8D%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/The_Great_Pyramid_and_the_Sphinx.jpg","page_title":"স্ফিংক্স","context_page_description":"স্ফিংক্স একটি পৌরাণিক সৃষ্টি যার শরীরের নিচের অংশ সিংহাকৃতির এবং উপরে মানব মাথার মতোন।\\nগ্রিক ঐতিহ্য মতে এদের পশ্চাদ্দেশ সিংহের মত, প্রায়ই এর পাখির ডানার মত বড় ডানা থাকে এবং এর মুখমন্ডল মানুষের মুখের মতোন হয়ে থাকে। পুরাণে একে বিশ্বাসঘাতক এবং নির্দয় হিসেবে বর্ণনা করা হয়। পৌরাণিক গল্পে এর ধাঁধায় ব্যর্থ ব্যক্তিদের একটি নির্দিষ্ট পরিনতি বরন করতে হয়। এসকল ব্যক্তিরা স্ফিংক্সের হাতে খুন হয় এমনকি এই দানব তাদের ভক্ষণ করে। পুরাণে বর্ণিত এ স্ফিংক্সকে অডিপাসের নাটকেও দেখা যায়। গ্রীক পুরাণে এরা নারী-আকৃতির হলেও, মিশরীয় স্ফিংক্সগুলো সাধারণত পুরুষ আকৃতির । মিশরীয় পুরাণের স্ফিংক্স ছিলো উপকারী কিন্তু গ্রীক পুরাণের স্ফিংক্সের মত একই রকম দুর্দান্ত শক্তিসম্পন্ন। তবে উভয় পুরাণেই এদেরকে বর্ণনা করা হয় মন্দির কিংবা সমতুল্য অঞ্চলের প্রবেশদ্বারের প্রহরীস্বরূপ।\\nরেনেসাঁস এর সময়ে আধুনিক চিত্রকল্পে স্ফিংক্স ইউরোপে পুনরুজ্জীবিত হয়। পরবর্তীতে, এর ভাবমূর্তি আরও বিভিন্ন সংস্কৃতিতে অপরিবর্তিত ভাবেই প্রতিফলিত হয়, যদিও কিছু ক্ষেত্রে মূলধারার বাইরের কিছু ধারণাও এর সাথে যোগ হতে দেখা যায়।\\nস্ফিংক্স সাধারণত, স্থাপত্যনিদর্শন যেমন, রাজকীয় সৌধ কিংবা ধর্মীয় মন্দিরের সাথে সম্পৃক্ত।"},{"page_url":"https://eu.wikipedia.org/wiki/P%C4%BCavi%C5%86as_udalerria","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Flag_of_P%C4%BCavi%C5%86u_novads.png","page_title":"Pļaviņas udalerria","context_page_description":"Pļaviņas udalerria Letoniako udalerri bat da. 376 km²ko azalera du eta 2018ko datuen arabera 5031 biztanle zituen. Udalerriko hiriburua Pļaviņas da."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Benjamin_Thomae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Thomae_Nymphenbrunnen1.jpg","page_title":"Johann Benjamin Thomae","context_page_description":"Johann Benjamin Thomae war ein Dresdner Kunsttischler und Bildhauer. 1712 wurde Thomae als Gehilfe von Balthasar Permoser für die plastische Ausschmückung des Dresdner Zwingers angestellt. Im selben Jahr wurde er Hofbildhauer am Dresdner Hof. 1720 erwarb Thomae das Dresdner Bürgerrecht."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B5%D0%BB%D1%82%D0%B5%D1%80%D1%81_(%D0%92%D0%B5%D1%81%D1%82%D0%B5%D1%80%D0%B2%D0%B0%D0%BB%D0%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Selters_%28Westerwald%29_Marktplatz_Germany.jpg","page_title":"Зелтерс (Вестервалд)","context_page_description":"Зелтерс град је у њемачкој савезној држави Рајна-Палатинат. Једно је од 192 општинска средишта округа Вестервалд. Према процјени из 2010. у граду је живјело 2.744 становника. Посједује регионалну шифру 7143067."},{"page_url":"https://en.wikipedia.org/wiki/Los_Pelambres_mine","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Copper_mines_in_Chile_-_1.PNG","page_title":"Los Pelambres mine","context_page_description":"Los Pelambres mine is a copper mine located in the north-central of Chile in Coquimbo Region. It is one of the largest copper reserves in the world, having estimated reserves of 4.9 billion tonnes of ore grading 0.65% copper.\\nThe deposit was first recognized by Willian Burford Braden in 1920. Production in 2012 was forecast at 390 tons of copper and 28,000 ounces of gold. The mine is served by Los Pelambres Airport, and by a water desalination facility at Los Vilos. A billion-dollar expansion project is underway."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%83%E8%91%89%E5%95%86%E7%A7%91%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Chiba-Univ-of-Commerce01.jpg","page_title":"千葉商科大学","context_page_description":"千葉商科大学は、千葉県市川市国府台1-3-1に本部を置く日本の私立大学である。1950年に設置された。大学の略称は「千葉商大」であるが、大学自体では「CUC」を主に使用している。"},{"page_url":"https://en.wikipedia.org/wiki/La_Marque,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/LaMarqueTXMap.gif","page_title":"La Marque, Texas","context_page_description":"La Marque is a city in Galveston County, Texas, south of Houston. The city population in 2010 was 14,509. It is a part of the Galveston metropolitan area. La Marque experienced considerable growth in the 1950s, during which the city provided a general administrative and trades and crafts workforce helping to support the petrochemical complex in adjoining Texas City. It is the hometown of U.S. Senator Kay Bailey Hutchison and Norman Bulaich."},{"page_url":"https://it.wikipedia.org/wiki/Aci_Trezza","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gozzo_tipico_di_Aci_Trezza_decorato.jpg","page_title":"Aci Trezza","context_page_description":"Aci Trezza è una frazione di 4 949 abitanti di Aci Castello, comune italiano della città metropolitana di Catania in Sicilia.\\nCentro di antica tradizione peschereccia, fondato alla fine del Seicento dal nobile palermitano Stefano Riggio come approdo marittimo per il proprio feudo, il paese si affaccia sul mar Ionio dinanzi al piccolo arcipelago delle Isole Ciclopi, sito di interesse naturalistico e geologico; dalla seconda metà del Novecento il borgo è divenuto anche una destinazione turistica.\\nAci Trezza è nota inoltre per essere il luogo in cui sono stati ambientati il romanzo I Malavoglia di Giovanni Verga e il film La terra trema di Luchino Visconti, a sua volta direttamente ispirato all'opera dello scrittore verista."},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_nowomiejski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Nowe_Miasto_nad_Wart%C4%85_Ko%C5%9Bci%C3%B3%C5%82.jpg","page_title":"Dekanat nowomiejski","context_page_description":"Dekanat nowomiejski – jeden z 43 dekanatów archidiecezji poznańskiej, składa się z trzynastu parafii:\\nparafia pw. Miłosierdzia Bożego,\\nparafia pw. św. Małgorzaty,\\nparafia pw. Wniebowzięcia Najświętszej Maryi Panny,\\nparafia pw. Podwyższenia Krzyża Świętego,\\nparafia pw. Narodzenia Najświętszej Maryi Panny,\\nparafia pw. św. Antoniego Padewskiego,\\nparafia pw. Najświętszej Maryi Panny Wniebowziętej i św. Mikołaja,\\nparafia pw. św. Wawrzyńca,\\nparafia pw. Trójcy Świętej,\\nparafia pw. św. Walentego,\\nparafia pw. św. Katarzyny,\\nparafia pw. Chrystusa Króla,\\nParafia Niepokalanego Poczęcia Najświętszej Maryi Panny we Włościejewkach.\\nDekanat sąsiaduje z dekanatami:\\nśredzki,\\nkórnicki,\\nlwówecki,\\nśremski,\\nborecki,\\ndekanaty archidiecezji gnieźnieńskiej,\\ndekanaty diecezji kaliskiej.\\nAdministracyjnie dekanat znajduje się na terenie gminy Nowe Miasto nad Wartą, gminy Krzykosy, gminy Żerków, gminy Jarocin i gminy Książ Wielkopolski."},{"page_url":"https://en.wikipedia.org/wiki/Jennie_Harbour","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Cinderella.jpg","page_title":"Jennie Harbour","context_page_description":"Jennie Harbour was an English Art Deco artist and illustrator."},{"page_url":"https://es.wikipedia.org/wiki/Eragon_(pel%C3%ADcula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Christopher_Paolini%2C_Eragon_1.jpg","page_title":"Eragon (película)","context_page_description":"Eragon es una película de aventuras y fantasía de 2006, basada en la novela homónima escrita por Christopher Paolini. El reparto incluye a Edward Speleers en el personaje protagónico, Sienna Guillory, Jeremy Irons, Robert Carlyle, John Malkovich, Garrett Hedlund, Djimon Hounsou, Alun Armstrong, Joss Stone y la voz de Rachel Weisz como el dragón Saphira.\\nLa película fue dirigida por Stefen Fangmeier, quien había trabajado previamente como director de efectos especiales en Lemony Snicket's A Series of Unfortunate Events y Master and Commander: The Far Side of the World. El guion cinematográfico fue escrito por Peter Buchman, quien es muy conocido por ser el guionista de Parque Jurásico III. La película comenzó a rodarse en los Estudios Mafilm Fót en Hungría el 1 de agosto de 2005. Los efectos especiales y la animación estuvieron a cargo de Watafac Digital y de Industrial Light & Music.\\nEragon fue estrenada el 14 de diciembre de 2006 en Australia, Nueva Zelanda, Alemania, Puerto Rico, Rusia, Hong Kong y Malasia. Más tarde, el 15 de diciembre de 2006, fue estrenada en el Reino Unido, Estados Unidos, Canadá, España, México, Portugal y Taiwán por la 20th Century Fox."},{"page_url":"https://en.wikipedia.org/wiki/Peugeot_308","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Peugeot_308_82_VTi_Active_%28II%29_%E2%80%93_Heckansicht%2C_4._Januar_2014%2C_D%C3%BCsseldorf.jpg","page_title":"Peugeot 308","context_page_description":"The Peugeot 308 is a small family car produced by the French car manufacturer Peugeot. It was unveiled on 5 June 2007, and launched in September 2007. Its development code was \\"Project T7\\", and is the first car of the X08 generation of Peugeot models. The 308 features a range of petrol and diesel engine options. In March 2011, the 308 received a facelift, and it premiered at the Geneva Motor Show.\\nA second generation was unveiled in 2013, and it was awarded as the 2014 European Car of the Year."},{"page_url":"https://fr.wikipedia.org/wiki/Curd_J%C3%BCrgens","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Curd_Juergens_by_G%C3%BCnter_Rittner_1980.jpg","page_title":"Curd Jürgens","context_page_description":"Curd Jürgens, né le 13 décembre 1915 à Solln et mort le 18 juin 1982 à Vienne, est un acteur et un réalisateur de cinéma allemand et autrichien."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%AF_%DA%A9%D9%86%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Ted_Kennedy%2C_official_photo_portrait_crop.jpg","page_title":"تد کندی","context_page_description":"ادوارد کندی معروف به تد کندی، متولد ۱۹۳۲ و متوفی ۲۰۰۹، سیاستمدار دموکرات و سناتور کهنه‌کار ایالت ماساچوست بود.\\nاو دارای مدرک وکالت حقوق از دانشگاه ویرجینیا و دانش آموختهٔ دانشگاه هاروارد نیز بود.\\nاو همچنین مدت ۲ سال در ارتش آمریکا خدمت کرد. او برادر جان و رابرت کندی بود.\\nسناتور ادوارد کندی، یکی از برجسته‌ترین سناتورهای تاریخ ایالات متحده و از حامیان باراک اوباما بود، که در سن ۷۷ سالگی و پس از یک سال مبارزه با سرطان مغز، درگذشت. سناتور کندی نزدیک به نیم قرن در سنای آمریکا حضور داشت. وی در سنای آمریکا در زمینه قانونگذاری از جمله دربارهٔ بهداشت، حقوق مدنی، آموزش و مهاجرت تلاش‌های چشمگیری داشت"},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%92%E1%83%9D%E1%83%A2%E1%83%A4%E1%83%A0%E1%83%98%E1%83%93_%E1%83%9A%E1%83%90%E1%83%98%E1%83%91%E1%83%9C%E1%83%98%E1%83%AA%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Gottfried_Wilhelm_von_Leibniz.jpg","page_title":"გოტფრიდ ლაიბნიცი","context_page_description":"გოტფრიდ ვილჰელმ ლაიბნიცი — გერმანალი ფილოსოფოსი დო მენცარი, მათემატკოსი, დიპლომატი, ფიზიკოსი, ისტორიკოსი, ოერეფოშქაშე დო საშურო სამართალიშ დოქტორი. თიქ დო ინგლისარ მენცარ ისააკ ნიუტონქ, ართიანშე ზოხორინელო, ოსხირი დინურღვეს მათემატიკაშ შანულამ დარგის — მათემატიკურ ანალიზის. ლაიბნიციქ ბრელი მათემატიკური ცნება დო სიმბოლო გამშეღჷ, ნამუსჷთ ასე ხოლო ირინუანა.თიში მუშაღალირი რე გომიარაფაშ დო გორთუალაშ შანეფი"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%82%D1%96%D0%BD%D0%B0%D1%8F_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87-%D0%9D%D0%B5%D0%B3%D0%BE%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Altanai_petrovitch_njegosh.jpeg","page_title":"Алтіная Петрович-Негош","context_page_description":"Принцеса Алтіная Петрович-Негош — єдина дочка Ніколи, князя Чорногорії, голови дому Петрович-Негошів і його покійної дружини Франсіни Наварро."},{"page_url":"https://sv.wikipedia.org/wiki/Vittorio_Giardino","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Barcelona_bombing_%281938%29.jpg","page_title":"Vittorio Giardino","context_page_description":"Vittorio Giardino, född 24 december 1946 i Bologna, är en italiensk serieskapare. Han har skapat serier som Max Friedman, Sam Pezzo, Jonas Fink och Little Ego. Giardino ingick i en generation europeiska serieskapare som under 1990-talet slog igenom i bland annat Frankrike med realistiska berättelser, och han har själv ofta hämtat sina motiv från tiden före eller efter andra världskriget. I Sverige har han publicerats i albumform i bland annat tidningen Epix och i albumform hos Carlsen Comics och Medusa."},{"page_url":"https://vi.wikipedia.org/wiki/Mindy_Kaling","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Mindy_Kaling_%2846863597125%29_%28cropped%29.jpg","page_title":"Mindy Kaling","context_page_description":"Vera Mindy Chokalingam, nghệ danh: Mindy Kaling, là một nhà biên kịch, nữ diễn viên và tác giả người Mỹ."},{"page_url":"https://fi.wikipedia.org/wiki/Lastenelokuva","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Wolfgang_Staudte_907-1747.jpg","page_title":"Lastenelokuva","context_page_description":"Lastenelokuva on erityisesti lasten katsottavaksi tarkoitettu fiktiivinen tai dokumenttipohjainen elokuva. Sen hahmot ja tapahtumat vetoavat lapsiin joko mielikuvituk­sellisuudessaan tai yhteyksissään lasten todellisuuteen, kuten kotiin, vanhempiin ja kouluun. Lasten­elokuvien alalajeja ovat erilaiset animaatioelokuvat sekä näytellyt komediat ja draamat, jotka puolestaan voivat mukailla jotakin aikuis­elokuvien lajityyppiä kuten rikostarina, tieteiselokuva tai lännenelokuva. Lasten­elokuvien tarinat voivat olla mielikuvituk­sellisia fantasioita tai hyvinkin realistisia, lapsia puhuttelevia tarinoita, jotka kiinnostavat yhteyksillään lasten todellisuuteen ja heitä askar­ruttaviin kysymyksiin. Etenkin yhdys­valtalaisia lasten­elokuvia kutsutaan myös perhe-elokuviksi, ja niihin sijoitetaan usein myös aikuisia kiinnostavia asioita tai ne vaativat aikuisten läsnäoloa esimerkiksi pelottavuutensa takia. Lasten­elokuvien ja aikuisten elokuvien väliin sijoittuvat nuortenelokuvat."},{"page_url":"https://az.wikipedia.org/wiki/AB%C5%9E-%C4%B1n_birinci_xan%C4%B1mlar%C4%B1n%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Lucretia_Garfield_-_Brady-Handy.jpg","page_title":"ABŞ-ın birinci xanımlarının siyahısı","context_page_description":"ABŞ-ın birinci xanımı — Ağ Evin sahibəsi titulunu daşıyır. Ənənəvi sahibə vəzifəsini ABŞ prezidentinin xanımı yerinə yetirir, lakin bəzən bu titulu dövlət başçısının həyat yoldaşı olmayan xanımlar da daşıyır. Bu o halda baş verir ki, prezident subay və yaxud duldur, ya da həyat yoldaşı hansısa səbəbdən birinci xanım vəzifəsini yerinə yetirə bilmir. Birinci xanım titulu seçilmir və heç bir rəsmi xidmət hesab olunmur. Bununla belə, birinci xanım bir çox rəsmi tədbirlərdə iştirak edir, həm də prezidenti əvəz edə bilir. Ənənəyə görə, Ağ Evin sahibəsi öz işinin yerinə yetirilməsi müddətində heç bir əmək fəaliyyəti icra etmir. Onların vəzifələri dairəsinə, həm də Ağ Evin mərasimləri haqqında qayğılar da daxildir. Birinci xanımın öz xidmət ştatı var, bura - Ağ Evin ümumi katibi, işçilərin ştatının rəhbərləri, mətbuat katibi, baş floristi və baş aşbazlar daxildir. Birinci xanımın ofisi prezident ofisinin qoludur."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%BE%B3%E5%A4%A7%E5%88%A9%E4%BA%9E%E7%B8%BD%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/BobHawke%28cropped%29.jpg","page_title":"澳大利亞總理","context_page_description":"澳洲總理大臣是澳洲聯邦政府的首腦，由澳洲總督代表君主任命。\\n《澳洲憲法》沒有明確提到總理一職，因此總理的存在和職權皆由慣例來確定。按照西敏制的慣例，澳洲總督作為象徵性的元首代理人不干預行政，所以總理是實際決策者和最高行政長官。同樣根據西敏制的法律結構，總理由於下議院掌握多數席次的黨派來推舉，並且被視為該黨派的實際領袖。總理通常必須是聯邦議員，在澳洲政治史上，唯一以參議員身份出任總理的是約翰·戈頓。\\n現任的澳洲總理大臣是自由黨籍的斯科特·莫里森，為第30任，於2018年8月24日上任。"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%83%9C%EA%B5%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Songkran_in_Wat_Kungthapao_02.jpg","page_title":"태국","context_page_description":"타이 왕국 또는 태국은 동남아시아의 말레이 반도와 인도차이나 반도 사이에 걸쳐 있는 나라이다. 동쪽으로 라오스와 캄보디아, 남쪽으로 타이만과 말레이시아, 서쪽으로 안다만해와 미얀마와 접해 있다. 태국은 동남아시아의 유일한 오랜 독립국으로서 피식민지 경험이 없는 국가이다. 주요 도시로는 방콕, 치앙마이, 파타야, 깐짜나부리 등이 있다."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%DB%8C%D8%AF%D9%81%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bridges_over_the_River_Lambourn%2C_East_Garston%2C_Berkshire.jpg","page_title":"بیدفورد","context_page_description":"بیدفورد بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 17107 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://es.wikipedia.org/wiki/Prav%C4%8Dice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Prav%C4%8Dice%2C_%C5%A1kola.jpg","page_title":"Pravčice","context_page_description":"Pravčice es una localidad del distrito de Kroměříž en la región de Zlín, República Checa, con una población estimada a principio del año 2018 de 732 habitantes.\\nSe encuentra ubicada al noroeste de la región, en la zona más occidental de los montes Cárpatos, al este de Praga, cerca de la orilla del río Morava —un afluente izquierdo del Danubio— y de la frontera con las regiones de Moravia Meridional y Olomouc.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%B8%E5%AE%9A%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Lugouqiao2.jpg","page_title":"永定河","context_page_description":"永定河，古称㶟水，隋代称桑干河，金代称卢沟，元代称浑河，旧名无定河，海河流域七大水系之一，是河北系的最大河流。流域面积47016平方千米，其中山区面积45063平方千米，平原面积1953平方千米。永定河全长747公里，流经内蒙古、山西、河北三省区、北京、天津两个直辖市、共43个县市。全流域面积4.7万平方公里。\\n永定河上游的桑干河和洋河两大支流，在河北省怀来县朱官屯汇合，以下的河段称永定河，在延庆区汇入妫水河，经官厅水库流入官厅山峡。从官厅至朱官屯河长30km，官厅山峡河长108.7千米，至门头沟三家店流入平原。从三家店以下至天津的入海口，河道全长大约200km。根据水利系统人们将永定河分为三家店至卢沟桥、卢沟桥至梁各庄、永定河泛区和永定新河四段。\\n永定河因为经常泛滥更改河道，得名“无定河”。康熙帝改名“永定河”。\\n永定河在北京南部一段因为长有大量芦苇，因此被称为“芦沟”。河上有著名石桥芦沟桥，也称永定桥。后因河水泛滥芦苇消失。"},{"page_url":"https://ms.wikipedia.org/wiki/Hirundo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Hirundo_neoxena_risdon.jpg","page_title":"Hirundo","context_page_description":"Genus burung layang-layang Hirundo adalah burung layang-layang biasa terdapat dimana-mana. Kebanyakan warna bahagian belakang burung ini hitam kebiruan, kemerahan di bahagian muka kadang-kadang merah juga di bahagian dada. Bahagian bawah pula berwarna putih."},{"page_url":"https://en.wikipedia.org/wiki/Albert_Anker","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Fleissig--Appliqu%C3%A9e_by_Albert_Anker%2C_1886.jpg","page_title":"Albert Anker","context_page_description":"Albrecht Samuel Anker was a Swiss painter and illustrator who has been called the \\"national painter\\" of Switzerland because of his enduringly popular depictions of 19th-century Swiss village life."},{"page_url":"https://it.wikipedia.org/wiki/Societ%C3%A0_Polisportiva_Ars_et_Labor_1998-1999","image_url":"https://upload.wikimedia.org/wikipedia/it/a/a8/Societ%C3%A0_Polisportiva_Ars_et_Labor_1998-1999.jpg","page_title":"Società Polisportiva Ars et Labor 1998-1999","context_page_description":"Questa pagina raccoglie le informazioni riguardanti la Società Polisportiva Ars et Labor nelle competizioni ufficiali della stagione 1998-1999."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1986","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/JustinBerfield1SecondFilm.jpg","page_title":"Lijst van personen geboren in 1986","context_page_description":"Dit is een lijst van personen die geboren zijn in 1986.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/Larry_Clark_(r%C3%A9alisateur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Larry_Clarke.jpg","page_title":"Larry Clark (réalisateur)","context_page_description":"Larry Clark né le 19 janvier 1948 est l’un des principaux réalisateurs de L.A. Rebellion, également connue sous le nom de Los Angeles School of Black Filmmakers. Il a réalisé les longs métrages Passing Through en 1977 et Cutting Horse en 2002."},{"page_url":"https://es.wikipedia.org/wiki/Oxfordshire","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/OxfordshireNumbered.png","page_title":"Oxfordshire","context_page_description":"Oxfordshire /ˈɒksfətʲˌʃə/ es uno de los cuarenta y siete condados de Inglaterra, Reino Unido, con capital en Oxford. Ubicado en la región Sudeste limita al norte con Warwickshire y Northamptonshire, al este con Buckinghamshire, al sur con Berkshire y al oeste con Wiltshire y Gloucestershire.​​\\nEstá dividido en cinco distritos gubernamentales: Oxford, Cherwell, Vale of the White Horse, West Oxfordshire y South Oxfordshire.\\nEl principal recurso del condado es el turismo, la zona se destaca por la concentración de compañías e instalaciones relacionadas con el automovilismo y la Oxford University Press, que ha liderado la convergencia de compañías de impresión y publicación y la universidad también está vinculada a la concentración de compañías de biotecnología.\\nEl principal núcleo de población es la ciudad de Oxford, junto con otras poblaciones como Bicester, Banbury y Chipping Norton al norte de Oxford; Witney al oeste; Thame y Chinnor al este; y Abingdon, Wantage, Wallingford, Didcot y Henley-on-Thames al sur."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B3%A2%E6%96%AF%E5%9F%BA%E4%BA%9E%E6%B2%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/P1030956_Poschiavo%2C_St._Maria_Assunta.JPG","page_title":"波斯基亞沃","context_page_description":"波斯基亞沃是一座瑞士格勞賓登州的城鎮，位於該國東部，面積191.01平方公里，海拔高度1,014米，2011年人口3,602，人口密度每平方公里19人。它與布魯西奧一起組成波斯基亞沃谷。"},{"page_url":"https://pl.wikipedia.org/wiki/Drugi_Bank_Stan%C3%B3w_Zjednoczonych","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Second_Bank_of_the_United_States_rear.jpg","page_title":"Drugi Bank Stanów Zjednoczonych","context_page_description":"Drugi Bank Stanów Zjednoczonych – bank centralny w Stanach Zjednoczonych, z siedzibą w Filadelfii, działający w latach 1816–1836, a jako bank prywatny do 1841 roku."},{"page_url":"https://de.wikipedia.org/wiki/Edito","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Edito.png","page_title":"Edito","context_page_description":"Edito ist ein Schweizer Fachmagazin für Medien und Journalismus. Es beschäftigt sich mit Medienarbeit, Medientrends, Medienpolitik, der Aus- und Weiterbildung und berichtet über medienethische und medienrechtliche Fragen.\\nEdito erscheint in Deutsch und in Französisch, in Print und Online. Die deutschsprachige Print-Ausgabe hat eine WEMF-beglaubigte Auflage von 6'338 verkauften bzw. 6'534 verbreiteten Exemplaren, die französischsprachige Print-Ausgabe von 3'773 verkauften bzw. 3'801 verbreiteten Exemplaren.\\nChefredaktorin ist Nina Fargahi, Redaktionsleiter in der Romandie Jean-Luc Wenger. Verleger des Magazins ist Ivo Bachmann.\\nEdito ging 2009 aus den Magazinen der Mediengewerkschaften SSM, Gazette, und impressum, journalisten.ch, hervor. 2011 stiess auch das Medienmagazin Klartext der Gewerkschaft syndicom dazu. Bis Ende 2016 führte Edito noch den Zweitnamen Klartext."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A3%A8%EB%8F%84%EB%B9%84%EC%BF%A0%EC%8A%A4_2%EC%84%B8_%EC%9D%B4%EC%9A%B0%EB%8B%88%EC%98%A4%EB%A5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Reichsschwert_ludwig_das_kind.jpg","page_title":"루도비쿠스 2세 이우니오르","context_page_description":"루도비쿠스 2세 이우니오르는 845년부터 약 30년 동안 서로마 제국 황제였다. 처음 10년간은 아버지 로타르 1세와 공동 통치하였다. 839년에는 이탈리아 군주라는 직함을 갖고, 844년부터는 실제로 롬바르디아의 왕이었으며, 850년에는 공동 황제가 되었다. 855년 9월 부왕의 은퇴로 단독 황제가 되었다.\\n루도비쿠스 1세 피우스의 손자이자 황제 로타리우스 1세의 맏아들로 839년부터는 이탈리아 왕으로 봉해졌고 844년 6월 15일 로마에서 교황 세르지오 2세에 의해 롬바르디아의 왕으로 정식 대관식을 치렀다. 루트비히 2세는 막강한 권력을 소유한 채 그리스와 사라센 그리고 해적들을 물리쳤다. 그는 사라센의 침략으로 무정부상태가 된 이탈리아 정부의 혼란을 수습하고, 독자적 정권을 수립하려 했으나 실패한다. 그는 재위기간 내내 사라센 족에 시달림을 당해 비잔틴 제국에 도움을 청하기도 했다. 그러나 비잔틴 제국에서는 그의 황제 칭호 사용에 대해 문제삼아 외교 갈등으로 비화되었다. 끝내 남자 후계자를 남기지 못하고 사망하여, 그의 사후 이탈리아의 영유권 및 황제 칭호를 놓고 분쟁의 원인이 된다. 같은 이름을 가진 동프랑크의 국왕인 삼촌과 구분을 위해 삼촌을 독일왕 루트비히, 조카를 이탈리아왕 루트비히로 구별하기도 한다.\\n살아생전 그는 로마인의 황제라 칭했지만, 실제로 그는 이탈리아의 황제로 불렸다. 그는 끝까지 자신을 로마인의 황제라 하였지만, 비잔틴 제국에서는 그를 인정하지 않아 프랑크의 황제라 칭하였다. 서프랑크 왕국에서도 그를 이탈리아의 황제로 불렀다. 베르가모의 역사가 안드레아스는 \\"그의 죽음 이후 이탈리아에 큰 환란이 왔다.\\"고 평하기도 했다."},{"page_url":"https://en.wikipedia.org/wiki/Overland_Campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/ColdHarbor-June3.png","page_title":"Overland Campaign","context_page_description":"The Overland Campaign, also known as Grant's Overland Campaign and the Wilderness Campaign, was a series of battles fought in Virginia during May and June 1864, in the American Civil War. Lt. Gen. Ulysses S. Grant, general-in-chief of all Union armies, directed the actions of the Army of the Potomac, commanded by Maj. Gen. George G. Meade, and other forces against Confederate Gen. Robert E. Lee's Army of Northern Virginia. Although Grant suffered severe losses during the campaign, it was a strategic Union victory. It inflicted proportionately higher losses on Lee's army and maneuvered it into a siege at Richmond and Petersburg, Virginia, in just over eight weeks.\\nCrossing the Rapidan River on May 4, 1864, Grant sought to defeat Lee's army by quickly placing his forces between Lee and Richmond and inviting an open battle. Lee surprised Grant by attacking the larger Union army aggressively in the Battle of the Wilderness, resulting in heavy casualties on both sides."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%B2%E0%A5%81%E0%A4%AE%E0%A5%8D%E0%A4%AC%E0%A4%BF%E0%A4%A8%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%E0%A4%AE%E0%A5%8D%E0%A4%AF%E0%A4%BE%E0%A4%A8%E0%A5%8D%E0%A4%AE%E0%A4%BE%E0%A4%B0_%E0%A4%AC%E0%A5%8C%E0%A4%A7%E0%A5%8D%E0%A4%A6_%E0%A4%B8%E0%A5%8D%E0%A4%A4%E0%A5%81%E0%A4%AA%E0%A4%BE%2C_%E0%A4%B2%E0%A5%81%E0%A4%AE%E0%A5%8D%E0%A4%AC%E0%A4%BF%E0%A4%A8%E0%A5%80.JPG","page_title":"लुम्बिनी","context_page_description":"लुम्बिनी गौतम बुद्धको जन्मस्थल हो। हाल याे ठाउँ नेपालको पश्चिमाञ्चल विकास क्षेत्रको लुम्बिनी अञ्चल, रूपन्देही जिल्लामा पर्छ। विभिन्न बाैद्ध वाङ्मयहरूमा बुद्धकाे जन्मस्थल भनेर लुम्बिनी नाउँकाे एउटा उपवनलाई चिनाइएकाे छ भने साे उपवनमा कालान्तरमा विभिन्न मानवीय गतिविधिहरू हुन थालेकाे पाइन्छ । इ.पू. २४९ मा माैर्य सम्राट अशाेकले यस स्थलकाे तीर्थाटन गरेका थिए र यस तीर्थाटनकाे संस्मरणमा अभिलेख पनि कुँदाएका थिए । याे कुराकाे जानकारी इसाकाे पाँचाैं शताब्दीमा आएका चिनियाँयात्री फाहियान र साताै शताब्दीमा आएका अर्का चिनियाँ यात्री, ह्वेनसाङले विस्तृत बयान आफ्ना यात्रा विवरणहरूमा दिएका थिए । सन् १८९६ मा पुरातात्विक अन्वेषणका क्रममा माैर्य सम्राट अशाेकद्वारा राखिएकाे अशाेक स्तम्भ र त्यसमा रहेकाे अभिलेख भेटियाे । उक्त अभिलेखमा याे ठाउँकाे नाम लुंमिनि भनेर उल्लेख गरिएकाे पाइन्छ । यस अभिलेखकाे प्राप्तीले गाैतम बुद्धकाे जन्मस्थल लुम्बिनीकाे पहिचान भएकाे हाे भने त्यसैबेलादेखि विश्वभर गाैतम बुद्धकाे जन्मस्थल नेपालकाे पश्चिमाञ्चल विकास क्षेत्रकाे लुम्बिनी अञ्चल, रूपन्देही जिल्लामा पर्ने कुरा स्थापना भयाे ।"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%92%D7%A0%D7%95%D7%9F_%D7%92%D7%95%D7%AA%D7%99_%D7%9C%D7%95%D7%94%D7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Vendome03.jpg","page_title":"סגנון גותי לוהב","context_page_description":"סגנון גותי לוהב, הידוע גם כגותיקה לוהבת, סגנון הלהבות או כ-Flamboyant, הוא תת-סגנון של האדריכלות הגותית שהתפתח בסוף המאה ה-14 ותחילת המאה ה-15. סגנון זה נקרא על שם צורות הלהבות של תחרת החלונות והאבן ונהפך לשם נרדף לראוותנות בעקבות עושר הפרטים והקישוטים שלו.\\nסגנון הלהבות הוא חלק מהאדריכלות הגותית המאוחרת ובא בעקבות הגותיקה הקורנת. הסגנון היה נפוץ בצרפת, ספרד ופורטוגל. הסגנון המקביל באנגליה הוא סגנון גותי ניצב ובגרמניה ה-Sondergotik. בסוף המאה ה-15 ותחילת המאה ה-16 סגנון זה התפתח לגותיקה מנואלינית בפורטוגל וגותיקה איזבלינית בספרד, בסגנונות אלה הועמק השימוש הראוותני והפזרני בקישוטים ותחרת אבן.\\nהסגנון מאופיין בתחרת חלונות וקישוטי אבן עשירים ומלאי פרטים בצורת להבות אש או עלים מלופפים. צריחים בסגנון זה הם בעלי מרקם תחרה.\\nמבנים נודעים בסגנון זה הם כנסיית סן מקלו ברואן, בית הרוחב של קתדרלת סנלי, חזית קתדרלת טור, קתדרלת מולן, כנסיית סנט אנה, בזיליקת נוטרדאם דה ל'אפין וחלון הרוזטה של סנט שאפל."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B6dbent_nektarkrypare","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Cyanerpes_cyaneus_-Diergaarde_Blijdorp_-male-8a.jpg","page_title":"Rödbent nektarkrypare","context_page_description":"Rödbent nektarkrypare är en fågel i familjen tangaror inom ordningen tättingar."},{"page_url":"https://pl.wikipedia.org/wiki/Skellytown","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Restored_filling_station_in_Skellytown%2C_Texas.JPG","page_title":"Skellytown","context_page_description":"Skellytown – miasto w Stanach Zjednoczonych, w stanie Teksas, w hrabstwie Carson."},{"page_url":"https://nl.wikipedia.org/wiki/Onze-Lieve-Vrouw_van_Goede_Bijstandkerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/%C3%89glise_Notre-Dame_du_Bon_Secours_%28Brussels%29_-_IMG_3690.JPG","page_title":"Onze-Lieve-Vrouw van Goede Bijstandkerk","context_page_description":"De Onze-Lieve-Vrouw van Goede Bijstandkerk is een barok kerkgebouw in het centrum van Brussel."},{"page_url":"https://es.wikipedia.org/wiki/Rosa_macrophylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Rosa_Auguste_Roussel_2.jpg","page_title":"Rosa macrophylla","context_page_description":"Rosa macrophylla es una especie de rosa clasificada en la Rosa sect. Cinnamomeae."},{"page_url":"https://tr.wikipedia.org/wiki/Benjamin_Huggel","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Huggel061115.jpg","page_title":"Benjamin Huggel","context_page_description":"Benjamin Huggel, defansif orta saha olarak görev yapmış İsviçreli eski millî futbolcudur."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%AF%D9%85%DB%8C%D8%A7_%D8%A2%D9%84%DA%A9%D8%B3%D9%88%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Lyudmila_Alexeyeva.jpg","page_title":"لودمیا آلکسویا","context_page_description":"لودمیا آلکسویا تاریخ‌نگار، پدیدآور، فعال حقوق بشر، و نویسنده اهل اتحاد جماهیر شوروی سوسیالیستی بود. آلکسویا یکی از مورخان روسیه بود، او عضو بنیانگذار سازمان دیده‌بان گروه هلسینکی مسکو و یکی از آخرین مخالفان شوروی در روسیه مدرن بود.\\nوی همچنین برندهٔ جوایزی همچون لژیون دونور، لژیون دونور، جایزه ساخاروف، نشان افتخار شایستگی جمهوری فدرال آلمان، و جایزه اولاف پالمه شده‌است."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B1%9F%E5%B7%9D%E6%B5%B7%E5%B2%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%E9%BB%84%E6%98%8F%E3%81%AE%E6%B1%9F%E5%B7%9D%E6%B5%B7%E5%B2%B8%28Egawa_coast_in_twilight%29_04_Oct%2C_2015_-_panoramio.jpg","page_title":"江川海岸","context_page_description":"江川海岸は、千葉県木更津市の木更津港に面した海岸。海岸部には盤州干潟が形成されている。潮干狩り場や絶景スポットとして観光名所となっている。"},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Urisiu_de_Jos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Romania_Mures_Urisiu_de_Jos_icon_86.jpg","page_title":"Biserica de lemn din Urisiu de Jos","context_page_description":"Biserica de lemn din Urisiu de Jos, comuna Chiheru de Jos, județul Mureș, datează din anul 1747. Are hramul „Sfinții Arhangheli Mihail și Gavriil”. Biserica se află pe noua listă a monumentelor istorice sub codul LMI: MS-II-a-A-16059."},{"page_url":"https://vec.wikipedia.org/wiki/Nostang","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Chapelle_de_Locmaria_de_Nostang_3891.JPG","page_title":"Nostang","context_page_description":"Nostang el xé on comun de 1 545 abitanti del departemento de Morbihan che el fa parte del rejon Bretagna in Fransa."},{"page_url":"https://nl.wikipedia.org/wiki/Montagne_de_Bueren","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Escalier_de_Bueren.jpg","page_title":"Montagne de Bueren","context_page_description":"De Montagne de Bueren is een straat bestaande uit een trap van 374 treden in het centrum van de Belgische stad Luik. De straat verbindt de wijk Féronstrée et Hors-Château met Au Péri en de toegang tot de citadel van Luik."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AC%AC%E4%B8%89%E6%AC%A1%E5%AE%89%E5%80%8D%E5%85%A7%E9%96%A3_(%E7%AC%AC%E4%BA%8C%E6%AC%A1%E6%94%B9%E9%80%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Nobuteru_Ishihara_cropped_3_Ishihara_Nobuteru_2012.jpg","page_title":"第三次安倍內閣 (第二次改造)","context_page_description":"第三次安倍第二次改造內閣，是日本眾議院議員、自由民主黨總裁安倍晉三就任第97任內閣總理大臣後，自2016年8月3日至2017年8月3日組成的日本內閣。"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%DB%8C%D9%87%D8%A7%DB%8C%DA%A9%DB%8C%D9%88%D8%8C_%D8%B4%DB%8C%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Coyhaique10.jpg","page_title":"کویهایکیو، شیلی","context_page_description":"کویهایکیو، شیلی یک سکونتگاه مسکونی در شیلی است که در Coyhaique Province واقع شده‌است."},{"page_url":"https://no.wikipedia.org/wiki/Gliese_581_c","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Planetary_System_in_Gliese_581_%28artist%27s_impression%29.jpg","page_title":"Gliese 581 c","context_page_description":"Gliese 581 c er en eksoplanet i bane rundt den røde dvergstjernen Gliese 581. Planeten antas å ligge innenfor den beboelige sonen hvor overflatetemperaturen tilsier at flytende vann kan finnes. Planeten befinner seg 20,5 lysår fra jorden i stjernebildet Vekten."},{"page_url":"https://en.wikipedia.org/wiki/List_of_State_Protected_Monuments_in_Gujarat","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Modpar_Stepwell_3_clicked_by_Hariom_Raval.jpg","page_title":"List of State Protected Monuments in Gujarat","context_page_description":"This is a list of State Protected Monuments as officially reported by and available through the website of the Archaeological Survey of India in the Indian state Gujarat. It also includes new monuments added by Gujarat State Archeology and Museums Department on its website.\\nThe monument identifier is a combination of the abbreviation of the subdivision of the list and the numbering as published on the website of the ASI. 366 State Protected Monuments have been recognized by the ASI in Gujarat. Besides the State Protected Monuments, also the Monuments of National Importance in this state might be relevant."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jeongol.jpg","page_title":"Чонголь","context_page_description":"Чонголь — категория искусно приготовленного тушёного мяса или запеканки. Он похож на категорию корейского тушёного мяса ччигэ, с главным отличием от ччигэ в том, что он сделан только из основных ингредиентов и само его название ставится после названия ингредиентов, например, кимчхи ччигэ или сундубу ччигэ, в то время как чонголь содержит в себе разнообразие главных ингредиентов. Ещё одно отличие заключается в том, что чонголь, как и куджольпхан, первоначально был блюдом высших слоёв корейского общества и членов королевского двора, тогда как ччигэ был обычным блюдом для простых людей."},{"page_url":"https://ceb.wikipedia.org/wiki/Candlestone_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Candelston_Castle_2009.JPG","page_title":"Candlestone Castle","context_page_description":"Kastilyo ang Candlestone Castle sa Hiniusang Gingharian. Nahimutang ni sa munisipyo sa Bridgend county borough ug apil sa nasod sa Wales, sa habagatang bahin sa nasod, 240 km sa kasadpan sa London ang ulohan sa nasod. 24 metros ibabaw sa dagat kahaboga ang nahimutangan sa Candlestone Castle.\\nAng yuta palibot sa Candlestone Castle kay kasagaran patag, apan sa amihanan nga kini mao ang kabungtoran. Sa habagatang-kasadpan, dagat ang pinakaduol sa Candlestone Castle. Ang kinahabogang dapit sa palibot dunay gihabogon nga 81 ka metro ug 1.0 km sa amihanan-kasadpan sa Candlestone Castle. Dunay mga 411 ka tawo kada kilometro kwadrado sa palibot sa Candlestone Castle nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bridgend, 4.3 km sa amihanan-sidlakan sa Candlestone Castle. Hapit nalukop sa kasagbotan ang palibot sa Candlestone Castle. Sa rehiyon palibot sa Candlestone Castle, mga luuk talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa 1 °C."},{"page_url":"https://en.wikipedia.org/wiki/Cenotaph","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Bruce_Park_Cenotaph.JPG","page_title":"Cenotaph","context_page_description":"A cenotaph is an empty tomb or a monument erected in honour of a person or group of people whose remains are elsewhere. It can also be the initial tomb for a person who has since been reinterred elsewhere. Although the vast majority of cenotaphs honour individuals, many noted cenotaphs are instead dedicated to the memories of groups of individuals, such as the lost soldiers of a country or of an empire."},{"page_url":"https://nn.wikipedia.org/wiki/McMurdo_Sound","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/B15_landsat.jpg","page_title":"McMurdo Sound","context_page_description":"McMurdo Sound er eit isdekt sund i Antarktis som er 55 km langt og breitt. Det knyt Rosshavet i nord til holet i Rossisen i sør via Haskell Strait.\\nSundet er stort sett dekt av McMurdo isbrem. Royal Society Range stig opp frå kysten av sundet til 4 205 moh på vestsida. Ross Island, eit historisk utgangspunkt for mange polekspedisjonar, ligg på austsida av sundet. Den aktive vulkanen Mount Erebus på 3 794 moh. dominerer Ross Island. Den største forskingabasen i Antarktis, den amerikanske McMurdo-basen, og den newzealandske Scott-basen ligg på sørsida av øya. Mindre enn 10 % av kysten av McMurdo Sound er isfri.\\nKaptein James Clark Ross oppdaga dette sundet, som ligg kring 1300 km frå Sørpolen i februar 1841, og kalla det opp etter løytnant Archibald McMurdo på HMS «Terror». Sundet er i dag ein del av forsyningsruta for fraktefartøy og fly som landar på den flytande isen nær McMurdo-basen. McMurdo-basen har vore kontinuerleg busett sidan 1957-58 og dette har ført til stor forureining ved forureining ved Winter Quarters Bay.\\nPakkisen som ligg kring kysten ved Winter Quarters Bay og andre stader i sundet er ei stor hindring for skipsfarten til stasjonane."},{"page_url":"https://de.wikipedia.org/wiki/Ritter_Toggenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Bayer_Toggenburg.JPG","page_title":"Ritter Toggenburg","context_page_description":"Ritter Toggenburg ist eine im Juli des Balladenjahres 1797 entstandene Ballade von Friedrich Schiller. Nach Schillers Kalendereintrag schloss er sie am 31. Juli ab. Das in zehn trochäischen Strophen verfasste Gedicht erschien erstmals noch im gleichen Jahr im Musen-Almanach für das Jahr 1798 und wurde auch in die Gedichtausgaben von 1800 und 1804 aufgenommen."},{"page_url":"https://sv.wikipedia.org/wiki/Shanhaipasset","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/ShanhaiguanGreatWall-end.jpg","page_title":"Shanhaipasset","context_page_description":"Shanhaipasset eller Shanhaiguan är en strategisk passage och sektion av kinesiska muren. Shanhaipasset ligger i stadsdistriktet Shanhaiguan i Qinhuangdao i Hebei i Kina.\\nTidigt under Mingdynastin år 1381 byggdes Zhendongporten som är den östra porten genom Shanhaipasset. Det byggdes då även ca 10 km av kinesiska muren. Öster om Shanhaipasset ansluter muren mot Bohaibukten och murens östra slut här kallas \\"Den gamla drakens huvud\\". Försvaret av Shanhaipasset under Mingdynastin låg under Jizhougarnisonen ansvarsområde.\\nMed start 1551 byggdes en kontinuerlig mur från Juyongpasset till Shanhaipasset. Denna mur renoverades, expanderades och kompletterades 1567–1572 under ledning av general Qi Jiguang. Det var under denna tid som muren fick det karakteristiska teglade utseendet med torn och skottgluggar som den kinesiska muren är känd för.\\n1644 stod här Slaget om Shanhaiguan där generalen Wu Sangui tog hjälp av manchurerna för att bekämpa rebellen Li Zicheng."},{"page_url":"https://en.wikipedia.org/wiki/Josiah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Close-Up-Without-Ceiling.jpg","page_title":"Josiah","context_page_description":"Josiah or Yoshiyahu was the sixteenth king of Judah who, according to the Hebrew Bible, instituted major religious reforms. Josiah is credited by most biblical scholars with having established or compiled important Hebrew scriptures during the \\"Deuteronomic reform\\" which probably occurred during his rule. Josiah became king of the Kingdom of Judah at the age of eight, after the assassination of his father, King Amon, and reigned for thirty-one years, from 641/640 to 610/609 BCE.\\nJosiah is known only from biblical texts; no reference to him exists in other surviving texts of the period from Egypt or Babylon, and no clear archaeological evidence, such as inscriptions bearing his name, has ever been found. Nevertheless, most scholars believe that he existed historically and that the absence of documents is due to few documents of any sort surviving from this very early period, and to Jerusalem having been occupied, conquered, and rebuilt over thousands of years."},{"page_url":"https://id.wikipedia.org/wiki/Federal_Communications_Commission","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Seal_of_the_United_States_Federal_Communications_Commission.svg","page_title":"Federal Communications Commission","context_page_description":"Federal Communications Commission adalah Lembaga independen dari pemerintah Amerika Serikat, dibuat oleh undang-undang kongresional, dan dengan mayoritas komisaris yang ditunjuk oleh Presiden saat ini. Pekerjaan FCC mengarah ke enam gol di bidang broadband, kompetisi, frekuensi radio, Media, keselamatan publik dan keamanan dalam negeri. Komisi ini juga dalam proses untuk modernisasi itu sendiri.\\nFCC dibentuk oleh Communications Act of 1934 untuk menggantikan fungsi regulasi radio dari Federal Radio Commission. FCC mengambil alih kawat regulasi komunikasi dari Interstate Commerce Commission. Yurisdiksi mandat FCC mencakup 50 negara bagian, District of Columbia, dan Harta AS. FCC juga menyediakan beragam derajat kerjasama, pengawasan, dan kepemimpinan bagi tubuh komunikasi serupa di negara lain dari Amerika Utara. FCC didanai sepenuhnya oleh biaya regulasi. Ini memiliki perkiraan anggaran fiskal 2011 sebesar US$335.8 juta dan mengusulkan anggaran fiskal 2012 dari $354.2 juta. Lembaga ini memiliki 1.898 karyawan federal."},{"page_url":"https://nl.wikipedia.org/wiki/Lacinipolia_patalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Lacinipolia_patalis_02.jpg","page_title":"Lacinipolia patalis","context_page_description":"Lacinipolia patalis is een vlinder uit de familie van de uilen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1873 door Grote."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_FFH-Gebiete_im_Landkreis_Schwandorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Bild_Fluss_Schwarzach_Ort_Schwarzach.JPG","page_title":"Liste der FFH-Gebiete im Landkreis Schwandorf","context_page_description":"Die Liste der FFH-Gebiete im Landkreis Schwandorf zeigt die FFH-Gebiete des Oberpfälzer Landkreises Schwandorf in Bayern. Teilweise überschneiden sie sich mit bestehenden Natur– Landschaftsschutz- und EU-Vogelschutzgebieten.\\nIm Landkreis befinden sich 16 und zum Teil mit anderen Landkreisen überlappende FFH-Gebiete."},{"page_url":"https://en.wikipedia.org/wiki/Watertown_(city),_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Prelucrare_3D_pentru_Watertown_%28Details%29_-_New_York.jpg","page_title":"Watertown (city), New York","context_page_description":"Watertown is a city in the U.S. state of New York and the county seat of Jefferson County. It is situated approximately 25 miles south of the Thousand Islands, and along the Black River about 5 miles east of its mouth at Lake Ontario. It lies 180 miles northwest of Albany, the state capital, and 328 miles northwest of New York City. As of the 2010 census, it had a population of 27,023, an increase of 1.2% since 2000. The U.S. Army post Fort Drum is near the city.\\nNamed after the many falls on the Black River, the city developed early in the 19th century as an industrial and manufacturing center. From years of generating industrial wealth, by the early 20th century the city was said to have more millionaires per capita than any other city in the nation.\\nGeographically, Watertown is located in the central part of Jefferson County. It lies 70 miles north of Syracuse and 31 miles south of the Ontario border. The city is served by Watertown International Airport.\\nThe city claims to be the origin of the five and dime store and the safety pin, and it is the home of Little Trees air fresheners. It manufactured the first portable steam engine."},{"page_url":"https://es.wikipedia.org/wiki/Embalse_de_Poil%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Barragem_de_Poil%C3%A3o%2C_Santiago%2C_Cape_Verde.jpg","page_title":"Embalse de Poilão","context_page_description":"El embalse de Poilão es el primero construido en Cabo Verde, está situado en el municipio de Santa Cruz de la isla de Santiago. Está situado sobre la Ribeira Seca y es utilizado para la agricultura.\\nSe empezó a construir en diciembre de 2004 y se finalizó 18 meses más tarde en mayo de 2006. Fue construido gracias a las ayudas del gobierno chino. La presa tiene una altura de 26 metros y una anchura de 15 metros, en embalse alberga una capacidad de 1,7 hm³, y riega un total de 63 hectáreas.​"},{"page_url":"https://an.wikipedia.org/wiki/Diodo","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Diodo_pn-_Polarizaci%C3%B3n_inversa.png","page_title":"Diodo","context_page_description":"Un diodo ye un dispositivo electronico. O suyo funcionamento se basa en as valvulas de vueito, ya que premite o fluxo d'a corrient electrica en una dirección, pero la bloqueya en o sentito contrario.\\nDe forma simplificata, la curva caracteristica d'un diodo ye formata por dos rechions, por debant de cierta diferencia de potencial, se comporta como un cercuito ubierto, y por dezaga d'ista como un cercuito zarrato con una muit chicota resistencia electrica.\\nDebito a iste comportamiento, se lis gosa decir rectificadors, ya que son dispositivos capaces de convertir una corrient alterna en corrient contina."},{"page_url":"https://cs.wikipedia.org/wiki/Franti%C5%A1ek_Dost%C3%A1l_(fotograf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Frantisek_Dostal_img662_%284%29.jpg","page_title":"František Dostál (fotograf)","context_page_description":"František Dostál je současný český reportážní a dokumentární fotograf žijící v Praze. Jeho nejslavnějším souborem jsou Letní lidé, který vytvořil mezi roky 1968–1990 ve Zlenicích na řece Sázavě. Námětem jeho tvorby v posledních 30 letech jsou především lidé pražských ulic. Pro jeho dílo je typický jemný humor těžící z často absurdních setkání více nesourodých prvků na jednom obrazu."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%AD_%D8%B3%D9%86%DA%AF%DB%8C_%DA%AF%D9%88%D8%A2%D9%86%DA%AF_%DA%AF%D8%A7%D8%A6%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gwanggaeto_Stele.jpg","page_title":"لوح سنگی گوآنگ گائتو","context_page_description":"لوح سنگی گوآنگ گائتو یک سنگ یادبود تاریخی برای مقبره پادشاه گوآنگ گائتو بزرگ از سلسله گوگوریو است که توسط پسرش یانگسو در سال ۴۱۴ میلادی در Ji'an که در حال حاضر در مرز کره شمالی و چین کنار رودخانه یالو در استان جی‌لین واقع شده و بزرگترین مقبره حکاکی شده در جهان است ساخته شده‌است. در این لوح از فضایل پادشاه گوآنگ گائتو نام برده شده‌است. همچنین افسانه تأسیس گوگوریو برگرفته از لوح سنگی گوآنگ گائتو می‌باشد."},{"page_url":"https://pl.wikipedia.org/wiki/Alfred_Weber","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Weber_alfred_1868%E2%80%931958.jpg","page_title":"Alfred Weber","context_page_description":"Alfred Weber – niemiecki socjolog i teoretyk kultury, przedstawiciel tzw. socjologii historycznej, twórca teorii lokalizacji przemysłu.\\nW latach 1907–1933 oraz 1945–1958 profesor uniwersytetu w Heidelbergu.\\nBył bratem Maxa Webera."},{"page_url":"https://en.wikipedia.org/wiki/Euclidean_algorithm","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/24x60.svg","page_title":"Euclidean algorithm","context_page_description":"In mathematics, the Euclidean algorithm, or Euclid's algorithm, is an efficient method for computing the greatest common divisor of two integers, the largest number that divides them both without a remainder. It is named after the ancient Greek mathematician Euclid, who first described it in his Elements.\\nIt is an example of an algorithm, a step-by-step procedure for performing a calculation according to well-defined rules,\\nand is one of the oldest algorithms in common use. It can be used to reduce fractions to their simplest form, and is a part of many other number-theoretic and cryptographic calculations.\\nThe Euclidean algorithm is based on the principle that the greatest common divisor of two numbers does not change if the larger number is replaced by its difference with the smaller number. For example, 21 is the GCD of 252 and 105, and the same number 21 is also the GCD of 105 and 252 − 105 = 147. Since this replacement reduces the larger of the two numbers, repeating this process gives successively smaller pairs of numbers until the two numbers become equal. When that occurs, they are the GCD of the original two numbers."},{"page_url":"https://ca.wikipedia.org/wiki/52a_edici%C3%B3_dels_Premis_Sant_Jordi_de_Cinematografia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Alex_Brendem%C3%BChl_Photo_Call_Django_Berlinale_2017.jpg","page_title":"52a edició dels Premis Sant Jordi de Cinematografia","context_page_description":"La gala de la 52a edició dels Premis Sant Jordi de Cinematografia va tenir lloc el 21 d'abril de 2008 a la Sala Oval del Museu Nacional d'Art de Catalunya i fou presentat per María Casado Paredes i Toni Garrido. Com en anys anteriors, un jurat presidit per Conxita Casanova i compost per diversos crítics i periodistes cinematogràfics de Barcelona va decidir mitjançant votació els qui eren els destinataris dels premis Sant Jordi que Ràdio Nacional d'Espanya concedeix anualment al cinema espanyol i estranger en els diferents apartats competitius i que en aquesta edició distingien a les pel·lícules estrenades al llarg de l'any 2007. Aquest sistema d'elecció fa que aquests guardons estiguin considerats com un reconeixement de la crítica barcelonina, i a més és un dels premis cinematogràfics més antics de Catalunya. Fou retransmesa en directe per Ràdio 4 i dies més tard per televisió a La 2."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%DA%A4%D8%A7%D9%86_%D8%AC%D9%8A%D9%87._%D9%BE%D8%A7%D8%B1%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/IJPme.jpg","page_title":"ايڤان جيه. پارون","context_page_description":"ايڤان جيه. پارون رجل اعمال من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Sonamarg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sirbal_Sonamarg.jpg","page_title":"Sonamarg","context_page_description":"Sonamarg ist ein verstreut liegender kleiner Himalaya-Ort mit etwa 500 Einwohnern an der alten Seidenstraße im Distrikt Ganderbal im indischen Unionsterritorium Jammu und Kashmir. Der Ort wurde während der Britischen Kolonialzeit als Hill Station genutzt."},{"page_url":"https://en.wikipedia.org/wiki/Tata_Vasco_(opera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Palacio_de_bellas_artes_1.jpg","page_title":"Tata Vasco (opera)","context_page_description":"Tata Vasco is an opera in five scenes composed by Miguel Bernal Jiménez to a Spanish libretto with nationalistic and devoutly Roman Catholic themes by the Mexican priest and poet, Manuel Muñoz. It premiered in Pátzcuaro, Mexico on 15 February 1941. The opera is based on the life of Vasco de Quiroga, the first Bishop of Michoacán and known to the indigenous Purépecha of the region as 'Tata Vasco'. Considered one of Bernal Jiménez's most emblematic scores, the music incorporates native melodies, dances, and instruments as well as elements of Gregorian chant."},{"page_url":"https://tl.wikipedia.org/wiki/Wire","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Matt_Simms_sep_2013.jpg","page_title":"Wire","context_page_description":"Ang Wire ay isang English rock band, na nabuo sa London noong Oktubre 1976 nina Colin Newman, Graham Lewis, Bruce Gilbert at Robert Gotobed. Orihinal na nauugnay sila sa punk rock scene, na lumilitaw sa The Roxy London WC2 album, at kalaunan ay sentro ng pagbuo ng post-punk, habang ang kanilang debut album na Pink Flag ay nakaimpluwensya para sa hardcore punk.\\nAng Wire ay itinuturing na isang tumutukoy na art punk at post-punk band, dahil sa kanilang detalyadong detalyado at himpapawid na tunog at hindi nakakubli na mga tema ng liriko. Patuloy silang umunlad mula sa isang maagang istilo ng noise rock patungo sa isang mas kumplikado, nakabalangkas na tunog na kinasasangkutan ng pagtaas ng paggamit ng mga effects ng gitara at synthesizer. Ang banda ay nakakuha ng isang reputasyon para sa pag-eksperimento sa mga pag-aayos ng kanta sa buong karera nito."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BA%D0%B0-%D0%B4%D0%B0-%D0%9C%D0%B0%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Bandeira_Boca_da_Mata.jpg","page_title":"Бока-да-Мата","context_page_description":"Бока-да-Мата — муниципалитет в Бразилии, входит в штат Алагоас. Составная часть мезорегиона Восток штата Алагоас. Входит в экономико-статистический микрорегион Сан-Мигел-дус-Кампус. Население составляет 24 227 000 человек. Занимает площадь 186,57 км².\\nПраздник города — 11 ноября."},{"page_url":"https://pt.wikipedia.org/wiki/Ant%C3%ADlope-salta-rochas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Klipspringer.jpg","page_title":"Antílope-salta-rochas","context_page_description":"O cabrito-das-pedras ou conca é um pequeno antílope africano."},{"page_url":"https://ms.wikipedia.org/wiki/Antonius_dan_Cleopatra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Castro_Battle_of_Actium.jpg","page_title":"Antonius dan Cleopatra","context_page_description":"Antony and Cleopatra adalah sebuah kisah tragedi karya William Shakespeare. Drama ini mula-mula dicetak dalam First Folio 1623. Jalan cerita kisah ini didasarkan terjemahan Thomas North ke atas karya Bíoi Parállēloi Βίοι Παράλληλοι, \\"Kehidupan Slari\\" nukilan Plutarch yang mengikuti hubungan cinta antara Cleopatra dengan Marcus Antonius dari ketika pemberontakan Sicily hinggalah pembunuhan diri Cleopatra sewaktu Perang Terakhir Republik Rom. Antagonis utamanya ialah Octavius Caesar, iaitu rakan sejawat Antonius dan bakal Maharaja Rom yang pertama. Tragedi ini merupakan drama Rom yang bercirikan anjakan panorama dari segi latar tempat dan laras, berulang-alik antara Iskandariah yang mengghairahkan dan penuh khayalan dengan Rom yang lebih pragmatik dan susila.\\nPeranan Cleopatra dalam drama ini dianggap ramai sebagai antara watak perempuan yang paling kompleks dalam seluruh karya Shakespeare. Cleopatra sering bersikap angkuh dan dramatik hingga membuat penonton ingin mencemuhnya; pada masa yang sama, usaha-usaha Shakespeare melaburi Cleopatra dan Antonius dengan kemegahan tragis. Ciri-ciri yang bercanggahan ini telah menyebabkan ulasan kritis yang berbelah-bahagi."},{"page_url":"https://zh.wikipedia.org/wiki/1871%E5%B9%B412%E6%9C%8812%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/SE1871Dec12T.png","page_title":"1871年12月12日日食","context_page_description":"1871年12月12日日食为一次在协调世界时1871年12月12日出现的日全食。该次日食食分为1.0465，食甚维持4分23秒。"},{"page_url":"https://gl.wikipedia.org/wiki/Frauta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Manet%2C_Edouard_-_Young_Flautist%2C_or_The_Fifer%2C_1866_%282%29.jpg","page_title":"Frauta","context_page_description":"A frauta é un tipo de instrumento musical da familia dos Instrumentos de vento-madeira. A diferenza dos instrumentos de vento con palletas, unha frauta é un instrumento de vento que consta dun tubo cilíndrico que produce o seu son a partir do fluxo de aire, insuflado polo instrumentista, que entra a través dunha abertura ou bisel que vibra grazas ao contacto contra o bordo da embocadura. Segundo a clasificación de instrumentos musicais Hornbostel-Sachs atópase na categoría dos aerófonos, instrumentos que en si non vibran, e que non teñen cordas ou membranas que o fagan.\\nAo músico que toca a frauta adóitaselle chamar frautista."},{"page_url":"https://de.wikipedia.org/wiki/St._Hedwig_(Bielefeld)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/HEBI-Holzkreuz_St.Hedwig.jpg","page_title":"St. Hedwig (Bielefeld)","context_page_description":"St. Hedwig ist eine römisch-katholische Pfarrkirche in Bielefeld-Heepen, Nordrhein-Westfalen. Kirche und Gemeinde gehören zum Pastoralverbund Bielefeld-Ost im Dekanat Bielefeld-Lippe des Erzbistums Paderborn."},{"page_url":"https://pl.wikipedia.org/wiki/Zygmunt_Pukianiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/14_pp_-_w_15_lecie_niepodleg%C5%82o%C5%9Bci.jpg","page_title":"Zygmunt Pukianiec","context_page_description":"Zygmunt Pukianiec – doktor medycyny, major lekarz Wojska Polskiego II Rzeczypospolitej, naczelny lekarz garnizonu Włocławek."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BD%D0%B5%D0%BD%D1%84%D0%B5%D0%BB%D1%8C%D0%B4,_%D0%99%D0%BE%D1%81%D0%B5%D1%84_%D0%A5%D0%B0%D0%B8%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Yosef_Chaim_Sonnenfeld.jpg","page_title":"Зоненфельд, Йосеф Хаим","context_page_description":"Йосеф Хаим Зоненфельд — ультра-ортодоксальный ашкеназский общественный деятель и раввин Иерусалима. В 1920 вместе с равом Йерухамом Дискиным основал «Эда Харедит» и стал её первым гл. раввином."},{"page_url":"https://da.wikipedia.org/wiki/Jean_Rhys","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Jean_Rhys_%28left%2C_in_hat%29_with_Mollie_Stoner%2C_Velthams%2C_1970s_B.jpg","page_title":"Jean Rhys","context_page_description":"Jean Rhys er pseudonym for forfatteren Ella Gwendolen Rhys Williams. Hun udgav sine fire første romaner i 1920'erne og 1930'erne, men det var først med udgivelsen af Langt over havet i 1966, at hun fik sit gennembrud."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tels_particuliers_de_Toulouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pauilhac-1_%283%29.jpg","page_title":"Hôtels particuliers de Toulouse","context_page_description":"Toulouse, à la tête d'un vaste comté au Moyen Âge, puis capitale de la province de Languedoc jusqu'à la Révolution, a tout au long de son histoire compté parmi les principales villes de France. Centre de pouvoir, la ville a conservé jusqu'à nos jours de nombreux hôtels particuliers édifiés par ses élites : capitouls, marchands fortunés et noblesse de robe liée au Parlement de Toulouse notamment.\\nSi l'historiographie toulousaine met volontiers en avant un « siècle d'or » coïncidant avec la Renaissance et la fortune brassée par quelques grands négociants du pastel, ce sont cependant quelque deux cents hôtels particuliers ou vestiges d'hôtels particuliers qui rendent compte de l'évolution de l'architecture civile au fil des siècles dans une capitale provinciale qui ne suivit pas toujours les modèles nationaux.\\nCette page n'a pas pour objet de lister tous les hôtels particuliers de Toulouse, mais de répertorier les plus remarquables pouvant être intégrés dans une lecture de l'évolution de l'architecture privée toulousaine."},{"page_url":"https://en.wikipedia.org/wiki/Veregin","image_url":"https://upload.wikimedia.org/wikipedia/en/c/ce/The_Grand_Hall_in_Veregin_Saskatchewan.jpg","page_title":"Veregin","context_page_description":"Veregin is a special service area in Saskatchewan, Canada. It is located 50 kilometres northeast of Yorkton, and some 10 km to the west of Kamsack.\\nVeregin was incorporated as a village in 1912 and was named after Veregin Station, and misspelled by the railroad when it earlier built Veregin Siding in 1904, named after Peter V. Verigin. The Veregin railway station is served by Via Rail."},{"page_url":"https://jv.wikipedia.org/wiki/Piala_Donya_FIFA_1930","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Estadiocentenario.JPG","page_title":"Piala Donya FIFA 1930","context_page_description":"Piala Donya FIFA kang pisanan diadani taun 1930. Kajuwaraan iki diadani ing Uruguay, juwara Olimpiade wektu iku. Uruguay dadi juwara kang pisanan, ngalahaké Argentina ing babak final kanthi asil 4 – 2."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%AD%E3%83%B6%E6%89%80%E6%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/A_beach_in_Japan_%28Shimokita_Peninsula%29.jpg","page_title":"六ヶ所村","context_page_description":"六ヶ所村は、青森県の下北半島太平洋岸に位置する村である。\\n原子燃料サイクル施設などの原子力施設の他、国家石油備蓄基地や、やませを利用した風力発電基地等、エネルギー関連施設が集中している。ITERの建設候補地として誘致を推進していたが、カダラッシュに建設されることが決定した。"},{"page_url":"https://fr.wikipedia.org/wiki/Walter_Weideli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Walter_Weideli_%281988%29_by_Erling_Mandelmann.jpg","page_title":"Walter Weideli","context_page_description":"Walter Weideli, né le 16 juillet 1927 à Genève, est un journaliste, critique littéraire, traducteur et écrivain suisse."},{"page_url":"https://en.wikipedia.org/wiki/KDB_Darulaman","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/RIMPAC_2014_PHOTOEX_140725-N-FC670-2853.jpg","page_title":"KDB Darulaman","context_page_description":"KDB Darulaman is the third ship of the Darussalam-class offshore patrol vessels. The vessel is in active service in the Royal Brunei Navy."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],N={key:0},H={key:1}